	 (5,'Радость','2022-12-24-serdce-radost','2022-12-24','2022-12-25',NULL,NULL,'<p>Microcosmos Records представляет теплое и душевное событие, вечеринку с атмосферной музыкой<br>&nbsp;"РАДОСТЬ"<br>Мероприятие состоится с 24 на 25 декабря в Санкт-Петербурге&nbsp;<br>В уютном клубе "Сердце".<br><br>Вас ждет целая ночь красивой музыки, танцев, веселья, общения с интересными людьми, аудиовизуальное шоу и красочный перфоманс!</p><p>Если вы устали от серости бытия, постоянной суеты и тревог -<br>&nbsp;приходите отдохнуть душой и телом на наш праздник!<br>Мы всегда рады и старым, и новым друзьям!<br><br>Пора создавать Новогоднее Настроение!</p>',700,'',1,6,1,'https://rupor.biz/widgets/event-tickets/798','https://t.me/radostvserdce',false,false,NULL,NULL,'2022-12-15 15:49:58','2023-08-25 23:23:29',NULL,'','0',18,20),
	 (6,'ПСИХЪ''О''PARTY''Я VOL. XIII','2023-01-06-factory-psixieopartyia-vol-xiii','2023-01-06','2023-01-07','23:59:00','06:00:00','<p>TechnoCore с гордостью представляет! <br>ПЕРВЫЙ #HARDCORE #RAVE ГОДА! <br>День Рождения TechnoCore комьюнити и его лидера — Psycho-Dj!<br>Раздавать поздравления на двух танцполах клуба <a href="https://vk.com/factory3">Factory</a>: HardCore Stage и BreakCore Stage!</p>',500,'',1,7,1,'https://technocore.timepad.ru/event/2260319/','https://vk.com/techno_core',false,false,NULL,NULL,'2022-12-15 17:10:31','2023-09-10 01:42:57',NULL,'','0',18,7),
	 (7,'Psyber Tune','2023-01-28-factory-psyber-tune','2023-01-28',NULL,NULL,NULL,'<p>Специалистами исследовательского центра СПБК были пойманы сигналы&nbsp; с далёкой планеты&nbsp; киборгов.&nbsp;<br>Наша научная&nbsp; группа приняла рискованное решение - обнародовать полученный шифр. Вы избраны стать теми, кто первыми услышит их послание.<br>Воздействие его тонких вибраций&nbsp; не изучены.<br>Последствия&nbsp; непредсказуемы.<br>Тайна будет раскрыта 28 января!<br>Factory, СПб, Кожевенная л. 40Д<br><br>Самый свежий тюнинг человечьего разума по новейшему рецепту.<br>Become happy part of universe!<br>Стань счастливой деталью мироуниверсума!</p>',750,'',1,7,1,'https://spb.qtickets.events/57545-spbkpsyber-tuned','',false,false,NULL,NULL,'2022-12-15 17:18:12','2023-10-22 19:12:05',NULL,'','0',18,21),
	 (8,'Somatik Fest','2022-12-24-lastocka-somatik-fest','2022-12-24',NULL,NULL,NULL,'<p>Традиционный рождественский Соматик Фест. 90 bpm, флешмоб трехглазых и что-нибудь ещё.</p>',500,'',1,10,1,'https://band.link/smfest2412','https://vk.com/smfest2412',false,false,NULL,NULL,'2022-12-15 19:27:29','2023-10-22 22:33:12',NULL,'','0',18,43),
	 (9,'DarkXmass 2022','2022-12-25-darkxmass-2022','2022-12-25',NULL,'17:00:00',NULL,'<p>Jingle bells, jingle bells<br>Jingle all the way<br>Друзья! Совсем скоро по всей стране начнут сиять новогодние елки!<br>А мы, не избегая традиций, приглашаем вас на уже полюбившийся предновогодний DarkXmas!<br>Дед морозы и снегурочки, снежинки и снеговики! Мы ждем вас на заключительном в 2022 году большом Dark концерте! Приходите! Будем радоваться!</p>',800,'',2,15,1,'https://rupor.biz/widgets/event-tickets/796','',false,false,NULL,NULL,'2022-12-15 19:36:19','2023-10-16 18:13:05',NULL,'','0',18,24),
	 (10,'EMC w/Happy New Year','2023-01-04-emc-whappy-new-year','2023-01-04','2023-01-05',NULL,NULL,'',300,'',1,3,1,'https://rupor.biz/widgets/event-tickets/799','',false,false,NULL,NULL,'2022-12-15 19:48:43','2023-10-07 12:20:53',NULL,'','0',18,31),
	 (11,'Christmas EDM Night','2022-12-23-live-story-christmas-edm-night','2022-12-23',NULL,'23:30:00',NULL,'<p>В программе мероприятия:<br>- Уникальная непередаваемая атмосфера EDM вечеринки в уютном клубе на Таганке,<br>- Кальянная зона,<br>- Наши диджеи будут ставить всю ночь самые жаркие EDM хиты: Avicii, Don Diablo, Tiësto, Hardwell, Sandro Cavazza, Martin Garrix, Kygo, Marshmello, Alan Walker, David Guetta и других.<br><br>Приходи и наслаждайся любимой музыкой!<br><br>18+ (Вход строго по оригиналам документов)<br>Место проведения: Клуб "Live Story", Большой Дровяной пер. 8с1 (м. Таганская).</p>',300,'',2,16,1,'https://moscow.qtickets.events/55758-christmas-edm-night-2312-live-story','',false,false,NULL,NULL,'2022-12-15 20:29:00','2023-08-25 23:51:44',NULL,'','0',18,12);
