	 (12,'Shift','2022-12-23-mutabor-shift','2022-12-23','2022-12-24','22:00:00','08:00:00','<p>Поиск и исследование новых форм культурных событий на стыке экспериментальной электроники, глубокого техно грува, живой импровизации и аудиовизуальных технологий. Это синтез новых форматов взаимодействия и восприятия, вне привычных стилистических рамок и паттернов, симбиоз и синергия близких по духу культур, где особое внимание уделяется повышенной вовлеченности аудитории, глубокой проработке деталей, атмосфере, комфорту, и безопасности. Событие пройдёт на трёх сценах московского арт-центра Mutabor.</p>',1500,'',2,2,1,'https://shift.ticketscloud.org/','',false,false,NULL,NULL,'2022-12-15 20:41:10','2023-10-22 12:19:15',NULL,'','0',18,27),
