	 (13,'System 108 Label Night','2022-12-24-system-108-label-night','2022-12-24',NULL,NULL,NULL,'<p>Ночь лейбла System 108 всё ближе и ближе.&nbsp;<br>И сегодня пришло время презентовать вам второй пул артистов, в который вошли резиденты техно-альма-матер Monasterio в лице Trust True и Turboera, короли железных лайвов The Dawless и не нуждающиеся в представлении Arkadich и Mashkov.</p>',1400,'',2,17,1,'https://live.mts.ru/moscow/concerts/system-one-hundred-and-eight-konsert','',false,false,NULL,NULL,'2022-12-15 20:52:05','2023-09-27 19:37:37',NULL,'','0',18,9),
	 (14,'New Year Madness IV','2022-12-31-raver-new-year-madness-iv','2022-12-31','2022-12-01',NULL,NULL,'<p>По доброй сложившейся традиции, уже четвертый год подряд, в волшебную новогоднюю ночь случается маленькое чудо – вместе собираются одни из главных адептов электронной психоделической сцены, и делают эту ночь такой, чтобы ее не забыл никто. А еще все собравшиеся – добрые волшебники, которые делятся радостью с теми, кто ждет чуда больше всех!<br>И этот год не будет исключением. Кто не был – присоединяйтесь. Кто был – рады видеть снова.<br>До встречи на самой доброй пати столицы!<br>Как и всегда.<br><br></p>',750,'1000.0',2,18,1,'https://vk.com/topic-217580216_48956722','https://vk.com/nymadness4',false,false,NULL,NULL,'2022-12-15 21:19:41','2023-10-09 21:18:42',NULL,'','0',18,18),
	 (15,'Lift Me Up','2022-12-24-raver-lift-me-up','2022-12-24','2022-12-25','23:00:00','06:00:00','<p>Uplifting trance это та самая редкая музыка, которая не может надоесть. Её хочется слушать снова и снова, испытывать ощущение полёта, пропускать через себя все эти эмоции.<br>Ма собрали для вас комманду из разных уголков России, так что давайте встеримся все вместе в преддверии нового года, послушаем любимую музыку в компании настоящих друзей и отпразднуем день рождения талантливого диджея, продюсера, и нашего хорошего друга Alex Believe!</p>',300,'',2,18,1,'','',false,false,NULL,NULL,'2022-12-16 14:10:34','2023-10-12 17:43:16',NULL,'','0',18,8),
	 (16,'PanTheon','2022-12-24-deportment-pantheon','2022-12-24',NULL,'23:59:00',NULL,'',300,'500.0',1,19,1,'','',false,false,NULL,NULL,'2022-12-16 14:50:17','2023-09-07 10:07:11',NULL,'','0',18,19),
	 (17,'Dark Places','2023-02-16-dark-places','2023-02-16',NULL,NULL,NULL,'<p>Фестиваль тёмной Ambient музыки — Dark Places. Наше сознание — храм. И у каждого из нас есть свои тайны. Они терзают, погружают душу во тьму и не дают покоя, как мрачные коридоры забытых пространств. В этот вечер, мы постараемся изучить все уголки человеческой души и очистить разум с помощью магии музыки, а нашими проводниками в мир метаморфоз станут небезызвестные представители Ambient звучания России.</p>',800,'',2,20,1,'https://gotoparty.ru/event/view/10234','',false,false,NULL,NULL,'2022-12-16 15:08:29','2023-10-19 22:53:12',NULL,'','0',18,34),
	 (18,'Катэраг','2022-12-23-blank-katerag','2022-12-23',NULL,'23:00:00',NULL,'<p>Ты заводишь свой мотор это приказ<br>И танцуешь без меня ядерный джаз<br>Ты – машина, что не знает тепла<br>Но танцуя с тобой, я сгораю дотла&nbsp;<br><br>Наша финальная и самая масштабная вечеринка в этом году.<br>На мейне – интерпретация классического рейв-звучания в исполнении мастодонтов отечественной сцены и резидентов.&nbsp;<br>В гримерке – яркая селекция хауса, диско и электроники, подкрепленная вокальным лайвом.</p>',700,'',1,1,1,'','',false,false,NULL,NULL,'2022-12-16 15:36:27','2023-10-22 12:27:28',NULL,'','0',18,62),
	 (19,'Flash Back Trance Party','2023-01-06-artist-hall-flash-back-trance-party','2023-01-06',NULL,NULL,NULL,'<p>FREE SOUND LAB опираясь на музыку прошлых лет, так называемый Old school (старый добрый Goa Trance), игравший на танцполах страны с 1995 по 2015 год, организовывают мероприятие "FLASHBACK TRANCE PARTY", которое напомнит Вам о прошлом, в котором ВЫ были творцами будущего.</p>',1000,'2000.0',2,21,1,'','https://www.flashbacktranceparty.ru/',false,false,NULL,NULL,'2022-12-16 16:38:51','2023-09-30 03:02:59',NULL,'','0',18,32);
