	 (23,'ЧАРЫ','2023-02-25-tba-cary','2023-02-25',NULL,NULL,NULL,'<p>Мероприятие «Чары» пройдёт 25 февраля в Москве.<br>line up:<br>Summer Of Haze / † CΛIN † / Sibewest / △Sco△ / akiaura / Monokle / STS-51L / HOLOGRAPHIC Slavnayad / Iwilldiehere / UROBOROS / Ptichka Soe / Exidy / CROSSPARTY (dj-set) / Secret Guest<br><br>За репост + комментарий разыгрывается 10 билетов.<br><br>FC/ DC 18 + (Monochrome / Black / White)<br><br>Design &amp; VJ by Breakpoint.<br><br>Audio &amp; Visual Show, Illustrations.</p>',800,'',2,24,1,'https://vk.cc/cjgBDq','https://vk.com/charywh',false,false,NULL,NULL,'2022-12-16 17:32:07','2023-10-24 21:05:15',NULL,'','0',18,124),
	 (24,'Ave Eurodance','2023-01-27-lastocka-ave-eurodance','2023-01-07',NULL,'23:59:00',NULL,'<p>Новогодний кутёж отгремел, но это не значит что никакого праздника не будет. 😄<br><br>7 января клуб Ласточка запускает машину времени и перенесёт тебя в атмосферу европейских танцполов 90-х – с аутентичной музыкой, антуражной одеждой, духом свободы, беззаботности и характерного лоска!<br><br></p>',500,'',1,10,1,'','',false,false,NULL,NULL,'2022-12-19 14:05:21','2023-09-29 15:52:22',NULL,'','0',18,11),
	 (58,'Noir Bazaar','2022-12-24-powerhouse-noir-bazaar','2022-12-24',NULL,NULL,NULL,'<p>Последняя «домашняя» вечеринка от команды в этом году. Гостей ждет абсент–бар, фирменные настойки и диджей–сеты с перкуссионистами</p>',0,'',2,5,1,'','',false,false,NULL,NULL,'2022-12-21 20:05:20','2023-10-24 22:10:51',NULL,'','0',18,30),
	 (25,'Hedonism Techno x Midgard Rave','2022-12-31-pticia-licnost-hedonism-techno-x-midga','2022-12-31',NULL,NULL,NULL,'<p>Просвещение чуждых культур стилем, любовью и техно<br><br>31.12 произойдёт второе пришествие проекта “Hedonism” в более широком составе в компиляции с “Midgard Rave” на двух танцполах</p>',NULL,'',1,4,1,'','',false,false,NULL,NULL,'2022-12-19 14:11:47','2023-09-18 18:45:30',NULL,'','0',18,25),
	 (27,'Дикое Диско','2022-12-24-dikoe-disko','2022-12-24',NULL,NULL,NULL,'<p>Дикое Диско готовит Новогодний бал в большом концертном зале Аврора, даже не просто бал, а музыкальную церемонию. Любители винтажной поп-музыки коллективно выбирают лучшее из лучших.&nbsp;<br>Декораторы поколдуют над атмосферой, свет, звук, диско-шары — на высоте. На сцене танцы, перформансы и видео-представление.<br>По классике огромный мягкий чилл-аут с тихими, вдумчивыми и глубокими диджейскими выступлениями.<br>Фотографы, интервью, бесплатные фотокарточки из автомата на память…<br>Дресс-код — звёздные 80-е, широкие плечи, роскошные платья, пайетки, бархат и всё самое роскошное, потому что когда, если не сейчас.<br>Компании могут забронировать столик с видом на сцену или зал на всю ночь.&nbsp;<br><br>Золотой состав Дикого Диско плюс артисты чилла:&nbsp;<br>Яна Перовская, MINT TIGER, диджей Лёша, Свит Хард, Yosip, WowSophie, Аня Тимашева, Ivin.</p>',1700,'',1,25,1,'https://dikoe-disko.timepad.ru/event/2258138/','https://vk.com/discodikoe',false,false,NULL,NULL,'2022-12-19 20:18:12','2023-10-14 21:11:28',NULL,'','0',18,31),
	 (28,'М.А.Г. Birthday Party ','2022-12-23-kenkeseyspace-birthda-party','2022-12-23',NULL,NULL,NULL,'<p>Дамы и господа!<br>Вы видели где-нибудь этого человека? Может, на Systo? Кåстрах? Ином фестивале? Так или иначе, в KenKesey (https://t.me/kenkeseyspace) его знают, и хорошо! И у него будет День Рождения!<br>23 декабря Магистр Академии Грёз (позывной М.А.Г.) приглашает всех друзей на поезд кутежа: чествуем самого незабываемого фестивального сказочника Питера.<br><br>Что будет ждать тебя внутри с 20:00 и до утра:<br>★Традиционно вкусная еда и алкоголь от KenKesey.Space<br>&nbsp;(https://t.me/kenkeseyspace)★Тату-студия в лице natattoo (http://t.me/natalia_deriabina) и beetlejuice_art<br>&nbsp;(https://t.me/beetlejuice_art)★Сказки и другие кулстори от маэстро-именинника (https://t.me/Wizard1380)!<br>★Драка за пульт в 23:00! Диджеи, приносите свои флешки!&nbsp;<br>Вход - FREE DONATION</p>',0,'',1,13,1,'','',false,false,NULL,NULL,'2022-12-19 20:30:09','2023-10-23 19:10:51',NULL,'','0',18,59),
	 (29,'Новогодний Кен Кизи','2022-12-31-kenkeseyspace-novogodnii-ken-kizi','2022-12-31',NULL,'21:00:00',NULL,'<p>31 декабря автобус имени KenKesey.Space (https://t.me/kenkeseyspace) открывает свои двери для жаждущих кутить и незаметно для тебя провезёт к следующему году, полному новых страниц для твоей книги жизни. Готов ехать на фестиваль имени 2023? Тогда садись и занимай свободное место!<br>В автобусе будут ждать:<br>Месье Тайный Санта! Пускай никто не уйдёт с пустыми руками!<br>Конкурс костюмов! Победителя в голосовании будет ждать приятный сюрприз на баре.<br>УФ-аквагрим, покраска входит в стоимость билета.<br>Выставка картин! Можно принести свои картины.<br>В твой билет будет входить 3 любых напитка на баре.<br>Наши завсегдатаи-диджеи и secret guest будут играть для тебя нон-стоп до самого утра!</p>',1500,'',1,13,1,'','https://t.me/kenkeseyspace',false,false,NULL,NULL,'2022-12-19 20:43:02','2023-08-17 04:21:54',NULL,'','0',18,5);
