	 (31,'Клуб 13','2021-01-13-mutabor-klub-13','2023-01-13','2023-01-14','23:00:00','12:00:00','<p>Для абсолютного катарсиса мы собрали полное комбо знаков и примет: пятница 13, старый Новый год, 13 часов техно всех мастей и 13 участников в лайнапе.<br><br>Выделим главное: впервые на Черте с лайвом выступит UH – владелец лейбла NYPRA, из Минска снова приедет полюбившийся всем Niamiha, из Санкт-Петербурга – WHITE I, а из Новосибирска – orbwd и Dead Yucca.</p>',800,'',2,2,1,'https://cherta.qtickets.ru/event/57645?base_color=000000','',false,false,NULL,NULL,'2022-12-19 21:27:44','2023-10-06 17:54:10',NULL,'','0',18,5),
	 (32,'New Year Night','2022-12-31-new-year-night','2022-12-31',NULL,'22:00:00',NULL,'<p>Традиционное празднование Нового года от команд RNDM и Quintessence. Двенадцатичасовой лайн-ап с новогодними инсталляциями в камерной атмосфере.</p>',800,'',2,27,1,'https://newyear2023.ticketscloud.org/','',false,false,NULL,NULL,'2022-12-19 21:42:35','2023-09-19 03:38:12',639328,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,11),
	 (38,'Y E A H N Y E','2022-12-31-mutabor-y-e-a-h-n-y-e','2022-12-31','2023-01-02','22:00:00','08:00:00','<p>Новый год стремительно приближается. Снежная буря эмоций сметет все, чему не место в 2023-м. Время загадывать большие желания!<br>Праздничный уикенд продлится до понедельника 2 января. В продаже первые билеты. Резерв: +7 495 177-77-70<br>Dragoș Ilici в новогоднем лайнапе! В программе праздничной ночи на Медиуме — шоу Cabaret Alter под кураторством Жени Соболь. Активно встречают 2023 Теплица и Under.<br>1 января, с рассветом и замахом на следующую ночь, подключится Студия. Полный таймтейбл — до утра понедельника.<br><br><br></p>',2200,'',2,2,1,'https://mutabor.club/yeahnye/','https://mutabor.club/yeahnye/',false,false,NULL,NULL,'2022-12-19 23:35:21','2023-10-24 17:31:09',NULL,'','0',18,36),
