	 (33,'Basic Instinct','2023-01-01-basic-instinct','2023-01-01',NULL,NULL,NULL,'<p>C Наступающим! Рейверы!<br>Начинаем продажу ранних пташек, и открываем первую часть лайнапа, на мероприятие Основной Инстинкт, которое состоится 01 января 2023 г., на двух сценах, в новой для нас локации в Питере. Как и прежде особое внимание уделяем качеству звучания, организации пространства, где артисты находятся прямо в центре танцпола, и комфорту Гостей (тепло, гардероб и туалет - топ). Подробности в телеграм @lngrdsmena_bot в меню ИВЕНТЫ.<br><br>К нам в гости едет DRA MÄ. Харизматичный представитель новой волны французской Hard Techno сцены. Артист уже отметился релизами на следующих лейблах: EXPEL YOUR DEMONS, NORMATIVE, INNERGATE, EXCESS KOLLECTIVE, CHAINED VISION, VAST PERCEPTION, FLESH AND HAMMERS, SUB-TERRA и других, сделал ремикс на любимого нами MORSURE и примет участие в VA от ЛенСмены, который намечен на Февраль 2023 года. <br>Слушать артиста!</p>',500,'',1,NULL,1,'','https://vk.com/lngrdsmenarave',false,false,NULL,NULL,'2022-12-19 22:05:44','2023-10-22 16:53:42',NULL,'','0',18,34),
