	 (34,'We Are Psychedelic vol.2','2023-01-28-we-are-psychedelic-vol2','2023-01-28',NULL,'23:30:00',NULL,'<p>Отмечаем творческий юбилей проекта Protomusic — 20 лет на сцене. T.L.N. Promo приглашает вас на особый праздничный рейв. Мы соберемся вместе, чтобы поздравить нашего резидента, музыканта, диджея и просто хорошего друга с настоящим юбилеем — 20 лет на сцене. Этой ночью мы не только услышим особенный сет и новые треки от Protomusic, но и соберём всех друзей за одним диджейским пультом, чтобы устроить настоящую жару. В честь этого события, вход на мероприятие будет бесплатным. Но, вы можете отправить подарок нашему музыкальному юбиляру или купить VIP-билет.<br>Декор by Psymetrika<br>Visuals by Breakpoint<br><br>При поддержке Voices of Galaxy, Tortuga Company, Out Of Reality Group, Around Sound Сommunity</p>',800,'',2,28,1,'https://tlnpromo.com/anons/protomusic-20','https://tlnpromo.com/anons/protomusic-20',false,false,NULL,NULL,'2022-12-19 22:42:08','2023-10-11 09:05:51',638,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,9),
	 (35,'B-Day + НГ','2023-01-02-16-tonn-b-day-ng','2023-01-02',NULL,'23:50:00',NULL,'<p>Дамы и господа, в ночь со 2-го на 3-е января мы приглашаем всех любителей ломаных ритмов, друзей и постояльцев, знакомых и просто хороших людей на празднование самой яркой и теплой серии drum and bass мероприятий в Москве — Burning Series. Мероприятие традиционно состоится на главном танцполе клуба 16 Тонн на втором этаже! Сбор гостей на первом этаже на красной веранде клуба с 23:59 в ночь со 2-го на 3-е января, а двери на главный танцпол на втором этаже откроются для вечеринки в 00:30 и будут открыты до самого утра. Мы ждем вас! Отметим новый год и День Рождения Burning. Спасибо, что вы с нами уже более десяти лет. Встречаемся в Тоннах, увидимся на танцполе. И, кстати, уже ходят слухи о возвращении в Россию нашего резидента — легендарного MC V, возможно, он заглянет именно этой ночью.</p>',600,'',2,29,1,'https://moscow.qtickets.events/57431-burning-series-den-rozhdeniya-i-novogodnyaya-noch-drum-and-bass-muzyki-so-2-go-na-3-e-yanvarya','https://occulti.ru/burning-series/',false,false,NULL,NULL,'2022-12-19 22:52:32','2023-09-26 23:40:02',NULL,'','0',18,4);
