	 (36,'Посленовогодний бал-деж 3.0','2022-12-02-16-tonn-poslenovogodnii-bal-dez-30','2022-12-02',NULL,'23:00:00',NULL,'<p>Пространство готовит предновогодний сюрприз и эпическое начало года. Этот сюрприз, без преувеличения, самый неожиданный, и, одновременно, долгожданный ивент Space Music в Москве.</p>',900,'',2,30,1,'https://redkassa.ru/events/bilety_na_concert_poslenovogodniy_bal_dezh_3_0','',false,false,NULL,NULL,'2022-12-19 22:59:20','2023-09-19 04:29:33',NULL,'','0',18,37),
	 (37,'Кто подставил кролика Роджера?','2022-12-31-kto-podstavil-krolika-rodzera','2022-12-31',NULL,'22:00:00',NULL,'<p>Два амбициозных московских лейбла делают вечеринку в стиле всеми любимого фильма "Кто подставил кролика Роджера", чтобы эта шикарная ночь блеском туфлей и шелестом платьев по красной дороже вошла в вашу память на всю жизнь! Судите сами:<br>Вы встретите Новый год над облаками, на 90-м этаже в центре столицы, наблюдая красивейший Новогодний салют.<br>Диджеи с перформансом из живых инструментов будут удивлять вас 9 часов подряд.<br>Специально подготовленная шоу-программа с живым вокалом позволит вам оценить соединение нашей музыки и мировых хитов.<br>Аниматоры в костюмах героев из фильма и танцевальное girl-шоу будут развлекать гостей посреди специальных декораций, погружая всех в богемную атмосферу Голливуда 1947-го года.<br>Мероприятие рассчитано только на 300 человек, чтобы всем было комфортно, а продуманная расстановка столов позволит вашей компании забронировать лучшее место!<br><br>Дамы, готовьте шикарные платья.<br>Господа, начищайте туфли до блеска и доставайте подтяжки с запонками.<br>Воспоминаниями об этой ночи вы будете делиться с замиранием сердца!<br><br>FC | DC | 21+</p>',3990,'',2,31,1,'https://bassmaticrecords.com/','https://bassmaticrecords.com/',false,false,NULL,NULL,'2022-12-19 23:15:51','2023-09-27 17:55:56',NULL,'','0',18,42),
	 (56,'Последний Рейв','2022-12-24-poslednii-reiv','2022-12-24',NULL,'23:30:00',NULL,'<p>Команда @last_russian_rave объявила Последний Рейв (https://t.me/last_russian_rave), который действительно будет последним.<br><br>Последним в этом году! 24 декабря встречаемся в Ионотеке, чтобы вместе проводить 2022 год, погрузиться в звуки техно, забыться в атмосфере вечеринки и снова разнести танцпол.&nbsp;<br><br></p>',300,'',1,40,1,'','https://vk.com/last.russian.rave',false,false,NULL,NULL,'2022-12-21 18:31:00','2023-10-22 08:07:27',NULL,'','0',18,8),
	 (39,'Сказочное Бали','2022-12-31-skazocnoe-bali','2022-12-31',NULL,NULL,NULL,'<p>Радуга новогодняя во всей красе, с ёлкочкой и зайками под ней. <br>Зайки — это, конечно же, вы. И мы тоже зайки, да. <br>И вместе мы встретим НГ на Сказочном Бали. Танцполов будет не один, не три, а два! — рестораныч и рэйвуля. <br>Первый откроется в 21:00, и здесь&nbsp; можно будет встретить НГ за столом, слушая волшебные песни Мирель и локал варм ап диджеев, а второй — стартанёт сразу после полуночи.</p>',3000,'',2,32,1,'https://live.mts.ru/moscow/concerts/skazochnoe-bali','',false,false,NULL,NULL,'2022-12-19 23:45:28','2023-10-24 21:19:53',NULL,'','0',18,33),
	 (40,'Neuropunk Session','2022-12-23-factory-neuropunk-session','2022-12-23',NULL,NULL,NULL,'<p>Neuropunk Session от промо-группы&nbsp; Dark Session Сrew. Пройдет в&nbsp; новом мультиформатном концертном зале Factory № 3 в Санкт-Петербурге, расположенный на территории культурного пространства Севкабель Порт в историческом здании завода.</p>',900,'',1,7,1,'https://gotoparty.ru/event/view/10283','',false,false,NULL,NULL,'2022-12-19 23:54:54','2023-09-18 12:03:17',NULL,'','0',18,41),
	 (41,'Kontrkult Open New Year','2022-12-31-kontrkult-open-new-year','2022-12-31','2023-01-01','21:00:00','11:00:00','<p>2023 уже наступает на пятки последней декады года. Вместе с зимними вьюгами возвращается наш общий дом — арт-пространство Контркульт. &nbsp;<br>Теперь у нас есть чёрный двухэтажный домик, первый этаж которого мы торжественно откроем 31 декабря.<br><br>К 21:00 ждём всех, кто не нашёл местечка для празднования в полночь. Традиционно украсим елочку, покушаем салатики, потанцуем под лёгкую жизнерадостную музыку.<br>В полночь разольём шампанское за счёт заведения, чокнемся под бой курантов и начнём проводить время в лучших традициях нашей площадки (понесёмся как ужаленные)<br>Веселиться и радоваться жизни обязательно со всей силы, ведь как Новый год встретишь, так его и проведёшь🎄🐇<br><br>И приятного: теперь помимо зала для танцев внутри будут уютные места для отдыха и общения, расширенное барное меню, лавка с угощениями и приятными глазу (и уху) штучками, более комфортабельные места общего пользования.&nbsp;</p>',500,'',1,NULL,1,'','',false,false,NULL,NULL,'2022-12-20 00:22:09','2023-09-18 21:23:44',NULL,'','0',18,20),
	 (42,'△ека▽ance','2022-12-23-ekaance','2022-12-23','2022-12-24','22:00:00','05:00:00','<p>△ека▽ance — комьюнити, вобравшее в себя атмосферу техно вечеринок, перформансы и арт-инсталляции.<br><br>В пятницу 23 декабря △ека▽ance представит аудио-визуальный техно-перформанс "Время", выполненный в стиле современного арт-хауса.&nbsp;<br>За музыкальное наполнение пространства отвечают: Lowchord и Etrigan (b2b - Manifest), Julia Karma, Dima Studitsky, Alex River ( spb ), XTONЬ, Denis Kudla, Stepan Borin.&nbsp;<br><br>Художественная часть воплотится талантом двух замечательных художниц: Даши Буравцевой и Кристины Породзинской. Во время выступления диджеев они раскроют основную тему ивента на холсте и телах моделей.</p>',500,'',2,NULL,1,'https://moscow.qtickets.events/57316-dekadance','',false,false,NULL,NULL,'2022-12-20 00:34:18','2023-10-16 15:46:46',NULL,'','0',18,11),
	 (43,'OUTLOW','2022-12-24-16-tonn-outlow','2022-12-24',NULL,NULL,NULL,'<p>OUTLAW — серия столичных Bass вечеринок от творческого объединения российских хаус-продюсеров, сплотившихся вокруг темного и стильного звучания. Визуальная и атмосферная эстетика является отличительной чертой самих вечеринок.</p>',500,'',2,29,1,'https://moscow.qtickets.events/56655-outlaw','https://vk.com/outlaw.event',false,false,NULL,NULL,'2022-12-20 06:05:41','2023-09-18 15:20:49',NULL,'','0',18,7),
	 (44,'POSTANOVKA APPLIQUE','2022-12-24-gazgolder-postanovka-applique','2022-12-24',NULL,'23:00:00',NULL,'<p>Целая вечность прошла с нашей последней вечеринки. За это время мы успели вскипятить воду танцующих фонтанов ОАЭ и разбросать пад-тай по танцполам Азии. Признавайтесь, кто из вас прошёл все уровни марафона желаний и загадал Applique в канун новогодних?</p><p>Мы очень соскучились и помимо традиционных сказочных инсталляций, фонариков и красивых диджеев, подготовили для каждого из вас орешек с предсказанием, а значит всех нас ждет радость, вкусные коктейли, бутылка минералки утром у кровати и сто бессонных ночей на танцполе с нами.</p><p>Не прощёлкай! Билеты на самую сказочную постановку года, без очередей и перекупов. Мы ни на что на намекаем, но если ты Король Мышей, фея Драже или Принц Коклюш – вход бесплатный</p><p>Главный итог года – несмотря ни на что мы снова вместе в родных стенах клуба Газгольдер.</p>',1500,'',2,35,1,'https://kudago.com/msk/event/vecherinka-gazgolder-new-year/#ticketscloud_popup_com-content','',false,false,NULL,NULL,'2022-12-20 06:20:18','2023-09-28 12:28:08',NULL,'','0',18,9),
	 (57,'Haps tattoo x 10 by ten party','2022-12-24-10-by-ten-bar-haps-tattoo-x-10-by-ten-p','2022-12-24',NULL,NULL,NULL,'<p>Cовместная вечеринка тату-студии и бара на Маросейке 15.&nbsp; Весь вечер мастера из Haps будут набивать татуировки всем желающим по самым приятным ценам. В программе: фирменные коктейли и закуски по специальной цене, розыгрыш сертификатов в Haps Tatoo и в 10 by Ten и диджей-сеты<br><br></p>',0,'',2,39,1,'','',false,false,NULL,NULL,'2022-12-21 19:48:01','2023-09-14 05:37:14',NULL,'','0',18,6);
