	 (45,'НГ в стиле Drum and Bass','2022-12-31-live-story-ng-v-stile-drum-and-bass','2022-12-31','2023-01-01','22:00:00','08:00:00','<p>GMB PROMO Представляет!</p><p>Осталось совсем немного до конца 2022 года, мы приглашаем вас присоединиться к нашему празднику, чтобы задать правильный тон и настроение на весь год вперед!</p><p>Что будет: будет, как ни странно, Новый Год со всем антуражем. Ну и, конечно, звук, свет, в этот раз клуб Live Story, все многообразие Drum and Bass и немного Hardcore музыки, праздничное настроение – особенно если его привнесете и вы вместе с организаторами и артистами!</p><p>Новогодние образы, поздравления и подарки тем, кому вы хотите их подарить – приветствуются, но не обязательны.</p>',500,'700.0',2,16,1,'https://www.afisha.ru/concert/2157350/?utm_source=admitad&utm_medium=cpa&utm_campaign=353356&utm_content=8149c9089bdcde8a408ca99c81899e41','https://vk.com/bass_attack_gmb',false,false,NULL,NULL,'2022-12-20 06:38:13','2023-10-23 03:41:48',63726,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,22),
