	 (251,'Sanchez Thursdays','2023-01-26-propaganda-sanchez-thursdays','2023-01-26',NULL,'23:55:00',NULL,'<p>Традиционные четверги Санчеза в «Пропаганде». <br>На всю грядущую ночь диджейскую стойку займут Max Grabke и Sapurra.</p>',0,'',2,101,1,'','',false,false,NULL,NULL,'2023-01-26 14:26:15','2023-01-26 14:26:15',NULL,'','0',18,0),
	 (47,'Samovar','2023-01-04-gazgolder-samovar','2023-01-04',NULL,'23:00:00',NULL,'<p>Первая встреча в новом году и большие планы на мейн в Газе.&nbsp;<br>Вайб - свойский, бит - хлесткий, состав - проверенный и уверенный. В этот раз присоединятся Pasha Sigmatic и Denis Koorablev. Эти парни знают, как порадовать танцпол в любое время ночи и утра, ждём жирную порцию хауса, минимала и другой электроники. Как обычно, в деле резиденты Самовата и друзья лейбла.</p>',1000,'',2,35,1,'https://samovar0401.ticketscloud.org/','https://vk.com/samovar005',false,false,NULL,NULL,'2022-12-20 07:02:49','2023-10-14 00:50:18',NULL,'','0',18,26),
	 (48,'РОЖДЕСТВО В ГАЗГОЛЬДЕРЕ','2022-01-06-gazgolder-rozdestvo-v-gazgoldere','2023-01-06',NULL,NULL,NULL,'',1500,'',2,35,1,'https://moscow.qtickets.events/57557-rozhdestvo-v-gazgoldere','https://highwayevent.ru/',false,false,NULL,NULL,'2022-12-20 07:14:44','2023-08-17 04:18:56',NULL,'','0',18,3),
	 (49,'Новогоднее Слияние','2022-12-31-pravda-novogodnee-sliianie','2022-12-31',NULL,NULL,NULL,'<p>Приглашаем любителей качественной танцевальной электроники на ежегодное празднование Нового 2023 года!</p><p>Концепция – гармоничное сочетание современных искусств: музыки, видео и театра</p><p>По сложившейся традиции мы готовим для вас вкусный line-up, кристальный звук и завораживающие визуализации!</p><p>Transdriver | Sulima | Nicr | Indracarana | Eq tunkul | Hyperspective</p><p>Звук L-Acoustics | Лазерное шоу | Светодиодные перфомансы</p><p>Праздничные декорации | Поздравление Президента</p>',1800,'',2,20,1,'https://dfusionfest.ru/?utm_campaign=clubsite','https://www.clubpravda.ru',false,false,NULL,NULL,'2022-12-20 07:22:01','2023-09-18 18:51:47',638,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,17),
	 (50,' VOID XMAS Fest','2022-01-06-void-xmas-fest','2022-01-06','2022-12-07','21:00:00','06:00:00','<p>Новогодний фестиваль электронной музыки VOID XMAS Fest. состоится 6 января в Известия Hall.</p>',300,'',2,43,1,'https://vk.com/void.fest?w=app5732604_-205980704','https://vk.com/void.fest',false,false,NULL,NULL,'2022-12-20 07:33:45','2023-10-10 05:03:37',NULL,'','0',18,10),
	 (51,'SENSES II','2022-02-03-mutabor-senses-ii','2023-02-03',NULL,'23:50:00',NULL,'<p>От любви и умиротворения лайва Kedr Livanskiy до ненависти и холода сета Fatal-M – почти весь спектр чувств будет возможно испытать за одну ночь на фестивале SENSES в пространстве Mutabor.<br><br></p>',1200,'',2,2,1,'https://msk.kassir.ru/koncert/klub-mutabor/senses-ii_2023-02-03?admitad_uid=77dc0c110fb2073b89b65a070caff44e&utm_source=admitad&utm_campaign=353356&utm_content=77dc0c110fb2073b89b65a070caff44e&utm_medium=cpa','',false,false,NULL,NULL,'2022-12-20 07:42:57','2023-10-22 16:55:59',NULL,'','0',18,57),
	 (52,'НОВЫЙ ГОД В БЛАНКЕ','2022-12-31-mutabor-novyi-god-v-blanke','2022-12-31',NULL,'21:00:00',NULL,'<p>Начало в 21.00<br>Вход:<br>21.00 - 22.00 FC / вход бесплатный с предварительной регистрацией<br>22.00 - 06.00 FC / 21+ / вход по билетам<br>C картами Highway Family вход свободный.<br><br>Резерв столов 8 (977) 829-32-00</p>',2000,'',2,36,1,'https://moscow.qtickets.events/57556-novyy-god-v-blanke','https://highwayevent.ru/',false,false,NULL,NULL,'2022-12-20 07:58:56','2023-08-25 23:18:23',NULL,'','0',18,9);
