	 (53,'Another Saturday','2022-12-24-another-saturday','2022-12-24',NULL,'23:00:00',NULL,'<p>Кутёж Classic</p><p>Танцпол с барным депозитом 2 500₽. Цена — 2 000₽. 500₽ — бонус от клуба.</p>',2000,'',2,37,1,'https://bargipsy.com/another-saturday-24122022','https://bargipsy.com/',false,false,NULL,NULL,'2022-12-20 08:07:47','2023-10-14 12:48:29',NULL,'','0',18,64),
	 (54,'Jungle Planet Festival V','2022-12-24-dk-kristall-jungle-planet-festival-v','2022-12-24',NULL,NULL,NULL,'<p>В этот раз мы решили собрать для Вас убойный состав отечественных Артистов, которые двигают нашу Джангл Планету и наполняют её ломаными ритмами и отменным вайбом! Вас ждёт неукротимый JUNGLE и DRUM&amp;BASS саунд, огненные панчлайны от MC, мощный звук и световое шоу!</p>',800,'',2,28,1,'https://gotoparty.ru/event/view/10298','',false,false,NULL,NULL,'2022-12-20 08:27:16','2023-09-28 03:07:39',NULL,'','0',18,9),
	 (55,'Ethno Che','2022-12-07-ethno-che','2023-01-21',NULL,NULL,NULL,'<p>Друзья, праздник на связи!<br>В рождественскую ночь, полную чудес и красоты, мы отправимся в звуковое путешествие по волнам электронной музыки. Изысканные интерьеры «Будда-бара», пожалуй, самого стильного заведения северной столицы, наполнят это путешествие красотой и неповторимой атмосферой.<br><br>Проводниками в мистерию звука в эту ночь станут:<br>Покров Этно — по-настоящему народный и русский современный проект с сибирскими корнями, в содержании смыслов которого царит дух корневого русского знания и немного мистического сказочного, в звучании — транс и техно в обрамлении завораживающего вокала Маши Покровской. Живой концерт откроет вечеринку!<br><br>Далее — Танцы! Всё, как мы любим!<br><br>Auratech — проект Артёма Новизнова продолжит праздник специальной рождественской программой, подхватит нас в танце современным и своевременным psytrance-звучанием и доставит счастливыми в следующий звуковой поток.<br><br>Dj Synergia — светлая эльфийская шаманка, мастер глубокого сакрального баса и магического чиллаута, её диджей сеты традиционно качают танцпол, под её руками волшебные мелодии, этнические напевы и мощный бас смешиваются в загадочные звуковые истории и погружают слушателей в древний племенной танец.<br><br>Popperhnool — это российский проект в необычном жанре электронной музыки, который можно обозначить как фанки и психоделик диско! Проект был создан автором небезызвестного транс проекта Transdriver, однако имел совершенно другую стилистическую направленность. PopperHnool представляет собой тонкую связь между звучанием прошлого и современным синтезом звука.<br><br>Stas Afro — основатель лейбла Mudra Music, настоящий Мастер Звука и Маг танцпола с очаровательной улыбкой и профилем воина из древних эпосов подготовил для вас специальный Рождественский сет — сочетание переплетений глубокого пси-баса и бодрых этно-ритмов. И поверьте, этот парень знает, как унести вас в пляс.<br><br>Spuge User — проект Александра Ярославцева (основатель и лейбл диджей Soundkitchen Records, соорганизатор ключевых фестивалей электронной музыки Nataraja/Непал, Systo/Санкт-Петербург, Турслёт/Москва, Sun Spirit/Крым), душевный и очень... финский транс — это полёт Сердца и Чистая Энергия здесь и сейчас.<br><br>Надевайте свои самые красивые этно-наряды, берите с собой хорошее настроение и сердечное тепло, и пусть наши улыбки и танцы раскрасят эту ночь яркими красками и сделают незабываемой!<br><br>До встречи!</p>',1333,'',1,38,1,'https://ethnoche.com/','https://ethnoche.com/',false,false,NULL,NULL,'2022-12-20 21:23:10','2023-10-01 20:37:08',NULL,'','0',18,10),
	 (96,'Darkness Rises XIII','2023-01-13-factory-darkness-rises-xiii','2023-01-13','2022-12-14','23:50:00','06:00:00','<p>2й по счету фестиваль разных направлений электронной музыки, отличающейся своим мощным и темным звучанием и объединенных общей идеей погружения слушателя в иную реальность по дорожкам звуковых волн и ритмам сердца, поможет перенестись сквозь индустриальный лес в загадочный темный мир, в котором каждый сможет увидеть близкое себе по духу отражение</p>',720,'',1,7,1,'https://gotoparty.ru/event/view/10351','',false,false,NULL,NULL,'2022-12-30 08:05:29','2023-10-21 05:12:19',NULL,'','0',18,26),
	 (59,'Континуум 3 года','2022-12-24-stakensnaider-kontinuum-3-goda','2022-12-24',NULL,NULL,NULL,'<p>В ночь с 24 на 25 декабря отмечаем трехлетие вечеринок Континуум. Как и всегда мы собрали интересный лайн-ап, охватывающий разные стороны экспериментальной бэйс-музыки.<br><br>К нашим резидентам присоединятся специальные гости: продюсер с мировым именем, недавно выпустивший (вместе с Subwave) новый альбом «Renaissance» (https://bopxsubwave.ffm.to/renaissance.GCN) на британском Hospital Records – Bop, диджей и куратор московского проекта Judder (https://www.instagram.com/judder_bass_music/) – Stace Bam и резидент петербургского лейбла Fat Vibez (https://t.me/fatvibezrecords) – Blasta.</p>',400,'',1,3,1,'https://spb.qtickets.events/57800-kontinuum-3-goda','',false,false,NULL,NULL,'2022-12-21 20:22:03','2023-10-24 17:30:34',NULL,'','0',18,8),
	 (60,'Vibe Room','2022-12-24-union-vibe-room','2022-12-24',NULL,NULL,NULL,'<p>Vibe Room в 2022 году — американские горки. Релокейты резидентов, появление новых имен, эксперименты с форматами мероприятий и музыкальным наполнением. Перемены неизбежны, однако мы старались обновляться максимально безболезненно, чтобы сохранить традиционный для Vibe Room звук и атмосферу. Говоря о традициях, закрытие года шумной вечеринкой в Ю — одна из них.<br><br>Праздничный лайн-ап представлен большой солянкой диджеев: помимо бессменных резидентов Denis Yuzhin, Coubraque и Artemii Korzh, тут и фрешмены наших вечеринок Izabelle, Lapina, Middle и Startuem, и близкие друзья и коллеги по цеху 5DM и Brique, а также ответственные за электронные танцполы на Vibe Room Idelson и Auxfella.</p>',NULL,'300.0',1,8,1,'','https://t.me/viberoom_spb',false,false,NULL,NULL,'2022-12-21 21:55:28','2023-10-25 05:02:17',NULL,'','0',18,23),
	 (61,'Christmas Acid Jam','2022-12-26-union-christmas-acid-jam','2022-12-26',NULL,'20:00:00',NULL,'<p>Традиционный сочельник от Electric Kool-Aid Acid Jam. Любимые рождественские песни в стилях фанк, хип-хоп и соул. За пультом Sko, вход FREE.</p>',0,'',1,8,1,'','https://vk.com/coolacidjam',false,false,NULL,NULL,'2022-12-21 23:56:02','2023-10-20 11:55:50',NULL,'','0',18,9),
	 (62,'Street Shaker','2022-12-25-union-street-shaker','2022-12-25',NULL,'20:00:00',NULL,'',NULL,'',1,8,1,'','http://unionbar.ru/',false,false,NULL,NULL,'2022-12-22 00:50:09','2023-08-25 23:50:38',NULL,'','0',18,2),
	 (63,'Taste of Deep History','2022-12-24-ambar-taste-of-deep-history','2022-12-24',NULL,NULL,NULL,'<p>Мы решили готовиться к новогодним праздникам заранее, и в ночь с 24 на 25 декабря в Амбаре пройдёт встреча с нашими друзьями из LIVE HISTORY и 2DEEP DNB!<br>Начнём провожать старый год, верить в лучшее, веселиться и, конечно, танцевать, ведь пластинки всю ночь будут ставить:<br><br>• Flegmatikk<br>• Zhar<br>• Marcus<br>• Capital Dogz<br>• Anman<br>• DubSpace Lion<br><br>Это та самая вечеринка, с которой всё началось!<br>Авторские настойки и бесплатный вход!<br><br></p>',0,'',1,41,1,'','https://vk.com/wall-217852123_2',false,false,NULL,NULL,'2022-12-22 01:21:10','2023-10-22 09:38:57',NULL,'','0',18,15),
	 (64,'New Year Carnaval at Freedom','2022-12-31-new-year-carnaval-at-freedom','2022-12-31',NULL,NULL,NULL,'<p>В стиле ревущих 20-х в роскошном дворце в центре города - NEW YEAR KARNAVAL AT FREEDOM! Именно так мы предлагаем вам встретить 2023 год!<br><br>"NEW YEAR KARNAVAL" - совместный проект промо-группами Funk You! &amp; Ancient Future Team и пространства FREEDOM<br><br>20-е - это чарующая атмосфера свободы и любви. Это блеск, шарм, элегантность и изысканность. Реки шампанского, роскошные наряды и зажигательные танцы. Безудержное и беззаботное веселье, на которое иногда спускали целые состояния!<br><br>Искристый шарм 20-х создадим посредством:<br><br>- Фанка, джаза, диско и другой заводной музыки<br>- 2 танцпола<br>- Эксцентричная шоу-программа<br>- Фотозона<br>- Фуршет<br>- Чиллаут с гамаками<br>- Дворцовая атмосфера</p>',2500,'',1,42,1,'https://k7.su/event/karnaval3112','https://vk.com/event212093528',false,false,NULL,NULL,'2022-12-22 01:41:51','2023-10-23 02:50:47',6352,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,12);
