	 (65,'Шаманика','2022-12-23-lastocka-samanika','2022-12-23',NULL,'20:00:00',NULL,'<p>Сольный концерт Шаманика.<br><br>Шаманика - братство истинных адептов электронного танцевального фолка, замешанного на Drum&amp;Bass.<br><br>При поддержке нового проекта<br>Чёрный Знахарь - музыка, которого словно саундтрек к фэнтези фильму которого нет, но до боли знакомого.</p>',600,'',1,10,2,'https://spb.qtickets.events/56747-2312-shamanika-v-lastochke-spb','https://vk.com/schamanikaparty',false,false,NULL,NULL,'2022-12-22 19:36:22','2023-10-24 21:04:22',NULL,'','0',18,30),
	 (184,'STREET CREDIT','2023-01-20-griboedov-street-credit','2023-01-20',NULL,'00:00:00',NULL,'<p>STREET CREDIT — это валюта улиц, которая зарабатывается впечатляющими и смелыми поступками.&nbsp;<br>Чем больше у вас полезных действий, тем вы круче.<br>Улицы помнят — улицы знают.<br>Затягивайте ремни потуже, а мы расскажем, как заработать кредит улиц.<br><br>Вход:<br>400 — с репостом.<br>600 — без внимания к мероприятию.</p>',400,'',1,86,1,'','https://t.me/griboedovbasement/2100',false,false,NULL,NULL,'2023-01-18 14:06:21','2023-09-28 12:29:15',NULL,'','0',18,36),
	 (67,'Убийцы Crystal','2022-12-24-ionoteka-ubiicy-crystal','2022-12-24',NULL,NULL,NULL,'<p>24 декабря - особенное Рождество с группой УБИЙЦЫ CRYSTAL! Все лучшие хиты и материал с последних релизов! Вы узнаете почему грядущий альбом будет последним и почему это возможно один из немногих концертов, которые вообще возможны в наше непростое время!<br><br>Герои андеграундных рейвов 10-х, группа Убийцы Crystal продолжают нести своё электрическое шаманство по просторам России. Безнадёжное веселье сквозь слёзы и убийственно-задорный бит настоящего русского электро-клэша! Если ты веган и тебе порою не хочется жить - эти треки для тебя!</p>',700,'',1,40,1,'https://spb.qtickets.events/55438-ubiytsy-crystal-rozhdestvo-2412-ionoteka','https://vk.com/ubiyzy_24_12',false,false,NULL,NULL,'2022-12-22 20:16:23','2023-10-04 01:39:22',NULL,'','0',18,22),
	 (68,'Зимняя Сказка','2022-12-24-krysa-18-zimniaia-skazka','2022-12-24',NULL,NULL,NULL,'<p>Итак, вы все этого ждали: наша ежегодная супер вечеринка Зимняя Сказка (та самая со снегом:)!<br>24 декабря 2022 года!<br>В 23.30<br><br>DR.SPY.DER<br>NADYA [RU]<br>EGOR b2b MIRIDA<br>ARTSKY</p>',1378,'',1,45,1,'https://spb.qtickets.events/55660-zimnyaya-skazka22','',false,false,NULL,NULL,'2022-12-22 20:25:52','2023-09-18 19:10:02',NULL,'','0',18,19),
	 (69,'Fizica','2022-12-23-serdce-fizica','2022-12-23',NULL,NULL,NULL,'<p>Добро пожаловать на специальный новогодний концерт FIZICA и артистов лейбла Burn Music House! Вас ждут новогоднее настроение, хороший юмор и несколько часов мощнейших треков SOBOLIHA, AHSHEVA, Bistrovi, VENERA, IMANKA, PONOMORE и других. И, конечно же, много FIZICA - больше, чем когда-либо! Отметим Новый Год в кругу нашей большой музыкальной семьи. Вместе!<br><br>Рекомендуемый дресс-код:<br>- вечерний костюм (мужчины - смокинг, рубашка, неспортивные штаны; женщины - вечерние / коктейльные платья)<br>- тематический маскарад по мотивам песен FIZICA и артистов лейбла</p>',1200,'',1,6,1,'https://spb.qtickets.events/53733-novogodniy-kontsert-fizica-i-artistov-leybla-burn-music-house','https://fizica.ru/rus',false,false,NULL,NULL,'2022-12-22 20:32:00','2023-09-28 05:00:07',NULL,'','0',18,21),
	 (70,'Zagi Bock','2022-12-25-ionoteka-zagi-bock','2022-12-25',NULL,'19:00:00',NULL,'<p>Заги Бок. Ионотека. Это андеграунд, детка!)</p>',600,'',1,40,1,'https://spb.qtickets.events/55751-zagi-bok-2512-spb-ionoteka','https://vk.com/zagibok_partyspb',false,false,NULL,NULL,'2022-12-22 20:51:59','2023-10-10 23:01:11',NULL,'','0',18,19),
	 (71,'Родительское собрание','2022-12-23-prostranstvo-pole-roditelskoe-sobranie','2022-12-23',NULL,NULL,NULL,'<p>В пятницу итоги года с b2b сетами будут подводить: один из первых техно диджеев России, резидент культового питерского клуба «Тоннель» Dj Slon с резидентом лейбла ГОСТ Звук Flaty; селектор и резидент Arma17 Ranishe Niyaak поделит диджейку с членом команды Underdog Bogdamn; резидент вечеринок Минимум, Joy Hipushit отыграет с резиденткой Поля Masha Volum; участник лейбла Heisenberg продюсер Sapurra с молодым дарованием Skunk York; а также группа «Вещь» после выхода нового альбома «Очередь»</p>',800,'',2,46,1,'https://polye.timepad.ru/event/2275207/','',false,false,NULL,NULL,'2022-12-22 23:04:06','2023-10-23 15:06:17',NULL,'','0',18,217),
	 (72,'M’n’mum','2022-12-23-stakensnaider-mnmum','2022-12-23',NULL,NULL,NULL,'<p>В конец года сообщество Dance Music Testing вновь собирает железных представителей Петербурга.<br><br>DMT Electronics - сообщество единомышленников, объединённых любовью к музыке и свободе. Искренность перед собой и перед слушателем, поиск индивидуального звучания, вне рамок и стилистических жанров, развитие локальной live сцены - это основные принципы объединения.<br>Dance Music Testing всегда открыт для тех, кто выбирает путь любви к музыке и готовности к новому опыту и экспериментам.<br><br>Cash Only</p>',500,'',1,3,1,'','',false,false,NULL,NULL,'2022-12-22 23:40:33','2023-09-18 06:25:19',NULL,'','0',18,5),
	 (73,'Ghetto','2022-12-28-factory-ghetto','2022-12-28',NULL,'18:00:00',NULL,'<p>Хотим передать вам атмосферу улиц, эпоху кассетной музыки, бумбоксов, денс и фристайл батлов. Музыка, фотозоны, декорации шоу программа, дресс-код и площадка будет соответствовать тематике.<br><br>DRESS CODE:<br>Широкие штаны, оверсайз одежда, бакскетбольные майки, кольца, цепи, банданы, дюраги, кепки и все в таком духе!<br><br>Как и всегда он носит рекомендательный характер, но это сильно влияет на атмосферу, поэтому просим всех его соблюдать. Те, кто будет соответствовать дресс-коду, получит welcome drink и welcome food на входе + сможет поучаствовать в конкурсе на лучший образ, где денежный приз - 5.000₽!<br><br>Приготовили для вас 2 фотозоны для памятных фото «карты, деньги, 2 ствола» и «магшот»<br><br>Также будет несколько зон с интерактивами:<br>• BASKETBALL<br>• TATTOO zone<br>• SNEAKER/CUSTOM zone<br><br>И это только часть того, что мы для вас приготовили, о остальном расскажем вам ближе к мероприятию!</p>',500,'',1,7,1,'https://spb.qtickets.events/54764-after-1811-ghetto','',false,false,NULL,NULL,'2022-12-23 00:08:16','2023-10-07 03:24:44',NULL,'','0',18,24),
	 (74,'.TXT','2022-12-24-stakensnaider-txt','2022-12-24','2022-12-24','20:00:00','00:00:00','<p>.txt - это попытка осмыслить минимал звучание в разных направлениях электронной музыки.<br>Отдавая должное румынской сцене, ребята не забывают о корнях, которые уходят к звучанию tech house конца 90х, начала 00х.<br>Отправляясь в это музыкальное путешествие, они ищут жемчужины, в которых отражены гипнотической вайб, легкая меланхолия и танцевальный грув.<br><br>До 23:30 вход свободный</p>',0,'',1,3,1,'','',false,false,NULL,NULL,'2022-12-23 00:13:44','2023-07-03 02:37:15',NULL,'','0',18,3);
