	 (75,'Абстрасенция: Новогодняя','2022-12-30-oranzereia-tavriceskogo-sada-abstrasenci','2022-12-30',NULL,'16:00:00',NULL,'<p>Канун Нового года фестиваль атмосферной электроники проведет в оранжерее Таврического сада. Под сводами тропической резиденции Абстрасенция соберет единомышленников — и мы вместе загадаем всем нашим мечтам исполниться в будущем году.<br><br>По доброй традиции на сцене, окутанной ветками пальм и экзотических растений, выступят давние друзья фестиваля. Long Arm, культовый электронщик, участник Boiler Room и немецкого лейбла Project Mooncircle, выступит с новым лайвом. Резидент английского Hospital Records и создатель лейбла Microfunk Music — продюсер Bop отыграет танцевальный сет. Спустя два года состоится долгожданное возвращение Woodju в Оранжерею с атмосферным лайв-сетом. Музыкант и саундпродюссер Rautu с Карельского перешейка, ставший открытием июньского фестиваля, представит свой новый материал. А основатель фестиваля Игорь Адамс подготовит специальную новогоднюю программу.<br><br>Концерт состоится в двух сеансах с одинаковой программой — в 16:00 и 19:10. Количество мест ограничено.</p>',1700,'',1,48,1,'https://spb.qtickets.events/57653-abstrasentsiya-novogodnyaya','https://abstrasension.ru/newyear_orangery',false,false,NULL,NULL,'2022-12-23 00:37:21','2023-08-25 23:26:53',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','1',18,6),
	 (1320,'China Town','2023-07-16-propaganda-china-town','2023-07-16',NULL,'23:00:00',NULL,'<p>В воскресенье China Town — заглядывайте завершить неделю.</p>',NULL,'0.0',2,101,1,'','',false,false,NULL,2,'2023-07-13 04:17:10','2023-10-24 06:18:12',NULL,'','0',18,71),
	 (76,'F*ck 2022','2022-12-30-vnvnc-concert-hall-fck-2022','2022-12-30',NULL,'23:00:00',NULL,'<p>Команда FRIENDFAM приготовила самую громкую ночную вечеринку этого года!<br>Мы знаем, что новогоднее настроение в этом году найти намного сложнее, чем в любой другой. Поэтому мы решили сделать такую новогоднюю вечеринку, чтобы каждый из вас смог послать этот год вместе с нами, и назвали ее «f*ck you, 2022, and f*ck all your parties»!<br><br>Новый Год принято встречать в кругу семьи, поэтому в преддверии праздника собираемся большой шумной компанией в центре города в клубе VNVNC CONCERT HALL в ночь с 30 на 31 декабря.<br><br>Ну и помимо этого, нас ждёт поистине большой праздник в честь юбилея FRIENDFAM, мы же не могли забыть про годовщину!</p>',700,'',1,50,1,'https://spb.qtickets.events/57189-friendfam-new-year-3012','https://t.me/friendfamparty',false,false,NULL,NULL,'2022-12-23 00:54:50','2023-10-16 13:30:50',NULL,'','0',18,7),
	 (77,'Drum&Bass New Year','2022-12-31-diuny-drumbass-new-year','2022-12-31',NULL,'22:00:00',NULL,'<p>31 декабря, команды Time Of Night и Heavy Dubplate приглашают вас проводить уходящий, не самый легкий 2022 год и встретить новый 2023 год в компании старых друзей.. Музыкальное действие пройдет на двух танцполах бара Дюны: подогреваемом уличном и расположенном в баре Poison на втором этаже.</p>',1000,'1500.0',1,49,1,'https://spb.qtickets.events/57813-3112-dnb-new-year-night-2023-at-dyuny-na-ligovke','https://vk.com/dnb_new_year2023',false,false,NULL,NULL,'2022-12-23 01:12:04','2023-09-27 21:20:06',NULL,'','0',18,13),
