	 (79,'New Year 2023','2022-12-31-stakensnaider-new-year-2023','2022-12-31',NULL,'01:00:00','10:00:00','<p>Не изменяя доброй традиции, откроем двери через час после боя курантов.<br>Всю ночь за пультом друзья и резиденты клуба.<br>Веселиться будем до 10 утра, а там посмотрим.<br>На входе cash only</p>',700,'1000.0',1,3,1,'http://bit.ly/3VbP41T','https://vk.com/stackenschneider?z=photo-55837663_457278091%2Falbum-55837663_00%2Frev',false,false,NULL,NULL,'2022-12-23 01:40:27','2023-10-12 13:28:10',NULL,'','0',18,12),
	 (80,'Free Flow Flava x NKOHA x ndls404','2022-12-21-factory-free-flow-flava-x-nkoha-x-ndls4','2023-01-21',NULL,'20:00:00',NULL,'<p>Долгожданный концерт трех столпов лоу-фай хип-хопа России!<br>Тройная презентация свежих альбомов. Каждый из трех участников выступает с новым альбомом — услышать их можно на одном концерте уже в январе.<br><br>Free Flow Flava — один из самых популярных и мощных битмейкеров в России. С 2014 года сэмплирует азиатскую тематику в хип-хоп стиле. Любишь аниме или ставишь новые диски на свой марк 2, ешь рамен или допиваешь асахи? Флава хорош в любой ситуации.<br><br>NKOHA — петербургский музыкант, работающий в масштабе жанров от этно-трэпа до драм-н-бэйса и дабстепа. На концерте вас будет ожидать плотный микс из восьмилетней дискографии музыканта с упором на новые, в том числе еще неизданные треки.<br><br>ndls404 - уже зарекомендовавший себя битмейкер из новой волны азиатского лоу-фай хип-хопа в России. Десятки миллионов стримов говорят за него лучше слов.<br><br>Не упустите шанс начать Новый год правильно: с презентации сразу трех альбомов.<br><br>Начало строго в 20:00, приходите заранее!</p>',800,'',1,7,1,'https://spb.qtickets.events/57581-2101-free-flow-flava-x-nkoha-x-ndls404','https://vk.com/fffnkohandls404spb',false,false,NULL,NULL,'2022-12-23 01:50:24','2023-10-14 11:49:41',NULL,'','0',18,26),
	 (81,'CRIMEWAVE IV SPB','2023-01-21-blank-crimewave-iv-spb','2023-01-21','2022-12-22','23:50:00','07:00:00','<p>CRIMEWAVE SPB IV пройдёт в Санкт-Петербурге 21 января 2023.<br>Место проведения: Blank [Арсенальная набережная, 1]<br><br>FC: строго 18+<br>DC: acid neon / monochrome</p>',900,'',1,1,1,'https://spb.qtickets.events/58094-crimewave-iv-spb','https://vk.com/crimewave_spb_iv',false,false,NULL,NULL,'2022-12-23 02:01:57','2023-10-24 21:25:50',NULL,'','0',18,15),
	 (83,'Clubnight','2022-12-23-rndm-clubnight','2022-12-23',NULL,NULL,NULL,'<p>В пятницу стартует серия RNDM Club Night, ее будут представлять наши резиденты и «звездные друзья». Для первой «клубной ночи» везут Варю Карпову.&nbsp; Также отыграет друг клуба Никита Телегин, и резиденты Wellew и Etrigan</p>',NULL,'500.0',2,27,1,'','https://ra.co/events/1633302',false,false,NULL,NULL,'2022-12-23 18:39:06','2023-09-18 09:13:25',NULL,'','0',18,20),
	 (250,'Радуга в Москве','2023-01-27-blanc-raduga-v-moskve','2023-01-27',NULL,'22:00:00',NULL,'<p>На Бали слктали, теперь летим дальше. И кстати, летим ли?&nbsp;<br>Отмечаем Новый Год по Лунному календарю!<br><br></p>',700,'',2,36,1,'https://radugadiscoclub.ru/e270123','',false,false,NULL,NULL,'2023-01-26 14:20:31','2023-10-21 19:56:40',NULL,'','0',18,48);
