	 (1614,'Пятница','2023-08-18-bar-strelka-piatnica','2023-08-18',NULL,'23:00:00',NULL,'<p>Предпоследний уикенд лета можно провести в уютном дворике бара «Стрелка».</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,2,'2023-08-16 17:28:34','2023-10-09 01:48:17',NULL,'','0',18,43),
	 (84,'ZLOBA','2022-12-13-rndm-zloba','2023-01-13',NULL,NULL,NULL,'<p>Злоба возвращается, покажи ей правильный выход!<br><br>В сакральную дату звезды тяжелого жанра из Москвы и Санкт-Петербурга вновь объединятся, чтобы устроить для вас сеанс очищения рейвом. Все самое темное будет обнаружено, изъято и втоптано в танцпол под самый стильный саундтрек для подобного ритуала. Пусть гнев и ярость потеряют свою деструктивную силу, остынут и растворятся в неодушевленной материи, а в вашем сердце освободится место для светлого и созидательного.</p>',500,'',2,27,1,'https://zloba.ticketscloud.org/','https://vk.com/zloba.rndm',false,false,NULL,NULL,'2022-12-23 19:14:57','2023-09-07 10:42:32',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,5),
	 (85,'Прожиточный Минимал','2022-12-24-rndm-prozitocnyi-minimal','2022-12-24',NULL,'22:00:00',NULL,'<p>Ночь минимала от резидентов и гостей промогруппы "прожиточный минимал".<br><br>0l0m / anushka / al.sub / belogorodski / gabrava / grsha / petr kandinsky / tonel'' dj set / uhl futurinkel<br><br>Начало: 22:00<br>Вход: 500 р</p>',500,'',2,27,1,'','',false,false,NULL,NULL,'2022-12-23 19:36:26','2023-10-22 19:44:34',NULL,'','0',18,49),
	 (143,'Community','2023-01-14-scaste-community','2023-01-14','2023-01-14','16:00:00','21:00:00','<p>DATE: 14.01<br>TIME: 16:00-21:00<br>PLACE: СЧАСТЬЕ<br>PHOTO | VIDEO <br>FC/DC 15+<br><br>После каникул, сразу поглощаться в учебную рутину нельзя, надо постепенно. именно поэтому, мы с вами встречаемся на первых же выходных, после великолепных январских праздников<br><br>Artist:<br>LIL KRIN<br><br>TICKETS <br>250₽ - с выполнением условий<br>400₽ - без внимания к мероприятию<br>500₽ - на входе<br><br>MUSIC STYLE: HIP-HOP, TRAP, NEW SCHOOL, OLD SCHOOL&nbsp;<br><br>LINE UP:<br>DJ VAGA | DJ FLAMIE | DJ CARNAL | MC LIL TUGH | MC EPEMIN | MC TALKA</p>',400,'500.0',7,74,1,'','',false,false,NULL,NULL,'2023-01-11 04:39:31','2023-10-16 03:13:22',NULL,'','0',18,11),
	 (86,'Manifest','2023-01-06-rndm-manifest','2023-01-06',NULL,NULL,NULL,'<p>Шестого января мы готовим для вас традиционный подарок от Manifest! На открытие нового сезона мы собрали для вас плотнейший лайн-ап. Nastya Zimens из Питера, её музыка звучит по всему миру и выпускается на крупнейших рейв-лейблах. Легендарный dope-дуэт Yung Acid, чьи треки играли Chemical Brothers на BBC Radio One, а так же возвращение тройного резидентского бэк-ту-бэка от Etrigan, Basil White и Lowchord. Rif Erous будет отвечать за разогрев танцпола этой ночью.<br><br>Вход: по репосту в VK/INST - 500₽ до 0:00, после 0:00 - 700₽.<br>Без внимания к мероприятию - 1000₽.</p>',500,'1000.0',2,27,1,'','',false,false,NULL,NULL,'2022-12-23 20:05:40','2023-09-18 13:59:21',NULL,'','0',18,23),
	 (87,'Kiki','2022-12-24-kiki-kiki','2022-12-24',NULL,NULL,NULL,'<p>накраптор в 19<br>маша сергеева в 20<br>фамитсу в 21<br>тейпхуд в 22<br><br>мерри киксмас</p>',NULL,'',1,54,1,'','',false,false,NULL,NULL,'2022-12-24 19:58:30','2023-10-22 13:26:09',NULL,'','0',18,22),
	 (88,'Вечер импровизаций: Рейв','2022-12-27-polelab-vecer-improvizacii-reiv','2022-12-27',NULL,'21:00:00',NULL,'<p>Фестиваль экспериментального танца «Ключи» завершает 2022 год новым форматом – первым открытым Вечером Импровизаций, в котором могут участвовать как танцовщики, так и зрители.</p><p>Вечер пройдет в формате рейва. Час танцевальной терапии, где каждый может дать волю своему телу. За этот год мы пережили много разных и сложных чувств, и этим событием хотим дать возможность зрителям хотя бы ненадолго освободиться от них. А еще объединиться и стать ближе как с собой, так и с окружающими.</p><p>Для вдохновения можно наблюдать за движениями профессиональных рейверов.</p><p>Главный рейвер: Матэ</p><p>Cценография Вечера: световая инсталляция дизайн-студии СЕТАП «Borders»</p><p>Музыка: experimental playlist от Dark Vanya (Taet Vremya)</p><p>Участники: все желающие</p><p>27 декабря,</p><p>сбор гостей в 20:30</p>',900,'',2,56,1,'https://live.mts.ru/moscow/concerts/vecher-improvizaciy-reyv','',false,false,NULL,NULL,'2022-12-26 16:36:22','2023-10-12 03:49:10',NULL,'','0',18,12),
	 (89,'Новогодний Маскарад с Pompeya','2022-12-31-aglomerat-novogodnii-maskarad-s-pompeya','2022-12-31',NULL,NULL,NULL,'<p><br>Aglomerat, сб 31.12<br><br>В новогоднюю ночь&nbsp; в клубе Aglomerat состоится Новогодний Маскарад 2023. Будут играть группы Pompeya, Mana Island, а также Karmanovsky и Fanick. Весь праздник пройдёт в стиле ретро-гранж маскарада, поэтому гостей ждут в косухах, футболке с любимой группой и блёстками с ног до головы</p>',2000,'',2,56,1,'https://vk.cc/ck27sN','https://vk.com/newyear_aglomerat',false,false,NULL,NULL,'2022-12-26 17:08:41','2023-10-18 01:11:14',NULL,'','0',18,3),
	 (91,'Hawaii','2023-01-01-gas-hawaii','2023-01-01',NULL,'23:00:00',NULL,'<p>Мы все понимаем, как бывает трудно 1 января&nbsp;<br><br>Переместимся в место релакса и настоящего удовольствия, дабы восстановиться&nbsp;<br><br>Наши DJ будут поддерживать эту атмосферу&nbsp;<br><br>Line up:<br><br>Djusova / Pablo / Brique / 4iza / Middle / Otiumo / Santiago<br><br></p>',NULL,'',1,57,1,'','',false,false,NULL,NULL,'2022-12-26 17:31:59','2023-10-22 14:46:25',NULL,'','0',18,24),
	 (92,'Gas New Year','2022-12-31-gas-gas-new-year','2022-12-31',NULL,'23:00:00',NULL,'<p>Какие ассоциации вызывает у вас Новый год?<br>Праздник, веселье, тусовка, друзья&nbsp;<br>Мы можем продолжать долго, но просто скажем, что все это будет в одном месте под сводами GÁS<br>Увидимся в эту сказочную ночь!<br><br>Line up:<br>Enot / Rebel / Pill one / F-jay / Omai / Kudrya / Odddi / Arturque / Startuem / Lyanna&nbsp;</p>',500,'',1,57,1,'https://637ccf786601f5658da4e4cf.ticketscloud.org/e/63a32f632ce1257103b03369?partner_id=637ccf786601f5658da4e4cf','',false,false,NULL,NULL,'2022-12-26 17:51:53','2023-08-25 23:53:10',NULL,'','0',18,1);
