	 (94,'Imagine','2022-12-31-community-moscow-imagine','2022-12-31',NULL,'22:00:00',NULL,'<p><strong>Мы в предвкушении! Совсем скоро наступит Новый Год, праздник, в который сбываются мечты и загадываются важные желания!<br></strong>IMAGINE! Представьте то, о чем давно мечтали, чего желаете себе и миру. Мы представили и вложили свои мысли в музыкальный лайн-ап новогодней программы Imagine! Внутри чистая любовь, богатство стилей и высокое мастерство.<br><br>Программа делится на два блока. Это связь между годами, возможность взять в 2023 самое лучшее и желанное!<br><br><strong>NEW YEAR DINNER</strong><br><strong>22:00-01:00&nbsp;</strong>(вход для гостей со столами)<br>Arseniy Trofim’s Acoustic Band live<br>piano | cello | drums | bass<br><br>Телеграмм-спектакль “Imagine”<br>Community Stage<br><br>Samir Kuliev &amp; Arseniy Trofim<br>live electronic<br><br><strong>NEW YEAR PARTY</strong><br><strong>01:00-06:00&nbsp;</strong>(открытый вход по билетам на вечеринку)<br>Levandowskiy &amp; SCHE live (new album)<br>Monoplay dj set<br>Sarabi b2b Ogannes<br>Samir Kuliev<br><br><strong>FC | DC</strong></p>',3000,'',2,58,1,'http://communitymoscow.ru/imagine','',false,false,NULL,NULL,'2022-12-29 23:29:14','2023-10-22 14:23:42',NULL,'','0',18,30),
	 (95,'Sожжеnie 5: back to private','2022-12-31-sozzenie-5-back-to-private','2022-12-31',NULL,NULL,NULL,'<p>Команда устраивает анти Новый год под лозунгом no alco-no drugs и приглашает всех присоединиться к единомышленникам. Будет вегетарианская еда, китайский чай и тату зона, где каждый сможет бесплатно набить кривую гайку у дизайнера. Также будет стол для своп обмена — приносите свои ненужные вещи. По традиции после первого сета будет проведена 15-минутная медитация mindfulness<br><br></p>',NULL,'',2,NULL,1,'','',false,false,NULL,NULL,'2022-12-30 01:28:15','2023-08-25 23:24:12',NULL,'','0',18,11),
