	 (97,'Кåстры fest 2023','2023-12-31-kastry-fest-2023','2023-08-04','2023-08-07','12:00:00','18:00:00','<p>КÅСТРЫ FEST 2023 4-7 АВГУСТА — ЛЕСНОЙ МУЛЬТИФОРМАТНЫЙ ФЕСТИВАЛЬ ЭЛЕКТРОННОЙ МУЗЫКИ И ИСКУССТВА В ЖИВОПИСНЫХ ПЕЙЗАЖАХ ЛЕНИНГРАДСКОЙ ОБЛАСТИ.<br><br>Лесной - значит жить в палатках, спать в спальнике, греться у костра. Фестиваль будет проходить в 100-120 км от Санкт-Петербурга. Точное месторасположение раскрывается 01.08.23.<br><br>4 музыкальные сцены:<br><br>&nbsp;MAIN FLAME<br>(ELECTRO, TECHNO, HARD TECHNO, PSYTRANCE)<br>&nbsp;URBAN<br>(SOMATIK, DnB, JUNGLE, BREAKCORE, UK GARAGE)<br>&nbsp;AIR<br>(CHILLOUT, ETHNIC BASS, ORGANIC HOUSE, AMBIENT)<br>&nbsp;COMMUNITY<br>(МУЛЬТИЖАНРОВАЯ ЭЛЕКТРОНИКА И LIVE АРТИСТЫ)<br>Искусство, развлечения, инфраструктура:<br><br>&nbsp;ХИЛИНГ-ЛЕКТОРИЙ<br>&nbsp;ТАНЦЕВАЛЬНЫЕ И ИММЕРСИВНЫЕ ПЕРФОРМАНСЫ<br>&nbsp;ХУДОЖЕСТВЕННАЯ ГАЛЕРЕЯ, ТЕАТР<br>&nbsp;ЯРМАРКА, ФУДКОРТ<br>&nbsp;ДУШ, БАНИ<br>ЛЕС ЖДЕТ</p>',3500,'',1,NULL,3,'','https://kastry.art/',false,false,NULL,NULL,'2022-12-30 08:15:20','2023-10-25 05:53:14',62,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,1052),
