	 (100,'NEUROPUNK FESTIVAL','2023-02-17-izvestiia-hall-neuropunk-festival','2023-02-17','2023-02-18','21:00:00','06:00:00','',1100,'',2,43,3,'','',false,false,NULL,NULL,'2022-12-30 08:29:44','2023-10-22 04:16:54',NULL,'','0',18,15),
	 (101,'Sens','2023-04-15-mutabor-sens','2023-04-15','2023-04-16','22:00:00','06:00:00','<p>Чувственный рейв с перфомансами и активностями в культовом клубе Москвы.</p><p>Мы продолжаем серию вечеринок NAZLO MAME в формате музыкально-эстетической коллаборации.<br>Sens – это мистический неошабаш, где тебя ждут перфомансы, лежачий танцпол, визуальный арт, сенсорный коридор, активности на общение и раскрепощение.<br>DRESS-CODE: total black + fetish<br>ПРАВИЛА:&nbsp;<br>1. «Нет» — значит Нет. «Да» — значит Да.<br>2. Не прерывай чужой экшен.<br>3. Любые взаимодействия только по взаимному согласию.<br>4. Фото и видеосъёмку ведут исключительно аккредитованные фотографы с профессиональной техникой.<br>5. Запрещено пользоваться телефоном. Мы не забираем телефоны на входе, но заклеиваем камеры, в том числе рекомендуем проживать опыт вечеринки без гаджетов.<br>Сдать билет можно не позднее, чем за 3 дня до начала мероприятия. <br>При этом будет удержана комиссия за банковское обслуживание. Возврат оформляется по ссылке в письме с приобретенным билетом. <br>В случае непрохождения фейс- и дресс-контроля, мы вернем ваш билет самостоятельно в течение 3 рабочих дней.</p>',2500,'',2,2,1,'https://nazlomame.ticketscloud.org/','',false,false,NULL,NULL,'2022-12-30 08:34:37','2023-10-22 17:14:18',NULL,'','0',18,86),
	 (113,'Tochka Sborki & Friends','2023-01-05-stakensnaider-tochka-sborki-friends','2023-01-05','2023-01-06','22:59:00','08:00:00','<p>Редко да метко. Саундсистема Точка Сборки собирает старых и новых друзей. <br>Состав усилен двумя гостями из Москвы, резидентами, частыми гостями на вечеринках и темной лошадкой - Galet.<br><br>23:59—08:00<br><br><a href="https://soundcloud.com/belonica/tracks">Belonica</a><br><a href="https://on.soundcloud.com/MZeTW">Galet </a><br><a href="https://soundcloud.com/conceptrme/conceptcast-31-kife-suffer?in=kife-suffer/sets/mixes">Kife Suffer</a> <br><a href="https://m.soundcloud.com/tochka_sborki">Tochka Sborki</a><br><a href="https://soundcloud.com/norton-commander">Norton Commande</a><br><br>Face Control<br>Entry 500₽* [cash only]<br>*300₽ с репостом <a href="https://vk.com/wall-55837663_8733">записи из ВК</a>&nbsp;<br><br></p>',300,'500.0',1,3,1,'','',false,false,NULL,NULL,'2023-01-03 22:47:16','2023-10-24 20:56:08',NULL,'','0',18,16);
