	 (102,'Сказка-9: Любовь','2023-08-10-skazka-9-liubov','2023-08-10','2023-08-13','17:00:00','21:00:00','<p>Мы все находимся в предвкушении летней встречи. Когда от тёплых солнечных лучей бежишь в прохладную реку, а затем, облачившись в свой сказочный образ, летишь по лесным тропинкам к приключениям. По пути встречаешь удивительных существ, изумляясь их небывалой красоте, радуешься ярким краскам и музыке, а ноги сами пускаются в пляс на удивительных полянах. Мы создаём это событие для того, чтобы поделиться любовью друг с другом. Именно об этом тема грядущего фестиваля, который мы готовим для вас с особым трепетом. Мы не смогли устоять и даём вам уникальную возможность сделать предложение своему любимому человеку или же сыграть свадьбу на нашем фестивале. Для любящих сердец на поляне будут 2 локации: Orbita Stage и Symbiosis Stage. Мы назвали их верхним и нижним миром.<br><br></p>',6900,'',2,NULL,3,'','',false,false,NULL,NULL,'2022-12-30 08:39:04','2023-10-23 20:18:43',63199,'eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSJ9.eyJwIjoiNjFiYTNiMDE0YTM4ZTcxNzQ1Yzk5MDhmIn0.oNBbcYl1pM42-xVFJHeMolwa8ARvP9V1jBiitpsUwZg','0',18,475),
	 (103,':data New Year Special','2023-01-03-rndm-data-new-year-special','2023-01-03','2023-01-04','22:00:00','06:00:00','<p>Состав гостей вечеринки открывает ChaseR, продюсер известный громким релизами на Eatbrain, Neuropunk, Dispatch. Также прямиком из Казахстана к нам летит наша верная подруга, автор незаурядного вкуса и непредсказуемой подачи - Катя Zebra.<br><br>Компанию им составят неугомонные резиденты: Traffic, Cutworx, Untrue и Runout.<br><br></p>',400,'',2,27,1,'https://vk.cc/ck2erJ','https://vk.com/data_03_01_23',false,false,NULL,NULL,'2022-12-30 08:55:47','2023-08-25 23:40:17',NULL,'','0',18,6),
	 (104,'Cherta','2023-01-02-rndm-cherta','2023-01-02',NULL,NULL,NULL,'<p>Черта проводит афтепати Нового года, или препати Старого нового года — в общем, вы поняли, будет разная и любимая бочка. Выступят резиденты и друзья: Produsserka из BRB, Kvarta, oneroid, Bisolar, Altruck и osixed.<br><br>Вход: до 00:00 — 500 р., после — 800 р.<br>Время: 23:00 - 08:00</p>',500,'',2,27,1,'','https://vk.com/chertaxrndm',false,false,NULL,NULL,'2022-12-30 09:02:50','2023-09-30 04:25:44',NULL,'','0',18,4),
	 (105,'Calvin Klein','2023-01-03-kiki-calvin-klein','2023-01-03',NULL,'23:59:00',NULL,'<p>Ночью 3 января в баре будет представлена домашняя классика Кики — коктейль Дао на основе бурбона, настоянного на чае Лапсан, и мандариновый лимонад.&nbsp;<br>Первый напиток обладает насыщенным травяным кисло-горьким вкусом, подается с зажженным листом голубого шалфея.&nbsp;<br>Второй готовится из свежих мандаринов, розмарина и ферментированных шишек, получается бодрящим.<br><br>Face Control<br>Entry 500₽ [cash only]</p>',500,'',1,3,1,'','',false,false,NULL,NULL,'2023-01-03 21:27:28','2023-09-07 08:00:11',NULL,'','0',18,2),
	 (1081,'HATE HOME PARTY','2023-06-16-pravda-hate-home-party','2023-06-16','2023-06-16','19:00:00','23:00:00','<p>Атмосфера пляжной поп-панк вечеринки в разгар московского лета!<br><br></p>',1400,'',2,20,1,'https://moscow.qtickets.events/73001-hate-home-party-16-iyunya','https://vk.com/hatehomepartymoscow',false,false,NULL,NULL,'2023-06-14 16:26:44','2023-10-25 14:14:40',NULL,'','0',18,90),
	 (106,'Funk You!','2023-01-07-stakensnaider-funk-you','2023-01-07',NULL,'21:00:00',NULL,'<p>07 января фанк, огонь и арт сольются воедино под крышей клуба <a href="https://vk.com/stackenschneider">Stackenschneider</a>.<br><br>Фирменная Breakbeat &amp; Breaks тусовка <a href="https://vk.com/funkyou">Funk You!</a> принимает в гостях Dancehall, Favela &amp; Jersey вечеринку Fyah от <a href="https://vk.com/fatvibez">FAT VIBEZ Records.</a> <br><br>Важным элементом события станет арт-инсталляция от <a href="https://vk.com/artletikastudio">ARTLETIKA creative studio</a>&nbsp; - <a href="https://vk.com/misha.vert">студия Misha Vert</a>. Это будет завершающая ночь выставки работ автора в стенах клуба. <br><br>Лайн-ап артистов состоит из хорошо знакомых имен, которые так приятно видеть вместе: <a href="https://vk.com/djquest">Quest</a>, <a href="https://vk.com/lexanidj">Lexani</a>, <a href="https://vk.com/schinderr">Shinder</a>, <a href="https://vk.com/outselect">Outselect</a>, <a href="https://vk.com/levicedj">Levice</a>, <a href="https://vk.com/soul_sista">Soul Sista</a>, <a href="https://vk.com/theselector">Basic Principles</a>.</p>',300,'500.0',1,3,1,'https://funk-you.timepad.ru/event/2277829/','https://vk.com/funkyou',false,false,NULL,NULL,'2023-01-03 21:36:27','2023-10-22 09:53:28',NULL,'','0',18,36),
	 (107,'Prop The Bass','2023-01-03-factory-prop-the-bass','2023-01-03',NULL,'22:00:00',NULL,'<p>Сегодня Drop The Bass @ Factory, Севкабель Порт!&nbsp;<br>Начало в 22:00<br>До 00:00 стоимость входа - 800р, после 00:00 - 1000р, после 4 утра вход - 500р<br><br>Афтерпати: Кен Кизи, бесплатно с браслетами DTB, без браслета - 300р, с 7:00 до 12:00</p>',800,'1000.0',1,7,1,'https://timeofnight.timepad.ru/event/2275271/','',false,false,NULL,NULL,'2023-01-03 21:50:49','2023-06-12 05:08:00',NULL,'','0',18,5),
	 (108,'Itallika','2023-01-03-union-itallika','2023-01-03',NULL,'22:00:00',NULL,'<p>Петербург привет! Синти-Диско живёт, ITALLIKA растёт! 3-го января в Union дети, родственники и друзья италлики играют, традиционно - Italo disco, synthpop, synth disco, electroclash, new wave 80’s, hi-nrg и всё что звучит синти<br>Искрящие наряды приветствуются!<br>Начало в 22.00,&nbsp;<br>Вход до 22.00 free.&nbsp;<br>С 22.00 - 300₽&nbsp;<br>С 23.00 - 400₽, (300₽ с репостом в день вечеринки до 20.00).&nbsp;</p>',300,'400.0',1,8,1,'','',false,false,NULL,NULL,'2023-01-03 21:57:57','2023-01-03 21:57:57',NULL,'','0',18,0),
	 (109,'Анноу','2023-01-03-kruzok-annou','2023-01-03',NULL,'21:00:00',NULL,'',NULL,'',1,11,1,'','https://vk.com/kruzhokspb',false,false,NULL,NULL,'2023-01-03 22:10:25','2023-01-03 22:10:25',NULL,'','0',18,0);
