	 (110,'n.thing_real','2023-01-03-mixed-nthing-real','2023-01-03',NULL,NULL,NULL,'<p>3.01 Минимал от <a href="https://t.me/nothingrealtrio">n.thing_rea</a>l в Mixed.<br><br>Надо расти духовно, иначе…<br><br>500 entry</p>',500,'',1,59,1,'','https://www.soundcloud.com/nothingrealtrio',false,false,NULL,NULL,'2023-01-03 22:21:04','2023-01-03 22:21:04',NULL,'','0',18,0),
	 (115,'Synth Party','2023-01-13-live-story-synth-party','2023-01-13','2023-01-15','23:30:00','05:00:00','<p>Ночная вечеринка для всех любителей синтезаторной музыки! Танцы до самого утра под лучшие хиты synthwave, retrowave, new wave!<br><br>В программе:<br>- Танцы до самого утра и атмосфера настоящего праздника,<br>- Диджеи поставят ваших любимых синт-хиты: A-ha, Alphaville, Bananarama, Blondie, Carpenter Brut, The Cars, Crystal Castles, The Cure, Depeche Mode, Dead Or Alive, Desire, Eurythmics, Electric Youth, FM-84, The Human League, Kavinsky, Ladytron, New Order, Perturbator, Soft Cell, Yazoo и многих других!<br><br>18+ (Вход строго по оригиналам документов)</p>',350,'',2,16,1,'https://moscow.qtickets.events/58239-synth-party-1401-live-story','https://vk.com/synth140123',false,false,NULL,NULL,'2023-01-05 09:43:32','2023-10-11 23:11:17',NULL,'','0',18,10),
