	 (117,'Ghetto Town','2023-01-06-kinky-rouge-ghetto-town','2023-01-06','2023-01-07','22:00:00','06:00:00','<p>Праздник к нам приходит! И мы делаем первую большую вечеринку 2023 года. Оставим все невзгоды, печали и обиды в ушедшим 2022, с собой возьмем позитив, отличное настроение, тепло и добро. Сделаем грандиозный отрыв грядущего Рождества вместе с вами, с нашими любимыми резидентами в привычной нам бешеной атмосфере!<br><br>Line Up :<br>- 21:00 Сбор гостей<br>- 22:00 Начало<br>- 03:00 Жаркие Go Go<br>- 03:30 Стрип<br><br>Dj Set от :<br>- Dj SPARK<br>- Dj MITROOLS<br>- Dj YUNGSTEF</p>',500,'',2,62,1,'https://qtickets.ru/iframe?event_id=59158','https://m.vk.com/tusatown',false,false,NULL,NULL,'2023-01-05 10:10:39','2023-10-10 11:32:36',NULL,'','0',18,21),
	 (118,'Marry Christmas','2023-01-08-pravda-marry-christmas','2023-01-08','2023-01-08','16:00:00','22:00:00','<p>Начало 2023 года мы решили сделать громким и радостным для большого количества гостей. Об этом свидетельствует повтор полюбившейся вам коллаборации и огроменная площадка. Мощный лайн-ап, сотни киловатт звука и яркое неоновое шоу - так мы отмечаем Рождество!</p>',600,'',2,20,1,'https://moscow.qtickets.events/58791-marry-christmas','https://vk.com/blade.events',false,false,NULL,NULL,'2023-01-05 10:28:23','2023-10-18 02:43:38',NULL,'','0',18,23),
	 (119,'U-DJIN bday Party ','2023-01-13-gorod-u-djin-bday-party','2023-01-13',NULL,'23:30:00',NULL,'<p>Мы открываем 2023 год серией клубных вечеринок.<br>13 января 2023 года в сердце столицы, мы отпразднуем сразу три интересных события: пятница 13-е, Старый Новый год и главная причина — это день рождения нашего друга, артиста и просто хорошего человека DJ U-DJINа.<br>Приглашаем шумно поздравить его вместе с нами в очень уютном месте под названием Город.<br>С хорошим звуком , уже всем известным декором от именитых ребят - PsyMetrika<br>В компании диджеев с опытом выступлений на самых интересных тематических ивентах России.<br>VDXA<br>U-DJIN<br>Doc.Gonzo<br>MONK''S &amp; SKAZKA<br>ChippoChongo<br>TwoFaders<br>Stone<br>Nerva<br><br>Standart - 500<br>VIP - 1000</p>',500,'',2,63,1,'https://moscow.qtickets.events/56992-u-djin-bday-party-by-space-place','https://vk.com/spp2022y',false,false,NULL,NULL,'2023-01-05 10:39:39','2023-10-22 12:15:02',NULL,'','0',18,13),
	 (120,'TOP&DOPE  VIDÉNIE','2023-01-14-rndm-topdope-videnie','2023-01-14','2023-01-15','20:00:00','06:00:00','<p>Вечером Вас ждёт приятная музыку с латино, восточными и африканскими мотивами.<br>Погрузиться в процесс создания картин вместе с художниками от команды VIDÉNIE<br><br>В полночь дуэт братьев WOZHD из Латинской Америки, устроит настоящее шоу с музыкальными инструментами со всего мира.<br><br>Магическое выступление BOLA BAJA с индийским ситаром моментально отправит Вас в атмосферу Гоанских сансетов.<br><br>Далее окунемся в программу с самой вкусной андеграундной электронной музыкой, ведь у нас в составе супер талантливые ребята с большими заслугами. (расскажем о них в постах в инсте) @topndopmusiccommunity<br><br>Приятным сюрпризом будет Крымский гость NATS, каждый сет которого настоящая история.<br><br>БИЛЕТЫ:<br>до 30.12 - 500 руб.<br>до 13.01 - 700 руб.<br>в день мероприятия на входе до 0:00 - 800 руб.<br>далее всю ночь - 1000 руб.<br><br></p>',700,'1000.0',2,27,1,'https://moscow.qtickets.events/57536-topdope-videnie','https://t.me/videnieorg',false,false,NULL,NULL,'2023-01-05 10:51:13','2023-09-07 10:42:51',NULL,'','0',18,6),
	 (121,'ЕШ2023','2023-06-01-es2023','2023-06-01','2023-06-04',NULL,NULL,'<p>Фестиваль современного творчества, искусство в лесу.<br>250 км от центра</p>',2000,'',2,NULL,3,'https://moscow.qtickets.events/56132-esh2023','https://vk.com/esh2023',false,false,NULL,NULL,'2023-01-05 11:07:47','2023-10-22 09:50:10',NULL,'','0',18,208),
	 (122,'RAMMSTEIN Erotic Show','2023-01-14-rock-base-bar-rammstein-erotic-show','2023-01-14',NULL,'21:00:00',NULL,'<p>Две мощнейших атмосферы - Eros.vibe + RAMMproJect окунут тебя в нереальную<br>вечеринку безнравственности, похоти и разврата. Место, где встречаются самые мокрые киски и самые острые перцы.<br>Тебя ждут:<br>- горячие тела самых красивых девушек<br>- представления в стиле шибари и BDSM<br>- живой шоу-концерт трибьюта RAMMSTEIN<br>- афтепати до утра с лучшими DJ города</p>',500,'',3,64,1,'https://sochi.qtickets.events/59146-rammstein-erotic-show','https://vk.com/event218065147',false,false,NULL,NULL,'2023-01-05 11:14:26','2023-10-10 10:49:43',NULL,'','0',18,22),
	 (129,'We Love Drum&Bass','2023-01-11-aurora-hall-we-love-drumbass','2023-01-11','2023-01-12','23:30:00','06:00:00','<p>Да будет Рейв в наших сердцах. Музыка нас связала и подарила незабываемые эмоции, горячую атмосферу и нежные чувства, которые хочется испытывать вновь и вновь. Встречайте новый эпизод фестиваля WeLove Drum&amp;Bass , где мы с размахом начнём праздновать День Святого Валентина!</p>',700,'',1,25,1,'https://welovednb.timepad.ru/event/2282300/?utm_source=vk&utm_medium=cpc&utm_campaign=sales','',false,false,NULL,NULL,'2023-01-09 17:41:17','2023-10-24 21:06:15',NULL,'','0',18,17);
