	 (123,'DR.SPY.DER','2023-01-14-central-park-drspyder','2023-01-14',NULL,'22:00:00',NULL,'<p>DR.SPY.DER— российский диджей, музыкант, музыкальный продюсер московского клуба «Крыша мира»!. Участник музыкальных коллективов и проектов : «Step 2 Sun», «Kоntrabanda Dj», «Boris the Spyder», «The Conservators», «Underground Moscow», «Djin Mask” За свои многочисленные достижения стал "Лучшим диджеем 2003 года" по версии Night Life Awards и «Лучшим андерграунд диджеем» 2014, 2015, 2016 годов.<br><br>Сегодня Spy.der это легенда. Это тот человек, который может заставить танцпол клуба ходить ходуном столько, сколько ему нужно. Не зря он имеет славу самого грамотного ди-джея на after-party вечеринках. Именно на таких вечеринках тяжелее всего удивить, так как на таких мероприятиях собирается публика, в музыкальном плане изысканная, уставшая от танцев, но по-прежнему жаждущая удивления.<br>—————-<br>FC/DC</p>',800,'',3,65,1,'https://sochi.qtickets.events/56733-701-drspyder-krysha-mira','https://vk.com/centralpark.sochi',false,false,NULL,NULL,'2023-01-05 11:21:31','2023-10-14 11:42:28',NULL,'','0',18,14),
	 (124,'LIST','2023-01-06-andaman-riviera-phuket-hotel-list','2023-01-06',NULL,'23:00:00',NULL,'<p>Его все и всегда ждут!<br><br>Легендарный DJ LIST на Пхукете 6 января. Один из самых востребованных диджеев России за последние 20 лет, резидент той самой «Крыши Мира» на протяжении 10 лет победитель народного голосования «Alfa future people» и это далеко не все его достижения, но зачем нам их перечислять, а вам читать об этом?<br><br>Встречаемся 6 января в шикарной локации Andaman Riviera Phuket Hotel. Будет жарко‍!</p>',4664,'',10,66,1,'https://phuket.qtickets.events/59054-list','',false,false,NULL,NULL,'2023-01-05 11:34:35','2023-10-21 15:30:57',NULL,'','0',18,29),
	 (134,'Old New Year','2023-01-14-blank-old-new-year','2023-01-14',NULL,'23:00:00',NULL,'<p>Чужая душа — потемки. Душа русского человека — кромешная тьма, озаренная одним единственным, вечно дотлевающим угольком надежды.<br><br>И каждый праздник, даже анекдотичный календарный оксюморон под названием Старый Новый год, подается как нелишний повод подбросить в очаг дровишек, раздуть его мехами и, чтоб уж наверняка, подлить чего-нибудь покрепче. Такая вот кочерга.<br><br>Отпраздновали тот, отпразднуем и этот, ведь чаять перемен можно сколь угодно долго, но даже крохотные утехи профукать не охота.<br><br>14 января — Old New Year<br><br>Вход:<br>23:00 - 500₽<br>23:59 - 700₽</p>',500,'700.0',1,1,1,'','',false,false,NULL,NULL,'2023-01-10 16:35:12','2023-08-25 23:46:49',NULL,'','0',18,6),
	 (125,'Vibes & Grooves with Theoretical','2023-01-21-klub-c-vibes-grooves-with-theoretical','2023-01-21',NULL,'18:00:00',NULL,'<p>Четвертая часть самой теплой серии D&amp;B-вечеринок Екатеринбурга открывает новый год и новые имена!<br><br>Vibes &amp; Grooves — это стильный и эталонный Drum''n''Bass. Это всегда треки, которые можно с комфортом слушать и под которые можно танцевать. Каждый гость мероприятия сможет открыть для себя новые грани звучания drum’n’bass!<br><br>В этот раз отдаем предпочтение глубине звучания и нашим звездным гостем будет сильнейший дуэт из Санкт-Петербурга - Theoretical!<br>За последние несколько лет ребята ворвались на топовые заграничные и Российские лейблы, неоднократно получали поддержку на Vision Radio (привет фанатам Noisia), а также подписали трек на лейбл продюсера Break - Symmetry Recordings!<br><br>Astraoum - диджей и продюссер из Екатеринбурга, один из основателей первого и самого громкого D''n''B-движения на Урале - Criminal State.<br><br>ZRD - диджей и селектор из Екатеринбурга, автор проекта Deep Stuff, в котором он еженедельно представляет лучшие треки из самых темных уголков нашего мира</p>',500,'',4,67,1,'https://ekb.qtickets.events/59224-vibes-grooves-with-theoretical','https://vk.com/vibesandgrooves4',false,false,NULL,NULL,'2023-01-05 11:45:56','2023-10-24 01:33:28',NULL,'','0',18,19),
	 (126,'So Icy','2023-01-06-mutabor-so-icy','2023-01-06',NULL,'20:00:00',NULL,'<p>Boulevard Depo, Хаски, Bato — в большой концертной программе на главной сцене Mutabor. Здесь же с DJ-сетом: 4EU3. Далее и до утра: вечеринка House Of Rap, хедлайнер Kashin.<br>Boulevard Depo выступит с полноценной часовой программой.</p>',2500,'',2,2,1,'http://mutabor.club/so-icy','https://vk.com/msoicy',false,false,NULL,NULL,'2023-01-05 13:31:05','2023-09-28 11:20:32',NULL,'','0',18,30),
	 (127,'Радуга х Easy Fresh Essentials','2023-01-14-blanc-raduga-x-easy-fresh-essentials','2023-01-14',NULL,NULL,NULL,'<p>Диско-клуб 14-го января захватит элитный и солидный Blanc. Главенствовать этой ночью будет Easy Fresh.&nbsp; Лайн-ап&nbsp; залипательный, обеспечит всем вечер замечательный.</p>',1500,'',2,36,1,'https://live.mts.ru/moscow/concerts/raduga-kh-easy-fresh-essentials','',false,false,NULL,NULL,'2023-01-09 16:18:46','2023-10-22 08:33:12',NULL,'','0',18,15),
	 (128,'Vibe Room','2023-01-13-dk-vibe-room','2023-01-13',NULL,'23:00:00',NULL,'<p>Руководствуясь правилом «как год встретишь, так его и проведешь», мы собрали большой лайн-ап резидентов и друзей и взяли одну из главных хип-хоп площадок Петербурга — все для того, чтобы настроить сезон 2023 на правильный лад с самого его начала.<br><br>Классический формат вечеринкок Vibe Room с разделением музыкальной программы на 2 танцпола и целая россыпь наших любимых диджеев: Denis Yuzhin, Artemii Korzh, Laqs, Brique и Santi на мейн стейдже и Bambi Sofa, Izabelle, Lapina и Nika Vosem на бэкярде.<br><br>Вход 500₽ / 700₽<br><br>Начало в 23:00. FC/DC 18+</p>',500,'700.0',1,68,1,'','',false,false,NULL,NULL,'2023-01-09 17:25:26','2023-09-28 00:20:05',NULL,'','0',18,8),
	 (130,' Interplay White Night','2023-01-28-pravda-interplay-white-night','2023-01-28','2023-01-29','23:30:00','06:00:00','<p>Interplay Events представляет первую вечеринку в 2023 году - Interplay White Night! <br>Синергия музыки, света и любви, незабываемые моменты и эмоции под сеты Alexander Popov, Aurosonic, Somnia, Alexander Spark, Ruslan Radriges, Chester Young, Seegy, Kitone, Kaimei + специальный White Performance. <br>28 января Москва, клуб Pravda, старт в 23:30. <br><br>Будь в белом!</p>',1000,'',2,20,1,'','https://interplayevents.com/',false,false,NULL,NULL,'2023-01-10 12:50:47','2023-10-24 23:16:42',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,26),
	 (131,'Hard Thursday ','2023-01-12-hard-thursday','2023-01-12',NULL,'19:00:00',NULL,'<p>Всё новое это хорошо забытое старое! Когда-то наш любимый город гремел (во всех смыслах) от тяжёлой электронной музыки не только в ночи выходных, но и в вечера будней.<br><a href="https://vk.com/hardthursday">HardThursday</a> - возрождение забытых традиций легендарных Trashdays с берегов Невы!<br><br>WELCOME HOME!&nbsp;<br>GO HARDER!<br>ALL IN CORE!<br><br>Вход свободный</p>',0,'',1,72,1,'','https://vk.com/hardthursday',false,false,NULL,NULL,'2023-01-10 13:36:54','2023-10-24 20:52:35',NULL,'','0',18,30),
	 (132,'Kinky Circus','2023-02-24-kinky-circus','2023-02-24',NULL,'23:50:00',NULL,'<p>KINKY Rebel party - вечеринка в пятницу - 24/02/2023, <br>Эксцентричный цирк приветствует вас и гостей со всего мира на KINKY Сircus - Rebel party)! <br>Улётная ночь фетиш феерии будет заряжена потрясающе-возмутительными развлечениями и умопомрачительными tech-house сетами...</p>',3000,'10000.0',2,71,1,'','https://www.kinky-cirque.com/',false,false,NULL,NULL,'2023-01-10 13:50:45','2023-10-12 08:39:26',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,37);
