	 (133,'Industrial Storm VIII','2023-01-23-mezzo-forte-industrial-storm-viii','2023-02-23',NULL,'18:00:00',NULL,'<p>Дорогой друг! 23 февраля мы приглашаем тебя на очередной, уже седьмой по счету INDUSTRIAL STORM!</p><p>Зажжем танцпол так, как никогда раньше! <br>Самые яркие представители Dark-тусовки соберутся вместе чтобы сделать этот вечер поистине огненным и сумасшедшим!</p>',700,'',2,15,1,'https://rupor.biz/widgets/event-tickets/804','',false,false,NULL,NULL,'2023-01-10 16:00:49','2023-10-12 10:34:30',NULL,'','0',18,52),
	 (135,' Underground Experience','2023-01-20-rndm-underground-experience','2023-01-20',NULL,'23:00:00',NULL,'<p>Первое в 2023 году мероприятие Underground Experience пройдет, вопреки обыкновению, не в Санкт-Петербурге. <br>20 января столичный клуб RNDM примет шоукейс одной из старейших петербургских промо-групп. <br>С середины девяностых годов прошлого века участники Undeground Experience, несмотря на разноплановость своих музыкальных пристрастий, сходятся в одном - сочетают в своих сетах и релизах любовь и знание классики техно-музыки с умением продемонстрировать слушателю небанальные и менее известные направления танцевальной электроники. <br>На предстоящем шоукейсе выступит основной состав промо-группы: dj Slon, dj Zaletny, dj Ershov. <br>Столичную сцену представит опытный диджей и искушенный коллекционер пластинок dj Son. <br>Мы будем рады всем москвичам и петербуржцам, которые разделят с нами эту зимнюю ночь.</p>',NULL,'',2,27,1,'','https://vk.com/undergroundexperience',false,false,NULL,NULL,'2023-01-10 16:45:06','2023-10-22 11:03:40',NULL,'','0',18,31),
	 (136,'Зимняя Сказка','2023-01-27-mutabor-zimniaia-skazka','2023-01-27',NULL,'22:00:00',NULL,'<p>27 января 2023, на четырех стейджах клуба "Мутабор"<br><br>IMAGINE MARS &amp; VOLCANO / Israel<br>Addams • Boho Nativo • Chronos • Cutworx • Dj Dan • Dzhura • Edell •&nbsp; Liquid Crystal• Manoj Puri • Nostromosis • Solnce • Sonic Elysium • Stanin • Taga • Traffic • XP VooDoo • Zirrex • 2Whales + many more to be announced</p>',2500,'',2,2,1,'','https://vk.com/skazkaartgroup',false,false,NULL,NULL,'2023-01-11 00:25:19','2023-10-23 00:23:12',NULL,'','0',18,27),
	 (137,'ВЕРТЬ','2023-01-13-kruzok-vert','2023-01-13',NULL,'21:00:00',NULL,'',200,'300.0',1,11,1,'','https://vk.com/tyt_vert',false,false,NULL,NULL,'2023-01-11 01:41:33','2023-10-17 22:44:14',NULL,'','0',18,4),
	 (138,'Салют Хани ','2023-01-14-kruzok-saliut-xani','2023-01-14',NULL,'22:00:00',NULL,'',200,'300.0',1,11,1,'','',false,false,NULL,NULL,'2023-01-11 02:19:10','2023-08-26 00:09:47',NULL,'','0',18,4),
	 (139,'Ахола. Сближение','2023-02-11-brusnicyn-xoll-axola-sblizenie','2023-02-11',NULL,NULL,NULL,'<p>АХОЛА.СБЛИЖЕНИЕ — симбиоз музыки, практик и созидательной деятельности, выстраивающий связь между индивидуальными сознаниями. В рамках наших ивентов экспериментальные формы коммуникации объединяют реальный и виртуальный мир, выстраивая безопасное сенсорное пространство. Обновленное восприятия и свежий взгляд на чувственность станут проводниками на пути через обволакивающие звуковые ландшафты и мягкий наэлектризованный туман аудиовизуальных инсталляций.<br><br>АХОЛА — ежегодный фестиваль, который уделяет особое внимание взаимодействию пространства, музыки и аудитории.<br><br>Новое однодневное мероприятие АХОЛА.СБЛИЖЕНИЕ в зимнем Петербурге сохраняет и развивает ценности наших прошлых встреч. Мы стремимся создать комфортную и эмоционально-теплую среду, в которой происходит единение людей, а также гармонично дополняют друг друга мультижанровые выступления и диджей-сеты, мастерклассы, маркет, лекции и перфомансы.<br>День:<br><br>Кожа быстрее performance<br>Артём Брюхов lecture<br>Ксения Нечепоренко lecture<br>Rhododéndron live<br>salle de rire performance<br><br>+ market<br>+ exhibition&nbsp;<br>+ workshops&nbsp;<br><br>Ночь:&nbsp;<br><br>Бродячая собака live<br>Roma Nemov<br>DJ Kassir live<br>Димка Батарин<br>Masha Volum<br>Mashusu tapes<br>Женя Лаврин<br>Heliyah</p>',NULL,'',1,70,1,'','',false,false,NULL,NULL,'2023-01-11 02:33:58','2023-10-23 19:24:10',NULL,'','0',18,20),
	 (299,'IDANCITY','2023-02-03-griboedov-idancity','2023-02-03',NULL,'23:59:00',NULL,'<p>IDANCITY — уже сегодня!<br><br>Начать первые февральские выходные в Griboedov Basement станет однозначно правильным решением.<br><br>Под нереальную энергетику наш состав сделает этот вечер ярким и незабываемым.<br>Вход:<br>300 — с репостом <br>500 — без внимания<br><br><a href="https://vk.com/wall-154594155_17033">VK</a> &nbsp;</p>',300,'500.0',1,86,1,'','https://www.t.me/griboedovbasement/2147',false,false,NULL,NULL,'2023-02-03 16:23:59','2023-02-03 16:23:59',NULL,'','0',18,0),
	 (140,'Нейромонах Феофан','2023-03-10-1930-moscow-neiromonax-feofan','2023-03-10',NULL,'20:00:00',NULL,'<p>Самый известный и, по существу, единственный фолк-драм-н-бейс-проект в России. Жанр фолк-драм-н-бейс стоит понимать буквально — это действительно эстетика и лирика, вдохновленные древнерусскими традициями, мощные басы и энергичный бит в 170–180 BPM. За десять лет у «Феофана» вышло три полноформатных альбома, а также EP.</p>',1500,'',2,30,2,'https://www.afisha.ru/concert/2151266/?utm_source=admitad&utm_medium=cpa&utm_campaign=353356&utm_content=ac35844c5da845b02b571bf3b4628393','https://vk.com/neurofeofan',false,false,NULL,NULL,'2023-01-11 02:56:18','2023-10-16 01:53:25',NULL,'','0',18,18),
	 (141,'Trancemission Masquerade','2023-04-14-adrenaline-stadium-trancemission-masque','2023-04-14',NULL,'22:00:00',NULL,'<p>Когда стрелки часов приблизятся к полуночи, двери откроет наш мистический Маскарад. Наступит ночь магии, полная сюрпризов и перевоплощений. Лица участников будут скрыты под масками. Московский VK Stadium погрузится в сумрак, до тех пор пока лучи лазеров не «разрежут» его, и оживут тени…</p><p>Балом будут править:</p><ul><li>Heatbeat (AR)</li><li>Philippe El Sisi (EG)</li><li>Omar Sherif (EG)</li><li>FEEL</li><li>Alexander Popov</li><li>Roman Messer</li><li>Victoria Ray (live)</li></ul><p><br>14 апреля на новом эпизоде фестиваля Trancemission «Masquerade» выступит 3 иностранных артиста. Легендарный аргентинский проект Heatbeat, чей трек «Push Over» долгое время возглавлял чарт Beatport и был самым скачиваемым синглом. А также ведущий музыкант в направлении uplifting trance – Philippe El Sisi и автор гимнов для эпизодов радиошоу Future Sound of Egypt – Omar Sherif.</p><p><br>Трансмиссия – российский электронный фестиваль транс-музыки с 20-летней историей. Каждый эпизод Трансмиссии – это новая, уникальная постановка. Основатели фестиваля – Feel и Радио Record. В разное время на Трансмиссии выступали Armin van Buuren, Paul van Dyk, Ferry Corsten, ATB и другие звезды транс-музыки.</p><p>Категории билетов:</p><ul><li>Dancefloor – доступ на танцпол, в вашем распоряжении будут все бары на арене, ресторан и гардероб, а если вы придете раньше, то займете место перед сценой.</li><li>VIP – все привилегии Dancefloor, отдельный вход и гардероб, вход на эксклюзивный VIP-балкон с замечательным видом на сцену, отдельные бары.</li><li>Gold – все привилегии Dancefloor и VIP, место за столиком на одном из ярусов каскадной части VIP-балкона с премиальным видом на сцену и индивидуальным обслуживанием официантами, отдельный вход и гардероб.</li><li>Ложи (на 4 и 6 персон) – персональный вход и сопровождение хостес, панорамный вид на сцену и мероприятие в целом, персональное обслуживание официантами, алкогольные и безалкогольные напитки, фрукты.</li></ul><p><em>Все билеты, приобретённые на 03.11.2022, действительны на новую дату.</em></p><p><br></p>',1600,'',2,73,3,'https://www.ticketland.ru/kluby/klub-adrenaline-stadium/trancemission-masquerade/20230414_2300-3939234/','',false,false,NULL,NULL,'2023-01-11 03:40:43','2023-10-24 21:13:44',NULL,'','0',18,53),
	 (142,'Trancemission Masquerade','2023-04-15-trancemission-masquerade','2023-04-15',NULL,'22:00:00',NULL,'<p>Когда стрелки часов приблизятся к полуночи, двери откроет наш мистический Маскарад. Наступит ночь магии, полная сюрпризов и перевоплощений. Лица участников будут скрыты под масками. Петербуржский А2 Green Concert погрузится в сумрак, до тех пор пока лучи лазеров не «разрежут» его, и оживут тени…</p><p>15 апреля на новом эпизоде фестиваля Trancemission «Masquerade» выступит 3 иностранных артиста. Легендарный аргентинский проект Heatbeat, чей трек «Push Over» долгое время возглавлял чарт Beatport и был самым скачиваемым синглом. А также ведущий музыкант в направлении uplifting trance – Philippe El Sisi и автор гимнов для эпизодов радиошоу Future Sound of Egypt – Omar Sherif.</p><p>Трансмиссия – российский электронный фестиваль транс-музыки с 20-летней историей. Каждый эпизод Трансмиссии – это новая, уникальная постановка. Основатели фестиваля – Feel и Радио Record. В разное время на Трансмиссии выступали Armin van Buuren, Paul van Dyk, Ferry Corsten, ATB и другие звезды транс-музыки.</p><p>Категории билетов:</p><ul><li>Dancefloor – доступ на танцпол, в вашем распоряжении будут все бары на арене, ресторан и гардероб, а если вы придете раньше, то займете место перед сценой.</li><li>VIP – все привилегии Dancefloor, отдельный вход и гардероб, вход на эксклюзивный VIP-балкон с замечательным видом на сцену, отдельные бары.</li><li>Gold – все привилегии Dancefloor и VIP, место за столиком на одном из ярусов каскадной части VIP-балкона с премиальным видом на сцену и индивидуальным обслуживанием официантами, отдельный вход и гардероб.</li><li>Ложи (на 4 и 6 персон) – персональный вход и сопровождение хостес, панорамный вид на сцену и мероприятие в целом, персональное обслуживание официантами, алкогольные и безалкогольные напитки, фрукты.</li></ul><p><strong><em>Все билеты, приобретённые на 04.11.2022, действительны на новую дату.</em></strong></p>',1800,'',1,NULL,3,'https://www.ticketland.ru/kluby/klub-adrenaline-stadium/trancemission-masquerade/20230415_2300-4679584/','',false,false,NULL,NULL,'2023-01-11 03:54:21','2023-10-22 06:23:37',NULL,'','0',18,54);
