	 (252,'Asylum Young Blood','2023-01-27-slezy-asylum-young-blood','2023-01-27',NULL,'23:00:00',NULL,'<p>Промогруппа Asylum с хард-техно-вечеринкой для любителей тяжелого скоростного звучания. <br>В её лайнапе — как молодые, так и опытные диджеи из Москвы и Санкт-Петербурга с селекцией разнообразной прямой бочки.</p>',400,'',2,102,1,'','https://vk.com/event218295659',false,false,NULL,NULL,'2023-01-26 14:36:03','2023-10-24 21:17:15',NULL,'','0',18,41),
	 (144,'MNMUM','2023-01-13-stakensnaider-mnmum','2023-01-13',NULL,NULL,NULL,'<p>Сначала ребята из DMT и их друзья музыканты создают и тестируют звук в паттернах, настройках и ещё что где можно подкрутить, далее получают подготовленный лайв на железках.<br>Так они выявили очень хорошую традицию - собираться и показывать своё мастерство слушателю через приборы с лампочками, которые создают музыкальную магию.<br>В этот Старый Новый год мы подключим провода, а вы включите чувство ритма и оцените их фирменный вайб.<br><br>23:59—10:00<br><br>Artöm<br>Basic7<br>Cleaning Company<br>Het live<br>Hidikel<br>Johnny U-tah<br>Lbrnth &amp; Idm’’t<br>Oira<br><br>Face Control<br>Вход свободный до 23:00<br>Entry 500₽* [cash only]<br>*После 6:00 300₽</p>',500,'500.0',1,3,1,'','',false,false,NULL,NULL,'2023-01-11 05:29:16','2023-10-09 03:20:48',NULL,'','0',18,5),
	 (145,'Desoner','2023-01-13-mejan-desoner','2023-01-13',NULL,NULL,NULL,'<p>БАЛИ&nbsp;<br>Пятница 13го в Mejan с особенным лайнапом.&nbsp;<br>В этот раз команда Desoner хостит гостью из Дании - Anastasia Kristensen, уже давно ставшую постоянным участником крупных фестивалей Awakenings, Afterlife, Primavera или EXIT, так же на счету которой частые гостевые сэты в знаковых клубах вроде Berghain, Bassiani, Blitz, Movement и миксы для Resident Advisor, Boiler Room и HӦR.&nbsp;<br>Компанию гостье составит Nazira, решившая задержаться на Бали, cоосновательница коммьюнити Desoner - Anelle и восходящая звезда локального подполья - Tikkoi.&nbsp;<br><br>Anastasia Kristensen (DK)<br>Nazira (KZ)<br>Anelle<br>Tikkoi<br><br>Пресейл: https://megatix.co.id/events/desoner-kristensen<br>Билеты на входе: 300k IDR<br><br>Код на скидку 20% - PLACHUNATECHNO</p>',NULL,'300000.0',11,75,1,'https://megatix.co.id/events/desoner-kristensen','',false,false,NULL,NULL,'2023-01-11 06:54:40','2023-10-12 19:43:21',NULL,'','0',18,15),
