	 (147,'Drop','2023-01-13-union-drop','2023-01-13',NULL,'22:00:00',NULL,'<p>Интересный танцевальный стаф, идущий по касательной к жанру «хаус» в самом разностороннем его проявлении. <br>В лайн-апе: Buzz Compass, My Format, Tom Ride, Диджей Круг.&nbsp;<br><br>Вход до 23:00 — фри, после — 400₽&nbsp;</p>',0,'400.0',1,8,1,'','',false,false,NULL,NULL,'2023-01-11 15:15:09','2023-08-26 00:04:28',NULL,'','0',18,2),
