	 (149,'.TXT','2023-01-14-union-txt','2023-01-14',NULL,'23:00:00',NULL,'<p>Облегченная формула субботнего музыкального наполнения от свежей формации .TXT <br>Хаус мьюзик от минимализма до классики. За пультом: Alles, Dime Chù, Igro, Texture. <br>Вход до 23:00 — фри, после — 400₽&nbsp;</p>',0,'400.0',1,8,1,'','',false,false,NULL,NULL,'2023-01-11 16:13:33','2023-08-26 00:17:03',NULL,'','0',18,1),
	 (150,'Bravers x Get busy','2023-01-13-prostranstvo-pole-bravers-x-get-busy','2023-01-13',NULL,'22:00:00',NULL,'<p>&nbsp;Коллаборация двух уважаемых тусовщиками команд — столичной Bravers и лейбла Get Busy из Казани, который давно обосновался в Москве. <br>В программе — выступления резидентов и друзей обеих формаций. <br>В их числе Kovyazin D с танцевальным EBM, b2b-сет от Nikita Telegin и Rvbbt и гибридный электро-лайв Хулиганской Электроники. <br>Визуальным оформлением займется объединение «Горизонт», которое готовит теневые инсталляции и эзотерические декорации.&nbsp;</p>',505,'',2,46,1,'https://bravers-event.timepad.ru/event/2286718/','',false,false,NULL,NULL,'2023-01-12 08:28:09','2023-10-22 12:55:48',NULL,'','0',18,20),
	 (151,'Hyperboloid 2023','2023-01-13-powerhouse-hyperboloid-2023','2023-01-13',NULL,'23:30:00',NULL,'<p>&nbsp;Шоукейс лейбла Hyperboloid, который уже 18 лет выпускает и продвигает на клубной карте столицы электронную экспериментальную музыку.&nbsp;<br>Тусовка отметит выход свежей компиляции импринта Hyperboloid 2023.&nbsp;<br>Выступят на ней избранные резиденты, в том числе A. Fruit, Summer Of Haze, New Sylveon и Data Drain.&nbsp;<br><br><strong>Стоимость:</strong> донейшн (любая купюра).</p>',NULL,'',2,5,1,'','https://vk.com/hyperboloid2023',false,false,NULL,NULL,'2023-01-12 08:40:22','2023-10-01 00:52:45',NULL,'','0',18,19),
	 (152,'M+ST','2023-01-14-prostranstvo-pole-mst','2023-01-14',NULL,'23:00:00',NULL,'<p>&nbsp;Онлайн-платформа музыкального вещания M+ST берёт в охапку шесть диджеев и выходит в «поле» в эту субботу. За плечами команды десятки эфиров с известными московскими артистами и несколько вечеринок. На тусовке-трансляции выступят Bulgakov, GLS, Lilok, John Rock и другие артисты.&nbsp;<br><br>Стоимость: донейшен</p>',0,'',2,46,1,'','https://t.me/eto_polye/871',false,false,NULL,NULL,'2023-01-12 08:48:46','2023-07-01 15:52:59',NULL,'','0',18,11);
