	 (153,'Санкт-Петербург VNVNC ','2023-01-14-vnvnc-concert-hall-sankt-peterburg-vnvn','2023-01-14','2023-01-15','23:00:00','06:00:00','<p>Продолжаем наш идеальный план раз уже все запланировано, то слиться у тебя не получится да ты и не захочешь, столько всего будет и столько отметить надо:<br>1. Старый Новый год <br>2. Мы прожили две недели после Нового<br>3. День белоснежных птиц <br>4. День одевания домашних питомцев короче, загугли, там еще куча поводов выбери тот, что по душе, и сразу к нам <br>БРОНЬ СТОЛОВ +7 (921) 410-44-40 <br>Чувствуйте стиль и не забывайте документы<br>FC|DC 18+</p>',500,'',1,50,1,'','',false,false,NULL,NULL,'2023-01-12 12:17:10','2023-01-12 12:17:10',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,0),
	 (1321,'Пятница','2023-07-14-bar-strelka-piatnica','2023-07-14',NULL,'23:00:00',NULL,'<p>В пятницу всю ночь в тусовом баре «Стрелка» ставит пластинки коллекционер разнообразных музыкальных ритмов Валера Sputnik.</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,2,'2023-07-13 04:22:46','2023-10-11 01:58:09',NULL,'','0',18,55),
	 (154,'Карт Бланш - DOM','2023-01-14-gas-kart-blans-dom','2023-01-14','2023-01-15','23:00:00','06:00:00','<p>КАРТ БЛАНШ - DOM<br>Просыпайся! <br>Помотали тебя, конечно, эти праздники, всё ещё не можешь встать с кровати, но запал тусоваться снова пробуждается? <br>Дружище, зачем напрягаться, просто запрыгивай в свои тапочки, пижаму можешь не снимать! <br>Осталось разбудить того самого друга, и пригнать в гости на наш рейв по-домашнему! <br>ДРЕСС-КОД: домашний <br>Старт 23:00<br>Ждем вас в гости!<br>Ваш КАРТ БЛАНШ двери в 23:00<br>FC/DC 18+<br>Будет звучать стильная музыка, DC по соответствию.</p>',700,'',1,57,1,'','',false,false,NULL,NULL,'2023-01-12 13:04:54','2023-01-12 13:04:54',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,0),
	 (155,'VNVNC','2023-01-13-vnvnc-concert-hall-vnvnc','2023-01-13','2023-01-14','23:00:00','06:00:00','<p>Надеемся, что режим все восстановили и готовы к стабильности<br>Знаете, ходить на тусовки каждые выходные - это тоже стабильность<br>Лично у нас план как никогда идеальный: встречаемся в пятницу по расписанию, отрываемся вместе с нашими резидентами, чуть-чуть спим и продолжаем в субботу<br>perfect <br>Будем ждать на том же месте, в то же время<br>БРОНЬ СТОЛОВ +7 (921) 410-44-40<br>Чувствуйте стиль и не забывайте документы<br>FC|DC 18+</p>',500,'',1,50,1,'','',false,false,NULL,NULL,'2023-01-12 14:27:43','2023-08-25 23:48:56',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,2),
	 (156,'Dazrk Love Fest','2023-02-04-mezzo-forte-dazrk-love-fest','2023-02-04',NULL,'18:00:00',NULL,'<p>Хочешь узнать как можно соединить любовь и мрачную эстетику? <br>Как соединить лирику и мощные риффы? <br>Как соединить нежность и отборную жесть?<br>Если да, то ждем тебя на одном из самых эпатажных мероприятий - Dark Love Fest!<br>Надевай кружево и латекс, бери плетки и маски.. И скорее беги в объятья своих желаний!</p>',700,'',2,15,1,'https://rupor.biz/widgets/event-tickets/807','',false,false,NULL,NULL,'2023-01-12 15:06:38','2023-09-06 15:30:16',NULL,'','0',18,14),
	 (312,'LEGALNAYA','2023-02-18-blank-legalnaya','2023-02-18','2023-02-19','23:00:00','08:00:00','<p>18 февраля отправляемся на поиски актуальных границ дозволенного и прекрасного с большим ивентом и сильнейшим составом в последний храм электронной музыки города!</p>',1000,'',1,1,1,'','',false,false,NULL,NULL,'2023-02-09 01:08:53','2023-10-25 15:26:46',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,59),
	 (157,'EMC w/KARELIAN LANDING','2023-02-04-stakensnaider-emc-wkarelian-landing','2023-02-04','2023-02-05','23:55:00','08:00:00','<p>В субботу, 4 февраля, встречаем у себя в гостях сразу двух гостей из карелии S-QUADRO и BOLSHOE UHO.<br><br>Всю ночь как всегда будет звучать только электро. От гипнотического и мелодичного до неистово-агрессивного, подкисленого брекйбитом и гетто.<br><br>Локальная поддержка от наших местных карелов PTZoiD и SUMMANEN, а также участников банды EMC, NEURO, NEONICLE и LP.<br><br>FC//DC 18+</p>',500,'',1,3,1,'https://rupor.biz/widgets/event-tickets/808','https://t.me/emclabel',false,false,NULL,NULL,'2023-01-12 15:15:31','2023-10-04 01:38:16',NULL,'','0',18,7),
	 (158,'Saturday Night','2023-01-14-deep-fried-friends-saturday-night','2023-01-14',NULL,'23:55:00',NULL,'<p>Вечеринка в тусовом ресторане Deep Fried Friends, который по выходным превращается в клуб. За музыку здесь отвечают: мать отечественного техно София Родина, экс-участница группы SEREBRO и солистка проекта FAVLAV Полина Фаворская, дизайнер и инфлюенсер Антон Лисин, а также селектор и любитель дарк-диско Илья Булгаков.</p>',0,'',2,76,1,'','',false,false,NULL,NULL,'2023-01-12 15:20:12','2023-10-22 13:13:23',NULL,'','0',18,7),
	 (159,'Monasterio','2023-02-10-mutabor-monasterio','2023-02-10',NULL,'23:00:00',NULL,'<p>Голландец Wndrlst, Rain Wood из Италии и резиденты Complex Maastricht — Hush &amp; Sleep — станут хедлайнерами на главной сцене клуба на открытии сезона 2023<br><br>Медиум вновь станет самым долгоиграющим танцполом: там отыграют Main sniffer engineer с лайвом, Julia, Alod. Будет секретный b2b под утро, а закроет Gemut. В Андере нижегородское промо Creptonit и представит шоукейс с пятью премьерами</p>',2000,'',2,2,1,'https://ipalimbekov.timepad.ru/event/2290880/?utm_source=telegram&utm_medium=post&utm_campaign=23-02-10-MonaSO-Lisa&utm_refcode=a582ddfb9b6ac67d0e8df64049107221ee0e47ed','',false,false,NULL,NULL,'2023-01-12 16:01:24','2023-10-18 06:07:06',NULL,'','0',18,33),
	 (160,'Sonnabende','2023-01-14-stakensnaider-sonnabende','2023-01-14',NULL,'23:00:00',NULL,'<p>Классический субботник Штакеншнайдера — Sonnabende (https://t.me/stackenschneider/2272) пройдёт в компании мастеров своего дела.<br><br>Ershov — любитель винила и ломаных электро ритмов. Очень уверенно чувствует себя на скорости в 130 bmp, плавно и элегантно смешивая редкие и очень стильные пластинки.<br>Kovalev — мастер неочевидного звучания с отборной коллекцией пластинок.<br>Primitive — диджей и продюсер из Санкт-Петербурга, резидент Roots United.&nbsp;<br>Дамир — частый гость в К-30, Blank, Mutabor, Поле.&nbsp;<br>Играл на Signal в составе шоукейса Roots United на Möbius.&nbsp;<br>Отметился на всех топ мероприятиях страны — Present Perfect Festival, Arma17, Popoff Kitchen и Resonance.&nbsp;<br>Ukusila — важная часть вечеринки Departure с музыкой, которую вы еще точно не слышали, но уже влюбились.<br><br>FC | cash only</p>',500,'',1,3,1,'','',false,false,NULL,NULL,'2023-01-12 16:21:48','2023-10-04 11:33:11',NULL,'','0',18,7);
