	 (163,'Rampa Trash','2023-01-14-factory-rampa-trash','2023-01-14',NULL,'23:45:00',NULL,'<p>14 января, после долгого перерыва группировка Rampa Trash D&amp;B (http://t.me/rampatrash) возвращается по особому поводу: 34-ый День Рождения Олега Finsky!&nbsp;<br>Поздравлять именинника будут лучшие представители DnB сцены Северной Столицы на двух танполах клуба FACTORY .&nbsp;<br>&nbsp;<br>Main:&nbsp;<br>&nbsp;<br>&nbsp;•&nbsp; Lowriderz&nbsp;<br>&nbsp; •&nbsp; C.A.2K&nbsp;<br>&nbsp;•&nbsp; Finsky&nbsp;<br>&nbsp;•&nbsp; KROT&nbsp;<br>&nbsp;•&nbsp; Pasha Nuts&nbsp;<br>&nbsp;•&nbsp; Grinder&nbsp;<br>&nbsp;•&nbsp; Rampa Band B2B<br>&nbsp;•&nbsp; Mistwist&nbsp;<br>&nbsp;•&nbsp; Bass Dealah b2b Original Ninja&nbsp;<br>&nbsp;<br>🎤 MC :&nbsp;<br>&nbsp;•&nbsp; Smoky D&nbsp;<br>&nbsp;•&nbsp; Chemist&nbsp;<br>&nbsp;•&nbsp; Tazmania&nbsp;<br>&nbsp;•&nbsp; Man&nbsp;<br>&nbsp;<br>1st Floor :&nbsp;<br>&nbsp;<br>&nbsp;•&nbsp; Toper&nbsp;<br>&nbsp;•&nbsp; Poison&nbsp;<br>&nbsp;•&nbsp; Sonya&nbsp;<br>&nbsp;•&nbsp; 007&nbsp;<br>&nbsp;•&nbsp; X-Cam&nbsp;<br>&nbsp;•&nbsp; Hot Spot&nbsp;<br>&nbsp;•&nbsp; Plasti-X&nbsp;<br>&nbsp;•&nbsp; Changed Daily&nbsp;<br>&nbsp;•&nbsp; TCP&nbsp;</p>',500,'',1,7,1,'https://timeofnight.timepad.ru/event/2283692/','',false,false,NULL,NULL,'2023-01-13 16:35:31','2023-09-28 01:29:43',NULL,'','0',18,5),
