	 (182,'Happy Chinese New Year','2023-01-21-tommy-lee-happy-chinese-new-year','2023-01-21',NULL,NULL,NULL,'<p>В субботнюю ночь мы окунемся в атмосферу страны восходящего солнца и отпразднуем Лунный Новый Год, также известный как Праздник весны. Новый Год в Китае – главное торжество и прекрасный повод собраться всей семьёй. Я тоже хочу собрать свою семью в Tommy Lee, чтобы отпраздновать зарождение новой жизни и привлечь удачу и везение.<br><br>Задаст тон вечеринке Jackie Jeff, затем сменит пластинку Bagus, приближая нас к ночному трипу. Опытный Atche раскачает нас ломаными ритмами, а Albert завладеет электронным вайбом и энергией танцпола. Groovejack точно не даст зевать до утра.<br><br>Резерв по телефону и WhatsApp: 8 921 9381212<br><br>Вход FC/DC</p>',NULL,'',1,83,1,'','',false,false,NULL,NULL,'2023-01-18 13:45:19','2023-08-25 23:23:13',NULL,'','0',18,1),
	 (165,'Большой Рейв - Санкт-Петербург','2023-01-28-blank-bolsoi-reiv-sankt-peterburg','2023-01-28',NULL,NULL,NULL,'<p>Нет, это не двоится в глазах, это «Большой рейв» увеличился и 28 января одновременно громыхнет в Петербурге и Москве.<br>Если в каждой мафии должен быть свой Бигги, то наш толстячок — «Большой Рейв». <br>Серия вечеринок, которая возникла по приколу, из возжелания соединить несоединимое, триумфально выполняет задачу четвертый год. <br>В век рушащихся мостов, сооружаем свой собственный, консолидирующий людей разных музыкальных пристрастий вокруг стремления как следует оттянуться. <br>Такие уж мы пацифистские ретрограды.&nbsp;<br><br>«Большой Рейв» в Blank: шоукейсы Popoff Kitchen, Катэраг, Plan B<br><br>«Большой Рейв» в Поле: шоукейсы Blank, Monasterio, Поле</p>',900,'',1,1,1,'http://blankclub.ru/','',false,false,NULL,NULL,'2023-01-16 15:48:56','2023-10-10 11:05:50',NULL,'','0',18,45),
	 (166,'Большой Рейв - Москва','2023-01-28-prostranstvo-pole-bolsoi-reiv-moskva','2023-01-28',NULL,NULL,NULL,'<p>Нет, это не двоится в глазах, это «Большой рейв» увеличился и 28 января одновременно громыхнет в Петербурге и Москве.<br><br>Если в каждой мафии должен быть свой Бигги, то наш толстячок — «Большой Рейв». <br>Серия вечеринок, которая возникла по приколу, из возжелания соединить несоединимое, триумфально выполняет задачу четвертый год. <br>В век рушащихся мостов, сооружаем свой собственный, консолидирующий людей разных музыкальных пристрастий вокруг стремления как следует оттянуться. <br>Такие уж мы пацифистские ретрограды.&nbsp;<br><br>«Большой Рейв» в Blank: шоукейсы Popoff Kitchen, Катэраг, Plan B<br><br>«Большой Рейв» в Поле: шоукейсы Blank, Monasterio, Поле</p>',1000,'',2,46,1,'http://blankclub.ru/','',false,false,NULL,NULL,'2023-01-16 15:54:54','2023-10-24 23:20:15',NULL,'','0',18,39),
	 (167,'SIGNAL','2023-08-17-signal','2023-08-17','2023-08-20',NULL,NULL,'<p>Экосистема с годовым жизненным циклом, Signal Festival официально открывает седьмой сезон в партнерстве с крупнейшим в Европе арт-парком Никола-Ленивец. 7 сцен с уникальным звучанием<br>Signal — ведущий электронный фестиваль России и главный летний ретрит многотысячных комьюнити, мотивированных общей идеей: выйти за пределы влияния мегаполиса, оказаться — "за горизонтом" — в идеальном мире, созданном во имя музыки, искусства и любви.</p>',6900,'',2,82,3,'https://signal.live/','https://vk.com/signal.live',false,false,NULL,NULL,'2023-01-16 16:30:47','2023-10-25 11:38:59',NULL,'','0',18,571),
	 (168,'Gray Day MKIII by SAINT','2023-01-20-warpp-gray-day-mkiii-by-saint','2023-01-20',NULL,'23:00:00',NULL,'<p>20 Января, SAINT совместно с Warpp продолжают серию вечеринок. На очереди Gray Day mkIII - это капсульная вечеринка в честь дня рождения SAINT ATHEI<br><br>За пультом в эту ночь вместе с именинником преисполнятся:<br>KINKY SOUND / SAINT ATHEI (Birthday set) / FOCUS 10 / LLQ<br>и специальные гости MODBIT - Дуэт опытных саунд продюсеров на просторах indie-dance музыки.<br>Релиз “Calypso” вышел на Siona Records, он стал хитом и получил большую поддержу европейских артистов.<br>На лейбле Bunny Tiger (Germany) состоялся релиз из двух треков "Space Time" "Rush, который попал в TOP INDIE DANCE и держащий позиции по сей день. а также cовместная работа с Kinky Sound - "Connect" вышедшая на Ritual, заняла свои позиции в TOP 10 стиля.<br><br>Вас ждет жаркая ночь, стартуем в 23:00<br><br>Резерв столов по телефону 500-09-01<br><br></p>',NULL,'1000.0',1,23,1,'','https://warppclub.com',false,false,NULL,NULL,'2023-01-16 17:30:27','2023-08-25 23:30:52',NULL,'','0',18,7),
	 (190,'Пламя','2023-02-18-motiv-plamia','2023-02-18',NULL,'23:00:00',NULL,'<p>Это была долгая пауза, но ПЛАМЯ вновь разгорелось ! Проект, призванный зажечь огонь в наших сердцах и пробудить любовь.<br>Тебя ждёт 2 жарких зала ломанного римта&nbsp; и конечно, Огонь!<br>На этой дискотеке для вас&nbsp; выступит отличный состав артистов&nbsp;<br><br>Max Fiesta<br>Fixxxt&nbsp;<br>Julia Brooks&nbsp;<br>LOWRIDERZ&nbsp;<br>Dubspace Lion<br>Amoralyx&nbsp;<br><br>Nemero<br>Albi Zantana&nbsp;<br>Mevrik<br>Shinder&nbsp;<br>Outside Dj<br>Пламя загорится 18.02 в 23:00 в клубах Мотив &amp; Птичья Личность&nbsp;</p>',400,'',1,88,1,'https://spb.qtickets.events/60432-plamya-probuzhdenie','https://vk.com/club218295909',false,false,NULL,NULL,'2023-01-19 16:28:51','2023-10-25 17:48:40',NULL,'','0',18,47);
