	 (183,'OG Party','2023-01-21-scaste-og-party','2023-01-21','2023-01-21','17:30:00','21:30:00','<p>Тусовка ЗА 200 РУБЛЕЙ НА НОВОЙ ЛОКАЦИИ??<br>Краснодар!<br><br>Думаю пора посетить закрытую вечеринку,<br>в которой не обязательно отрываться по полной,<br>в которой ты получишь кайф от Вайба!<br><br>21 января!<br><br>FС/DС:15+<br>TIME 17:30-21:30<br>PLACE: River bar (Тц карнавал)<br><br>LINE UP:<br><br><a href="https://vk.com/carnalll">Carnal</a><br><a href="https://vk.com/liltoughguy">lil tugh</a><br><a href="https://vk.com/xereminx">Eremin</a><br><a href="https://vk.com/broucash">Broucash</a><br><br><br>DRESS: одеться в стилистике трэп, хип хоп<br><br>Браслеты до 18 лет-зеленый<br>18+ красный<br><br>TICKETS<br>Онлайн :<br>С условиями 200<br>Без выполнения условий 400<br>VIP-500- (проход за диджейку, вход без очереди)<br><br>(билетов ограничено! В зависимости от количества цена может меняться)<br><br>На входе :<br>500<br><br>Условия:<br>Репостнуть афишу в историю<br>Отметить 3ех друзей в комментариях<br><br>ПРАВИЛА<br>Соблюдение дресс-кода<br>Никаких намеков на Абу, только трэп стиль<br>Администрация в праве попросить вас покинуть данное мероприятие за неадекватное, агрессивное поведение, провоцирование конфликтов и нарушение правил.<br><br>Охрана имеет право отказать во входе без объяснения причины</p>',200,'500.0',7,85,1,'','https://vk.com/ogpartyy',false,false,NULL,NULL,'2023-01-18 13:54:55','2023-10-25 06:07:22',NULL,'','0',18,108),
	 (169,'Freitag Nacht','2023-01-20-stakensnaider-freitag-nacht','2023-01-20','2023-01-21','23:59:00','08:00:00','<p>Фирменная пятничная вечеринка клуба - Freitag Nacht.<br><br>Buren'' — диджей новой волны Санкт-Петербурга. Отдает предпочтение классическому звучанию 90х, но не забывает и про современную электронную музыку<br>Fanick — участник Клуба Любителей Музыки (К.Л.М.). В сетах придерживается эклектики, поэтому среди свежих релизов можно услышать и ранний хаус, и техно 90х, и ломаные ритмы 00х<br><br>Ki.Mi. — владелец лэйблов Kashatskikh (https://soundcloud.com/kashatskikh), Labelafterme (https://soundcloud.com/labelafterme) и Stackenschneider (https://soundcloud.com/stackenschneider), продюсер электронной музыки, диджей <br><br>Zok Zok — отыграл почти во всех городах России, в Берлине, на фестивалях Present Perfect Festival, Alfa Future People, Kazantip в Грузии, Epizode во Вьетнаме и Odyssey Festival.<br>Один из организаторов летних руфтопов в Mocква Сity и Hi-hat и ночных мероприятий Special Case Night, Art Rite, Dogma и Bunga-Bunga!<br><br>Face Control<br>Entry 500₽* [cash only]<br>*300₽ с репостом <a href="https://vk.com/wall-55837663_8775">записи ВК</a>&nbsp;</p>',NULL,'500.0',1,3,1,'','',false,false,NULL,NULL,'2023-01-16 18:27:43','2023-09-20 02:21:39',NULL,'','0',18,11),
	 (170,'Goom Gum','2023-01-20-goom-gum','2023-01-20',NULL,NULL,NULL,'<p>Чего ждёшь от предстоящих выходных? Я — тебя.&nbsp;<br>Будем отмечать жизнь, замедлять время и отдыхать душой и телом.&nbsp;<br>Мои друзья будут ставить музыку только для тебя в этот зимний уикенд.&nbsp;<br>Открываем портал в вечер пятницы вместе с Goom Gum.<br><br>Первый релиз Goom Gum под названием Karma, выпущенный на лейбле Aubliminal Soul принёс музыканту большой успех.&nbsp;<br>Всемирно известный диджей Solomun сыграл трек Shambala на afterparty Amaterdam Dance Event.&nbsp;<br>Видео с выступления облетело социальные сети с вопросами, чья эта работа.&nbsp;<br>Позднее Solomun сделал премьеру ремикса Goom Gum на трек Depeche Mode «Master&amp;Servants».&nbsp;<br>Трек стал одним из главных хитов вечеринок на Ибице и вошёл в 5 лучших треков года по версии радиошоу Essential Selection на BBC Radio 1.&nbsp;<br>Под названием It’s A Lot он стал треком номер 1 в чартах UK Dance Chart- Cool Cute Charts и Nu Disco Beatport Chart.&nbsp;<br>Tommorowland One World Radio назвали Goom Gum одним из 20 артистов, которых нужно слушать в 2020 году.<br><br>Поддержку Goom Gum окажут Vakulenko, Renat, Keyton и Vistan.<br><br>Резерв по телефону и WhatsApp: 8 921 9381212<br><br>Вход FC/DC</p>',NULL,'',1,83,1,'','https://vk.com/lee_tommy',false,false,NULL,NULL,'2023-01-16 18:50:38','2023-10-07 14:49:54',NULL,'','0',18,15),
	 (171,'DJ Stereotr!p','2023-01-17-stirka40-dj-stereotrp','2023-01-17',NULL,'21:00:00',NULL,'<p>17 января, вторник&nbsp;<br>21:00 Dj Stereotr!p #synthwave #darkdisco<br>За баром с 11 Ден, с 20 Ася</p>',0,'',1,14,1,'','',false,false,NULL,NULL,'2023-01-17 12:51:16','2023-10-04 15:13:40',NULL,'','0',18,28),
	 (172,'Ночной Клуб Петров - 30 лет','2023-01-20-blanc-nocnoi-klub-petrov-30-let','2023-01-20',NULL,'22:00:00',NULL,'<p>Ночной клуб «Петров» 30 лет&nbsp;<br>Blanc, пт 20.01<br><br>Клубный проект №1, открывший свои «двери» в 1993 отмечает юбилей совместно с Радугой. Все селебы будут в этот вечер в Бланке. Гостей ждет музыкальная программа из дюжины артистов, шоу клоунов, цирковые номера, горы конфетти, а также Саша Петров, Хофманнита и Диджей Огурец (он же Сережа Мезенцев)</p>',900,'',2,36,1,'https://radugadiscoclub.ru/e200123','',false,false,NULL,NULL,'2023-01-17 14:03:31','2023-10-14 14:10:43',NULL,'','0',18,23),
	 (173,'Expand Reality','2023-01-21-stakensnaider-expand-reality','2023-01-21','2023-01-21','20:00:00','00:00:00','<p>Выпускники петербургского отделения школы электронной музыки Tramplin.pro представят полный спектр своих музыкальных селекций, собранных с большой любовью и вниманием к деталям.&nbsp;<br>Начнем с легкого и мелодичного house, плавно усложняя ритмы до electro и breakbeat и закончим вязким и тягучим deep techno.<br><br>Face Control<br>Вход свободный до 23:00</p>',0,'',1,3,1,'','',false,false,NULL,NULL,'2023-01-17 14:41:58','2023-08-30 01:48:27',NULL,'','0',18,3),
	 (174,'Галерея - Bu.Di Birthday','2023-01-20-gazgolder-galereia-budi-birthday','2023-01-20',NULL,NULL,NULL,'<p>Январская «Галерея» от команды Highway и день рождения Тимура Bu.Di. <br>Расширенную музыкальную программу будут сопровождать работы абсолютно новых художников, инсталляции, стилизованная терраса и классические световые решения «Галереи» на двух танцполах клуба&nbsp;</p>',1500,'',2,35,1,'https://bit.ly/gallerybudibday','',false,false,NULL,NULL,'2023-01-17 15:50:14','2023-10-21 04:24:06',NULL,'','0',18,31),
	 (181,'Абстрасенция','2023-01-28-abstrasenciia','2023-01-28',NULL,'22:00:00',NULL,'<p>Фестиваль Абстрасенция открывает 2023 год в Северной столице с масштабной музыкальной программой. С вечера до самого утра на новой площадке GAS, расположенной в самом центре Петербурга, выступят знаковые деятели атмосферной сцены.<br><br>За музыкальное настроение долгожданного события будут отвечать 10 музыкальных проектов. Выступит гуру даунтемпо и трип-хопа <a href="https://vk.com/longarmofficial">Long Arm</a>, резидент культового лейбла Anjunadeep <a href="https://vk.com/nuagemusic">Nuage</a>, мастер аналоговых синтов и джазовых запилов <a href="https://vk.com/kiyan_kiyan">kiyán</a>, лауреат премии Сергея Курехина и участник Boiler Room <a href="https://vk.com/monokle">Monokle</a>. Свой первый сет на Абстрасенции сыграет <a href="https://vk.com/dveylmusic">Dveyl</a>. <a href="https://vk.com/sloati">Sloati</a>, <a href="https://vk.com/woodmood">Woodmood</a> и <a href="https://vk.com/aortaa_music">Aortaa</a> сыграют сеты с глубоким погружением в британский пасмурный саунд на стыке гэриджа, вейва и тустепа.<br><br>Начало нового сезона ознаменуется компанией друзей и единомышленников, запоминающимся и разнообразным лайн-апом, праздничным настроением и теплой атмосферой фестиваля, который в этом году отметит десятилетие.</p>',800,'',1,NULL,1,'https://abstrasension.ru/spb2023??utm_source=vk&utm_medium=cpc&utm_campaign=mainpost','https://vk.com/abstrasension_night',false,false,NULL,NULL,'2023-01-18 13:43:46','2023-08-25 23:54:54',NULL,'','0',18,12),
	 (1337,'Grani - Saturday ','2023-07-15-ritmy-grani-saturday','2023-07-15',NULL,'22:00:00',NULL,'<p>Рассказываем о вечеринках в Гранях в эти выходные</p>',NULL,'0.0',1,197,1,'','',false,false,NULL,2,'2023-07-14 04:55:41','2023-10-24 21:06:59',NULL,'','0',18,64);
INSERT INTO public.events (id,title,slug,start_date,end_date,start_time,end_time,description,price_from,price_gate,city_id,venue_id,event_type_id,tickets_url,info_url,is_cancelled,is_featured,deleted_at,user_id,created_at,updated_at,ticketscloud_event_id,ticketscloud_event_token,ticketscloud_event_multi,age_limit,"views") VALUES
	 (175,'Абстрасенция','2023-01-21-treff8-club-abstrasenciia','2023-01-21','2023-01-22','22:00:00','06:00:00','<p>Фестиваль Абстрасенция открывает 2023 год в Москве с масштабной музыкальной программой. <br>С вечера до самого утра на двух сценах культурной площадки, расположенной в старинном особняке революционных годов, выступят знаковые деятели атмосферной сцены. <br>За музыкальное настроение долгожданного события будут отвечать 14 музыкальных проектов с обширной географией. <br>Из Петербурга приедут: гуру даунтемпо и трип-хопа Long Arm, резидент культового лейбла Anjunadeep Nuage, мастер аналоговых синтов и джазовых запилов kiyán, повелитель атмосферных танцев Numback. <br>С Воронежа приедет новый участник Framasound, с берегов Волги — знаковый резидент лейбла Unworldly. <br>Свои первые сеты на Абстрасенции сыграют Deescawa и Naarya. Sloati, Cultrow и Ennja сыграют сеты с глубоким погружением в британский пасмурный саунд на стыке гэриджа, вейва и тустепа. <br>Solar Bird представит сет с живой оркестровой флейтой.</p>',800,'',2,84,1,'https://abstrasension.ru/moscow2023??utm_source=vk&utm_medium=cpc&utm_campaign=mainpost','',false,false,NULL,NULL,'2023-01-17 17:10:02','2023-09-28 12:25:45',NULL,'','0',18,32),
	 (176,'Resonance Showcase','2023-01-21-prostranstvo-pole-resonance-showcase','2023-01-21',NULL,'22:00:00',NULL,'<p>Выходим после зимних каникул в «поле» и разворачиваем сцену с резидентами и друзьями. Распорядок ночи солидный: костяк главных танцевальных резонаторов — Nikita Zabelin, DESTROY и Vlas Leskin, новые имена в лице Karl Moor и Raciya Bağdad, а также mishxn и CPSL с цифровыми и аналоговыми лайвами. <br>Из сайд-квестов — большой мерчстор с новой коллекцией одежды и аксессуаров Resonance, и офлайн-лотерея с ценными призами.</p>',600,'',2,46,1,'https://polye.timepad.ru/event/2289072/https://polye.timepad.ru/event/2289072/#register','',false,false,NULL,NULL,'2023-01-17 17:18:45','2023-09-19 04:10:59',NULL,'','0',18,23),
	 (177,'Discoteque','2023-01-21-stakensnaider-discoteque','2023-01-21','2023-01-22','23:59:00','08:00:00','<p>8 часов света, улыбок, танца и волнующих ритмов breakbeat, bass, dark disco, new beat, electro, techno и даже немного jungle и trance.<br>Главное - чтобы обувь не жала, и костюмчик сидел как влитой.<br><br>Face Control<br>Entry 500₽* [cash only]<br>*300₽ за репост афиши в Инста Raw&amp;Voice</p>',300,'500.0',1,3,1,'','',false,false,NULL,NULL,'2023-01-17 19:13:52','2023-10-25 18:20:14',NULL,'','0',18,8),
	 (178,'Chinese Syndicate','2023-01-21-gazgolder-chinese-syndicate','2023-01-21',NULL,'23:00:00',NULL,'<p>В новогодние праздники улицы расцветают и не важно это Нью-йорк или Берлин, город просыпается, а вместе с этим и вся тусовая флэйва. <br>Прошвырнувшись по любимым барам ваше внимание привлекут красные фонари и это вовсе не Амстердам как вы могли бы подумать. <br>Это China-town ребятки, вы по адресу, благо он есть почти в каждом городе планеты. <br>Вы спросите: как мы там оказались? <br>Да посмотрите на календарь! <br>Китайский Новый год, во время которого перемирие объявляют даже мафиозные кланы. Синдикат не стоит в стороне и продлевает праздники ни на что не похожим музыкальным событием. Оно и верно, ведь по хорошим сходкам можно было уже соскучится.</p>',1000,'',2,35,1,'','',false,false,NULL,NULL,'2023-01-17 20:21:27','2023-08-30 02:46:46',NULL,'','0',18,3),
	 (179,'WARPP 21.01','2023-01-21-warpp-warpp-2101','2023-01-21',NULL,NULL,NULL,'<p>В эту субботу в клубе Warpp состоится невероятная вечеринка, на которой выступят три талантливых и известных артиста - Valer den Bit, Space Food и Netochno.<br>Valer den Bit своим уникальным стилем и музыкальным мастерством завораживает аудиторию с первых минут выступления. Space Food известны своими экспериментальными саундом и запоминающимися треками. Netocno же представит свои самые яркие и зажигательные хиты.<br><br>Аудитория сможет полностью погрузиться в атмосферу клуба и музыки. Не пропустите этот незабываемый вечер!<br><br>Списки на сайте - warppclub.com<br>Резерв столов по телефону 500-09-01</p>',NULL,'1000.0',1,23,1,'','',false,false,NULL,NULL,'2023-01-17 20:27:45','2023-08-25 23:14:11',NULL,'','0',18,1),
	 (180,':DATA - 21.01','2023-01-21-rndm-data-2101','2023-01-21',NULL,NULL,NULL,'<p>Едва успев восстановиться после новогоднего безумия, «дата» врывается с анонсом второй раз за месяц!<br>В этот раз встречаем в гостях:<br><br>• Grim Hellhound - ведущие подкаста Abstruse от Neuropunk Records, трио из Брянска и Санкт-Петербурга с релизами на Ekou, Four Corners, Inception, Huski, High Resistance, Citate Forms, Emphaseas, Onset Audio;<br><br>• Kije - продюсер из Санкт-Петербурга с внушительным бэк-каталогом релизов на Critical, Vision, Invisible, Hospital и нашем Data Music.<br><br>• Mr. Frenkie - супер-стар продюсер, участник Phlegmatic Dogs, автор бессмертного «Bass Symptom», который недавно обновился ремиксом от Audio. В январе ждем выхода ответного ремикса от Mr. Frenkie на совместку от BSE и Prolix.<br><br>Резидентский состав: Subwave, Traffic, Alyness. И дебют :data - Neinzge.</p>',600,'',2,27,1,'https://moscow.qtickets.events/59394-data','https://vk.com/data_21_01',false,false,NULL,NULL,'2023-01-18 12:44:09','2023-08-25 23:30:02',NULL,'','0',18,7),
	 (253,'A CASA','2023-01-27-powerhouse-a-casa','2023-01-27',NULL,'23:00:00',NULL,'<p>Искрящаяся вечеринка команды A CASA с танцами под диско, хаус, ломаный саунд и другую веселю электронику.&nbsp;<br>Стоимость: за донейшн (сколько не жалко)</p>',0,'',2,5,1,'','',false,false,NULL,NULL,'2023-01-26 14:44:36','2023-10-20 14:20:19',NULL,'','0',18,25),
	 (185,'Катэраг х Esc.','2023-01-21-griboedov-katerag-x-esc','2023-01-21',NULL,'23:00:00',NULL,'<p>Ты далеко, далеко<br>И между нами снега<br>И между нами огонь<br>И между нами ветра<br><br>Начинаем год с первого и совершенно эксклюзивного для Петербурга шоукейса знакового новосибирского комьюнити – «ESC.».<br>Зародившись как клуб, «Эск.» быстро стал центром притяжения деятелей культуры со всей Сибири. Сейчас команда активно принимает участие в развитии электронной сцены, резиденты пестрят мощными релизами и становятся участниками крупных столичных ивентов.<br><br>Симбиоз команд предвещает многогранное музыкальное наполнение: техно, транс, брейкс, электро и тяжелое индустриальное звучание.<br><br>Вход:<br>400 — с репостом<br>600 — без внимания<br>На предпродаже минимальный прайс.</p>',400,'600.0',1,86,1,'https://spb.radario.ru/events/1855650/tickets','',false,false,NULL,NULL,'2023-01-18 14:16:45','2023-10-03 19:25:45',NULL,'','0',18,20),
	 (186,'Harmonia Caelestis oppos Lunaeus','2023-01-21-factory-3-harmonia-caelestis-oppos-luna','2023-01-21',NULL,NULL,NULL,'',NULL,'',1,7,1,'','',false,false,NULL,NULL,'2023-01-18 15:55:33','2023-08-26 00:08:35',NULL,'','0',18,3),
	 (187,'Точка Сбора','2023-02-11-loft-metamorfoza-tocka-sbora','2023-02-11',NULL,'23:00:00',NULL,'<p>11.02.2023 Отправляемся на встречу звуковых фантазий.<br>Как всегда Вас ждут незабываемые звуковые вибрации от кудесников своего дела!&nbsp;<br>Мы рады пригласить Вас в самую дальнюю точку сбора, психоделичных музыкальных ритмов.<br>&nbsp;<br>ОФОРМЛЕНИЕ СЦЕНЫ&nbsp;<br>Evgeniy Zheton&nbsp;<br><br>ПЕРФОМАНС<br>Masha Solntse<br><br></p>',700,'1000.0',1,87,1,'https://rupor.biz/widgets/event-tickets/810','https://arendalofta-spb.ru/tochkasbora',false,false,NULL,NULL,'2023-01-18 15:59:36','2023-09-19 00:37:46',NULL,'','0',18,13);
