	 (188,'Последний Рейв - Inquisition','2023-02-11-ionoteka-poslednii-reiv-inquisition','2023-02-11',NULL,'23:30:00',NULL,'<p>Бесы устраивают одержимые танцы, черти опустошают бар, ведьмы проводят свои последние магические ритуалы, а злые духи срывают голос под музыку, которую для них в последний раз перед казнью ставит Святая Инквизиция.&nbsp;<br><br>В этот раз на Последнем Рейве соберётся самая тёмная нечисть, которой нечего терять и которой перед исполнением приговора остаётся только устраивать свои отчаянные танцы под звуки техно.<br><br>Дата: 11 февраля&nbsp;<br>Время: 23:30<br>Место: Ионотека, Лиговский 50к16<br>Вход: 300₽</p>',300,'',1,40,1,'','https://vk.com/last.russian.rave',false,false,NULL,NULL,'2023-01-19 14:29:54','2023-10-24 21:24:18',NULL,'','0',18,29),
	 (189,'Пламя','2023-01-18-pticia-licnost-plamia','2023-02-18',NULL,'23:00:00',NULL,'<p>Это была долгая пауза, но ПЛАМЯ вновь разгорелось ! Проект, призванный зажечь огонь в наших сердцах и пробудить любовь.<br>Тебя ждёт 2 жарких зала ломанного римта&nbsp; и конечно, Огонь!<br>На этой дискотеке для вас&nbsp; выступит отличный состав артистов&nbsp;<br><br>Пламя загорится 18.02 в 23:00 в клубах Мотив &amp; Птичья Личность&nbsp;</p>',400,'',1,4,1,'https://spb.qtickets.events/60432-plamya-probuzhdenie','https://vk.com/club218295909',false,false,NULL,NULL,'2023-01-19 16:14:03','2023-09-28 09:25:56',NULL,'','0',18,9),
	 (191,'Попофф в Поле','2023-01-20-prostranstvo-pole-popoff-v-pole','2023-01-20',NULL,'23:00:00',NULL,'<p>Шло время, Попофф в своем доме, что на втором круге городища Московии находится, жил-поживал, как и все молодцы, но чует, что скука душегубом на сердце засела и вспомнил он, что в Поле чудеса творятся и решил махнуть не глядя на то Поле.&nbsp;<br>Пришел, осмотрелся, никого – пустота: ни Шальной Суки, ни музыкантов в одеждах блестящих, н-и-к-о-г-о…<br><br>FC/18+</p>',NULL,'1000.0',2,46,1,'','',false,false,NULL,NULL,'2023-01-19 22:23:37','2023-09-18 05:54:52',NULL,'','0',18,28),
	 (192,'Параграф 6: Inside Out','2023-02-17-rndm-paragraf-6-inside-out','2023-02-17',NULL,'22:00:00',NULL,'<p>Важные подробности о вечеринке Параграфа и релизе нового эпизода.<br><br>Через несколько дней на нашем <a href="https://youtube.com/@Paragraphs">ютубе</a>&nbsp;выйдет интервью с героем новой серии и вы наконец узнаете, кто этот талантище. До того момента мы запускаем продажу Friends тикетов по 500₽ &nbsp;<br>Мероприятие начнётся в 22:00 с показа фильма и продолжится полноценной вечеринкой до утра.&nbsp;<br>Хэдлайнер ночной части — топ, поверьте моему вкусу!<br><br>Интервью выйдет в воскресенье, в 18:00 по Москве. После этого билеты подорожают — так что советую вам купить их сейчас!</p>',500,'',2,27,1,'https://moscow.qtickets.events/60419-paragraf-shest-inside-out','',false,false,NULL,NULL,'2023-01-19 22:31:16','2023-10-24 10:27:00',NULL,'','0',18,17),
	 (198,'Beatcomp Vol.2','2023-01-26-union-beatcomp-vol2-5','2023-01-26',NULL,'20:00:00',NULL,'<p>26 января в Ю — второй по счету BoomBap-фестиваль Beatcomp Vol.2, посвященный золотой эре хип-хопа 90-х. Весь вечер — только оригинальные биты с винтажных сэмплеров от поборников жанра, виниловые сеты и олдскульный флоу от мастеров речитатива.<br><br>Ведущий: <a href="https://vk.com/maxroa">Beatdigga</a><br><br></p>',400,'',1,8,1,'https://spb.radario.ru/events/1857048/tickets','',false,false,NULL,NULL,'2023-01-20 14:36:58','2023-10-23 21:03:02',NULL,'','0',18,37),
	 (322,'VDL','2023-02-10-powerhouse-vdl','2023-02-10',NULL,'23:00:00',NULL,'<p>Триумфальное возвращение на клубную карту промогруппы VDL. Ребята отмечают день рождения своего идеолога Никиты Соколова под бодрые диджей-сеты дружественных артистов.</p>',0,'',2,5,1,'','',false,false,NULL,NULL,'2023-02-09 02:46:02','2023-09-28 13:04:16',NULL,'','0',18,11),
	 (796,'Itallika','2023-04-29-union-itallika','2023-04-29',NULL,'22:00:00',NULL,'<p>Ваша любимая ITALLIKA в субботу в Юнионе&nbsp;<br>Вход до 23.00 фри, после 400₽.</p>',0,'400.0',1,8,1,'','https://t.me/itallikaparty/496',false,false,NULL,NULL,'2023-04-27 14:07:15','2023-09-28 01:23:09',NULL,'','0',18,71),
	 (200,'ÇAVA','2023-01-21-otel-akyan-cava-1','2023-01-21',NULL,'21:21:00',NULL,'<p>ÇAVA со всей силы врывается в 2023!<br>Прокрути в голове песню… бла-бла-бла… да какая к черту разница?&nbsp;<br>Никаких ограничений!&nbsp;<br>Хоть Рикардо Вилалобос, хоть Маша Распутина. З<br>а вертушками великие профессионалы, на месте сориентируются и сделают всё правильно.&nbsp;<br><br>Повеселиться хотите? Ну, вот и везите своё грешное тело на Саву. Еще у Саши День Рождения.&nbsp;<br>Это та, которая придумала Саву с Валерой.<br>Лайнап задорный!<br><br>Дресс-код: просто красиво. Празднично. Блестяще. Пышные шевелюры приветствуются!</p>',500,'1000.0',1,90,1,'','',false,false,NULL,NULL,'2023-01-20 14:47:21','2023-10-03 18:24:06',NULL,'','0',18,12),
	 (202,'Branch Garage','2023-01-20-backstage-branch-garage-1','2023-01-20','2023-01-21','22:00:00',NULL,'<p>Январский уикенд в BACKSTAGE от Branch Garage<br>Танцевальная рок вечеринка с качественным звуком, диджей сетами с винила и демократичным баром <br>А также зал с пинболом и фри бильярдом, дайнер и свой закрытый двор. <strong><br></strong><br></p>',0,'',1,92,1,'','',false,false,NULL,NULL,'2023-01-20 15:04:23','2023-01-20 15:05:01',NULL,'','0',18,0),
	 (203,'Electricity','2023-03-03-pravda-electricity','2023-03-03','2023-03-04','23:30:00','06:30:00','<p>Pravda Concert и T.L.N. Promo представляют свой первый рейв под флагом разножанровой электронной музыки. <br>Electricity — это safe space для тех, кто хочет заменить безумный ритм города на чарующие ритмы электронной музыки. <br>Локация свободы и единения с пульсацией звуковых волн. <br>Настоящий катарсис от аудиовизуального наслаждения. <br>Эту ночь вы встретите с прогрессивными и талантливыми саунд продюсерами и диджеями отечественной сцены и пропустите через себя заряд музыкального электричества до мурашек на коже.</p><p><br></p>',800,'',2,20,1,'https://msk.showgogo.ru/events/concerts/electricity/03.03.23-23.30/','',false,false,NULL,NULL,'2023-01-20 16:18:24','2023-10-11 03:16:12',NULL,'','0',18,46);
