	 (204,'RVЯ','2023-02-11-factory-3-rvia','2023-02-11',NULL,'23:00:00',NULL,'<p>Рейверы!<br>Хороших рейвов должно быть много.<br>Поэтому<a href="https://vk.com/rave_rvya"> RVЯ</a> и <a href="https://vk.com/inbass">IN[BASS]</a> объединяются вместе на одну ночь - протестировать Вас и саундсистемы клуба Factory на прочность.<br><br>Рейву - быть!</p>',500,'',1,7,1,'https://spb.qtickets.events/60818-rvya-inbass','',false,false,NULL,NULL,'2023-01-23 17:56:53','2023-10-24 16:06:54',NULL,'','0',18,26),
	 (205,'Соматик Фест','2023-02-25-factory-3-somatik-fest','2023-02-25',NULL,'23:59:00',NULL,'<p>Om WiFi!<br>Добро пожаловать на первый в новом году Соматик Фест!<br>Slow Rave в Factory<br>Сектанский билет (для обладателей татуировки) - 300 рублей</p>',500,'',1,7,1,'https://rupor.biz/widgets/event-tickets/811','',false,false,NULL,NULL,'2023-01-23 18:09:53','2023-10-24 23:17:49',NULL,'','0',18,70),
	 (221,'Dark Carnival 2022','2023-04-07-a2-dark-carnival-2022','2023-04-08',NULL,'20:00:00',NULL,'<p>Карнавал «без масок». Только вы, ваша индивидуальность, уникальный стиль, музыка и танцы. <br>Масштабный праздник индивидуальности, безграничной свободы и самовыражения. <br>Место, где можно и нужно заявить о себе: «Я НЕПОВТОРИМЫЙ!» <br>Заявить через то, что снаружи и то, что внутри. <br>Ваш характер, облик, мысли и желания.<br><br>Три танцпола. Более 40 ди-джеев стилей EDM, bass House, drum &amp; Bass, breakbeat и Uk garage.<br><br>Снимайте маски, будьте собой и зажигайте вместе с нами.</p>',700,'',1,95,1,'https://afisha.timepad.ru/event/2176767','',false,false,NULL,NULL,'2023-01-23 22:57:12','2023-10-05 16:16:17',NULL,'','0',18,78),
	 (1338,'Vinyl sets','2023-07-14-technodoner-elistratov-vinyl-set','2023-07-14',NULL,'20:00:00',NULL,'<p>Виниловая кебабно-праздничная пятница и нетривиально звучащий субботний klubnacht<br><br></p>',NULL,'0.0',1,194,1,'','',false,false,NULL,2,'2023-07-14 05:04:10','2023-10-13 05:31:19',NULL,'','0',18,94),
	 (206,'Закрытие кафе «Снежок»','2023-01-27-prostranstvo-pole-zakrytie-kafe-snezok','2023-01-27',NULL,'22:00:00',NULL,'<p>Антоха МС, официальный представитель светлого хип-хопа и хранитель ритма наших сердец, закроет сезон работы кафе «Снежок» 27 января. <br>Кроме него в лайнапе б2б сет алтайской принцессы и создательницы лейбла ДРУГ Наташи Бай и основателя клуба «Дом» Fitmess, виниловых дел мастер Dj Tactics, резидент лейбла ГОСТ ЗВУК vtgnike6 и Enfant — когда-то казанский, а ныне московский диджей и продюсер.<br>В одном зале пройдут концерт и диджей сеты, в другом — вторая встреча караоке-клуба «Зеленый свет» клипмейкера, блогера и просто фаната покричать в микрофон Никиты Зеленого. <br>Попрощаемся со «снежком» и вместе перейдем в состояние подснежников с ожиданием весны и теплых дней.<br><br>Билеты (https://polye.timepad.ru/event/2300749/?utm_source=google&amp;utm_campaign=cpc&amp;utm_content=link&amp;utm_term=6)<br><br></p>',800,'',2,46,1,'https://polye.timepad.ru/event/2300749/?utm_source=google&utm_campaign=cpc&utm_content=link&utm_term=6','',false,false,NULL,NULL,'2023-01-23 18:23:53','2023-10-18 18:40:33',NULL,'','0',18,15),
	 (288,'Flip Flap','2023-02-03-union-flip-flap','2023-02-03',NULL,'22:00:00',NULL,'<p>&nbsp;снова выходят в оффлайн и собирают друзей под одной, любимой и знакомой крышей Ю. В эту пятницу будет минимальное количество рэпа, хип-хопа и R&amp;B, по крайней мере — в классическом понимании.&nbsp;</p><p>Нас ждет современная электроника вроде Fred Again, UK Garage, Baile, Breaks и всевозможные танцевальные эдиты на современные треки, в том числе русские. Ребята будут жонглировать стилями и двигаться на скоростях от 120 до 150 BPM.<br><br>Вход до 23:00 — фри, после — 400₽</p>',0,'400.0',1,8,1,'','',false,false,NULL,NULL,'2023-02-01 18:56:04','2023-09-25 11:09:21',NULL,'','0',18,13),
	 (207,'Камон, Ра!','2023-01-28-cult-kamon-ra','2023-01-28',NULL,'23:00:00',NULL,'<p>Соскучились по костюмированным вечеринкам с зажигательной музыкой?&nbsp;<br>Тогда приглашаем вас к нам в клуб Cult на новое иммерсивное шоу "КАМОН, РА!".&nbsp;<br><br>Пока Санкт-Петербург заметает снегом, в самом его центре всего лишь на несколько часов откроются врата в мир вечного тепла и благоухающих оазисов.&nbsp;<br>Творческое объединение клуба Cult подготовило для вас новое костюмированное шоу.&nbsp;<br>Властительная царица Нефертити, утончённые полукошки-полудевы, битва техно-мумий, путешествие по волнам музыки и реки освежающих коктейлей – это и многое другое ждёт вас в мире мифов и легенд Древнего Египта.&nbsp;<br>Будет жарко, приходите!<br><br>Такое невозможно пропустить!&nbsp;<br>DC:&nbsp;<br>Приветствуются любые ваши ассоциации на тему мифов и легенд Древнего Египта.&nbsp;<br>Но если злые джинны помешают вас создать образ, приходите в самом ярком наряде из того, что есть.&nbsp;<br><br>Билеты уже в продаже.&nbsp;<br>Ранние птички по 700 рублей разлетятся 24 января, поэтому скорее переходите по ссылке, чтобы купить билеты по минимальной цене.&nbsp;<br><br></p>',700,'1600.0',1,92,1,'https://cult-event.timepad.ru/event/2298046/','',false,false,NULL,NULL,'2023-01-23 20:29:46','2023-09-18 18:01:32',NULL,'','0',18,22),
	 (208,'FairTone','2023-01-27-warpp-fairtone','2023-01-27',NULL,'23:00:00',NULL,'<p>В эту пятницу Warpp готовится к еще одному захватывающему событию. <br>На этот раз, мы пригласили одного из талантливых артистов Краснодарского края FAIRTONE - артист который привнесет в клуб невероятное количество энергии и зарядит всех присутствующих своими захватывающим сетам. <br>Вы сможете услышать его самые последние релизы и лучшие хиты. <br>Готовьтесь к незабываемой ночи. <br>Поддержку окажут наши резиденты Dabu Davout и Jimmy Hop&nbsp;<br><br>Списки на сайте -&nbsp;<br>Резерв столов по телефону 500-09-01<br>Литейный пр.53</p>',NULL,'1000.0',1,23,1,'','https://www.warppclub.com',false,false,NULL,NULL,'2023-01-23 20:43:20','2023-10-14 21:25:01',NULL,'','0',18,2),
	 (209,'Чувство Ритма: Paradise Garage','2023-01-27-community-moscow-cuvstvo-ritma-paradis','2023-01-27',NULL,'22:00:00',NULL,'<p>27 января клуб Community (Космодемианская наб 2) “Чувство Ритма: Paradise Garage” w/ Stan Williams (Studio 54 - NYC).</p><p>«Чувство Ритма» приглашает всех нас вновь совершить путешествие во времени, прямо на танцпол легендарного нью-йоркского клуба «Paradise Garage», распахнувшего свои двери в 1977 году и правившего умами и настроениями слушателей вплоть до конца 80-х.&nbsp;<br>Специальный гость резидент легендарного диско-клуба Studio 54 Stan Williams (New-York)</p><p>Если клуб «Студия 54» являлся, как писали музыкальные критики, гламурной, напыщенной стороной disco, то «Райский Гараж» был клубом, про который говорили как про место, где живет настоящая танцевальная музыка. На сцене этого уютного местечка стартовали карьеры Мадонны и Грейс Джонс. Легендарный художник Кит Харинг родоначальник “стрит арта", создавал костюмы для вышеупомянутых певиц и делал декорации для вечеринок в «Paradise Garage», провозгласив моду на создание оных. В то время как идейный вдохновитель клуба и диджей Larry Levan, несмотря на уход из жизни в 1992 году, до сих пор считается лучшим диджеем мира благодаря своему неповторимому вкусу нашедшему отражение порой в круглосуточных 24-х часовых сетах в Paradise Garage, собиравшим огромное количество слушателей.</p><p>F/C</p><p>Билеты в предпродаже 1500 и 2000 руб.</p>',1500,'',2,58,1,'https://afisha.timepad.ru/event/2290839','',false,false,NULL,NULL,'2023-01-23 20:53:18','2023-10-14 17:50:18',NULL,'','0',18,34),
	 (210,'Exhaust 5: Infernal Massacre','2023-01-27-gorod-exhaust-5-infernal-massacre','2023-01-27',NULL,'23:55:00',NULL,'<p>Продолжение серии вечеринок под названием Exhaust, запоминающиеся своим посетителям атмосферой настоящего олдскул габбер события.</p>',500,'',2,63,1,'https://afisha.timepad.ru/event/2294332','',false,false,NULL,NULL,'2023-01-23 21:05:55','2023-10-19 21:15:29',NULL,'','0',18,29);
