	 (211,'EBM Day','2023-02-23-gorod-ebm-day','2023-02-23','2023-02-23','19:00:00','23:00:00','<p>23 Февраля ждем красивейших женщин и мужчин, которых объединяет любовь, любовь к EBМ.</p><p>35 лет назад музыкантами бельгийской группы Front 242 был придуман термин Electronic Body Musiс (сокращенно EBM). <br>За прошедшее время стиль менялся, модернизировался, приходил в упадок, воскресал и возвращался к своим корням. <br>Но всегда он объединял вокруг себя людей верящих в магию чисел 242. <br>Во всем мире стало традицией 24 февраля (24/2) каждого года отмечать Международный День EBM, в этом году мы решили сделать это на день раньше, дабы дать душе хорошо разгуляться.<br><br>Live: <strong>STRONG PRODUCT</strong> / <strong>ZOЙD</strong> / <strong>OUTPOST 11</strong></p>',770,'',2,63,1,'https://afisha.timepad.ru/event/2287574','',false,false,NULL,NULL,'2023-01-23 21:13:58','2023-10-14 21:22:12',NULL,'','0',18,34),
	 (262,'Dark Inside - Bloody Valentine','2023-02-18-lastocka-dark-inside-bloody-valentine','2023-02-18',NULL,'23:00:00',NULL,'<p>18 февраля Dark Inside Production представит грандиозное мероприятие ко дню Святого Валентина!<br><br>Впервые за долгое время на двух танцполах соберутся лучшие артисты в underground drum and bass поджанрах.</p>',700,'1200.0',1,10,1,'https://spb.qtickets.events/59374-dark-inside-production','https://vk.com/darkinside001',false,false,NULL,NULL,'2023-01-26 16:37:33','2023-10-25 06:28:38',NULL,'','0',18,61),
	 (212,'Dark Pop','2023-02-03-kinky-rouge-dark-pop','2023-02-03','2023-02-03','19:00:00','22:00:00','<p>Когда вся мишура облетела, и все праздники отгремели, мы ждём всех городских уже уставших романтиков в клубе Kinky rouge с слегка меланхоличным коктейлем из дарк-поп групп с их темной стороной электронного звучания, минорной очаровательностью и текстами с мрачной эстетикой.</p><p>Ингредиенты нашего коктейля:<br><strong>Omnimar</strong> - dark-pop проект с качественным альтернативным электронным звучанием. <strong>Flower knife</strong> - группа, которой удается сочетать всю беззаботность синтипопа и мечтательную задумчивость тёмной электроники. <strong>Fatal Aim</strong> удивит самобытным сочетанием плотного электронного звучания и чувственного, такого кристально-легкого женского вокала. <strong>From Techno To The Sun</strong> - дуэт, исполняющий смесь из авторской электроники, атмосферной гитары и необычного вокала.</p>',700,'',2,62,1,'https://afisha.timepad.ru/event/2292053','',false,false,NULL,NULL,'2023-01-23 21:33:08','2023-10-22 20:19:18',NULL,'','0',18,17),
	 (213,'Gothwave - 2 Years','2023-02-11-pravda-gothwave-2-years','2023-02-11','2023-02-12','23:59:00','05:30:00','<p>Приглашаем наш приход 11 февраля на Birthday GOTHWAVE в новый клуб “Pravda”. Эта новая локация с огромным танцполом до 700 человек, как нельзя лучше позволит отметить эту прекрасную дату, и разумеется, служит еще одним подтверждением, что мы переходим на новый уровень, благодаря всем вам. Больше качественного звука, больше интересных групп, больше новых встреч!<br><br>В эту ночь вас ждет погружение в атмосферу лучших goth-тусовок старой школы благодаря нашим музыкантам: Пожалуй, только мертвый не знает, что My Coffin Rats - одна из самых ярких и заметных команд deathrock-сцены на пространстве СНГ. А Tourmaline Bats - настоящие готы с Южного Урала, сочетающие эксцентричный вокал и обволакивающее дарквейв звучание с пронзительными намеками на горячий и мрачный рифф старых Alien Sex Fiend и March Violets.<br><br>За пляски на костях отвечают наши бессменные резиденты DJ Flo, DJ I.K.S и DJ Fallen.</p>',550,'',2,20,1,'https://afisha.timepad.ru/event/2236620','',false,false,NULL,NULL,'2023-01-23 21:39:28','2023-09-22 00:39:41',NULL,'','0',18,19),
	 (214,' Invaders: Follow The Rabbit','2023-02-03-aglomerat-invaders-follow-the-rabbit','2023-02-03',NULL,'22:55:00',NULL,'<p>Следуй за нами!</p>',600,'',2,56,1,'https://afisha.timepad.ru/event/2299281','',false,false,NULL,NULL,'2023-01-23 21:48:01','2023-10-08 02:45:24',NULL,'','0',18,16),
	 (215,'Shanti Valentine Day - Rave-Meditation','2023-02-11-chateau-de-fantomas-shanti-valentine-da','2023-02-11',NULL,'19:00:00',NULL,'<p>То, чего вы так долго ждали! 11 февраля 11 часов рейва на 3х танцполах замка Chateau de Fantomas на рейв-медитации Shanti Valentin Day, посвящённой, конечно же, Дню Всех Влюблённых!</p><p>Вас ждёт мультиформатная электронная музыка с этническим вайбом!<br><br>SpaceTime Stage (Psy Prog)<br>Space Reality Stage (Indie, Melodic, Progressive)<br>Ethno Stage (Organic, Afro, Ethno Electronica, Drum &amp; Bass, live).<br><br>Будет работать шанти ЗАГС, где вы сможете сочетаться браком за 5 минут и получить памятный сертификат. <br>А почта купидонов поможет передать послание понравившемуся незнакомцу или незнакомке.<br>Также в программе танцевальные, световые и арт-перфомансы, выставка художников, флюрный декор и творческий маркет.<br>Дресс-код под девизом "Дари любовь"! <br>Одевайтесь так, чтобы каждый, кто вас увидел, сразу понимал, что вы являетесь источником безусловной любви. <br>Это может быть образ хиппи, купидона, сказочный или эпатажный, блёстки, неон, сердечки... <br>В общем, включайте свою фантазию. <br>А феи с маркета и бьюти-зоны помогут вам в создании образов.<br><br>До встречи на танцполе в энергиях любви и танца!</p>',1500,'',2,93,1,'https://afisha.timepad.ru/event/2292208','',false,false,NULL,NULL,'2023-01-23 22:01:06','2023-09-07 20:54:41',NULL,'','0',18,21),
	 (217,'Fly Eternal: Skyline','2023-02-24-pravda-fly-eternal-skyline','2023-02-24',NULL,'23:00:00',NULL,'<p>В эту ночь мы подготовили для вас особенный сюрприз. Впервые в Россию прилетает звезда мировой trance-сцены, чьи треки издаются на таких лейблах, как Armada Music, FSOE, Black Hole Recordings, AVA White, Ori Uplift, Amsterdam Trance Records (Raz Nitzan Music), Evolve и огромном количестве других, имеют поддержку даже на ASOT! К нам прилетает LAST SOLDIER!<br><br>Так же свои сеты для вас подготовили самые топовые артисты trance-сцены со всех уголков России!&nbsp;<br>Из Питера, Сургута, Читы, Москвы! К нам приедет один из отцов trance музыки нашей страны, FEEL.&nbsp;<br>Так же танцпол будут взрывать Alexander Turok, Alex Believe, Alexander Komarov, Exouler, Ithil, Lazy Seal и многие другие!!!<br><br>Давайте вместе раздвинем горизонты реальности. <br>А что за ними? <br>Бесконечный поток эмоций, который даёт нам любимая музыка! <br>Ощущение полёта и бесконечного счастья! <br>Отыщем выход за горизонт в потоках звука и света. <br>Вырвемся за рамки и откроем новые грани!</p>',1200,'',2,20,1,'https://afisha.timepad.ru/event/2298312','',false,false,NULL,NULL,'2023-01-23 22:20:57','2023-10-24 20:54:08',NULL,'','0',18,68),
	 (218,'Тяжелые Четверги','2023-01-26-zoccolo-20-tiazelye-cetvergi','2023-01-26',NULL,'19:00:00',NULL,'<p>Казалось бы! А уже второй Тяжелый Четверг в этом году! Легче точно не будет!<br><br>&nbsp;Не приноси с собой агрессию, алкоголь, оружие, наркотики и политику.<br>&nbsp;FC &amp; DC<br><br>Like, Share, Repost, Subscribe!<br>GO HARDER!<br>ALL IN CORE!</p>',0,'',1,72,1,'','https://vk.com/hardthursday',false,false,NULL,NULL,'2023-01-23 22:30:31','2023-10-18 01:07:26',NULL,'','0',18,44),
	 (220,'Music Couture - Secrets By Tsinist','2023-01-27-cinist-music-couture-secrets-by-tsini','2023-01-27','2023-01-28','23:00:00','05:00:00','<p>27 января в Secret by Tsinist мы всю ночь будем играть отборную музыку, которую вы редко услышите в клубах!<br>Добро пожаловать!<br><br>FC/DC</p>',985,'',1,94,1,'https://afisha.timepad.ru/event/2296917','',false,false,NULL,NULL,'2023-01-23 22:50:33','2023-10-15 07:19:45',NULL,'','0',18,40),
	 (222,'CARTE BLANCHE - Raw Takes х Snarexx','2023-01-28-klub-rmc-carte-blanche-raw-takes-x-sn','2023-01-28',NULL,NULL,NULL,'<p>Ломаный ритм, стук их сердец <br>Свобода — начало, страх есть конец.<br>Пока звук превращает энергию в чувства <br>Здесь есть я, здесь есть ты, есть искусство.<br><br><strong>Carte Blanche</strong> со своей <strong>крайней </strong>вечеринкой влетает на местный танцпол с все так же заряженным лайнапом и янтарным настроем!<br>И этот раз вам запомнится надолго, ведь в наш хрустящий хлеб добавлены самые лучшие сорта русской пшеницы.<br>Мы добавили еще немного кунжута в виде инсталляции и сдобрили как следует сыром с некоторыми интересными промо ходами на пути к вечеринке<br><br>Очередная серия головокружительных брейкбитовых перебивок и раскатистых импульсов баса захватят вновь клуб РМЦ 28 января.</p>',400,'',13,96,1,'https://afisha.timepad.ru/event/2291379','',false,false,NULL,NULL,'2023-01-23 23:15:51','2023-09-26 23:01:11',NULL,'','0',18,34);
INSERT INTO public.events (id,title,slug,start_date,end_date,start_time,end_time,description,price_from,price_gate,city_id,venue_id,event_type_id,tickets_url,info_url,is_cancelled,is_featured,deleted_at,user_id,created_at,updated_at,ticketscloud_event_id,ticketscloud_event_token,ticketscloud_event_multi,age_limit,"views") VALUES
	 (223,'СПИРАЛИ','2023-02-03-fabrika-spirali','2023-02-03',NULL,'22:00:00',NULL,'<p>Очередной виток развития молодой и энергичной концепции all-night вечеринок, которая захватила умы и внимание многих артистов и диджеев Казани. <br>Спирали — это не просто объединение творцов электронной музыки, а поток творческой энергии, объединяющей&nbsp; людей разных направлений современного искусства. <br>В этом витке будут не только большой и разнообразный лайнап артистов, но и арт-инсталляции, пространство для спонтанной коллаборации и взаимодействия творческих людей, которые ищут новое в себе, в звуке, в рисунке, в живописи, в крафте.<br>Спирали — это эволюция эстетического развития каждого из нас.<br><br>Начало в 22:00 по часовому поясу Казани</p>',250,'',6,97,1,'https://afisha.timepad.ru/event/2298173','',false,false,NULL,NULL,'2023-01-23 23:22:36','2023-10-04 17:32:41',NULL,'','0',18,3),
	 (224,'Структура','2023-01-28-stakensnaider-struktura','2023-01-28','2023-01-28','20:00:00','00:00:00','<p>В субботу, 28 января резиденты Структуры по традиции выйдут за рамки одного стиля - соединятся ломаные ритмы и леденящий скрэтч, плотная бочка и форест вкрапления<br><br>Face Control<br>Вход свободный до 23:00</p>',0,'',1,3,1,'','',false,false,NULL,NULL,'2023-01-24 15:56:37','2023-08-25 23:27:04',NULL,'','0',18,5),
	 (225,'ChillOut Planet Festival - One Night in Moscow ','2023-03-07-aglomerat-chillout-planet-festival-on','2023-03-07',NULL,NULL,NULL,'<p>Всего на одну ночь мы спроецируем основные составляющие фестиваля и его атмосферу в клуб "Агломерат"<br>и наполним его самыми красивыми людьми столицы.</p>',NULL,'',2,56,3,'','https://chilloutplanet.ru/events/',false,false,NULL,NULL,'2023-01-24 20:06:15','2023-09-26 20:03:51',NULL,'','0',18,18),
	 (226,'ChillOutPlanet Festival','2023-07-18-chillout-planet-festival','2023-07-18','2023-07-23',NULL,NULL,'<p>Самый яркий фестиваль 2023 года для поклонников ChillOut пройдёт в псковской области!<br><br><br></p>',7150,'',2,NULL,3,'https://chilloutplanet.ru/','',false,false,NULL,NULL,'2023-01-24 20:19:25','2023-10-25 11:14:58',NULL,'','0',18,996),
	 (227,'RAVENSTVO x VOLCHOK','2023-01-28-rndm-ravenstvo-x-volchok','2023-01-28',NULL,'23:00:00',NULL,'<p>Красота в глазах смотрящего.<br>Да, сегодня вот такой поэтичный заход.<br>Мы ценим в тебе твоё чувство прекрасного.<br>Мы знаем, что у тебя самый лучший на свете музыкальный вкус.<br>Мы видим, как ты умеешь получать наслаждение от того, что окружает твоё взор.<br>Так, хорош выебываться, я так больше не могу.<br>Лучший клуб, лучший саунд, лучшие люди.&nbsp;<br>Да, это я о тебе!<br>Это не мы делаем рейв. Это ты его делаешь!</p>',NULL,'800.0',2,27,1,'','',false,false,NULL,NULL,'2023-01-24 21:12:13','2023-09-14 18:19:55',NULL,'','0',18,4),
	 (228,'Juicy Fruitt','2023-01-27-bar-na-flakone-juicy-fruitt','2023-01-27',NULL,'22:00:00',NULL,'<p>Надеемся что все уже отошли от оливье и холодца и вновь готовы к активным действиям.<br>Приглашаем провести последнюю пятницу января вместе с Juicy Fruitt.<br>Новая вечеринка от команды, на которой будут звучать новые имена и новые стили в музыке.&nbsp;<br>Miss Black отвечает за минимал, Gofreeze (Froufroufrou) — хаус, транс и электро, а Socool — брейкбит.&nbsp;<br>Резиденты также подготовили специальную музыкальную программу&nbsp;<br>До 23:00 - вход свободный</p>',0,'200.0',2,98,1,'','https://vk.com/wall-212682528_60',false,false,NULL,NULL,'2023-01-24 21:30:23','2023-09-18 22:27:13',NULL,'','0',18,4),
	 (229,'EUROTRIP','2023-01-28-griboedov-eurotrip','2023-01-28',NULL,'23:00:00',NULL,'<p>В эту субботу мы отправляемся в незабываемое путешествие в мир европейской электронной музыки.<br>Представляем вам новую серию вечеринок — EUROTRIP!<br>Начнём с кинопоказа, будем пить сангрию, общаться, и настраиваться на то, что будет ждать нас ночью.<br>А ночью — прямая бочка, электро, диско, транс и хайперпоп погрузят вас в атмосферу безумного танца.<br>Have a nice Trip!</p>',400,'600.0',1,86,1,'','',false,false,NULL,NULL,'2023-01-24 21:40:28','2023-10-25 07:00:33',NULL,'','0',18,10),
	 (263,'Secret Garden','2023-02-18-factory-3-secret-garden','2023-02-18',NULL,'23:00:00',NULL,'<p>18 февраля 2023 года в клубе Factory состоится вечеринка Secret Garden.<br>Мероприятие теперь целиком и полностью посвящено электронной музыке!<br>2 танцпола, мощный звук, свет, лазеры и тот самый вайб секретного сада под ломаные ритмы наших диджеев.&nbsp;<br>Все, как вы любите!<br>В ближайшее время два VIP билета разыграются среди подписчиков сообществ</p>',800,'',1,7,1,'https://spb.qtickets.events/60155-secret-garden','https://t.me/secret_garden_spb',false,false,NULL,NULL,'2023-01-26 16:42:27','2023-10-23 03:25:55',NULL,'','0',18,26),
	 (230,'СВЕТ','2023-01-28-bar-na-flakone-svet','2023-01-28','2023-01-29','23:00:00','06:00:00','<p>Свет — это серия локальных вечеринок — результат коллаборации двух московских комьюнити: Disco Muerte и Unicum Lab.&nbsp;<br>Это история про тепло и уют, опыт и страсть, доверие и уважение.&nbsp;<br>Про нас лично и про людей, которых мы любим и хотим собрать вместе.&nbsp;<br>Во времена, когда тьма кажется непроглядной, а мир вокруг необычайно хрупким, мы приглашаем вас в безопасное место, где общие вибрации слой за слоем складываются в единую картину, образуя новый нескончаемый поток энергии<br>С репостом - 400 руб.<br>Без репоста - 600 руб.<br>После 04:00 - 300 руб.<br><br>FC: 21+<br>DC: Black &amp; White &amp; Rainbow<br>&nbsp;<br>Следи за новостями.&nbsp;<br>Присоединяйся к нам.&nbsp;<br>Иди на Свет.</p>',NULL,'600.0',2,98,1,'https://t.me/+jJKdEmB2ZRlmMzUy','',false,false,NULL,NULL,'2023-01-24 22:01:40','2023-10-23 21:00:58',NULL,'','0',18,52),
	 (231,'Genesis⁵','2023-03-24-genesis5','2023-03-24','2023-03-25','21:00:00','06:00:00','<p>Genesis - городской side-проект фестиваля музыки и искусства в природных ландшафтах Sun Spirit Festival.<br>Проект синтеза музыкальных и творческих направлений для вскрытия эмоциональных инсайтов.&nbsp;<br>Дата выбрана не случайно.&nbsp;<br>Весеннее равноденствие - для северного полушария время начала астрономической весны, в момент которого проиcходит активация и запуск новых творческих энергий.&nbsp;<br>Как раскрываем замысел мы. Выразим идеи через театральный перформанс и свето-кинетическую инсталляцию и конечно музыку на двух танцполах.<br><br></p>',900,'',2,2,1,'https://cbiletom.ru/event.php?event=4064','https://vk.com/sunspiritfest',false,false,NULL,NULL,'2023-01-24 22:16:29','2023-10-20 18:22:08',NULL,'','0',18,92);
