	 (232,'НЕЖНЫЙ РЕЙВ','2023-01-29-lastocka-neznyi-reiv','2023-01-29',NULL,'20:00:00',NULL,'<p>&nbsp;29 января в стенах клуба "Ласточка" где выступят Вáрьюшка, ФЕЙ и Funkodoxals случится сплетение стилей, танцы и драйв от петербургских бендов.<br>Вáрьюшка — русско-французская лирика из глубинных фолк мотивов и искристого вокала, обнимающего теплом и светом.<br>ФЕЙ (ex. Kind Soul) — нежные песни феи, сотканные из соул музыки, звуков флейты и переливов женского вокала. Манят, обволакивают, уносят в сказку.<br>Funkodoxals — танцевальный фанк и импровизация от элиты петербургского джаза для тех, кто понимает.<br><br>ГДЕ:&nbsp;<br>Клуб «Ласточка» Транспортный пер. 10А<br><br>Билет 200 рублей&nbsp;<br>Билет на троих 500 рублей<br><br></p>',200,'',1,10,2,'https://nezhnyy-reyv.timepad.ru/event/2289311/','',false,false,NULL,NULL,'2023-01-25 00:12:01','2023-10-15 18:45:43',NULL,'','0',18,12),
	 (233,'NewTone','2023-01-26-al-capone-newtone','2023-01-26',NULL,'19:00:00',NULL,'<p>NewTone — научно-популярный журнал от «Мегабайт Медиа». 47-й выпуск посвящен музыке. Создавая этот выпуск, мы вдохновлялись эстетикой 2000-х — времени Бритни Спирс и Кристины Агилеры, укороченных топов со стразами и заниженных брюк, тотал пинка и бархата. Поэтому NewTone пестрит или даже кричит, привлекая внимание случайного читателя. Но главное, конечно, не форма, а содержание.&nbsp;</p><p>Проверить вашу музыкальную эрудицию предлагаем в квизе. Побороться за звание «Лучших на этой вечеринке» можно в составе команды. А если вы предпочитаете интеллектуальной деятельности физическую активность, то наши диджеи — DJUX и FOMIN — не дадут заскучать.&nbsp;</p><p>Вход в бар свободный. Если хотите принять участие в квизе, нужно зарегистрироваться <a href="https://clck.ru/33KP4T">по ссылке</a>&nbsp;<br><br></p>',0,'',1,99,1,'','',false,false,NULL,NULL,'2023-01-25 00:44:57','2023-10-22 11:00:23',NULL,'','0',18,5),
	 (234,'NeoEthnika Buddha Bar','2023-02-18-buddha-bar-neoethnika-buddha-bar','2023-02-18',NULL,'21:00:00',NULL,'<p>Яркий декор, оригинальные образы, музыканты, Dj’s, фотографы, художники, аквагрим, бьюти зона, световое шоу и многое другое!</p><p>Приходите проводить время среди близких по духу, ярких, умеющих наслаждаться жизнью людей. <br>Вас ждёт незабываемый аудиовизуальный трип, ослепляющий сознание яркими бликами и гипнотичными ритмами.</p>',1200,'',1,38,1,'https://light-fluor-dance.timepad.ru/event/2290867/','',false,false,NULL,NULL,'2023-01-25 01:00:35','2023-09-18 10:57:11',NULL,'','0',18,25),
	 (235,'Avatar Party','2023-02-04-warpp-avatar-party','2023-02-04',NULL,'22:00:00',NULL,'<p>AVATAR PARTY в клубе WARPP в центре города с многоуровневым пространством, уникальными LED-панелями и звуковой системой FUNKTION-ONE. Вас ждет незабываемое музыкально-визуальное путешествие на планету ПАНДОРА!</p><p>Флуоресцентное тематическое оформление всего клуба, художники (раскрасят вас флуоресцентым аквагримом), DJ, проф. фото/видеографы, световое шоу, бар и кухня от клуба, чилл зона, 2 танцпола на 2 этажах.</p>',1300,'',1,23,1,'https://light-fluor-dance.timepad.ru/event/2292072/','',false,false,NULL,NULL,'2023-01-25 01:13:43','2023-10-11 17:30:10',NULL,'','0',18,25),
	 (279,'PUMPING & HARDBASS ZONE','2023-02-11-glastonberry-pumping-hardbass-zone','2023-02-11',NULL,'23:50:00',NULL,'<p>U77 Music presents:<br><br>11 февраля в GLASTONBERRY вновь зазвучат Pump &amp; Hardbass ритмы!<br>Огненный диджейский состав и специальные гости из Санкт-Петербурга - Sonic Mine и ЖестянЬщикИ.<br>Будем веселиться, общаться, отрываться и гудеть по-полной под нашу любимую музыку одной большой дружной семьей!<br>Зададим жару и раскачаем всё вокруг!<br>Welcome!<br><br></p>',500,'',2,109,1,'https://moscow.qtickets.events/61815-pumping-hardbass-zone','https://vk.com/pumping_zone',false,false,NULL,NULL,'2023-01-31 18:28:29','2023-10-25 02:20:54',NULL,'','0',18,44),
	 (264,'Love Fest 2023','2023-02-18-aurora-hall-love-fest-2023','2023-02-18',NULL,NULL,NULL,'<p>Скоро Санкт-Петербург содрогнется, обалдеет и упадет, потому что он возвращается! <br>Не пропусти главную ночь влюбленных, которая объединит тысячи гостей на легендарной арене города AURORA Concert Hall.<br><br>Предел напряжения растёт, атмосфера накаляется градус за градусом<br>Дай волю своим эмоциям и чувствам! Обрети новые знакомства и дружбу, получи заряд бешеных эмоций, энергии и драйва.<br><br>Тебя ждут огромный танцпол, VIP-ложа с балконом, своими удобствами и видом на главную сцену, подарки от партнеров, декорации, шоу, танцы, специальные гости, лучшие MC/DJ России, фото и видео с твоим участием.<br><br>Всем любви!</p>',700,'',1,25,1,'https://spb.qtickets.events/61258-love-fest-2023','',false,false,NULL,NULL,'2023-01-26 16:48:23','2023-10-04 23:49:16',NULL,'','0',18,55),
	 (236,'Funk You!','2023-02-03-stakensnaider-funk-you','2023-02-03','2023-02-04','21:00:00','06:00:00','<p>Одноименная серия вечеринок Funk You! снова прошумит в Stackenschneider . Ожидайте крутой лайн-ап с перкуссионным перформансом<br>За пультом для вас играют: <br><a href="https://vk.com/djquest">QUEST</a> — впитывает в себя атмосферу российской клубной рейв-культуры с 1995 года. Как обычно скрупулёзно отберет материал в стилях breaks&amp;breakbeat.<br><br>В подаче материала отличиться funky звучанием — улыбчивый <a href="https://vk.com/lexanidj">LEXANI</a>. Много соло, мелодичных треков и буйного брейкса для танцев.<br><br><a href="https://vk.com/schinderr">SHINDER</a> — тяготит к совмещению классического диджеинга (как на vinyl, так и digital носителях) c live составляющими. Экспериментирует со стилями и звуком, сохраняет общий близкий ему грувовый, фанки настрой выступлений. В этот раз выступит в дуэте с <a href="https://vk.com/shimpadzen">Ar2r</a> (electronic drums). Музыканты представят перкуссионный перфоманс. <br><br><a href="https://vk.com/outselect">OUTSELECT</a> — опытный селектор, отдающий предпочтение Bass, Jungle, Footwork, Breakbeat &amp; UK Garage саунду. Бас-продюсер, основатель лейблов <a href="https://vk.com/fatvibez">FAT VIBEZ Records</a> и Block160, вечеринки FYAH.<br><br><a href="https://vk.com/levicedj">LEVICE</a> — диджей, продюсер, основатель и куратор проекта <a href="https://vk.com/what_i_listen">what_i_listen</a>, освещающего брейкбит и бейс музыку. Ожидайте сет с действительно жирным звуком.<br><br><a href="https://vk.com/ivabadman">IVA</a> — King Of Remixes &amp; Future Junglist, коллекционер редких записей, дабок и эксклюзивных бэнгеров.<br><br>Face Control<br>Цена билета на входе после 0:00 — 500 RUB (Cash Only)</p><p><br></p>',0,'500.0',1,3,1,'https://funk-you.timepad.ru/event/2304594/','',false,false,NULL,NULL,'2023-01-25 01:26:00','2023-09-20 02:54:27',NULL,'','0',18,8),
	 (237,'Прожиточный Минимал','2023-02-03-prostranstvo-pole-prozitocnyi-minimal','2023-02-03','2023-02-04','23:00:00','05:30:00','<p>Два танцпола энтузиастов минимал-сцены с редкими бэк2бэками и глубоким звучанием.<br><br></p><p><br></p>',600,'',2,46,1,'https://polye.timepad.ru/event/2305365/','',false,false,NULL,NULL,'2023-01-25 01:34:31','2023-10-14 21:37:24',NULL,'','0',18,27),
	 (238,'FORESTRIP ','2023-02-04-gazgolder-forestrip','2023-02-04',NULL,'23:00:00',NULL,'<p>В первую субботу февраля мы отправляемся в путь, вновь назначая встречу всем мечтателям.<br>Мелодичное звучание, позитивные эмоции и танцы на новом маршруте Forestrip, который так давно ждали!<br>Открываем удивительный и многогранный мир музыки, наполненный светлыми чувствами и искренними танцами с артистами и друзьями лейбла Forestrip music.</p><p>&nbsp;Путешествие, которое нельзя пропустить.<br><br>Резерв столов: +7 (991) 265-03-55<br>FC/21+<br>С картами Highway Family вход свободный.</p>',1500,'',2,35,1,'https://forestrip.timepad.ru/event/2297849/','',false,false,NULL,NULL,'2023-01-25 01:51:21','2023-09-28 12:33:19',NULL,'','0',18,28),
	 (239,'RROOM in HAZE','2023-02-11-gazgolder-rroom-in-haze','2023-02-11',NULL,'23:00:00',NULL,'<p>Пять лет назад музыкальная платформа HAZE родилась в стенах Gazgolder, по этому случаю мы решили устроить шумное празднование совместно с проектом Rroom.</p><p>Гаранты атмосферы праздника - два полноценных лайнапа, два иностранных гостя и идеально настроенный акустический сетап на базе D&amp;B + Ampersound.<br><br>Технологичное и концептуальное наполнение интерьеров от HAZE architects.<br><br></p>',800,'',2,35,1,'https://rroom.timepad.ru/event/2303011/','',false,false,NULL,NULL,'2023-01-25 02:06:38','2023-10-23 02:22:26',NULL,'','0',18,85);
