	 (240,'Corpus One','2023-01-27-gazgolder-corpus-one','2023-01-27',NULL,'23:55:00',NULL,'<p>27 января команда CORPUS ONE собирает всех после новогодних праздников на первый ивент 2023 в клубе Газгольдер.<br>Гармоничное слияние световых инсталляций и электронной музыки от настоящих профессионалов своего дела, способных найти пути к сердцу меломанов.<br><br>EARLY BIRDS — 1000 RUB<br>FIRST RELEASE — 1200 RUB<br>SECOND RELEASE — 1500 RUB<br>DOOR PRICE — 1700 RUB<br>FC/DC<br>+18</p>',1000,'1700.0',2,35,1,'https://moscow.qtickets.events/60200-corpus-one-gazgolder','',false,false,NULL,NULL,'2023-01-25 22:07:40','2023-10-25 01:56:39',NULL,'','0',18,66),
	 (241,'Carte Blanche Gotica','2023-01-28-stakensnaider-carte-blanche-gotica','2023-01-28',NULL,'23:59:00',NULL,'<p>Нельзя дышать, и твердь кишит углями,<br>И ни одна звезда не говорит,<br>Но видит Бог, есть музыка над нами,<br>Дрожит вокзал от пенья Аонид,<br>И снова паровозными свистками<br>Разорванный, скрипичный воздух слит.<br><br>Нагонять жути и плотной материи пикирующих, словно каменные горгульи звуков, вызван сибирский гуру, обещавший показать много нового материала из своих потёмок — Roma Zuckerman.&nbsp;<br>Обеспечивать поддержку и руководство возведения правильного настроя будут архитекторы петербургского звука из объединений Roots United и Nasledie вместе с резидентами Carte Blanche, поэтому сгущаем краски вплоть до самого рассвета — до 8 утра.<br><br>Face Control<br>Entry 700₽* [cash only]<br>*Ранние пташки&nbsp; 500₽<br>Цена будет повышаться&nbsp;<br><br>DC: goth style | total black</p>',500,'700.0',1,3,1,'https://spb.qtickets.events/60935-carte-blanche-gotica','',false,false,NULL,NULL,'2023-01-25 22:21:08','2023-10-10 13:03:49',NULL,'','0',18,12),
	 (249,'Антоха МС х BIICMAK','2023-02-04-community-moscow-antoxa-ms-x-biicmak','2023-02-04',NULL,'23:00:00',NULL,'<p>Самое время строить планы на начало февраля! Тем более повод уже имеется.<br>Впервые на одной сцене главный добряк современного и танцевального хип-хопа — Антоха МС + родные и знакомые вам имена: Biicla, Essaii, Milkshakeis, Qarti и Lado. <br><br>Лайн-ап — праздник! Праздник любви, дружбы и музыки!<br>Так что поднимите еще раз глаза на афишу и правильно инвестируйте в свой уикенд. <br><br>Билеты на входе по спискам. <br>1000 по репосту, 1500 без репоста. <br>&nbsp;<br>*обладатели билетов early birds проходят без очереди. <br><br>Все новости о мероприятии читай в <a href="https://t.me/biiclaandfriends/821">телеграм-канале</a>&nbsp; <a href="https://t.me/biiclaandfriends/821">Biicmak </a><br><br>F/C</p>',1000,'1500.0',2,58,1,'','',false,false,NULL,NULL,'2023-01-26 14:12:40','2023-10-10 07:52:33',NULL,'','0',18,13),
	 (242,'Pioner & Portal Rave','2023-01-27-kinky-rouge-pioner-portal-rave','2023-01-27','2023-01-28','22:00:00','06:00:00','<p>Приветствуем всех! <br>Самые жесткие треки и слэмы для вас в эту пятницу только для вас в нашем любимом клубе Kinky Rouge. Мы готовы подарить вам ночь, пронизанный атмосферой рейва<br>Наши резиденты проекта заряжают дикий сет в стиле рейв пати, и готовы потратить всю свою энергию , что бы вы дико оторвались! Готовы ли вы потратить эту энергию вместе с нами?<br><br>Как попасть в список?<br>• Подписаться на<br><a href="https://vk.com/pioner.portal">PIONER &amp; PORTAL</a><br>• Сделать репост записи<br>• По спискам: 299<br>• Без списков: 500<br><br>С собой обязательно нужно иметь документы, подтверждающие личность.<br>• Доплата за фото документа: 200₽<br>• Гардероб FREE<br>&nbsp;<br>VIP - билет дает ряд классных преимуществ, обеспечивающих ваш комфорт:<br>• проход без очереди<br>• бесплатный вход без выполнения условий<br>• бесплатный гардероб<br>• отдельная закрытая комната с депозитом на бар&nbsp;<br><br>Количество билетов строго ограничено.</p>',500,'',2,62,1,'https://moscow.qtickets.events/61060-pioner-portal-rave-27012023','https://vk.com/pioner.portal',false,false,NULL,NULL,'2023-01-25 22:38:15','2023-10-09 21:38:56',NULL,'','0',18,28),
	 (243,'LIN&K','2023-01-27-griboedov-link','2023-01-27',NULL,'23:59:00',NULL,'<p>Отличным завершением недели для вас станет новый звук.<br><br>Ломаная ударка, басы, быстрый ритм и знакомая обстановка настроят на предстоящие выходные.<br><br>Пора снять напряжение и раствориться в потоке. Времени больше не существует, индивидуальность размывается, сознание и деятельность сливаются в одно.<br><br>Вход:<br>300 - с репостом<br>500 - без внимания</p>',300,'500.0',1,86,1,'','https://vk.com/wall-154594155_17028',false,false,NULL,NULL,'2023-01-25 23:19:06','2023-10-02 02:38:26',NULL,'','0',18,5),
	 (244,'CALL TO ALL ','2023-01-27-rndm-call-to-all','2023-01-27',NULL,'23:00:00',NULL,'<p>Совместная вечеринка команд Metamorphoses и TRYD — путешествие на стыке звука и стиля.<br><br>В программе опытные проводники и укротители напористых жанров</p>',NULL,'500.0',2,27,1,'','https://vk.com/wall-145793441_2115',false,false,NULL,NULL,'2023-01-25 23:26:34','2023-10-24 21:33:17',NULL,'','0',18,27),
	 (245,'Freedom Blast','2023-01-28-community-moscow-freedom-blast','2023-01-28',NULL,'23:55:00',NULL,'<p>Взрыв свободы, любви и счастья! Приветствуются ваши яркие образы в стиле хиппи (очки, парики и т.д)</p>',1500,'',2,58,1,'https://moscow.qtickets.events/60537-freedom-blast','',false,false,NULL,NULL,'2023-01-25 23:56:59','2023-10-22 09:18:07',NULL,'','0',18,19),
	 (246,'Kontrkult Showcase','2023-01-27-stakensnaider-kontrkult-showcase','2023-01-27',NULL,'23:59:00',NULL,'<p>Шоу-кейс клуба Контркульт: резиденты наполнят стены Stackenschneider каноничным техно и исполнят авторскую музыку.<br><br>Naslednik — сооснователь клуба Контркульт, создатель промо-групп Nasledie и Электробудка. Основой его сетов служит модулярное техно — тягучее и гипнотическое.&nbsp;<br><br>Partia — дуэт продюсеров с характерным индастриал и эйсид звучанием. Были отмечены итальянским изданием Insane Industry, где их можно услышать как в сборнике, так и в сольном альбоме. &nbsp;<br><br>Victor Nagaev — продюсер и диджей.<br>Его работы представлены в сборнике нидерландского лейбла Complex Maastricht, звучали в сетах европейских диджеев, наиболее известный из которых — Stan Christ.&nbsp;<br><br>Mvrlya — музыка Дани разнообразна по стилям — в основном это ломаные ритмы, а грань между электро и брейком стирается прямым сумрачным техно и уходит в мелодичную минорную гамму.<br><br>F/C<br>500 rub. [cash only]</p>',500,'',1,3,1,'','',false,false,NULL,NULL,'2023-01-26 13:47:38','2023-08-25 23:23:23',NULL,'','0',18,1),
	 (247,'Hardravers','2023-01-27-cult-hardravers','2023-01-27',NULL,'23:00:00',NULL,'<p>Это не просто вечеринка, это музыкальное событие, объединяющее людей, музыку, танцы, творчество, отдых, веселье, эстетическое наслаждение, общение, знакомства и обмен опытом.<br><br>На главном танцполе будут лайвы и сэты с винила. Играем классическое и глубокое шаманское техно, от Detroit и Hypnotic до Raw и Peaktime.<br><br>Dj ZIP отметит своим выступлением свой 36 (!!!) День Рождения!<br>С чем мы его и поздравим ночью!<br><br>Второй танцпол станет полноценной psy-chill зоной с чайной комнатой, выставкой шикарных картин наших друзей и отменной музыкой от ребят из <a href="https://vk.com/dreamfatum">Dreamfatum</a>!<br><br>Предварительная покупка входных билетов по 500 рублей сейчас доступна через сообщения группы <a href="https://vk.com/technobreeze">HardRavers</a>&nbsp;<br>Просто напишите "хочу билет" и администратор вам ответит.</p>',500,'700.0',1,92,1,'','https://vk.com/technobreeze',false,false,NULL,NULL,'2023-01-26 13:57:37','2023-08-26 00:02:06',NULL,'','0',18,1),
	 (248,'Vibe Room','2023-01-28-miraz-vibe-room','2023-01-28',NULL,'23:00:00',NULL,'<p>28 января Vibe Room гостит в Мираже — очень полюбившейся нам площадке на Петроградской стороне.<br><br>Хедлайнером события станет именинница Bambi Sofa, которая успела зарекоменодовать себя важным игроком на наших ивентах еще в прошлом году. Ловите ее за диджейкой в прайм тайм со специальным сетом в честь дня рождения.<br><br>Вход 500₽ по спискам / 700₽ без внимания к мероприятию</p>',500,'700.0',1,77,1,'','',false,false,NULL,NULL,'2023-01-26 14:02:47','2023-09-18 10:49:59',NULL,'','0',18,11);
