	 (397,'Lovemachine','2023-03-03-union-lovemachine','2023-03-03',NULL,'22:00:00',NULL,'<p>Lovemachine разгрузят от стресса будней. <br>&nbsp;<br>Вход до 23:00 свободный, после — 400₽ наличными</p>',0,'400.0',1,8,1,'','',false,false,NULL,NULL,'2023-02-28 23:49:21','2023-10-12 04:52:03',NULL,'','0',18,22),
	 (254,'Время Цыган','2023-01-27-union-vremia-cygan','2023-01-27','2023-01-28','21:00:00',NULL,'<p>Девятилетие бара <a href="https://t.me/unionbarspb">Union</a> совпало с Временем Цыган. <br>Временем, когда дом может быть где угодно, но главное — дом всегда внутри, где бы мы не находились. Временем кочевников, сплоченных таборов, песен и танцев на привалах, чёрных очей и романсов под гитару.<br>Надевайте свои лучшие серьги, перстни, платки, рубахи, жилетки, начищайте золотые зубы, седлайте лучших скакунов и табунами, придерживая шляпы, мчитесь к нашему балагану. <br>На звуки скрипки, блеск золота и вибрации басов. <br>Будем праздновать жизнь вместе со всеми резидентами бара. <br>Как и всегда в Ю.&nbsp;<br><br>(!) Не пропустите в пятницу в середине ночи музыкальный перформанс с настоящими цыганами с гитарами, юбками и скрипкам.<br><br>Обе ночи начнём в 21:00. Вход до 23:00 — фри, после — 500 золотых наличными.</p>',0,'500.0',1,8,1,'','',false,false,NULL,NULL,'2023-01-26 15:17:52','2023-09-30 21:41:17',NULL,'','0',18,3),
	 (255,'Время Цыган','2023-01-28-union-vremia-cygan','2023-01-28','2023-01-29','21:00:00',NULL,'<p>27 и 28 января Union отмечает 9 лет на вечеринкой «ВРЕМЯ ЦЫГАН».<br><br>Девятилетие бара <a href="https://t.me/unionbarspb">Union</a>&nbsp;совпало с Временем Цыган. <br>Временем, когда дом может быть где угодно, но главное — дом всегда внутри, где бы мы не находились. Временем кочевников, сплоченных таборов, песен и танцев на привалах, чёрных очей и романсов под гитару.<br>Надевайте свои лучшие серьги, перстни, платки, рубахи, жилетки, начищайте золотые зубы, седлайте лучших скакунов и табунами, придерживая шляпы, мчитесь к нашему балагану. <br>На звуки скрипки, блеск золота и вибрации басов. <br>Будем праздновать жизнь вместе со всеми резидентами бара. Как и всегда в Ю.&nbsp;<br><br>(!) Не пропустите в пятницу в середине ночи музыкальный перформанс с настоящими цыганами с гитарами, юбками и скрипкам.<br><br>Обе ночи начнём в 21:00. Вход до 23:00 — фри, после — 500 золотых наличными.</p>',0,'500.0',1,8,1,'','',false,false,NULL,NULL,'2023-01-26 15:24:58','2023-09-18 04:51:36',NULL,'','0',18,5),
	 (256,'Friday Nights','2023-01-27-deep-fried-friends-friday-nights','2023-01-27',NULL,'23:55:00',NULL,'<p>Пятничная ночь в тусовом ресторане Deep Fried Friends, который по выходным превращается в клуб. За музыку отвечают: электронщица Кедр Ливанский, амбассадоры уличного звучания ZULUWARRIOR, а также Gucci Kale и Ефим Гинзбург.</p>',0,'0.0',2,76,1,'','',false,false,NULL,NULL,'2023-01-26 15:29:31','2023-10-10 10:47:45',NULL,'','0',18,20),
	 (257,'НОЧНОЙ АМФИТЕАТР','2023-01-28-deep-fried-friends-nocnoi-amfiteatr','2023-01-28',NULL,'00:00:00',NULL,'<p>В эту субботу мы приглашаем всех в ресторан DFF, стать частью нашей новой вечеринки!<br><br>Только этой ночью мы сможем снять с себя маски, чтобы надеть новые. Какова ваша роль&nbsp; — зритель и актёр? Решать вам. Вы можете выбрать любой образ. «Ночной амфитеатр» - это вечеринка полной свободы, будьте теми кем давно мечтали и даже собой!<br><br>Из самого сердца северной столицы, на золотой колеснице к нам на сцену мчится король образов, легенда ТикТока, блогер и стендапер — ИЛЬЯ КУРУЧ, он же DJ FENIXXX ! К нему из печи, там где пеклись куличи предстанет отец-молодец, участник группы «Хлеб», блогер и местами актер — Саша Шулико. Добавит всему остроты под раскачанные биты – лучший менеджер всех главных артистов страны, таких как Cream Soda, Лауд, Lovanda, Dequine и др., неповторимый EASY FRESH. И под конец пьесы играют две принцессы: стилистки, модели ZISSTAA&nbsp; и JENDAYI.&nbsp;<br>Помните: чудеса начинаются в полночь&nbsp;<br><br>ВХОД ПЛАТНЫЙ&nbsp;<br>500₽ с 00:00 до 1:00<br>1000₽ с 1:00 и до конца<br><br>FC/DC</p>',500,'1000.0',2,76,1,'','',false,false,NULL,NULL,'2023-01-26 15:39:09','2023-10-21 00:02:00',NULL,'','0',18,29),
	 (258,'5/8 Radio Night','2023-01-28-bar-strelka-58-radio-night','2023-01-28',NULL,'23:00:00',NULL,'<p>Шоукейс комьюнити-радиостанции 5/8 Radio с её основателем Димой Сафроновым и диджеем Даней Прасдовым. Ожидайте много ритмичной электроники</p>',0,'0.0',2,103,1,'','',false,false,NULL,NULL,'2023-01-26 15:46:04','2023-10-13 23:15:10',NULL,'','0',18,46),
	 (259,'Суббота в Симаче','2023-01-28-bar-simach-v-nedalnem-subbota-v-simace','2023-01-28',NULL,'23:00:00',NULL,'<p>Бар, который стал реинкарнацией легендарного «Симача», принимает опытных московских диджеев. Настроение зададут близкий друг диско-клуба «Радуга» Sasha Khizhnyakov, а также селекторы Pasha Wonda и Lay-Far.</p>',0,'',2,104,1,'','',false,false,NULL,NULL,'2023-01-26 15:56:05','2023-10-12 23:38:15',NULL,'','0',18,52),
	 (260,'System 108','2023-01-28-bauns-system-108','2023-01-28',NULL,'22:00:00',NULL,'<p>Первый в 2023-м лейблнайт System 108. В лайнапе — резиденты команды и их молодые коллеги: Errortica, Kovyazin D, The Dawless, Cream Soda и другие важные на столичной электронной сцене артисты.</p>',1200,'',2,17,1,'https://system108.com/2023-01-28','',false,false,NULL,NULL,'2023-01-26 16:02:45','2023-10-02 16:56:28',NULL,'','0',18,25),
	 (261,'Kontrol','2023-02-18-zoccolo-20-kontrol','2023-02-18',NULL,NULL,NULL,'<p>Технодром под контролем! <br>Ты уверен, что управляешь своей жизнью, своими желаниями, своими мыслями и действиями. <br>Но кто управляет тобой?<br><br>Первая техно-вечеринка от Madfox Events в 2023 году в клубе Zoccolo 2.0 - KONTROL!&nbsp;<br>Только качественная музыка в стиле dark minimal и minimal techno, 16Квт звука, уникальный декор и видеоинсталляции!</p>',500,'',1,72,1,'https://spb.qtickets.events/61174-kontrol','https://vk.com/kontrolmdfx',false,false,NULL,NULL,'2023-01-26 16:13:18','2023-10-25 07:49:25',NULL,'','0',18,50),
	 (265,'Time Of Night XII','2023-02-25-time-of-night-xii','2023-02-25',NULL,NULL,NULL,'<p>Большое 12-летие промо группы Timeofnight, 25 февраля на трех сценах клуба Blank!<br><br>Приглашаем грандиозно отметить это событие и открыть новую XII главу нашей истории в, несомненно, лучшем для этого события месте - пространстве Blank, по адресу: Арсенальная наб.1, Санкт-Петербург.<br><br>Событие продлится 12 часов. <br>Начало в 22:00 и до 06:00. <br>Afterparty на двух танцполах с 06:00 до 10:00.<br><br>Преимущества VIP:<br>• Доступ к третьему танцполу Backstage;<br>• Отдельный VIP-вход без очереди:<br>• Сувенирный комплект TON (наклейки, бейдж, флаер).</p>',1000,'',1,1,1,'https://spb.qtickets.events/61050-timeofnight-xii-at-blank','https://vk.com/ton_2023',false,false,NULL,NULL,'2023-01-26 16:54:42','2023-10-25 09:37:47',NULL,'','0',18,52);
