	 (266,'Jazzy Vibes','2023-02-04-solaris-lab-jazzy-vibes','2023-02-04',NULL,'20:00:00',NULL,'<p>Друзья!&nbsp;<br><br>Приглашаем вас провести вечер субботы в уютном и тёплом Solaris lab. В этот раз мы наполним пространство&nbsp;<br>звучанием&nbsp; Acid Jazz, Trip-Hop, IDM, Electronica.&nbsp;<br><br>Задавать ритм будут<br>Гость из подмосковного Жуковского - Andy ADO&nbsp;<br>Резидент Ancient Future - Ekza Selecta<br><br>Место: Курляндская 49, Solaris lab<br>Начало: 20:00&nbsp;<br>Вход: 300 руб<br>Приобретайте билеты у t.me/usulra</p>',300,'',1,106,1,'','',false,false,NULL,NULL,'2023-01-31 12:26:56','2023-09-28 02:37:24',NULL,'','0',18,16),
	 (267,'Overload','2023-02-11-prostranstvo-pole-overload-1','2023-02-11',NULL,'22:00:00',NULL,'<p>Ускоренные ритмы вызывают увеличение массы лайнапа — встречаем «Перегрузку» на двух танцполах «поля». Масштабное объединение признанных мэтров жанра и героев новой школы в багровых тонах.</p>',600,'',2,46,1,'https://polye.timepad.ru/event/2304079','',false,false,NULL,NULL,'2023-01-31 12:37:21','2023-09-18 16:35:23',NULL,'','0',18,8),
	 (268,'ALGORITHM 1 YEAR','2023-02-24-gorod-algorithm-1-year','2023-02-24','2023-02-25','23:50:00','07:00:00','<p>Эй, братва! Давайте вместе гудеть! Начнём шизить и петь! Заряд ещё мощней! Драм-н-бейс всех сильней!<br><br>Этот год открываем мощнейшей вечеринкой, ведь в этом году мы отмечаем первый День Рождения команды. Да-да, друзья, уже как год мы делаем и создаём для вас праздничное настроение, стремимся на каждой нашей тусе дарить вам положительные эмоции и качественное музло! Этот год также не будет исключением и мы продолжим гнуть свою линию! Потому собрали братский лайнап, чтобы передать вам наш настрой и зарядить мощнейшей энергией на год вперёд!<br><br>BROCARD - вход free</p>',400,'',2,63,1,'https://moscow.qtickets.events/59832-algorithm-1-year-240223','https://taplink.cc/algorithm_moscow',false,false,NULL,NULL,'2023-01-31 12:50:35','2023-10-21 05:19:48',NULL,'','0',18,28),
	 (269,'SVOI Contrast','2023-02-10-gazgolder-svoi-contrast','2023-02-10',NULL,'23:00:00',NULL,'<p>За 3 года за вертушками проекта SVOI побывали практически все лучшие российские диджеи и несколько мировых звезд. Наш рост пришелся на удивительное и непростое время. И мы вместе с вами сделали его чуть лучше.<br>Наша миссия - создавать атмосферу тепла, добра и дружбы вопреки всеобщей турбулентности.<br>Быть оазисом, где каждый бы ощущал себя Своим.<br>SVOI - это актуальная музыка и лучшие артисты.<br><br>Мы за разнообразие стилей.<br>Предлагаем в этот раз повысить их контраст до максимума.<br><br>10 февраля новые впечатления на SVOI Contrast. Впервые нас ждет настоящий Techno танцпол с сильнейшими представителями сцены. Привычные минимал и тек вайбы будут царить на веранде.<br><br>Main:<br>Abelle / Anushka / Jeny Power / Sofia Rodina<br><br>Terrace:<br>Alexander Belousov / ByPass / D.A.L.I. / Cheese&amp;Cheese / Ogannes<br><br></p>',1000,'',2,35,1,'https://moscow.qtickets.events/60753-svoi-contrast','Http://vk.com/svoi_showcase',false,false,NULL,NULL,'2023-01-31 13:02:14','2023-09-19 01:03:52',NULL,'','0',18,27),
	 (270,'CWH w/ FeyDer','2023-02-10-rndm-cwh-w-feyder','2023-02-10',NULL,'22:00:00',NULL,'<p>В ночь с 10 на 11 февраля Клокворк Хэдс начинает новую главу джангл вечеринок в Москве. Вас ждет проверенный временем лайн-ап, охватывающий разные стороны бэйс-музыки и незабываемая дружественная атмосфера клуба.<br><br>Компанию резидентам составит гость из Нижнего Новгорода, продюсер, диджей, совладелец отечественного лэйбла Mashed Youths Records</p>',500,'',2,27,1,'https://moscow.qtickets.events/61039-cwh-w-feyder','https://www.linktr.ee/clockworkheads',false,false,NULL,NULL,'2023-01-31 13:12:41','2023-10-24 21:08:12',NULL,'','0',18,28),
	 (271,'HYPERBOLOID X RNDM','2023-02-04-rndm-hyperboloid-x-rndm','2023-02-04',NULL,'23:00:00',NULL,'<p>Шоукейс лейбла Hyperboloid в RNDM</p><p>Афиша: Gsmgarden</p>',500,'800.0',2,27,1,'https://moscow.qtickets.events/60919-0402-hyperboloid-x-rndm','https://vk.com/event218422461',false,false,NULL,NULL,'2023-01-31 14:28:51','2023-10-06 08:17:24',NULL,'','0',18,16),
	 (543,'Phangan Dreams','2023-03-17-community-moscow-phangan-dreams','2023-03-17',NULL,'22:00:00',NULL,'<p>Проекты GOA TV и ASIA EXPERIENCE решили объединиться 17 марта в клубе Community. Приглашаем вас окунуться в ночь мистического острова Koh Phangan!<br>DC: Boho!</p>',1800,'2000.0',2,58,1,'https://moscow.qtickets.events/65416-phangan-dreams','',false,false,NULL,NULL,'2023-03-17 16:00:47','2023-10-25 10:57:51',NULL,'','0',18,49),
	 (289,'Violet Techno','2023-02-10-balagan-violet-techno','2023-02-10',NULL,'23:00:00',NULL,'<p>10 февраля в самом центре Санкт-Петербурга в ночном клубе «BALAGAN» состоится ночная ультрафиолетовая techno-вечеринка!<br><br>8 часов электронной музыки и флуоресцентные краски под ультрафиолет сделают эту ночь незабываемо красивой.<br><br>Цена билета растет от количества продаж, торопись!<br><br>Ждём тебя, будет жарко !</p>',346,'',1,112,1,'https://spb.qtickets.events/59223-violet-techno','https://vk.com/sleepestet',false,false,NULL,NULL,'2023-02-01 19:02:17','2023-10-09 20:41:55',NULL,'','0',18,31),
	 (272,'Откровение','2023-02-04-blank-otkrovenie','2023-02-04',NULL,'23:00:00',NULL,'<p>Бочка лупцует остервенело, как отцовский ремень упражняется в воспитательстве, обращая зад виноватой дочери в пунцовый шмат мяса. Не выучила уроки? Пришла домой позже положенного? Сосалась со старшеклассником? Не дай боже!<br><br>Травматизирующая педагогика, и все же между ними вспыхивает искра, ежесекундно наливающаяся чем-то неудержимым, чем-то постыдным, чем-то вводящим в наваждение, требующее сиюминутной разрядки. Разве может быть так больно и так хорошо?<br><br>Щечки розовеют в предвкушении выплеска. Не слишком ли развязно? Если откровенничать, так донага, чтобы дух извергался из плоти и вгонялся обратно под бесщадный рев синтезатора. Только что ты застиг сюжетец из вспышечной серии событий «Откровение», где хорошие диджеи наказывают хороших людей хорошим техно. Приобщайся, сокровенное нуждается в откровенности.<br><br>Билеты на входе:<br>23:00 - 600₽<br>00:00 - 800₽</p>',600,'800.0',1,1,1,'','https://vk.com/event218422461',false,false,NULL,NULL,'2023-01-31 14:34:06','2023-09-28 09:54:40',NULL,'','0',18,21),
	 (273,'Northern Mood','2023-02-03-tommy-lee-northern-mood','2023-02-03',NULL,NULL,NULL,'<p>Пока за окном бушует северный ветер, я предлагаю создать свой ураган из бурных эмоций в Tommy Lee.<br><br>Февраль — самый короткий, окрыляющий надеждой на весеннее тепло месяц, и я хочу вкушать его вместе с тобой. Призываем тёплое солнце искренними улыбками и сочными вкусами. А яркие представители клубной культуры Северной столицы включат живой огонь саунда и растопят лёд.<br><br>Приходи самозабвенно танцевать и опьяняться счастьем за стойкой бара.<br><br>Резерв по телефону и WhatsApp: 8 921 9381212</p>',NULL,'',1,83,1,'','',false,false,NULL,NULL,'2023-01-31 14:41:57','2023-10-20 12:38:21',NULL,'','0',18,4);
