	 (274,'Northern Mood','2023-02-04-tommy-lee-northern-mood','2023-02-04',NULL,NULL,NULL,'<p>Пока за окном бушует северный ветер, я предлагаю создать свой ураган из бурных эмоций в Tommy Lee.<br><br>Февраль — самый короткий, окрыляющий надеждой на весеннее тепло месяц, и я хочу вкушать его вместе с тобой. Призываем тёплое солнце искренними улыбками и сочными вкусами. А яркие представители клубной культуры Северной столицы включат живой огонь саунда и растопят лёд.<br><br>Приходи самозабвенно танцевать и опьяняться счастьем за стойкой бара.</p><p>Резерв по телефону и WhatsApp: 8 921 9381212</p>',NULL,'',1,83,1,'','',false,false,NULL,NULL,'2023-01-31 14:45:31','2023-09-07 17:08:13',NULL,'','0',18,16),
	 (275,'Free Vibes','2023-02-04-vibe-hall-free-vibes','2023-02-04',NULL,'23:00:00',NULL,'<p>Приглашаем Вас на грандиозное событие, открытие новой площадки VIBE HALL в Москве! 4 февраля Вас ожидает настоящий праздник с БЕСПЛАТНЫМ входом и космическим составом, стартуем ровно в 23:00, до встречи на танцполе!<br><br>-&gt; Готовьте прыжок в гиперпространство!</p>',0,'',2,107,1,'https://moscow.qtickets.events/59474-0402-free-vibes-vibe-hall','https://vk.com/free_vibes_hd',false,false,NULL,NULL,'2023-01-31 14:57:20','2023-10-23 03:59:14',NULL,'','0',18,16),
	 (276,'POLNЫЙ SUR by Space Reality','2023-02-04-treff8-club-polnyi-sur-by-space-reality','2023-02-04','2023-02-05','22:00:00','07:00:00','<p>4 февраля в клубе Treff8 произойдет нечто странное, загадочное, но в то же время прекрасное, потому что мы решили спровоцировать вас! Это сюр, но такова наша реальность - брать от жизни все и ощущаться себя героями фантастического фильма.<br><br>«Великий художник - это не тот, кто вдохновлен, а тот, кто вдохновляет других»! Крылатая фраза неординарного Сальвадора Дали, вдохновившего нас на создание этой вечеринки, посвящённой дню рождения Артема Лаврецкого - основателя коммьюнити Space Reality.<br><br>Провокаторы этой безумной ночи, готовые удивить вас<br>Мероприятие открытое!<br>При покупке билета вы получаете индульгенцию до конца вечеринки.<br>Discover your space!</p>',1250,'',2,84,1,'https://moscow.qtickets.events/60647-polnyy-sur-by-space-reality','',false,false,NULL,NULL,'2023-01-31 15:06:30','2023-10-17 17:25:59',NULL,'','0',18,18),
	 (277,'Burning Series','2023-02-03-16-tonn-burning-series','2023-02-03','2023-02-04','23:30:00','05:30:00','<p>3 февраля, в пятницу, на танцпол клуба «16 Тонн» в рамках легендарной drum &amp; bass вечеринки Burning Series, проводимой лейблом Occulti, возвращаются артисты английских и голландских лейблов.<br><br>В программе ночи музыка от специалистов джангл–сцены в сопровождении одного из лучших джангл–MC в России!</p>',600,'',2,29,1,'https://moscow.qtickets.events/60730-burning-series','',false,false,NULL,NULL,'2023-01-31 15:16:23','2023-09-27 02:10:15',NULL,'','0',18,12),
	 (278,':data x tochkaorg','2023-02-11-trinity-park-data-x-tochkaorg','2023-02-11',NULL,'22:00:00',NULL,'<p>В субботу 11 февраля, передовая столичная :data объединяет силы с локальной tochkaorg, чтобы представить незабываемую вечеринку в стенах Trinity Park!<br><br>8 артистов, самый актуальный андеграунд драм-н-бейс и джангл, британская звуковая система топ-класса Funktion-One - все это в привычном полумраке малого танцпола Trinity. Приготовьтесь к настоящему безумию!</p>',500,'',2,108,1,'https://vk.cc/clb9o1','https://vk.com/data_x_tochkaorg',false,false,NULL,NULL,'2023-01-31 16:30:53','2023-10-22 15:47:52',NULL,'','0',18,20),
	 (290,'Абстрасенция 2023 в Оранжерее','2023-02-11-oranzereia-tavriceskogo-sada-abstrasenci','2023-02-11',NULL,NULL,NULL,'',1000,'',1,48,1,'https://spb.qtickets.events/61976-abstrasentsiya-2023-v-oranzheree','https://abstrasension.ru/',false,false,NULL,NULL,'2023-02-01 19:45:05','2023-09-18 20:34:43',NULL,'','0',18,19),
	 (280,'Despersion','2023-02-17-16-tonn-despersion','2023-02-17',NULL,'23:55:00',NULL,'<p>Друзья! 17 февраля в «16 Тонн» мы празднуем День Рождения проекта Despersion.<br><br>Despersion - российский дуэт из Москвы, образованный в 2017 году Владимиром Decent и Александром Lion. Ребята уже зарекомендовали себя как создатели мелодичных и в то же время агрессивных вибраций, несмотря на то, что они все еще находятся в самом начале своей творческой деятельности как музыкального проекта. За 6 лет существования ребята добились определенных успехов в работе и получили поддержку от ведущих российских производителей DnB в России. С 2018 года они стали участниками самого громкого и узнаваемого проекта о драм-н-бэйс-музыке в Российской Федерации - подкаста Neuropunk, который, в свою очередь, уже полюбился ценителям жанра во всех уголках планеты.<br>За последние пару лет ребята, выпустив три релиза на лейбле Eatbrain, подтвердили себя как один из ярких neurofunk проектов не только в России но и в мире.</p>',500,'',2,29,1,'https://moscow.qtickets.events/61510-despersion-den-rozhdeniya','',false,false,NULL,NULL,'2023-01-31 18:35:18','2023-10-25 06:24:06',NULL,'','0',18,41),
	 (281,'Mutabor Samosad Bend ElektroLiveDub session ','2023-02-23-mutabor-mutabor-samosad-bend-elektroliv','2023-02-23',NULL,'18:00:00',NULL,'<p>Стильный лайф музон с кайфовым, расслабленным вайбом</p>',800,'',2,2,1,'https://moscow.qtickets.events/59715-elektrolivedub-session-23','https://vk.com/event218202836',false,false,NULL,NULL,'2023-01-31 18:45:59','2023-10-09 19:17:29',NULL,'','0',18,29),
	 (282,'Дискотека-80 ','2023-02-24-live-story-diskoteka-80','2023-02-24',NULL,'23:30:00',NULL,'<p>Встречай день защитника отечества вместе с нами! Праздничная ночная вечеринка с лучшими диско-хитами 80-х и 90-х!<br><br>В программе:<br>- Танцы до самого утра и атмосфера настоящего праздника,<br>- Кальянная зона,<br>- Самые лучшие хиты 80-х и 90-х от наших диджеев: ABBA, Ace Of Base, Arabesque, Al Bano &amp; Romina Power, Baccara, Boney M, Bad Boys Blue, Bee Gees, C.C.Catch, Chilly, Dr. Alban, Digital Emotion, E-Type, Erasure, Duran Duran, Giorgio Moroder, Gilla, Haddaway, Joy, Modern Talking, Pet Shop Boys, Silent Circle, Ultravox и многие другие!<br><br>18+ (Вход строго по оригиналам документов)</p>',300,'',2,16,1,'https://moscow.qtickets.events/60024-diskoteka-80-2402-live-story','https://vk.com/disco80s240223',false,false,NULL,NULL,'2023-01-31 18:51:28','2023-10-22 21:49:00',NULL,'','0',18,27),
	 (283,'Hope','2023-02-03-sandboxmusicroom-hope','2023-02-03',NULL,'23:00:00',NULL,'<p>Друзья, надежда есть и будет!&nbsp;<br><br>Shanti Sound System приглашает вас внести свой энергетический вклад в танцевальную медитацию в пятницу, 3 февраля, в пространстве SandBoxMusicRoom.<br>Считаем, что в сложные моменты очень важно поддерживать друг друга, так что встречаемся, надеемся и верим в лучшее!</p>',500,'',1,110,1,'','https://vk.com/wall-149384502_1548',false,false,NULL,NULL,'2023-01-31 19:16:46','2023-09-23 15:26:04',NULL,'','0',18,7);
