	 (284,'Hard Thursday','2023-02-02-zoccolo-20-hard-thursday','2023-02-02',NULL,NULL,NULL,'<p>Кто-то говорил - мало? Кто-то говорил - редко? Ну на, держи, нам не жалко!<br>Февраль раскачивают наши диджеи!<br><br>Не приноси с собой алкоголь, наркотики, оружие,&nbsp; агрессию и политику.<br>FC &amp; DC<br>ВХОД: FREE!<br><br>Like, Share, Repost, Subscribe!<br>GO HARDER! ALL IN CORE!</p>',0,'',1,72,1,'','https://vk.com/hardthursday',false,false,NULL,NULL,'2023-01-31 23:44:53','2023-10-04 15:42:11',NULL,'','0',18,10),
	 (285,'Loft 2.0','2023-02-03-krov-loft-loft-20','2023-02-03',NULL,NULL,NULL,'<p>Мы до сих пор ощущаем воздух гор Домбая и хотим поделиться этой энергий со всеми! Вечеринку "Loft 2.0" мы посвещаем нашим любимым лицам, постоянным и новым гостям.&nbsp;</p><p>Вечер начнется с просмотра документалки о нашей новогодней поездке, далее со своими dj-сетами выступят любимчики столичной публики:<br><br>FC: быть на стиле, аксессуары приветствуются.</p>',1500,'2000.0',2,111,1,'https://moscow.qtickets.events/61195-loft-20','',false,false,NULL,NULL,'2023-02-01 16:44:36','2023-10-23 15:28:56',NULL,'','0',18,18),
	 (286,'Largent Candy Party ','2023-02-05-gorod-largent-candy-party','2023-02-05','2023-02-05','16:00:00','22:00:00','<p>Помните что мы устроили в декабре? CANDY PARTY - Сладости абсолютно всем кто заглянет к нам, так вот повторим это) Но в этот раз,вход будет бесплатный всем, CANDY PARTY x FREE ENTRY<br><br>УСЛОВИЯ ПОПАДАНИЯ:<br><br>1. Подписаться на наш паблик<br>2. Сделать репост <a href="https://vk.com/wall-212229432_7692">данной записи</a> и показать на входе ОБЯЗАТЕЛЬНО<br>3. Подписаться на наш тг канал <a href="https://vk.com/away.php?to=https%3A%2F%2Ft.me%2Flargentmsk&amp;post=-212229432_7692&amp;cc_key=">https://t.me/largentmsk</a><br><br>PRICE:<br>Без выполнения условий -299р<br>0 RUB - Танцпол ( С выполненными условиями)<br>900 RUB - VIP<br>300 RUB - Fast Pass<br><br>БИЛЕТЫ VIP И FAST PASS :&nbsp;<br><br>В VIP места входит:<br>•Проход без очереди<br>•Бесплатный гардероб<br>•Отдельная лаундж зона<br>•Бесплатный коктейль от бара<br><br>После Sold out - Вход платный<br><br>На тусовке действует строгий FACECONTROL<br>Доплата за фото паспорта - 200р</p>',0,'',2,63,1,'https://moscow.qtickets.events/61823-candy-party-20','',false,false,NULL,NULL,'2023-02-01 16:59:17','2023-10-17 02:50:52',NULL,'','0',18,29),
	 (287,'What’s Crackin','2023-02-04-griboedov-whats-crackin','2023-02-04',NULL,'23:30:00',NULL,'<p>Ха-Ха-Ха, You wanna die?<br>I GONNA CRACK DIE!<br><br>Субботней ночью подвал захватит компания безумцев, готовых забрать все ваши силы, деньги, трезвость, кепки и связь с реальностью.<br>Обещается Hustle с безграничным количеством алкоголя, отборной музыкой от команды диджеев, которые точно никому не позволят остаться Fresh.<br><br>If you real THUG, so bring ur ass to the CLUB, G!<br><br>Вход:<br>300 — с репостом<br>500 — без внимания<br><br></p>',300,'500.0',1,86,1,'','',false,false,NULL,NULL,'2023-02-01 18:28:27','2023-09-13 23:27:10',NULL,'','0',18,13),
	 (291,'Barbie Valentine Party','2023-02-17-dk-barbie-valentine-party','2023-02-17',NULL,'18:00:00',NULL,'<p>В этом году придумали кое-что кьют на День всех влюбленных:<br>Устроим приторно розовую и дико блестящую пати в стиле Barbie: все атрибуты в стиле pink, сладкая вата, special на баре, а ещё наши бармены-кены будут ждать Вас в тех самых костюмах с бабочками.<br><br>А ещё те самые валентинки, которые вы сможете оставить офлайн и большая коробка Барби, иууууу<br><br>Что по дресс-коду?<br>Розовый, джинса и рубашки ближе к классике для парней.<br><br>18+<br>FC/DC<br><br>INFO: +7 (921) 884-66-44</p>',1000,'',1,68,1,'https://spb.qtickets.events/61947-barbie-party','',false,false,NULL,NULL,'2023-02-02 15:36:56','2023-10-23 11:19:43',NULL,'','0',18,25),
	 (292,'Go Blank','2023-02-11-blank-go-blank','2023-02-11',NULL,NULL,NULL,'<p>Заглавная серия событий клуба, вызывающая в нас сердечные трепыхания, когда ее двусмысленное имя втискивается в календарную сетку, расталкивая все вокруг.<br><br>Раз в сезон, не чаще, Go Blank вовлекает в трансграничный рейд к истокам человекоустройства. Музыка, заправский поводырь, проторит тропинку к эго, высвободит от слепоты, комплексов и ужимок. Встряска, опустошение, и даже неприветливые старушенции на скамеечке, подстерегающие жертв их молчаливого порицания, вздохнут с облегчением при виде твоего силуэта, скользящего в рассветной дымке вопреки законам физики и здравого смысла.<br><br>Тем, для кого эта тонироббинсовщина покажется напускной, коротко и ясно: вечеринка — отпад.</p>',600,'',1,1,1,'https://www.blankclub.ru','https://www.blankclub.ru',false,false,NULL,NULL,'2023-02-02 17:19:48','2023-10-24 23:38:33',NULL,'','0',18,32),
