	 (296,' ABADDON','2023-02-10-factory-3-abaddon','2023-02-10',NULL,'23:00:00',NULL,'<p>10 февраля в пространстве Factory3 пройдет событие Петербургского андера, в котором смешались незнакомые лица с давно полюбившимися представителями разных жанровых направлений.&nbsp;<br><br>VJ performance - AY<br><br>Ранние пташки&nbsp;<br>10 февраля I 23:00 I Factory3</p>',500,'',1,7,1,'https://t.me/abaddon_raven_bot','https://t.me/abaddon_raven',false,false,NULL,NULL,'2023-02-02 18:05:04','2023-10-21 19:05:43',NULL,'','0',18,15),
	 (297,'SACRED SOUND III','2023-02-17-blank-sacred-sound-iii','2023-02-17',NULL,'23:00:00',NULL,'<p>В пятницу, 17 февраля, <a href="https://t.me/sacredsound">SACRED SOUND</a>&nbsp; отпразднует свой 3-й день рождения, в родной и душевной компании, на двух танцполах клуба Blank.<br><br>Созданием андеграундной атмосферы на «SACRED FLOOR» займутся исключительно мастера своего дела: YAROSLAV LEBEDINSKIY — резидент Московской команды Monasterio. BIONOID — резидент m_division. Дополнят атмосферу резиденты Sacred Sound: VTP и Ậ.DENIẬL.<br><br>На «HYPNO FLOOR» погружать в гипнотическую атмосферу будут: UNITØNE — специальный гость из Эстонии. A.G. — талантливый музыкант из Казани. Поддержат гостей локальный состав, резиденты SubSpace комьюнити: EYE QUE, G DEPOT и MORPHA.<br><br>DC: BLACK</p>',700,'',1,1,1,'https://spb.radario.ru/events/1862215/tickets','',false,false,NULL,NULL,'2023-02-02 18:14:28','2023-10-22 05:17:07',NULL,'','0',18,25);
