	 (448,'DARK MASTERS','2023-03-25-factory-3-dark-masters','2023-03-25',NULL,NULL,NULL,'<p>Фестиваль тяжёлой электронной музыки, представляющий российских музыкальных продюсеров в жанрах Drum &amp; Bass и Hardcore. Тёмная амосфера и антураж, световое шоу, мощный звук и лучшие артисты со своим фирменным звучанием!</p>',500,'',1,7,1,'https://spb.qtickets.events/64735-dark-masters','https://vk.com/dvrkmvsters',false,false,NULL,NULL,'2023-03-08 00:12:30','2023-10-22 05:10:15',NULL,'','0',18,70),
	 (298,'Wonderland - Глава 12 ','2023-02-03-warpp-wonderland-glava-12','2023-02-03',NULL,NULL,NULL,'<p>WARPP представляет новую, уже 12 главу сказки в облаках, наполненную радостью, красотой и гармонией. Эта встреча знакомства с очаровательными композициями, которые надолго сохранятся в вашем сердце, а также предоставит возможность воссоединится в единое целое, чтобы почувствовать любовь к чистой энергии музыки и путешествию.&nbsp;<br>&nbsp;<br>Главной феей истории, уже во второй раз с собственным волшебным и атмосферным музыкальным рассказом, станет талантливая и харизматичная - Amonita, неотъемлемая часть семьи лейблов All Day I Dream и Anjunadeep, создатель собственного лейбла Rubicunda, не изданные и секретные треки и эдиты с которого также прозвучат в эту ночь. Со своими сетами её поддержат известные артисты Valer den Bit и Dabu Davout.&nbsp;<br><br>Мероприятия Wonderland за 2 года стали узнаваемы благодаря своей энергетике и атмосфере безграничного самовыражения единомышленников; а уникальный декор вечеринки и инсталляции лучше погрузят в эту магическую ночь.&nbsp;<br><br></p>',0,'1000.0',1,23,1,'https://warppclub.com/p/3903b9/','https://t.me/warppclub/929',false,false,NULL,NULL,'2023-02-02 18:19:32','2023-09-28 05:32:13',NULL,'','0',18,16),
	 (300,'HERO PYTH','2023-02-19-griboedov-hero-pyth','2023-02-19',NULL,'20:00:00',NULL,'<p><a href="https://vk.com/themebbb">Jag hare Pogo</a> - биполярные художества, от нежных фортепианных баллад до грязного панка. Трикстерские заячьи уловки.<br><br><a href="https://vk.com/pythonious">Pyth</a> - экспрессивный экспериментальный рок, приправленный психоделией и вкусной атональщиной. Если вам кажется, что крутую вещь невозможно написать про сыр, светофор или математику, подумайте ещё раз.<br><br><a href="https://vk.com/herbband">HERB</a> - Нечто, сотканное из разных настроений и состояний, жанров и поджанров. Плод, выращенный музыкантами в коллективных потоках импровизации. Самое ёмкое и удобное жанровое определение - прогрессивный рок, но это всё формальности, мы просто играем хорошую музыку.<br><br>Начало: 20:00<br>На входе - 300 р.<br><a href="https://vk.com/wall-20218518_31091">С репостом</a> - 200 р.<br>Забронировать столик вы можете совершенно бесплатно, по телефону:<br>+7(901) 373-72-73</p>',200,'300.0',1,86,1,'','',false,false,NULL,NULL,'2023-02-03 16:41:24','2023-10-10 02:11:18',NULL,'','0',18,31),
	 (301,'Neovision','2023-03-18-mod-neovision','2023-03-18',NULL,'23:50:00',NULL,'<p>Фестиваль Neovision пройдет в 18 марта в Санкт-Петербурге!<br><br></p>',900,'',1,113,1,'https://spb.qtickets.events/61960-neovision','https://vk.com/neovisionspb',false,false,NULL,NULL,'2023-02-03 16:52:25','2023-10-25 07:45:34',NULL,'','0',18,59),
	 (302,'Jungle Sound','2023-02-03-motyga-jungle-sound','2023-02-03',NULL,'20:00:00',NULL,'<p>Мы здесь, чтобы окунуться в атмосферу ломаных ритмов и раскачивать танцпол лучшими сетами!&nbsp;<br><br></p>',0,'',2,114,1,'','https://vk.com/jungleyeti6',false,false,NULL,NULL,'2023-02-03 17:06:50','2023-02-03 17:08:56',NULL,'','0',18,0),
	 (303,'Amen Keepers','2023-02-04-motiv-amen-keepers','2023-02-04','2023-02-05','22:00:00','06:00:00','<p>Друзья! Мы давно с вами не виделись и это необходимо исправлять!<br>Такая возможность появится 4 февраля, когда пространства Мотива и Птичьей Личности объединит Amen Keepers!<br>C 22.00 и до утра только лучшие пластинки из своих коллекций будут ставить для вас мастера своего дела.<br>Вы услышите как свежие релизы, так и нестареющую классику drum&amp;bass и jungle музыки.<br>Равнодушным не останется даже самый искушённый любитель ломаных ритмов!<br><br>В эту ночь на двух танцполах<br>Jungle Floor &amp; Drum &amp; Bass Floor!<br>Непременно присоединяйтесь к этому долгожданному мероприятию и вас будет ждать:<br><br>- отличный саунд и лучшие ди-джеи<br>- танцы до утра<br>- уютная, дружеская атмосфера<br><br>- Оплата на входе:<br>с 22.00 до 03.00 - 500 рублей<br><a href="https://vk.com/wall-218265467_2">с репостом мероприятия</a> - 300 рублей<br>с 03.00 до 06.00 свободный<br><br>FC/18+</p>',300,'500.0',1,88,1,'','https://vk.com/amen_keepers_6',false,false,NULL,NULL,'2023-02-03 17:39:59','2023-10-01 08:26:49',NULL,'','0',18,5),
	 (304,'Kontrkult','2023-02-04-kontrkult-kontrkult','2023-02-04',NULL,'23:00:00',NULL,'<p>Звезда луной укрылась в небе<br>Раздался стук и повторился вновь<br>Блестят глаза, затрепетала кровь&nbsp;<br><br>Светлый праздник Дня рождения адепта музыкальной политики Контркульта, — Артура Роос, прогремит тёмным, суровым и ритмичным шумом. Индустриальная ночь продлится практически половину суток, за это время сцену возглавят лидеры петербургских техно-формаций, гости из столицы и Alex Pankov из Monasterio.<br><br><br>Предпродажа доступна по ссылке&nbsp;&nbsp;<br><br>FC/DC</p>',700,'',1,33,1,'https://t.me/nasledie_label_bot?start=link_wC3grfO49X','',false,false,NULL,NULL,'2023-02-04 23:52:52','2023-02-04 23:52:52',NULL,'','0',18,0),
	 (1492,'YOUR PERSONAL DANCE CORNER','2023-07-28-dom12-your-personal-dance-corner','2023-07-21',NULL,'21:00:00',NULL,'<p>В предстоящий уикенд DOM12 снова станет местом притяжения настоящих тусовщиков и меломанов.</p>',NULL,'0.0',1,187,1,'','http://dom12spb.ru/?utm_source=vkontakte',false,false,NULL,2,'2023-07-28 13:16:33','2023-08-07 07:59:11',NULL,'','0',18,27),
	 (305,'Point Em Up','2023-02-04-bar-usy-na-pene-point-em-up','2023-02-04',NULL,'23:00:00',NULL,'<p>Point Em Up Санкт-Петербург<br>BASSLINE | DNB | UK GARAGE<br>04.02.23<br>Начало: 23:00<br><br>Бар “Усы на Пене”<br>Адрес: Лиговский пр-кт 50лит У<br><br>Мы вернулись, что бы прокачать ваши уши жирным Uk Саундом.<br>Собираемся 04.02 на двух этажах бара "Усы на пене" на Лиговском<br><br>Dj’s :<br>23:00-00:00 August the Chemist (UK Bass)<br>00:00-01:00 Rudy b2b Stepa Bulkin (UK Bass / DnB)<br>01:00-02:00 Ssylvester x Terror Letov (Jump up + Live Mc)<br>02:00-03:00 Dj Alise (Jump up / Rollers)<br>03:00-04:00 Hanzo (Neuropunk)<br><br>Вход:<br><br>Наличие «+» под этим постом и <a href="https://vk.com/pointemup0402">репоста </a>- 200р<br><br>Без внимания к мероприятию - 300р<br><br>До встречи!<br><br>18+</p>',200,'300.0',1,118,1,'','https://vk.com/pointemup0402',false,false,NULL,NULL,'2023-02-05 00:09:18','2023-02-05 00:09:18',NULL,'','0',18,0),
	 (306,'Hard Thursday','2023-02-09-zoccolo-20-hard-thursday','2023-02-09',NULL,'19:00:00',NULL,'<p>Виниловый четверг! Эстетично, эксклюзивно, с легким налетом пыли и фетишизма, как старая пластинка!<br>Аналоговый #HARDCORE вращают наши диджей<br>Не приноси с собой алкоголь, наркотики, оружие,&nbsp; агрессию и политику.<br>&nbsp;FC &amp; DC<br>&nbsp;ВХОД: FREE!<br><br>&nbsp;Powered by <a href="https://vk.com/techno_core">TechnoCore</a><br> Like, Share, Repost, Subscribe!<br>GO HARDER! ALL IN CORE!<br><br></p>',0,'',1,72,1,'','https://vk.com/techno_core',false,false,NULL,NULL,'2023-02-07 12:56:54','2023-10-09 23:05:47',NULL,'','0',18,51);
