	 (399,'4.03 GÁS MUSIC CLUB','2023-03-04-gas-403-gas-music-club','2023-03-04','2023-03-05','23:00:00','06:00:00','<p>Прошлые выходные показали, что вам был необходим второй танцпол.<br>Мы вас поняли<br>Двигаемся дальше!<br>Будет звучать стильная музыка, DC по соответствию.</p>',500,'',1,57,1,'','',false,false,NULL,NULL,'2023-03-01 01:03:54','2023-08-25 23:23:40',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,20),
	 (307,'Red Sheep','2023-02-11-rndm-red-sheep','2023-02-11',NULL,'23:00:00',NULL,'<p>За камерным рейвом в эти выходные отправляйтесь на Red Sheep в RNDM. Молодая промокоманда регулярно делает техно-вечеринки, где разбавляет прямую бочку разной танцевальной электроникой от транса до хард-грува.<br><br>11 февраля Red Sheep празднуют год на клубной карте города и открывают сезон 2023-го. В лайнап пригласили петербуржцев — дуэт VTP с индустриально-гипнотичным лайвом и почитателя аналоговых синтезаторов Игоря Старшинова. Диджей-сетами гостей поддержат Enn Franco, Tashika, A.E и Errioxa.<br>За визуал возьмется медиа артист Amona_re, ответственная за оформление множества вечеринок в мутаборе и газгольдере.</p><p>Кароче присущая нам атмосфера камерного плотного рейва на месте)</p><p>Приходите будем пить и танцевать! Приглашены все и каждый!</p>',500,'',2,27,1,'https://red-sheep.timepad.ru/event/2316368/','https://t.me/red_sheep/303',false,false,NULL,NULL,'2023-02-07 13:06:31','2023-10-09 21:57:29',NULL,'','0',18,10),
	 (308,'Rare Tapes ','2023-02-10-griboedov-rare-tapes','2023-02-10',NULL,'23:00:00',NULL,'<p>Очередная заряженная на разнос пятница уже не за горами. Всеми любимое звучание заполнит собой всё пространство клуба.<br><br>Брейкбит, электро, плотная бочка, мы с вами — все это сольётся воедино в эту долгожданную ночь. Врывайтесь в происходящее и запечатлейте в памяти конец недели.<br><br>Пришло время сменить рабочий скин на что-то более комфортное.<br><br>Вход:<br>300 — <a href="https://vk.com/wall-154594155_17044">с репостом</a><br>500 — без внимания</p>',300,'500.0',1,86,1,'','https://t.me/griboedovbasement/2161',false,false,NULL,NULL,'2023-02-07 13:28:49','2023-08-28 02:39:42',NULL,'','0',18,8),
	 (309,'ArtParty Valentine''s Day','2023-02-12-pravda-artparty-valentines-day','2023-02-12','2023-02-12','16:00:00','22:00:00','<p>В честь Дня святого Валентина мы устраиваем грандиозный розыгрыш на 30 призов<br>Всего лишь в комментариях<a href="https://vk.com/wall-213933768_29917"> под этим постом</a> напиши слово - ART<br>На мероприятие присутствуют более 1к человек, поэтому высокий шанс найти себе вторую половинку<br><br>Цены будут повышаться<br><br>Не забудь с собой паспорт.<br>Берём оригинал, а не фото<br><br>Важно:<br>НА ТУСОВКЕ ДЕЙСТВУЕТ СТРОГИЙ FACE CONTROL<br>(Если вам отказано на входе, то билет возврату не подлежит)<br><br>Покупка билета не отменяет условия входа.</p>',599,'',2,20,1,'https://moscow.qtickets.events/62388-pravda','',false,false,NULL,NULL,'2023-02-07 14:20:44','2023-09-27 19:12:21',NULL,'','0',18,17),
	 (310,'КАМОН х ALBLAK 52','2023-02-10-vnvnc-concert-hall-kamon-x-alblak-52','2023-02-10',NULL,'23:00:00',NULL,'<p>&nbsp;в VNVNC Concert Hall с лайвом от ALBLAK 52 back home <br>Мы посчитали и поняли, что это будет 52-ая по счёту наша вечеринка, камон. <br>Поэтому кому как ни перспективному исполнителю ALBLAK 52 стать хэдлайнером. <br>А ещё мы решили, что соскучились по стенам VNVNC Concert Hall, где больше 2-х лет назад мы постоянно с вами виделись и слышались.<br>Всё просто!<br>Старый, добрый и классический состав!<br>Первая волна билетов (до 06.02) - 500₽<br>Вторая волна билетов (до 08.02) - 600₽<br>Tретья волна билетов (до 10.02) - 700₽<br>Бронь столов: 8 (921) 410-44-40<br>FC|DC 18+</p>',500,'',1,50,1,'','',false,false,NULL,NULL,'2023-02-07 15:43:18','2023-10-20 08:10:13',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,33),
	 (318,'Шува Шува','2023-02-11-blanc-suva-suva','2023-02-11','2023-02-12','22:00:00','05:00:00','<p>«Шува Шува» — серия вечеринок Лалы и Паши из электронного дуэта Lovanda. С диско-клубом «Радуга» ребята готовят полноценное клубное шоу со множеством знакомых артистов, которые будут играть хаус, диско, брейбит и прочую музыку. Среди хедлайнеров — рэперы «Всигме», видный электронщик Директор Всего и группа Tesla Boy с диджей-сетом.</p><p><strong>Стоимость:</strong> предпродажа от 1200 ₽ <a href="https://radugadiscoclub.ru/e110223">по ссылке</a>, на входе — 2000 ₽.</p>',1200,'2000.0',2,36,1,'https://radugadiscoclub.ru/e110223','https://t.me/radugasuperclub/4134',false,false,NULL,NULL,'2023-02-09 02:21:00','2023-10-25 09:12:25',NULL,'','0',18,61),
	 (311,'Witches II','2023-02-24-mutabor-witches-ii','2023-02-24',NULL,NULL,NULL,'<p>Dendruo &amp; Yudol готовят импровизационное выступление в рамках основной программы ковенанта.<br><br>На главной сцене. Вибрационное звучание австралийского инструмента диджериду, горловое пение и drone ambient. Погружение в глубины подсознания.<br><br>Dendruo. Этнический музыкант, автор проекта Медитация Земли. Инструменты: диджериду, бубен, поющая чаша, варган.<br><br>Yudol. Проект основан в 2018 году Георгием Орловым-Давыдовским, основателем Московской шумовой мануфактуры и бывшим участником проектов Шумы России, Phurpa. В своих выступлениях музыкант использует горловое пение, самодельный струнный щипковый инструмент валиха, электронные средства, а также сэмплер и барабаны. В составе Yudol также выступит Александра Исаева (Jum-Jum).</p>',1100,'',2,2,1,'https://mutabor.club/witches2','',false,false,NULL,NULL,'2023-02-09 00:57:22','2023-09-20 02:55:37',NULL,'','0',18,27),
	 (1872,'NEOVISION','2023-10-07-mod-neovision','2023-10-07',NULL,'23:50:00',NULL,'<p>Фестиваль электронной музыки Neovision пройдет 7 октября в Санкт-Петербурге!<br><br></p>',1100,'',1,113,3,'https://neovision.qtickets.ru/event/81756','',false,false,NULL,2,'2023-09-14 01:52:15','2023-10-20 20:57:03',NULL,'','0',18,145),
	 (313,' DECONCTRUCTA','2023-02-10-kontrkult-deconctructa','2023-02-10',NULL,NULL,NULL,'<p>Мистическое чувство родства, которое рождается в процессе исполнения ритуальных танцев, определяет важнейшие инициативные события жизни человека.<br>Танец всегда был, есть, и остается обрядом, поклонением божествам, созиданием абстрактного и общедоступного полотна изъяснений и воссыланий.<br><br>DECONSTRUCTA — это не простое сопровождение танцевальных движений. Она — как богиня — является средством глубокого эмоционального раскрытия содержания танца на изломе привычных нам мыслеформ. Она здесь для того, чтобы воззвать к заутробному звуку и первобытному импульсу. Это наш новый социальный (де)конструкт.<br><br>ALL INCLUSIVE! 18+ Мероприятие исключает из себя проявления любых систем классового угнетения, агрессии и нетерпимости!<br><br>Вход — 600₽ с репостом афиши (сделанным не позднее, чем за 3 часа до мероприятия) 800₽ без внимания к мероприятию&nbsp;<br><br></p>',600,'800.0',1,33,1,'','',false,false,NULL,NULL,'2023-02-09 01:33:34','2023-10-25 09:31:04',NULL,'','0',18,19),
	 (314,'Manifest','2023-02-25-rndm-manifest','2023-02-25',NULL,'23:00:00',NULL,'<p>Manifest предлагает максимально диким образом, попрощаться с зимой.&nbsp; St.Mike - заслуженный представитель Питерского электро, Arkadich - уважаемый гость STVOL.TV и System 108, Nikita Telegin - опытный хозяин всевозможного techno &amp; groove саунда и, теперь уже мегадолгожданный, тройной B2B от резидентов Etrigan, Lowchord &amp; Basil White.<br><br>Вход: 500₽ - по репосту в <a href="https://vk.com/wall-218637727_1">VK</a>&nbsp;<br>800₽ - без внимания к мероприятию</p>',500,'800.0',2,27,1,'','https://vk.com/wall-218637727_1',false,false,NULL,NULL,'2023-02-09 01:41:00','2023-10-20 16:55:50',NULL,'','0',18,26);
