	 (315,'Поцелуйный Бар','2023-02-11-poceluinyi-bar','2023-02-11','2023-02-12','20:00:00','03:00:00','<p>Вечеринка для тех, кто любит новые знакомства, флирт и поцелуи. В преддверии Дня всех влюбленных команда Nazlo Mame (https://t.me/nazlomame) приглашает на нежную и этичную вечеринку, где гости смогут открыть для себя новые виды поцелуев, погрузиться в свою чувственность и завести друзей<br><br>На вечеринке можно будет выполнять задания на знакомства и общение, зарабатывать кисс-коины, обменивать их в Поцелуйном баре на свой особенный поцелуй. Механика вечеринки подойдет и парам, и тем, кто пришел один<br><br>Можно будет попробовать музыкальный и электро поцелуй, сыграть в бутылочку, заключить брак или поставить рекорд на самый долгий поцелуй. А если не уверены, что готовы к такому близкому общению, можно сходить на дейтинг, пройти мастер-классы по осознанию личных границ и развитию чувственности<br><br>На Мейне — танцы, веселье, блестки, конфетти. В Чайной — трипхоп, чтобы заземлиться. Место проведения будет объявлено позже</p>',7500,'',2,NULL,1,'https://clck.ru/33QMFQ','',false,false,NULL,NULL,'2023-02-09 01:49:18','2023-10-13 19:07:22',NULL,'','0',18,43),
	 (316,'Пудра х Экстаз ','2023-02-10-prostranstvo-pole-pudra-x-ekstaz','2023-02-10','2023-02-11','23:00:00','05:30:00','<p>Коллаборация серии вечеринок «Экстаз» продюсера Ильи Булгакова и тусовок «Пудра», состоящих преимущественно из девочек-диджеев. <br>Ожидайте симбиоз танцевальной электроники и танцевального экстаза на двух танцполах под звуки техно, итало-диско и искрящегося электро.</p>',600,'',2,46,1,'https://polye.timepad.ru/event/2316956/','https://t.me/eto_polye/1051',false,false,NULL,NULL,'2023-02-09 02:06:30','2023-10-12 09:52:38',NULL,'','0',18,42),
	 (317,'Пятница в «Стрелке»','2023-02-10-bar-strelka-piatnica-v-strelke','2023-02-10',NULL,'23:00:00',NULL,'<p>&nbsp;Тусовая пятница в богемном баре «Стрелка» под ритмы диско и хауса. Ночь пройдет в компании резидентов серии вечеринок Jardin De Bliss: диджея Pachino и продюсера Dj Wedding, издающегося на барселонском лейбле Italo Moderni.&nbsp;</p>',0,'',2,103,1,'','',false,false,NULL,NULL,'2023-02-09 02:11:53','2023-09-18 10:34:52',NULL,'','0',18,20),
	 (319,'United','2023-02-11-powerhouse-united','2023-02-11',NULL,'23:00:00',NULL,'<p>Формация UNITED с новой бэйс-вечеринкой в баре «Паверхаус». К резидентам команды в этот раз присоединится талантливая артистка Naprimer со специальным виниловым сетом.&nbsp;</p><p><strong>Время:</strong> с 23:00.<br><strong>Стоимость:</strong> вход <a href="https://www.instagram.com/p/CoVPE2KrX04/">по репосту</a> — свободный, без репоста — 500 ₽.</p>',0,'500.0',2,5,1,'','',false,false,NULL,NULL,'2023-02-09 02:26:41','2023-08-25 23:14:54',NULL,'','0',18,4),
	 (320,'1 YEAR ANNIVERSARY TAKEOFF PROJECT','2023-02-11-community-moscow-1-year-anniversary-tak','2023-02-11',NULL,NULL,NULL,'<p>Уникальное собственное звучание и энергетический посыл live-выступлений превращают их сет в особую медитацию, где каждый звук несёт определённую силу, а этнические мантры помогают раскрыть новый потенциал восприятия музыкального мира.<br>———<br>Мероприятие открыто для всех желающих:<br>⁃ Для тех, кто уже был на наших вечеринках<br>⁃ Для тех, кто еще не был, но хочет попробовать</p>',1000,'2000.0',2,58,1,'https://takeoff-project.timepad.ru/event/2315936/','',false,false,NULL,NULL,'2023-02-09 02:32:52','2023-09-18 18:10:01',NULL,'','0',18,16),
	 (321,'Суббота в «Стрелке»','2023-02-11-bar-strelka-subbota-v-strelke','2023-02-11',NULL,'23:00:00',NULL,'<p>&nbsp;В субботу в «Стрелке» будут танцы под дарк-диско, хип-хоп, итало и другую заводную электронику в компании ваших любимых коктейлей. В лайнапе — опытные столичные диджеи и селекторы Guccikale и Bulgakov.&nbsp;</p>',0,'',2,103,1,'','',false,false,NULL,NULL,'2023-02-09 02:37:47','2023-08-26 00:13:39',NULL,'','0',18,5),
	 (323,'Мир-2 в Бланке','2023-02-10-stakensnaider-mir-2','2023-02-10','2023-02-11','23:59:00','08:00:00','<p>10 февраля на вечеринке МИР-2, визуальное пространство клуба Blank трансформируется и превратиться в единую материю из света и техно музыки.<br><br>На мероприятии выступит Рома Цукерман — резидент лейбла ТРИП, принадлежащего Нине Кравиц, а так же DJ Slon — арт-директор знаменитого клуба Tunnel, автор книги «Рейволюция» и участник берлинского фестиваля Love Parade.</p>',500,'',1,1,1,'http://mir2.timepad.ru/event/2306062/','http://t.me/mir2_mir2',false,false,NULL,NULL,'2023-02-09 11:51:28','2023-08-26 00:13:06',NULL,'','0',18,3),
	 (324,'КАРИНА ИСТОМИНА','2023-02-10-gas-karina-istomina','2023-02-10',NULL,'23:00:00',NULL,'<p>Карина Истомина или Алмаз апреля<br><br>Называйте ее так, как вашей душе угодно, но в эту ночь она точно засверкает в стенах любимого GÁS MEDIA CUB<br><br>Ждём ее в самый разгар ночи</p>',700,'',1,57,1,'','',false,false,NULL,NULL,'2023-02-09 15:20:58','2023-09-19 19:36:45',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,20),
	 (325,'Должанский | HISTORY','2023-02-10-vnvnc-concert-hall-dolzanskii-history','2023-02-10','2023-02-11','23:00:00','11:00:00','<p>Мы обязаны были удивить<br>Комик, баттл-рэпер, самый эксцентричный участник Дом-2<br>Коля Должанский ворвется на сцену в роли МС в абсолютно новый HISTORY<br>Мы пишем новую историю<br>Line up: MARYAAANZ / F-JAY / NEVKUSNOE / BOJA<br><br>Наша любовь к тебе навечно</p>',300,'',1,50,1,'','',false,false,NULL,NULL,'2023-02-09 15:29:02','2023-10-04 09:13:56',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,25),
	 (326,'11 февраля | VNVNC | СУББОТА','2023-02-11-vnvnc-concert-hall-11-fevralia-vnvnc','2023-02-11','2023-02-12','23:00:00','06:00:00','<p>несем стиль в массы every weekend<br><br>сеты наших резидентов не заставят тебя долго стоять на месте<br><br>Let''s get it<br><br>Бронь столов: 8(921)410-44-40</p><p><br></p>',500,'',1,50,1,'','',false,false,NULL,NULL,'2023-02-09 15:39:20','2023-10-14 00:17:34',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,10);
INSERT INTO public.events (id,title,slug,start_date,end_date,start_time,end_time,description,price_from,price_gate,city_id,venue_id,event_type_id,tickets_url,info_url,is_cancelled,is_featured,deleted_at,user_id,created_at,updated_at,ticketscloud_event_id,ticketscloud_event_token,ticketscloud_event_multi,age_limit,"views") VALUES
	 (327,'Плоохесис','2023-02-11-dissident-plooxesis','2023-02-11',NULL,'23:00:00',NULL,'<p>Став за первую пару месяцев жизни домиком для многих вечеринок, мы набрались смелости и опыта. Теперь на московском потолке мы зажигаем новый прожектор – встречайте Плохесис)&nbsp;<br><br>Всех плохих девочек и мальчиков, а также их жертв и поклонников, мы ждём 11.02 в наших катакомбах.&nbsp;<br><br></p>',0,'',2,117,1,'','',false,false,NULL,NULL,'2023-02-10 01:07:50','2023-09-24 08:51:29',NULL,'','0',18,31),
	 (328,'Континуум','2023-02-11-stakensnaider-kontinuum','2023-02-11',NULL,'20:00:00','00:00:00','<p>В субботу, 11 февраля, пройдёт наша первая встреча в этом году. Традиционно вас ожидает всё самое тëмное и инновационное из всего спектра британского бэйс-андерграунда.<br><br>В этот раз резиденты Континуума выступят в специальном вечернем формате и будут сменять друг друга, играя сессии по полчаса. Таким образом, вы сможете послушать музыку в разных направлениях и ничего не пропустить.<br><br></p>',0,'',1,3,1,'','',false,false,NULL,NULL,'2023-02-10 01:14:35','2023-09-20 02:56:09',NULL,'','0',18,26),
	 (375,'Time Machine','2023-03-04-griboedov-time-machine','2023-03-04',NULL,'23:30:00',NULL,'<p>Друзья, 4 марта приглашаем вас на очередную совместную танцевальную медитацию из серии Time Machine от Shanti Sound System в пространстве Griboedov Hill.<br>Телепортируемся в прошлое под сопровождение классических шедевров Гоа транс музыки.<br>Свои отполированные многочисленными танцполами музыкальные бриллианты представят искушённые и хорошо знакомые артисты</p>',NULL,'',1,86,1,'','https://vk.com/timemachine2023',false,false,NULL,NULL,'2023-02-23 19:43:46','2023-10-17 17:47:54',NULL,'','0',18,33),
	 (329,'Electrobudka','2023-02-17-mutabor-electrobudka','2023-02-17',NULL,'00:00:00',NULL,'<p>Заебался? Хочешь бросить всё и приехать в Питер, но не выходит? Не хватает чувства легкости, встряски и панковской дури? Тогда тебе на Электробудку, дружок.&nbsp;<br>Глоток свежего воздуха или разряд на электрическом стуле — подбери метафору сам, а мы позаботимся об остальном — из северной столицы выдвигается вагончик с диджеями и фирменным духом свободы. Поддержать феерию приедет минская электро-дива и резидент промо Geshtalt — Nina Indi. Вместе с ней в обойме медиума отыграют Primitive и Arkadich, а в помещениях андера развернется шоу-кейс техно-промо nasledie c лайвом от Gutkein.&nbsp;</p>',600,'',2,2,1,'https://t.me/nasledie_label_bot','',false,false,NULL,NULL,'2023-02-10 01:26:45','2023-10-20 01:32:15',NULL,'','0',18,52),
	 (330,'Electrobudka x Kontrkult','2023-02-11-kontrkult-electrobudka-x-kontrkult','2023-02-11',NULL,'23:00:00',NULL,'<p>Тебе повезло жить в Петербурге. Повезло иметь возможность выбирать как выглядеть, с кем общаться, чем питаться и под какую музыку танцевать. Пока ещё везёт что-то делать тайно или незаметно, везёт быть молодым, вытворять похлеще чем в фильмах, а уже на следующий день как ни в чем не бывало продолжать строить настоящее. Ты везунчик, пока жив<br><br>Жестко празднуем жизнь в субботу в стенах родного Контркульта, музыкальный репертуар классический — для бесноватых плясок под ломаную бочку</p>',300,'500.0',1,33,1,'','',false,false,NULL,NULL,'2023-02-10 01:34:43','2023-10-23 19:32:50',NULL,'','0',18,38),
	 (331,'СОННИК 2023 ','2023-02-11-ugly-sonnik-2023','2023-02-11','2023-02-12','18:00:00','06:00:00','<p>)Зимний фестиваль в Санкт-Петербурге.&nbsp;<br>Летим к вам из Москвы на крыльях сна.<br><br>Мне не хватало&nbsp;<br>Мне не хватало как будто одного, малейшего усилия, что бы проснуться.&nbsp;<br><br>От пробуждения меня отделял образ, твой образ, который я не мог упустить.&nbsp;<br>Который скользил передо мной.<br>Мы танцевали во сне и если бы я тебя упустил, если бы я упустил тебя , это малейшее усилие - если бы я проснулся.<br><br>Если бы я проснулся тогда.</p>',800,'',1,118,1,'https://spb.qtickets.events/61626-sonnik?fbclid=PAAaZjTGrUuscQ0oizj3MepPd4DuX5UGaNQGZx_UGxnXCgWmzksRFyln-Rb8E','',false,false,NULL,NULL,'2023-02-10 01:47:59','2023-10-25 00:12:41',NULL,'','0',18,18),
	 (332,'LOVESCHOOL','2023-02-11-warpp-loveschool','2023-02-11',NULL,NULL,NULL,'<p>11 февраля (СБ) LOVESCHOOL&nbsp;<br>Фирменная вечеринка LoveSchool, которая уже многие годы ассоциируются с качественно-разноплановой электронной музыкой, благодаря его идеологу и создателю – Косте Лавскому.<br><br>Резерв столов по телефону 500-09-01</p>',0,'1000.0',1,23,1,'','https://warppclub.com',false,false,NULL,NULL,'2023-02-10 01:52:51','2023-10-25 18:15:35',NULL,'','0',18,57),
	 (333,'WARPP 10.02','2023-02-10-warpp-warpp-1002','2023-02-10',NULL,NULL,NULL,'<p>Команда резидентов, 10 февраля наполнит пространство WARPP прогрессивными вибрациями.&nbsp;</p><p>Списки на сайте<br>Резерв столов по телефону 500-09-01</p>',0,'1000.0',1,23,1,'','https://warppclub.com',false,false,NULL,NULL,'2023-02-10 01:56:59','2023-09-18 13:39:26',NULL,'','0',18,4),
	 (334,'Legacy of UK - MLC','2023-02-10-miraz-legacy-of-uk-mlc','2023-02-10',NULL,'00:00:00',NULL,'<p>Mirage Bar обещали неделю, богатую на анонсы. И обещание выполнили!&nbsp;<br><br>10 февраля резиденты Mirage bar устраивают уже четвёртое мероприятие под эгидой MLC — фирменной вечеринки, созданной объединить участников местных промо-команд.<br><br>В этот раз ребята подготовились основательно, чтобы показать всю широту влияния и наследия UK сцены, соответственно и называться мероприятие будет MLC: LEGACY OF UK🇬🇧<br><br>nft priority pass - вход бесплатный</p>',500,'700.0',1,77,1,'','https://t.me/miragebar/819',false,false,NULL,NULL,'2023-02-10 02:05:17','2023-09-27 21:11:52',NULL,'','0',18,6),
	 (335,'Hedonism - Iskrennost''','2023-02-17-kontrkult-hedonism','2023-02-17',NULL,'23:00:00',NULL,'<p>Главная доктрина гедонизма - удовольствие в абсолюте, а все остальные ценности лишь инструменты, которые помогают этого удовольствия достичь.<br><br>17 февраля на сцене андерграундного плейса Петербурга соберутся тёмные амбассадоры гедонизма под предводительством двух лордов из <a href="https://t.me/monasteriomoscow">Monasterio:</a> KYK и<a href="https://t.me/alexpankovmusic"> ALEX PANKOV</a>, а также другими мощными локальными продюсерами и гостями из столицы с самыми терпкими индустриальными музыкальными историями.</p>',600,'',1,33,1,'https://t.me/hedonism_tech_bot','',false,false,NULL,NULL,'2023-02-10 02:14:17','2023-10-20 11:53:16',NULL,'','0',18,19);
