	 (336,'Mixed.night vol.1 ','2023-02-11-mixednight-vol1','2023-02-11','2023-02-12','22:00:00','06:00:00','<p>Первая фирменная вечеринка от бара Mixed которая пропагандирует&nbsp; смешанные напитки, кухню, микс людей, культур и различных стилей музыки.&nbsp;<br><br>Откроет вечеринку легким вайбом Kid Cope — владелец винилового магазина Культура, участник группы Tapenight.&nbsp;<br>продолжит Juravlove — петербургский диджей и продюсер, участник дуэта Полиритм, ведущий радио-программ Полиритм и Bad Bad Song.<br><br>хаус эстафету перехватит мастер и волшебник микшера Fanick из<br>klm_fanclub.<br>проводником из хауса в минимал-звучание выступит Preesh — участник объединения Double Sound².<br><br>продолжат ночь в режиме Minimal, Poly — босс лейбла Tur и серии вечеринок с одноименным названием;<br>Kekoriy — создатель лэйбла utro.rec и творческая единица объединения n.thing_real.<br><br>завершат первую mixed.night vol. 1 — Mio Ristic и Kodacki с минималистичным live modular выступлением.<br><br></p>',NULL,'500.0',1,NULL,1,'','',false,false,NULL,NULL,'2023-02-10 02:24:11','2023-10-24 21:06:03',NULL,'','0',18,14),
	 (337,'Therapy Sessions','2023-03-11-factory-3-therapy-sessions','2023-03-11',NULL,'23:55:00',NULL,'<p>Drum and bass рейв <a href="https://vk.com/therapysessions">Therapy Sessions</a> возвращается в Санкт-Петербург! Мы собрали лучших представителей темного отечественного drum and bass звучания, неоднократных представителей фестивалей Therapy Sessions в Европе!<br><br>11 марта в клубе Factory окунемся в андерграунд вместе с Gancher &amp; Ruin, CA2K, Paperclip, Dyslexia, Tantrum Today, Hell Kitchen, Vein, Inerpois, Big-Head, Plasti-x, N!ke, <a href="https://vk.com/feed?section=search&amp;q=%23Prtyhard">#Prtyhard</a><br>&nbsp;<br>WE ARE THE DARK SIDE!</p>',900,'',1,7,1,'https://ts666.ru/','https://ts666.ru/',false,false,NULL,NULL,'2023-02-15 12:28:06','2023-10-25 17:54:02',NULL,'','0',18,127),
	 (338,'Underground G: Finish Them!!!','2023-03-04-griboedov-underground-g-finish-them','2023-03-04',NULL,'23:00:00',NULL,'<p>Списки:<br>Первые 100 репостов — 300 рублей!<br>Следующие 100 репостов — 400 рублей!<br>Остальные репосты — 500 рублей!<br>Без внимания к мероприятию — 700 рублей!<br><br>Для того, чтобы репост считался действительным, необходимо вступить в паблик <a href="https://vk.com/undrgrndg">UNDERGROUND G</a> и написать ”+” в комментарии.<br><br>** Репосты, сделанные после 4 марта 20:00, не являются действительными, вход «без внимания к мероприятию»<br><br>Локация до боли знакома и невероятно любима:<br><br>Сумасшедший дизайнер: Алексей Французов<br><br>Ответственные за бал: Владик, Тёмик<br><br>P.S: Шао Кан пострадает сильно</p>',300,'700.0',1,86,1,'','',false,false,NULL,NULL,'2023-02-15 12:41:31','2023-10-23 21:33:32',NULL,'','0',18,33),
	 (339,':DATA','2023-02-18-rndm-data','2023-02-18',NULL,'22:00:00',NULL,'<p>Бейс-трио Teddy Killerz уже давно получило признание и любовь слушателей. Их музыка выходит на топовых лейблах<br>Выступление проекта такой величины в формате и атмосфере :data - это особенное событие для нас и подарок для всех ценителей музыки Teddy Killerz.<br><br>Резидентский состав представляют Cutworx и Untrue, которые сыграют специальный back2back сет, а также Subwave, Traffic и открытие Data Music - Fulltek.<br><br>Начало: 22:00<br>Билеты:&nbsp;</p>',800,'',2,27,1,'https://moscow.qtickets.events/61973-data','https://vk.com/wall-145793441_2132',false,false,NULL,NULL,'2023-02-15 12:56:52','2023-09-28 10:23:54',NULL,'','0',18,42),
	 (340,'Pink Shine Party','2023-02-18-griboedov-pink-shine-party','2023-02-18',NULL,'23:00:00',NULL,'<p>Кассетный звук снова в подвале клуба Грибоедов! На этот раз с Москвы помимо Route 696 к нам в гости едет создатель лейбла Graveyard Family, DJ Impact, с одним из участников DJ Acoustic.<br><br>Вход по спискам:<br>300 — первые 100 заявок<br>400 — следующие 100 заявок<br>600 — без внимания к мероприятию<br><br>Условия попадания в списки расписаны в запрещённой социальной сети!<br>Среди всех, кто выполнит все условия разыграем 4 фри входа!<br><br><br></p>',300,'600.0',1,86,1,'','https://t.me/griboedovbasement/2165',false,false,NULL,NULL,'2023-02-15 13:12:57','2023-10-24 21:30:25',NULL,'','0',18,41),
	 (341,' DISCO FLOWERS BALL. Episode Carmine ','2023-02-18-freedom-disco-flowers-ball-episode-ca','2023-02-18',NULL,'23:00:00',NULL,'<p>Светский горячий коктейль любви, музыки и красивейшей публики из Санкт-Петербурга и столицы. Повод&nbsp; - День всех влюбленных.&nbsp;<br><br>Эстетика залов, романтичное настроение, раскрепощенные танцы - все на двух танцполах с темпераментными артистами, музыкантами и диджеями:&nbsp;<br><br>1 DanceFloor [ italo &amp; french / disco / indie / synth]:<br><br>• Fck Stereotypes, петербургский дуэт Гамлета Мовсияна и Андрея Севастьянова - эксперимент с синтезом электронной и живой музыки. Stereotypes компилируют различные стили музыки с психоделичными электрогитарами и минималистичным вокалом.<br>• Shinder&nbsp; &amp; Suzikari<br>• Kostromin<br>• Shahash (vinyl)<br><br>2 DanceFloor [hip-hop / r''n''b]:<br><br>• Tony Lil<br>• Poison<br>• Soul Sista<br>• Nick Brown<br>• Pasha Bronx<br><br>&nbsp;Dresscode: наряды в цвете красный кармин&nbsp;<br>В эту ночь важно будет лишь одно - ваше желание танцевать и любить музыку.<br><br><br></p>',1900,'',1,42,1,'https://k7.su/event/disco-flowers-ball','https://t.me/freedom_kazanskaya/510',false,false,NULL,NULL,'2023-02-15 13:25:56','2023-10-24 21:31:59',NULL,'','0',18,19),
	 (342,'RАЗЪЁМ ','2023-03-11-gas-razieem','2023-03-11',NULL,'23:00:00',NULL,'<p>Картель PRTTY PRTY вновь открывает двери в Северной столице и врывается с внушительными новостями!&nbsp;<br>Новое танцевальное пространство «GAS», встретит вас ультимативным лайнапом и широким спектром музыкальных жанров.<br><br>Вход:<br>до 00 - 500₽<br>после 00 - 600₽<br>И помните: RAЗЪЁМ рядом.</p>',500,'600.0',1,57,1,'','http://t.me/prtty_prty',false,false,NULL,NULL,'2023-02-15 13:35:11','2023-10-11 01:23:48',NULL,'','0',18,65),
	 (343,'VALENTINE’S DAY','2023-02-17-miraz-valentines-day','2023-02-17',NULL,NULL,NULL,'<p>Масштабное празднование Дня Всех Влюблённых состоится в клубе Mirage уже в эту пятницу!&nbsp;<br>С вечеринки никто не уедет без пары, если сам этого не захочет<br>17.02 | VALENTINE’S DAY | MIRAGE<br><br>Вход:&nbsp;<br>500₽ (stories + repost)<br>700₽ без внимания к мероприятию + фейс<br>nft priority pass - вход бесплатный</p>',500,'700.0',1,77,1,'','https://t.me/miragebar/838',false,false,NULL,NULL,'2023-02-15 13:44:46','2023-09-18 16:14:30',NULL,'','0',18,5),
	 (344,'8 — µ ','2023-03-07-mutabor-8','2023-03-07','2023-03-09','23:00:00',NULL,'<p>(µ) – Собираются первые весенние лайнапы. На продолжительный отрезок свободного времени с 7 по 9 марта — практически составлен. <br>Задействовано 5 пространств клуба. В программе несколько премьер, новые лайвы и много танцевальных сетов. <br>Без разделения на танцполы, more TBA</p>',1300,'',2,2,1,'https://mutabor.club/8M','',false,false,NULL,NULL,'2023-02-15 18:22:29','2023-10-24 21:04:25',NULL,'','0',18,39),
	 (345,'BIICMAK + RADAR','2023-02-18-supermetall-biicmak-radar','2023-02-18',NULL,'22:00:00',NULL,'<p>18 февраля встречаемся с вами на суперметалле для того, чтобы разменяться новинками электроники + эксклюзивами от меня и моих друзей!&nbsp;<br><br>Вторая новость, но первая по значимости — день рождения&nbsp; Кати Milkshakeis!&nbsp;<br><br>📹: Снимаем сетики диджиков, поэтому одевайтесь красиво! Хотя вы и так все красивые!&nbsp;<br><br>Билетов всего 200шт.<br>КУПИТЬ БИЛЕТЫ (https://moscow.qtickets.events/63143-biicmak-x-radar-180223) 🎫</p>',1000,'',2,119,1,'https://moscow.qtickets.events/63143-biicmak-x-radar-180223','',false,false,NULL,NULL,'2023-02-16 12:49:15','2023-10-19 13:44:16',NULL,'','0',18,51);
