	 (1675,' SUMMER OF HAZE ','2023-09-02-rndm-summer-of-haze','2023-09-02',NULL,'19:00:00',NULL,'<p>Большой сольный концерт Summer Of Haze в уютном дворе клуба RNDM состоится 2 сентября. Количество билетов ограничено</p>',800,'1300.0',2,27,2,'https://moscow.qtickets.events/80787-summer-of-haze-rndm-dvor-open-air','',false,false,NULL,2,'2023-08-24 03:37:24','2023-10-22 23:06:00',NULL,'','0',18,70),
	 (347,'ГРЯДЁТ House Music','2023-02-17-lachesis-griadet-house-music','2023-02-17',NULL,'20:00:00',NULL,'<p>Делаем веселую тусу со всеми оттенками хауса в одной намоленной локации на двух танцполах.<br>В этом обновленном укромном месте будет авторский бар (это когда вы алкоголь считаете реально вкусным), а кухня работает всю ночь (брускетта с вялеными томатами - топ).<br><br>На мейне с отличным звуком пьем, танцуем и едим под house, tech house, deep<br>А во второй зале - под micro и мини всё такое концептуальное<br>С небольшой поволокой от дня Святого Валентайна)<br>В общем, 11 диск жокеев будут вас гулять с 20:00 и до самого утра.<br><br>FC/DC: приходи любой<br><br>Билеты в предпродаже: 500<br>На входе: 700<br>Девчатам до 00:00 фри вход<br><br></p>',500,'700.0',2,121,1,'https://moscow.qtickets.events/62668-g-r-ya-d-e-t-house-music','',false,false,NULL,NULL,'2023-02-16 13:41:29','2023-09-28 08:17:45',NULL,'','0',18,19),
	 (348,'Loft 3.0','2023-02-17-krov-loft-loft-30','2023-02-17',NULL,'22:00:00',NULL,'<p>Chacha’s Crew собирается в эту пятницу снова в лофте. В этот вечер мы окунёмся в мир любви.<br>FC: быть на стиле, аксессуары приветствуются.<br><br>Правила:<br>1 Объятия при встрече и знакомстве.<br>2 Угощать соседа<br>3 Быть приветливым<br>4 Напитки можно с собой<br>5 Для нас будет работать бар</p>',1000,'',2,111,1,'https://moscow.qtickets.events/63445-loft-30','',false,false,NULL,NULL,'2023-02-16 13:48:03','2023-09-02 14:04:26',NULL,'','0',18,3),
	 (349,'The Weeknd Birthday Party','2023-02-17-live-stars-the-weeknd-birthday-party','2023-02-17',NULL,'23:30:00',NULL,'<p>17 февраля, в ночь с пятницы на субботу в Москве состоится The Weeknd Party в честь дня рождения Эйбла! Мы готовим интересную программу мероприятия, ночь обещает быть насыщенной и запоминающейся для всех любителей творчества выходного! Всю ночь диджеи ставят музыку, а наш специальный музыкант из Индии с потрясающим вокалом вживую споет любимые песни The Weeknd!<br><br>Адрес: клуб Live Stars, Берсеневский переулок 5, стр.2<br>Возрастное ограничение строго 18+! Не забудьте паспорт, либо водительские права, чтобы подтвердить возраст на входе в клуб!</p>',500,'',2,71,1,'https://moscow.qtickets.events/61372-the-weeknd-birthday-party-moskva-17-fevralya','',false,false,NULL,NULL,'2023-02-16 13:51:35','2023-10-22 23:08:02',NULL,'','0',18,7),
	 (350,'Despersion. День Рождения','2023-02-17-16-tonn-despersion-den-rozdeniia','2023-02-17',NULL,'23:55:00',NULL,'<p>Despersion - российский дуэт из Москвы, образованный в 2017 году Владимиром Decent и Александром Lion. <br>Ребята уже зарекомендовали себя как создатели мелодичных и в то же время агрессивных вибраций, несмотря на то, что они все еще находятся в самом начале своей творческой деятельности как музыкального проекта. <br>За 6 лет существования ребята добились определенных успехов в работе и получили поддержку от ведущих российских производителей DnB в России. <br>С 2018 года они стали участниками самого громкого и узнаваемого проекта о драм-н-бэйс-музыке в Российской Федерации - подкаста Neuropunk, который, в свою очередь, уже полюбился ценителям жанра во всех уголках планеты.<br>За последние пару лет ребята, выпустив три релиза на лейбле Eatbrain, подтвердили себя как один из ярких neurofunk проектов не только в России но и в мире.</p>',500,'',2,29,1,'https://moscow.qtickets.events/61510-despersion-den-rozhdeniya','',false,false,NULL,NULL,'2023-02-16 15:15:23','2023-10-22 11:45:19',NULL,'','0',18,16),
	 (351,'SPACEX','2023-02-18-pravda-spacex','2023-02-18',NULL,'17:00:00',NULL,'<p>Тематический ивент со знакомствами и крутым интерактивом в поистине крутом клубе PRAVDA !&nbsp;<br>Планируется подорожание билетов&nbsp;<br>Наличие промокода гарантирует скидку&nbsp;</p>',599,'',2,20,1,'https://moscow.qtickets.events/61496-spacex','',false,false,NULL,NULL,'2023-02-16 15:28:26','2023-10-25 02:56:19',NULL,'','0',18,24),
	 (376,'GLEBASTA SPAL','2023-02-24-griboedov-glebasta-spal','2023-02-24',NULL,'19:00:00',NULL,'<p>Раз на улице такой холод, мы решили устроить вам жару!<br><br>В пятницу, с сольным концертом выступит легенда отечественного хип-хопа GLEBASTA SPAL!<br><br>Уникальный звук и экспериментальное звучание музыки, в сочетании с ярким визуалом — вот что ждёт нас на этой недели!</p>',400,'700.0',1,86,1,'https://glebasta-spal.ticketscloud.org/','',false,false,NULL,NULL,'2023-02-23 19:48:46','2023-10-09 05:15:00',NULL,'','0',18,6),
	 (352,'Организованные беспорядки','2023-02-18-kitaiskii-letcik-dzao-da-organizovannye','2023-02-18',NULL,'18:00:00',NULL,'<p>Организовываем беспорядки, распитие спиртных напитков, слэм и безумие в центре Москвы 18 февраля<br><br>3 группы будут играть для тебя лютую жесть из смеси панка, рэп-кора, металла, рока и бешеной энергии, которые помогут тебе забыть обо всём этом<br>мы ждём тебя, твоих друзей, родителей, собутыльников, сокурсников и прочих прекрасных людей на наших организованных беспорядках!</p>',222,'300.0',2,122,1,'https://moscow.qtickets.events/62189-organizovannye-besporyadki','',false,false,NULL,NULL,'2023-02-16 15:51:03','2023-09-06 11:21:03',NULL,'','0',18,8),
	 (353,'Party Mask Edition Act 1.','2023-02-18-treff8-club-party-mask-edition-act-1','2023-02-18',NULL,'22:00:00',NULL,'<p>Дорогие друзья, мы рады вас приветствовать на первом акте наших вечеринок!<br>Наша задача максимально вас погрузить в историю фильма, создав незабываемую атмосферу!<br>- Световое шоу<br>- Декорации<br>- Актеры<br>- Лучшие команды<br>- Современная локация<br>- Лучший сервис<br>- Лайн ап из топ артистов<br><br></p>',1250,'',2,84,1,'https://moscow.qtickets.events/62710-party-mask-edition-act-1','',false,false,NULL,NULL,'2023-02-16 16:04:42','2023-10-24 21:19:42',NULL,'','0',18,30);
