	 (354,'DJ BATTLE ','2023-02-18-kitaiskii-letcik-dzao-da-dj-battle','2023-02-18','2023-02-19','23:00:00','05:00:00','<p>Бородатый. Лысый. Злой:<br>Rock Dj Nebzdyaschiy<br>VS<br>Очаровательная рыжая кудряшка:<br>DJ Ekta<br>Столкнутся в нешуточном баттле: наставник против ученицы!<br>Выясним, кто же по вашему мнению лучший DJ<br>Победителя определяет зал! Приходи и выбери!<br><br>Бронируем лучшие места по телефонам: +7-495-624--56-11 и +7-991-620-60-97 - WhatsApp</p>',300,'',2,122,1,'https://moscow.qtickets.events/61638-1802-dj-battle-dzhao-da','https://m.vk.com/connekt_dj_battle',false,false,NULL,NULL,'2023-02-16 16:14:44','2023-09-18 11:32:46',NULL,'','0',18,19),
	 (355,'Tommy’s Friends','2023-02-18-tommy-lee-tommys-friends','2023-02-18',NULL,NULL,NULL,'<p>В эту субботу выходим из сумрака будней и отправляемся за порцией электронных ритмов в Tommy Lee. 18 февраля разгорится настоящий музыкальный пожар, потому что раздавать звук будет Sham Jam!<br><br>Sham Jam — виртуозный диджей и продюсер, резидент известного лейбла Bassmatic Records. Благодаря широкому спектру стилей, музыка Sham Jam попадает на вершины чартов и регулярно играет на радио. Сейчас музыкант транслирует своё видение через насыщенные сочные сеты, сочетая melodic house и indie dance.<br><br>Локальную поддержку окажут и другие артисты! Жду тебя этой ночью и всегда.<br><br>Резерв по телефону и WhatsApp: 8 921 9381212<br><br>Вход FC/DC<br>Tommy Lee<br>18+</p>',NULL,'',1,83,1,'','https://vk.com/wall-203632547_592',false,false,NULL,NULL,'2023-02-16 17:20:39','2023-09-06 23:28:57',NULL,'','0',18,10),
	 (356,'Базовое Техно FIVE YEARS ANNIVERSARY','2023-03-18-factory-3-bazovoe-texno-five-years-anni','2023-03-18',NULL,'23:00:00',NULL,'<p>Праздничная дискатечная феерия продолжается. Базовое Техно обьявило дату своих именин и выкатило первых пташек! Хватай пока горяченькие&nbsp;</p>',800,'',1,7,1,'https://rupor.biz/widgets/event-tickets/806','https://t.me/bazovoetechno',false,false,NULL,NULL,'2023-02-17 13:24:38','2023-10-20 03:43:57',NULL,'','0',18,25),
	 (357,'OCSID LOVERS','2023-02-17-barnoe-obieedinenie-profsoiuz-ocsid-lov','2023-02-17',NULL,'21:00:00',NULL,'<p>Всем привет! Море любви, танцы под луной и коктики неземной вкусноты.&nbsp;<br>Таким будет Валентинов день в OCSID’е, который мы отпразднуем 17 февраля.<br><br>На танцполе нас ждёт «романтик коллекшн» из рук любимых диджеев, а в баре спецпредложение — секси-шоты «69»* и наша фото-будка, заряженная Купидоном специально для сладеньких пар.<br><br>*Пряный ром, малиновое пюре, персиковый ликер, клюквенный морс, пюре лайма.&nbsp;<br><br>Си ю!</p>',0,'',2,123,1,'','',false,false,NULL,NULL,'2023-02-17 13:43:09','2023-02-17 13:43:09',NULL,'','0',18,0),
	 (358,' CHANNELS','2023-02-17-gazgolder-channels','2023-02-17',NULL,'23:00:00',NULL,'<p>У Газгольдера есть удивительное свойство: собирать под своей крышей самых ярких и веселых людей во вселенной. Очередной сбор будет уже в эту пятницу, 17 февраля.&nbsp;<br><br>На ночное дежурство заступит вечеринка CHANNELS, а тематикой ивента станут супергерои. &nbsp;<br>Этой ночью приглашенные хип-хоп диджеи раскроют миру свои суперспособности: талантливые ребята будут раскачивать два стэйджа всю ночь на пролёт!<br><br>Благодаря антуражу, над которым трудятся создатели вечеринки, каждый гость сможет почувствовать себя героем комикса. Чтобы движение на двух танцполах не прекращалось!<br><br></p>',1000,'',2,35,1,'https://widget.afisha.yandex.ru/w/sessions/MTk5NDl8MzY1MTczfDI5MDIwMHwxNjc2NjY0MDAwMDAw?clientKey=93e262b1-8851-4821-9af4-2ba6d919f1f9','',false,false,NULL,NULL,'2023-02-17 13:53:33','2023-02-17 13:53:33',NULL,'','0',18,0),
	 (377,'Algorithm 1 Year','2023-02-24-gorod-algorithm-1-year-1','2023-02-24','2023-02-25','23:50:00','07:00:00','<p>Эй, братва! Давайте вместе гудеть! Начнём шизить и петь! Заряд ещё мощней! Драм-н-бейс всех сильней!<br><br>Этот год открываем мощнейшей вечеринкой, ведь в этом году мы отмечаем первый День Рождения команды. Да-да, друзья, уже как год мы делаем и создаём для вас праздничное настроение, стремимся на каждой нашей тусе дарить вам положительные эмоции и качественное музло! Этот год также не будет исключением и мы продолжим гнуть свою линию! Потому собрали братский лайнап, чтобы передать вам наш настрой и зарядить мощнейшей энергией на год вперёд!</p>',600,'',2,63,1,'https://moscow.qtickets.events/59832-algorithm-1-year-240223','https://vk.com/algorithm_one_year',false,false,NULL,NULL,'2023-02-24 01:02:57','2023-09-07 18:06:28',NULL,'','0',18,11),
	 (359,'Solar Systo 2023 - 20 years','2023-05-18-solar-systo-2023-20-years','2023-05-18','2023-05-22',NULL,NULL,'<p>Мы, как и 20 лет назад, верим в чудеса. <br>Поэтому они и случаются!<br>Все мы с нетерпением ждём прихода весны. После холода и льда жизнь просыпается журчанием капелей и пением птиц. Солнечные лучи теплеют, согревая воздух, землю и наши тела.<br><br>А ещё мы ждём весну, чтобы собраться на Солар Систо. Увидеться, обняться, согреться огнём костра и насладиться просыпающимся весенним лесом, вдохновиться музыкой и песней, поделиться событиями прошедшего года, построить планы на будущее, и вместе создать праздник. Праздник, который струится при встрече из наших сердец.<br><br>Много фестивалей мы прошли вместе, и каждому они запомнились как прекрасные и неповторимые мгновения весны, пробуждение и обновление себя, прикосновение к пространству радости. С вниманием всматриваясь в будущее, мы осознаём: за двадцать лет Систо стало для нас не просто музыкальным событием, а традиционным праздником, объединяющим такие разные племена в единое большое сообщество, в котором выросло новое поколение, родилось наше будущее.<br><br>Мы, как и 20 лет назад, верим в чудеса. Поэтому они и случаются! Так давайте же вновь соберёмся вместе и покажем этому миру, что мы готовы к любым вызовам – любовь, творчество и намерение станут нашими инструментами. Есть поговорка: «Племя, которое танцует, не умирает». Жизнь – это движение и ритм! В едином порыве танца, вместе, мы преодолеем все трудности и испытания.<br><br>Сбор племён состоится в любую погоду 18-22 мая 2023, где-то в лесах Ленинградской области!<br>https://2023.solarsysto.ru/<br><br>Приём оргвзносов первой волны начнется на следующей неделе. Следите за новостями ;)</p>',5400,'5800.0',1,NULL,3,'https://org.solarsysto.ru/','https://2023.solarsysto.ru',false,false,NULL,NULL,'2023-02-21 11:07:22','2023-10-25 04:02:23',NULL,'','0',18,204),
	 (360,'Oberwave','2023-03-11-mutabor-oberwave','2023-03-11',NULL,'23:55:00',NULL,'<p>Открываем сезон большой вечеринкой в Мутаборе. <br>На сцене: наши любимые артисты, а также Cult Black Venus с гитарный лайвом и наглядным примером, каково это, когда богемный дарквейв встречается с сырым, прокуренным блюзом. <br>В остальном все, как вы любите: тлеющие свечи, влажные взгляды и атмосфера пира во время чумы.<br><br><br></p>',800,'',2,2,1,'https://moscow.qtickets.events/62920-1103-oberwave-at-mutabor','https://t.me/oberwave',false,false,NULL,NULL,'2023-02-21 14:46:28','2023-10-24 22:57:19',NULL,'','0',18,28),
	 (361,'bpm block','2023-02-23-mutabor-bpm-block','2023-02-23',NULL,'23:00:00',NULL,'<p>bpm block: «Каждый поэт, художник и музыкант олицетворяют систему симбиотических структур, сплетенную в единое созидательное.&nbsp;<br>В итоге рождается коллективный эстетический труд, состоящий из экспрессии разных характеров, личностей, стилей. Все это и есть bpm block»<br>bpm block: «Помимо этого, дюжина современных поэтов прочитают свои авторские произведения. <br>Коллаборация вместе с «Luminopoetry» подарит вам возможность, встретить предрассветные часы на волнах современной поэзии.»</p>',800,'',2,2,1,'https://clck.ru/33W5Cp','',false,false,NULL,NULL,'2023-02-21 15:51:09','2023-10-16 05:55:12',NULL,'','0',18,64),
	 (362,'24.02 GÁS MUSIC CLUB','2023-02-24-gas-2402-gas-music-club','2023-02-24','2023-02-25','23:00:00','06:00:00','<p>Никаких больше вечеринок? - эта история точно не про нас&nbsp;<br>Мы не боимся, завтра точно проснемся<br>Будет звучать стильная музыка, DC по соответствию.</p>',500,'',1,57,1,'','',false,false,NULL,NULL,'2023-02-21 16:03:39','2023-09-21 01:09:52',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,11);
