	 (364,'23.02 GÁS MUSIC CLUB','2023-02-23-gas-2302-gas-music-club','2023-02-23','2023-02-24','23:00:00','06:00:00','<p>День, благодаря которому у нас есть возможность видеться чаще <br>Поздравляем парней и танцуем, пока совсем не упадем<br>FC/DC 18+<br>Будет звучать стильная музыка, DC по соответствию.</p>',500,'',1,57,1,'','',false,false,NULL,NULL,'2023-02-21 16:39:31','2023-10-25 07:46:35',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,64),
	 (365,'HakkeNight','2023-03-04-factory-3-hakkenight','2023-03-04',NULL,'23:59:00',NULL,'<p>4 марта вас ждёт одно из самых крупных мероприятий от команды HakkeNation<br><br>Звуки Gabber и HardTechno сразу на двух танцполах. Специально для вас приедут небезызвестные гости из Москвы.&nbsp;</p>',700,'',1,7,1,'https://hakkenation-event.timepad.ru/event/2311128/','https://vk.com/hakkenation',false,false,NULL,NULL,'2023-02-21 17:41:20','2023-09-18 12:01:33',NULL,'','0',18,6),
	 (366,'FLUR','2023-02-22-flur','2023-02-22','2023-02-23','21:00:00','05:00:00','<p>FLUR&nbsp; – это самый красочный рейв Москвы. Неоновые краски и ничего лишнего, даже трусов – вот наше видение. Голые тела становятся больше чем холстами – динамическими инсталляциями, засинхроненными на танцполе ритмами наших диджеев.&nbsp;<br><br>FLUR – место встречи этичных свободных людей, ценящих будоражащий живой звук, наслаждающихся эстетикой и кинестетикой, открытых к наслаждению, желающих жить ярко и обретать себе подобных.&nbsp;<br><br>И тема нашей вечеринки HOUSE. или хаос, или хаус – все едино.&nbsp;<br>Дадим house во всех своих проявлениях. И тяжелый тек, и легкий органик, и заводной джекин, и даже диско хаус.&nbsp;<br>Все вариации такого популярного, и такого разного стиля на одной сцене. Во флюрном цвете и в бесконечном веселье!</p>',6000,'',2,NULL,1,'https://docs.google.com/forms/d/e/1FAIpQLScsURqj7f9o-1W0kVL9QbIOrAw4_P5OZ3pvp-3YP4IeDRabmQ/viewform','https://t.me/flurparty',false,false,NULL,NULL,'2023-02-21 22:12:46','2023-10-24 21:18:16',NULL,'','0',18,35),
	 (1572,'ITALLIKA','2023-08-12-vinnyi-sklad-itallika','2023-08-12',NULL,'19:00:00',NULL,'<p>В субботу <a href="https://www.instagram.com/reel/CvuGp9GI6Es/?igshid=MzRlODBiNWFlZA==">ITALLIKA</a> устраивает Open Air на Винном Складе.<br>Дресс код: glam, rock, fancy, disco</p>',NULL,'0.0',1,250,1,'','',false,false,NULL,1,'2023-08-11 16:07:49','2023-10-25 14:36:05',NULL,'','0',18,96),
	 (367,'Большой Рейв','2023-03-04-blank-bolsoi-reiv','2023-03-04',NULL,'23:00:00',NULL,'<p>Ему не нужно ждать подходящей погоды, он просто вмешается в твою жизнь, как лучик солнца, проникая в заиндевевшее окно, переворачивает все вверх дном. Без спроса разрисовывает теплом обои, выгибает опустившиеся уголки губ в обратную сторону, даже в обленившемся коте пробуждает интерес к жизни, выгуливая зайчиков по потолку. Кто-то называет это любовью, кто-то весной, а мы, зная, что все тождественно, зовем его «Большим Рейвом».&nbsp;<br><br>Урчим, предвкушая, как 4 марта наш здоровяк пошлет зиму к чертовой матери. Золотой — первый весенний гром от Resonance во главе с Забелиным. Гримерка – первое солнышко, вытащенное из-под полы TAPENIGHT Кланом и ему сочувствующими. На мейне — пикник на обочине беззаботных дней с ценителями диковинного звука и съедобными горячими псами.&nbsp;</p>',900,'',1,1,1,'https://blankclub.ru','https://blankclub.ru',false,false,NULL,NULL,'2023-02-21 22:26:43','2023-10-04 10:34:44',NULL,'','0',18,39),
	 (368,'Sabotage D''nB Party','2023-02-23-mod-sabotage-dnb-party','2023-02-23',NULL,'23:00:00',NULL,'<p>Уже бывали в клубе MOD, который недавно переехал на Арсенальную набережную и увеличился в размерах?<br><br>Если ещё нет, то 23 февраля выдастся прекрасная возможность: первое масштабное событие SABOTAGE (https://t.me/sabotageomg/82) в 2023 году!&nbsp;<br><br>Оно станет ярким началом многочисленных и крупных мероприятий с участием лучших представителей DNB сцены.<br>Готовьтесь к безумной и жаркой ночке, наполненной ломаной энергетикой от резидентов и специального гостя</p>',400,'',1,113,1,'https://sabotage-inc.timepad.ru/event/2314623/','',false,false,NULL,NULL,'2023-02-21 22:33:45','2023-10-25 05:53:15',NULL,'','0',18,48),
	 (369,'PANOPTIC','2023-02-23-mixed-panoptic','2023-02-23',NULL,NULL,NULL,'<p>В четверг 23 февраля Mixed представляет новый проект PANOPTIC.&nbsp;<br><br>Это — серия вечеринок, объединяющая любителей ультраминималистичного звучания, редких интроокулярных ритмов и поклонников тонкого юмора.<br><br>Хедлайнером станет потрясающая Anushka, изысканно и минималистично, ее выступление обрамят сеты от коллег-диджеев!<br><br>P.S. перед вечеринкой panoptic в mixed прозвучат лайв выступления от проектов Cleaning Company и Узор.<br>Вход свободный.</p>',500,'',1,59,1,'','',false,false,NULL,NULL,'2023-02-21 22:45:41','2023-10-20 18:11:27',NULL,'','0',18,25),
	 (370,'ITALLIKA','2023-02-22-union-itallika','2023-02-22',NULL,'22:00:00',NULL,'<p>Bonjour Питер! <br>22 февраля пульсации итало и диско электроники в Union (https://t.me/itallikaparty/450)<br><br>В гости едет <a href="https://on.soundcloud.com/495G8txECG3DShyV9">Karolina BNV</a>, а её сеты всегда&nbsp; <br>Недавно её микс вышел на <a href="https://on.soundcloud.com/YVnCGhCdXx93qGfj6">италлике</a>, слушайте&nbsp;<br><br>Также музыка от братьев и сестёр италлики!<br><br>Дресс код - нарядный, винтажный<br><br>До 23.00 фри, после 400₽</p>',0,'400.0',1,8,1,'','',false,false,NULL,NULL,'2023-02-21 22:50:06','2023-09-18 22:14:50',NULL,'','0',18,21),
	 (371,'Popoff Kitchen XXL','2023-02-25-mutabor-popoff-kitchen-xxl','2023-02-25','2023-02-26','23:00:00','23:59:00','<p>Решили, что пора поделиться с вами кусочком лайн-апа на предстоящее событие Popoff Kitchen XXL<br>А так же рассказываем, что ранние пташки закончились, теперь в продаже поздние пташки, стоимость которых 1200 рублей.</p>',1200,'',2,2,1,'https://ticketscloud.com/app#!/deals/events/63d271c6c173a01ed966e613','',false,false,NULL,NULL,'2023-02-22 00:35:02','2023-09-18 14:02:44',NULL,'','0',18,39);
INSERT INTO public.events (id,title,slug,start_date,end_date,start_time,end_time,description,price_from,price_gate,city_id,venue_id,event_type_id,tickets_url,info_url,is_cancelled,is_featured,deleted_at,user_id,created_at,updated_at,ticketscloud_event_id,ticketscloud_event_token,ticketscloud_event_multi,age_limit,"views") VALUES
	 (372,'BETON','2023-02-25-kontrkult-beton','2023-02-25',NULL,'23:00:00',NULL,'<p>Природные человеческие базисы — тяга к запретному и подконтрольность социуму.&nbsp;<br>В симбиозе эти категории рождают причудливые и любопытные сочетания, оправдывающие сосуществование друг друга, а в роли реактива надёжно выступает музыка. В первые такты мы попадаем в ловушку. В последующие — заботливо открываем дверку своему бессознательному я, выходящему в тот самый социум (зачарованному ровно так же, как и мы). Какими мы доберёмся до последних тактов? Как далеко наружу выйдет «оно»? — тайна, которую нужно оставить в стенах Контркульта, чтобы&nbsp; вернуться в обычную жизнь немножечко другими.</p>',600,'',1,33,1,'https://t.me/nasledie_label_bot','https://t.me/kontrkult21/310',false,false,NULL,NULL,'2023-02-22 00:45:24','2023-10-23 02:17:09',NULL,'','0',18,34),
	 (373,'HIGHWAY NIGHT','2023-02-22-gazgolder-highway-night','2023-02-22',NULL,NULL,NULL,'<p>Ночь Highway – лучшее из мира танцевальной электроники в исполнении резидентов и друзей лейбла. Яркие музыкальные эмоции на двух танцполах легендарного клуба Газгольдер.&nbsp;<br>С картами Highway Family вход свободный!</p>',1500,'',2,35,1,'https://secret420.timepad.ru/event/2309838/#register','https://www.highwayevent.ru',false,false,NULL,NULL,'2023-02-22 01:12:28','2023-08-03 09:48:03',NULL,'','0',18,12),
	 (374,'IDANCITY ','2023-02-24-griboedov-idancity','2023-02-24',NULL,'00:00:00',NULL,'<p>Пятница в очередной раз ждёт всех чтоб собраться и войти в выходные без лишнего напряжения.<br><br>Танцы, музыка и полный бар ваших любимых напитков в запутанных застенках клуба Грибоедов станут отличным дополнением к окончанию последней полной недели февраля.<br>Вход:<br>300 —<a href="https://vk.com/wall-154594155_17061"> с репостом</a><br>500 — без внимания</p>',300,'500.0',1,86,1,'','',false,false,NULL,NULL,'2023-02-23 19:36:34','2023-09-18 10:07:52',NULL,'','0',18,31),
	 (1586,'BEERKRAFTABOOM','2023-08-12-hops-mustache-beerkraftaboom','2023-08-12',NULL,'22:00:00',NULL,'<p>Ждём тебя в субботу <strong>12 августа</strong>.<br>Первую пластинку ставим в <strong>22-00</strong><br>Вход свободный.</p>',NULL,'0.0',1,144,1,'','',false,false,NULL,1,'2023-08-12 15:59:07','2023-10-25 09:22:40',NULL,'','0',18,41),
	 (379,'PainOpticum','2023-02-24-slezy-painopticum','2023-02-24',NULL,NULL,NULL,'<p>Команда предлагает прожить свой собственный рейв-экспириенс. <br>Одно из главных искусств темной ночи — шибари, в сопровождении иммерсив-дэнс. <br>Арт-галерея с атмосферными полотнами будет вовлекать в мистическое действо ночи. <br>И все это под разнос от hard-techno артистов на главном танцполе, плавно перетекающий&nbsp; индустриальный hypnotic на малом танцполе в баре. Выступать будут Chain Damage (резидент Monasterio), энергичная SDTX и диджеи команды Synesthesia</p>',600,'',2,102,1,'https://painopticum.timepad.ru/event/2316602/','',false,false,NULL,NULL,'2023-02-24 01:29:12','2023-09-14 01:16:09',NULL,'','0',18,28),
	 (428,'КАСКАД','2023-03-03-blanc-kaskad','2023-03-03',NULL,'22:00:00',NULL,'<p>&nbsp;Первая совместная вечеринка весны молодых промокоманд «Шкаф» и Club Kids. Ребята будут миксовать неочевидный хаус, ломаные ритмы, техно и гэридж, чтобы вы не заскучали на танцполе.&nbsp;</p>',0,'',2,36,1,'','',false,false,NULL,NULL,'2023-03-02 19:53:02','2023-09-07 10:04:20',NULL,'','0',18,8),
	 (380,'Decameron','2023-02-25-community-moscow-decameron','2023-02-25',NULL,'20:00:00',NULL,'<p>Community x Omelchenko Gallery<br><br>Headliner ночи блистательный live от гениального Monoplay. Впервые в Community молодой талант - Ramazan представит свою live программу. За танцевальную атмосферу будут отвечать любимые артисты<br><br>На открытии художница Анна Проказова представит свои работы, а также эксклюзивный видео-арт c ожившими полотнами. Кроме того гости смогут приобрести лимитированную коллекцию постеров авторских карт таро больших арканов</p>',2000,'',2,58,1,'https://u.to/sPW6HQ','',false,false,NULL,NULL,'2023-02-24 01:37:31','2023-10-03 23:17:26',NULL,'','0',18,60),
	 (381,'Lost.Act In My House!','2023-02-25-mixed-lostact-in-my-house','2023-02-25','2023-02-26','22:00:00',NULL,'<p>Lost.Act - московский ди-джей и продюсер, главный идеолог лейбла Drumatiq.<br>Лёша Болгарин - мастер винилового звучания и обладатель большой коллекции пластинок с&nbsp; выдающимся собранием deep, dub и minimal произведений.&nbsp;<br>Eitbit — участник комьюнити Double Sound² и лайв проекта LBRNTH.<br>Arkady Antsyrev — саундпродюсер, диджей и владелец лейлбла Black Sea Side Music.<br><br>Вход свободный до 00:00 FC/DC<br><br></p>',0,'',1,59,1,'','',false,false,NULL,NULL,'2023-02-24 01:44:46','2023-09-28 05:31:03',NULL,'','0',18,37),
	 (382,'EURO TRIP','2023-02-25-griboedov-euro-trip','2023-02-25',NULL,'00:00:00',NULL,'<p>В эту субботу Griboedov Basemet проводит очередную вечеринку из серии EURO TRIP.&nbsp;<br><br>В этот раз в путешествие отправлятся девушки, в сопровождение kirsanax.&nbsp;<br>Всем любителям стиля, андеграунда, техно и электро обязательно к посещению</p>',400,'',1,86,1,'https://euro-trip.ticketscloud.org/','',false,false,NULL,NULL,'2023-02-24 01:54:58','2023-10-15 03:19:11',NULL,'','0',18,22),
	 (383,'New Faces Night','2023-02-24-rndm-new-faces-night','2023-02-24',NULL,NULL,NULL,'<p>New Faces Night — новая серия вечеринок от команды RNDM<br><br>Продолжаем расширять границы музыкальной вселенной и открывать новые светила на локальной сцене. В программе первого ивента — разножанровая селекция от гипнотического электро до свирепого техно.<br><br>Экспонировать будут уже отметившиеся на четверговых «открытых деках» артисты. Компанию им составят яркие молодые артисты, и наш любимый фотограф Depressive Tuesday.&nbsp;<br><br>На саппорте — звездный секретный гость.</p>',0,'',2,27,1,'','',false,false,NULL,NULL,'2023-02-24 02:03:33','2023-10-08 22:47:22',NULL,'','0',18,8);
