	 (384,'Rayme в Поле','2023-02-25-prostranstvo-pole-rayme-v-pole','2023-02-25',NULL,'21:04:15',NULL,'<p>Продано - 2! Rayme в Поле и тоже 25-го февраля, ну просто день на разрыв! Кто не слышал саундсистему и басы pz/dc, идем в Поле.</p>',NULL,'',2,46,1,'','',false,false,NULL,NULL,'2023-02-24 02:16:07','2023-10-09 17:33:46',NULL,'','0',18,18),
