	 (386,'71Е6 Laatoka Birtday','2023-02-24-sandboxmusicroom-71e6-laatoka-birtday','2023-02-24',NULL,'23:59:00',NULL,'<p>Друзья, "TriBul''ka Foundation" совместо с дайвинг содружеством "Подболотники" приглашает весело провести время и отметить день рождения Сашки LaaToka''и.<br><br>Этой ночью вас порадуют опытнейшие инструкторы по ночному нырянию в болото с сосны, спринту по мху в тумане, превращению бензина в воду, изготовлению дым машины из саба... ну и прочих премудростей</p>',500,'',1,110,1,'','',false,false,NULL,NULL,'2023-02-24 02:34:05','2023-09-18 17:20:26',NULL,'','0',18,36),
	 (387,'Lost.Act In My House!','2023-02-25-mixed-lostact-in-my-house-1','2023-02-25',NULL,'00:00:00',NULL,'<p>Lost.Act - московский ди-джей и продюсер, главный идеолог лейбла Drumatiq.<br><br>Лёша Болгарин - мастер винилового звучания и обладатель большой коллекции пластинок с&nbsp; выдающимся собранием deep, dub и minimal произведений.&nbsp;<br><br>Eitbit — участник комьюнити Double Sound² и лайв проекта LBRNTH.<br><br>Arkady Antsyrev — саундпродюсер, диджей и владелец лейлбла Black Sea Side Music.<br><br>Вход свободный до 00:00 FC/DC</p>',0,'',1,59,1,'','',false,false,NULL,NULL,'2023-02-25 21:17:14','2023-09-19 00:09:04',NULL,'','0',18,22),
	 (388,'BPM FEST','2023-03-10-klub-base-bpm-fest','2023-03-10','2023-03-11','18:00:00','23:00:00','<p>Весной 2023 года концертное агентство <a href="https://vk.com/batterspromo">Batters Promo Music</a> проведет свой первый именной фестиваль в двух столицах: <a href="https://vk.com/bpm_fest">BPM FEST</a>!</p><p><a href="https://vk.com/bpm2023msk">Московская часть</a> этого большого события состоится 10 и 11 марта в клубе <a href="https://vk.com/baseclubmsc">BASE</a>, <a href="https://vk.com/bpm2023spb">Санкт-Петербург</a> подхватит эстафету 12 марта в клубе <a href="https://vk.com/sound_club_spb">SOUND</a>.</p><p>В каждый из трех дней гостей фестиваля ждет мощный лайнап из самых актуальных артистов, для которых BPM организовало крупнейшие концерты 2022 года. Но не обойдется и без новых для нас, зато хорошо знакомых вам имен и других приятных сюрпризов!</p>',1600,'',2,124,1,'','https://vk.com/bpm_fest',false,false,NULL,NULL,'2023-02-28 22:32:56','2023-10-14 13:48:51',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,52),
	 (398,'CHERTA — 3 YEARS w/ Daniella Da Silva (DE)','2023-03-04-mutabor-cherta-3-years-w-daniella-da','2023-03-04','2023-03-05','23:00:00','12:00:00','<p>4 марта Черта отметит своё трёхлетие масштабным рейвом в арт-центре Mutabor с Daniella da Silva (Берлин).<br><br>Четыре танцпола, 22 артиста из 5 городов, световые инсталляции, атмосферный декор, маркет аксессуаров и тату-мастерская.</p>',1200,'',2,2,1,'https://cherta-music.timepad.ru/event/2302584/?utm_source=vkontakte&utm_medium=public&utm_campaign=cherta_3years','',false,false,NULL,NULL,'2023-03-01 00:02:56','2023-10-20 20:26:13',NULL,'','0',18,54),
	 (389,'INFINITY NOW','2023-03-08-griboedov-infinity-now','2023-03-08','2023-03-08','19:00:00','22:00:00','<p>Пока вокруг существует множество поводов задуматься о прошлом и будущем, в день празднования женского начала, мы предлагаем задержаться ненадолго в бесконечности настоящего.<br><br>Спустившись в подвал клуба Griboedov Basement, где пройдёт выставка современного искусства 8 марта, мы ненадолго остановим время, чтобы погрузиться в тайну бессознательного. Так же вас ждёт концептуальный перфоманс, приятная музыка, общество самых интересных людей города и конечно же welcome drinks!</p>',0,'',1,86,1,'','',false,false,NULL,NULL,'2023-02-28 22:41:23','2023-10-23 12:52:52',NULL,'','0',18,47),
	 (390,'Violet Techno','2023-03-10-mod-violet-techno','2023-03-10',NULL,'23:59:00',NULL,'<p>10 марта территория нового клуба MOD облачится в темно-фиолетовый цвет, приглашая всех жаждущих на фееричный рейв.<br>Эстетика темного техно соприкоснется с визуализацией ультрафиолета, где каждый пришедший станет частью флюрной магии.<br>Для вас шесть часов концептуальной музыки и отличная коллекция виниловых пластинок<br><br></p>',400,'',1,113,1,'https://spb.qtickets.events/63956-violet-techno','https://vk.com/event218880823?w=wall-218880823_1',false,false,NULL,NULL,'2023-02-28 22:51:22','2023-10-22 05:24:21',NULL,'','0',18,52),
	 (391,'Club Night','2023-03-03-rndm-club-night','2023-03-03',NULL,'22:00:00',NULL,'<p>Пригласили в гости друзей издалека. Из Красноярска к нам едет подписант лейбла «трип», экспериментатор и техно-гипнотизер Roma Zuckerman, а из Владикавказа — эксцентричный электронный музыкант, продюсер и лидер техно-формации MYATMO Zaur Gapienko.<br><br>Также в хайлайтах московские звезды: наш красавчик-резидент Rayme, чьи релизы уже давно покорили международную клубную сцену, рейвер со стажем и организатор безумных вечеринок RAVENSTVO Izov и Rif Erous, молодой артист с крутой селекцией.<br><br>Начало: 22:00<br><br>Вход до 23:00 - 500 ₽, после 1000 ₽</p>',500,'1000.0',2,27,1,'https://vk.cc/clTOJt','https://vk.com/rndmclubnight',false,false,NULL,NULL,'2023-02-28 22:58:22','2023-10-15 03:53:51',NULL,'','0',18,18),
	 (392,'Blank Flowers','2023-03-07-blank-blank-flowers','2023-03-07','2023-03-08','23:00:00','08:00:00','<p>В том саду, где мы с вами встретились, ваш любимый куст хризантем расцвел.<br><br>Плаксивые романсы отпеты. Слабый пол — это гнилые доски. Мимозы вянут, борьба за равноправие не утрачивает жизненность. Хвала английским суфражисткам, петроградским стачечницам, фабричным работницам и всем храбрым женщинам прошлого и настоящего, которые тычут в ахиллесову пяту угнетателям любого ранга — от бытовых деспотов до самодержавных узурпаторов.<br><br>Накануне Международного женского дня в нашем чертоге разразится полет валькирий. Клубные героини Петербурга и Москвы и фанфан-тюльпан DJ Bayk разорвут кольцо нибелунга, чтобы вынуть из убитости в какие-то более процветающие состояния.</p>',700,'',1,1,1,'http://blankclub.ru/','',false,false,NULL,NULL,'2023-02-28 23:07:10','2023-10-24 20:59:29',NULL,'','0',18,39);
