	 (393,'Agma','2023-03-03-tommy-lee-agma','2023-03-03',NULL,NULL,NULL,'<p>Agma — тандем двух талантливых музыкантов, моментально отличившихся на мировой сцене. Парни выпустили релизы на таких топовых лейблах как Lost On You, Go Deeva Records, Oko Recordings, Hey, Location. Их треки регулярно входят в Топ 100 Beatport, занимая лидирующие позиции. Выступления Agma погружают слушателей в глубокую медитацию. Их сеты наполнены этническими мотивами и чарующими мантрами, которые перевернут ваше восприятие музыки.<br><br>Резерв по телефону и WhatsApp: 8 921 9381212<br><br>Вход FC/DC</p>',NULL,'',1,83,1,'','https://vk.com/lee_tommy',false,false,NULL,NULL,'2023-02-28 23:12:50','2023-10-09 16:21:20',NULL,'','0',18,40),
	 (394,'ПИРАТСКАЯ СТАНЦИЯ - ATLANTIS','2023-04-01-sk-iubileinyi-piratskaia-stanciia-atla','2023-04-01',NULL,'22:00:00',NULL,'<p>Много веков пытаются люди разгадать секрет исчезновения Атлантиды — мифического государства-острова, сгинувшего в пучине океана. Лишь тому, кто не побоится совершить погружение, полное чудес и опасностей, откроется тайна, хранимая тёмной водой.<br><br></p>',2400,'',1,125,3,'https://spb.showgogo.ru/events/concerts/piratskaya-stantsiya-atlantis/?utm_source=vk&utm_medium=cpc&utm_campaign=psatlantis2023&utm_content=dnbfollowers&utm_term=universal','https://vk.com/piratestation',false,false,NULL,NULL,'2023-02-28 23:25:23','2023-10-22 13:21:00',NULL,'','0',18,49),
	 (395,'ИНТЕРВАЛ : Первый Карнавал','2023-03-03-mod-interval-pervyi-karnaval','2023-03-03',NULL,'23:00:00',NULL,'<p>Когда все звезды сойдутся и магию чисел невозможно будет игнорировать, тогда и появится во тьме Петербуржского андеграунда первый интерактивно-перфомативный рейв, где каждый станет участником происходящего.<br><br>Каждый час пространство вокруг будет меняться забирая с собой в танец.<br>Ночь сказочный и необычных событий, укутанная звучанием любимого жанра Drum &amp; Bass!<br><br>Билеты только на входе. 300 р до 0:30 после 400.</p>',300,'400.0',1,113,1,'','',false,false,NULL,NULL,'2023-02-28 23:33:57','2023-10-25 05:21:09',NULL,'','0',18,55),
	 (396,'CRIMEWAVE SPB V','2023-04-08-crimewave-spb-v','2023-04-08','2023-04-09','23:30:00','07:00:00','<p>CRIMEWAVE SPB V пройдёт в Санкт-Петербурге 8 апреля 2023.</p><p>Место проведения будет объявлено позже.</p><p>FC: строго 18+<br>DC: acid neon / monochrome</p>',700,'',1,NULL,1,'https://vk.cc/clARnU','',false,false,NULL,NULL,'2023-02-28 23:43:32','2023-09-23 14:46:12',NULL,'','0',18,36),
	 (546,'Masters At Work','2023-03-17-gestalt-masters-at-work','2023-03-17',NULL,'21:00:00',NULL,'',0,'',2,126,1,'','',false,false,NULL,NULL,'2023-03-17 16:28:57','2023-08-02 05:57:08',NULL,'','0',18,3),
	 (400,'4 марта | VNVNC ','2023-03-04-vnvnc-concert-hall-4-marta-vnvnc','2023-03-04','2023-03-05','23:00:00','06:00:00','<p>Думая, что же здесь написать, мы вспоминаем вас и ищем вдохновение в моментах, которые вы дарите нам.&nbsp;<br>Почему бы просто не сказать спасибо?<br>Спасибо! Вы невероятные<br>Ждём вас каждые выходные на тусовки<br>Бронь столов: 8(921)410-44-40</p>',500,'',1,50,1,'','',false,false,NULL,NULL,'2023-03-01 01:13:09','2023-09-18 17:20:29',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,15),
	 (401,'3 марта | VNVNC ','2023-03-03-vnvnc-concert-hall-3-marta-vnvnc','2023-03-03','2023-03-04','23:00:00','06:00:00','<p>Заряд энергии остался ещё с прошлого уикенда<br>Мы заряжаемся каждые выходные, и это значит - мы вечные!<br>Always and forever<br><br>Бронь столов: 8(921)410-44-40</p>',500,'',1,50,1,'','',false,false,NULL,NULL,'2023-03-01 01:21:23','2023-10-14 20:13:51',63,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,18),
	 (402,'Bassmatic Box','2023-03-04-community-moscow-bassmatic-box','2023-03-04',NULL,'00:00:00',NULL,'<p>Обряд смены времён года издавна был важнейшим в жизни нашей страны. Следуя традиции, Bassmatic Records анонсирует первую весеннюю вечеринку BassmaticBOX в одном из самых атмосферных мест Москвы - клубе-библиотеке Community!<br>4 марта резиденты Bassmatic Records заполнят это пространство звуками пробуждающей музыки, окутывающей всех нас волнами объединяющей энергии во имя природного цветения и наступления тепла!<br><br>На этой вечеринке мы приветствуем в ваших нарядах яркие краски с природными мотивами, чтобы обряд смены времени года прошёл правильно!<br><br>Ждём всех наших любимых гостей и новых друзей на первую весеннюю вечеринку!<br><br>Столы 8(903)731-63-19 Катя<br>8(926)493-03-30 Никита</p>',1890,'2500.0',2,58,1,'https://bassmaticrecords.com/?utm_source=vk2','https://bassmaticrecords.com/',false,false,NULL,NULL,'2023-03-01 01:35:31','2023-10-22 21:19:36',NULL,'','0',18,35),
	 (403,' Friendly Birthday Party','2023-03-04-gestalt-friendly-birthday-party','2023-03-04',NULL,'21:00:00',NULL,'<p>Яркая годовщина двух музыкальных комьюнити с богатым составом Djs состоится в колоритном клубе Gestalt в центре столицы. Дружественная атмосфера, отборные танцевальные фреш-сеты с нотками живого полетного вокала, а также энергетика танцпола намерены зарядить позитивом каждого, кто готов разделить этот вайб.</p>',800,'',2,126,1,'https://afisha.timepad.ru/event/2328793','',false,false,NULL,NULL,'2023-03-01 01:49:27','2023-10-09 21:55:03',NULL,'','0',18,15),
	 (404,'Urban Jungle','2023-03-04-blanc-urban-jungle','2023-03-04',NULL,'22:00:00',NULL,'<p>Urban Jungle предлагает вам из серого города погрузиться в яркие краски джунглей под музыку любимых диджеев уже в эту субботу.</p><p>Помимо основного зала с музыкой, у вас будет возможность посетить выставку картин в стиле современного искусства и чайную церемонию в одном из залов площадки.</p>',1000,'',2,36,1,'https://blanc.timepad.ru/event/2338921/38921','',false,false,NULL,NULL,'2023-03-01 01:57:59','2023-10-22 11:38:06',NULL,'','0',18,28);
