	 (405,'VIP MIX | DJ Romeo','2023-03-07-buddha-bar-vip-mix-dj-romeo','2023-03-07',NULL,'21:00:00',NULL,'<p>7 марта мы вновь соберёмся вместе.<br>Один голос, одно сердце, любовь и единство!<br><strong>World hold on<br></strong><br></p>',2300,'',1,38,1,'https://vip-mix.ru/?utm_source=yandex&utm_medium=cpc&utm_campaign=83188301&utm_content=13484711518&utm_term=---autotargeting&yclid=905006555244061844','https://vip-mix.ru/',false,false,NULL,NULL,'2023-03-01 02:08:03','2023-10-02 06:40:18',NULL,'','0',18,66),
	 (406,'TRIP Pre-Party ','2023-03-23-gazgolder-trip-pre-party','2023-03-24','2023-03-25','23:00:00','10:00:00','<p>24 марта вместе с друзьями из лейбла Highway мы устраиваем официальное pre party фестиваля TRIP 2023 в клубе Gazgolder.</p><p>По этому случаю собрали эпический лайнап и пригласили иностранного артиста, со своим live-шоу в клубе выступит турецкий музыкант и саунд-продюсер Turker.</p>',1500,'',2,35,3,'https://secret420.timepad.ru/event/2277376/','',false,false,NULL,NULL,'2023-03-01 02:12:03','2023-10-25 15:00:34',NULL,'','0',18,69),
	 (414,'Hard Thusday','2023-03-02-zoccolo-20-hard-thusday','2023-03-02',NULL,'19:00:00',NULL,'<p>&nbsp;Весеннее обострение? Фляга свистит от смены погоды? Цветочки/бабочки в животе и набухли БОЧКИ?!<br>Есть проверенное средство - <a href="https://vk.com/feed?section=search&amp;q=%23HARDCORE">#HARDCORE</a>.<br><br></p>',0,'',1,72,1,'','https://vk.com/hardthursday',false,false,NULL,NULL,'2023-03-01 03:14:51','2023-10-20 03:50:05',NULL,'','0',18,22),
	 (415,'FLIP FLAP ','2023-03-04-union-flip-flap','2023-03-04',NULL,'22:00:00',NULL,'<p>Не прошло и месяца как мы вновь собираемся вместе в привычном месте. С нас современная электроника, и всевозможные танцевальные эдиты на современные треки, в том числе и русские, с вас танцы и улыбки.</p>',0,'',1,8,1,'','',false,false,NULL,NULL,'2023-03-01 03:20:32','2023-09-24 04:13:27',NULL,'','0',18,40),
	 (427,'DFF','2023-03-03-deep-fried-friends-dff','2023-03-03','2023-03-04','23:50:00','05:00:00','<p>Фирменная пятничная тусовка в богемном ресторане DFF с хип-хопом и танцевальной музыкой разных жанров. За пульт встанут звезда отечественной электронной сцены Кедр Ливанский, рэпер новой школы VACIO, амбассадоры стрит-звучания с сетами на стыке рэпа и UK-электроники ZULUWARRIOR и один из основателей заведения Lil Den.</p><p><strong>Время:</strong> с 23:50 до 05:00.<br><strong>Стоимость: </strong>вход до 01:00 — свободный, после 01:00 — 500 ₽.</p>',0,'500.0',2,76,1,'','https://t.me/dffradio/2763',false,false,NULL,NULL,'2023-03-02 19:45:59','2023-10-25 14:52:03',NULL,'','0',18,45),
	 (797,'In My House','2023-04-28-mixed-in-my-house','2023-04-28',NULL,'22:00:00',NULL,'<p>In My House продолжает серию вечеринок при участии приглашенных гостей и резидентов проекта.&nbsp;<br>Вход свободный до 23:00</p>',0,'500.0',1,59,1,'','',false,false,NULL,NULL,'2023-04-27 14:11:38','2023-10-20 10:08:47',NULL,'','0',18,57),
	 (407,'BLACK & WHITE PARTY','2023-03-07-novyi-arbat-21-black-white-party','2023-03-07','2023-03-08','23:00:00','05:00:00','<p>Долгожданное и всеми любимое мероприятие, которое мы проводим уже 3 год в преддверии международного женского дня. Самая красивая, самая элегантная и любимая вечеринка UNILIME</p><p>Новый Арбат, 21</p><p>На мероприятии тебя ждут самые яркие турниры по аэрохоккею со своими друзьями, расклады на разные личные темы на картах таро, игра в покер среди самых опытных игроков, комната для быстрых знакомств и безлимитная сладкая вата! Качественный алкоголь на баре и выгодные акции приятно порадуют тебя! Приглашённые DJ сыграют свои топовые сеты, а МС не дадут вам заскучать<br><br>Полюбившаяся всем чёрно-белая тематика представляет собой шикарные образы, завораживающую музыку и ту самую атмосферу, в которую хочется окунуться перед 8 марта</p>',600,'',2,127,1,'https://unilime.timepad.ru/event/2337469/','',false,false,NULL,NULL,'2023-03-01 02:21:29','2023-10-22 22:20:34',NULL,'','0',18,48),
	 (408,'Imminent Festival','2023-03-24-urban-imminent-festival','2023-03-24',NULL,'22:00:00',NULL,'<p>Возвращение легендарного фестиваля wave-музыки! На одну ночь в стенах клуба соберутся сильнейшие артисты в жанре!</p>',1200,'',2,128,1,'https://gorodzovet.ru/moskva/imminent-festival-event9512431','',false,false,NULL,NULL,'2023-03-01 02:30:59','2023-10-23 12:32:31',NULL,'','0',18,40),
	 (409,'Чувство Ритма: Jungle Fever w/ Embargo','2023-03-03-community-moscow-cuvstvo-ritma-jungle','2023-03-03',NULL,'00:00:00',NULL,'<p>Чувство Ритма» возвращается к своей популярной серии африканских мероприятий «Лихорадка Джунглей», на этот раз, встречая в стенах клуба Community, (который на одну ночь превратится в музыкальные джунгли) команду легендарного ростовского проекта Emargо.</p><p>За годы существования на вечеринках Jungle Fever свои специальные сеты отыграли многие зарубежные и российские артисты&nbsp;<br><br></p>',1500,'',2,58,1,'https://chuvstvo-ritma.timepad.ru/event/2329751/','',false,false,NULL,NULL,'2023-03-01 02:37:41','2023-10-03 03:09:43',NULL,'','0',18,15),
	 (410,'Exhaust 6: Feral Instincts','2023-03-03-gorod-exhaust-6-feral-instincts','2023-03-03',NULL,'23:50:00',NULL,'<p>Для ценителей истинного HARD звучания мы подготовили специальных гостей!<br>При себе иметь документы удостоверяющие личность. <br>Запрещено приносить все, что запрещено законодательством РФ, а также колющие и режущие предметы, средства самообороны, еду и напитки.&nbsp;<br>Лицам в сильном опьянении вход воспрещен.&nbsp;<br>Работает фейс контроль. Адекватность приветствуются</p>',500,'',2,63,1,'https://exhaust.timepad.ru/event/2326296/','',false,false,NULL,NULL,'2023-03-01 02:44:53','2023-09-29 01:05:27',NULL,'','0',18,7);
