	 (411,'Music Couture','2023-03-03-cinist-music-couture','2023-03-03',NULL,'23:00:00',NULL,'<p>Music Couture - это события для музыкальных эстетов, обладающих особых чутьем к звуку. Каждый эпизод открывает двери в восприимчивый мир музыкального откровения - палитры пронизывающих частот, сокровенные тайны устами мелодий и тот самый момент, когда наши невероятные души объединяются в синергичном присутствии, а тела отдаются качающей геометрии грува, всю ночь будем играть отборную музыку, которую вы редко услышите в клубах.<br><br></p>',818,'',1,94,1,'https://afisha.timepad.ru/event/2339232','',false,false,NULL,NULL,'2023-03-01 02:50:41','2023-10-20 06:04:17',NULL,'','0',18,42),
	 (412,'PARNAS MUSIC ','2023-03-07-blanc-parnas-music','2023-03-07',NULL,'22:00:00',NULL,'<p>После долгой зимы Бланк распахнет врата всех своих потайных комнат, где мы будем кружиться под музыку, которую создают самые талантливые представительницы прекрасного пола этого города.<br>Вход:</p><p>20.00 - 21.00 FC / вход бесплатный, с предварительной регистрацией</p><p>21.00 - 06.00 FC / 21+ / вход по билетам</p><p>C картами Highway Family вход свободный.<br>Резерв столов <a href="tel:820977208293200">8 (977) 829-32-00</a></p>',1000,'',2,36,1,'https://afisha.timepad.ru/event/2337249','',false,false,NULL,NULL,'2023-03-01 02:57:45','2023-10-24 16:57:12',NULL,'','0',18,40),
	 (413,'GEO NIGHTS BY GEOMETRIA','2023-03-07-rossis-club-geo-nights-by-geometria','2023-03-07',NULL,'23:00:00',NULL,'<p>Весна вступает в свои права, а это значит, самое время повеселиться от души! 7 марта в 22-00 в Rossis Club стартует Весенний карнавал в Северной Венеции <strong>SPRING GEO NIGHTS</strong> от легендарного портала GEOMETRIA. Такого вы еще не видели! Вас ждут шокирующие перформансы, яркие и незабываемые представления артистов, буйство цветов и красок и сногсшибательные роскошные красотки за диджейским пультом!<br>22:00 – 00:00 Pre-Party</p><p>- OPEN DRINK<br>- Певец <a href="https://vk.com/nikolo_zemlianskii">Nikolo Zemlianskii MUSIC</a><br>- Световое шоу<br>- Певица <a href="https://vk.com/pavenskaa">Таисия Павенская</a><br>- Воздушные акробаты<br>- Модный показ<br>- Розыгрыш призов<br>- Обворожительные девочки GO-GO<br>ВНИМАНИЕ! Обязательный атрибут Весеннего карнавала в Северной Венеции – карнавальные маски. Догадаться, кто есть кто, в этот вечер будет невозможно</p><p>Фотосъемка от фотографов портала GEOMETRIA</p><p>&nbsp;</p><p>Важно: вход только в костюмах.</p><p>Вручение призов за лучший образ!</p><p>Вы можете забронировать стол на <strong>SPRING GEO NIGHTS </strong>по т. +7 (921) 949-62-00</p>',900,'',1,129,1,'https://afisha.timepad.ru/event/2316058','',false,false,NULL,NULL,'2023-03-01 03:04:34','2023-10-14 10:58:44',NULL,'','0',18,32),
	 (416,'Завет','2023-03-03-kontrkult-zavet','2023-03-03',NULL,'23:00:00',NULL,'<p>Рассветы грёз несёт весна<br>И меркнут холода в безделье…<br>Бокал вина украдкой обернулся в зелье<br><br>Что в нём, первом весеннем Завете? — медленные такты dark disco и смена мрака в угоду лоснящихся на свету декораций.<br>Внезапный художественный союз породил серию арт-объектов, переосмысляющих стилистику Контркульта: прозрачные, легкие и металлические материи дополнят привычные интерьеры, создав новое, доселе неизвестное ощущение пространства.<br><br>Традиционный мастхев в барном меню — белое вино. На радость эстетам теперь оно будет литься в стекло.<br><br>Вход<br>23:00 — 00:00 — 400₽ с репостом афиши (сделанным не позднее, чем за 3 часа до мероприятия)<br>00:00 — 06:00 — 600₽&nbsp;<br><br></p>',400,'600.0',1,33,1,'','',false,false,NULL,NULL,'2023-03-01 23:43:45','2023-10-24 00:26:39',NULL,'','0',18,52),
