	 (422,'BALI Party','2023-03-19-bali-party','2023-03-19',NULL,'17:00:00',NULL,'<p>Общий сбор Искусства Жизни СПБ!<br>Организовываем безалкогольную тусовку! Только чай, хорошая музыка, танцы, общение и веселье)<br><br>19 марта встречаемся по адресу Спб, ул. Белинского, 9, 4 этаж, зал Avatar<br>&nbsp;Сбор гостей 17:00-17:40, на входе вас встретит фейс арт с неоновыми красками.<br>С 17:40 начинаем танцевать и веселиться: в программе завораживающий ecstatic dance, dj-сет от прекрасной и чарующей Synergia (Microcosmos Records), медитация с поющими чашами и многое другое!<br><br>Стоимость 1500 руб при ранней регистрации, 2000 руб - в день мероприятия&nbsp; Количество мест ограничено!<br><br>Подробности и бронь билетов - <a href="https://vk.com/away.php?to=http%3A%2F%2Ft.me%2Fbali_prty&amp;post=-145488867_766&amp;cc_key=">t.me/bali_prty</a><br>После оплаты обязательно скинуть платежку и ФИО <a href="https://vk.com/sanya_solnce">организаторам</a></p>',1500,'2000.0',1,NULL,1,'https://yoomoney.ru/fundraise/5JyE9AKDEBE.230215','',false,false,NULL,NULL,'2023-03-02 01:49:00','2023-09-19 09:30:50',NULL,'','0',18,33);
