	 (423,'CHLOROPHILIA','2023-03-08-macty-chlorophilia','2023-03-08',NULL,'19:00:00',NULL,'<p>« – Пройдемте в сад? Я покажу вас розам... » 🥀<br><br>Фестиваль CHLOROPHILIA приглашает отправиться в путешествие сквозь зазеркалье. Именно в нём пройдет весенний рок-фестиваль: совместный проект Wild и Bad Seeds (https://vk.com/bad__seeds). Здесь можно встретить таинственных существ, а воздух наполнен психоделическими рифами. В этом месте найдется место для джаза и блюза, а ноты трип-хопа и прогрессив рока словно тенью пройдутся по туманному танцполу.</p>',1800,'',1,9,3,'https://spb.radario.ru/events/1870572/tickets','',false,false,NULL,NULL,'2023-03-02 19:21:37','2023-09-07 19:48:28',NULL,'','0',18,33),
	 (424,'The Dreamers','2023-03-07-union-the-dreamers','2023-03-07',NULL,'22:00:00',NULL,'<p>Наконец, весна! Солнце пробивается сквозь петербургское небо, пробуждая первые весенние цветы.&nbsp;<br><br>Думая исключительно о прекрасном, THE DREAMERS соберут в Union Bar самые красивые подснежники для вас.<br><br>Вход: до 23.00 - фри, после - 400₽</p>',0,'400.0',1,8,1,'','',false,false,NULL,NULL,'2023-03-02 19:26:38','2023-09-18 16:01:52',NULL,'','0',18,22),
	 (425,'Sanchez Thursdays ','2023-03-02-propaganda-sanchez-thursdays','2023-03-02','2023-03-03','23:45:00','06:00:00','<p>&nbsp;Традиционные четверги Санчеза в «Пропаганде». На всю грядущую ночь диджейскую стойку займут сам маэстро Сергей Санчез и виртуозный музыкант Александр Белоусов.&nbsp;</p>',0,'',2,101,1,'','https://t.me/propagandamoscow/690',false,false,NULL,NULL,'2023-03-02 19:31:54','2023-09-28 12:45:07',NULL,'','0',18,19),
	 (426,'Виниловая Комната','2023-03-03-prostranstvo-pole-vinilovaia-komnata','2023-03-03',NULL,'22:00:00',NULL,'<p>&nbsp;Тусовка, где диджеи будут играть исключительно с винила. Их музыкальная страсть — эклектика несовместимого. Свои любимые пластинки готовят искусные селекционеры.</p><p><strong>Стоимость:</strong> до 00:00 — 303 ₽, с 00:00 до 03:00 — 606 ₽, после 03:00 — 404 ₽.&nbsp;</p>',303,'606.0',2,46,1,'','https://t.me/eto_polye/1153',false,false,NULL,NULL,'2023-03-02 19:38:57','2023-10-14 20:57:35',NULL,'','0',18,27),
	 (429,'Warehouse','2023-03-03-propaganda-warehouse','2023-03-03',NULL,NULL,NULL,'<p>&nbsp;Пятница в «Пропаганде» — это традиционная вечеринка Warehouse, на которой её куратор Сергей Тимошов играет с опытными локальными диджеями. В новом эпизоде с бодрыми техно-сетами выступят сам Сергей и его коллеги</p>',0,'',2,101,1,'','https://t.me/propagandamoscow/691',false,false,NULL,NULL,'2023-03-02 19:56:46','2023-10-24 20:56:27',NULL,'','0',18,71),
	 (430,'Пятница в Стрелке','2023-03-03-bar-strelka-piatnica-v-strelke','2023-03-03',NULL,'23:00:00',NULL,'<p>&nbsp;В пятницу в «Стрелке» всю ночь ставить пластинки будет резидент бара Валера Sputnik, вернувшийся с гастролей по Южной Америке. В программе — танцевальная электроника и другая музыка для хорошего настроения.&nbsp;</p>',0,'',2,103,1,'','https://t.me/strelkabarmoscow/362',false,false,NULL,NULL,'2023-03-02 20:01:06','2023-08-25 23:20:41',NULL,'','0',18,2),
	 (431,'SYSTEM ONE HUNDRED AND EIGHT','2023-03-03-bauns-system-one-hundred-and-eight','2023-03-03',NULL,NULL,NULL,'<p>&nbsp;Тусовка лейбла System 108 с костяком резидентов и близких сердцу коллег в лайнапе. Среди артистов известные тусовщикам имена: EBM-чародеи, звезды лейбла, парни из промогруппы Monasterio и многие другие музыканты. Ожидайте на вечеринке смесь из техно, электро и ломаной электроники.&nbsp;</p>',1400,'',2,17,1,'https://system108.com/2023-03-04','',false,false,NULL,NULL,'2023-03-02 20:07:48','2023-10-22 16:45:48',NULL,'','0',18,31),
	 (432,'Funk You!','2023-03-18-macty-funk-you','2023-03-18',NULL,'20:00:00',NULL,'<p>Весна - как повод дислоцироваться из каменных джунглей ближе к морю и широкому горизонту. Funk You! готовят обширную музыкальную программу в Мачтах на территории Севкабель порт.</p>',300,'',1,9,1,'https://afisha.timepad.ru/event/2343289','',false,false,NULL,NULL,'2023-03-02 20:11:56','2023-10-06 20:45:01',NULL,'','0',18,50),
	 (433,' Dark Carnival','2023-03-08-a2-dark-carnival','2023-03-08',NULL,'20:00:00',NULL,'<p>Карнавал «без масок». Только вы, ваша индивидуальность, уникальный стиль, музыка и танцы. Масштабный праздник индивидуальности, безграничной свободы и самовыражения. Место, где можно и нужно заявить о себе: «Я НЕПОВТОРИМЫЙ!» Заявить через то, что снаружи и то, что внутри. Ваш характер, облик, мысли и желания.<br><br>Три танцпола. Более 40 ди-джеев разных стилей&nbsp;<br><br>Снимайте маски, будьте собой и зажигайте вместе с нами.</p>',700,'',1,95,1,'https://afisha.timepad.ru/event/2176767','',false,false,NULL,NULL,'2023-03-02 20:18:55','2023-10-11 06:32:03',NULL,'','0',18,26),
	 (434,'Monasterio 10 years','2023-04-14-mutabor-monasterio-10-years','2023-04-14',NULL,NULL,NULL,'<p>14 апреля техно-викинги Monasterio празднуют 10 лет на четырех танцполах «Мутабора». В далеком 2013-м команда открыла свой прорывной техно-клуб на Трехгорной мануфактуре.<br><br>Поздравлять их приедут четыре иностранных гостя: испанец INQUISITOR с новым лайвом, голландец OGUZ со скоростным сетом, владелец бельгийской промогруппы Hard Harder Hardest VOLUNT BARBATI и рейв-видеограф ALEX VERHALLE.&nbsp;</p>',2200,'',2,2,1,'https://bit.ly/3SBaTbD','https://t.me/monasteriomoscow/3252',false,false,NULL,NULL,'2023-03-02 21:01:40','2023-10-24 20:51:34',NULL,'','0',18,135);
