	 (435,'Blood Knife','2023-03-03-griboedov-blood-knife','2023-03-03',NULL,'23:00:00',NULL,'<p>В пятницу бомбоубежище превратится в филиал Улицы Вязов.&nbsp;<br><br>Парни подготовили дерзкиt сэты, полный грязи и крови.</p>',400,'600.0',1,86,1,'https://blood-knife.ticketscloud.org','',false,false,NULL,NULL,'2023-03-02 21:14:49','2023-10-24 21:19:21',NULL,'','0',18,20),
	 (436,'PANDEMIC SPECIAL','2023-03-25-blank-pandemic-special','2023-03-25',NULL,NULL,NULL,'<p>Мир трещит по швам, не давая расслабиться и передохнуть, а бесконечная серая хмарь над головой заставляет мысли хаотично метаться в поисках редких лучиков света и тепла..&nbsp;<br><br>PANDEMIC сконцентрирует для вас все лучи в одном месте, раскрасит их в фирменные цвета, добавит неоновых оттенков и проекции стилизованной генеративной графики.&nbsp;<br>В атмосфере техничного, но мрачного будущего, кибер-сердце вновь мощно забьется, прогревая кровь бегущих от повседневности!<br><br></p>',800,'',1,1,1,'https://t.me/pndmcravebot','',false,false,NULL,NULL,'2023-03-02 21:39:41','2023-10-10 00:22:37',NULL,'','0',18,67),
	 (437,'GONGGY','2023-03-11-griboedov-gonggy','2023-03-11',NULL,NULL,NULL,'<p>Никаких подводных камней и сложностей, чистая энергия звука и ритмов.&nbsp;</p>',450,'',1,86,1,'https://spb.qtickets.events/64532-gonggy','',false,false,NULL,NULL,'2023-03-02 21:45:21','2023-09-06 21:52:29',NULL,'','0',18,15),
	 (438,'Поджог','2023-03-04-giper-loop-podzog','2023-03-04',NULL,'22:00:00',NULL,'<p>4 марта состоится тёмный бал, организованный командой «Поджог» в стенах клуба Giper Loop<br><br>Приглашённые артисты и резиденты команды «Поджог» озвучат свой рейв-манифест из жанров техно, электро и брейка.<br><br>Dress Code: TOTAL BLACK</p>',500,'700.0',2,131,1,'','',false,false,NULL,NULL,'2023-03-02 21:53:23','2023-10-19 19:27:29',NULL,'','0',18,14),
	 (439,'Plan B','2023-03-03-miraz-plan-b','2023-03-03',NULL,NULL,NULL,'<p>Санкт-Петербург, конец февраля, весной не пахнет от слова совсем. Ок. Будем принимать меры и уходить от общепринятого в прошлом, разбавляя разными цветами - добавим немного дабстепа, накинем по больше ломанного, не отменяя при этом прямую, возможно, послушаем наш любимый рэп в перемешку с синтетическим панк-роком, кто знает.&nbsp;<br>В общем, отдаем свою судьбу в руки его величеству Марту Безумному&nbsp;</p>',NULL,'500.0',1,77,1,'','',false,false,NULL,NULL,'2023-03-02 21:58:17','2023-10-24 21:27:07',NULL,'','0',18,16),
