	 (441,'РЕЗЬБА','2023-03-31-rezba','2023-03-31',NULL,'23:50:00',NULL,'<p>Виток за витком, РЕЗЬБА продолжает набирать обороты, не забывая о своих началах и стартовых позициях.&nbsp;<br>31 марта на двух танцполах состоится уютный и камерный эпизод вечеринки.&nbsp;<br><br>На одном своё кунг-фу будут показывать адепты классического техно звучания, главари и подписанты мощнейших промо команд СП</p>',700,'',1,NULL,1,'https://spb.qtickets.events/64761-rezba-3103','https://t.me/techno_rezba',false,false,NULL,NULL,'2023-03-07 23:01:50','2023-09-29 03:37:23',NULL,'','0',18,55),
	 (442,'INTERVALS FESTIVAL','2023-08-25-intervals-festival','2023-08-25','2023-08-27',NULL,NULL,'<p>Международный фестиваль медиаискусства INTERVALS традиционно проходит на территории Нижнего Новгорода, а география его участников охватывает Россию, США, страны Европы и Азии. Миссия фестиваля — сделать медиаискусство понятным и доступным для всех зрителей без исключения.<br>Поэтому INTERVALS&nbsp; — это масштабная бесплатная медиавыставка на архитектурных локациях в историческом центре города, разноформатная образовательная программа и серия аудиовизуальных перформансов и музыкальных событий.<br><br>Вход на медиавыставку свободный, 0+.<br><br>Организаторы фестиваля: студия dreamlaser, куратор Ксюша Чеховская. При участии «Центра 800» и при поддержке Правительства Нижегородской области</p>',0,'',8,NULL,3,'','https://vk.com/intervalsfest',false,false,NULL,NULL,'2023-03-07 23:10:41','2023-10-22 20:51:35',NULL,'','0',18,314),
