	 (445,'Дыра Славика','2023-03-17-zoccolo-20-dyra-slavika','2023-03-17',NULL,'23:50:00',NULL,'<p>Наш мир прекрасен! Наш мир выздоравливает! Ему срочно нужен экстренный сеанс обнимашек, подобный ромашковой поляне, пробуждающей самые нежные рефлексы и страсти! Обрести душевное равновесие под волны басовой аритмии, выплеснуть на танцпол своё ЛИБИДО, всё это станет возможным 17го марта, на самом светлом празднике самого светлого человека!<br><br>&nbsp;Лучшие друзья кружка ломаных ритмов зальют светом и теплом танцпол клуба Цоколь:<br><br>&nbsp;Приноси с собой подарки, любовь, радость, счастье, улыбки и веселье.<br>&nbsp;Выгляди взрослым, одевайся красиво, будь умничкой и до неприличия приличным.<br>&nbsp;Настоящие друзья всегда заходят бесплатно и выпивают весь бар.<br>&nbsp;Заряжено позитивом от <a href="https://vk.com/techno_core">TechnoCore</a><br><br>GO ДЫРА СЛАВИКА!&nbsp; ВСЕМ ТОРТИК!</p>',0,'',1,72,1,'','https://linktr.ee/technocore',false,false,NULL,NULL,'2023-03-07 23:49:39','2023-10-24 21:15:09',NULL,'','0',18,72),
	 (446,'Absurd','2023-03-11-rndm-absurd','2023-03-11',NULL,'23:00:00',NULL,'<p>Это мероприятие как очередной Абсурд в бессмысленном потоке музыки и окружающего мира, но всё же небольшая альтернатива вашим предыдущим желаниям!<br><br>Альтернативную мелодичную историю для вас создадут настоящие мастера своего дела. Артист чье имя связано с такими легенадами как Arma, Joy и Минимум, диджей которого можно просто слушать Hipushit. Добавит красок в селективной ночи и известный столичный диггер и виниловый коллекционер Timur Omar. Без сомнений хедлайнерами ночи так же станут и Александр Шулико, артист который демонстрирует в мире андеграунда иную сторону музыкальных пристрастий, а так же Wellew чьи сеты всегда отличались выдержанной драматургией<br><br></p>',500,'',2,27,1,'https://rndm.ticketscloud.org/e/63fdd1362c8433489b50be0a?partner_id=5d7a00fb16acf68f69bdbc83','',false,false,NULL,NULL,'2023-03-07 23:54:52','2023-09-23 14:04:36',NULL,'','0',18,58),
