	 (452,'CWH| MARCH| RNDM','2023-03-11-rndm-cwh-march-rndm','2023-03-11','2023-03-11','18:00:00','23:00:00','<p>Вы просили и мы вас услышали! Совершенно новый для нас формат вечерних вечеринок для тех кто устаёт ждать любимых артистов до утра, для тех кто соблюдает режим, а также хочет успеть везде и сразу, это лучший вариант, о котором вы так просили.<br><br>На этот раз играем пятичасовой бэк-ту-бэк сет, где все артисты будут играть как единое целое на протяжении всего времени. Как всегда, качественная бэйс-музыка, новинки и классика жанра, даб сирены и верные друзья.<br>Билеты:<br>- ? RUR | Поддержать нас можно любой суммой на входе при условии подписки на наш<a href="http://t.me/clockworkheads"> telegram</a> канал<br> – 500 RUR | Без внимания к мероприятию</p>',100,'500.0',2,27,1,'https://vk.com/cwh_march_rndm','http://t.me/clockworkheads',false,false,NULL,NULL,'2023-03-08 01:28:23','2023-10-10 06:15:09',NULL,'','0',18,45);
