	 (456,'IBWT 23Th Anniversary','2023-04-11-sound-ibwt-23th-anniversary','2023-04-11',NULL,NULL,NULL,'<p>29 апреля команда IN BEAT WE TRUST приглашает тебя в космическое путешествие в честь 23-летия бренда. За это время мы облетели Землю, побывали в разных уголках нашей вселенной, собрали целую колонию единомышленников и построили свою собственную цивилизацию, основанную на вере в бит, бас и ломаные ритмы. На этот раз наше прилунение произойдет в культовом пространстве Sound / Севкабель порт. Ждем всех бывалых членов экипажа IBWT и тех, кто только решил присоединиться к нашему космическому приключению.</p>',1000,'',1,44,1,'https://www.inbeatwetrust.com','https://www.inbeatwetrust.com',false,false,NULL,NULL,'2023-03-08 02:15:49','2023-10-15 06:46:27',NULL,'','0',18,49),
	 (457,'Live History Night','2023-04-08-macty-live-history-night','2023-04-08','2023-04-09','21:00:00','03:00:00','<p>8 апреля в клубе Мачты, состоится Drum &amp; Bass вечеринка с артистами Петербургского ликвид-фанк лейбла Live History Records.<br>Как звуки оживающей весны, ритмы музыкантов наполнят вас хорошей энергетикой. Питерскими капелями, Пятигорскими горными реками, бурным течением Дона и Московскими ручьями музыка, пронзит ваше сознание, заставляя сердце биться чаще.</p>',400,'',1,9,1,'https://spb.radario.ru/events/1871895','',false,false,NULL,NULL,'2023-03-08 02:24:07','2023-09-28 12:52:40',NULL,'','0',18,28),
