	 (460,'Asian Expirience','2023-03-11-miks-afterparty-asian-expirience','2023-03-11',NULL,'23:55:00',NULL,'<p>Asia Experience заменяет зимнюю рефлексию на тропические грёзы. 11 марта в клубе МИКС Afterparty, отмечаем Международный женский день.<br>Каждому гостю из списка — карта на бар на 1000₽ до 3 ночи в подарок.<br>Вход для девушек бесплатный.<br>Для парней — 1000₽</p>',0,'1000.0',2,133,1,'','',false,false,NULL,NULL,'2023-03-08 02:50:12','2023-08-26 00:09:42',NULL,'','0',18,45),
	 (461,'Samovar: Symbol live band','2023-03-17-bauns-samovar-symbol-live-band','2023-03-17','2023-03-18','23:00:00','06:00:00','<p>Середина марта и пятница — раскачаем Баунс в безупречной компании. В центре ночи шумно: рок, речитатив и электроника, это SYMBOL опять обгоняет бит ваших сердец. Бэнд Никиты Стеблина выступит с треками из нового альбома «Придет Весна», любимыми бодрыми бэнгерами и отчаянным драйвом, за который мы любим этих парней. Вайб поддержат: ростовский дуэт Злая Собака с лайв-перформансом, Subtraxive и нон-стоп брейкбит с эйсидом, грув-гроссмейстер и наш резидент Alfij. Эту ночь вам захочется растянуть до понедельника, что неудивительно, ведь финал на танцполе за Dawn Razor, а это — рейв и восторг.</p>',900,'',2,17,1,'https://samovar1703.ticketscloud.org/','',false,false,NULL,NULL,'2023-03-08 02:55:51','2023-09-19 04:19:32',NULL,'','0',18,44),
	 (462,'Dima Nova Birthday','2023-03-11-yauza-dima-nova-birthday','2023-03-11','2023-03-12','22:00:00','05:00:00','<p>Молния! Повод особой важности! В субботу, 11 марта, мы встретимся на Яузе, чтобы отметить день рождения Димы Новы. Приодеться надо как следует: надо быть на строгом костюме или на вечернем платье. И отвертеться не получится, ведь Дима — человек серьёзный. В программе сеты всех бизнес-партнёров и не толькою.</p>',1000,'',2,32,1,'https://radugadiscoclub.ru/e110323','',false,false,NULL,NULL,'2023-03-08 03:00:52','2023-10-22 12:16:39',NULL,'','0',18,60);
