	 (463,'TRIP ON TOUR. Edu Imbernon','2023-04-21-atmosphere-trip-on-tour-edu-imbernon','2023-04-21','2023-04-22','22:00:00','09:00:00','<p>Шоукейс ‘TRIP on Tour’ популярного электронного фестиваля пройдет в Москве 21 апреля 2023 года. Перенос связан с общим изменением расписания промо-тура, весной 2023 года мероприятия ‘TRIP on Tour’ запланированы в 7 городах России. Место проведения остается неизменным: Atmosphere Moscow. 21 апреля в клубе выступит испанский диджей и саунд-продюсер Edu Imbernon, а также российские диджеи; герои фестиваля 2022 года и будущие участники TRIP 2023.</p>',2000,'',2,134,1,'','https://sagrado.show/',false,false,NULL,NULL,'2023-03-08 03:10:44','2023-10-24 14:16:40',635,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,55),
	 (464,'Alien Project','2023-04-01-1930-moscow-alien-project','2023-04-01','2023-04-02','23:00:00','06:30:00','<p>Этот сюрприз, без преувеличения, самый долгожданный в свете событий последнего года. В Россию возвращаются мировые звезды электронной сцены, и это первое мероприятие в сезоне с участием метра жанра Psy Trance - ALIEN PROJECT (Israel).</p>',1500,'',2,30,1,'https://redkassa.ru/events/bilety_na_concert_alien_project','',false,false,NULL,NULL,'2023-03-08 03:16:48','2023-10-22 18:52:44',NULL,'','0',18,37),
	 (465,'ELECTROSTORM','2023-03-11-kinky-rouge-electrostorm','2023-03-11',NULL,'23:30:00',NULL,'<p>Ты готов окунуться в мир бесконечного рейва, музыки и танца?<br>Присоединяйся к нам в клубе Kinky Rouge на новом и невероятном мероприятии из серии “Электрошторм”!<br><br>Погрузись с головой в омут безбашенного веселья, эйфории и счастья!<br>Тебя ждут фантастические эмоции и энергетика трех танцполов!<br><br>Вход:<br>18+<br>FC/DC<br>800 руб. в день мероприятия.<br>600 руб. <a href="https://vk.com/electrostorm?ad_id=146548805">с репостом </a><br>500 руб. пред <a href="https://vk.com/smashka">продажа</a>&nbsp;</p>',NULL,'800.0',2,62,1,'','',false,false,NULL,NULL,'2023-03-08 17:46:02','2023-09-07 13:52:50',NULL,'','0',18,26),
	 (466,'УБИЙЦЫ CRYSTAL','2023-03-08-mutabor-ubiicy-crystal','2023-03-08',NULL,'19:00:00',NULL,'<p>Сегодня. Концерт Убийцы Crystal. Открытие дверей 19:00</p>',1500,'',2,2,1,'https://ybcmsc.ticketscloud.org/','',false,false,NULL,NULL,'2023-03-08 17:48:56','2023-03-08 17:48:56',NULL,'','0',18,0),
	 (467,'VTUSSE Festival','2023-03-10-blank-vtusse-festival','2023-03-10',NULL,'23:00:00',NULL,'<p>30 артистов представят музыкальное многообразие на 3 сценах, стилистически разбитых на 3 категории: мейн — электроника, гримерка - хип-хоп, золотой - d''n''b.<br><br></p>',1500,'',1,1,1,'http://blankclub.ru/','http://blankclub.ru/',false,false,NULL,NULL,'2023-03-09 15:19:28','2023-10-25 18:13:42',NULL,'','0',18,80),
	 (476,'Burning Series','2023-03-10-16-tonn-burning-series','2023-03-10',NULL,'22:30:00',NULL,'<p>10 марта, в пятницу, на танцполе клуба «16 Тонн» в рамках drum &amp; bass вечеринки Burning Series, проводимой лейблом Occulti, выступают артисты английских и голландских лейблов, и резиденты:</p><p>+ специальный виниловый сет 22:30 сразу после концерта ИЛВТ</p><p>Но и это ещё не всё: впервые на Burning Series выступит Smoky D!</p><p>На этот раз мероприятие стартует в 22:30! <br>Увидимся на танцполе, зовите всех друзей!</p>',600,'',2,29,1,'https://msk.kassir.ru/koncert/16-tonn/burning-series_2023-03-10?admitad_uid=a49dd4d968c96c5d0b8ffc10c09047de&utm_source=admitad&utm_campaign=353356&utm_content=a49dd4d968c96c5d0b8ffc10c09047de&utm_medium=cpa','',false,false,NULL,NULL,'2023-03-09 17:52:55','2023-10-17 18:22:27',NULL,'','0',18,40),
	 (497,'ChillOutPlanet in Mutabor','2023-05-05-mutabor-chillout-planet-in-mutabor','2023-05-05',NULL,NULL,NULL,'<p>Вот уже 25 лет <a href="https://t.me/chilloutplanet">ChillOutPlanet Family</a> участвует в различных событиях по всему миру! За это время мы обрели мощнейший опыт и сформировали оригинальный вкус к музыке, которыми мы хотели бы поделится со всеми вами!</p>',1600,'',2,2,1,'https://chilloutplanet.ru/events/20230505/#buyTicket','https://chilloutplanet.ru/events/20230505/',false,false,NULL,NULL,'2023-03-14 21:34:53','2023-10-24 05:39:02',NULL,'','0',18,122),
	 (468,'Откровение','2023-03-11-blank-otkrovenie','2023-03-11',NULL,'23:00:00',NULL,'<p>У каждого свое откровение, и каждый находит его в разном.<br><br>Подростки слепо рыщут по клумбам и газонам, как трюфельные свиньи утыкаются рылом в грунт, почуяв под землей самцовый феромон. Последователи пророков страждут в уповании его в величавых сооружениях под позолоченными сосцами, устремленными к облакам. В застенках невзрачных зданий, жрущих людей, как печка дрова из мультика про Вовку в Тридевятом царстве, откровения добывают с особым изощрением. Кому-то хватит взгляда на фразу, накарябанную на стене, чтобы прозреть. Другому кричи-не кричи — без толку.<br><br>И в жестком стуке бочки, и в яростном рыке синтезатора можно расслышать шепот вышнего. Чем мы, собственно, и займемся.<br><br></p>',700,'',1,1,1,'http://blankclub.ru/','http://blankclub.ru/',false,false,NULL,NULL,'2023-03-09 15:31:57','2023-10-23 20:54:48',NULL,'','0',18,44),
	 (469,'Another Saturday','2023-03-11-gipsy-another-saturday','2023-03-11',NULL,'23:00:00',NULL,'<p>Окунитесь на одну ночь в мир настоящей клубной жизни столицы.<br><br>Субботние вечеринки в Gipsy — это атмосфера непрекращающегося летнего карнавала среди пальм и зелени. Топовые диджеи, go-go, акробаты и, конечно же, легендарная шаурма.<br><br>Посетить мероприятие могут лица старше 18 лет, наличие оригинала паспорта обязательно для входа (копии и фотокопии паспорта не принимаются!).<br><br>Клуб в праве отказать вам во входе, в случае несоблюдения основных правил посещения: дресс кода, возрастных ограничений, состояния алкогольного или наркотического опьянения. В особых случаях вам может быть отказано в посещении по решению сотрудников внутренней службы безопасности без объяснения причины с полным возвратом денежных средств уплаченных за билет на мероприятие.</p>',2000,'',2,37,1,'https://afisha.yandex.ru/moscow/party/another-saturday-2023?source=rubric&schedule-preset=tomorrow','',false,false,NULL,NULL,'2023-03-09 15:58:53','2023-10-14 20:04:02',NULL,'','0',18,17),
	 (470,'Piece of Cake','2023-03-11-gazgolder-piece-of-cake','2023-03-11',NULL,'23:00:00',NULL,'<p>Piece Of Cake — третья вечеринка из серии событий, посвященных дню рождения лейбла Triori Records. Лейбл появился в конце 2010 года и набрал много последователей. Треки лейбла неоднократно попадали в топ-чарты магазинов и радиостанций. А шоукейсы лейбла проходили в России и в странах Азии и Европы.<br><br>Piece Of Cake — это Два праздника в одном! Александр Белоусов, идейный вдохновитель лейбла, считает днем создания Triori свой день рожденья.<br><br>Alexander Belousov<br>Создатель и идейный вдохновитель лейбла Triori Records и вечеринок SVOI<br>Начал выпускать музыку еще в 00-х<br>Имеет обширную географию релизов на крупных мировых лейблах<br>Ведущий уверенно собственного радио-шоу «День и Ночь»<br>Преподаватель в аудиошколе Umaker</p>',1500,'2000.0',2,35,1,'https://moscow.qtickets.events/64231-svoi','https://vk.com/svoi_showcase',false,false,NULL,NULL,'2023-03-09 16:20:25','2023-09-18 09:00:35',NULL,'','0',18,9);
