	 (477,'VESNA','2023-03-11-16-tonn-vesna','2023-03-11',NULL,'23:00:00',NULL,'<p>Весна – это гормон хорошего настроения и пора любви, и каждый из нас верит, что новое начало обязательно будет ярче и красочнее.</p><p>Наше комьюнити любителей техно музыки Desire Room приглашает вас 11 марта на Красную веранду клуба «16 Тонн» встретить начало весны и получить незабываемые музыкальные впечатления</p>',0,'',2,29,1,'','https://vk.com/16tons_club',false,false,NULL,NULL,'2023-03-09 17:57:17','2023-08-26 00:19:44',NULL,'','0',18,10),
	 (478,'Δека∇ance invites Asylum','2023-03-10-slezy-dekaance-invites-asylum','2023-03-10',NULL,'22:00:00',NULL,'<p>Δека∇ance продолжает серию техно-арт вечеринок и приглашает вместе отметить наступление весны.&nbsp;<br>На этот раз темой аудиовизуальной рефлексии стал «Шабаш».&nbsp;<br>Мы покажем это событие, как способ познать свою внутреннюю природу и возможность отдаться безумному танцу из самых глубин души.&nbsp;<br>DC: gothic (witch, nun, priest) street-wear, tech-wear,&nbsp; monochrome, fetish&nbsp;</p>',500,'600.0',2,102,1,'https://moscow.qtickets.events/63890-dekadance','',false,false,NULL,NULL,'2023-03-09 19:10:16','2023-10-06 06:52:07',NULL,'','0',18,17),
	 (479,'I AM MAN','2023-03-11-community-moscow-i-am-man','2023-03-11',NULL,'22:00:00',NULL,'<p>Энергия весны побуждает нас к обновлению и расцвету чувств!&nbsp;<br><br>В пятницу 10.03 перформанс-ритуал «I am Woman» во главе с верховной жрицей Agata, перед сетом которой в один энергетический поток объединятся contemporary dance, видео арт и музыкальное повествование. Также за танцевальную часть отвечают —&nbsp; Tanit, Mayana и Helena Baeva.&nbsp;<br><br>В субботу 11.03 гости из Минска Para Noir выступят в формате LIVE с рокерским настроением. Смесь жанров танцевальной музыки, игра на живых инструментах, гитарные рифы и яркая перкуссия. В лайн-апе ночи также —&nbsp; Talemates, Ogannes, Ivan Sorkin &amp; Voynov&nbsp;<br><br>Билеты можно купить отдельно на каждый день или на оба дня вместе</p>',1500,'',2,58,1,'','',false,false,NULL,NULL,'2023-03-09 19:21:16','2023-09-18 14:33:34',64021,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWM1YmU0MjEwYzYxYTIwMDBjY2FiMzc4In0.AY-W2j7Fu4MTTbypRyh06EOCt1PoIG4pOgjzzIH51qw','0',18,34),
	 (480,'I AM WOMAN','2023-03-10-community-moscow-i-am-woman','2023-03-10',NULL,'22:00:00',NULL,'<p>10 марта “I AM WOMAN” и 11 марта “I AM MAN”<br><br>Энергия весны побуждает нас к обновлению и расцвету чувств!&nbsp;<br><br>В пятницу 10.03 перформанс-ритуал «I am Woman» во главе с верховной жрицей Agata, перед сетом которой в один энергетический поток объединятся contemporary dance, видео арт и музыкальное повествование. Также за танцевальную часть отвечают —&nbsp; Tanit, Mayana и Helena Baeva.&nbsp;<br><br>В субботу 11.03 гости из Минска Para Noir выступят в формате LIVE с рокерским настроением. Смесь жанров танцевальной музыки, игра на живых инструментах, гитарные рифы и яркая перкуссия. В лайн-апе ночи также —&nbsp; Talemates, Ogannes, Ivan Sorkin &amp; Voynov&nbsp;<br><br>Билеты можно купить отдельно на каждый день или на оба дня вместе</p>',1500,'',2,58,1,'','',false,false,NULL,NULL,'2023-03-09 19:26:35','2023-10-22 18:35:58',64021,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWM1YmU0MjEwYzYxYTIwMDBjY2FiMzc4In0.AY-W2j7Fu4MTTbypRyh06EOCt1PoIG4pOgjzzIH51qw','0',18,33),
	 (481,'GAS','2023-03-10-gas-gas','2023-03-10',NULL,'23:00:00',NULL,'<p>Со вторым танцполом нам точно не тесно быть вместе<br>Дарим любовь, наливаем самые вкусные коктейли и танцуем до самого утра<br>Бесплатный вход всю ночь! <br>Весна уже пришла, а значит, теперь они длиннее<br><br>Резерв столов: 89214104440<br><br>FC/DC 18+</p>',0,'',1,57,1,'','',false,false,NULL,NULL,'2023-03-09 19:47:19','2023-10-12 10:48:55',NULL,'','0',18,33);
