	 (482,'PRTTY PRTY | RАЗЪЁМ','2023-03-11-gas-prtty-prty-razieem','2023-03-11',NULL,'23:00:00',NULL,'<p>Врываемся к вам с подробной информацией о нашей площадке. Предлагаем вам взглянуть на привычные вещи с другого угла.&nbsp;<br>&nbsp;<br>Конюшенная, 2A, Санкт-Петербург.<br><br>Вход:<br>до 00 - 500р. | после 00 - 600р.</p>',500,'600.0',1,57,1,'','https://t.me/gasmusiclub',false,false,NULL,NULL,'2023-03-09 19:52:30','2023-10-22 08:14:51',NULL,'','0',18,22),
	 (483,'Андерграунд «Мотыге»','2023-03-09-motyga-andergraund-motyge','2023-03-09',NULL,'20:00:00',NULL,'<p>Максимально экспериментальный андерграунд этим вечером!</p>',0,'',2,114,1,'','',false,false,NULL,NULL,'2023-03-09 20:00:35','2023-03-09 20:00:35',NULL,'','0',18,0),
	 (484,'День рождения Ксюши Шампанской','2023-03-10-motyga-den-rozdeniia-ksiusi-sampanskoi','2023-03-10',NULL,'21:00:00',NULL,'<p>На сцене по программе&nbsp; ожидается ламповый акустический разогрев у костра и танцевальное продолжение под диджей сеты шуршащего винила.</p>',0,'',2,114,1,'','',false,false,NULL,NULL,'2023-03-09 20:05:32','2023-08-17 04:25:33',NULL,'','0',18,5),
	 (485,'Katechka B-Day Party','2023-03-11-motyga-katechka-b-day-party','2023-03-11',NULL,'20:00:00',NULL,'<p>Приглашаем вас на тусу в честь дня рождения нашей сотрудницы Кати. Музыку будут ставить диджеи в диапазоне от панка и рок-н-ролла до техно и хауса.&nbsp;</p>',0,'',2,114,1,'','',false,false,NULL,NULL,'2023-03-09 20:11:19','2023-09-07 21:28:53',NULL,'','0',18,22),
	 (486,'Industrial Fest','2023-03-12-motyga-industrial-fest','2023-03-12',NULL,'20:00:00',NULL,'<p>Пост-индустриальный ивент с обширным экспериментальным разнообразием.</p>',NULL,'200.0',2,114,1,'','',false,false,NULL,NULL,'2023-03-09 20:17:41','2023-10-17 04:27:24',NULL,'','0',18,43),
	 (487,'Noir Bazaar','2023-03-17-blank-noir-bazaar','2023-03-17',NULL,NULL,NULL,'<p>В планах на ночь — танцы, чтобы разбудить весну и взгляды, что растопят любой лед. В общем, приходите красивыми, все остальное мы берем на себя, тлеющие свечи, дым благовоний, ориентальщина и чертовщина!</p>',400,'',1,1,1,'https://spb.qtickets.events/63457-1703-noir-bazaar-at-blank','',false,false,NULL,NULL,'2023-03-09 20:44:06','2023-10-24 05:20:23',NULL,'','0',18,47),
	 (499,'Top Notch V','2023-03-18-solaris-lab-top-notch-v','2023-03-18',NULL,'22:00:00',NULL,'<p>Добро пожаловать на ламповый вечер!<br>В процессе вечеринки отмечаем День рождения Артура Translippers</p>',400,'',1,106,1,'','',false,false,NULL,NULL,'2023-03-14 21:57:39','2023-10-06 00:51:25',NULL,'','0',18,35),
	 (729,'MDFX','2023-04-22-motiv-mdfx','2023-04-22',NULL,'19:00:00',NULL,'<p>В эту субботу наши друзья из MDFX подготовили для вас свежий стрим.<br>На него сможет попасть любой желающий совершенно свободно. Ребята будут раздавать техно весь вечер.</p>',NULL,'0.0',1,88,1,'','',false,false,NULL,NULL,'2023-04-19 22:23:07','2023-09-29 14:21:17',NULL,'','0',18,42),
	 (498,'Seeds','2023-03-18-blank-seeds','2023-03-18',NULL,NULL,NULL,'<p>В лучших традициях включений на коротких уведомлениях собираем два танцпола на Арсенальной набережной.&nbsp;<br><br>Seeds — это сюжет про новую школу электронной сцены, выросшую из локдаунов под влиянием реп музыки.<br><br>Не нужно ни к чему приурочивать. И смотреть, как на начало какой-то новой серии. Это one night stand, если хотите.&nbsp;<br><br></p>',700,'',1,1,1,'','',false,false,NULL,NULL,'2023-03-14 21:47:47','2023-10-14 05:10:42',640,'eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSJ9.eyJwIjoiNWRiYWU5YTAxODE0MTBhYmQzY2M2ZWU4In0.qMpyNDLwYZmcxCyCRlH9fLMFM8g9NtCCi9SdTdFqGgI&','0',18,33),
	 (488,'Girl''s Squad','2023-03-17-16-tonn-girls-squad','2023-03-17',NULL,'23:55:00',NULL,'<p>Как совместить все это в одной вечеринке?</p><p>Это возможно, если для вас выступают четыре яркие, красивые девушки, любящие Drum and Bass музыку каждой клеткой своего тела!</p><p>Москва, Санкт Петербург и Минск – это те города, музыкальные частички которых девушки привезут с собой и продемонстрируют вам всю палитру Drum and Bass звучания, не оставляя никого равнодушным на танцполе.</p><p>Но этим девушки не ограничиваются! Совсем скоро будет анонсирована их первая Drum and Bass EP с неизменным названием "Moms of Drums"!</p>',400,'',2,29,1,'https://www.afisha.ru/concert/2186549/?utm_source=admitad&utm_medium=cpa&utm_campaign=353356&utm_content=bf0df004f7999ad7b22d10fa80bb4f64','',false,false,NULL,NULL,'2023-03-09 20:50:24','2023-09-30 23:27:38',NULL,'','0',18,39);
