	 (489,'Neuropunk Festival: AI','2023-03-24-izvestiia-hall-neuropunk-festival','2023-03-24',NULL,'21:00:00',NULL,'<p>Neuropunk Festival возвращается в совершенно новом обличии!</p><p>Нейросети стремительно развивают свое присутствие в нашей жизни и новая постановка главного dnb-рейва страны не станет исключением. На сей раз вся структура Нейропанка создается в тесном контакте с искусственным интеллектом: начиная с афиши, мультимедийного шоу и видеоконтента, заканчивая составом артистом, состоящим из b2b-выступлений.</p><p>Добро пожаловать в новый мир – мир AI.</p>',1400,'',2,43,1,'','https://vk.com/neuropunkfest',false,false,NULL,NULL,'2023-03-09 21:01:21','2023-10-24 21:09:12',636,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWRhNzQzODQyN2UzNzQ5YjU5ZGZiNDY3In0.U05wkA44GXyUVc08h27Uy_xRflnvIamZ9gJswzO5EYo&','0',18,41),
	 (490,'Rare Tapes','2023-03-10-griboedov-rare-tapes','2023-03-10',NULL,NULL,NULL,'<p>Музыка является самым удивительным изобретением человека. Это инструмент, с помощью которого управляют чувствами. Она возвращает в прошлое и отрывает от реальности, затрагивая&nbsp; различные области подсознания, чтобы вывести на нужные эмоции.&nbsp;<br><br>Можно получать удовольствие от осознания происходящего с телом или же удивляться и восхищаться тому, что будет дальше.<br>Rare Tapes как раз про второе.&nbsp;<br><br>Наши диджеи собрали ту музыку, которая окажет&nbsp; неизгладимое впечатление, ту музыку, которую вы еще не слышали.</p>',300,'500.0',1,86,1,'','',false,false,NULL,NULL,'2023-03-09 21:21:15','2023-10-24 20:27:36',NULL,'','0',18,33),
	 (491,'Moscow Madness : For The Hardest','2023-03-25-urban-moscow-madness-for-the-hardest','2023-03-25',NULL,'23:00:00',NULL,'<p>В этом году безумию не будет предела! Вторая часть MOSCOW MADNESS | FOR THE HARDEST прогремит этой весной! Отличие FOR THE HARDEST от обычного MOSCOW MADNESS это состав артистов, которые отличаются любовью к особенно экстремальному звучанию hardcore. FOR THE HARDEST – это мощь в чистом виде!</p>',1180,'',2,128,1,'https://msk.kassir.ru/koncert/klub-urban/moscow-madness-for-the-hardest_2023-03-25?admitad_uid=529c910d27debf9b4d6b56a303e96881&utm_source=admitad&utm_campaign=353356&utm_content=529c910d27debf9b4d6b56a303e96881&utm_medium=cpa','https://vk.com/moscowmadness2023fth',false,false,NULL,NULL,'2023-03-09 21:42:13','2023-10-17 07:49:48',NULL,'','0',18,27),
	 (493,'Underground Resistance','2023-03-10-kontrkult-underground-resistance','2023-03-10','2023-03-11','23:00:00','07:00:00','<p>Целая ночь модулярных лайвов и винила — сегодня🍸<br>Для тех, кто не в теме: модулярные синтезаторы имеют почти бесконечную вариативность извлекаемых звуков и абсолютную непредсказуемость финала, а выглядят как громадные коробочки с десятками цветных проводов. Аналоговый лайвовый саунд — синоним неповторимости. Именно поэтому для нас, как музыкального комьюнити, это мероприятие имеет особую ценность.</p>',300,'600.0',1,33,1,'','',false,false,NULL,NULL,'2023-03-10 15:38:22','2023-09-28 16:42:11',NULL,'','0',18,9),
	 (494,'Techno x Kontrkult','2023-03-11-kontrkult-techno-x-kontrkult','2023-03-11','2023-03-12','23:00:00','10:00:00','<p>Для описания этого мероприятия мы бы могли добротно навалить клише: бескомпромиссное техно, лязгание цепей, адептыъ тяжёлых индустриальных звучаний, фирменная злая бочка северной столицы и все такое, но у нас уже глаза слезятся от таких текстов, да описывать техно, когда наша публика и так прекрасно все понимает, — лишнее.&nbsp;</p>',300,'600.0',1,33,1,'','',false,false,NULL,NULL,'2023-03-10 15:43:47','2023-10-22 09:13:42',NULL,'','0',18,22),
	 (496,'Sasha Birthday & 23 Years DKLR в Factory 3','2023-04-08-factory-3-sasha-birthday-23-years-dkl','2023-04-08',NULL,'23:30:00',NULL,'<p>Приветствуем! <br>8 апреля Приглашаем вас на Sasha Birthday &amp; 23 Years DKLR в топовый клуб Factory, расположенный на территории культурного пространства Севкабель. <br>По традиции выступят лучшие артисты из Санкт-Петербурга, а так же к нам в гости заедет легендарный DJ Novak из Москвы. <br>Два танцпола, более 20 артистов, лучший звук в городе, торт, свечки а так же — хорошая атмосфера гарантирована.</p>',700,'',1,7,1,'https://vk.com/dklr23?w=app5732604_-219122579','',false,false,NULL,NULL,'2023-03-14 21:23:27','2023-10-17 03:48:20',NULL,'','0',18,24),
	 (503,'AFRIKA+','2023-03-18-cult-afrika','2023-03-18',NULL,'23:00:00',NULL,'<p>Всем Африка Бамбата, братья и сЕстры!&nbsp;<br>В ближайшую субботу 18 марта мы снова трясём конечностями под афробит в экзотической компании. Да-да, вы всё правильно поняли: у нас в клубе снова вечеринка AFRIKAPLUS. &nbsp;<br>Давайте же вместе дадим жару, чтобы скорее сошёл снег и наступила долгожданная весна. По-настоящему!&nbsp;<br><br>VIP резерв: +79313711154&nbsp;</p>',500,'',1,92,1,'','https://t.me/afrikaplusdaily',false,false,NULL,NULL,'2023-03-14 22:44:38','2023-10-24 04:22:59',NULL,'','0',18,31),
	 (504,'BUNKER x Griboedov basement','2023-03-17-griboedov-bunker-x-griboedov-basement','2023-03-17',NULL,'23:00:00',NULL,'<p>Два вектора самовыражения, два луча света, сквозь щель тяжелой задвижки, дадут нам веру, что культура не за горами, она здесь.&nbsp;<br><br>Вашему вниманию будут представлены 6 уверенных артистов петербуржской электронной сцены, а также 5 художников, чьи эстетически - проницательные работы будут погружать вас в общую атмосферу этой ночи.&nbsp;<br>Лучший выход — это вход</p>',300,'600.0',1,86,1,'','https://t.me/bunker555040',false,false,NULL,NULL,'2023-03-14 22:51:05','2023-10-07 23:42:36',NULL,'','0',18,56),
	 (505,'Bangerz Massive','2023-03-17-factory-3-bangerz-massive','2023-03-17',NULL,NULL,NULL,'<p>Специально для ценителей ломаных ритмов в Питер приезжают два мощнейших артиста Jump Up сцены - SOLIX (UK) / PRESTIGE (KGD)<br><br>Событие развернется в клубе Factory под эпический лайнап!<br>На Мероприятии будет осуществляться жесткий Dress и Face Control.</p>',1200,'',1,7,1,'https://bit.ly/bangerzmassive','https://vk.com/bangerzmassive',false,false,NULL,NULL,'2023-03-14 23:05:09','2023-10-23 20:28:19',NULL,'','0',18,70),
	 (506,'Nikita Zabelin — All Ni36t Long','2023-04-01-prostranstvo-pole-nikita-zabelin-all','2023-04-01',NULL,NULL,NULL,'<p>Никита Забелин устраивает грандиозный праздник в формате своего классического олнайтера в крайне нестандартной форме. На этот раз действие развернется на двух танцполах «поля», один из которых займут известные артисты и ближайшие друзья Никиты. Если главными правилами жизни Забелина являются поиск и создание новой жизни, то этот олнайтер — прямое воплощение их. Во что это выльется можно узнать 1-ого апреля.<br><br></p>',1000,'',2,46,1,'','',false,false,NULL,NULL,'2023-03-14 23:18:55','2023-10-24 18:39:05',6408,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWZkOTU5YWZmZGNiZDZlZTY0NTJjZjczIn0.GeRgIuxoux5eUegSzCkEWmLeljBwf4hO9W4fGQPV01A','0',18,74);
