	 (507,'Odyssey of Flowers','2023-04-01-tba-odyssey-of-flowers','2023-04-01','2023-04-02','20:00:00','06:00:00','<p>Когда снег тает, и первые лучи солнца пробиваются сквозь серую дымку, мир начинает преображаться…день побеждает ночь, всё звонче слышно птиц и повсюду распускаются цветы ... Мы всегда затаив дыхание ждём это время. 1 апреля Одиссея вновь объединит силы со Спиритон, чтобы подарить всем праздник красок, любви и цветов на самом весеннем традиционном балу года - Odyssey of Flowers<br><br></p>',5550,'',2,24,1,'https://odysseyofflowers.ticketscloud.org/','https://vk.com/odysseyfestival',false,false,NULL,NULL,'2023-03-15 03:28:24','2023-10-25 12:13:27',NULL,'','0',18,54),
