	 (511,'BACK TO THE REALITY','2023-03-18-temple-of-deer-back-to-the-reality','2023-03-18',NULL,'23:00:00',NULL,'<p>Все мы вернулись в реальность. Для каждого она разная. В том числе и для каждого из нас.<br><br>Мы же хотим представить вашему вниманию реальность альтернативную, где все светло, стоят красивые здания и люди дружат друг с другом.<br><br>Экскурсию в эту реальность мы и хотим представить вашему вниманию, 18 марта, в самом необычном пространстве СПБ: Temple of Deer.</p>',1000,'',1,22,1,'https://spb.qtickets.events/65351-back-to-the-reality','',false,false,NULL,NULL,'2023-03-15 04:00:23','2023-10-19 08:41:56',NULL,'','0',18,33),
	 (512,'DARK INSIDE PRODUCTION 002','2023-03-18-zoccolo-20-dark-inside-production-002','2023-03-18',NULL,'23:55:00',NULL,'<p>18 марта в клубе Zoccolo состоится праздничное мероприятие по случаю Дня рождения основательницы проекта Dark Inside Production - Екатерины ZIGRIL.</p>',400,'',1,72,1,'https://spb.qtickets.events/64329-dark-inside-production-002','https://vk.com/darkinside002',false,false,NULL,NULL,'2023-03-15 04:07:20','2023-10-10 21:01:01',NULL,'','0',18,24),
	 (538,'Радуга x Шува','2023-03-18-blanc-raduga-x-suva','2023-03-18',NULL,NULL,NULL,'<p>«Шува Шува» — это тусовки от дуэта Lovanda. В коллаборации с диско-клубом «Радуга» ребята вновь собирают друзей, чтобы наполнить бар Blanc музыкой</p>',800,'',2,36,1,'','',false,false,NULL,NULL,'2023-03-15 21:46:58','2023-10-20 03:11:09',NULL,'','0',18,48),
	 (1164,'Friday w//','2023-06-30-mixed-friday-w','2023-06-30',NULL,'22:00:00',NULL,'<p>Заключительная пятница июня пройдёт в Mixed с опытными диджеями петербургской сцены.&nbsp;</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,NULL,'2023-06-29 15:50:04','2023-10-25 15:35:56',NULL,'','0',18,67),
	 (513,'IN[BASS] x Enter The Void','2023-03-24-kontrkult-inbass-x-enter-the-void','2023-03-24',NULL,'23:00:00',NULL,'<p>24 марта музыкальное сообщество IN[BASS] представит искушенному слушателю шоу-кейс лейбла Enter the Void, курируемого одноименной московской бас-группировкой.<br><br>В качестве хэдлайнера выступит Hoji — артист берлинского лейбла Samurai Music и американского лейбла Weaponry.<br>Enter the Void представят столичные селекторы Shiza и Bishop.<br>Мероприятие пройдёт при поддержке резидентов сообщества и друзей.<br><br>FC/DC</p>',300,'',1,33,1,'https://spb.qtickets.events/65284-inbass-x-enter-the-void','',false,false,NULL,NULL,'2023-03-15 04:15:53','2023-09-18 06:14:49',NULL,'','0',18,19),
	 (514,'ВЕСНА | ETU','2023-03-25-mod-vesna-etu','2023-03-25',NULL,'23:50:00',NULL,'<p>Самое ожидаемое танцевальное событие этой весны.<br><br>#ВеснаETU — это незабываемый отрыв твоего студенчества, самые сочные треки, новые знакомства и безостановочное движение до самого утра. Фантастическое шоу и яркие личности, незабываемые эмоции и новые знакомства. Эту ночь вы будете вспоминать ещё многие года.<br><br>В программе вечера: розыгрыш призов, живое исполнение самых топовых треков, ну и как же без зажигательных ди-джеев и яркого ведущего.<br><br>Начни наполнять свое студенчество яркими моментами сегодня, чтобы не жалеть об упущенном завтра!</p>',400,'',1,113,1,'https://spb.qtickets.events/63168-vesna-etu','https://vk.com/etusn',false,false,NULL,NULL,'2023-03-15 04:24:09','2023-10-01 16:08:16',NULL,'','0',18,21);
