	 (515,'128 Club','2023-03-18-action-club-128-club','2023-03-18',NULL,'17:00:00',NULL,'<p>128 club - event лейбл; объединение и личный бренд!<br><br>Это не просто тусовка, это стиль жизни…</p>',550,'',1,47,1,'https://spb.qtickets.events/65856-tusovka-128-club-otkrytie','https://vk.com/goldentysa',false,false,NULL,NULL,'2023-03-15 04:29:06','2023-10-25 10:58:51',NULL,'','0',18,67),
	 (516,'Резьба','2023-03-18-rezba','2023-03-18',NULL,'23:59:00',NULL,'<p>Долгожданная Резьба. Камерный формат мероприятия с ограниченным количеством билетов.<br>Внимание! Покупая билет вы поддерживаете Петербургскую андеграунд сцену. поэтому билеты возврату не подлежат.</p>',800,'',1,NULL,1,'https://spb.qtickets.events/64761-rezba-3103','https://t.me/techno_rezba',false,false,NULL,NULL,'2023-03-15 04:33:26','2023-10-21 11:45:42',NULL,'','0',18,38),
	 (517,'BIRTHDAY DVORKULTURI & DJ M.E.G.','2023-03-31-dk-birthday-dvorkulturi-dj-meg','2023-03-31',NULL,'00:00:00',NULL,'<p>собираемся отмечать уже по традиции 2 дня подряд и в каждый день будет свой «привоз»<br><br>31/03 будем поздравлять<br>любимый клуб вместе с DJ M.E.G<br><br>Музыкант, диджей, продюсер, профессиональный хореограф.<br>M.E.G. проделал долгий путь от би-боя до диджея.<br>Начиная с 2003го выступает в качестве диджея на концертах Тимати и становится официальным диджеем лейбла «Black Star inc.».<br>В 2016 году M.E.G. официально стал артистом лейбла Axtone, владельцем которого является известный шведский продюсер Axwell.<br><br><br>BIRTHDAY PARTY DVORKULTURI ты запомнишь надолго<br>see ya<br><br>PRE-PARTY START: 18:00<br>START: 00:00</p>',1000,'',1,68,1,'https://spb.qtickets.events/65894-birthday-dvorkulturi-dj-meg','',false,false,NULL,NULL,'2023-03-15 04:43:17','2023-10-21 23:23:16',NULL,'','0',18,67),
	 (518,'ПОСЛЕДНИЙ РЕЙВ: DARK CIRCUS','2023-04-01-lastocka-poslednii-reiv-dark-circus','2023-04-01',NULL,'23:55:00',NULL,'<p>«Я убеждён, что ещё остались шатры, которые я не успел посетить, хоть и бывал в цирке бессчётное множество раз. И хотя я видел море чудес и прошёл везде, где только смог, здесь всегда остаются неизведанные уголки и неоткрытые двери». — The Night Circus&nbsp;<br><br>1 апреля мы вместе с вами будем устраивать представление под любимые звуки техно в одном из таких шатров. Кто окажется за его шторами — парящие над танцполом акробаты, разыгрывающие всех вокруг клоуны или заклинатели змей, около которых грациозно танцуют техно-кобры? Это навсегда останется тайной, которая не покинет стены нашего цирка.</p>',300,'',1,10,1,'https://spb.qtickets.events/64053-posledniy-reyv-dark-circus','https://vk.com/last.russian.rave',false,false,NULL,NULL,'2023-03-15 04:49:43','2023-10-09 19:27:56',NULL,'','0',18,19),
	 (519,'BIRTHDAY DVORKULTURI & AARNE','2023-03-31-dk-birthday-dvorkulturi-aarne','2023-03-31','2023-04-02',NULL,NULL,'<p>31/03 &amp; 01/04<br><br>собираемся отмечать уже по традиции 2 дня подряд и в каждый день будет свой «привоз»<br><br>01/04 будем поздравлять<br>любимый клуб вместе с AARNE<br><br>Aarne - музыкальный продюсер родом из Румынии, проживающий в Лондоне. 12 августа 2022 года вышел студийный альбом AA Language, спродюсированный Aarne и получивший огромный успех в России, Европе и странах СНГ.<br>Трек «Тесно» с ANIKV &amp; Bushido Zho стал хитом и играет практически везде!<br>Спродюсировал бит к треку Kizaru - Money Long , а также принимал участие в создание треков Big Baby Tape: «Surname», «7 Дней», “G6” и многим другим.<br><br>Мы устанем перечислять артистов с которыми AARNE работал с 2018 года, но поверьте - вы точно их знаете! Будем до срыва голоса петь «Фиесту», «Kebab Boy» &amp; «Тесно» вместе с продюсером, написавшим биты на все вышеперечисленные треки и не только<br><br>BIRTHDAY PARTY DVORKULTURI ты запомнишь надолго<br>see ya</p>',1500,'',1,68,1,'https://spb.qtickets.events/65478-birthday-dvorkulturi-aarne','',false,false,NULL,NULL,'2023-03-15 04:54:18','2023-10-22 17:09:59',NULL,'','0',18,17),
	 (1365,'90''s DISCO','2023-07-22-plan-b-90s-disco','2023-07-22',NULL,'21:00:00',NULL,'<p>Ну где же ручки? Давай зажжем танцпол PLAN_B в ритме 90х-00х&nbsp;</p><p>Готовь олимпийки, лоссины и варенки&nbsp;</p>',NULL,'0.0',2,228,1,'','https://planb-msk.ru/',false,false,NULL,2,'2023-07-18 00:09:11','2023-10-23 03:34:40',NULL,'','0',18,90),
	 (520,'WARPP 17/03/2023','2023-03-17-warpp-warpp-17032023','2023-03-17',NULL,'23:00:00',NULL,'<p>В пятницу, 17 марта, на главной сцене клуба Warpp в течение нескольких часов будет выступать Mike Spirit. Его сеты объединят в себе различные жанры танцевальной музыки.<br><br>В эту ночь соберутся все желающих погрузиться в мир музыки и танцев. Дополнять атмосферу настоящего музыкального путешествия будут видеоинсталляции.&nbsp;<br><br>Локальную поддержку окажут резиденты клуба K Loveski и Kirill Bagus.</p>',0,'1000.0',1,23,1,'https://warppclub.com','https://t.me/warppclub',false,false,NULL,NULL,'2023-03-15 18:21:43','2023-10-16 16:55:07',NULL,'','0',18,36),
	 (580,'2nd Anniversary 7th Heaven','2023-03-25-gestalt-2nd-anniversary-7th-heaven','2023-03-25',NULL,'22:00:00',NULL,'<p>Празднуем второй день рождения 7th Heaven в Gestalt Club!<br>Фуршет до 00:00, презентация нового проекта, качественная музыка и отличная атмосфера ожидают вас в эту пятницу!<br><br></p>',NULL,'',2,126,1,'','',false,false,NULL,NULL,'2023-03-22 23:14:54','2023-09-28 12:49:48',NULL,'','0',18,49),
	 (521,'Funny Spring BOOM','2023-03-18-macty-funny-spring-boom','2023-03-18',NULL,'20:00:00',NULL,'<p>Весна — повод дислоцироваться из каменных джунглей ближе к морю и широкому горизонту. Funk You! готовят 18 марта программу на территории Севкабель порт.<br><br>9-часовой праздник Funky Spring Boom станет началом для летних приключений промо-группы.<br><br>В этот вечер состоится премьера гаражного фанк-рок проекта от Шиндера и друзей. А из Екатеринбурга едет усиленный глубокий бас, неровный, ломанный бит в исполнении ElectroGorilla. Вечер примечателен еще, тем что за виниловыми вертушками отыграет old school hip-hop дива Санкт-Петербурга — Soul Sista. Ночная программа — это breaks, breakbeat вечеринка. Only Bass Music!</p>',500,'',1,9,1,'https://funk-you.timepad.ru/event/2343289/','https://vk.com/funkyouspring',false,false,NULL,NULL,'2023-03-15 18:30:17','2023-10-10 11:46:46',NULL,'','0',18,17),
	 (522,'Five Blank Years','2023-04-01-blank-five-blank-years','2023-04-01',NULL,NULL,NULL,'<p>Шутка ли, в день дурака Blank справляет пятилетие.<br><br>Еле сдержались, чтобы не ляпнуть тут галочку, которая удачно указала бы знаменательность повода, но вовремя одумались. Какая-то сволочь запятнала римскую нотацию, да и непригоже в нашем-то веке тосковать по империям, до добра не доводит. Каждую оперу венчает финал, мы — лишь терпеливые зрители, запасшиеся настороженностью и вожделеющие ее заключения.<br><br>Дай пять! Отвесь мы подобную фразочку 5 лет назад, в разгар пандемии или в прошлом году, вы бы решили, что мы напрочь хлопнулись умом. Никто не дал бы. Неудачи, проверки, запреты — за всеми печальными строками история склеилась так, что Blank — клубик, который выжил. Значит, это только первая глава долгой саги.<br><br>Юбиляру неймется затащить тебя в праздник. Три танцпола, чтобы чудачить, озорничать и плясать. Приходи без всего, ведь лучший подарочек — это ты.<br><br></p>',1200,'',1,1,1,'http://blankclub.ru/','http://blankclub.ru/',false,false,NULL,NULL,'2023-03-15 19:40:24','2023-10-22 23:08:13',NULL,'','0',18,84);
