	 (539,'Space Union / Lachesis','2023-03-17-dissident-space-union-lachesis','2023-03-17','2023-03-18','21:00:00','04:00:00','<p>В эту пятницу две промо группы современного московского андеграунда — Техподдержка и&nbsp; boodcamp — сойдутся вместе в клубе на Чистопрудном бульваре. В программе ритмы до 150bpm</p>',0,'300.0',2,117,1,'','',false,false,NULL,NULL,'2023-03-15 21:57:34','2023-10-23 21:13:19',NULL,'','0',18,35),
	 (528,'Sengiley Recordings ','2023-03-18-propaganda-sengiley-recordings','2023-03-18',NULL,'00:00:00',NULL,'<p>Шоукейсы проходят с приглашенными гостями, резидентами и близкими по музыкальному духу диджеями.&nbsp;<br>Хаус новой волны и олдскул провереный временем, эйсид и синтезаторы, а так же ломаный стаф от гостя из Самары, артдира места сила всех жигулей "Вечно Молодой" - Сергей PfPf.&nbsp;<br>Вова PACHINO - актёр и диджей из Москвы, сооснователь вечеринки Jardin de Bliss, с которой резидентствует в столичном Powerhouse, пропагандист хрустящего и быстрого танцевального звука.&nbsp;<br>Denis Kazakov -&nbsp; фаундер и движущая сила Sengiey Recordings.</p>',0,'',2,101,1,'','',false,false,NULL,NULL,'2023-03-15 20:54:38','2023-09-18 19:37:25',NULL,'','0',18,49),
	 (529,'Open Decks','2023-03-16-rndm-open-decks','2023-03-16',NULL,'20:00:00',NULL,'<p>Вечеринка, на которой выступят молодые и малоизвестные локальные артисты!<br>Курировать лайнап будет техно-диджей Etrigan<br><br></p>',0,'',2,27,1,'','',false,false,NULL,NULL,'2023-03-15 21:01:30','2023-10-23 08:42:20',NULL,'','0',18,59),
	 (547,'23th ANNIVERSARY EMC','2023-04-15-factory-3-23th-anniversary-emc','2023-04-15','2023-04-16','23:55:00','07:00:00','<p>В субботу, 15 апреля, лэйбл Electro Music Coalition собирается для празднования 23го дня рождения в клубе FACTORY.<br>!!! Все билеты купленные на 4 марта в клуб Stackenschneider будут действительны 15 апреля в клубе Factory !!!</p>',400,'',1,7,1,'https://rupor.biz/widgets/event-tickets/815','https://t.me/emclabel',false,false,NULL,NULL,'2023-03-17 16:58:18','2023-10-20 19:24:16',NULL,'','0',18,40),
	 (530,'RAVENSTVO','2023-03-17-rndm-ravenstvo','2023-03-17',NULL,'23:00:00',NULL,'<p>Некоторые штуки случаются только раз в году. А некоторые не случаются.&nbsp;<br>Философский муд в чатике. Живи моментом, ну или чем ты там предпочитаешь жить.&nbsp;<br>Мы тебя не осуждаем. Осуждает судья и прокурор.&nbsp;<br>А у нас такой ху*ни нет. Напоминаю, МЫ - РАВЕНСТВО. РА-ВЕН-СТВО!<br>Энивей, подобное никогда не повторится, лови момент супер клей.<br>Это не мы делаем рейв, это ты его...Хотя нет, в этот раз его точно делаем мы. Мы с тобой.<br>Мы же с тобой одно целое. Ведь так?<br>А ещё у Кутузова будет ДР (это тот, который АЙЗОВ)&nbsp;<br>Приходи поздравить и свечку подержать.<br><br>Free вход до 00:00, c 00:01 - 1000</p>',0,'1000.0',2,27,1,'','',false,false,NULL,NULL,'2023-03-15 21:08:29','2023-10-25 03:31:41',NULL,'','0',18,33);
