	 (532,'Олл-найтер Hipushit','2023-03-17-prostranstvo-pole-oll-naiter-hipushit','2023-03-17',NULL,'23:00:00',NULL,'<p>Первый в истории поля и первый для самого Хипушита оллнайтер — соло-сет с 23:00 до 5 утра. На этом творческом вечере ожидается буквально все: от медляков и странных песенок Dunkelziffer до речитатива и танцев на высоких скоростях.&nbsp;<br><br>Не хватает только вас на танцполе, но и это легко исправить — вход до 00:00 свободный, после — 800 рублей</p>',0,'800.0',2,46,1,'','',false,false,NULL,NULL,'2023-03-15 21:15:38','2023-10-13 15:32:20',NULL,'','0',18,37),
