	 (542,'Котельная 17 марта','2023-03-17-bar-kotelnaia-kotelnaia-17-marta','2023-03-17',NULL,'22:00:00',NULL,'<p>Частыми рывками аритмия музыкальных темпов толкала воздух из моих легких так, что я почти падал в бессознательность. Отчаянный прыжок туда, откуда возвращаешься абсолютно счастливым.<br><br></p>',0,'',2,137,1,'','https://kotelnayabar.ru/events',false,false,NULL,NULL,'2023-03-17 15:53:26','2023-10-24 21:09:52',NULL,'','0',18,20),
	 (548,'ПРОЖИТОЧНЫЙ МИНИМАЛ','2023-03-25-rndm-prozitocnyi-minimal','2023-03-25',NULL,'22:00:00',NULL,'<p>Продолжение серии вечеринок любимого направления!</p>',1000,'1500.0',2,27,1,'https://moscow.qtickets.events/66933-prozhitochnyy-minimal','',false,false,NULL,NULL,'2023-03-21 15:22:23','2023-09-17 14:31:59',NULL,'','0',18,12),
	 (549,'NEW FACES NIGHT','2023-03-24-rndm-new-faces-night','2023-03-24',NULL,'22:00:00',NULL,'<p>New Faces Night — серия ивентов от клуба, где мы открываем для вас новые имена. В программе второго ивента — ломаная бочка в перемешку с электро, ускорится до скоростей транса и хард техно.<br><br>Состав артистов состоит отнюдь не из новичков: здесь и Юля Подольская дебютировавшая в прошлом году на «Пластилине», Антон Федотов, дебютировал в прошлом году на Монастерио, а перспективная артистка и продюсер Kira Benchi дебютировала в прошлом году на RROOM. Так же вас ждут гости из Северной Осетии в лице Silent Mode из команды MY ATMO, которую она возглавляет вместе с Зауром Гапиенко, наш друг Frisson - артист и светохудожник известный всем по многим световым инсталляциям Temnota Design и Ephire которую вы уже могли оценить на одном из Open Decks<br><br>Специально приглашенная звезда - DJ XNX, выступление которого - это всегда событие и редкость! Хулиган - аноним в маске, который может создать ажиотаж играя грязное гетто и разогнать свой сэт до безумных хардкор скоростей, уничтожая танцпол!</p>',0,'',2,27,1,'','',false,false,NULL,NULL,'2023-03-21 15:29:30','2023-10-11 02:52:41',NULL,'','0',18,15),
	 (550,'Applique','2023-03-25-gazgolder-applique','2023-03-25',NULL,'23:00:00',NULL,'<p>В это невозможно поверить: роботы уже рисуют картины, понимают эмоции, пишут книги и даже придумывают шутки. Но, ни один андроид в мире не способен создать Applique и закатить самую безбашенную вечеринку в эту субботу в Газгольдере.&nbsp;</p>',1500,'',2,35,1,'https://applique.ticketscloud.org/','',false,false,NULL,NULL,'2023-03-21 15:38:54','2023-10-24 15:03:58',NULL,'','0',18,65),
	 (551,'OPEN DECKS','2023-03-23-rndm-open-decks','2023-03-23',NULL,'20:00:00',NULL,'<p>В этот четверг на «открытых деках» выступит таинственный проект FJ SUKITTA, а так же молодые артисты</p>',0,'',2,27,1,'','https://vk.com/rndm.club',false,false,NULL,NULL,'2023-03-21 15:46:24','2023-10-22 12:20:23',NULL,'','0',18,34),
	 (552,'All Blessed','2023-03-24-griboedov-all-blessed','2023-03-24',NULL,'23:00:00',NULL,'<p>В эту пятницу пространство танцпола наполнится приятной лёгкостью и воздушностью. Это напоминает нам о тёплых летних вечерах, которые мы так все ждём!<br><br>Кстати, у нас конкурс!</p>',400,'600.0',1,86,1,'','https://vk.com/griboedovbasement',false,false,NULL,NULL,'2023-03-21 15:59:33','2023-10-16 16:25:47',NULL,'','0',18,46),
