	 (554,'ARMA - 15 years','2023-04-22-mutabor-arma-15-years','2023-04-22',NULL,NULL,NULL,'<p>Ночь в ночь, 15 лет спустя.</p><p>Лайнап TBA</p>',1800,'',2,2,1,'https://mutabor.club/ARMA15YEARS/','',false,false,NULL,NULL,'2023-03-21 18:20:59','2023-10-24 21:05:02',NULL,'','0',18,110),
	 (555,'STVOL - Cream Soda ','2023-03-25-mutabor-cream-soda','2023-03-25',NULL,'09:00:00',NULL,'<p>Дорогие друзья! Нашей командой было принято решение не отменять мероприятие 25.03.23. Более того, мы наращиваем лайн-ап и в ближайшее время представим его вам. Все вырученные средства с билетов будут собраны и переданы семьям погибших.&nbsp;</p>',1600,'',2,2,1,'https://stvol.tv/opening-season-25-03-23/','',false,false,NULL,NULL,'2023-03-22 15:01:55','2023-10-13 11:53:11',NULL,'','0',18,59),
	 (556,'Парад Дураков','2023-04-01-kinky-rouge-parad-durakov','2023-04-01',NULL,'23:30:00',NULL,'<p>Друзья, привет, соскучились?<br>Мы тоже! Поэтому приглашаем Вас 01.04 в&nbsp; клуб&nbsp; Kinky Rouge, на наш фирменный шоукейс. <br>Культурно-развлекательное мероприятие "Парад Дураков'''' на котором выступят эксклюзивные артисты. <br>Готовьте дурацкий оброз прикида (одежды) для тематической обстановки. <br>Мы готовим специальную шоу программу, чтобы развлекать вас все эти 9 часов. <br>Клоуны, Фокусники, и конкретная дурь будет присутствовать на танцполе.<br>FC/DC/21+</p>',1500,'',2,62,1,'','https://vk.com/paraddurakov',false,false,NULL,NULL,'2023-03-22 16:04:45','2023-10-22 20:26:38',NULL,'','0',18,67);
