	 (574,'OUTLAW','2023-04-07-16-tonn-outlaw','2023-04-07',NULL,'23:30:00',NULL,'<p>OUTLAW – серия столичных тусовок от творческого объединения российских хаус-продюсеров, сплотившихся вокруг темного и стильного звучания.</p>',500,'',2,29,1,'https://www.afisha.ru/concert/2186786/?utm_source=admitad&utm_medium=cpa&utm_campaign=353356&utm_content=e952a2485e07f914daa28656fe27fb70','https://16tons.ru',false,false,NULL,NULL,'2023-03-22 19:13:44','2023-10-25 06:28:25',NULL,'','0',18,96),
	 (557,'Space Reality 2 Years','2023-03-24-treff8-club-space-reality-2-years','2023-03-24','2023-03-25','22:00:00','07:00:00','<p>Пророчество великого оракула Очевидикуса из отдаленной Галактики Ромба и Треугольника гласит о том, что 24 марта, в день второй годовщины коммьюнити Space Reality, откроется портал вселенского совершенства, координаты которого указывают на Treff8. Те, кто окажется вблизи от этого портала смогут аудиально перемещаться из одной звёздной системы в другую, станут свидетелями поразительного шоу музыки и света, смогут принять участие в арт-терапии и познакомиться с внеземными формами жизни.<br><br>Dress-code: Sci-fi (люди будущего)<br>Соблюдение тематического DC даёт преимущество при прохождении FC и возможность зайти в клуб без очереди.</p>',1500,'',2,84,1,'https://moscow.qtickets.events/65413-space-reality-2-years?fbclid=IwAR1fubj_9N3lk3Rvn7O6oFEqCdm9QVF8Pe-4Thh4JXv_GM4WT9JN2YZZadg','',false,false,NULL,NULL,'2023-03-22 16:19:51','2023-10-11 19:32:16',NULL,'','0',18,15),
	 (578,'Chernika Sunday','2023-03-26-gestalt-chernika-sunday','2023-03-26','2023-03-27','20:00:00','02:00:00','<p>Каждое воскресенье с 20:00 и до утра Gestalt Club — место встречи тех, для кого выходные и праздничные дни — рабочие (диджеи, управляющие, менеджеры, барменеджеры, хостесс ночных заведений города).<br><br>&nbsp;Скидка 50% на бар, бесплатный кальян, черничное мороженое<br>20:00-23:00!<br>&nbsp;Мастер-классы для обучающихся диджеев<br>за пультом, начинающие диджеи и признанные мастера.<br><br>Хедлайнер вечеринки:<br>23:00-02:00 dj Chernika</p>',0,'',2,126,1,'','',false,false,NULL,NULL,'2023-03-22 22:57:55','2023-10-21 09:11:25',NULL,'','0',18,46),
	 (558,'КругОзор в поле','2023-03-24-prostranstvo-pole-krugozor-v-pole','2023-03-24','2023-03-25','23:00:00','06:00:00','<p>Когда-то давно, за пять лет до открытия поля, существовал «кругозор» — поп-ап проект, который объединял в себе самые разные проявления современной культуры. Сейчас «кругозор» — это фестиваль-открытие нашего нового сезона, который несет в себе ценности того самого проекта. «Кругозор» — это история про расширение границ познания жанров и форматов, когда у любого искусства получается друг с другом соседствовать.<br><br>весна в поле: музыка, искусство, маркет, еда, кругозор<br>выставка галереи Fabula<br>спешл-меню<br>дроп коллекции скейтбордов поле х абсурд<br>поп-ап секонд-стора «окно»</p>',1000,'',2,46,1,'https://krugozorvpole.ticketscloud.org/','',false,false,NULL,NULL,'2023-03-22 16:36:22','2023-09-30 14:02:23',NULL,'','0',18,49),
	 (559,'EDM Night','2023-03-25-live-story-edm-night','2023-03-25','2023-03-26','23:30:00','05:00:00','<p>В программе мероприятия:<br>- Уникальная непередаваемая атмосфера EDM вечеринки в уютном клубе на Таганке,<br>- Кальянная зона,<br>- Наши диджеи будут ставить всю ночь самые жаркие EDM хиты: Avicii, Don Diablo, Tiësto, Hardwell, Sandro Cavazza, Martin Garrix, Kygo, Marshmello, Alan Walker, David Guetta и других.<br><br>Приходи и наслаждайся любимой музыкой!<br><br>18+ (Вход строго по оригиналам документов)</p>',300,'',2,16,1,'https://moscow.qtickets.events/60660-edm-night-2503-live-story','',false,false,NULL,NULL,'2023-03-22 16:44:38','2023-10-24 18:52:27',NULL,'','0',18,29),
	 (560,'Штопка','2023-04-08-mutabor-stopka','2023-04-08',NULL,'22:00:00',NULL,'<p>Мероприятие «Штопка» пройдет на трех танцполах: мейн, медиум, андер. Возглавит лайнап сайд-проект Дельфина — «Механический пёс» с лайвом.<br>Будем штопать танцполы и тусовку – громко, без устали, самими собой, каждый в своем ритме.</p>',1600,'',2,2,1,'https://shtopka.ticketscloud.org/','',false,false,NULL,NULL,'2023-03-22 16:54:36','2023-10-17 01:21:42',NULL,'','0',18,86),
	 (561,'Bassmatic BOX','2023-04-01-gazgolder-bassmatic-box','2023-04-01','2023-04-02','23:00:00','09:00:00','<p>Первого апреля принято не верить никому, но вопреки этому негласному правилу, в этот день Bassmatic Records возвращаются в стены легендарного Gazgolder''e с фирменным show-case Bassmatic BOX. Следуя правилу синтеза звучания лейбла и правильной локации, в эту ночь исторический особняк середины 19-го века содрогнётся от звуковых вибраций и наполнится энергией сотен людей. Авторская световая визуализация, в которую закладывается свой смысл для каждого ивента, не позволит вам оторваться от происходящего, а идеально подобранный музыкальный лайнап позволит вам соединить все в общую феерию звука и света, и почувствовать тот вайб, который присущ нашим вечеринкам!</p>',1490,'',2,35,1,'https://bassmaticrecords.com/','',false,false,NULL,NULL,'2023-03-22 17:00:46','2023-10-11 06:21:41',NULL,'','0',18,17),
	 (562,'Free Rave','2023-04-07-izvestiia-hall-free-rave','2023-04-07','2023-04-08','23:23:00','06:00:00','<p>Традиционный FREE-RAVE в честь юбилея Виктора Строгонова. Просторный танцпол клуба с обязательной бесплатной регистрацией на free-rave.ru, комфортная VIP-зона на балконе 2 этажа с диванами или же доступ в зону DJ BACKSTAGE с фри-дринками и возможностью пообщаться с участниками лайнапа? Решать тебе. Ждем тебя 7 апреля в клубе Известия Hall.</p>',0,'',2,43,1,'','https://free-rave.ru',false,false,NULL,NULL,'2023-03-22 17:10:45','2023-10-11 00:47:52',NULL,'','0',18,86),
	 (563,'Hypnotic 7','2023-04-08-rndm-hypnotic-7','2023-04-08','2023-04-09','23:00:00','07:00:00','<p>Серия, посвящённая берлинскому груву и саунду без перегрузов<br>Световым оформлением займётся уже зарекомендовавшая себя команда TEMNOTA.</p>',600,'',2,27,1,'https://cherta.qtickets.ru/','https://vk.com/hypnotic7rndm',false,false,NULL,NULL,'2023-03-22 17:15:38','2023-10-16 23:23:10',NULL,'','0',18,55),
	 (564,'Suanda Music 10 Years Celebrating','2023-04-28-pravda-suanda-music-10-years-celebratin','2023-04-28','2023-04-29','22:00:00','06:00:00','<p>В этом году лейблу Suanda Music исполняется 10 лет. Разумеется, отмечать будем вместе с нашими любимыми артистами и преданными слушателями. Юбилей будем праздновать специальными вечеринками 28 апреля в Москве и 29 апреля в Санкт-Петербурге. Пока мы работаем над окончательным списком гостей фестиваля, билеты можно приобрести по специальной сниженной цене!</p>',1500,'',2,20,1,'https://www.suandamusic.com/','',false,false,NULL,NULL,'2023-03-22 17:23:58','2023-10-08 01:59:46',NULL,'','0',18,77);
