	 (581,'Ultimate New Reality','2023-05-13-loft-svoi-ultimate-new-reality','2023-05-13',NULL,'20:00:00',NULL,'<p>13 мая команда ULTIMATE собирает всех ценителей транса в Севкабеле на знаковом для нас мероприятии. Друзья, добро пожаловать в NEW REALITY!<br><br>Этой весной грядёт новая эра ULTIMATE, и мы приглашаем вас встретить её вместе!<br><br>Мы готовим для вас множество новостей о наших ближайших планах и изменениях, а также – встречу с любимыми музыкантами и необычный формат: планируется съёмка мероприятия, в которой смогут принять участие все гости! Поэтому мы будем особенно благодарны тем, кто придёт к началу вечера.</p>',500,'',1,140,1,'https://spb.qtickets.events/66134-ultimate-new-reality','https://vk.com/ultimateevent',false,false,NULL,NULL,'2023-03-22 23:37:42','2023-10-23 00:39:05',NULL,'','0',18,85),
	 (582,'Audio Drug','2023-03-25-secret-place-audio-drug','2023-03-25',NULL,'22:00:00',NULL,'<p>Погружение всеми органами чувств. Для тех, кто ищет другое.<br><br>Мы делаем концептуальный и насыщенный движ. Наша задача – дать каждому гостю новый опыт. Вот что тебя ждёт на тусе:<br><br>— Первый дроп одежды от 88,<br>— Парад жанров музыки: от от гипертрэпа до хауса,<br>— Арт-инсталляции от питерских художников,<br>— Диджей-сеты всю ночь,<br>— Лайн-ап от 88-ых,<br>— Фотозоны,<br>— Зона знакомств «Ван Дог»,<br>— Бесплатный бар и бесплатные татуировки прямо на мероприятии.</p>',1500,'',1,141,1,'https://spb.qtickets.events/64156-audio-drug','https://vk.com/88audiodrug',false,false,NULL,NULL,'2023-03-22 23:47:08','2023-10-05 12:28:54',NULL,'','0',18,44),
	 (583,'BIICLA + FRIENDS ','2023-03-24-cheers-biicla-friends','2023-03-24',NULL,'23:00:00',NULL,'<p>24 марта специальный шоу кейс в формате пятничной виселки с друзьями. Ожидается мечтательная электроника и много классных людей.<br><br>Следите! Скоро увидимся!</p>',1500,'',1,142,1,'https://spb.qtickets.events/65876-biicmak-sankt-peterburg-2403','',false,false,NULL,NULL,'2023-03-22 23:51:21','2023-10-18 00:42:52',NULL,'','0',18,13),
	 (584,'СВИДАНИЕ VAMP ANTHEM','2023-03-25-temple-of-deer-svidanie-vamp-anthem','2023-03-25',NULL,'23:00:00',NULL,'<p>25 марта мы отдаем дань нашей молодости на вечеринке СВИДАНИЕ VAMP ANTHEM, погружаемся в эстетику свободы и сексульности. для подготовки включаем в наушниках Playboi Carti, пересматриваем «выживут только любовники», находим в винтажке кожаный корсет и раскрываем темную часть своей личности. отбрасывая границы, выстроенные обществом или же нами самостоятельно, мы хотим предупредить, что вступая на территорию СВИДАНИЯ, вы - больше не вы, вы часть красивой, очень горячей и незабываемой истории в тематике Vamp Anthem.<br><br></p>',800,'',1,22,1,'https://spb.qtickets.events/65834-svidanie-vamp-anthem','',false,false,NULL,NULL,'2023-03-23 00:03:40','2023-10-23 06:23:42',NULL,'','0',18,32);
