	 (589,'Spirit Rave','2023-04-28-spirit-rave','2023-04-28','2023-05-01',NULL,NULL,'<p>В это раз Spirit Rave пройдет в лесах и горах Краснодарского края, на расстоянии 100 км от г. Краснодар и 100 км от г. Туапсе, на частной охраняемой территории. На турбазе имеется река, 2 водоема с рыбой - где можно порыбачить, места для кемпинга, душ, туалеты, а так же шикарные места для прогулок.<br>Для тех кто едет с детками - на фестивале буде детская PsyKids!<br><br>Наслаждаемся музыкой 3 незабываемых ночи<br>2 танцпола<br>20 киловатт звука<br>Чайная, Напитки, Бар<br>Баня<br><br>До 01 апреля орг. взнос 3000р за все время фестиваля, дальше цена будет повышаться.</p>',3000,'',7,NULL,3,'https://www.spiritrave.ru/','https://www.vk.com/spiritrave',false,false,NULL,NULL,'2023-03-23 17:35:16','2023-10-24 21:50:52',NULL,'','0',18,66),
	 (590,'Катэраг POP-UP','2023-04-15-katerag-pop-up','2023-04-15',NULL,'22:00:00',NULL,'<p>Спустя три месяца возвращаемся с большим 12-часовым поп-ап проектом. Событие пройдёт в знакомом помещении на Кожевенной.<br><br>В лайн-апе резиденты, представители локальных музыкальных сообществ Plan B, Love Machine, Tapenight Clan, Fam и Nasledie, а также гость из Еревана, опытный музыкальный продюсер – Dave N.A., треки которого все чаще звучат в сетах диджеев по всему миру.</p>',600,'',1,NULL,1,'https://spb.radario.ru/events/1884074/tickets','',false,false,NULL,NULL,'2023-03-24 12:57:43','2023-10-24 20:56:32',NULL,'','0',18,49),
	 (591,'Asia Niight','2023-03-24-ugol-asia-niight','2023-03-24',NULL,NULL,NULL,'<p>Азия - это стиль.&nbsp;<br>Азия - это самобытность.&nbsp;<br>Азия - это древняя культура.&nbsp;<br><br>Мы приглашаем вас на арт-вечеринку, посвященную Азии от промогруппы vse svoi tech nari в эту пятницу!<br><br>Чай, благовония, декор, вееры - все это для вас в эту ночь.&nbsp;<br>Ну и конечно же, техно. Берите своих.</p>',NULL,'500.0',2,130,1,'http://asianiight.tilda.ws/','',false,false,NULL,NULL,'2023-03-24 13:28:54','2023-09-30 03:33:05',NULL,'','0',18,7),
	 (592,'TEPLO','2023-03-24-slezy-teplo','2023-03-24','2023-03-25','22:00:00','06:00:00','<p>Друзья, приветствуем!<br><br>Вот и наступил День весеннего равноденствия – начало начал, когда солнце и луна встречаются и объединяют свои силы, чтобы пробудить всё живое от долгого зимнего сна. Зима была долгой, и мы все соскучились по настоящему теплу.<br>24 марта решительно встречаем красавицу-весну в стенах родного Бара Слёзы&nbsp; в компании наших резидентов и любимых артистов локальной минимал сцены<br><br>entrance:<br>22:00-00:00 free<br>00:00-06:00 500 rub</p>',NULL,'500.0',2,102,1,'','',false,false,NULL,NULL,'2023-03-24 13:34:38','2023-10-01 18:05:58',NULL,'','0',18,24),
	 (593,'& FRIENDS','2023-03-24-motyga-friends','2023-03-24',NULL,'18:00:00',NULL,'<p>Сегодня вечеринка &amp;FRIENDS с электронной музыкой нулевых. Будем танцевать под оригиналы и ремиксы треков нулевых разных напревлений электроники</p>',0,'',2,114,1,'','https://taplink.cc/moyeti',false,false,NULL,NULL,'2023-03-24 13:39:40','2023-07-24 11:00:28',NULL,'','0',18,9),
	 (594,'Всё Везде и Сразу','2023-03-25-community-moscow-vse-vezde-i-srazu','2023-03-25',NULL,'22:00:00',NULL,'<p>RADI MIRA I LUBVI и COMMUNITY в эту субботу 25.03 представят совместный шоу кейс под оскароносным названием «ВСЁ ВЕЗДЕ И СРАЗУ». В рамках запуска заявлена непредсказуемая смесь электроники, эстрады и диджитал арта. Это будет легендарно!</p>',2500,'',2,58,1,'','',false,false,NULL,NULL,'2023-03-24 13:54:52','2023-10-07 18:24:15',641816,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWJkMzA0NDY1YWEwMWEwMDBjNDU0YzJkIn0.nmbm2WUQoyYoQq5uqnGVaaCfwc448xN7dPm4H04rKaQ','0',18,56),
	 (595,'In My House','2023-03-25-mixed-in-my-house','2023-03-25',NULL,'22:00:00',NULL,'<p>In My House продолжает серию вечеринок с участием приглашенных гостей и резидентов проекта.&nbsp;<br><br>Bilalov (https://on.soundcloud.com/K1HvsMc4NgeWk9tu5) — диджей из Калининграда, организатор вечеринок и владелец одноименного лейбла. Участник московского комьюнити «complete».&nbsp;<br><br></p>',0,'',1,59,1,'','',false,false,NULL,NULL,'2023-03-24 14:03:42','2023-10-12 19:43:21',NULL,'','0',18,22);
