	 (596,'Lodka x Exotic','2023-03-25-kiki-lodka-x-exotic','2023-03-25',NULL,'17:00:00',NULL,'<p>25 марта LODKA x EXOTIC представит симбиоз международной выставки современного искусства «THROUGH THE WALLS» и звучания андеграундной музыкальной сцены, истоки которой зародились на территории промышленного завода.&nbsp;<br><br>Это событие продемонстрирует, что искусство и музыка — это неотъемлемые части одного целого. Таким образом вам покажу как разрушить границы между стилями, жанрами и людьми. Благодаря такой аудиовизуальной составляющей вы будете погружены в исследование всевозможных комбинаций миров.&nbsp;<br><br>Художники:&nbsp;<br>Carlotto Rose / Nikolai Sidorov / Kirra Kusy / Liza Ryzhaia / Cristobal Pereira / Julia Astronskaya / Leyli Alakbarova / Alicia Nieto / If A then B</p>',NULL,'0.0',1,54,1,'','',false,false,NULL,NULL,'2023-03-24 14:11:06','2023-10-16 00:25:24',NULL,'','0',18,41),
	 (597,'De Con Structa','2023-03-25-kontrkult-de-con-structa','2023-03-25',NULL,'23:00:00',NULL,'<p>DECONSTRUCTA — средство глубокого эмоционального раскрытия содержания танца на границе привычных нам мыслеформ. Вовлекая в свои преломления, она здесь для того, чтобы воззвать к заутробному звуку и первобытному импульсу. Деконструирая и разобщая — собирая заново, воедино.<br>Мероприятие пройдет при содействии организации «Доступное действие». В эту ночь, абсолютно бесплатно и анонимно вы можете пройти тестирование на ВИЧ и сифилис, получить равную консультацию по вопросам ВИЧ и ЗППП, а также получить контрацептивы и лубриканты.&nbsp;</p>',600,'',1,33,1,'','',false,false,NULL,NULL,'2023-03-24 14:23:19','2023-09-28 12:39:44',NULL,'','0',18,19),
	 (598,'Попофф в Поле','2023-03-25-prostranstvo-pole-popoff-v-pole','2023-03-25',NULL,'23:00:00',NULL,'<p>Попофф медленно открыл глаза. Он лежал в ледяном дворце у подножья трона. Внутри дворца медленно падал снег. Снежная Королева, окинула молодца своим морозным взглядом и сказала: «Ты проснулся, отлично, как помнишь, мы договорились – разгадаешь мою загадку и соберешь слово из ледяных букв – отпущу, а не разгадаешь – останешься здесь навеки и забудешь свою семью!" И снова застыла на своем троне.</p>',NULL,'1000.0',2,46,1,'','',false,false,NULL,NULL,'2023-03-24 14:29:11','2023-10-24 09:22:50',NULL,'','0',18,48),
	 (599,'OUTLINE FESTIVAL 2023','2023-07-06-outline-festival-2023','2023-07-06','2023-07-09',NULL,NULL,'<p>Фестиваль пройдет с 6 по 9 июля 2023 года в новой постоянной локации ДОЛ Салют в районе реки Дубна, в 90 км к северу от Москвы.<br>Четыре из пяти сцен фестиваля: Main, концертная Sun, Dark Stage и легендарный танцпол Woods — прямое продолжение традиций Outline. Две развернуты под открытым небом, другие — в восстановленных бруталистских зданиях в новой локации на берегу реки Дубна. Одно из строений архитектурного комплекса трансформировано в большое арт-пространство.<br><br></p>',6000,'',2,NULL,3,'https://outlinefestival.org/','https://t.me/outlinefestival/4',false,false,NULL,NULL,'2023-03-24 15:00:00','2023-10-25 10:53:36',NULL,'','0',18,617),
