	 (602,'КОД:МСК - Se:Ver','2023-03-25-treff8-club-kodmsk-sever','2023-03-25','2023-03-26','23:00:00','05:00:00','<p>Москва! Лейбл танцевальной электроники SE:VER приглашает на свою дебютную вечеринку «КОД:МСК»!<br><br>Целую ночь в клубе Treff8 можно будет ощущать единения природы, современных технологий, света, ярких людей и, конечно же, фирменной электронной музыки от артистов лейбла.<br>За световое шоу отвечают художники по свету от команды Oops Team, а команда NO DRAMA проведёт стрим в духе мировых электронных вечеринок для канала SE:VER.</p>',1300,'',2,84,1,'https://6401e42950cb2da37d3d7b09.ticketscloud.org/e/640b1c6157279d80cf5c7181?partner_id=6401e42950cb2da37d3d7b09','',false,false,NULL,NULL,'2023-03-24 16:04:26','2023-10-05 22:12:20',6401,'','0',18,18),
