	 (604,' Headspace Collective x КАРТ БЛАНШ ','2023-03-24-mixed-headspace-collective-x-kart-blan','2023-03-24',NULL,'20:00:00',NULL,'<p>Headspace Collective — музыкальное объединение, сформированное в Стамбуле в 2022. Команда еженедельно выпускает экспериментальную электронную музыку.&nbsp;<br><br>Сегодня на этом ивенте Headspace Collective и КАРТ БЛАНШ объединяются вместе, чтобы играть&nbsp;</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,NULL,'2023-03-24 17:52:35','2023-10-10 13:24:36',NULL,'','0',18,26),
