	 (606,'Alien Project','2023-04-01-1930-moscow-alien-project-1','2023-04-01',NULL,'23:30:00',NULL,'<p>ПРОСТРАНСТВО готовит сюрприз - первый иностранный привоз 2023 года!<br><br>Этот сюрприз - без преувеличения самый долгожданный в свете событий последнего года. В Россию возвращаются мировые звезды электронной сцены, и это первое мероприятие в сезоне с участием мэтра жанра psy trance ALIEN PROJECT (Israel).<br><br><strong>Alien Project </strong>- псевдоним израильского транс-диджея и продюсера Ари Линкера, начавшего свой творческий путь аж в 1994 году в Гоа. За эти годы Ари объездил всю планету покоряя всевозможные мировые фестивали своими невероятными музыкальными произведениями и совместными работами с мэтрами жанра Astrix, GMS, Raja Ram и пр. Он обладает феноменальной способностью чувствовать энергетику танцпола, что позволяет его поклонникам всякий раз переживать глубинный музыкальный трип, пробирающий до мурашек.<br><br>Отличной поддержкой станут те, без кого мероприятия под эгидой ПРОСТРАНСТВА невозможно себе и представить без<strong>&nbsp;артистов команды Space Music.</strong><br><br>Серия мероприятий "SPACE MUSIC / Пространство" в очередной раз станет элеватором для вашего погружения, а помогут в этом пробирающий до костей звук, световое шоу и гости клуба "1930 Moscow".</p>',1500,'',2,30,1,'https://redkassa.ru/events/bilety_na_concert_alien_project#description','',false,false,NULL,NULL,'2023-03-27 18:13:03','2023-10-23 21:32:59',NULL,'','0',18,48),
