	 (608,'Asylum: Бочка и Точка','2023-03-31-rndm-asylum-bocka-i-tocka','2023-03-31',NULL,NULL,NULL,'<p>После короткой передышки мы возвращаемся с вечеринкой “Бочка и Точка”<br><br>На этот раз из Санкт-Петербурга к нам пожалуют, а из горного Дагестана нагрянет гость, чтобы дебютировать на столичной сцене!<br>Поддержку гостям и молодым талантам окажут локальные артисты, уже полюбившиеся всем!<br><br>*Цены указаны при оплате наличными</p>',800,'',2,27,1,'','https://vk.com/wall-145793441_2170',false,false,NULL,NULL,'2023-03-27 20:00:15','2023-10-08 02:34:49',NULL,'','0',18,55),
