	 (621,'Electrobudka','2023-03-31-kontrkult-electrobudka','2023-03-31',NULL,'23:00:00',NULL,'<p>Правила на площадке, как и обычно, простые: безумствовать со всей силы, но помнить о комфорте ближнего. Обратите внимание, мы на самом пороге дня дурака, а значит, дурачиться надо как следует.</p>',600,'',1,33,1,'https://t.me/nasledie_label_bot','',false,false,NULL,NULL,'2023-03-29 17:37:40','2023-10-23 03:06:14',NULL,'','0',18,17),
