	 (629,'WAKE UP!','2023-04-01-community-moscow-wake-up','2023-04-01',NULL,'21:00:00',NULL,'<p>Зима прошла, а за ней наконец-то начались солнечные дни<br>Мир выходит из спячки, открывая глаза и душу новому и прекрасному<br>Рене Декарт как-то сказал: «Весной все иначе — небо голубее, люди добрее, дни длиннее, счастье ярче!»</p><p>TAKEOFF PROJECT и COMMUNITY MOSCOW приглашают на яркое весеннее пробуждение<br>Что будет?<br>&nbsp;⁃ с 21:00 POETRY PERFORMANCE by Daria Sorkina «Психология в стихах». Начнем вечер с правильных установок, которые полезно внедрить каждому «проснувшемуся».<br>&nbsp;- c 22:00 и до 6:00 DJ-перформансы от резидентов промогруппы TAKEOFF PROJECT и приглашенного артиста, а также яркий иммерсив в тематике весеннего настроения.<br>DC | FC<br>Приветствуются воздушные, лёгкие и нежные ткани, цветочный принт, пастельные или яркие оттенки, аксессуары, символизирующие чистоту, счастье, рождение нового, светлого и прекрасного. Включай фантазию на полную</p>',2000,'',2,58,1,'','',false,false,NULL,NULL,'2023-03-31 14:33:46','2023-10-24 21:27:25',641,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWM1YmU0MjEwYzYxYTIwMDBjY2FiMzc4In0.AY-W2j7Fu4MTTbypRyh06EOCt1PoIG4pOgjzzIH51qw','0',18,23),
	 (630,'Kontrkult TECHNO','2023-04-01-kontrkult-kontrkult-techno','2023-04-01','2023-04-02','23:00:00','09:00:00','<p>"Leurs lieux de prédilection sont les campagnes situées à l’ouest de la capitale alsacienne", ajoute-t-il. Une migration qui ne ravit pas certains agriculteurs qui se plaignent de devoir ressemer plusieurs fois leurs graines à cause des corvidés venant picorer leurs champs."&nbsp;<br><br>Вход<br>23:00 — 00:00 — 400₽<br>00:00 — 06:00 — 600₽<br>06:00 — 09:00 — 300₽&nbsp;</p>',300,'600.0',1,33,1,'','',false,false,NULL,NULL,'2023-03-31 14:38:46','2023-10-22 09:07:06',NULL,'','0',18,41),
	 (661,'SPACEX x SD | CLUBSHOW: BLOCKKID + SECRET GUESTS','2023-05-06-dk-kristall-spacex-x-sd-clubshow-blo','2023-05-06',NULL,'17:00:00',NULL,'<p>BLOCCKID- российский рэп-исполнитель и участник творческого объединения Haunted Family.<br><br>Sound of space - Sound of streets<br><br>Бери Кузину и приходи !</p>',299,'',2,28,1,'https://moscow.qtickets.events/68360-spacex-x-sd-clubshow-blockkid-secret-guests-6-maya-14','',false,false,NULL,NULL,'2023-04-05 20:30:11','2023-10-24 05:48:53',NULL,'','0',18,81),
	 (631,'LEGAL’NAYA x SHALOM SHANGHAI','2023-04-08-blank-legalnaya-x-shalom-shanghai','2023-04-08',NULL,'23:00:00',NULL,'<p>Гибридный лайв и презентация новых работ Вани Ткачева, последнее выступление Насти Земс перед отъездом из России, лайв RAW TAKES, гости из Москвы, Казани и новые имена - на главном танцполе<br>В «гримерке» — шоу-кейс уральского бара «Шалом Шанхай» — самого заметного тусовочного места в Екатеринбурге. Возглавляют танцпол Директор Дискотеки, Казино Экзотика и диджеи, приближенные к бару. <br>В рецепте вечеринки — азиатские коктейли, красные фонари и дух китайской опиумной</p>',900,'',1,1,1,'https://xn--legalnaya--shalomshanghai-fru.ticketscloud.org/','',false,false,NULL,NULL,'2023-04-03 15:13:20','2023-10-17 00:25:44',NULL,'','0',18,60),
	 (632,'MOONTUNE','2023-04-08-macty-moontune','2023-04-07',NULL,'20:00:00',NULL,'<p>«Женщины отчаянно жаждут новой жизни. Они живут в ожидании следующего месяца, конца семестра, они не могут дождаться, когда наконец закончится зима и они снова почувствуют себя живыми. Они ждут некоей мистически предопределенной даты где-то в будущем, когда они смогут совершить нечто удивительное…»<br><br>Эта дата уже выбрана:<br>7 апреля в клубе Мачты пройдет вечеринка MOONTUNE.<br>А удивительным станет то, сколько творческих нас есть вокруг. Будем знакомиться друг с другом, создавать атмосферу тепла и безопасности, в которой найдется место для мистерии, что лежит в основе женского духа.<br><br>Раскрыть себя и открыться другим поможет музыкальная атмосфера: соул и софт-гранж с щепоткой психоделии, как любят в Bad Seeds.</p>',500,'700.0',1,9,1,'https://spb.radario.ru/events/1886660/tickets','https://vk.com/bad__seeds?w=wall-215225815_145',false,false,NULL,NULL,'2023-04-03 15:27:45','2023-10-24 21:27:56',NULL,'','0',18,35);
