	 (645,'Provocateur','2023-04-15-buddha-bar-provocateur','2023-04-15',NULL,'22:00:00',NULL,'<p>Провоцируем вас на танцы со Вселенной.</p><p>15 апреля – 25 кадр тарантиновского кино, воплощенный в реальность ! Ночь&nbsp; в&nbsp; Buddha Bar&nbsp; с приглашенной легендой техно -&nbsp; DR.SPY.DER&nbsp; - мастодонтом отечественного андеграунда, традиции которого мы глубоко чтим и&nbsp; уважаем! &nbsp; За пультом BORIS THE SPYDER, локация и дресс-код -&nbsp; в тон аллюзиям и веяниям кадров лучших сцен Квентина Тарантино.</p><p>Увидимся&nbsp; Buddha Bar 15 апреля!</p>',1000,'',1,38,1,'https://afisha.timepad.ru/event/2359642','',false,false,NULL,NULL,'2023-04-04 15:24:25','2023-10-22 22:18:12',NULL,'','0',18,67),
	 (633,'INFINITY NOW: Chinatown','2023-04-08-griboedov-infinity-now-chinatown','2023-04-08',NULL,'22:00:00',NULL,'<p>В эту субботу вы в центре кипящего жизнью Бангкока, разводите мыслями о том чем же занимаются все эти люди вокруг, проходящие мимо и стоящие там около красных лавок с электронными инструментами и диджейскими пультами, а ваш путеводитель, этот милый старичок, который вызвался вам все здесь показать, рассказывает вам о том, что 8 АПРЕЛЯ команда художников INFINITY NOW создает в квартале CHINATOWN в клубе Griboedov выставку новейшего прогрессивного искусства, всего на одну ночь, в которой будут участвовать такие художники как :<br><br>Hommegiuseppe<br><a href="https://vk.com/away.php?to=http%3A%2F%2FGnidkovskaya.anna.art&amp;post=-154594155_17129&amp;cc_key=">Gnidkovskaya.anna.art</a><br>Gosnasty<br>Zlosi<br>Zverok.zverok<br><a href="https://vk.com/away.php?to=http%3A%2F%2FColored.cloud&amp;post=-154594155_17129&amp;cc_key=">Colored.cloud</a><br>Wspwaw<br>Kassue.tats<br>Ark_3500<br>37kir<br>Zhivuivizhu<br>See_oneguy<br>Maryasushkevich<br>Halal_hashish<br><br>Вход:<br>400 - с репостом<br>600 - без внимания к мероприятию</p>',400,'600.0',1,86,1,'','https://vk.com/djkeks74?w=wall-154594155_17129',false,false,NULL,NULL,'2023-04-03 15:36:32','2023-09-18 14:16:19',NULL,'','0',18,29),
	 (634,'Highway Night','2023-04-07-gazgolder-highway-night','2023-04-07',NULL,'23:00:00',NULL,'<p>7 апреля на двух танцполах Газгольдера тебя ждет большой состав любимых ди-джеев и музыкантов Highway Records. <br>Оригинальные бэк-ту-бэки, премьеры новых треков и гарантированные танцы all night long!<br><br>С картами Highway Family вход свободный.<br><br></p>',1500,'',2,35,1,'https://secret420.timepad.ru/event/2356544/','https://www.highwayevent.ru',false,false,NULL,NULL,'2023-04-04 11:48:41','2023-09-29 21:32:43',NULL,'','0',18,51),
	 (635,'RROOM 8 YEARS','2023-04-08-gazgolder-rroom-8-years','2023-04-08',NULL,'23:00:00',NULL,'<p>Live-проект Symbol появился в 2015 году, изначально – из экспериментов над смесью техно, брейкбита и хауса. Треки выходили только на виниле, и первые пластинки моментально привлекли интерес диггеров по всему миру.<br><br>Артистическая манера Symbol чем-то напоминает выступления русских поэтов-футуристов, скандировавших стихи в толпу, только он выкрикивает бойкие тексты своих электронных боевиков.&nbsp;</p>',1200,'',2,35,1,'https://rroom.timepad.ru/event/2375413/#register','',false,false,NULL,NULL,'2023-04-04 11:56:19','2023-10-24 11:51:05',64231219,'','0',18,24),
	 (636,'Movement Dialogue','2023-04-29-factory-3-movement-dialogue-1','2023-04-29',NULL,'23:55:00',NULL,'<p>Дорогие друзья, 29 апреля СПБК приглашает вас отметить Международный день танцев в движении.<br>Танец - уневерсальный язык общения, стирает границы, соединяет людей во имя чистой любви и добра.<br>"Мы должны считать потерянным каждый день, в который мы не танцевали хотя бы раз." — Фридрих Ницше</p>',1000,'',1,7,1,'https://spb.qtickets.events/65666-spbk-movement-dialogue','https://vk.com/spbkmovementdialogu',false,false,NULL,NULL,'2023-04-04 12:07:33','2023-09-06 21:52:58',NULL,'','0',18,35),
	 (662,'House Of Rap','2023-05-19-rndm-house-of-rap','2023-05-19',NULL,'23:00:00',NULL,'',1000,'',2,27,1,'https://moscow.qtickets.events/68453-house-of-rap','https://houseofrap.ru/',false,false,NULL,NULL,'2023-04-05 20:36:14','2023-10-25 07:23:25',NULL,'','0',18,180),
	 (637,'Mixed.Night vol.2','2023-04-08-mixed-mixednight-vol2','2023-04-08',NULL,'22:00:00',NULL,'<p>8 апреля в Mixed баре пройдет вторая серия фирменной вечеринки mixed.night vol.2, которая проходит редко и по особенным поводам. А повод в этот раз весомый — ровно год назад вдохновителями проекта (Кириллом и Джорджем) было посеяно первое зерно на пути появления бара: нашлось помещение, которое стало обрастать деталями и впоследствие впитывать атмосферу камерных вечеринок.<br><br>на mixed.night ребята внимательно подбирают лайн-ап из артистов смежных, но разных жанров, мягко перетекая из одного в другой</p>',500,'',1,59,1,'','',false,false,NULL,NULL,'2023-04-04 12:20:07','2023-09-25 13:30:40',NULL,'','0',18,66),
	 (638,'Street Credit','2023-04-07-griboedov-street-credit','2023-04-07',NULL,'23:00:00',NULL,'<p>Пристегнитесь, сбавлять скорости не будем.<br>7 часов отборного репа в стенах бункера - это то, что вы давно просили.&nbsp;<br><br>ENTER:&nbsp;<br>С репостом — 300 рублей!&nbsp;<br>Без внимания к мероприятию — 500 рублей</p>',300,'500.0',1,86,1,'','',false,false,NULL,NULL,'2023-04-04 12:29:54','2023-10-20 01:53:57',NULL,'','0',18,45),
	 (639,'Balagan','2023-04-15-gazgolder-balagan','2023-04-15','2023-04-16','23:00:00','11:00:00','<p>Пора приоткрыть занавес и услышать овации зала, наше шоу, длиною в ночь, начинается! Команды HEY, LOCATION! и 16OM объединились, чтобы создать уникальное по своим масштабам и пожалуй самое яркое событие этой весны, открыв серию вечеринок BALAGAN <br>Только на один день, 15 апреля, танцпол клуба GAZGOLDER превратиться в огромную цирковую арену под сводами разноцветного шатра, а в самом центре нас ждёт уникальная круглая сцена с главными иллюзионистами ночи - музыкантами и диджеями, под ритмы которых будет постепенно оживать наш маленький город, вместе с жонглерами, клоунами, ходулистами и конечно же главными героями этой ночи - Вами!&nbsp;</p>',1800,'',2,35,1,'https://balagan.ticketscloud.org','',false,false,NULL,NULL,'2023-04-04 12:46:18','2023-10-14 19:08:50',641,'','0',18,36),
	 (646,'Oberwave','2023-04-07-prostranstvo-pole-oberwave','2023-04-07',NULL,'22:00:00',NULL,'<p>Только недавно отгремели в Мутаборе, теперь пошумим в <a href="https://vk.com/eto.polye">Поле</a>, на этот раз с нашим фирменным абсент-баром. Настроение — вернуться к классическому дарк диско и похулиганить. Ждем вас в следующую пятницу, 7-го апреля.</p>',600,'',2,46,1,'https://moscow.qtickets.events/67972-0704-oberveyv-v-pole','https://vk.com/oberwave',false,false,NULL,NULL,'2023-04-04 15:37:37','2023-10-23 03:06:59',NULL,'','0',18,17);
