	 (640,'Возвращение Орбиты','2023-04-21-gazgolder-vozvrashhenie-orbity','2023-04-21','2023-04-22','23:00:00','10:00:00','<p>Будущее…еще не наступило, но именно туда направляется наш космический музыкальный корабль Orbita project. 21-го апреля, в совсем недалеком будущем, завершив наши зимние каникулы в Индии, мы снова втретимся в клубе&nbsp; Gazgolder. Возвращение проекта из Гоа по-традиции ознаменует день рождения души и основателя проекта - Александра SMITH’а. До кучи мы добавим еще один повод уйти в конкретные ОРБИТанцы: день рождения основателя DJ-школы „PROSTEREO“ и резидента проекта - DJ TAGA. Пульты управления вашим настроением займут прилетевшие из Гоа, загореленькие&nbsp; разиденты, их московские друзья и техно - десант из Екатеринбурга.<br>Подумать о ТЕБЕ БУДУЩЕМ, можешь только ТЫ В НАСТОЩЕМ! Поэтому отмечай дату, бери билет и готовь самую удобную обувь! Диджеи «ОРБИТЫ» соскучились и привезут много СОЛНЦА, энергии и крутой МУЗЫКИ!</p>',1500,'',2,35,1,'','',false,false,NULL,NULL,'2023-04-04 14:09:36','2023-10-08 09:58:57',641,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,79),
	 (641,'Another Saturday','2023-04-08-gipsy-another-saturday','2023-04-08',NULL,'23:00:00',NULL,'<p>Окунитесь на одну ночь в мир настоящей клубной жизни столицы.<br><br>Субботние вечеринки в Gipsy — это атмосфера непрекращающегося летнего карнавала среди пальм и зелени. Топовые диджеи, go-go, акробаты и, конечно же, легендарная шаурма.<br><br>Посетить мероприятие могут лица старше 18 лет, наличие оригинала паспорта обязательно для входа (копии и фотокопии паспорта не принимаются!).<br><br>Клуб в праве отказать вам во входе, в случае несоблюдения основных правил посещения: дресс кода, возрастных ограничений, состояния алкогольного или наркотического опьянения. В особых случаях вам может быть отказано в посещении по решению сотрудников внутренней службы безопасности без объяснения причины с полным возвратом денежных средств уплаченных за билет на мероприятие.</p>',2000,'',2,37,1,'https://afisha.yandex.ru/moscow/party/another-saturday-2023?admitad_uid=7d84a6ac2b5154cd09b0f89fc6bc0211&utm_source=admitad&utm_content=7d84a6ac2b5154cd09b0f89fc6bc0211&utm_campaign=353356','https://vk.com/gipsybar',false,false,NULL,NULL,'2023-04-04 15:05:27','2023-10-25 13:41:00',NULL,'','0',18,81),
