	 (644,' Buddha Music Classic','2023-04-08-buddha-bar-buddha-music-classic','2023-04-08',NULL,'22:00:00',NULL,'<p>Buddha Bar приглашает Вас окунуться на 10 лет назад в приятную атмосферу ностальгии и качественной музыки....</p>',1000,'',1,38,1,'https://afisha.timepad.ru/event/2360356','',false,false,NULL,NULL,'2023-04-04 15:17:35','2023-10-14 19:41:26',NULL,'','0',18,65),
	 (647,'Tears for Peers','2023-04-07-slezy-tears-for-peers','2023-04-07',NULL,'19:00:00',NULL,'<p>Мы так долго утопали в ностальгии по старым добрым временам, что решили открыть портал в музыкальное прошлое.<br><br>Приглашаем тебя на вечеринку Tears for Peers 7 апреля в бар Слёзы утолять жажду свободы и выпускать на волю все скопившиеся эмоции!</p>',650,'',2,102,1,'https://moscow.qtickets.events/66305-tears-for-peers','https://vk.com/tearsforpeers',false,false,NULL,NULL,'2023-04-04 15:51:12','2023-10-22 09:21:49',NULL,'','0',18,80),
	 (648,'Chacha’s Crew Birthday','2023-04-07-krov-loft-chachas-crew-birthday','2023-04-07',NULL,'22:00:00',NULL,'<p>Пришло тепло, изменений много, но что было неизменно в Chacha’s Crew, так это коллектив, энергия добра и незабываемая атмосфера.<br><br>Призываем всех принять участие в этом замечательном празднике, завсегдатым и новичкам. Так же отметить ребят и девчонок, которые могут отличиться в положительную сторону за короткий промежуток времени!<br><br>В этот день мы собрали наших любимых резидентов<br>Дресс: ждем вас красивыми, нарядными. Акссесуары приветсвуються.<br>Правила:<br>1 Объятия при встрече и знакомстве.<br>2 Угощать соседа<br>3 Быть приветливым<br>4 Напитки можно с собой<br>5 Опустошаем бар<br><br>Всех люблю как в первый раз</p>',1500,'',2,111,1,'https://moscow.qtickets.events/67306-chachas-crew-birthday','',false,false,NULL,NULL,'2023-04-04 15:58:14','2023-10-01 21:48:43',NULL,'','0',18,39),
	 (649,'SPACE REALITY SHOWCASE','2023-04-07-treff8-club-space-reality-showcase','2023-04-07',NULL,'23:00:00',NULL,'<p>7 апреля звездный десант SR снова совершит посадку в клубе TREFF8 для того, чтобы продолжить борьбу со скукой земных обитателей под музыку, которую шазамят.<br><br>На борту корабля были замечены харизматичный электронный проект двух диджеев и музыкальных продюсеров из Беларуси Stereoporno, фанатка эклектизма и музыкальных экспериментов Victoria Rude, коллекционер редких музыкальных работ Artem Lavreckiy, жемчужина электронной сцены Alessa Khin и эпатажная Shukur.<br><br>Запасайтесь кислородом, танцевать будем с 23:00 до 6:00.<br>Dress-code: smart casual, cocktail</p>',1250,'1500.0',2,84,1,'https://moscow.qtickets.events/68042-space-reality-showcase','',false,false,NULL,NULL,'2023-04-04 16:03:02','2023-10-23 13:56:05',NULL,'','0',18,47);
