	 (650,'OUTLAW','2023-04-07-16-tonn-outlaw-1','2023-04-07',NULL,'23:30:00',NULL,'<p>7 апреля в клубе «16 Тонн» пройдёт OUTLAW вечеринка!<br>Нам исполняется один год!<br>OUTLAW — серия столичных тусовок от творческого объединения российских хаус-продюсеров, сплотившихся вокруг темного и стильного звучания.</p>',600,'',2,29,1,'https://moscow.qtickets.events/65463-outlaw','',false,false,NULL,NULL,'2023-04-04 16:08:48','2023-10-18 05:57:28',NULL,'','0',18,30),
