	 (653,'Волк с Уолл Стрит','2023-04-14-treff8-club-volk-s-uoll-strit','2023-04-14',NULL,'22:00:00',NULL,'<p>Дорогие гости! Добро пожаловать на третью тематическую вечеринку по легендарным фильмам! Мероприятие посвящено комедийной драме «Волк с Уолл-стрит»<br><br>Подняться и обогатиться - это то, о чëм мечтают многие! Этой ночью успех и богатство схлестнутся в битве за жажду лёгкой наживы и моралью<br>Противостоять соблазнам и порокам современного мира или поддаться им? Решать вам!<br><br>Световое шоу<br>Декорации<br>Актеры в гримме<br>Целевая аудитория<br>Профессиональный бар<br>Line Up артистов известных лейблов</p>',1300,'',2,84,1,'https://moscow.qtickets.events/67597-volk-s-uoll-strit','',false,false,NULL,NULL,'2023-04-04 18:07:36','2023-10-08 18:11:26',NULL,'','0',18,40),
	 (654,'CORPUS ONE','2023-04-14-gazgolder-corpus-one','2023-04-14',NULL,'23:59:00',NULL,'<p>14 апреля CORPUS ONE превратится в музыкальную двух–танцпольную станцию, отправляющую мелодические импульсы из стен Gazgolder Club в межзвездное пространство.<br><br>Желание делиться музыкой достигло вселенских масштабов и день космонавтики идеальное для этого время.<br><br>Настраивать связь «Земля – Космос – Земля» в эту ночь будут</p>',1000,'1700.0',2,35,1,'https://moscow.qtickets.events/66880-corpus-one-gazgolder','',false,false,NULL,NULL,'2023-04-04 18:15:42','2023-09-28 06:02:07',NULL,'','0',18,48),
	 (655,'HARD TIME - HARD TECHNO','2023-04-28-blank-hard-time-hard-techno','2023-04-28',NULL,'23:00:00',NULL,'<p>Время испытаний и мрака стремительно остаётся позади, впереди нас ждёт лишь весна, любовь и техно.<br>По такому поводу команда HEDONISM TECHNO вновь соберётся вместе, чтобы раскрыть новые грани атмосферы бескомпромиссного техно.</p>',700,'',1,1,1,'https://t.me/hedonism_tech_bot','https://t.me/hedonism_techno',false,false,NULL,NULL,'2023-04-05 17:46:31','2023-10-22 18:39:05',NULL,'','0',18,45),
	 (656,'ATMOSFERA_67','2023-04-15-community-moscow-atmosfera-67','2023-04-15',NULL,'22:00:00',NULL,'<p>Хорошим привозом сегодня мало кто может похвастаться. Мы - можем!<br>Наша международная команда диджеев из России,Туниса и Египта,которая уже покорила танцполы лучших заведений Москвы, приглашает тебя на свой Event в главную музыкальную библиотеку страны - Community!<br><br></p>',1700,'',2,58,1,'https://moscow.qtickets.events/66759-atmosfera-67','http://communitymoscow.ru/',false,false,NULL,NULL,'2023-04-05 18:00:39','2023-10-10 05:10:21',NULL,'','0',18,46),
	 (680,'Open Decks','2023-04-06-rndm-open-decks','2023-04-06',NULL,'20:00:00',NULL,'<p>В этот раз на четверговом Open Decks встречаем ребят из Петербурга, команду NASLEDIE XXI. Все мы иногда хотим в Питер, поэтому Питер приехал к нам.<br>Вход свободный</p>',NULL,'0.0',2,27,1,'','',false,false,NULL,NULL,'2023-04-06 00:23:13','2023-10-10 11:14:24',NULL,'','0',18,80),
	 (657,'ВОСХОД · LO-FI HOUSE','2023-04-15-tba-vosxod-lo-fi-house','2023-04-15',NULL,'23:55:00',NULL,'<p>Мероприятие пройдет в центре города, помещение будет дополнительно оформлено живыми папоротниками и другой растительностью. Дополнят эту ламповую картину бегущая строка и неоновые вывески.</p>',800,'',2,24,1,'https://moscow.qtickets.events/65993-voskhod-lo-fi-house','https://vk.com/vosxodlofi',false,false,NULL,NULL,'2023-04-05 18:08:02','2023-09-30 16:22:50',NULL,'','0',18,33);
