	 (658,'Vibe Room','2023-04-07-dk-vibe-room','2023-04-07',NULL,'23:00:00',NULL,'<p>Для новой вечеринки в ДК мы возвращаем специальный музыкальный формат, который пришелся вам по душе еще прошлым летом: каждый сет будет посвящен самым влиятельным городам в хип-хопе и их главным представителям.<br><br>География городов широкая и выходит далеко за пределы родины хип-хопа:&nbsp; Нью-Йорк, Лос-Анджелес, Монреаль, Чикаго, Хьюстон, Детройт, Мемфис, Лондон, Атланта, Торонто, Рио-де-Жанейро, Питтсбург, Филадельфия, Кливленд и Майами.<br><br>Все блоки по городам и их тайминги распишем в следующих постах.<br><br></p>',500,'700.0',1,68,1,'','',false,false,NULL,NULL,'2023-04-05 20:03:49','2023-10-24 21:47:50',NULL,'','0',18,39),
	 (660,'Synth Party','2023-04-29-live-story-synth-party','2023-04-29',NULL,'23:30:00',NULL,'<p>Ночная вечеринка для всех любителей синтезаторной музыки! Танцы до самого утра под лучшие хиты.<br>В программе:<br>- Танцы до самого утра и атмосфера настоящего праздника,<br>- Диджеи поставят ваших любимых синт-хиты: A-ha, Alphaville, Bananarama, Blondie, Carpenter Brut, The Cars, Crystal Castles, The Cure, Depeche Mode, Dead Or Alive, Desire, Eurythmics, Electric Youth, FM-84, The Human League, Kavinsky, Ladytron, New Order, Perturbator, Soft Cell, Yazoo и многих других!<br><br>18+ (Вход строго по оригиналам документов)</p>',300,'',2,16,1,'https://moscow.qtickets.events/65626-synth-party-2904-live-story','https://vk.com/synth290423',false,false,NULL,NULL,'2023-04-05 20:26:18','2023-10-10 20:22:31',NULL,'','0',18,29),
