	 (663,'Sasha Birthday & 23 YEARS DKLR','2023-04-08-factory-3-sasha-birthday-23-years-dkl-1','2023-04-08',NULL,'23:30:00',NULL,'<p>Приветствуем! 8 апреля Приглашаем вас на Sasha Birthday &amp; 23 Years DKLR в топовый клуб Factory, расположенный на территории культурного пространства Севкабель. По традиции выступят лучшие артисты из Санкт-Петербурга, а так же к нам в гости заедет легендарный DJ Novak из Москвы. Два танцпола, более 20 артистов, лучший звук в городе, торт, свечки а так же — хорошая атмосфера гарантирована.</p>',700,'',1,7,1,'https://spb.qtickets.events/65000-sasha-birthday-23-years-dklr','https://vk.com/event219122579',false,false,NULL,NULL,'2023-04-05 20:54:34','2023-09-26 03:50:32',NULL,'','0',18,22),
	 (664,'Heavy DubPlate 1 Year In Game','2023-04-15-zoccolo-20-heavy-dubplate-1-year-in-ga','2023-04-15',NULL,'23:55:00',NULL,'<p>Heavy Dubplate возвращается с фирменной вечеринкой в клубе Цоколь! Поводом стал День Рождения нашей промо! Мы собрали всеми любимый локальный состав артистов с сапортом от двух гостей из Беларуси.</p>',300,'500.0',1,72,1,'https://spb.qtickets.events/68101-1504-heavy-dubplate-1-year-in-game','https://vk.com/heavy_birthdaybash',false,false,NULL,NULL,'2023-04-05 21:07:44','2023-10-24 21:21:30',NULL,'','0',18,25),
