	 (666,'Pumping storm 2023','2023-04-29-aurora-hall-pumping-storm-2023','2023-04-29',NULL,'23:55:00',NULL,'<p>Ночь, которую ждут.<br>Ночь, знаменующая эпоху и объединившая поколения.<br>Разделившая жизнь на До и После...<br>Главный российский хардбас эвент: Pumping Storm 2023!</p>',680,'',1,25,1,'https://spb.qtickets.events/65772-pumping-storm-2023','https://vk.com/storm2023',false,false,NULL,NULL,'2023-04-05 21:21:47','2023-10-24 21:21:31',NULL,'','0',18,80),
	 (667,'Drop Dealerz Rave','2023-05-05-zoccolo-20-drop-dealerz-rave','2023-05-05',NULL,'23:55:00',NULL,'<p>ХэйХоу! Всем добра и баса! Вы этого ждали и просили! Что ж... Мы услышали и сделали. Встречаем анонс нашего очередного мероприятия! <br>5 мая Drop Dealerz Rave снова на ваших радарах! Не пропустите!<br><br></p>',400,'',1,72,1,'https://spb.qtickets.events/66492-drop-dealerz-rave-050523-zoccolo-20','https://vk.com/dropdealerzrave_0505',false,false,NULL,NULL,'2023-04-05 21:27:56','2023-09-18 06:03:53',NULL,'','0',18,33),
	 (669,'Mirage 08/04','2023-04-08-miraz-mirage-0804','2023-04-08',NULL,'23:00:00',NULL,'<p>пришло время напомнить вам о&nbsp; планах на эту субботу&nbsp;<br><br>нам исполняется год, а это значит, что праздновать будем всем составом, без исключений .<br>поздравить нас и порадовать вас приедет KTO DJ ? , поэтому танцевать точно будут все<br>разумеется не обойдётся без торта, а еще всем заказавшим из новой коктейльной карты мы дарим бокал игристого (парни, это чтобы угостить, а не быстрее убраться в ноль)<br>советуем заранее бронировать столы по номеру:&nbsp;<br>+7 (989) 346-71-85</p>',1000,'',1,77,1,'','',false,false,NULL,NULL,'2023-04-05 21:39:31','2023-10-23 17:04:10',NULL,'','0',18,44),
	 (670,'Secrets','2023-04-07-secrets-secrets','2023-04-07',NULL,NULL,NULL,'<p>Врываемся в весну! В пятницу 7 апреля в уютном пространстве Secrets на Полтавской 7 будет много музыки и интересных людей. Вас ждёт приятная компания и волнующее шоу в исполнении профессиональных артистов.<br><br>Специально для этой вечеринки из Москвы скорым поездом примчит DUB PEPPER с музыкальной шкатулкой. А маэстро DINAMICA поделится новыми находками из мира гипнотических звуков.</p>',999,'1500.0',1,147,1,'https://spb.qtickets.events/68476-dinamica-x-dub-pepper','',false,false,NULL,NULL,'2023-04-05 21:44:41','2023-09-28 00:35:22',NULL,'','0',18,29);
