	 (671,'antiCOVID-23','2023-04-22-slondoneba-anticovid-23','2023-04-22',NULL,'23:55:00',NULL,'<p>Мы продолжаем тему путешествий во времени. Вернёмся во времена короны, когда все сидели дома, TikTok набирал обороты, а треки, которые теперь известны нам всем, благодаря ТикТоку, играли повсюду.<br><br>В ночь с 22 на 23 апреля мы будем отрываться за те 2 года, когда коронавирус сильно ударил по клубной жизни. Вы готовы?<br><br>Все как вы любите: классный плейс, большой выбор напитков, любимые диджеи и МС.<br>Взяли очень атмосферную площадку, идеально подходящую под тематику нашего ивента.<br><br>На протяжении всей ночи вы можете брать коктейли на баре бесплатно! Оплатить надо только вход. На площадке будет 2 бара, танцпол, сцена, курилка и т.д.<br><br></p>',1500,'',1,148,1,'https://spb.qtickets.events/68131-anticovid-23','',false,false,NULL,NULL,'2023-04-05 22:24:15','2023-10-25 15:22:56',NULL,'','0',18,51),
	 (673,'SURPRISE (SASHA KHIZHNYAKOV B-DAY)','2023-04-07-radio-surprise-sasha-khizhnyakov-b-day','2023-04-07',NULL,NULL,NULL,'<p>Йо, у нас для вас сюрприз! В пятницу, 7 апреля, встречаемся в Радио на Суперметалле и отмечаем день рождения Саши Хижнякова!<br><br>Большой компетишн за синий кубок возглавит целая толпа диджеев, имена которых вам хорошо известны. Нарядиться нужно красиво, причём настолько, чтобы для всех это было сюрпризом. Готов ли ты к такому повороту?</p>',1000,'',2,149,1,'https://radugadiscoclub.ru/','',false,false,NULL,NULL,'2023-04-05 23:31:11','2023-10-02 19:21:48',NULL,'','0',18,64),
	 (674,'New School Rave','2023-04-07-kruzok-new-school-rave','2023-04-07',NULL,'21:00:00',NULL,'<p>Расписание на выходные не может не радовать!</p>',NULL,'',1,11,1,'','',false,false,NULL,NULL,'2023-04-05 23:47:54','2023-08-25 23:42:19',NULL,'','0',18,4),
	 (676,'THIS FRIDAY at DFF!','2023-04-07-deep-fried-friends-this-friday-at-dff','2023-04-07','2023-04-08','23:59:00','05:00:00','<p>Место встречи изменить нельзя, поэтому ждём вас всех красивыми и нарядными в неизменном ресторане DFF.<br>Всю ночь для вас играют: жемчужинs российской электронной сцены<br><br>Вход платный (оплата на входе, наличными или по QR-коду)</p>',600,'',2,76,1,'','https://t.me/dffradio',false,false,NULL,NULL,'2023-04-05 23:54:36','2023-09-27 02:04:37',NULL,'','0',18,16),
	 (677,' GENTLEMEN’s CLUB at DFF!','2023-04-08-deep-fried-friends-gentlemens-club-at','2023-04-08','2023-04-09','23:59:00','05:00:00','<p>Субботний вечер томно переходит в ночь. Они собирают свои клюшки для гольфа, докуривают сигары и больше не говорят о бизнесе. Ровно в полночь их спорткары будут припаркованы у старого особняка на Яузской, а это значит что Клуб Джентельменов уже открыт!<br><br>Мы собрали их в одном месте —сердцееды и красавчики, талантливые и очень талантливые, настоящие и нереальные — джентельмены. Не будем томить и познакомим вас с ними</p><p>Вход платный (оплата на входе, наличными или по QR-коду)</p>',NULL,'500.0',2,76,1,'','https://t.me/dffradio',false,false,NULL,NULL,'2023-04-06 00:03:53','2023-10-22 17:52:41',NULL,'','0',18,85),
	 (678,'ORAMICA: ШИПОВНИК  ','2023-04-21-rndm-oramica-sipovnik','2023-04-21','2023-04-22','22:00:00','06:00:00','<p>Мы ежедневно превращаемся в кого-то нового. Чем дальше в жизнь, тем стремительнее превращения и изменчивее роли: в чем ты был уверен вчера, может расбалансировать сегодня. Поддерживать опоры помогают чуткость к собственным желаниям, уважение дел других и живой интерес к соратникам по сцене; неважно, кто в подвале, а кто на мейне «Мутабора» — единение начинается с изнанки.&nbsp;<br><br>Oramica — это и есть лейбл наизнанку: поклонники линейного звука собирают модуляры и находят отдушину в шумах, экспериментаторы заново знакомятся с поп-культурой. На нашем первом овернайте в «Рэндоме» 21 апреля сыграют восемь артистов: лайвы и диджей-сеты варьируются от прямолинейного техно до саркастичного гиперпопа. Вечеринка для горя, радости и преодоления ненадежных ментальных состояний.&nbsp;</p>',300,'500.0',2,27,1,'https://moscow.qtickets.events/68058-oramika-shipovnik','https://oramica.online/',false,false,NULL,NULL,'2023-04-06 00:12:20','2023-10-25 06:28:56',NULL,'','0',18,75),
	 (679,'Manifest','2023-04-29-rndm-manifest','2023-04-29',NULL,NULL,NULL,'<p>29 апреля команда Manifest откроет для Вас празднование майских праздников и подарит свою фирменную скоростную вечеринку. Непревзойденный мастер&nbsp; techno-dope-ghetto-shit веселья с кучей крышеносных релизов DJ XNX и закаленный креатор-коллекционер techno-trance шедевров Ober Dada будут почетными гостями в субботнюю ночь. Маэстро Etrigan смузицирует свой новый Live, Lowchord и Basil White мастерски сведут новые селекции, а Rif Erous откроет ночь торжества. <br>До встречи!</p>',500,'800.0',2,27,1,'','https://vk.com/wall-218637727_20',false,false,NULL,NULL,'2023-04-06 00:17:00','2023-10-25 07:23:19',NULL,'','0',18,52),
	 (681,'СТРУКТУРА','2023-04-07-motiv-struktura','2023-04-07',NULL,'23:00:00',NULL,'<p>В пятницу, 7 апреля, мы снова встретимся в уютных стенах МОТИВ CREW.&nbsp;<br>Будем топтать последний лёд и прогревать окружающую среду электроэнергией.<br><br>К нам в помощь, с редкими пластинками, прилетит Ershov - резиденит Undeground Experience. Любитель как прямой бочки, так и ломанных ритмов, чувствуем, нас ждет b2b.<br><br>А также Trngl - проект молодого артиста из Новосибирска. Предпочитает электро, во всех его направлениях.</p>',NULL,'0.0',1,88,1,'','http://t.me/motivecrew',false,false,NULL,NULL,'2023-04-06 00:48:54','2023-10-22 23:56:07',NULL,'','0',18,56),
	 (682,'ПЛАСТИЛИН','2023-04-15-rndm-plastilin','2023-04-15',NULL,'22:00:00',NULL,'<p>Однажды в лесу росла сказочная вишня. Она была необычной, потому что у нее были волшебные ягоды, которые могли исполнить любое желание. Однажды вишня услышала желание о новой вечеринке “Пластилин” и она решила, что это замечательный способ познакомиться с новыми людьми и повеселиться.<br><br>Вишня начала готовиться к вечеринке: выбрала самые яркие и красивые ягоды, чтобы выглядеть нарядно. Она также приготовила магический напиток, который помогал ей летать.<br><br>15 апреля мы приглашаем вас на вишневый Пластилин, чтобы насладиться атмосферой любви и цветов. Мы вновь проведем этот праздник, который наполнит вас стильными звуками и музыкой от наших гостей</p>',500,'1000.0',2,27,1,'https://plastilin.ticketscloud.org/','',false,false,NULL,NULL,'2023-04-06 01:04:43','2023-10-24 21:24:04',NULL,'','0',18,76),
	 (683,'VesnaDance','2023-04-08-sandboxmusicroom-vesnadance','2023-04-08','2023-04-09','23:00:00','08:00:00','<p>В субботу уютное гнездышко SandBoxMusicRoom на Тучковом переулке ждет всех на психоделическое трансовое путешествие, которое перенесет присутствующих в другие измерения звука и сознания!&nbsp;</p>',NULL,'350.0',1,110,1,'','https://linktr.ee/SandBoxMusicRoom',false,false,NULL,NULL,'2023-04-06 01:09:19','2023-10-22 14:45:09',NULL,'','0',18,60);
