	 (687,'ALGORITHM: NEUROCRAB PARTY','2023-04-29-dvor-zacem-nakidalsia-algorithm-neuro','2023-04-29',NULL,'21:00:00',NULL,'<p>Полгода назад отряд команды Алгоритм открыл нейро-портал на планете «DVOR», но только сейчас вызвал необратимые последствия – через портал хлынули дальневосточные крабы. У ракообразных было много запасов огненной нейро-воды, тем самым они стали кошмарить население, превращая их в накидавшихся созданий. База Алгоритм перехватила сигнал последних выживших и отправила отряд на планету вновь но они ещё не догадываются, что планеты, на которую они направляются, больше нет, а крабы превратили это место в свой драм-н-бейс дом...<br><br>BROCARD – FREE<br>С собой запрещено проносить: алкоголь, огнестрельное и холодное оружие, наркотические средства, политику и агрессию.</p>',500,'700.0',2,145,1,'https://moscow.qtickets.events/68516-290423-algorithm-neurocrab-party','https://vk.com/algorithm_neurocrab',false,false,NULL,NULL,'2023-04-06 19:01:27','2023-10-11 15:09:03',NULL,'','0',18,39),
