	 (690,'SOLAR SYSTEM','2023-04-08-community-moscow-solar-system','2023-04-08',NULL,'22:00:00',NULL,'<p>Наполненная солнцем и любовью к жизни SOLAR SYSTEM возвращается в Москву! Нам хочется скорее встретиться, чтобы поделиться этой обновленной энергией и, конечно, музыкой! Увидимся 8 апреля в 22:00 в стенах родного и любимого Community! Библиотека зазвучит по-новому. В лайнапе друзья, близкие сердцу люди и те, чьей путеводной звездой в жизни является — музыка.</p>',1250,'',2,58,1,'https://www.afisha.ru/concert/2189084/','http://communitymoscow.ru',false,false,NULL,NULL,'2023-04-06 19:23:09','2023-10-22 18:23:52',NULL,'','0',18,46),
