	 (694,'ВКУС ВО РТУ ','2023-04-14-dk-kristall-vkus-vo-rtu','2023-04-14',NULL,NULL,NULL,'<p>Звезды над городом&nbsp;<br>Плавятся в огне&nbsp;<br>Вечного&nbsp;<br>Солнечного света.<br>Руки ребёнка&nbsp;<br>В молоке.<br>Твои пухлые губы&nbsp;<br>Приближаются ко мне.&nbsp;<br>За завтраком мне страшно,<br>За обедом хорошо,&nbsp;<br>A за ужином я&nbsp;<br>Вспоминаю,<br>Что у нас с тобой&nbsp;<br>Уже давно -<br>Один и тот же<br>Вкус во рту.<br><br></p>',800,'',2,28,1,'https://moscow.qtickets.events/68497-vkus-vo-rtu','',false,false,NULL,NULL,'2023-04-13 03:30:07','2023-10-25 10:18:10',NULL,'','0',18,39),
