	 (696,'Суббота в «Стрелке»','2023-04-15-bar-strelka-subbota-v-strelke','2023-04-15',NULL,'23:00:00',NULL,'<p>В субботу беззаботная дискотека с одним из самых ироничных музыкантов современности Петаром Мартичем, который недавно отметил десятилетие своего проекта «Прыгай, киска». Предлагаем продолжить праздновать.</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,NULL,'2023-04-13 03:41:16','2023-10-01 00:12:27',NULL,'','0',18,44),
	 (697,'Пятница в «Стрелке»','2023-04-13-bar-strelka-piatnica-v-strelke','2023-04-13',NULL,'23:00:00',NULL,'<p>Главные музыкальные приключения весны на «Стрелке» — уже на этих выходных.<br>В пятницу всю ночь ставит пластинки гуру магического саунда, сооснователь Opium Underground и Jazzve Антон Носов (Aman Po-Kaifu). По пути на вечеринку (и вообще когда угодно) включайте его свежий <a href="https://on.soundcloud.com/omVZa">микс</a> для нашего любимого радио «Тигр».</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,NULL,'2023-04-13 03:45:42','2023-09-28 05:29:09',NULL,'','0',18,63),
	 (698,'System 108 eight years','2023-04-15-prostranstvo-pole-system-108-eight-year','2023-04-15',NULL,NULL,NULL,'<p>Праздничное мероприятие в честь Дня рождения Системы отметят с размахом: вечеринка пройдёт сразу в двух клубах — Баунс и Поле, а музыкальная программа разделится на три сцены, одна из которых будет отдана под стрим Stvol.TV</p>',2000,'',2,46,1,'https://system108.com/2023-04-15','',false,false,NULL,NULL,'2023-04-13 04:01:35','2023-10-19 22:53:10',NULL,'','0',18,88),
	 (699,'Круговая Порука','2023-04-14-prostranstvo-pole-krugovaia-poruka','2023-04-14',NULL,'23:00:00',NULL,'<p>В «поле» стартует новый формат тусовок, где локальные диджеи будут сменять несколько b2b-сетов на протяжении одной ночи. В пятницу резидентка клуба Маша Волюм сыграет целых три раза с коллегами по цеху.</p>',600,'',2,46,1,'https://krugovayaporuka.ticketscloud.org/','',false,false,NULL,NULL,'2023-04-13 04:07:09','2023-10-23 02:45:25',NULL,'','0',18,33),
	 (700,'Warehouse','2023-04-14-propaganda-warehouse','2023-04-14',NULL,'23:55:00',NULL,'<p>Пятница в «Пропаганде» — это вечеринка Warehouse, на которой её куратор Сергей Тимошов играет с опытными локальными диджеями. Кроме Сергея в новом эпизоде участие примут Антона RVBBT из команды лейбла «АБЦД» и Roman Vabel.</p>',NULL,'0.0',2,101,1,'','',false,false,NULL,NULL,'2023-04-13 04:13:05','2023-10-25 09:50:46',NULL,'','0',18,72),
	 (701,'SPACE INSIDE','2023-04-14-myth-club-space-inside','2023-04-14',NULL,'23:00:00',NULL,'<p>Вечеринка, вдохновленная эстетикой космоса. Вы отправитесь в танцевальный межгалактический трип из башни Федерация в «Москве-Сити» под музыку белорусских продюсеров Para Noir и других артистов.<br><br></p>',1500,'',2,31,1,'https://megapolis-night.qtickets.ru/event/68639?base_color=4071e9','https://vk.com/event219793504',false,false,NULL,NULL,'2023-04-13 04:21:23','2023-10-24 21:52:09',NULL,'','0',18,31),
	 (702,'ТЕХНОЛОГИЯ','2023-04-14-bar-klub-texnologiia','2023-04-14',NULL,'21:00:00',NULL,'<p>Бесплатная тусовка с электронной музыкой в рюмочной, которая понравится любителям демократично выпить и потанцевать</p>',NULL,'0.0',2,151,1,'','',false,false,NULL,NULL,'2023-04-13 04:29:02','2023-10-19 20:26:13',NULL,'','0',18,46);
