	 (705,'Blood Knife','2023-04-15-griboedov-blood-knife','2023-04-15',NULL,'23:00:00',NULL,'<p>Никто и не подозревает с какой опасностью нам предстоит столкнуться — ведь дальнейшее развитие событий невозможно предугадать<br>До 00:00 - 300<br>С репостом - 400<br>Без репоста - 600</p>',300,'600.0',1,86,1,'','',false,false,NULL,NULL,'2023-04-13 05:32:26','2023-10-24 22:35:37',NULL,'','0',18,68),
	 (706,'Truth Light','2023-04-15-warpp-truth-light','2023-04-15',NULL,NULL,NULL,'<p>Дорогие наши друзья и единомышленники. После прекрасного события Wonderland, на котором в очередной раз благодаря Вам мы снова сделали Sold Out, мы рады открыть для вас новое послание в рамках нашего второго проекта - "Truth Light", что в переводе означает "Истинный Свет", тот самый теплый свет, который несет внутри нас гармонию, мир и любовь.</p>',0,'1000.0',1,23,1,'http://hopeandlovehere.com/','http://hopeandlovehere.com/',false,false,NULL,NULL,'2023-04-13 05:39:11','2023-09-27 16:39:01',NULL,'','0',18,45),
