	 (715,'Абстрасенция: April Gardens в тропиках','2023-04-22-oranzereia-tavriceskogo-sada-abstrasenci','2023-04-22',NULL,'16:00:00',NULL,'<p>Сады яркой, выразительной электронной музыки откроются для посещения на два сеанса — днем и вечером представится возможность услышать звучание 6 музыкальных проектов в сияющих джунглях Оранжереи Таврического.</p>',1200,'',1,48,1,'https://abstrasension.ru/april_gardens?utm_source=vk&utm_medium=cpc&utm_campaign=p2_1&erid=2VtzqvcuH99','https://abstrasension.ru/',false,false,NULL,NULL,'2023-04-19 17:56:33','2023-09-28 12:18:12',NULL,'','1',18,44),
	 (716,'Ethnoscope ','2023-07-28-zaovraznye-ozera-ethnoscope-28-30-iiulia','2023-07-28','2023-07-30',NULL,NULL,'<p>На фестивале Ethnoscop 2023 традиционно будет искусно составленный line-up из музыкальных жемчужин России, СНГ и других красивейший уголков планеты. Так появится большая электронная сцена, которая объединит ваших и наших любимых, локальных Dj и лейблы.<br><br>Мы сохраним дух релакса и уюта во всем, много места для отдыха и развития, высокий сервис и заботу обо всех участниках.<br><br>Подробности и новости совсем скоро в наших социальных сетях!</p>',5000,'',1,153,3,'https://ethnoscope.ru','https://vk.com/ethnoscope',false,false,NULL,NULL,'2023-04-19 18:12:36','2023-10-25 11:23:43',62,'','0',18,324),
	 (717,'LEMMARKET','2023-04-23-gestalt-lemmarket','2023-04-23','2023-04-23','12:00:00','20:00:00','<p>Вас ждёт маркет с уникальными изделиями ручной работы, приятные знакомства, общение с единомышленниками, вкусная выпивка, и все это под живые выступления популярных DJ!<br><br>⁃ украшения<br>⁃ одежда<br>⁃ карты-таро<br>⁃ изделия из керамики<br>⁃ свечи<br><br>И много другое!<br><br>Рады видеть всех ценителей прекрасного 23 апреля с 12:00 до 20:00! А после вас ждёт продолжение вечера на вечеринке CHERNIKA SUNDAY</p>',NULL,'0.0',2,126,1,'','',false,false,NULL,NULL,'2023-04-19 18:27:50','2023-10-04 22:47:11',NULL,'','0',18,53),
	 (718,'GESTALT PARTY','2023-04-22-gestalt-gestalt-party','2023-04-22',NULL,'22:00:00',NULL,'<p>GESTALT PARTY – неземная вечеринка с музыкой от популярных DJ, которая проникнет в твой разум и заставит по-настоящему расслабиться<br><br>Встречаемся уже в эту субботу, 22 апреля, в 22:00, чтобы танцевать до самого утра!</p>',0,'',2,126,1,'','',false,false,NULL,NULL,'2023-04-19 18:34:08','2023-10-20 02:41:31',NULL,'','0',18,43),
	 (1934,'БАРХАТНАЯ','2023-09-23-supermetall-barxatnaia','2023-09-23',NULL,'18:00:00',NULL,'<p>Новая задиристая вечеринка диско-клуба «Радуга» с говорящим названием и не менее говорящей афишей.</p>',1500,'',2,119,1,'https://radugadiscoclub.ru/e230923','',false,false,NULL,2,'2023-09-21 03:26:41','2023-10-24 22:06:52',NULL,'','0',18,200),
	 (719,'CHOICE SPRING EDITION','2023-04-21-gestalt-choice-spring-edition','2023-04-21',NULL,'22:00:00',NULL,'<p>Готовы отправиться в космическое путешествие по цветочным садам вечеринки CHOICE SPRING EDITION?🪐<br><br>Продолжаем серию тусовок, посвященных весеннему сезону! В этот раз встречаемся уже 21 апреля в 22:00 в Gestalt club<br><br>Успейте насладиться весенней атмосферой как можно дольше!</p>',0,'',2,126,1,'','',false,false,NULL,NULL,'2023-04-19 18:38:00','2023-10-05 15:17:20',NULL,'','0',18,40),
	 (727,'Continuum w/ Coubo','2023-04-21-warpp-continuum-w-coubo','2023-04-21','2023-04-21','19:00:00','23:00:00','<p>В пятницу, 21 апреля, промо группа Континуум продолжает сессии в клубе Warpp Live.<br><br>Ребята соберутся в полном составе, чтобы поделиться с вами новинками низкочастотной музыки. Приглашенным гостем в этот вечер станет резидент самого мощного саунда на югах Dub Raw, продюсер, битмейкер и опытный селектор – Coubo.<br><br>Билеты на входе – 300 рублей для <a href="https://t.me/continuum_wy">подписчиков канала</a>, остальным – 500 рублей.&nbsp;<br>Vibe control / 18+</p>',300,'500.0',1,23,1,'','',false,false,NULL,NULL,'2023-04-19 22:08:30','2023-08-25 23:37:22',NULL,'','0',18,27);
