	 (728,'RTRN','2023-04-22-motiv-rtrn','2023-04-22',NULL,'23:00:00',NULL,'<p>Дорогие эстеты ночной жизни, нашедшие себя в электронных вибрациях. Предлагаем вам, уже в эту субботу, присоединиться к культовому собранию RTRN от арт-коллаборации sychno group</p>',700,'',1,88,1,'https://synonym-techno.qtickets.ru/','',false,false,NULL,NULL,'2023-04-19 22:18:45','2023-09-26 11:27:11',NULL,'','0',18,31),
	 (2002,'All Friends Wanna Dance','2023-10-06-mod-all-friends-wanna-dance','2023-10-14',NULL,'23:59:00',NULL,'',NULL,'',1,113,1,'','',false,false,NULL,2,'2023-09-28 12:36:03','2023-10-23 23:18:42',NULL,'','0',18,189),
	 (720,'Blank Summer Season ','2023-04-29-blank-blank-summer-season','2023-04-29',NULL,'23:59:00',NULL,'<p>29 и 30 апреля открываем летний сезон теплопередач спаренной вечеринкой Blank Summer Season.&nbsp;<br><br>Как завещали косматые барды, сидя за полторашкой вокруг костра, лето — это маленькая жизнь. В климатических условиях Северо-Запада эта жизнь скоротечна, поэтому прожить ее хочется на полную. Обменяв сон на бодрствование, убежавший разум на дружеское плечо, а вшивых менестрелей на неотъехавших артистов, электризующих воздух вокруг.<br><br>Кроме старичка мейна в пляс пустится уличная терраса. Три года назад она стала чем-то вроде спасательного круга, помогшего выплыть из изоляции на островок надежды. Место бессчетных встреч рассвета, танцев до обеда и солнцезащитных очков, надетых по назначению, прошлым летом залегло на дно. Теперь клочок земли, со всех сторон замурованный неприступными стенами «Арсенала», за который мы вели ожесточенные бои с бюрократией, возвращается. Здесь мы с тобой проведем лето.<br><br></p>',800,'',1,1,1,'https://blankclub.ru','',false,false,NULL,NULL,'2023-04-19 19:47:01','2023-10-22 09:44:19',NULL,'','0',18,54),
