	 (722,'GAMMA FESTIVAL','2023-07-22-zavod-im-stepana-razina-gamma-festival','2023-07-22','2023-07-23',NULL,NULL,'<p>m_division исследует структуры электронной музыки и искусства, открывает новые грани и ставит эксперименты. IDM или techno, house или ambient, electro или jazz, стереотипы и ярлыки не важны. И пока темный всадник скачет по пластинке разрушая стены и ломая стереотипы, мы будем чувствовать эти вибрации и проживать их снова и снова...<br>Опыт глубокого прослушивания или активное телесное сопереживание? Решать вам. В новом экспериментальном проекте соединились дух минимализма, академическая точность и танцевальная стихия электронной музыки.</p>',1700,'',1,154,3,'https://gammafestival.ru/main','https://vk.com/m_division',false,false,NULL,NULL,'2023-04-19 20:02:29','2023-10-24 21:20:20',NULL,'','0',18,658),
	 (723,'Propaganda Birthday','2023-04-21-propaganda-propaganda-birthday','2023-04-21','2023-04-22','23:59:00','06:00:00','<p>21 апреля, празднуем день рождения клуба. Пригласили старых и новых друзей из Питера и Москвы.</p>',NULL,'500.0',2,101,1,'','https://vk.com/propagandamoscowclub',false,false,NULL,NULL,'2023-04-19 21:16:48','2023-10-04 18:43:40',NULL,'','0',18,44),
	 (724,'Cancelled','2023-04-22-mod-cancelled','2023-04-22','2023-04-23','23:00:00','05:00:00','<p>Серия вечеринок CANCELLED&nbsp; -&nbsp; отменяет все, что было до. <br>И приходит с новой волной техно и электро звучания в обновленный MOD</p>',299,'',1,113,1,'','',false,false,NULL,NULL,'2023-04-19 21:24:30','2023-10-14 20:54:09',NULL,'','0',18,36),
	 (725,'WALPURGIS','2023-04-30-dk-more-walpurgis','2023-04-30','2023-05-01',NULL,NULL,'<p>В Вальпургиеву ночь, с 30 апреля на 1 мая, заброшенный ДК МОРЕ преобразится в единый магический мир, в котором соединяться ведьмы, грибы, шаманы, монстры и технологии. Иммерсивный фестиваль развернётся трансцендентным приключением до незакатного солнышка сквозь всепоглощающие черные материи. Путь пройдет через наполненные секретами коридоры и залы, открытые к взаимодействиям и располагающие к познанию. В программе: фэшн-квест, волшебный маркет, грот спокойствия, дыра наслаждения, мета-библиотека, маскарад идентичностей и перформативный&nbsp; шабаш.&nbsp;<br><br></p>',666,'',1,155,3,'https://t.me/WALPURGIS_bot','',false,false,NULL,NULL,'2023-04-19 21:50:25','2023-10-08 04:10:51',NULL,'','0',18,74),
	 (805,'PLAN B','2023-04-28-miraz-plan-b','2023-04-28',NULL,'00:00:00',NULL,'<p>План «Б» более взвешенное и обдуманное решение, а не какой-то там запасной вариант. Так и у нас. Акцент делаем на качество, используя при этом минимум.&nbsp;</p>',500,'',1,77,1,'https://spb.qtickets.events/70679-plan-b-2804-shamsheva-ul-4','',false,false,NULL,NULL,'2023-04-27 16:24:36','2023-09-28 15:57:34',NULL,'','0',18,33),
	 (726,'КРИМ в Контркульте','2023-04-22-kontrkult-krim-v-kontrkulte','2023-04-22',NULL,NULL,NULL,'<p>КРИМ — проект сообщества&nbsp; _deka [о=о], цель которого — внести свой вклад в<br>развитие электронной музыки в России.&nbsp;<br>Комьюнити представляют продюсеры из Владивостока, Хабаровска, Тобольска и других городов. &nbsp;</p>',500,'700.0',1,33,1,'','',false,false,NULL,NULL,'2023-04-19 21:58:05','2023-09-30 07:56:05',NULL,'','0',18,36);
