	 (731,'Love Only','2023-04-21-blanc-love-only','2023-04-21',NULL,'22:00:00',NULL,'<p>Каждый артист на афише достоен вашего внимания.&nbsp;<br>Каждый из них тщательно готовит свой сет.&nbsp;<br>У вас будет уникальная возможность насладиться симбиозом разных стилей.&nbsp;<br>Поверьте, вам будет нравиться находиться сразу на несколько танцполах…&nbsp;<br>Мы будем признаваться друг другу в любви - ведь девиз нашего мероприятия “Love Only”</p>',2000,'',2,36,1,'https://um.ticketscloud.org','',false,false,NULL,NULL,'2023-04-19 23:01:10','2023-10-22 04:35:12',NULL,'','0',18,79),
	 (732,'HIGHWAY NIGHT','2023-04-28-blanc-highway-night','2023-04-28','2023-04-29','20:00:00','06:00:00','<p>28 апреля мы открываем новый весенне-летний танцевальный сезон в особняке Бланк вместе с крутейшим составом любимых артистов и специальным гостем – Matthias Meyer, многолетним резидентом берлинского клуба Watergate и нашим очень большим другом.<br>Вход:<br>20.00 — 22.00 FC / вход бесплатный, с предварительной регистрацией на сайте<br>22.00 — 06.00 FC / 21+ / вход по билетам<br><br>Купить билет / зарегистрироваться&nbsp;<br><br>C картами Highway Family вход свободный.</p>',1000,'',2,36,1,'https://www.highwayevent.ru','https://ucare.timepad.ru/6d793906-bd53-4050-90ea-ecc8a1dc26a0/-/preview/1248x1248/-/format/jpeg/poster_event_2392771.jpg',false,false,NULL,NULL,'2023-04-19 23:11:12','2023-10-22 13:43:37',NULL,'','0',18,50),
	 (733,'ГАЛЕРЕЯ х НЕЙРОСЕТИ','2023-04-29-gazgolder-galereia-x-neiroseti','2023-04-29',NULL,'22:00:00',NULL,'<p>Современное искусство приобретает разные и порой причудливые формы. Нам интересно сравнить на контрасте: как образы транслируются в картины человеком и как искусcтвенным интеллектом. У вас будет великолепная возможность вплотную приблизиться сразу к двум этим мирам в течении ночи.<br>+ AI Photobooth<br>+ Special Artworks<br>+ Installations<br>+ Performances<br>+ Visual Acts<br><br></p>',1000,'',2,35,1,'https://budi.timepad.ru/event/2394666/','',false,false,NULL,NULL,'2023-04-19 23:19:47','2023-10-12 20:32:41',NULL,'','0',18,35),
	 (734,'ШУМ','2023-04-21-supermetall-sum','2023-04-21','2023-04-23','16:00:00','21:00:00','<p>ШУМ — трехдневное событие, посвященное современному искусству.<br>Хэдланеры выставки: Антон Рева, Ники Зимой, Миша Мост, Зачем, Magu, Илья Sar, Shozy, Игорь Клепнев, Александр Кипсоне.<br>&nbsp;Художники самостоятельно прибудут на выставку и лично представят свои работы гостями и участникам.<br><br>Пятница – закрытый показ экспозиций, аукцион, вечеринка на подземном паркинге.<br>Суббота – техно вечеринка<br>Воскресенье – lite-версия экспозиции: бесплатный вход для студентов в рамках коллаборации с креативными учебными заведениями.</p><p>&nbsp;Во внутреннем дворике будет расположен полноценный фуд-корт, а в зоне маркета каждый желающий сможет сделать шелкографию с принтом от художника Ильи Sar.</p>',1500,'',2,119,3,'https://radio-event.timepad.ru/event/2389739/','',false,false,NULL,NULL,'2023-04-19 23:30:44','2023-10-24 21:20:20',NULL,'','0',18,59),
	 (735,'Вечеринка под художественным руководством Яны Кедриной','2023-04-22-prostranstvo-pole-vecerinka-pod-xudozes','2023-04-22',NULL,'22:00:00',NULL,'<p>&nbsp; Столичная электронщица Яна Кедрина, она же Kedr Livanskiy, организует собственную вечеринку в «поле».&nbsp;<br><br>Вход до 23:00 — свободный, после 23:00 — 600 ₽, после 00:00 — 800 ₽.&nbsp;</p>',0,'800.0',2,46,1,'','https://t.me/eto_polye/1410',false,false,NULL,NULL,'2023-04-19 23:35:35','2023-09-28 12:51:05',NULL,'','0',18,72),
	 (736,'Night Soul','2023-04-29-sandboxmusicroom-night-soul','2023-04-29','2023-04-30','19:00:00','06:00:00','<p>Приглашаем окунуться в мир техно музыки и ощутить ее настоящую силу.<br>Захватывающая атмосфера и качественное оборудование с глубоким звуком<br>Мультиформат от наших любимых промо питерского андеграунда<br>TEADRUNKS - Китайская церемония от Чайных пьяниц Санкт-Петербурга<br>Габа / Шу / Цзинь Xao / Шуй Сянь&nbsp;<br>Пуэр каждому всю ночь!<br><br>Музыкальная эстетика: выставка современного и поп-арт искусства.<br>С продажей некоторых лотов.</p>',0,'350.0',1,110,1,'','https://vk.com/n1ght_s0ul',false,false,NULL,NULL,'2023-04-20 00:01:52','2023-10-24 02:50:20',NULL,'','0',18,47),
	 (737,'САНАТОРИЙ РАДУГА','2023-04-22-blanc-sanatorii-raduga','2023-04-22',NULL,'18:00:00',NULL,'<p>&nbsp;Идеальная тусовка для размеренного весеннего чилла от диско-клуба «Радуга». Она начнется в переднем дворе бара «Бланк», а продолжится внутри локации.&nbsp;<br><a href="https://radugadiscoclub.ru/e220423">по регистрации</a> до 21:00 — бесплатно, после 21:00 — 1000 ₽. Cash only</p>',0,'1000.0',2,36,1,'','https://t.me/radugasuperclub/5185',false,false,NULL,NULL,'2023-04-20 00:07:47','2023-10-25 16:01:09',NULL,'','0',18,74),
	 (738,'SAMOVAR','2023-04-22-gazgolder-samovar','2023-04-22',NULL,'23:00:00',NULL,'<p>22 fghtkz - весенние танцы в Gazgolder club. Вас ждет теплая компания друзей и резидентов лейбла, которые знают, как порадовать танцпол в любое время ночи и утра.<br><br></p>',1000,'',2,35,1,'https://samovar008.ticketscloud.org/','https://t.me/Gaztelegram/3889',false,false,NULL,NULL,'2023-04-20 00:12:34','2023-09-28 07:32:20',NULL,'','0',18,30),
	 (739,' ÇAVA BOHEMIANS','2023-04-22-zavod-im-stepana-razina-cava-bohemian','2023-04-22',NULL,'22:00:00',NULL,'<p>Погружение танцующих в мир роскоши и костюмерной феерии на одну апрельскую субботу.&nbsp;<br>Поп-ап бары в стильке районов Нью-Йорка, например, Чайнатаун или Литл Итали. Виниловый магазин, галерея, фотокомната, коридор психоделик рока и другие секретные локации для ваших кайфариков.<br><br>DC: гламурная утонченность и первобытный гедонизм в духе Нью-Йорка 70-ых и 80ых.</p>',1399,'',1,154,1,'https://cava.ticketscloud.org/','https://t.me/cavaprivatechanel',false,false,NULL,NULL,'2023-04-20 00:24:10','2023-10-24 22:06:02',NULL,'','0',18,83),
	 (740,'We Love Drum''n''Bass Rave Гравитация','2023-04-22-aurora-hall-we-love-drumnbass-rave-gr','2023-04-22','2023-04-23','23:00:00','06:00:00','<p>Встречайте новый эпизод фестиваля We Love Drum &amp; Bass! На этот раз мы отправимся на планету ломаных ритмов, чтобы испытать силу и мощь музыкального притяжения.<br>22 апреля мы приглашаем всех рейверов и поклонников ломаных ритмов стать частью новой космической постановки под сводами концертного зала «Аврора».</p><p>50 кВ звука / Световое лазерное шоу / 100% DNB</p><p>Садись с нами в ракету, мы летим на Drum &amp; Bass планету!&nbsp;</p>',1200,'',1,25,1,'https://welovednb.timepad.ru/','',false,false,NULL,NULL,'2023-04-20 01:01:42','2023-09-25 10:50:44',NULL,'','0',18,68);
