	 (741,'Количество Тепла','2023-04-22-solaris-lab-kolicestvo-tepla','2023-04-22',NULL,'23:00:00',NULL,'<p>В субботу Svoi Community приглашают подняться на уровень 11-го этажа для танцев с ночным&nbsp; видом на любимый город!<br>Диско шар и все свои.</p>',700,'800.0',1,106,1,'https://spb.qtickets.events/69905-kolichestvo-tepla','',false,false,NULL,NULL,'2023-04-20 01:16:59','2023-10-24 02:48:31',NULL,'','0',18,54),
	 (742,'VNVNC - 22 апреля','2023-04-22-vnvnc-concert-hall-vnvnc-22-aprelia','2023-04-22',NULL,'22:00:00',NULL,'<p>VNVNC, виновница, винка, концерт-холл, кх<br>Как не называй, содержимое не изменится<br>Всё тот же вайб, та же музыка и танцы<br>Мы будем кем захочешь для тебя в эту ночь</p>',NULL,'500.0',1,50,1,'','',false,false,NULL,NULL,'2023-04-20 01:37:23','2023-09-18 11:04:33',64406,'','0',18,17),
	 (743,'VNVNC - 21 апреля','2023-04-21-vnvnc-concert-hall-vnvnc-21-aprelia','2023-04-21',NULL,'23:00:00',NULL,'<p>Всё вкусное, и вечеринка вкусная<br>Это как про нас сказали<br>От кухни до вкусных сетов&nbsp;(и мы не про роллы)<br>Приходи и убедись сам<br>Встретимся на нашем месте</p>',NULL,'500.0',1,50,1,'','',false,false,NULL,NULL,'2023-04-20 01:45:27','2023-10-09 22:55:33',64406,'','0',18,85),
	 (744,'Salute Honey','2023-04-22-union-salute-honey','2023-04-22',NULL,'22:00:00',NULL,'<p>В эту субботу Salute Honey и их друзья покажут новый уровень коннекта. В их сетах будут ваши мысли: присылайте в директ девчонкам аудиосообщения и они наполнят музыку новыми смыслами. Будьте искренними — иначе всё это зря</p>',0,'400.0',1,8,1,'','https://t.me/salutehoney',false,false,NULL,NULL,'2023-04-20 01:54:10','2023-10-16 23:15:31',NULL,'','0',18,61),
	 (745,'The Oriental Tales','2023-04-29-treff8-club-the-oriental-tales','2023-04-29',NULL,'23:00:00',NULL,'<p>29 апреля клуб Treff8 превращается на одну ночь в волшебные сады Вавилона. Встречаем впервые в России The Oriental Tales и СУПЕР таланта из Израиля - Bemet Beyorker. Отмечайте и сохраняйте дату в календаре потому, что ночь обещает быть очень насыщенной и жаркой!<br>Будьте готовы к необычному представлению, которое сочетает в себе завораживающий темный и воодушевляющий восточный хаффл с мелодичным техно, имеющими эйфорический и мистический оттенок. Короче говоря.. Давайте завершим месяц дикими танцами!</p><p>Приобретайте билеты заранее!<br><br>FC/DC: Casual, Vostok</p>',1000,'1500.0',2,84,1,'https://treff8.timepad.ru/event/2395166/','',false,false,NULL,NULL,'2023-04-20 02:27:36','2023-09-18 10:15:37',NULL,'','0',18,26),
	 (754,'House Culture','2023-04-21-restobar-matiss-house-culture','2023-04-21',NULL,'20:00:00',NULL,'<p>В ближайшие выходные рестобар Matisse приглашает культурно и со вкусом провести свой вечер в стенах музыкального заведения.&nbsp;<br><br>В пятницу ожидается мини вечеринка House Cultura, на которой будут раздвинуты столы и планируются легкие танцы под классику хауса и брокен бит сеты от диджеев</p>',NULL,'0.0',1,159,1,'','',false,false,NULL,NULL,'2023-04-20 19:19:01','2023-10-25 11:29:50',NULL,'','0',18,37),
	 (746,'Cosmotrance VI','2023-04-28-live-story-cosmotrance-vi','2023-04-28',NULL,'23:45:00',NULL,'<p>Raver, Cosmotrance и Novodance, рады представить шестую часть psychedelic trance мероприятий, с уклоном в космическую и UFO тематику, с охватом разных жанров psytrance музыки на двух танцполах в центре города!<br>Вас ожидают специальные декорации, которые создадут атмосферу неонового футуризма.<br>400 - предпродажа билетов, с 17 апреля<br>500 - с репостом этого поста<br>600 - без внимания к мероприятию<br><br>Бесплатно - людям, одетым полностью кроме обуви, в одежду салатового, оранжевого или красного цветов. А так же тем, у кого 28 и 29 апреля ДР.</p>',400,'',2,16,1,'https://www.raver.timepad.ru/event/2395804/','https://vk.com/club219496182',false,false,NULL,NULL,'2023-04-20 02:44:28','2023-10-19 08:22:03',NULL,'','0',18,56),
	 (747,'Applique TB-303','2023-04-28-gazgolder-applique-tb-303','2023-04-28',NULL,'23:00:00',NULL,'<p>Applique возвращается со своим легендарным звучанием.<br>Синтезатор Applique реализует аддитивный и субтрактивный типы синтеза. Главная особенность данной категории заключается в том, что для генерации и обработки звука используются физические процессы, протекающие в электрических цепях.<br>Всеми известный гипнотизирующий фирменный звук TB-303, лучше всего воспринимается в темных заполненных аудиториях Газгольдера с большими аудиосистемами.<br>На протяжении 6 лет Applique TB-303 стал одним из основных инструментов в House и Acid музыке столичной сцены, получив культовый статус.</p>',1500,'',2,35,1,'https://applique.ticketscloud.org/','',false,false,NULL,NULL,'2023-04-20 02:54:49','2023-09-28 14:10:57',NULL,'','0',18,46),
	 (748,'SUNDAY COMA','2023-04-23-purpur-sunday-coma','2023-04-23','2023-04-24','23:59:00','09:00:00','<p>ВЕСЕННЯЯ ПУШКА!<br><br>SUNDAY COMA вместе с горяченькими, только что вернувшимися из ГОА, Смитом, Гайданой и Гарри; гостем из солнечного Крыма&nbsp; - мсье Маргаряном;&nbsp;<br>и техно-папой из ЕКБ - Колмаковым!&nbsp;<br>И я, ваш Тимас.<br><br></p>',NULL,'0.0',2,157,1,'','',false,false,NULL,NULL,'2023-04-20 18:26:55','2023-10-24 22:34:33',NULL,'','0',18,33),
	 (749,'Bassmatic Box','2023-04-28-soho-rooms-bassmatic-box','2023-04-28',NULL,'22:00:00',NULL,'<p>Отгремев в Gazgolder’е, серия вечеринок Bassmatic Box продолжает своё шествие по знаковым площадкам столицы!<br>На очереди ещё одно историческое место - легендарный мистический старинный особняк на Саввинской набережной Москвы-реки.<br>Уникальное пространство по своей архитектуре, богатому внутреннему убранству и своей истории станет очередным украшением в послужном списке вечеринок лейбла Bassmatic Records и мест, где вы вместе с сотнями других любителей музыки сольетесь в электронном экстазе и создадите отпечаток в истории ночной жизни столицы!</p>',1990,'',2,158,1,'https://bassmaticrecords.com/#b2850','https://bassmaticrecords.com/',false,false,NULL,NULL,'2023-04-20 18:52:13','2023-10-15 22:27:59',NULL,'','0',18,57);
