	 (751,'Котельная','2023-04-22-bar-kotelnaia-kotelnaia','2023-04-22',NULL,NULL,NULL,'<p>Луна, дёргая за поводья горящей ночи, отправляет нас в мир, где жизнь распахивает в нас давно утерянное чувство сплоченности и счастья. Наслаждаясь друг другом и музыкой, мы взрываемся звездопадами, освещая всё вокруг людям.<br>100% вход с <a href="https://kotelnayabar.ru/ktln">регистрацией</a>&nbsp;</p>',NULL,'',2,137,1,'https://kotelnayabar.ru/ktln','',false,false,NULL,NULL,'2023-04-20 19:01:52','2023-09-19 17:38:05',NULL,'','0',18,45),
	 (752,'RESONANCE MOSCOW: 8 YEARS','2023-05-13-prostranstvo-pole-resonance-moscow-8-y','2023-05-13',NULL,NULL,NULL,'<p>В этом году Резонанс празднует свой день рождения в большой разношёрстной компании, с такими же разносторонними активностями.<br><br>• Главная точка соприкосновения Резонанса — беспрерывный рэйв от наших ближайших коллег по цеху.<br><br>• Громкий хип-хоп стэйдж с артистами от наших партнеров Studio 21.<br><br>• На одной из сцен состоится образовательная программа от наших дорогих коллег из Moscow Music School.<br><br>Музыка Дело Чести</p>',800,'',2,46,1,'https://bit.ly/resonancemoscow_8years','',false,false,NULL,NULL,'2023-04-20 19:09:55','2023-10-25 04:19:06',NULL,'','0',18,198),
	 (753,'Community: Nikola Melnikov. All Night Long ','2023-04-21-community-moscow-community-nikola-meln','2023-04-21',NULL,'23:00:00',NULL,'<p>Прямиком из джунглей, напитавшийся теплом и колоритом острова - Nikola Melnikov везет в Москву очень много красивой танцевальной электроники.<br><br>На всю ночь вы станете участниками невероятно мелодичного и в то же время динамичного приключения в необъяснимый, но такой гипнотизирующий мир музыки под руководством музыкального гения Николы!&nbsp;<br><br>Welcome back from the jungle!&nbsp;</p>',1500,'',2,58,1,'http://communitymoscow.ru/nikolamelnikov','',false,false,NULL,NULL,'2023-04-20 19:13:27','2023-10-20 13:32:58',NULL,'','0',18,90),
	 (775,'Avatar Party','2023-04-30-warpp-avatar-party','2023-04-30',NULL,'22:00:00',NULL,'<p>Флуоресцентный декор в стиле AVATAR,<br>Художники (раскрасят вас флуоресцентым аквагримом), DJ в образах, проф.фото/видеографы,световое шоу,бар и кухня ,чилл VIP зона на 1 и 2 этаже.</p>',1500,'',1,23,1,'https://light-fluor-dance.timepad.ru/event/2393869/','',false,false,NULL,NULL,'2023-04-26 13:30:06','2023-10-22 09:32:59',NULL,'','0',18,57),
	 (755,'Primat','2023-04-22-restobar-matiss-primat','2023-04-22',NULL,'20:00:00',NULL,'<p>В ближайшие выходные рестобар Matisse приглашает культурно и со вкусом провести свой вечер в стенах музыкального заведения.&nbsp;<br>В субботу в гостях заслуженный мастер виниловых и студийных дел петербургской хаус-сцены — Андрей ПРИМАТ&nbsp;<br><br>Начало в 20:00<br>Вход свободный!</p>',NULL,'0.0',1,159,1,'','',false,false,NULL,NULL,'2023-04-20 19:22:32','2023-10-24 20:59:41',NULL,'','0',18,28),
