	 (757,'Sex Machine','2023-04-21-kruzok-sex-machine','2023-04-21',NULL,'21:00:00',NULL,'<p>Вход: до 00:00 — бесплатно c репостом афиши мероприятия* / после 00:00 — 200₽ с репостом* / 300₽ — без репоста<br>*Репост необходимо сделать не позднее, чем за час до начала мероприятия</p>',0,'300.0',1,11,1,'','',false,false,NULL,NULL,'2023-04-20 19:39:12','2023-09-30 03:28:25',NULL,'','0',18,20),
	 (758,'Козырные Тузы','2023-04-22-kruzok-kozyrnye-tuzy','2023-04-22',NULL,'21:00:00',NULL,'<p>Вход: до 00:00 — бесплатно c репостом афиши мероприятия* / после 00:00 — 200₽ с репостом* / 300₽ — без репоста<br>*Репост необходимо сделать не позднее, чем за час до начала мероприятия в инсте или вк</p>',0,'300.0',1,11,1,'','',false,false,NULL,NULL,'2023-04-20 19:45:03','2023-10-22 13:09:43',NULL,'','0',18,53),
	 (1045,'House Grooves','2023-06-08-propaganda-house-grooves','2023-06-08',NULL,'23:55:00',NULL,'<p>Четверг пройдет под грувовые хаус-ритмы локальных диджеев, а курирует ночь Ofthesun — диджей, танцор и резидент творческой группировки TRD.</p>',NULL,'0.0',2,101,1,'','https://t.me/propagandamoscow',false,false,NULL,NULL,'2023-06-08 16:26:24','2023-10-06 03:57:57',NULL,'','0',18,27);
