	 (759,'Noir Bazaar','2023-04-22-powerhouse-noir-bazaar','2023-04-22',NULL,'23:00:00',NULL,'<p>Обводим дату в календаре, тщательно высыпаемся и выбираем свой лучший наряд — чтобы ловить двусмысленные взгляды и кружиться в экстатических танцах под мистически–ориентальные напевы. Да, мы вновь ждем вас на Нуар Базаре: будем удивлять музыкой, фирменными настойками, таро–раскладами и новыми приятными знакомствами. Как и всегда здесь все свои. Не хватает только вас. Придете?<br><br>Увидимся в эту субботу. Начало в 23:00. Вход — донейшен. Платите столько, сколько посчитаете нужным.</p>',NULL,'',2,5,1,'','',false,false,NULL,NULL,'2023-04-20 19:51:19','2023-10-25 17:35:48',NULL,'','0',18,92),
	 (760,'Le Club - REPTILOID','2023-04-22-miraz-le-club-reptiloid','2023-04-22',NULL,'00:00:00',NULL,'<p>всё, что может быть в планах на ночь субботы - здесь&nbsp;<br><br>к нам приезжает играть REPTILOID с жесточайшим сэтом и если этой информации вам недостаточно, то да, блудный сын SND тоже проведёт эту ночь с вами, итак, полный лайн-ап</p>',NULL,'1000.0',1,77,1,'','',false,false,NULL,NULL,'2023-04-20 19:56:57','2023-10-24 21:05:01',NULL,'','0',18,47),
