	 (762,'80s prom night','2023-04-22-motyga-80s-prom-night','2023-04-22',NULL,'20:00:00',NULL,'<p>вечеринка для тех, кто пропустил свой выпускной в старшей школе в 1986-м. Кассета Кейт Буш, неоновый лоск и... очень много лака для волос.<br><br>Доступные аудиоудовольствия 80х из арсенала диск-жокеев. В эту ночь мы приоткроем завесу тайны, расскажем, как провел выходные Феррис Бьюллер, кто убил Лору Палмер и как не пожертвовать субботним вечером ради клуба Завтрак. А за наслаждение эпохой глянца отвечают особые гости – группа Skerries с специальным лайвом только для нашей вечеринки!<br>Свободный вход!</p>',NULL,'0.0',2,114,1,'','',false,false,NULL,NULL,'2023-04-20 20:07:23','2023-10-19 20:44:30',NULL,'','0',18,46),
	 (763,'Alexey Romeo','2023-04-29-barashki-alexey-romeo','2023-04-29',NULL,'23:00:00',NULL,'<p>29 апреля BARASHKI будут работать вплоть до 5 утра, а хедлайнером вечера станет один из самых востребованных и популярных диджеев России – Alexey Romeo! Ведущий собственного шоу White Knight на радио Megapolis FM Москва встанет за пульт ровно в полночь и отыграет чумовой двухчасовой сет<br>Столик можно забронировать при условии внесения депозита&nbsp;<br>(депозит 3000/4000 на гостя, в зависимости от расположения столика)&nbsp;<br>Без предоставления столика вход свободный.<br><br>Let''s dance!<br><br>Бронь столов по телефону ресторана: +7 812 603 78 62<br><br></p>',NULL,'0.0',1,160,1,'','http://barashkispb.ru/',false,false,NULL,NULL,'2023-04-25 14:33:51','2023-09-27 05:59:25',NULL,'','0',18,26),
