	 (765,'АМУР ТУЖУР: couloirs rouges ','2023-04-28-cult-amur-tuzur-couloirs-rouges','2023-04-28',NULL,'23:45:00',NULL,'<p>Алый неон, экстравагантные одежды, жемчужные украшения, красные губы, секреты и тайны, произнесенные шепотом в коридорах, страстные поцелуи, скрытые от посторонних глаз. В воздухе витают Chanel и Yves Saint Laurent, за баром льются изысканные коктейли, и все сливается в единое полотно под ритмы французской музыки.<br>дресс-код: rouge et noir, струящиеся платья, шелковые рубашки и брюки, перья, блестки, бахрома, береты и шляпы, украшения с жемчугом и кристаллами</p>',400,'',1,92,1,'https://ognivo.timepad.ru/event/2397588/','',false,false,NULL,NULL,'2023-04-25 14:55:30','2023-10-12 20:45:23',NULL,'','0',18,31),
