	 (768,'LEGALNAYA','2023-05-06-volt-legalnaya','2023-05-06',NULL,'22:00:00',NULL,'<p>Спустя почти год, мы возвращаемся в Севкабель Порт. На одну из наших любимых площадок - Вольт<br>Собираем мощный состав друзей, резидентов и гостей из разных уголков страны, чтобы провести нашу самую масштабную и красивую вечеринку в этом сезоне&nbsp;<br>Полюбившуюся всем световую инсталляцию, дополнит самая большая зеркальная сфера в городе, а точками притяжения станут - зоны тотального взаимодействия. Art Area под кураторством художника Виктора Забуги, а прямо на танцполе будет возведена Fake Wedding Station!? <br>Все что было на Легальной, останется на Легальной<br><br>По всем канонам не обойдется без секретного гостя, обновлений в лайн-апе и прочих приятных апдейтов, о которых расскажем чуть позже. Просто оставайтесь на связи</p>',900,'',1,162,1,'https://spb.ticketland.ru/drugoe/sevkabel-port/koncert-legalnaya/20230506_2200-4813781/','',false,false,NULL,NULL,'2023-04-25 15:31:06','2023-10-25 12:28:09',NULL,'','0',18,70),
