	 (774,'DEEPER INTO THE MUSIC Matthias Meyer','2023-04-29-buddha-bar-deeper-into-the-music-matthi','2023-04-29',NULL,'22:00:00',NULL,'<p>Buddha-Bar совместно с новой event-компанией Deeper совершили прорыв в музыкальной индустрии. Впервые за три года Санкт-Петербург встречает лучших музыкальных исполнителей электронной музыки из Европы!</p><p>29 апреля серию легендарных электронных мероприятий откроет хедлайнер Matthias Meyer — ключевой исполнитель лейбла Watergate из Германии.&nbsp;</p><p>&nbsp;</p>',1800,'',1,38,1,'https://w-agency.timepad.ru/event/2395698/','',false,false,NULL,NULL,'2023-04-26 13:17:39','2023-09-27 23:51:46',NULL,'','0',18,48),
