	 (778,'Pioneer Party','2023-05-06-smolla-hall-pioneer-party','2023-05-06',NULL,'23:55:00',NULL,'<p>Признавайтесь, вам тоже нравятся девочки в красных галстуках?)<br><br>Тогда ждём вас на Pioneer party!<br><br>— Танцы до упаду всю ночь&nbsp;</p><p>— Бар по доступным ценам&nbsp;</p><p>— Розыгрыши от организаторов&nbsp;</p><p>— Талантливые диджеи&nbsp;</p>',400,'',1,163,1,'https://aerotusa.timepad.ru/event/2404626/','',false,false,NULL,NULL,'2023-04-26 14:01:36','2023-10-23 05:53:42',NULL,'','0',18,64);
