	 (794,'Nikita Zabelin: Tesla','2023-05-12-mutabor-nikita-zabelin-tesla','2023-05-12','2023-05-13','19:00:00','23:00:00','<p>Никита Забелин возвращается на мейн с большим вечерним перформансом TESLA, получившим название по имени изобретателя "аппарата для производства электрических токов высокой частоты и потенциала". Восемь катушек Тесла, принцип работы которых основан на использовании резонансных электромагнитных волн, будут установлены на главной сцене. Во время шоу устройства будут контролируемо генерировать гигантские молнии.</p>',1700,'',2,2,1,'https://mutabor.club/tesla/?fbclid=IwAR0aC9cVVcDJpMxzgRW_pS7SnSpTij-YzuIHhdAVBN3lZoTxgrwudtCVLlI','',false,false,NULL,NULL,'2023-04-26 15:26:53','2023-10-18 13:23:00',NULL,'','0',18,98),
	 (1070,'China Town','2023-06-18-propaganda-china-town','2023-06-18',NULL,'23:00:00',NULL,'<p>China Town — классическая воскресная вечеринка с позитивной электроникой.</p>',NULL,'',2,101,1,'','https://t.me/propagandamoscow',false,false,NULL,NULL,'2023-06-14 12:30:51','2023-10-23 22:23:57',NULL,'','0',18,115),
	 (779,'Symbiosis Party','2023-04-29-symbiosis-party','2023-04-29',NULL,'21:00:00',NULL,'<p>Хола, представители человечества!!!</p><p>Предлагаем вашему вниманию большое событие в мире искусства и клубной жизни Санкт-Петербурга!<br><br>Команда https://vk.com/grown.underground поставила перед собой амбициозную задачу – представить посетителям невероятный Симбио3 современной живописи, танцев, мультипликации, танцевальной музыки и других видов искусств под одной крышей.<br><br>На территории Арт-центра Сергиенко , мы устроим шоу которое ещё долго будет будоражить умы и пробуждать приятные воспоминания. Несколько залов арт-центра будут наполнены концептуальной электронной музыкой, полотнами известных современных художников-новаторов. Перед гостями выступит танцевальный коллектив, который представит новый взгляд на танцы, под нашумевшие в своё время клубные хиты мирового уровня.<br><br>Вас ждёт теплая и уютная атмосфера в Lounge и VIP залах. Для вашего комфорта на мероприятии будут работать бар и кухня. А различные интерактивные действа доставят удовольствие у будут радовать вас на этом незабываемом событии!<br><br>Билеты лучше приобрести заранее, на входе будет гораздо дороже!<br>Резерв столов в Lounge и VIP зоне по телефону +7(952) 273-43-84 (WhatsApp/Telegram)</p><p>Для гостей в VIP зале будет доступно:<br>- тихая зона вдали от суеты и шума, где можно будет отдохнуть и набраться сил;<br>- фруктовое угощение;<br>- бесплатный коктейль от наших барменов;<br>- бесплатное посещение Арт-тира, где вы сможете исполнить свой уникальный шедевр.</p><p>Для гостей зарезервировавших стол в Lounge зоне:<br>- место для отдыха в окружении превосходных образчиков современного искусства;<br>- welcome drink.<br><br>Цена билетов на входе:<br>до 23:00 - 1000 р/чел<br>после 23:00 - 1500 р/чел<br><br><strong>МЕСТО</strong></p><p>Пеньковая, 8/6В (вход со стороны набережной)</p>',1000,'1500.0',1,NULL,1,'https://www.grown-underground.timepad.ru/event/2362413/','https://vk.com/symbiosis_party',false,false,NULL,NULL,'2023-04-26 14:08:49','2023-10-24 20:59:53',NULL,'','0',18,51),
	 (780,'In Beat We Trust','2023-04-29-sound-in-beat-we-trust','2023-04-29',NULL,'22:00:00',NULL,'<p>Начиная с 2000 года слоган In Beat We Trust закрепился в сознании любителей электронной музыки и до сих пор ассоциируется с ломаными ритмами и самой известной в России промо-группой.<br>Пропагандируя ломаные ритмы, In Beat We Trust внесли неизмеримый вклад в развитие российской танцевальной культуры, заручились поддержкой колоссального количества поклонников как на территории России, так и за рубежом, а собственный музыкальный лейбл, стартовавший в 2009 году, добавил многогранности и разнообразия направлениям деятельности всей команды, поспособствовав выходу на мировую арену творений отечественных музыкантов и заручившись крепкой поддержкой именитых мировых диджеев и продюсеров.</p>',1100,'',1,44,1,'https://gorodzovet.ru/spb/in-beat-we-trust-event9512640','',false,false,NULL,NULL,'2023-04-26 14:19:05','2023-10-10 15:32:08',NULL,'','0',18,47),
	 (781,'INSPIRATION','2023-05-06-tommy-lee-inspiration','2023-05-06',NULL,'21:00:00',NULL,'<p>Dj’s в образах,музыканты, фото/видеографы, художницы аквагрим, бьюти зона, световое шоу,оригинальные образы гостей и многое другое!</p><p>В эту ночь вас ждёт музыка в энергичном исполнении от Vozhd, Turuk, Van Raven, Flauns, Rubikon, Katrina Killer , Ten G, Сosmic.</p><p>(Progressive, Breaks,Melodic Techno, Afro House)</p><p><br></p><p>Сказочный портал , где Фантазии сотрут границы реальности и изменят ваше сознание навсегда! Тебя ждут приключения в лабиринтах времени, возможность показать свою истинную сущность или наоборот, скрыть её за маской от всего мира, долгожданные встречи с родственными душами , знакомства в укромных уголках других измерений, бьющая через край энергия любви, счастья, созидания, свободы, перерождения и трансформации…</p>',1500,'2000.0',1,83,1,'https://light-fluor-dance.timepad.ru/event/2399050/','',false,false,NULL,NULL,'2023-04-26 14:25:08','2023-10-22 08:20:28',NULL,'','0',18,31),
	 (782,'Genesis','2023-05-06-garaz-elektropole','2023-05-06',NULL,'18:00:00',NULL,'<p>Отличный препати&nbsp; с 21:00 для тех, кто потом собирается во все тяжкие, а для тех, кто остаётся с нами предложим ближе к ночи высокоскоростной транс.</p>',300,'',2,156,1,'','http://garageclub.ru/',false,false,NULL,NULL,'2023-04-26 14:31:48','2023-10-23 11:41:37',NULL,'','0',18,66),
	 (783,'High Resistance','2023-04-28-16-tonn-high-resistance-1','2023-04-28',NULL,'23:55:00',NULL,'<p>Продолжение серии Drum&amp; Bass вечеринок от лейбла High Resistance, где выступят его передовые артисты.<br>High Resistance — это объединение музыкантов, промоутеров и любителей Drum and Bass из Вологды, которое переросло в музыкальный лейбл, выпускающий музыкантов со всего мира. С 2019 года мы выпускаем музыку и делаем для вас вечеринки, после которых тяжело устоять на ногах. Мы рады представить вам наше первое мероприятие в Москве, которое пройдет уже совсем скоро.</p>',500,'700.0',2,29,1,'https://gorodzovet.ru/moskva/high-resistance-event9556164','',false,false,NULL,NULL,'2023-04-26 14:36:50','2023-10-02 03:58:43',NULL,'','0',18,25),
	 (793,'Skydreamers','2023-04-29-miks-afterparty-skydreamers','2023-04-29',NULL,'23:59:00',NULL,'<p>Если море волнуется без вас, самое время прибыть на нашу вечеринку.<br>Отмечаем день рождения Elya Leto. Новый год всегда меняет планы, цели, рубежи, амбиции и мечты. Пусть все сбудется. Коллаборация команд Asia Experience и 7th Heaven, как согревающий намёк, на то что море рядом. Добавят ветра вашим парусам: стильные интерьеры, маркет и лучшие диджеи<br>Гостям из списков - карта на 1000 ₽ на бар до 3 ночи.<br>Вход для девушек бесплатный. Парни 1000 ₽.</p>',1000,'',2,133,1,'','',false,false,NULL,NULL,'2023-04-26 15:23:15','2023-10-22 05:24:04',NULL,'','0',18,38),
	 (795,'ПРОБУДДИСЬ','2023-04-28-zoccolo-20-probuddis','2023-04-28',NULL,'23:00:00',NULL,'<p>Пробуддись на уютной вечеринке тёплой весенней ночью с 28 на 29 апреля&nbsp;<br>Приходите поздравить с Днем Рождения несравненную Хайтечайлд и насладиться атмосферой дарка и хайтека с примесью легкого псайтранса.</p>',350,'500.0',1,72,1,'https://rupor.biz/widgets/event-tickets/832','',false,false,NULL,NULL,'2023-04-27 13:55:30','2023-10-16 16:22:53',NULL,'','0',18,63),
	 (784,'Void Fest','2023-04-29-urban-void-fest-1','2023-04-29',NULL,'22:00:00',NULL,'<p>Мультижанровый фестиваль электронной музыки Void Fest.<br>Клуб вмещает всего 1000 гостей, поэтому рекомендуем покупать билеты заранее, чтобы гарантировано попасть на фестиваль!<br>Категории билетов:<br>Танцпол — входной билет<br>VIP входной — отдельный вход, доступ на танцпол и в VIP зону с отдельным баром, уборными и лучшим видом на сцену и танцпол. Без места!<br>VIP Light — отдельный вход, доступ на танцпол и в VIP зону на балконе с отдельным баром, уборными и лучшим видом на сцену и танцпол. Закрепляется 1 место!<br>VIP Center стол на 2-х — отдельный вход, доступ на танцпол и в VIP зону на балконе с отдельным баром, уборными и лучшим видом на сцену и танцпол. Закрепляется стол на 2 персоны!<br>VIP ложа балкон — отдельный вход, доступ на танцпол и в VIP зону на балконе с отдельным баром, уборными и лучшим видом на сцену и танцпол. 1 место в отдельной VIP ложе на 12 человек!</p>',1200,'',2,128,1,'https://gorodzovet.ru/moskva/void-fest-event9509184','',false,false,NULL,NULL,'2023-04-26 14:42:40','2023-10-20 12:47:55',NULL,'','0',18,84);
