	 (785,'Burning Series','2023-05-05-16-tonn-burning-series','2023-05-05',NULL,'22:00:00',NULL,'<p>В рамках легендарной drum &amp; bass вечеринки Burning Series, проводимой лейблом Occulti, возвращаются артисты английских и голландских лейблов</p>',600,'',2,29,1,'https://gorodzovet.ru/moskva/burning-series-event9610796','',false,false,NULL,NULL,'2023-04-26 14:45:54','2023-10-22 12:24:02',NULL,'','0',18,77),
	 (786,'Smoky D & Lowriderz','2023-05-09-kitaiskii-letcik-dzao-da-smoky-d-lowr','2023-05-09',NULL,'20:00:00',NULL,'<p>Один из самых именитыx MC России — Smoky D и его верный друг по цеху — продюсер и dj Lowriderz. Smoky D — уникальное явление на отечественной джангл сцене. Его шоу — это быстрый флоу, невероятный вайб и танцы как не в себя. Вместе с Ромой Lowriderz он наполнит этот вечер высококачественным джангл-вайбом.</p>',600,'',2,122,1,'https://gorodzovet.ru/moskva/smoky-d-lowriderz-event9607502','',false,false,NULL,NULL,'2023-04-26 14:48:42','2023-09-19 02:50:37',NULL,'','0',18,41),
	 (787,'Highway Night','2023-04-28-blanc-highway-night-1','2023-04-28','2023-04-29','20:00:00','06:00:00','<p>Весна в самом разгаре, наступает время теплых ночей, террас, уютных двориков и танцев от заката до рассвета в особняке Blanc. 28 апреля мы открываем сезон вместе со специальным гостем – Matthias Meyer.<br>Вход:<br>20.00 — 22.00 FC / вход бесплатный, с предварительной регистрацией (Забронировать)<br>22.00 — 06.00 FC / 21+ / вход по билетам</p>',1000,'',2,36,1,'https://secret420.timepad.ru/event/2392771/#register','',false,false,NULL,NULL,'2023-04-26 14:54:16','2023-10-24 21:31:16',NULL,'','0',18,46),
	 (788,'GROTESQUE','2023-04-28-slezy-grotesque','2023-04-28','2023-04-29','23:00:00','06:00:00','<p>28 апреля AlieNation порадуют всех ценителей настоящего техно. Для нас громить танцполы будут: звезды российского и мирового техно из Казани, чьи треки звучали даже на bbc radio one - дуэт YUNG ACID. Икона российского техно-андерграунда, резидент Рабицы, Арма 17, Мутабора, диджей с удивительным вкусом - HIPUSHIT! Отец российского техно, человек, без которого не обходится ни одно значимое техно событие, он стоит за пультом дольше, чем большинство из вас живут на свете - SLAVA FINIST.</p>',800,'',2,102,1,'https://moscow.qtickets.events/70123-2804-grotesque-at-slozy','https://vk.com/grotesqerave',false,false,NULL,NULL,'2023-04-26 15:03:36','2023-10-23 00:44:04',NULL,'','0',18,48),
	 (789,'Droplex','2023-04-28-treff8-club-droplex','2023-04-28','2023-04-29','23:00:00','07:00:00','<p>28 апреля пройдёт мероприятие в стенах дружественного Treff8 у нам привезут европейского артиста Droplex. Он один из самых успешных продюсеров жанра melodic techno родом из Венгрии. Обладает большим опытом и богатым вкусом в различных жанрах, что позволяет ему подходить к созданию музыки нестандартно и изобретательно.</p>',1500,'',2,84,1,'https://theauraofmusic.timepad.ru/event/2374449/','',false,false,NULL,NULL,'2023-04-26 15:07:45','2023-10-17 16:04:21',NULL,'','0',18,47),
	 (790,'Private Persons','2023-04-29-mutabor-private-persons','2023-04-29','2023-04-30','22:00:00','10:00:00','<p>Приватные персоны опять заставят содрогаться стены Мутабора. Обилие голых торсов и вязанных балаклав обеспечено.</p>',2000,'',2,2,1,'https://privatepersons.net/','',false,false,NULL,NULL,'2023-04-26 15:10:03','2023-10-24 21:11:29',NULL,'','0',18,138),
	 (791,'Синдикат х Loyal х Линда','2023-04-29-bauns-sindikat-x-loyal-x-linda','2023-04-29','2023-04-30','22:30:00','06:00:00','<p>В субботу, 29 апреля, в Баунсе встретимся на масштабном шоукейсе Syndicate и Loyal с двумя танцполами и лайвом Линды. В лайнапе легенды танцполов из двух городов, которые знают своё дело на 1000%. Будет всё: от классики зарубежного рэпа и хип-хопа, до электроники и трип-рока Линды.</p>',1000,'',2,17,1,'https://onlybounce.timepad.ru/event/2395985/?fbclid=PAAabivQkBowYO3qYiTBzTpYi24qMj1KONat5pzDMGYxkT97M33tNDb3l1XNU','',false,false,NULL,NULL,'2023-04-26 15:15:42','2023-10-15 08:47:47',NULL,'','0',18,37),
	 (792,'Synth Party','2023-04-29-live-story-synth-party-1','2023-04-29','2023-04-30','23:30:00','05:00:00','<p>Ночная вечеринка для всех любителей синтезаторной музыки! Танцы до самого утра под лучшие хиты&nbsp;</p>',300,'',2,16,1,'https://moscow.qtickets.events/65626-synth-party-2904-live-story','',false,false,NULL,NULL,'2023-04-26 15:18:59','2023-10-03 16:57:48',NULL,'','0',18,46),
	 (804,'SYGMAS & FRIENDS x SECRETS','2023-04-28-cinist-sygmas-friends-x-secrets','2023-04-28',NULL,'23:30:00',NULL,'<p>SYGMA — ренессанс нашего времени, глоток кислорода для искателей приключений. Клубная культура возрождается, и мы долго этого ждали!<br><br>Раскачивающий хаус-грув и дерзкий хип-хоп вдохновят на танцы и окунут в облако эмоций. SYGMAS &amp; FRIENDS — новый формат жарких пати.<br><br></p>',NULL,'',1,94,1,'https://t.me/dybrov','',false,false,NULL,NULL,'2023-04-27 16:07:54','2023-10-19 22:00:48',NULL,'','0',18,61),
	 (798,'MONASTERIO FACTORY','2023-06-10-mutabor-monasterio-factory','2023-06-10','2023-06-12','22:00:00','06:00:00','<p>Третья глава эпоса MONASTERIO FACTORY ознаменует значимый период жизни промо.&nbsp;<br><br>В этом периоде – четыре стабильно забитых до отказа танцпола на 10-летии, а также европейские гости, которые впервые наблюдая за столь могучей и искренней аудиторией на протяжении 15 часов, в ответ отдают за пультами все силы и умения в оставшиеся 4 часа.&nbsp;<br>Такие эмоции и взаимодействие – суть технорейва, который традиционно наполняет жизнью пространства заводов, ангаров и бункеров, а рейверы готовятся к танцевальным марафонам, как к многочасовым сменам у станка.&nbsp;<br>После двухлетнего перерыва Мона зачинает новую большую смену на заводе, в бесперебойной работе которой будет задействовано более 55-ти артистов всех техно-калибров.</p>',3500,'',2,2,3,'https://monasteriomoscow.timepad.ru/event/2407479/','https://t.me/monasteriomoscow/3396',false,false,NULL,NULL,'2023-04-27 14:40:13','2023-10-23 20:48:47',NULL,'','0',18,328);
