	 (799,'Rampa Trash!','2023-04-28-factory-3-rampa-trash','2023-04-28',NULL,'23:55:00',NULL,'<p>28 апреля в Северной Столице состоится весенний эпизод RAMPA TRASH!&nbsp;<br>Ночь ломаных ритмов с мощным DNB составом пройдет в стенах пространства FACTORY на территории Севкабель Порт.</p>',500,'',1,7,1,'https://spb.qtickets.events/69692-rampa-trash-at-factory','https://vk.com/rampatrash2804',false,false,NULL,NULL,'2023-04-27 14:46:26','2023-10-19 22:53:43',NULL,'','0',18,66),
	 (800,'COLD BEAT FEST','2023-04-29-serdce-cold-beat-fest','2023-04-29','2023-04-30','18:00:00','06:00:00','<p>Мощное индустриальное событие этой весны в северной столице!<br>8 лайвов, 4 диджея, 12 часов непрерывной музыки, разнообразный лайн-ап артистов дарк сцены, никакой тишины и компромиссов!</p>',800,'1200.0',1,6,1,'','https://vk.com/coldbeatfest2023',false,false,NULL,NULL,'2023-04-27 15:11:00','2023-09-18 22:02:04',NULL,'','0',18,36),
	 (801,'RAVERHEAD','2023-04-29-kontrkult-raverhead','2023-04-29',NULL,'23:00:00',NULL,'<p>Команда RAVERHEAD выходит на связь. В эту субботу они планируют разогнать ваши сердечки до 270 ударов в минуту. Разъеб заказан и будет доставлен товарными вагонами. У их резидентов нет совести и жалости: ожидается широкий спектр хардкор-жанров.&nbsp;</p>',500,'',1,33,1,'https://spb.qtickets.events/68651-raverhead','https://linktr.ee/raverhead',false,false,NULL,NULL,'2023-04-27 15:17:04','2023-10-14 02:46:54',NULL,'','0',18,9),
	 (802,'Embargo Night','2023-04-29-community-moscow-embargo-night','2023-04-29',NULL,'23:00:00',NULL,'<p>За последние несколько лет Embargo Villa (Ростов-на-Дону) стала одним из самых известных мест, запускающими знаковые события целой страны! От российских легенд до лучших иностранных имен в мире музыки.<br><br>Embargo Villa - место притяжения меломанов, тусовщиков, любителей электронной музыки. Именно в Embargo проходит самый масштабный танцевальный фестиваль электронной музыки - Trip Music Festival.<br><br></p>',1590,'',2,58,1,'https://embargonight.ticketscloud.org/','',false,false,NULL,NULL,'2023-04-27 15:56:33','2023-10-06 18:41:59',NULL,'','0',18,61),
	 (803,'Space Voyage','2023-05-06-mutabor-space-voyage','2023-05-06',NULL,'23:00:00',NULL,'<p>Счастлив тот человек, который, не боясь ничего, осуществил свою мечту. <br>Моя мечта - космос в реальности, а не по фотографиям и новостям.<br>&nbsp;Звезд много, как и людей. Не являются ли звезды нашим отражением? Space voyage это путешествие, где Каждый человек - звездочка! <br>Я мечтаю собрать всех звездочек воедино, словно пыльцу,&nbsp; и рассыпать, чтобы они&nbsp; светились и блистали, как ночное звездное небо, превозносящее человека над повседневностью, погружая в транс, создавая иллюзию существования вне пространства и времени, за которым скрывается безграничная вселенная.</p>',900,'',2,2,1,'https://spacevoyage.ticketscloud.org/','',false,false,NULL,NULL,'2023-04-27 16:01:23','2023-10-17 11:09:46',NULL,'','0',18,65),
	 (806,'ТЕХНИЧЕСКИЙ ПЕРЕРЫВ','2023-05-05-factory-3-texniceskii-pereryv','2023-05-05','2023-05-06','00:00:00','06:00:00','<p>«Меня зовут Лена Попова, вы находитесь на волнах радио Рекорд и это первая программа из серии Технический Перерыв.» – с этой фразы почти 22 года назад начался отсчет эфиров одного из самых известных радиошоу электронной музыки в России (https://vk.com/popova_texper), гостями которого стало бессчётное количество музыкантов со всех континентов и уголков мира.<br><br>5 мая в технографии Технического Перерыва появится ещё один раздел – одноимённая серия вечеринок, для запуска которого был выбран один из центров притяжения любителей электронной музыки Петербурга – Севкабель Порт, клуб Factory.&nbsp;</p>',400,'',1,7,1,'https://texpereriv.timepad.ru/event/2406375/','',false,false,NULL,NULL,'2023-04-27 17:57:53','2023-10-13 00:25:44',NULL,'','0',18,59),
	 (808,'Радуга х Шува','2023-04-30-blanc-raduga-x-suva','2023-04-30',NULL,NULL,NULL,'<p>Первая летняя Шува тут как тут. Главная фича вечеринки — блок с лайвам, и на этот раз всё особенно мощно<br>Вход по регистрации</p>',NULL,'',2,36,1,'https://radugadiscoclub.ru/e300423','',false,false,NULL,NULL,'2023-04-27 18:28:54','2023-10-07 14:17:20',NULL,'','0',18,67),
	 (809,'Мир Культ Май','2023-04-30-kontrkult-mir-kult-mai','2023-04-30',NULL,'23:00:00',NULL,'<p>Техно-встряска по поводу выходного и первой майской ночи. Приглашаем как порядочно трудящихся, так и менее трудолюбивый пролетариат — фейс контроль для всех одинаковый.&nbsp;<br><br>Вход — 400 до полуночи, 600 — после&nbsp;</p>',400,'600.0',1,33,1,'','https://t.me/kontrkult21',false,false,NULL,NULL,'2023-04-27 18:38:00','2023-10-21 07:54:44',NULL,'','0',18,32),
	 (810,'Electrobudka!','2023-04-28-kontrkult-electrobudka','2023-04-28','2023-04-29','23:00:00','09:00:00','<p>Делимся стилистикой аутфитов к предстоящей пятнице<br>Ждём вас подготовленными, оригинальными, яркими. Вы можете себе позволить все: наряжайтесь стильно, безумно, много одежды, никакой одежды, цепи, кольца, латекс, кожа, твои любимые очки, лютая укладка или стрижка под ноль — круто делайте что угодно, мы вдохновляемся вами.&nbsp;<br><br>Задавайте тон, продумывайте, куражьтесь. На входе строгий FC/DC</p>',500,'',1,33,1,'https://t.me/nasledie_label_bot','',false,false,NULL,NULL,'2023-04-27 18:48:03','2023-10-22 05:14:37',NULL,'','0',18,34),
	 (811,'ТРУД','2023-04-28-prostranstvo-pole-trud','2023-04-28',NULL,'23:00:00',NULL,'<p>&nbsp;Первый за три года концерт андеграундной московской рок-группы «Труд» с презентацией нового EP «8». До и после концерта группу поддержат диджей-сетами&nbsp;</p>',1000,'',2,46,1,'https://trudandfriends.ticketscloud.org/','',false,false,NULL,NULL,'2023-04-27 18:55:36','2023-09-28 12:29:31',NULL,'','0',18,13);
