	 (812,'A Casa','2023-04-28-powerhouse-a-casa','2023-04-28',NULL,'23:00:00',NULL,'<p>&nbsp;Задорная команда A CASA возвращается с новой вечеринкой в «Паверхаус». На этот раз тусовщиков ждет событие с неожиданными бэк-ту-бэками столичных диджеев&nbsp;<br><strong>Стоимость:</strong> донейшн (любая купюра)&nbsp;</p>',NULL,'100.0',2,5,1,'','',false,false,NULL,NULL,'2023-04-27 19:00:09','2023-10-25 11:11:14',NULL,'','0',18,46),
	 (813,'Ohfckparty x Underground g','2023-04-30-prostranstvo-pole-ohfckparty-x-undergro','2023-04-30',NULL,'23:00:00',NULL,'<p>&nbsp;В воскресенье в «поле» зазвучит бойкая электроника вперемешку с хип-хопом. Именно такую музыку будут ставить на тусовке команды ohfckparty в коллаборации с музыкальным уличным проектом Underground G.</p>',100,'',2,46,1,'https://ohfukkug.ticketscloud.org/','https://t.me/eto_polye/1450',false,false,NULL,NULL,'2023-04-28 13:45:47','2023-10-14 17:11:54',NULL,'','0',18,39),
	 (814,'BANG! vol.2','2023-04-30-simach-bang-vol2','2023-04-30',NULL,'22:00:00',NULL,'<p>&nbsp;Московский селектор Lay-Far отмечает день рождения интересной вечеринкой в «Симаче». Интересна она тем, что в лайнапе заявлены известные столичные музыканты: Антоха МС, Директор Всего, группа «Поели», Lovanda и многие другие. Заходите выпить пару коктейлей и покутить в дружеской обстановке.&nbsp;</p>',0,'',2,165,1,'','',false,false,NULL,NULL,'2023-04-28 13:52:17','2023-10-20 09:25:18',NULL,'','0',18,41),
	 (815,'Elephant Trunk','2023-06-03-pravda-elephant-trunk','2023-06-03',NULL,'23:50:00',NULL,'<p>Хэй, Elephant Trunk! 3 июня мы возвращаемся в столицу с нашей новой крышесносной Drum&amp;Bass вечеринкой. Совершенно новое место проведения, 9 разнообразных артистов за одну ночь, световое и лазерное шоу,<br>приятные сюрпризы и многое другое, специально для вас. Устал от рутины и однообразия? Тогда тебе к нам: мы покажем тебе мелодичную, позитивную сторону жанра, наполняющую энергией и неповторимыми эмоциями. Подобно слонам из саванны мы трубим для каменных джунглей! Это - Elephant Trunk! Нас слышно отовсюду.</p>',1800,'',2,20,1,'https://msk.kassir.ru/koncert/klub-pravda/elephant-trunk_2023-06-03','',false,false,NULL,NULL,'2023-04-28 14:05:16','2023-10-24 20:55:29',NULL,'','0',18,250),
	 (816,'ISHOME','2023-07-16-vk-muzyka-summer-stage-ishome','2023-07-16',NULL,'20:00:00',NULL,'<p>Перламутровая электроника и аскетичное техно, невесомый эмбиент-поп и пронзительные цифровые драмы — балансируя между многообразием форм, <strong>Мирабелла Карьянова</strong> успела создать собственный музыкальный язык. Общим знаменателем в этом обилии жанров остаётся врождённая чуткость и филигранность Ishome, благодаря которым её произведения образуют цельное повествование.</p>',1000,'',2,167,2,'https://msk.kassir.ru/koncert/summer-stage/ishome_2023-07-16','',false,false,NULL,NULL,'2023-04-28 14:18:53','2023-10-25 14:33:02',NULL,'','0',18,454),
	 (832,'RESKIDE / Monograph / Аrtarea','2023-05-08-warpp-reskide-monograph-artarea','2023-05-08',NULL,NULL,NULL,'<p>Наши планы на выходные дни!<br>Записаться в списки можно на сайте Резерв столов по телефону 500-09-01</p>',0,'1000.0',1,23,1,'','https://warppclub.com/',false,false,NULL,NULL,'2023-05-04 13:37:40','2023-09-28 01:42:12',NULL,'','0',18,46),
	 (817,'SVOI. CALIFORNIA DREAM','2023-05-06-gazgolder-svoi-california-dream','2023-05-06',NULL,'23:00:00',NULL,'<p>Майские каникулы в Москве!<br>Калифорния - штат на берегу Тихого Океана. Пальмы Волны и вечное лето. Оказаться там мечтает наверно каждый. А что если мы осуществим эту мечту.<br><strong>SVOI </strong>оставили весь серьезный настрой и готовы к теплому сезону вечеринок. Берём только Легкость, Юмор и беззаботный Калифорнийский стиль жизни!<br>Мы ждем эту ночь, чтобы провести её с вами!<br><br>Наши артисты подобрали специальную музыку, а мы специальные декорации для погружения в атмосферу пляжа, солнца и калифорнийского побережья.</p>',1200,'',2,35,1,'https://moscow.qtickets.events/69798-svoi-california-dream','',false,false,NULL,NULL,'2023-04-28 14:26:36','2023-10-23 13:03:26',NULL,'','0',18,70),
	 (825,'Red Sheep','2023-05-06-rndm-red-sheep','2023-05-06',NULL,'23:00:00',NULL,'<p>Команда всегда была поклонниками качественного грува и постоянно находимся в поиске новых имен на локальной электронной сцене. И этот раз не стал исключением!<br><br>Первая половина ночи отдана дебютантам наших вечеринок FLAYM, Stepan Borin и Anton Fedotov.<br><br>Далее по классике резиденты нашего промо в лице A.E с эстетикой 00х, вновь разделят пульт между собой Tashika и Enn Franco, а утро окажется в руках опытного резидента Manifest Lowchord.<br><br></p>',500,'800.0',2,27,1,'https://red-sheep.timepad.ru/event/2406296/','',false,false,NULL,NULL,'2023-05-03 18:48:13','2023-10-21 07:56:14',NULL,'','0',18,68),
	 (818,'MAËWKA','2023-05-06-maewka','2023-05-06','2023-05-09','16:00:00','16:00:00','<p>MAËWKA 2023 — майский музыкальный фестиваль от проекта FUNK&amp;ВЕАТS, который ежегодно проходит на побережье Чёрного моря! Вот уже 7 лет фестиваль является заглавным событием электронной музыки на Юге России. Каждый год сотни тусовщиков из разных уголков нашей страны ждут именно это мероприятие, чтобы ярко встретить начало летнего сезона.<br>• Проезд на комфортабельном автобусе;<br>• Проживание в гостинице 3 дня / 2 ночи;<br>‌• Ранний заезд на курорт;&nbsp;<br>• Завтраки в отеле;&nbsp;<br>‌• Браслет участника «MAЁWKA» со входом на все локации фестиваля;<br>• Концертная программа фестиваля;<br>• Более 30 DJ и live проектов из разных городов России;<br>• Экскурсия в Африканскую деревню;<br>‌• Экскурсия в Замок «Львиная голова»;<br>• Встреча сансета на берегу моря;<br>• Кальяны и чайные церемонии в сhill zone (доп. услуга);<br>• Полное сопровождение кураторами поездки по всем вопросам;<br>• Большой фото и видео отчёт о поездке.</p>',7000,'',15,NULL,3,'','https://maewka.com/',false,false,NULL,NULL,'2023-04-28 14:47:15','2023-10-24 21:56:12',NULL,'','0',18,64),
	 (819,'WALPURGIS','2023-05-05-blank-walpurgis','2023-05-05',NULL,'23:00:00',NULL,'<p>Эпилог иммерсивного фестиваля WALPURGIS выпадет на заключительный день коридора затмений - астрологическое событие, закладывающее тенденции на несколько десятилетий вперед. Посему - предлагаем заложить максимум положительного и зарядиться творческой энергией совместно в стенах Blank 5 мая.</p>',888,'',1,1,1,'https://t.me/WALPURGIS_bot','https://t.me/walpurgis',false,false,NULL,NULL,'2023-05-02 19:09:00','2023-10-20 20:27:30',NULL,'','0',18,50);
INSERT INTO public.events (id,title,slug,start_date,end_date,start_time,end_time,description,price_from,price_gate,city_id,venue_id,event_type_id,tickets_url,info_url,is_cancelled,is_featured,deleted_at,user_id,created_at,updated_at,ticketscloud_event_id,ticketscloud_event_token,ticketscloud_event_multi,age_limit,"views") VALUES
	 (820,'Blank Garden','2023-05-07-blank-blank-garden','2023-05-07',NULL,'23:00:00',NULL,'<p>Терраса открыта, обмыта и безустанно впускает в себя, как нимфоманка. Кто следующий? Blank Garden.<br><br>Blank Garden — это такой «воскресный папа» — приходит когда вздумается, уходит по-английски, оставляет томиться до новой встречи. Год назад навестил лишь однажды, зато теперь Blank Garden — детишкина радость длиной в лето. Лучшая версия школьных каникул, с оговоркой, что в будни нужно пахать.<br><br>Только не в ЭТИ дни. Майские — восхитительный выкидыш производственного календаря. Улицы теплеют, пытаются уволочь к речке, соблазнить мяском, а под конец еще бабахнуть салютом по чайкам. Ну его, звучит как что-то на маньячном.&nbsp;<br><br>Чтобы бесплодно не слить выходные, придерживаемся такой тактики: шатаем террасную доску и греем телесами гримерку. Почти GG.&nbsp;<br><br>Билеты на входе:<br>00:00 - 700₽<br>01:00 - 900₽</p>',700,'900.0',1,1,1,'','',false,false,NULL,NULL,'2023-05-02 19:21:42','2023-10-17 22:23:12',NULL,'','0',18,97),
	 (821,'CWH','2023-05-07-rndm-cwh','2023-05-07','2023-05-08','20:00:00','05:00:00','<p>Вечеринка от ветеранов московского джангл движения Clockworkheads<br>20:00 - 22:00 | Бесплатный вход при условии подписки на <a href="https://t.me/clockworkheads">tg канал</a>, любая сумма - без внимания к мероприятию.<br><br>22:00 - 05:00 | 500 RUR - при условии подписки на tg канал / 700 RUR - без внимания к мероприятию<br><br></p>',0,'700.0',2,27,1,'','https://t.me/clockworkheads',false,false,NULL,NULL,'2023-05-03 18:06:19','2023-10-25 09:49:26',NULL,'','0',18,116),
	 (822,'ALL BLESSED','2023-05-06-griboedov-all-blessed','2023-05-06',NULL,'00:00:00',NULL,'<p>Команда All Blessed снова объединилась с Griboedov Basement.<br><br>Клуб приглашает вас на вечеринку, на которой вы сможете насладиться свежим лайвом от молодого артиста All Blessed - Shellywakeup и отдыхать до утра под селекцию от резидентов и друзей клуба.<br>ВХОД:<br>300 – с репостом.<br>500 – без внимания к мероприятию.</p>',300,'500.0',1,86,1,'','',false,false,NULL,NULL,'2023-05-03 18:20:29','2023-10-22 23:42:11',NULL,'','0',18,69),
	 (823,'KVADRAT','2023-05-05-griboedov-kvadrat','2023-05-05',NULL,'23:00:00',NULL,'<p>KVADRAT — это про улицы.<br><br>Наше сплоченное комьюнити обеспечит отличную возможность для того, чтобы выплеснуть свою энергию, и закончить цикл этой недели на положительной ноте.<br><br>Лайв шоу и арт-интерактивы, общение в кругу друзей, и знакомства с новыми звуками этой ночью не оставят вас равнодушными.<br><br>Приходи, и отдыхай вместе с нами!<br><br>Вход:<br>300 — до 00:00 с репостом<br>400 — с репостом<br>600 — без внимания</p>',300,'600.0',1,86,1,'','https://vk.com/im?w=wall-154594155_17143',false,false,NULL,NULL,'2023-05-03 18:26:19','2023-10-25 14:30:35',NULL,'','0',18,85),
	 (889,'День рождения «Клуба»','2023-05-12-klub-den-rozdeniia-kluba','2023-05-12','2023-05-13','20:00:00','05:00:00','<p>Столичный клуб «Клуб» празднует день рождения и закатывает две вечеринки 12 и 13 мая.</p>',NULL,'0.0',2,173,1,'','',false,false,NULL,NULL,'2023-05-12 12:55:50','2023-10-23 17:41:15',NULL,'','0',18,88),
	 (824,'КОЛЮЧКА','2023-05-07-mutabor-koliucka','2023-05-07','2023-05-08','23:00:00','08:00:00','<p>(µ) — Новые панк вечеринки заряжены сырой энергией Рабицы и JOY. <br>В палитре жанров электронная и гитарная музыка (см. Концерты), хип-хоп.<br><br>Колючка — как старая добрая проклепанная кожаная куртка. <br>Колючка — символ свободы.<br><br>MEDIUM — GARAGE — UNDER<br><br>КОНЦЕРТЫ<br><br>аллочка рубинштейн<br>Выродок<br>Досада<br>Ксюша<br>Линия Бикини<br>Миром правят собаки<br><br>Специальный перформанс<br>Scorpion Queen and NOKIANGEL</p>',1000,'',2,2,1,'https://mutabor.club/kolychka/','',false,false,NULL,NULL,'2023-05-03 18:40:01','2023-10-22 11:47:12',NULL,'','0',18,48),
	 (827,'ВОЗРОЖДЕНИЕ','2023-05-06-reka-oka-vozrozdenie','2023-05-06','2023-05-09','00:00:00',NULL,'<p>Фестиваль танцевальной культуры ВОЗРОЖДЕНИЕ. Серпуховский&nbsp; район. Берег реки Ока.&nbsp;<br>Когда я читаю&nbsp; список артистов, улыбаюсь, и становится тепло на сердце. Многие из них затеяли эту игру много лет назад.&nbsp; Игра превратилась в дело жизни.&nbsp;<br>Они стояли у истоков создания огромного культурного явления в современном искусстве - танцевальной электронной сцены. Маленькие клубы и многотысячные рейвы, сотни городов, вечеринки, фестивали, радиостанции и радиоэфиры - огонь, вода и медные трубы.&nbsp;<br>И пожизненное.&nbsp;<br>Пожизненное погружение в огромный и неиссякаемый мир электронной музыки - музыки очень разной, но несмотря на это - единой в своем предназначении:&nbsp; будить наши души, питать наши умы и согревать наши тела.</p>',3000,'6000.0',2,169,3,'https://pacha-ti.ru/#popup','https://vk.com/vozrozhdeniefest',false,false,NULL,NULL,'2023-05-04 12:40:44','2023-10-17 08:59:18',NULL,'','0',18,61),
	 (828,'ОТКРОВЕНИЯ','2023-05-07-factory-3-otkroveniia','2023-05-07',NULL,'23:55:00',NULL,'<p>7 мая 2023, Санкт-Петербург!<br>Gáte вновь приглашает всех конфидентов, единомышленников и сектантов на юбилейные и самые большие в нашей истории ДЕСЯТЫЕ ОТКРОВЕНИЯ!<br>В ЭТУ НОЧЬ ВАС ЖДЕТ:<br>▼ 2 сцены, Occult x Base<br>▼ 5 привозов с Москвы и Архангельска<br>▼ Digital инсталляция от <a href="https://vk.com/yalkatan">Yalkatan</a> vs <a href="https://vk.com/gate_promo">Gáte</a><br> ▼ Новый и вместительный <a href="https://vk.com/factory3">клуб FACTORY</a><br> ▼ Лайв от художников Gáte<br> ▼ Уникальные стикеры всем вошедшим<br>▼ Художники по свету: увидишь, Yalkatan<br> ▼ Семья <a href="https://vk.com/us_otk">Ø₹ЌРØßξЊψЯ</a> и все наши здесь!<br><br>Стоимость билетов:</p><p>до 1 апреля, 500 р.<br>с 1 апреля до 15 апреля, 700 р.<br>с 15 апреля до 30 апреля, 800 р.<br>с 30 апреля до 6 мая, 900р.<br>7 мая на входе: 1000р.</p>',500,'1000.0',1,7,1,'https://vk.com/@otkr10-kupit-bilet','https://vk.com/otkr10',false,false,NULL,NULL,'2023-05-04 12:58:53','2023-10-18 09:59:25',NULL,'','0',18,23),
	 (829,'Painopticum','2023-05-13-rndm-painopticum','2023-05-13',NULL,'23:00:00',NULL,'<p>Пока пепел на полу еще не остыл, а воспоминания о последнем событии свежи, мы объявляем твой третий PainOpticum!<br>Промо-группа Synesthesia объединила в себе все виды искусства, которые не оставят равнодушным никого: здесь каждый принимает участие в rave-experience, будь он артист или гость.<br>Тебя затянет на следующий круг адской воронки уже скоро - 13 мая<br>PainOpticum - это своя микровселенная, замкнутая в заговоренных стенах пространства клуба RNDM&nbsp; <br>А ее обитатели - это наши артисты, диджеи и, конечно же, ты! Ведь ты уже застрял в кругу пороков, и это твоя третья миссия под названием «Выжить».&nbsp;<br><br>Аудио-визуальный перформанс в сопровождении Immersive Dance погрузит тебя в транс, открывая новые горизонты и вселенные под музыку адептов жестокого techno</p>',600,'1000.0',2,27,1,'https://painopticum.timepad.ru/event/2375132/','',false,false,NULL,NULL,'2023-05-04 13:11:13','2023-10-24 22:26:05',NULL,'','0',18,112),
	 (830,'Dobrov & Gar1sson / Gaidana','2023-05-06-warpp-dobrov-gar1sson-gaidana','2023-05-06',NULL,'23:00:00',NULL,'<p>Наши планы на выходные дни!<br>6 Мая к нам едут наши друзья.&nbsp;<br>Резиденты ORBITA Prodject: Gar1isson &amp; Dobrov, Gaidana. <br>Ребята регулярно отправляют в космические рейсы всех пришедших. <br>Эти талантливые музыканты готовы растанцевать танцпол своими ярким и эмоциальаным выступлением а&nbsp;доброжелательная и озорная улыбка dj Gar1sson — это его визитная карточка, известная всем тусовщикам творит настоящие чудеса) &nbsp;<br>Записаться в списки можно на сайте&nbsp;<br>Резерв столов по телефону 500-09-01</p>',0,'1000.0',1,23,1,'','http://www.warppclub.com',false,false,NULL,NULL,'2023-05-04 13:20:56','2023-10-24 22:35:56',NULL,'','0',18,30);
