	 (833,' Truth Light @ Monoplay ','2023-05-13-warpp-truth-light-at-monoplay','2023-05-13',NULL,NULL,NULL,'<p>Послание 6.<br><br>Добрый день наши друзья! Мы готовы открыть для вас 6 послание. Truth Light это не просто вечеринка, это настоящее событие, которое наполнит вас светом любви, доброты и тепла. На этой вечеринке мы собираемся вместе, чтобы поделиться своей энергией и создать настоящую семейную атмосферу. Мы выбрали музыку, которая идеально подходит под нашу концепцию. Только Вы наши единомышленники и наша музыка, погрузят нас в чувство свободы танцев и самовыражения. 13 мая после насыщенных майских выходных мы рады приветствовать вас на нашем событии.</p>',0,'1000.0',1,23,1,'','https://www.hopeandlovehere.com',false,false,NULL,NULL,'2023-05-04 13:42:16','2023-10-11 13:51:42',NULL,'','0',18,115),
	 (834,'Рейв на крыше','2023-06-02-fantomas-chateau-rooftop-reiv-na-kry','2023-06-02',NULL,NULL,NULL,'<p>Пятый юбилейный Рейв на крыше фабрики Красный Октябрь в первый выходной лета.&nbsp;<br><br>Четырнадцать уникальных артистов на четырех независимых сценах. Танцы от заката до рассвета на фоне фантастических видов на Москва-реку и город.<br><br>При поддержке RTS.FM</p>',1200,'',2,170,1,'http://raveonroof.ticketscloud.org/','',false,false,NULL,NULL,'2023-05-04 13:51:30','2023-10-24 12:46:53',NULL,'','0',18,500),
