	 (835,'ChillOutPlanet in Saint Petersburg','2023-05-09-solaris-lab-chilloutplanet-in-saint-pe','2023-05-09',NULL,'16:00:00',NULL,'<p>9-го мая с 16.00 на видовой площадке Санкт-Петербурга,<br>на крыше,<br>в лаборатории Solaris Lab<br>зазвучит прекрасная музыка<br>и нас снова объединит энергия танцпола,<br>где царит свобода и красота,<br>где жизнь наполнена смыслом и созиданием.<br><br>Приходи и слушай!<br><br>Пространство кафе небольшое, продажа билетов может неожиданно прекратиться.</p>',1700,'',1,106,1,'https://chilloutplanet.ru/events/20230509/#buyTicket','https://vk.com/solarislab2023',false,false,NULL,NULL,'2023-05-04 14:36:11','2023-10-23 03:26:48',NULL,'','0',18,32),
