	 (837,'Drum in Bird','2023-05-05-pticia-licnost-drum-in-bird','2023-05-05',NULL,'22:00:00',NULL,'<p>Привет, полетаем ?)<br>Drum&amp;Bass пати в баре «Птичья Личность».<br>Собираемся в эту пятницу наслаждаться любимым жанром электронной музыки. Бери друзей и залетайте.</p>',324,'',1,4,1,'https://spb.qtickets.events/70835-drum-in-bird','https://vk.com/darkvioletrave',false,false,NULL,NULL,'2023-05-04 15:06:02','2023-10-11 17:21:22',NULL,'','0',18,35),
	 (838,'УБИЙЦЫ CRYSTAL','2023-05-06-ionoteka-ubiicy-crystal','2023-05-06',NULL,'19:00:00',NULL,'<p>Группа УБИЙЦЫ CRYSTAL выступит 6.05 в культовом клубе Ионотека с большим сольным концертом</p>',1000,'',1,40,1,'https://spb.qtickets.events/70375-ubiytsy-crystal','https://vk.com/crystalspb605',false,false,NULL,NULL,'2023-05-04 15:13:35','2023-10-23 06:19:39',NULL,'','0',18,90),
	 (839,'Somatica (Bali Style Party)','2023-05-12-secrets-somatica-bali-style-party','2023-05-12',NULL,'22:00:00',NULL,'<p>Somatique Music - это музыкальный лейбл, вместивший в себя музыкантов со всего мира, от столичного любимца F.A.R, топового питерского дуэта Space Food и красавца ALAR, до таких мэтров израильской электронной сцены как Matara, Martin Magal, Papillon.<br>Активно набирающий обороты не только как лейбл, но и как сильная промо-команда в настоящее время Somatique Music развивает серию фирменных вечеринок Somatica, где особое внимание уделяется созданию атмосферы мероприятия, декорациями, крутому перфомансу и неповторимому стилю.<br>Фирменные вечеринки Somatica уже наделали много шума не только в России (Казань, Н.Новгород, Екатеринбург), но и за ее пределами (Индия, Тайланд, Турция)<br>Пришло время устроить незабываемое шоу в родном Санкт-Петербурге!<br><br></p>',1000,'',1,147,1,'https://spb.qtickets.events/69157-somatica-bali-style-party','',false,false,NULL,NULL,'2023-05-04 15:23:16','2023-10-25 08:40:52',NULL,'','0',18,87),
	 (840,'SHAMBALA','2023-05-13-secrets-shambala','2023-05-13',NULL,'23:00:00',NULL,'<p>13 мая в уютном клубе SECRETS откроется портал в мистическую Шамбалу. Гипнотические ритмы, уютная обстановка и приятная компания – все условия, чтобы ярко и с удовольствием провести майские выходные.<br><br>Специально для вас мы собрали знатный лайнап, но имена этих героев вы узнаете позже.<br><br>Пока же просто запомните дату: 13 мая, 23-00.<br><br>Продажа билетов уже открыта, забирайте по самой приятной цене.</p>',555,'',1,147,1,'https://spb.qtickets.events/71052-1305-shambala-secrets','',false,false,NULL,NULL,'2023-05-04 15:27:30','2023-10-23 00:40:40',NULL,'','0',18,72),
	 (841,' Nasledie x Niko Grotik','2023-05-06-kontrkult-nasledie-x-niko-grotik','2023-05-06',NULL,'23:00:00',NULL,'<p>Сочетание техно и цыган это постмодерн? Сомневаетесь — Нико Гротик даст вам пищу для размышлений в эту субботу. Пляски покрытые позолотой и орнаментами ковров плавно перейдут в привычную вам черно-глянцевую обойму, создаваемую резидентами и парой гостей: с TESTFM к нам заглянет Olya Semenova, а Лёнечка Батерс представит своё альтер эго — DJ Stonik1917. Формула проста: любить по-русски, целоваться по-французски, танчить под техно по-цыгански.&nbsp;<br>Вот такая мультикультурная ночка.</p>',600,'',1,33,1,'https://t.me/nasledie_label_bot','https://t.me/nasledie_label_bot',false,false,NULL,NULL,'2023-05-04 17:13:19','2023-10-24 21:29:52',NULL,'','0',18,87);
