	 (842,'HERMOSA','2023-05-27-kontrkult-hermosa','2023-05-27',NULL,'23:00:00',NULL,'<p>Мы встретимся! И это точно.<br><br>Точно, как лазера лучи, рассекши свет над головой, поблекнут и останутся в ночи, и утро вновь, и ты живой.<br><br>Именно с этих слов великого русского Никого нам бы хотелось начать свой анонс.<br>Ведь речь вообще-то пойдет о предстоящем мероприятии!<br>27-го мая в Контркульт придет Хермоза, она пустит свои лепестки прямо под потолок, раскинет лучи света и повысит звуковое давление до предельных значений, а мы будем заряжаться ее энергией вместе с вами до самого утра!<br><br></p>',400,'',1,33,1,'https://spb.radario.ru/events/1916504/tickets','https://t.me/kontrkult21',false,false,NULL,NULL,'2023-05-04 17:20:26','2023-10-16 16:27:47',NULL,'','0',18,245),
	 (862,'ПИКНИК НА ОБОЧИНЕ #17','2023-07-28-piknik-na-obocine-17','2023-07-29','2023-07-30',NULL,NULL,'<p>Ежегодный Электро шабаш роботов от команды ELECTRO MUSIC COALITION -<br>"ПИКНИК НА ОБОЧИНЕ"<br>У нас нет никаких билетов, но есть возможность помочь нам финансово<br>(на текущие расходы: звук, горючка и расходные материалы) закинув любую посильную сумму на ТИНЬКОФФ банк<br><br>Каждый взнос - это фундамент нашего дальнейшего развития.</p>',NULL,'',1,NULL,1,'','',false,false,NULL,NULL,'2023-05-04 20:41:07','2023-10-17 20:04:06',NULL,'','0',18,467),
	 (843,'ФИОЛЕТОВАЯ СЛИВА','2023-05-05-blanc-fioletovaia-sliva','2023-05-05',NULL,'18:00:00',NULL,'<p>Всё тайное становится явным! Год мы скрывали от вас эт тусу, но дальше так не можем! Поприветствуем Фиолетовую Сливу и её феноменальный состав. Максимальное разнообразие внутри, редкий музыкальный эксперимент и ДР Сени. В общем, дом полная каша.<br>Начало в 18:00. До 21:00 есть маза пролететь по реге фо фри, а после цена входа составит от тыщи до полутора, кэш онли. По этой же сcылке можно заранее нахватить фулл прайс билики, по которым вход возможен в любое время, а до 21:00 еще и через фаст трек</p>',0,'1500.0',2,36,1,'https://radugadiscoclub.ru/e050523','',false,false,NULL,NULL,'2023-05-04 17:30:10','2023-10-12 19:43:19',NULL,'','0',18,28),
	 (844,'Попадос','2023-05-05-prostranstvo-pole-popados','2023-05-05',NULL,'23:00:00',NULL,'<p>Журналистка и яркая деятельница российской электронной сцены Алиса По отмечает день рождения. На праздник пригласили друзей и опытных диджеев. Готовьтесь дэнсить под драйвовые миксы!<br><br>Начинаем в 23:00, вход до 00:00 свободный, после — 800 рублей</p>',0,'800.0',2,46,1,'','https://t.me/eto_polye',false,false,NULL,NULL,'2023-05-04 17:35:38','2023-10-10 13:46:22',NULL,'','0',18,18),
	 (845,'МИР ХАУС МАЙ','2023-05-05-bar-na-flakone-mir-xaus-mai','2023-05-05',NULL,'20:00:00',NULL,'<p>Творческое объединение «НУЛЬ 21» приглашает на вечеринку в честь мира и дружбы. За музыку будут отвечать: основатель техно-хаус-лейбла ''Deform'' RESHET, междисциплианрый художник Veres, частая гостья столичных кутежей Wishnu и другие молодые диджеи. Главное блюдо вечера — любимые поп-треки в ритме хауса и его поджанры.<br><br>Стоимость: донейшн (любая купюра)</p>',200,'',2,98,1,'','',false,false,NULL,NULL,'2023-05-04 17:42:40','2023-10-22 13:02:44',NULL,'','0',18,31),
	 (846,'Cosmic Lovers','2023-05-05-community-moscow-cosmic-lovers','2023-05-05',NULL,'21:00:00',NULL,'<p>Шоукейс команды Solar System<br>Хедлайнер события — Zuma Dionys, начавший карьеру в 1999 году и отметившийся на танцполах Тулума, Ибицы, Стамбула и многих других электронных столиц. <br>Затем за пульт встанет DIBIDABO — петербургский музыкант, покоривший Burning Man и другие знаковые фестивали.</p>',2000,'',2,58,1,'','',false,false,NULL,NULL,'2023-05-04 17:50:43','2023-09-16 04:25:29',6442,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWM1YmU0MjEwYzYxYTIwMDBjY2FiMzc4In0.AY-W2j7Fu4MTTbypRyh06EOCt1PoIG4pOgjzzIH51qw&','0',18,76),
	 (847,'VELVET PINK NIGHT OUT','2023-05-05-powerhouse-velvet-pink-night-out','2023-05-05',NULL,'22:00:00',NULL,'<p>«Дом силы» на одну ночь занимает вечеринка VELVET PINK. Готовьте самые эпатажные бархатные наряды, чтобы плясать под техно, хаусовый хип-хоп и электронный поп. В лайнапе собрались участник промо-группы ''SETÅM'' Zotov, частый гость вечеринок ''AVG'' Romsta, начинающий техно-заводила Reptiloid и диджей Kilo, выступавший с рэпером LIL PUMP.</p>',NULL,'0.0',2,5,1,'','',false,false,NULL,NULL,'2023-05-04 17:55:43','2023-10-18 21:31:36',NULL,'','0',18,56),
	 (848,'Friday Night в DFF','2023-05-05-deep-fried-friends-friday-night-v-dff','2023-05-05',NULL,'21:00:00',NULL,'<p>Пятничная вечеринка в ресторане DFF, на которой выступят их друзья и резиденты. За пультом в эту ночь соберутся: участник группы «Лауд», селектор, член команды ''DFF'' и другие. Готовьтесь танцевать под сладкие хаус-эдиты и разножанровую электронику</p>',0,'500.0',2,76,1,'','',false,false,NULL,NULL,'2023-05-04 17:59:54','2023-10-07 15:01:37',NULL,'','0',18,49),
	 (849,'Mayday Preparty','2023-05-06-propaganda-mayday-preparty','2023-05-06',NULL,'23:00:00',NULL,'<p>В субботу разразимся безудержным весельем на вечеринке от команды организаторов ежегодных фестивалей под открытым небом MAY DAY и МИР. В лайнапе будет жирно.<br>23:00-0:00 вход бесплатный&nbsp;<br>0:00-6:00 вход 500р</p>',0,'500.0',2,101,1,'','',false,false,NULL,NULL,'2023-05-04 18:05:21','2023-10-19 06:13:06',NULL,'','0',18,38),
	 (850,'БДЫЩ х Ровесник','2023-05-06-bauns-bdyshh-x-rovesnik','2023-05-06',NULL,'23:00:00',NULL,'<p>В эту субботнюю майскую ночь наше нескончаемое путешествие продолжится в клубе на Белорусской. Приоткроем красные ворота Баунса, чтобы вы могли с кайфом провести время на свежем воздухе (который, надеемся, будет уже достаточно теплым), заказать любимый хот-дог из фудтрака и поиграть в пинг-понг на балконе прямо над танцполом с нашими друзьями&nbsp;</p>',NULL,'0.0',2,17,1,'','',false,false,NULL,NULL,'2023-05-04 18:10:31','2023-10-21 16:50:42',NULL,'','0',18,50);
