	 (851,'ДОМИК','2023-05-06-yauza-domik','2023-05-06',NULL,'23:00:00',NULL,'<p>Диско-клуб «Радуга» возвращается в особняк на Яузе. В эту ночь оттуда будет доноситься приятный хаус, электро и EBM. Готовьтесь танцевать вместе с талантливыми диск-жокеями AMLINSKY, GLEB FILIPCHENKOW, KITO JEMPERE и LAY-FAR. На десерт команда готовит лайв-акт музыкального проекта «Стерео Ширина».</p>',NULL,'',2,32,1,'https://radugadiscoclub.ru/e060523','https://t.me/radugasuperclub',false,false,NULL,NULL,'2023-05-04 18:14:30','2023-10-22 08:31:03',NULL,'','0',18,46),
	 (852,'Star Station','2023-05-07-bar-na-flakone-star-station','2023-05-07',NULL,'22:00:00',NULL,'<p>Молодая серия вечеринок Star Station отправляется в «Бар на Флаконе». С собой команда берет экспериментального электро-музыканта WPCWE, участника лейбла ''BASSBREAKERZ'' EXTRYZE, продюсера MICHAEL COX, SUPADUPA, Славную и других артистов. Ребята подготовят смесь жанров</p>',500,'700.0',2,98,1,'','',false,false,NULL,NULL,'2023-05-04 18:52:36','2023-09-20 02:22:12',NULL,'','0',18,21),
	 (863,'MANIFEST','2023-05-20-kontrkult-manifest','2023-05-20',NULL,'22:00:00',NULL,'<p>Наши МанифестЯнцы пошли в другой клуб, в другой город! Кто пойдет в Питере?</p>',500,'800.0',1,33,1,'','https://t.me/manifestmsc/584',false,false,NULL,NULL,'2023-05-04 20:48:59','2023-10-23 18:49:54',NULL,'','0',18,295),
	 (853,'ITALLIKA','2023-05-07-powerhouse-itallika','2023-05-07',NULL,'23:00:00',NULL,'<p>7-го мая готовим мощнейшую высокоэнергичную ИТАЛЛИКУ в Powerhouse Moscow.&nbsp;<br><br>Основной танцпол:&nbsp;<br>Из Питера едет локальная звезда, фронтмен Tapenight - Dimka Batarin и везёт Dj сет отборного синти, до мурашек.&nbsp;<br>Наконец-то вернулись - Danya Mu и Dasha Utochka, вас ждет драйвовый сет от итало до электроклэша.&nbsp;<br>Karolina BNV - традиционно, высокоэнергично будет двигать танцпол и ломать шазам своей селекцией.&nbsp;<br>Orchid - восходящая звезда электронной сцены, его эдиты и треки будоражат и заставляют двигаться еще больше.&nbsp;<br><br>Малый танцпол х Gradient:&nbsp;<br>Юля Конор - мама A Casa Disco и знает как вас растанцевать.&nbsp;<br>Orange Osaka - отец вечеринок Gradient знаток ретро-футуристичной романтики.&nbsp;<br>Johnny The Roastbeef - человек дискотека, от одного его вида хочется танцевать.&nbsp;<br>Santa-Barbara, переносит в атмосферу 80’х одним своим никнеймом.<br>Новые имена на Италлике,&nbsp;<br>Stepan Borin и Nikita Frolov,&nbsp;<br>готовят сюрприз из диско разных мастей.&nbsp;<br><br>Готовьте лучшие наряды, берите друзей и приходите.<br>Стоимость: донейшн (любая купюра)</p>',100,'1000.0',2,5,1,'','',false,false,NULL,NULL,'2023-05-04 19:01:10','2023-10-24 22:34:01',NULL,'','0',18,46),
	 (854,'Кейф','2023-05-07-prostranstvo-pole-keif','2023-05-07',NULL,'14:00:00',NULL,'<p>Проведем майский воскресник с кейфом: шашлычное спешл-меню от родного нам Вадика, винтажная селекция от магазина Demarche Vintage и все это под напитки от бара «Эскапист» и музыку во дворе с 14:00 и до самой ночи<br><br>Вход свободный почти всю вечеринку, платный только с 22:00</p>',0,'',2,46,1,'','',false,false,NULL,NULL,'2023-05-04 19:07:35','2023-10-16 16:34:51',NULL,'','0',18,32),
	 (855,'Girls Make Noise','2023-05-08-rndm-girls-make-noise','2023-05-08',NULL,'23:00:00',NULL,'<p>Девчачья вечеринка возвращается в «Паверхаус» под предводительством прекрасных артисток. Ищите в лайнапе основательницу тусовки Настю Сенкевич, вокалистку СБПЧ Женю Борзых, сербскую диск-жокессу Zanzibeat и дебютантку Ayokeh. Девушки припасли много эйсида, веселого хауса, техно, инди-дэнса и других жанров.</p>',500,'700.0',2,27,1,'','',false,false,NULL,NULL,'2023-05-04 19:12:05','2023-10-06 17:42:21',NULL,'','0',18,52),
	 (856,'ДК ДЭНС','2023-05-05-warpp-dk-dens','2023-05-05',NULL,'23:55:00',NULL,'<p>Инициатором ночи станет резидент клуба — Кирилл Багус, который отыграет шестичасовой сет.<br><br>Вас ждёт увлекательное погружения в хаус-музыку, где стилистические рамки жанра будут размыты, но это точно будет незабываемо!&nbsp;<br><br>Записаться в списки можно на сайте</p>',0,'1000.0',1,23,1,'','https://www.warppclub.com',false,false,NULL,NULL,'2023-05-04 19:17:18','2023-09-19 03:53:02',NULL,'','0',18,48),
	 (857,'Decade','2023-05-05-gestalt-decade','2023-05-05',NULL,'23:00:00',NULL,'<p>В магическую дату команда в окутает гостей волшебством вечеринок Decade. Мягкое сочетание танцевальных вибраций и нетривиальных мелодий позволит ощутить органику вне времени и пространства. Эта ночь будет таить в себе немало сюрпризов</p>',NULL,'0.0',2,126,1,'','',false,false,NULL,NULL,'2023-05-04 19:24:46','2023-10-17 18:10:28',NULL,'','0',18,36),
	 (858,'30 лет за Штурвалом - DJ UHO','2023-05-05-motyga-30-let-za-sturvalom-dj-uho','2023-05-05',NULL,'20:00:00',NULL,'<p>5 мая у нас в гостях легенда 90-ых Антон Уханов aka «DJ UHO» 30-лет за штурвалом при поддержке своих соратников по цеху.</p>',NULL,'0.0',2,114,1,'','',false,false,NULL,NULL,'2023-05-04 19:33:27','2023-09-28 12:25:58',NULL,'','0',18,9),
	 (859,'ПОСЛЕДНИЙ РЕЙВ: PERESTROIKA','2023-05-13-poslednii-reiv-perestroika','2023-05-13',NULL,'23:30:00',NULL,'<p>Ленин разложился на плесень и на липовый мёд, а Последний Рейв: PERESTROIKA идёт по плану.<br><br>13 мая машина времени отправит нас в советское время пионеров, железного занавеса и первого полёта в космос. На стенах квартир висят знакомые красные ковры, на улицах стоят автоматы по продаже газировки с сиропом, которая для многих стала вкусом детства, а в кинотеатрах в первый раз показывают сейчас уже любимые советские фильмы. Электронная музыка находится только на начальных стадиях развития, но эта эпоха успевает застать первый российский рейв, после которого андеграундная культура вечеринок и электроники в стране вышла в массы. Поэтому одно остаётся неизменным — путешествовать во времени мы будем под звуки техно.</p>',300,'',1,10,1,'https://spb.qtickets.events/70827-posledniy-reyv-perestroika','https://vk.com/last.russian.rave',false,false,NULL,NULL,'2023-05-04 19:48:57','2023-10-21 23:26:02',NULL,'','0',18,99);
