	 (2159,'Виниловый Квартирник','2023-10-20-na-vina-vinilovyi-kvartirnik','2023-10-20',NULL,'20:00:00',NULL,'<p>Диско-квартирник, винил, отдел вина и музыки и топовые этикетки на складе. Каким будет оранжевый октябрь?&nbsp;</p>',NULL,'0.0',1,199,1,'','',false,false,NULL,2,'2023-10-13 03:30:37','2023-10-24 15:32:31',NULL,'','0',18,72),
	 (1267,'Boogie Fek x Maxou','2023-07-07-miska-bar-boogie-fek-x-maxou','2023-07-07',NULL,'21:00:00',NULL,'<p>Сегодня, 7 июля, в Mishke играют Boogie Fek и maxou.<br><br>Хаус, диско, музыка для танцев и болтовни.<br><br>начало в 21<br>вход бесплатный<br>1+1 на избранные коктейли до 22<br><br></p>',NULL,'0.0',1,12,1,'','https://vk.com/wall-24151370_6939',false,false,NULL,2,'2023-07-07 16:25:31','2023-10-22 23:25:49',NULL,'','0',18,46),
	 (865,'GARILLA ROOM','2023-06-02-buddha-bar-garilla-room','2023-06-02',NULL,'23:00:00',NULL,'<p>Легенда гласит, что в первую пятницу лета, в Buddha-Bar ворвётся Garilla, чтобы зарядить всех волнующей энергией электронной музыки<br><br>Открываем серию новых вечеринок — GARILLA ROOM!<br>Событие объединит актуальные течения электронной музыки под одной аутентичной крышей Buddha-Bar.<br>В программе постоянные звезды ночной жизни 2-х столиц и новые имена.<br><br></p>',1000,'',1,38,1,'https://spb.qtickets.events/71087-0206-buddha-bur-garilla-room','',false,false,NULL,NULL,'2023-05-04 21:05:26','2023-10-14 04:54:09',NULL,'','0',18,145),
	 (866,'Купало','2023-06-23-kupalo','2023-06-23','2023-06-25',NULL,NULL,'<p>Купало - это лесной фестиваль, Праздник Летнего Солнцестояния, самого длинного дня и самой короткой ночи. Светлый и радостный, тёмный и зловещий. Яркий и звонкий, каждое его мгновение.<br><br>Купало - это время веселых гуляний и душевных посиделок. Это игрища и конкурсы для каждого и каждой. Это ярчайшая музыка и задорные пляски. Ремесленные мастер-классы и ряды ярмарки, сладкий мёд и душистый чай, традиционная кухня и внезапные открытия. Это встречи старых друзей и новые знакомства.<br><br>Перед покупкой билета прочитайте данную статью: https://vk.cc/cncDat<br>Оформляя заказ, вы соглашаетесь, что ознакомлены с её содержимым.<br><br>Ждём в сказке всех, кому исполнилось 18 лет и кто готов неистово кутить вместе с нами!</p>',2500,'',1,NULL,3,'https://spb.qtickets.events/69476-kupalo','https://vk.com/kupalofest',false,false,NULL,NULL,'2023-05-04 21:33:15','2023-10-18 00:35:54',NULL,'','0',18,205),
	 (867,'Saturday Mixed','2023-05-06-mixed-saturday-mixed','2023-05-06',NULL,'22:00:00',NULL,'<p>Buren'' — диджей новой волны Санкт-Петербурга, отдает предпочтение классическому звучанию 90х, но не забывает и про современную электронную музыку<br><br>Dj Loveski пионер российской хаус-сцены, более 15-ти лет один из ведущих диджеев России, а также основатель Loveschool.&nbsp;<br>фирменное звучание Dj Loveski на танцполе — это смесь разных форм хаус-музыки с обязательной фанк-основой и атмосферой чувственности<br><br>Smirnov начал свою карьеру в середине нулевых, в его сетах всегда звучали хаус и диско мотивы; отдает предпочтение винилу<br><br></p>',NULL,'0.0',1,59,1,'','',false,false,NULL,NULL,'2023-05-05 14:15:32','2023-10-14 17:13:20',NULL,'','0',18,23),
	 (868,'WAREHOUSE','2023-05-05-propaganda-warehouse','2023-05-05',NULL,'23:00:00',NULL,'<p>Техно вечеринка WAREHOUSE расширяет состав и время проведения . Теперь стартуем в 23:00 до 6:00. Впервые на вечеринке Andrey Pokrovsky. <br>Обратите внимание, что с 23:00 до 0:00 вход бесплатный, далее 500р.</p>',0,'500.0',2,101,1,'','',false,false,NULL,NULL,'2023-05-05 14:33:53','2023-10-14 01:35:51',NULL,'','0',18,15),
	 (869,'Front Yard','2023-05-08-axiom-bar-front-yard','2023-05-08',NULL,'18:00:00',NULL,'<p>ДОБРОВОЛЬНО ПОДДЕРЖАТЬ ПРОЕКТ<br>__________________________________________<br>Вечером в субботу 8 мая :data открывает уличный сезон с бесплатной вечеринкой во дворе Axiom Bar в Басманном!<br><br>Вас ждет теплая легкая музыка от резидентов :data и новых имен на звуковой системе Funktion One, множество сортов крафтового пива, бургеры и закуски, кикер и настольный теннис, и, конечно же, танцы!</p>',0,'',2,171,1,'https://moscow.qtickets.events/70942-front-yard','',false,false,NULL,NULL,'2023-05-05 14:51:12','2023-10-15 19:25:50',NULL,'','0',18,29),
