	 (877,'VNVNC - FRESCO','2023-05-12-vnvnc-concert-hall-vnvnc-fresco','2023-05-12','2023-05-13','23:00:00','06:00:00','<p>Санкт-Петербург, 12 мая на концертной площадке VNVNC, хип-хоп тусовка совершенно нового уровня, где главным гостем и хэдлайнером станет рэп-артист и битмейкер не нуждающийся в представлении…<br>Также нашими гостями станут топовые диджеи со всей России. Отборное музло и неповторимая атмосфера!</p>',700,'',1,50,1,'https://vnvncconcerthall.ru/events/vnvncpyatnicza-12-maya/','',false,false,NULL,NULL,'2023-05-12 00:38:42','2023-10-24 21:57:03',645,'','0',18,56),
