	 (879,'Gestalt Birthday 2 Years','2023-05-12-gestalt-gestalt-birthday-2-years','2023-05-12','2023-05-14','22:00:00','06:00:00','<p>Фееричное событие, которое нельзя пропустить этой весной, – 2 года проекту GESTALT CLUB и 2 дня грандиозного праздника в честь именинника<br>Каждую неделю особняк на Милютинском открывает свои двери для встречи гостей на лучших мероприятиях ночной Москвы.<br><br>Поздравляем команду, благодарим наших гостей и приглашаем 12 и 13 мая на GESTALT CLUB BIRTHDAY</p>',NULL,'',2,126,1,'','https://vk.com/event220451822',false,false,NULL,NULL,'2023-05-12 02:01:29','2023-10-23 05:44:33',NULL,'','1',18,49),
	 (880,'Gestalt Birthday 2 Years','2023-05-13-gestalt-gestalt-birthday-2-years','2023-05-13','2023-05-14','22:00:00','06:00:00','<p>Продолжаем главный праздник этого уикенда <strong>—</strong> Gestalt Club Birthday&nbsp;</p><p>Музыкальный перформанс от команды Trikotage, коктейли рекой и розыгрыш айпада в компании добрых друзей для фантастического настроения этой ночи.</p>',NULL,'',2,126,1,'','https://vk.com/event220451822',false,false,NULL,NULL,'2023-05-12 02:09:18','2023-10-22 06:07:42',NULL,'','0',18,65),
	 (881,'Asian King','2023-05-14-gestalt-asian-king','2023-05-14',NULL,'22:00:00',NULL,'<p>Как всегда отличное мероприятие в окружении добрых друзей, неравнодушных к красивому отдыху и кристально чистому звучанию музыки. С самурайской стойкостью разминаемся на заключительной ночи этих выходных</p>',NULL,'',2,126,1,'','',false,false,NULL,NULL,'2023-05-12 02:48:57','2023-10-24 21:13:57',NULL,'','0',18,91);
