	 (882,'STEREОVISIONS FUTURE','2023-05-12-gazgolder-stereovisions-future','2023-05-12',NULL,'23:00:00',NULL,'<p>Спустя ровно месяц со дня космонавтики мы вновь позовем вас в космос. А точнее, в ближайшее будущее. Каждый раз, после того как музыканты играли сеты в новых сочетаниях на наших предыдущих мероприятиях, это становилось излюбленной классикой публики – этот раз не станет исключением!<br><br>С картами Highway family вход свободный.</p>',1000,'',2,35,1,'https://stereo-visions-events.timepad.ru/event/2405258/','',false,false,NULL,NULL,'2023-05-12 02:58:31','2023-10-20 23:11:46',NULL,'','0',18,50),
	 (883,'BUNKER 3.0','2023-05-12-griboedov-bunker-30','2023-05-12','2023-05-12','18:00:00','23:00:00','<p>Третья вечеринка серии BUNKER представит для вас аж 20 артистов петербуржской электронной сцены и художников.<br>В 23:00 мы перемещаемся на танцпол, где для вас будут представлены самые актуальные течения электронной музыки от резидентов и гостей клуба.<br><br>13 мая, до 20:00, мы перемещаемся на летнюю веранду пространства GRIBOEDOV «Amsterdam», где в формате after party, вы сможете провести время с участниками проекта, с музыкальным сопровождением команды GRIBOEDOV BASEMENT. Также для вас будут открыты двери убежища, где вы сможете посмотреть работы участников.<br><br>Лучший выход — это вход<br><br>12 мая<br>600 + репост / 800</p>',600,'800.0',1,86,1,'','https://vk.com/griboedovbasement',false,false,NULL,NULL,'2023-05-12 03:05:17','2023-10-08 15:56:10',NULL,'','0',18,125),
	 (884,'Pink Shine Party','2023-05-13-griboedov-pink-shine-party','2023-05-13',NULL,'23:00:00',NULL,'<p>Мы празднуем 3 года Pink Shine Records, а так же презентуем наш новый альбом компиляцию Memphis Shine Vol. 1! В этот раз вы снова сможете услышать музыку нашего Московского друга, короля Джи-Фанка Route 696!<br>Вход:<br>300 — до 00:00 по спискам<br>400 — после 00 по спискам<br>600 — без внимания к мероприятию</p>',300,'600.0',1,86,1,'','https://vk.com/griboedovbasement',false,false,NULL,NULL,'2023-05-12 03:10:39','2023-10-22 11:22:03',NULL,'','0',18,54),
