	 (905,'Kiki x Caravanclaat','2023-05-19-blank-kiki-x-caravanclaat','2023-05-19','2023-05-20','23:00:00','10:30:00','<p>В потоке летнего латинского ветра кружатся племена кики и каравана, горячее приземление в бланке 19 мая</p><p>золотой откроем нотами гетто и рнб, которые перельются в трайб и грув на веранду с первыми лучами солнца. в гримерке на всю ночь под шатром зависнет панк пул, в большом зале – жизнь улиц через объектив челюсти.</p>',800,'',1,1,1,'https://kikikiiix.timepad.ru/event/2425377/','',false,false,NULL,NULL,'2023-05-12 21:26:57','2023-10-24 19:51:54',NULL,'','0',18,205),
	 (906,'Mixed Friday','2023-05-12-mixed-mixed-friday','2023-05-12',NULL,'22:00:00',NULL,'<p>Пятницу, по традиции, Mixed проведёт в компании приятных людей:&nbsp;<br><br>El — один из основателей и бессменный резидент Roots United.<br>География выступлений петербургского диджея достаточно обширна: от вечеринок Roots United в Берлине, Индонезии и выступлений в Южной Америке или в Khidi (Тбилиси) до столичных рейвов от System 108 и Мутабора.&nbsp;<br><br>Составит компанию Артему идейный вдохновитель mixed. — Kirill Vitman, который совсем недавно прилетел из длительного путешествия по Европе и готов со всеми поделиться своим настроением и занимательными историями</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,NULL,'2023-05-12 21:29:51','2023-07-10 10:11:28',NULL,'','0',18,65),
	 (907,'Secret Garden','2023-05-20-factory-3-secret-garden','2023-05-20',NULL,'23:59:00',NULL,'<p>20 мая SECRET GARDEN&nbsp; возвращаются в Factory с очередным разъёбным анонсом и суперстар-резидентами из PRIVATE PERSONS, GESTALT.PROMO и STVOL.TV в лайнапе!&nbsp;<br><br>Обведите эту дату в календаре, отложите всё и сохранитесь: очевидно, – эта ночь обречена на плотный замес!&nbsp;</p>',1000,'',1,7,1,'https://spb.qtickets.events/71923-secret-garden','https://t.me/secret_garden_spb',false,false,NULL,NULL,'2023-05-12 21:36:19','2023-10-03 05:05:32',NULL,'','0',18,119),
	 (908,'The Dreamers','2023-05-12-union-the-dreamers','2023-05-12',NULL,'22:00:00',NULL,'<p>С теплом, стремящимся к нам, во дворе Union Bar&nbsp; расцветет настоящий сад из творческих объединений.<br><br>В эту пятницу The Dreamers соберут ярких представителей локальной сцены, чтобы всем вместе наполнить пространство танцами и подготовить свои тела к летнему безумию.<br>Вход: до 23.00 - фри, после - 500₽</p>',0,'500.0',1,8,1,'','https://www.instagram.com/unionbar',false,false,NULL,NULL,'2023-05-12 21:40:27','2023-10-03 17:08:43',NULL,'','0',18,56),
	 (909,'White Party','2023-05-20-warpp-white-party','2023-05-20',NULL,'23:00:00',NULL,'<p>Дорогие друзья, как известно, есть вещи, которые не перестают радовать и удивлять всю жизнь.<br>Это хорошо знакомо тем, кому посчастливилось жить в нашем прекрасном городе. Ведь именно здесь начинающийся с конца мая сезон белых ночей почти на целых два месяца отправляет нас в сказочное путешествие, в котором великолепие Санкт-Петербурга гармонично переплетается с уникальным природным явлением, создавая неповторимую атмосферу.<br>Ценители эстетики пополняют свои фотоколлекции, романтики планируют ночные свидания с видом на Неву, а все вместе мы предвкушаем приуроченные к этому событию культурные мероприятия.<br><br>Таковым будет являться впервые проводимая в клубе WARPP вечеринка White Party. Условия для попадания на неё просты и элегантны - гостям необходимо одеться в белое, оставить за порогом свои страхи и переживания и насладиться ночной музыкальной феерией . Всё в этом событии символично - музыка DJя Лавски, мелодичная, атмосферная и порхающе романтичная и белый цвет, символизирующий чистоту, радость, истинность и универсальность, ведь он содержит в себе все цвета спектра, в нём можно блистать, сиять, быть холодным или тёплым, быть самим собой, в абсолютном покое и любви.<br>Мы приглашаем вас на этот неповторимый и светлый праздник добра, музыки, гармонии и любви.<br><br>⚡️Записаться в списки можно на сайте&nbsp;<br>Резерв столов по телефону 500-09-01</p>',0,'1000.0',1,23,1,'','https://www.warppclub.com/',false,false,NULL,NULL,'2023-05-12 21:44:49','2023-10-10 04:21:11',NULL,'','0',18,129),
	 (910,'МЕХАНИКА OPEN-AIR FESTIVAL','2023-07-01-teleclub-mexanika-open-air-festival','2023-07-01','2023-07-02','21:00:00','08:00:00','<p>Закрой глаза, сделай медленный выдох.<br>Освободи своё тело и разум,<br>Став частью механической сети...<br><br>Добро пожаловать на самый масштабный фестиваль электронной музыки на Урале - MEHANIKA OPEN-AIR<br><br>- 100 DJ''s со всего мира на 6 танцполах.<br><br>- Два мощных танцпола внутри и четыре под открытым небом.<br><br>- Головокружительный свет и чистейший звук сотнями киловатт распространятся на дизайнерски оформленных шести площадках, оснащенных к тому же, впечатляющим световым и лазерным шоу.<br><br>12 часов убойных DJ-сетов от мастодонтов электронной музыкальной сцены.</p>',2500,'',4,175,3,'https://mehanikafest.ru/#basket','https://mehanikafest.ru/',false,false,NULL,NULL,'2023-05-15 18:28:59','2023-10-25 04:17:17',NULL,'','0',18,291),
	 (911,'Hard Thursday 5 years','2023-05-27-factory-3-hard-thursday-5-years','2023-05-27','2023-05-28','23:30:00','06:00:00','<p>27го мая Санкт-Петербургу - 320 лет. А твоим Тяжелым Четвергам - 5 лет!<br>Пятый год подряд мы закаляем тебя тяжелым #HARDCORE звучанием, показываем самые жесткие его проявления, восторгаемся классикой голландской сцены, и конечно же аменами!<br><br>TechnoCore и Hard Thursday SPB&nbsp; с гордостью представляют:<br>В последнюю субботу мая, 27го! Ночью! Самые тяжелые! Самые четверги! 5 лет!</p>',500,'',1,7,1,'http://technocore.timepad.ru/event/2424254/','https://vk.com/hardthursday',false,false,NULL,NULL,'2023-05-16 13:44:02','2023-10-20 07:17:35',NULL,'','0',18,112);
