	 (912,'Agenda','2023-05-19-factory-3-agenda','2023-05-19',NULL,'23:30:00',NULL,'<p>19 мая в клубе Factory 3 пройдет Agenda — cвежая вечеринка с техно и хаус музыкой!<br><br></p>',500,'',1,7,1,'https://spb.qtickets.events/70255-agenda','https://factory3.club/event/1905agenda',false,false,NULL,NULL,'2023-05-16 13:51:04','2023-10-22 21:05:29',NULL,'','0',18,88),
	 (1044,'BELIEF PARTY','2023-06-11-griboedov-belief-party','2023-06-11',NULL,'23:30:00',NULL,'<p>Друзья, 11 июня приглашаем вас на BELIEF PARTY - вторую часть пати-триптиха BELIEF, HOPE &amp; LOVE от Shanti Sound System в любимом пространстве Griboedov Hill.<br><br>За пультом управления опытные музыкальные кудесники</p>',500,'',1,86,1,'','https://vk.com/griboedovintrancejune2023',false,false,NULL,NULL,'2023-06-08 16:18:55','2023-10-19 22:23:12',NULL,'','0',18,70),
	 (956,'Sanchez Thursdays','2023-05-25-propaganda-sanchez-thursdays','2023-05-25',NULL,'23:55:00',NULL,'<p>«Четверги Санчеса»&nbsp; — старейшая московская вечеринка. На этой неделе серия прощается олл-найтером её основателя Сергея Санчеса — опытного селектора и визионера клубных 90-х. Приходите прикоснуться к клубной истории и поздравить с днем рождения легендарную вечеринку.</p>',NULL,'0.0',2,101,1,'','https://t.me/propagandamoscow',false,false,NULL,NULL,'2023-05-23 16:45:57','2023-10-25 18:20:21',NULL,'','0',18,96),
	 (913,'Виниловые пляски','2023-05-19-buddha-bar-vinilovye-pliaski','2023-05-19','2023-05-20','22:00:00','05:00:00','<p>Для некоторых эта музыка означает сумасшедшее веселье до утра…&nbsp;<br>Другие просыпались под эту музыку в непонятных местах с мало знакомыми людьми…&nbsp;<br>Некоторые выжимали педаль в пол, выкручивая ручку магнитолы погромче и неслись на встречу ветру…&nbsp;<br>Кто-то знакомился, кто-то расставался, кто-то влюблялся, а кто-то любит до сих пор...&nbsp;<br>Всех объединяет одно: музыка, делающая по-настоящему счастливыми и имя этой музыки «Виниловые Пляски»!&nbsp;</p>',1000,'',1,38,1,'https://buddha-bar-event.timepad.ru/event/2421948/','https://t.me/buddhabarspb/17',false,false,NULL,NULL,'2023-05-16 13:55:31','2023-10-16 04:11:56',NULL,'','0',18,183),
	 (914,'PAUSE','2023-05-20-yauza-pause','2023-05-20','2023-05-21','18:00:00','06:00:00','<p>PAUSE -&nbsp; синтез музыкальной вечеринки и современного искусства от творческого содружества Synchron. Время забыть о повседневных проблемах и окунуться в мир наслаждения яркими эмоциями, искренними танцами, удивительными образами прекрасного. Время созерцать современные формы аудиовизуального перформанса, новейшие цифровые арт явления. Время быть собой и чувствовать неповторимость мгновения. Время для себя.<br><br></p>',1000,'',2,32,1,'https://yauza-event.timepad.ru/event/2404181/','',false,false,NULL,NULL,'2023-05-16 14:16:21','2023-10-22 16:36:36',NULL,'','0',18,158),
	 (915,'PARNAS','2023-05-20-blanc-parnas','2023-05-20','2023-05-21','18:00:00','06:00:00','<p>Oкунитесь в удивительный мир Парнаса, где богини и музы спустились с Олимпа, чтобы вдохновить нас своими восхитительными мелодиями и талантами.</p><p>Исследуйте мир астрологии, магии и провидения, где гадания на таро и древние мистические традиции раскрываются перед вами. Погрузитесь в уютное общение с чайными мастерами. Бланк наполнится сказочной атмосферой, окутанной красотой Парнаса и древнегреческих мифов о музах и богинях.</p><p>Здесь царит женский мир, полный красоты, тайн и легенд.</p><p>Вход:</p><p>18.00 — 21.00 FC / бесплатный, с предварительной регистрацией</p><p>21.00 — 06.00 FC / 21+ / по билетам</p><p>с картами Highway Family вход бесплатный!</p><p><br><br></p>',1500,'',2,36,1,'https://afisha.timepad.ru/event/2421305','',false,false,NULL,NULL,'2023-05-16 14:25:20','2023-10-25 08:33:51',NULL,'','0',18,135),
	 (916,' RROOM in HAZE | Kaleidoskop ','2023-05-20-gazgolder-rroom-in-haze-kaleidoskop','2023-05-20','2023-05-22','23:00:00','06:00:00','<p>Открытие сезона танцев на свежем воздухе в формате 24 hours.</p><p>Музыкальная платформа HAZE оккупирует террасу с танцевальным марафоном и боевым лайнапом, включающим в себя двух иностранных артистов.<br>Одним из хайлайтов Kaleidoskop станет выступление Anamorph — диджея и продюсера из Туниса, а также идеолога музыкального проекта Neverstill с одноименным фестивалем на берегу Средиземного моря. Вторым почетным гостем будет VincentIulian — румынский диджей и продюсер, который прилетит к нам прямиком из Бухареста после выступления. Локальную сцену представят мастера жанра</p><p>RROOM курирует ночную программу танцпола Gallery<br>Там же утром начнется дневная серия эмбиент лайвов</p><p>А вечером воскресенья состоится «Воскресная филармония». Возглавит ее программу большой концерт Symbol live band — коллектива под управлением электронного музыканта Никиты Стеблина. Он выступит с гитаристом Леонидом Затагиным и барабанщиком Иваном Амельченко в окружении не только драм-машин, но и живых инструментов. Дополнят концертный триптих выступления ярких представителей новой волны российской электронной сцены Sasha Night и .</p>',1500,'',2,35,1,'https://afisha.timepad.ru/event/2407364','',false,false,NULL,NULL,'2023-05-16 14:36:25','2023-10-22 10:34:10',NULL,'','0',18,138),
	 (917,'INVADERS: 5 YEARS','2023-05-19-slezy-invaders-5-years','2023-05-19','2023-05-20','23:00:00','06:00:00','<p>В пятницу 19-го мая объединение INVADERS вновь окрасит в свои цвета пространство Слезы, дабы отпраздновать 5 лет с момента основания.<br><br>Не отступая от принципа представлять новые жанровые сочетания на мероприятиях комьюнити, мы с особой скрупулезностью отнеслись к формированию лайн-апа нашего дня рождения.<br><br></p>',750,'',2,102,1,'https://afisha.timepad.ru/event/2416233','',false,false,NULL,NULL,'2023-05-16 14:40:56','2023-10-20 23:35:10',NULL,'','0',18,112),
	 (918,'Towel Day','2023-05-26-supermetall-towel-day','2023-05-26','2023-05-27','20:00:00','06:00:00','<p><br>Don’t panic! Мы сделали новый виток вокруг солнца и ежегодные гуляния по случаю Дня Полотенца снова с нами. Ждём всех любителей путешествовать автостопом по галактике в летнем пространстве Радио на территории Суперметалла.</p><p>Начинаем в пятницу вечером и продолжаем до позднего утра субботы. Не забудь взять с собой полотенце – незаменимую для автостопщика вещь, будь то путешествия по земным дорогам или межгалактическим пространствам.</p><p><br></p>',1000,'',2,119,1,'https://afisha.timepad.ru/event/2415476','',false,false,NULL,NULL,'2023-05-16 16:13:56','2023-10-21 19:33:34',NULL,'','0',18,349),
	 (919,'REVERSE - Garden of Wonders','2023-05-26-soho-rooms-reverse-garden-of-wonders','2023-05-26','2023-05-20','19:00:00','04:00:00','<p>В последние выходные весны на потрясающей террасе под стеклянным куполом Soho расцветёт волшебный сад в котором мы откроем наш летней сезон вечеринок, руфтопов, веранд и конечно летних пляжей!</p><p>Все начнётся вечером под красивую электронику и выступления live артистов!<br>Мы встретим закат и будем нестись на парах этих эмоций до 4х утра в сопровождении наших творцов&nbsp;</p>',2000,'',2,158,1,'https://afisha.timepad.ru/event/2420725','',false,false,NULL,NULL,'2023-05-16 16:21:01','2023-10-14 22:42:15',NULL,'','0',18,162);
