	 (920,'Please Radio + супер смурф','2023-06-02-prostranstvo-pole-please-radio-super','2023-06-02','2023-06-03','23:00:00',NULL,'<p>Совместный Шоукейс нового медиа <a href="http://vk.com/please">«Please»</a> и творческого объединения <a href="https://vk.com/supersmurfsquad">«Супер Смурф»</a> откроет летний сезон под ритмы основных направлений электронных рейв-школ Англии, Германии и США, заняв две сцены пространства <a href="https://www.polye.ru/">«Поле»</a>. На первом танцполе прозвучат лайвы с электро, брейкбит, гетто-тек, техно и габбой. Вторую отдали на откуп адептам ломаных ритмов олдскульного джангла и драм’н’бейса.</p>',600,'',2,46,1,'https://afisha.timepad.ru/event/2421284','https://vk.com/please',false,false,NULL,NULL,'2023-05-16 17:25:10','2023-10-24 21:03:50',NULL,'','0',18,176),
	 (921,'Boat party - Warpp club','2023-05-20-warpp-boat-party-warpp-club','2023-05-20','2023-05-20','17:30:00','22:00:00','<p>Один из ведущих ночных клубов города, с гордостью объявляет о предстоящем событии Boat Party, великолепная вечеринка на корабле, состоится 20 мая с 18:00 до 22:00</p><p>Boat Party от Warpp Club обещает стать одним из самых захватывающих событий сезона, где участники смогут насладиться непревзойденным сочетанием потрясающей атмосферы клуба и уникального плавания по водам города. Гостей ждет незабываемое путешествие по неве, в окружении прекрасного заката и красивейших видов побережья.</p><p>В течение этого плавания, участники смогут насладиться выступлениями резидентов клуба</p>',3000,'',1,23,1,'https://afisha.timepad.ru/event/2419291','',false,false,NULL,NULL,'2023-05-16 18:22:06','2023-10-25 18:20:21',NULL,'','0',18,78),
	 (922,'МИР-2','2023-05-26-blank-mir-2','2023-05-26','2023-05-27','23:00:00','08:00:00','<p>26 мая<strong> </strong><a href="https://mir2.timepad.ru/event/2422119/?utm_source=listing.events&amp;utm_medium=social&amp;utm_campaign=mir20230526&amp;utm_content=promo&amp;utm_term=lst1"><strong>МИР-2 </strong></a>перелистывает новую страницу ночной жизни Северной Столицы.&nbsp;<br>Два танцпола Бланка примут у себя 8 артистов, которые поделятся своим музыкальном видением техно и электро звучания, а визуальная команда возьмет на себя преображение внутреннего пространство клуба.</p><p>В этот раз к нам в гости из Армении едет KamavoSian - талантливый продюсер и диджей из Еревана и идеолог лейбла Death Bell Records, знакомый городу на Неве по выступлению на последнем фестивале Gamma. Заодно визитом на наше мероприятие отметит свое возвращение в Россию Unbalance - резидент Monasterio и владелец нескольких лейблов.</p><p>В качестве локальной поддержки выступят представители основных промо-команд Петербурга. А открывать террасу доверим Лене Поповой - резиденту m_division и человеку, без которого в нашем городе не обходится ни одно крупное событие.<br><br></p><p><br></p>',700,'',1,1,1,'https://mir2.timepad.ru/event/2422119/?utm_source=listing.events&utm_medium=social&utm_campaign=mir20230526&utm_content=promo&utm_term=lst1','https://t.me/mir2_mir2',false,false,NULL,NULL,'2023-05-16 18:28:50','2023-10-10 05:59:20',NULL,'','0',18,339),
	 (923,'Rare Tapes','2023-05-20-griboedov-rare-tapes','2023-05-20',NULL,'00:00:00',NULL,'<p>Потребность в отдыхе – неотъемлемая часть жизни. Это помогает нам перезарядиться, омолодиться и оживиться.<br><br>Брейкбит, электро, плотная бочка, мы с вами — все это сольётся воедино в эту долгожданную ночь. Врывайтесь в происходящее, и позвольте себе отдохнуть в приятной компании.<br><br>Вход:<br>500 — без внимания<br>С репостом — 300</p>',300,'500.0',1,86,1,'','https://vk.com/griboedovbasement',false,false,NULL,NULL,'2023-05-16 22:28:23','2023-10-22 08:04:01',NULL,'','0',18,78),
	 (924,'BLOOD KNIFE','2023-05-19-griboedov-blood-knife','2023-05-19',NULL,'00:00:00',NULL,'<p>Новая часть электро-слешера в стенах бомбоубежища, тусклый свет, свечи, музыка — все по канонам хорошего хоррор фильма.<br><br>Состав вам хорошо знаком, но чем все закончится — никто не знает!<br><br>Двери — 500<br>Репост — 300<br><br></p>',300,'500.0',1,86,1,'','',false,false,NULL,NULL,'2023-05-16 22:32:02','2023-10-12 06:56:49',NULL,'','0',18,45),
	 (925,'БОЛЬШОЙ РЕЙВ','2023-05-27-blank-bolsoi-reiv','2023-05-27',NULL,'23:00:00',NULL,'<p>Иногда мерещится, что это сон. В нем недремлющие феи растянули на твоем лице улыбку, как самый добрый транспарант, и мимические мышцы влекут его издалека в явь. Или наивная фантазия о приветливом мире, нечаянно кристаллизовавшаяся из детских стишков о дружбе и любви в так непохожей на них, унылой жизни взрослых.<br><br>Или «Большой Рейв» вновь жует жвачку про сплочение, плюрализм и коллективный улет в день города. Да, наша любимая резинка вновь вошла в моду.<br><br></p>',700,'',1,1,1,'http://blankclub.ru/','',false,false,NULL,NULL,'2023-05-16 22:41:49','2023-10-25 04:53:17',NULL,'','0',18,255),
	 (926,'Blank Garden','2023-05-30-blank-blank-garden','2023-05-30','2023-05-31','00:00:00',NULL,'<p>Объявляем террасу метеонезависимым приютом свободы для всех чувствительных сердцем.<br><br>Перепады масс в вовсе не атмосферном фронте смешиваются с рутиной, оседают внутри холодящим пыл конденсатом и проливаются дождем из глаз. От стресса и беспокойного сна лица бухнут грозовыми тучами из свинца. Да разве станет кто-то прикидываться ипохондриком, перманентно живя в угнетающем давлении?<br><br>Важней всего погода в доме, но раз она круглогодично оставляет ждать оттепели, намешаем свой собственный антициклон, чтобы греть друг друга встречами по выходным. Выдворяем вечеринку на улицу, на террасу, крышеванную неугасающим желанием жить полноценную жизнь и оргстеклом, прозрачным, как наши намерения. <br>Распогодится!<br><br>Билеты на входе:<br>00:00 - 600₽<br>01:00 - 800₽</p>',600,'800.0',1,1,1,'','',false,false,NULL,NULL,'2023-05-16 22:46:32','2023-10-21 23:30:22',NULL,'','0',18,122),
	 (927,'Open Air','2023-05-20-gas-open-air','2023-05-20','2023-05-21','23:00:00','06:00:00','<p>Вечеринка на свежем воздухе , стильная терраса с инсталляциями прямо в центре города<br>МЫ ОТКРЫВАЕМ СЕЗОН OPEN-AIR ВЕЧЕРИНОК<br><br>Мы обязаны встретить самое долгожданное время года правильно - с песен ,слова которых запали в каждое сердечко наших преданных ценителей музыки.<br>Поэтому, будем пить бодрящие коктейльчики, купаться в удовольствии слияния звуков и целоваться в самых укромных уголках)<br>Политика входа:<br>БЕСПЛАТНО - репост + отметка максимального количества друзей(до 00:00)<br>350 р. - с репостом после 00:00<br>500 р. - без внимания к мероприятию</p>',0,'500.0',1,57,1,'','',false,false,NULL,NULL,'2023-05-16 23:08:54','2023-10-22 14:35:41',NULL,'','0',18,151),
	 (928,'REELS NIGHT','2023-05-19-gas-reels-night','2023-05-20','2023-05-21','23:00:00','06:00:00','<p>Что же такое REELS NIGHT? В эту пятницу мы открываем для вас двери в мир, который поглотит вас в музыкально-танцевальное безумие популярных звуков, штурмующих инстаграм (R. I. P TikTok). Мы не сомневаемся, каждый трек ты не просто узнаешь с самых первых нот, но и перекричишь колонки, вторя знакомым текстам. И , конечно, тебя точно ждет много отборного , в хорошем смысле, треша и веселья<br>Мы обязаны встретить самое долгожданное время года правильно - с песен ,слова которых запали в каждое сердечко наших преданных ценителей музыки.<br>Поэтому, будем пить бодрящие коктейльчики, купаться в удовольствии слияния звуков и целоваться в самых укромных уголках)<br><br>Большой мультиформатный перформанс и ничего лишнего<br><br>Политика входа:<br>БЕСПЛАТНО - репост + отметка максимального количества друзей(до 00:00)<br>350 р. - с репостом после 00:00<br>500 р. - без внимания к мероприятию</p>',0,'500.0',1,57,1,'','https://vk.com/gasmusicclub',false,false,NULL,NULL,'2023-05-16 23:17:36','2023-10-22 21:47:04',NULL,'','0',18,58),
	 (929,'KAI ANGEL','2023-05-19-smolla-hall-kai-angel','2023-05-19',NULL,'23:59:00',NULL,'<p>Hypermarket и Angelmove&nbsp; ночью с 19 на 20 МАЯ в центре Санкт-Петербурга с шикарным лайвом выступит Kai Angel, а на разогреве играют диджеи&nbsp;</p>',1000,'',1,163,1,'https://spb.qtickets.events/72320-hypermarker-angelmove-kai-angel-live','https://vk.com/hyp3rmarket',false,false,NULL,NULL,'2023-05-17 12:17:09','2023-10-25 09:51:14',NULL,'','0',18,342);
