	 (930,'Popoff Kitchen XXL ','2023-05-20-mutabor-popoff-kitchen-xxl','2023-05-20',NULL,'23:00:00',NULL,'<p>Город засыпает, просыпается Попофф. Котел с приворотным зельем Popoff Kitchen XXL закипает в Mutabor 20 мая. Как всегда, не зная меры, откроются 4 танцпола и неотъемлемый даркурум.&nbsp;<br><br>Обжигайтесь языками пламени и растворяйтесь в клубах дыма на главной сцене, стаптывайте ноги в кровь под бит на Medium. Плавьтесь и утекайте в темные уголки даркурма под звуки в Under.&nbsp;<br>Обретайте нечеловеческий облик с полуночи и рассыпайтесь в пепел с восходом солнца на Garden.<br><br>Несите лучшее, жертвуйте самое дорогое. Пол — это лава, bitches!&nbsp;</p>',1500,'2000.0',2,2,1,'https://popoffxxl.ticketscloud.org/','https://t.me/popoffkitchen/1305',false,false,NULL,NULL,'2023-05-17 12:25:50','2023-10-25 00:34:28',NULL,'','0',18,1141),
	 (931,'Hard Thursday','2023-05-18-zoccolo-20-hard-thursday','2023-05-18',NULL,'19:00:00',NULL,'<p>18.05 мы проведем заключительный <a href="https://vk.com/hardthursday">Тяжелый Четверг</a> сезона под аккомпанемент любимого <a href="https://vk.com/feed?section=search&amp;q=%23hardcore">#hardcore</a>!<br>В этот вечер для вас крутят пластинки мастера своего дела<br>Не приноси с собой алкоголь, оружие, наркотики, политику и агрессию.</p>',NULL,'0.0',1,72,1,'','https://vk.com/hardthursday',false,false,NULL,NULL,'2023-05-17 12:53:36','2023-10-09 02:43:24',NULL,'','0',18,55),
	 (932,'Meyer Bergy','2023-05-19-tommy-lee-meyer-bergy','2023-05-19',NULL,'23:00:00',NULL,'<p>19 мая свою музыкальную историю расскажет прекрасный музыкант Meyer Bergy.<br><br>Meyer Bergy — диджей и саунд продюсер, который выпускается на лейбле X Series. За плечами музыканта тысячи отыгранных сетов с самой разнообразной стилистикой. Meyer Bergy поклонник electronica, melodic, techno, house и ambient. Такой прекрасный набор и ориентиры в стилях всегда отличают обычного слушателя от глубокого меломана и диджей в этом точно преуспел.<br><br>Танцуем и музицируем оставшуюся ночь вместе</p>',NULL,'',1,83,1,'','https://vk.com/lee_tommy',false,false,NULL,NULL,'2023-05-17 13:06:15','2023-10-25 12:15:07',NULL,'','0',18,94),
	 (933,'Пятница в «Стрелке»','2023-05-19-bar-strelka-piatnica-v-strelke','2023-05-19',NULL,'23:00:00',NULL,'<p>В пятницу в баре «Стрелка» будут танцы до рассвета на террасе. Эту ночь проводим в классной музыкальной компании: за пультом босс DFF Денис Кряжев и диджей Андрей Жилин.</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,NULL,'2023-05-17 13:27:53','2023-09-30 10:29:05',NULL,'','0',18,78),
	 (934,'HEAVEN','2023-05-19-prostranstvo-pole-heaven','2023-05-19',NULL,'23:00:00',NULL,'<p>Вечеринка в симбиозе хип-хопа и электронной музыки. В программе два танцпола: на мейне вы услышите качoвые лайвы и диджей-сеты, а на втором танцполе — ритмичную электронную музыку</p>',750,'',2,46,1,'https://heavenmsk.timepad.ru/event/2411846/','',false,false,NULL,NULL,'2023-05-17 13:38:08','2023-10-07 04:59:35',NULL,'','0',18,90),
	 (1026,'COLNYSHKO','2023-06-03-lendok-colnyshko','2023-06-03',NULL,'23:00:00',NULL,'<p>В первый летний уик-энд Солнышко раскинет веер золотых лучей в залах Лендока.&nbsp; Светская ночь в кругу родных и близких развернётся на двух танцполах со свободной от жанровой классификации музыкой - гедонистические фибры, райские сады, вина, фрукты и сыры.<br><br></p>',NULL,'500.0',1,182,1,'','',false,false,NULL,NULL,'2023-05-31 21:57:23','2023-10-24 21:06:32',NULL,'','0',18,124),
	 (935,'THE NIGHT COOPERATIVE (VOL 2)','2023-05-19-yauza-the-night-cooperative-vol-2','2023-05-19',NULL,'18:00:00',NULL,'<p>Ночь посвящена началу лета и тепла, возвращению в город друзей.</p><p><strong>Выходи во двор гулять до рассвета и вместе отправимся домой на велосипеде.&nbsp;</strong></p><p>Потому что Москва летом — это чудесно.</p><p><br>Спик-изи вечеринка на двух танцполах. Гостей ждет синтезаторный лайв с модулярами и гитарой, мультижанровые диджей-сеты от столичных артистов и ночной кинотеатр. И всё это в теплой дружеской атмосфере.</p>',1000,'',2,32,1,'https://nadopodumat.timepad.ru/event/2404254/','',false,false,NULL,NULL,'2023-05-17 13:40:46','2023-10-25 15:15:55',NULL,'','0',18,120),
	 (936,'Hypnotica','2023-05-19-radio-hypnotica','2023-05-19',NULL,'18:00:00',NULL,'<p>Снимаем движение с паузы и включаем Play!<br><br>Hypnotica возвращается в весеннюю и летнюю Москву, город друзей и единомышленников, столицу, способную чувствовать теплый вайб, который возникает на особенных мероприятиях! Hypnotica везет с собой накопленную светлую энергетику, которая в виде свежего музыкального звучания, специальных декораций и световых инсталляций раскроется среди друзей и единомышленников на любимых летних танцплощадках столицы под открытым небом. Новейшая музыка, знакомые и близкие лица, тот редкий и теплый вид атмосферы, куда хочется возвращаться снова. Мы соскучились по всем вам и приглашаем прожить с нами эту долгожданную историю с любимыми диджеями на частоте суперактуального РАДИО на Суперметалле 19го мая. И то, что она будет волшебной совершенно не сомневаемся! Приходите обниматься! Мы возвращаемся!</p>',0,'1500.0',2,149,1,'https://62b953c205f9f71b76d2cd3f.ticketscloud.org/','https://hypnoticamusic.timepad.ru/event/2404197/',false,false,NULL,NULL,'2023-05-17 13:50:22','2023-10-16 02:35:18',NULL,'','0',18,105),
	 (937,'Corpus One','2023-05-19-gazgolder-corpus-one','2023-05-19',NULL,'23:55:00',NULL,'<p>Безмятежные майские волны привели наш музыкальный корабль в точку бесконечного веселья.<br><br>19 мая команда CORPUS ONE высаживается в Gazgolder Club, чтобы затянуть вас в водоворот ритмов и эмоций.&nbsp;<br><br>За неповторимую музыкальную атмосферу отвечают профессионалы сцены и друзья комьюнити, в руках которых палитра минималистичного и хаус-звучания заиграет миллионами красок, как цветущий майский сад.<br><br></p>',1000,'',2,35,1,'https://moscow.qtickets.events/72044-corpus-one-at-gazgolder','',false,false,NULL,NULL,'2023-05-17 13:56:47','2023-10-25 00:11:28',NULL,'','0',18,96),
	 (938,'Jardin De Bliss','2023-05-20-bar-strelka-jardin-de-bliss','2023-05-20',NULL,'23:00:00',NULL,'<p>В субботу в «Стрелке» — специальный выпуск вечеринки Jardin De Bliss. Играют резиденты Pachino и Dj Wedding, а приглашенным гостем станет диджей и продюсер Digital Ivan.</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,NULL,'2023-05-17 14:00:33','2023-10-24 21:23:02',NULL,'','0',18,159);
INSERT INTO public.events (id,title,slug,start_date,end_date,start_time,end_time,description,price_from,price_gate,city_id,venue_id,event_type_id,tickets_url,info_url,is_cancelled,is_featured,deleted_at,user_id,created_at,updated_at,ticketscloud_event_id,ticketscloud_event_token,ticketscloud_event_multi,age_limit,"views") VALUES
	 (939,':DATA','2023-05-20-rndm-data','2023-05-20',NULL,'22:00:00',NULL,'<p>В эту ночь к нам едет Reknek - продюсер из Санкт-Петербурга, ворвавшийся на сцену своими плотными фанковыми барабанами и басами лишь в прошлом году, но уже успевший выпустить релизы на Engage Audio, Citate Forms, Impact и у нас на Data Music.<br>Компанию ему составит Fulltek - столичный продюсер, знакомый нам по безумному "Red Phone EP" и синглу "Husky".<br>Открывает вечеринку владелец винилового лейбла Okbron Records, активно выпускающий потерянные бриллианты музыкантов со всего света - Gutta.<br><br>Резидентский состав ночи - хорошо знакомые вам DJ</p>',500,'',2,27,1,'https://moscow.qtickets.events/72152-data','',false,false,NULL,NULL,'2023-05-17 14:05:19','2023-10-24 21:12:04',NULL,'','0',18,70),
	 (940,'CLUB NIGHT','2023-05-26-rndm-club-night','2023-05-26',NULL,'22:00:00',NULL,'<p>26 мая на Club Night мы встречаем уже полюбившихся нам артистов - легендарного резидента "Arma 17" с особенной селекцией - Hipushit и лучезарного артиста из Popoff Kitchen, выступления которого приводят в движение даже деревья - Рому Пташенко.&nbsp;<br><br>Принимают гостей в "домике" наши резидентские звезды, продюсеры, лайверы и диджеи - Rayme и Etrigan. А откроет наш ивент молодая артистка, участница прошедших Open Decks и New Faces Night - Ephire.</p>',500,'1000.0',2,27,1,'https://rndm.ticketscloud.org/e/64621fa75545a5f488a78e8b','https://t.me/rndmcIub/59',false,false,NULL,NULL,'2023-05-17 14:08:24','2023-10-25 11:16:43',NULL,'','0',18,138),
	 (941,'МОСОБЛЭЛЕКТРО x ORGAN BOYS CLUB','2023-05-20-slezy-mosoblelektro-x-organ-boys-club','2023-05-20',NULL,'22:00:00',NULL,'<p>Короче, Слёзы. МОСОБЛЭЛЕКТРО &amp; Organ Boys Club. Прямая бочка против ломаной. Вход за бабки.</p>',300,'400.0',2,102,1,'','https://vk.com/moexobc2005',false,false,NULL,NULL,'2023-05-17 14:37:52','2023-10-23 13:30:47',NULL,'','0',18,124),
	 (942,'FUNKY ROOF','2023-06-02-roof-place-funky-roof','2023-06-02','2023-06-03','23:59:00','06:00:00','<p>2 июня Funky You!&nbsp; встречает лето на&nbsp; крыше Roof Place с видом на Финский залив!&nbsp;<br><br>Устроят ночное путешествие по волнам любимой музыки в честь открытия летнего сезона 2023. Здесь ваши сердца будут биться в одном ритме с характерным фанки настроением.<br><br>Как всегда, за вертушками резиденты Funk You! и друзья</p>',500,'',1,176,1,'https://funk-you.timepad.ru/event/2401382/','https://vk.com/funkyouspring',false,false,NULL,NULL,'2023-05-17 14:49:15','2023-10-21 13:09:02',NULL,'','0',18,158),
	 (957,'Warehouse','2023-05-26-propaganda-warehouse','2023-05-26',NULL,'23:00:00',NULL,'<p>Пятничный Warehouse по-традиции пройдет под звуки техно с интересным электро-завершением. В лайнапе отметились завсегдатаи клуба.</p>',0,'500.0',2,101,1,'','https://t.me/propagandamoscow',false,false,NULL,NULL,'2023-05-23 16:48:57','2023-10-01 00:07:37',NULL,'','0',18,89),
	 (943,'Дикое Диско','2023-05-19-roof-place-dikoe-disko','2023-05-19','2023-05-20','22:00:00','06:00:00','<p>Первая летняя вечеринка от Дикого Диско (https://t.me/dikoedisco) в эту пятницу — открывают сезон красиво на крыше Roof place с видом на залив.&nbsp;<br><br>В программе закат и рассвет на двух танцполах:<br>- главный с выходом на крышу и лучшими хитами с 92 по 2011.<br>- и альтернативный — с сюрпризами, музыкальными экспериментами и исследованиями.<br>Будет всё: от классики, хип-хопа и рока, до брит-попа, экспериментальной электроники, советских хитов и этнического техно под утро.<br><br>Дресс-код: детский, дурацкий и озорной! Позвольте себе любые глупости. Много цвета. Котята и мишки. Цветы и гольфы до колена. Нежные платья. Шорты и панамы.<br><br>У вечеринки свой манифест! Задачи таковы: найти в себе самое лёгкое. Дать волю фантазии. Освободиться (о, а это, впрочем, задача каждого Дикого Диско). Вспомнить про приключения. Про интерес. Про искренность, любопытство и особую любовь и доверие к миру: к природе, к животным, к людям.</p>',1500,'',1,176,1,'https://dikoe-disko.timepad.ru/event/2401840/','',false,false,NULL,NULL,'2023-05-17 14:54:47','2023-10-24 22:05:00',NULL,'','0',18,146),
	 (944,'Морская / Севкабель Порт','2023-06-03-port-sevkabel-morskaia-sevkabel-port','2023-06-03',NULL,'23:00:00',NULL,'<p>Вечеринка-открытие летнего сезона. Сразу 4 промо-группы и 4 сцены<br><br>1 сцена — Roots United, короли хауса и электроники, создатели фестиваля Present Perfect и главного летнего курорта К-30<br><br>2 сцена — AVG, та самая глэм-группировка пати киллеров, хип-хоперов, рэперов и битмейкеров заглавными буквами и без перерыва<br><br>3 сцена — Odyssey: длинные балийские волны, северная фолктроника и космо-карнавал<br><br>4 сена — Дикое Диско, настоящая дискотека про любовь и вечное лето, на которой дико нарядная и дико веселая публика пляшет под Ветлицкую и Depeche Mode<br><br>В этот раз будет приятный бонус в виде работающего всю ночь night-маркета от Интеллигетной барахолки. Бары, кафе и фудтраки Порта тоже будут работать до утра</p>',1200,'',1,177,1,'https://sevcableport.ru/ru/afisha/morskaya-vecherinka','',false,false,NULL,NULL,'2023-05-17 15:02:57','2023-10-19 00:43:48',NULL,'','0',18,334),
	 (945,'NEW WAVE','2023-06-03-mutabor-new-wave','2023-06-03',NULL,'23:00:00',NULL,'<p>Bpm block и VENT объединяют силы в фестивале NEW WAVE.&nbsp;Два дня в беспрерывно качающем 3 танцпола Мутабора поле, цветущем новыми красками.&nbsp;</p>',1000,'',2,2,1,'https://newwavefest.timepad.ru/event/2419295/','',false,false,NULL,NULL,'2023-05-17 15:09:22','2023-10-22 20:45:55',NULL,'','0',18,323),
	 (946,'NYPRA X NITI - UNDERKICKBOXINGSHOW ’','2023-05-19-mutabor-nypra-x-niti-underkickboxings','2023-05-19',NULL,'23:00:00',NULL,'<p>первый крупный бочка-митап лейблов NYPRA и NITI на привычной локации в авторском представлением о темном клаббинге и дип дайвом в нипранити вселенную на двух сценах:<br>1UNDER - NYPRA NITI core<br>2KICKBOXING - united dj’s +&nbsp; &nbsp; &nbsp; &nbsp; show&nbsp; &nbsp;&nbsp;</p>',1100,'',2,2,1,'https://nypra.tech','',false,false,NULL,NULL,'2023-05-18 14:18:36','2023-10-16 09:46:39',NULL,'','0',18,153),
	 (947,'АБСТРАСЕНЦИЯ','2023-05-20-treff8-club-abstrasenciia','2023-05-20',NULL,'23:30:00',NULL,'<p>20 мая фестиваль атмосферной электроники Абстрасенция возвращается в Москву с масштабной музыкальной программой.&nbsp;<br>На двух сценах культурной площадки, расположенной в старинном особняке революционных годов, выступят 14 электронщиков.</p><p>На фестивале выступит проект Mogga Ocean от продюсера Марии Шостакович, внучки советского композитора Дмитрия Шостаковича. Состоится долгожданное возвращение с лайвом электронного проекта Inchange из Владимира. Впервые в Москве выступят Dveyl и Jöninēs. Будут презентации альбомов от kiyán и Jöninēs, которые выйдут летом на лейбле Абстрасенции. Reddy Sample из города Тотьма, мастер гипнотических ритмов, выступит с ярким лайвом. Академический музыкант, основатель проекта О чём классика — Регина Solar Bird представит сет с живой оркестровой флейтой.</p>',900,'',2,84,1,'https://abstrasension.ru/moscow_treff8','https://abstrasension.ru/moscow_treff8',false,false,NULL,NULL,'2023-05-18 14:25:26','2023-10-22 23:16:41',NULL,'','0',18,208);
