	 (948,'.txt ','2023-05-20-mixed-txt','2023-05-20',NULL,'22:00:00',NULL,'<p>В этот раз вечеринка пройдёт в расширенном составе.&nbsp;<br><br>Утончённый минимал вайб, меланхолия и танцевальный грув — все, как вы любите ✨<br>Это именно те ориентиры, которые не дадут вам заблудиться в головокружительном ночном путешествии.</p>',NULL,'500.0',1,59,1,'','https://t.me/house_music_head',false,false,NULL,NULL,'2023-05-18 15:59:40','2023-10-19 15:42:56',NULL,'','0',18,53),
	 (949,'ОТЕЛЬ КАЛИФОРНИЯ /  ЭПИЗОД 13','2023-05-20-wei-by-vertical-otel-kaliforniia-ep','2023-05-20','2023-05-21','23:00:00','06:00:00','<p>Как всегда яркая вечеринка с запоминающимся составом диджеев, приглашенным гостем из Москвы - Gucci Kale (диджей ÖMANKÖ)&nbsp; и с вами в главной роли.</p>',900,'',1,178,1,'https://spb.qtickets.events/72005-otel-kaliforniya-epizod-13','',false,false,NULL,NULL,'2023-05-18 16:48:00','2023-10-25 18:20:18',NULL,'','0',18,88),
	 (964,'Грядёт','2023-05-27-community-moscow-griadet','2023-05-27',NULL,'21:00:00',NULL,'<p>Бар-библиотека Community превратится в мекку прогрессивной электроники. Команда «Грядёт» устроит вечеринку, главным гостем которой станет минский продюсер Kostya Outta. Он поделится своими свежими работами и эксклюзивными анрелизами.</p>',1500,'',2,58,1,'https://moscow.qtickets.events/71671-g-r-ya-d-e-t-progressive-kostya-outta','https://vk.com/gryadetprogressive',false,false,NULL,NULL,'2023-05-23 17:45:07','2023-10-22 10:42:40',NULL,'','0',18,150),
	 (983,'HAKAN OZURUN','2023-06-03-warpp-hakan-ozurun','2023-06-03',NULL,'23:00:00',NULL,'<p>Hakan Ozurun описывает свой 15-летний музыкальный стиль, как баланс между глубокой и атмосферной прогрессивной музыкой. Сильные прогрессивные басовые партии в сочетании с воздушными мелодичными чувствами, далеко не депрессивные, танцевальные, заряжающие позитивом и раскрывающие самые потаённые чувства.<br>&nbsp;</p>',555,'',1,23,1,'https://warppclub.com','',false,false,NULL,NULL,'2023-05-24 19:28:40','2023-10-25 14:55:30',NULL,'','0',18,119),
	 (950,'MIDNIGHT IN PARIS 3 at DFF!','2023-05-19-deep-fried-friends-midnight-in-paris-3','2023-05-19','2023-05-20','00:00:00','05:00:00','<p>В эту пятницу в ресторане прогремит долгожданное продолжение одной из самых весёлых и запоминающих вечеринок последних месяцев — MIDNIGHT IN PARIS.&nbsp;<br>Уже по сложившейся традиции, в лайн-апе легендарная троица: человек-праздник, создатель серии вечеринок Love Boat, любимый и неподражаемый ВИТАЛИЙ КОЗАК, харизматичный сердцеед, мастер уменьшительно-ласкательных слов, топовый диджей и музыкант Миша Месхия aka D’MASELLE, принц ночной Москвы, амбассадор любви и доброй музыки ЕФИМ ГИНЗБУРГ! Дополнит весёлую компанию лучший светский фотограф и создательница Central Park Mag — АЛЁНА ЧЕНДЛЕР</p>',NULL,'1000.0',2,76,1,'','',false,false,NULL,NULL,'2023-05-19 10:50:51','2023-10-10 03:45:27',NULL,'','0',18,108),
	 (951,'GIRLS, GIRLS, GIRLS at DFF!','2023-05-20-deep-fried-friends-girls-girls-girls','2023-05-20','2023-05-21','00:00:00','05:00:00','<p>В субботу, ровно в полночь и до утра, за пультами наши прекрасные герлс, а именно: жемчужина отечественной электронной сцены, продюсер и музыкант KEDR LIVANSKIY, певица FAVLAV, основательница лейбла Друг Records и участница культового трио ДК Детка — NATASHA BAI, создательница серии вечеринок Only Fems, очаровательная RIMMA KIM, а также модель и диджей CVXVP<br>&nbsp;<br>Вход платный&nbsp;<br>FREE — 23:59 - 1:00<br>500₽ — 1:00 и до конца</p>',0,'500.0',2,76,1,'','',false,false,NULL,NULL,'2023-05-19 10:55:53','2023-10-16 17:26:16',NULL,'','0',18,65),
	 (952,'Уроды','2023-05-19-kontrkult-urody','2023-05-19',NULL,'23:00:00',NULL,'<p>Готовьте свои отбитые булки для жесткого разноса на пятничных УРОДАХ&nbsp;<br><br>Вместе с диджеями ворвутся в дикие танцы шум, крики, вопли и ритмы, меняющие разум даже самых продвинутых музыкальных гениев. Можете забыть всё, что вы знали о жестких рейвах, ведь этот вечер перевернет ваше сознание и заставит разрываться даже самые закаменелые сердца.<br><br>За пультом соберутся артисты, которые в своем познании настолько преисполнились, будто бы уже сто триллионов миллиардов лет проживают на триллионах и триллионах таких же планет и будут разрывать танцпол до последнего выжившего.<br><br>Вход — 400₽ до полуночи, 600₽ — после&nbsp;</p>',400,'600.0',1,33,1,'','',false,false,NULL,NULL,'2023-05-19 15:36:35','2023-10-13 00:27:02',NULL,'','0',18,42),
	 (953,'Wave Cannel','2023-05-19-union-wave-cannel','2023-05-19',NULL,'22:00:00',NULL,'<p>19.05 Wave Channel в Union bar<br><br>В эту пятницу, после продолжительного перерыва, команда Wave Channel,&nbsp; возвращается в стены резидент-площадки Union Bar&nbsp;<br><br>Музыкальная программа будет самая разнообразная, но в исконных жанрах промо, а именно танцевальных стилях электроники и хип-хопа, таких как uk garage, grime, afrobeat, baile funk, drill и многих других<br><br>Вход до 23:00 free, после 500₽</p>',0,'500.0',1,8,1,'','',false,false,NULL,NULL,'2023-05-19 15:49:56','2023-10-15 00:59:17',NULL,'','0',18,74),
	 (954,'Bassmatic','2023-05-26-community-moscow-bassmatic','2023-05-26',NULL,'23:00:00',NULL,'<p>Непередаваемый запах книг и звон бокалов.<br>Почти осязаемые волны фирменного звучания Bassmatic Records и отражающееся от сотен пар сетчаток глаз световое шоу.<br>Потоки невербальной энергии, проходя сквозь сердца гостей, спиралью закручиваются на танцполе.</p><p>⋯⋯⋯⋯⋯⋯⋯⋯⋯⋯<br>Этот рецепт отличного праздника мы разработали и проверили уже на двух вечеринках в этом прекрасном месте, и вот пришло время третьей закрепляющей, чтобы насладиться этим сочетанием ингредиентов ещё раз!<br>⋯⋯⋯⋯⋯⋯⋯⋯⋯⋯<br>26 мая, клуб-библиотека Community. Приходи и попробуй Bassmatic Box на вкус!</p>',1990,'',2,58,1,'https://bassmaticrecords.com/','',false,false,NULL,NULL,'2023-05-23 15:34:11','2023-10-12 06:34:20',NULL,'','0',18,105),
	 (965,'Club Night','2023-05-27-propaganda-club-night','2023-05-27',NULL,'23:00:00',NULL,'<p>Клубная ночь в субботу примет Sengiley Wax — отечественный лейбл с акцентом на хаус и брейкс. Куратор Denis Kazakov пригласил энергичных Pachino и Classonix.&nbsp;</p>',0,'500.0',2,101,1,'https://t.me/propagandamoscow','',false,false,NULL,NULL,'2023-05-23 17:49:21','2023-10-18 18:07:00',NULL,'','0',18,103);
