	 (955,'АНАНДА ФЕСТ','2023-07-28-aviator-ananda-fest','2023-07-28','2023-07-30',NULL,NULL,'<p>Трансформационный фестиваль Ананда - это:</p><ul><li>3 танцпола</li><li>более 40 ди-джеев и музыкантов</li><li>ярмарка</li><li>кемпинг</li><li>спортивные площадки</li><li>семинары и практики</li><li>медитации</li><li>экстатик рэйв</li><li>и ещё много всего интересного!<br><br></li><li><h3>Сцены</h3></li><li><strong><br>EDM Stage<br></strong><br>Хедлайнеры мировой и Российской электронной сцены взорвут актуальными сетами главный танцпол «Ананды»<br>Масштабное световое и лазерное шоу в сочетании со 100 киловаттным звуком Martin Audio и визуальным рядом на огромных экранах проведут в незабываемое путешествие в мир музыки и танца.<ul><li>Стили музыки: EDM, Psy, Breaks, Drum''n''Bass, Progressive, Ambient...</li><li>+ VIP зона</li><li>+ STAGE PASS зона</li></ul></li><li><strong><br>TECHNO Stage<br></strong><br>Второй основной танцпол соткан из технологий и качественного звука 100 вт Martin Audio, светового шоу, лазеров и масштабных видео инсталляций.&nbsp; Мощнейший саунд на протажении 2х дней обеспечивают лидеры Российской техно сцены.<ul><li>Стили музыки: Techno, Hard Techno, Deep Techno, Hypnotic, Minimal...</li><li>+ VIP зона</li><li>+ STAGE PASS зона</li></ul></li><li><strong><br>HOUSE Stage<br></strong><br>Глубокие ночные вайбы и сумасшедшие дневные вечеринки. Харизматичные диджеи и красивые люди будут окружать тебя круглосуточно. Пока длится Ананда - HOUSE танцпол будет заряжать тебя своей энергией и глубиной.<ul><li>Следи за лайнапом - в нем ты найдешь самые модные проекты и диджеев.&nbsp;</li><li>Стили музыки: House, Organic, Progressive house, Melodic, Tech, Deep, Electronica...</li><li>+ VIP зона</li></ul></li><li><strong><br>CHILL/LIVE Stage<br></strong><br>Что нужно для счастья? Конечно же, баланс!<br>Слушай • Чувствуй • Созерцай • Проникайся красотой • Осознавай себя и своё истинное предназначение<br>Мы создали место, в котором вы сможете просто БЫТЬ!<br>Отдых моральный и физический под звуки живой музыки, душевные песни и лёгкую атмосферу — то, что идеально дополнит насыщенные дни фестиваля</li></ul>',3700,'',8,179,3,'https://anandafest.ru/shop/','https://vk.com/anandafest',false,false,NULL,NULL,'2023-05-23 16:32:01','2023-10-22 01:00:28',NULL,'','0',18,344),
	 (1031,'JARDIN DE BLISS','2023-06-02-powerhouse-jardin-de-bliss','2023-06-02',NULL,'23:00:00',NULL,'<p>&nbsp;Вечеринка с диджей-сетами на стыке всех танцевальных направлений. Новый эпизод JARDIN DE BLISS в «Паверхаусе» примет певицу Полину Favlav, диджея Фила Гинзбурга, продюсера DJ Wedding и других локальных артистов.&nbsp;<br><br>Вход - донейшен (сумма определяется вашим желанием)</p>',NULL,'',2,5,1,'','',false,false,NULL,NULL,'2023-05-31 22:25:25','2023-10-21 00:36:58',NULL,'','0',18,83),
	 (958,'Δека∇ance: Nature desire ','2023-05-26-slezy-dekaance-nature-desire','2023-05-26',NULL,'20:00:00',NULL,'<p>Клуб Слёзы преобразится в настоящий сад: розы распустятся за диджейкой, танцпол завьется лианами, а на веранде аромат благовоний и чая позволят гармонично настроиться на внутреннюю техно-рефлексию<br><br>Как адепты техно-театра, мы начнем с прелюдии в 20:00, чтобы вместе прочувствовать весь спектр нашего любимого жанра от гипнотических мелодий до утреннего харда.&nbsp;<br>Но не будем раскрывать все карты сразу - следите за постами! Но намекнём, что перфомансов будет ещё больше, а ивент разделится на две части:&nbsp;<br><br>Мы решили начать раньше, чтобы даже самые ранние пташки заглянули в гости на техно-хаус и заценили зелёный своп!<br><br>DC: gothic, street-wear, monochrome, fetish, flower and nature elements</p>',500,'800.0',2,102,1,'','',false,false,NULL,NULL,'2023-05-23 17:02:42','2023-10-21 12:24:35',NULL,'','0',18,80),
	 (959,'Экстаз ','2023-05-26-bar-strelka-ekstaz','2023-05-26',NULL,'23:00:00',NULL,'<p>Тёплые летние ночи возвращаются, а значит на выходных устраиваем танцы во дворике у бара.&nbsp;<br><br>В пятницу — вечеринка Ильи Булгакова «Экстаз». За пультом сам основатель серии и наша давняя подруга Даша Уточка&nbsp;</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,NULL,'2023-05-23 17:10:29','2023-10-23 22:56:23',NULL,'','0',18,92),
	 (960,'Night Train to the East','2023-05-27-bar-strelka-night-train-to-the-east','2023-05-27',NULL,'23:00:00',NULL,'<p>Тёплые летние ночи возвращаются, а значит на выходных устраиваем танцы во дворике у бара.&nbsp;<br>В субботу отправляемся в музыкальное путешествие на восток с главными дигерами города: пластинки ставят сооснователь магазина DIG Иван Смекалин, коллекционер винила Тони Лаврутц (Lavraj Lav) и автор паблика World Music Geeks Василий Минков.</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,NULL,'2023-05-23 17:16:10','2023-10-07 20:52:01',NULL,'','0',18,170),
	 (961,'NOIR BAZAAR x DICHKA','2023-05-26-blanc-noir-bazaar-x-dichka','2023-05-26',NULL,'22:00:00',NULL,'<p>Большой летний Нуар Базар в московском Бланке. Два больших танцпола, на одном из них NOIR BAZAAR, на другом — DICHKA, вечеринки от великого и ужасного дуэта Geju, познакомившего нас с чиллрейвом. Буквально вчера на Бернинг Мене, а сегодня уже у нас — вот такой круговорот талантов в отдельно взятом ориентальном микрокосме. Кроме того, будет открыт дворик, так что встретим закат и проживем отличную московскую ночь.&nbsp;</p>',900,'',2,36,1,'https://moscow.qtickets.events/71472-noir-bazaar-x-dichka','https://t.me/blanc_msk',false,false,NULL,NULL,'2023-05-23 17:21:59','2023-10-22 12:23:22',NULL,'','0',18,97),
	 (962,'Большие Камыши','2023-05-26-prostranstvo-pole-bolsie-kamysi','2023-05-26',NULL,'21:00:00',NULL,'<p>Вечеринка-курорт в «поле», где пройдут лайвы и танцы со встречей заката. Начинаем с лежаний на гамаках и ритмичных, но плавных танцев во дворе, а затем перебираемся внутрь клуба</p>',800,'',2,46,1,'https://bolshiekamishi.ticketscloud.org/','',false,false,NULL,NULL,'2023-05-23 17:27:47','2023-10-22 13:35:08',NULL,'','0',18,59);
