	 (963,'SYSTEM ONE HUNDRED AND EIGHT','2023-05-26-bauns-system-one-hundred-and-eight','2023-05-26',NULL,'22:00:00',NULL,'<p>Братики и сестренки, 26 мая мы встретимся на первом в этом году летнем лейблнайте System 108<br><br>Пройдёт он на двух танцполах клуба БАYНС —&nbsp;мейне от артистов коалиции 108 и коллег и близких по духу, а также на втором, где, взявшись за руки с братиками и сестренками, мы отметим дни рождения братиков Tjur и Mrak. Полный лайнап ниже</p>',1300,'',2,17,1,'https://system108.com/','https://t.me/system108',false,false,NULL,NULL,'2023-05-23 17:35:36','2023-10-02 02:32:01',NULL,'','0',18,105),
	 (1040,'Пятница в Котельной','2023-06-02-bar-kotelnaia-piatnica-v-kotelnoi','2023-06-02',NULL,'22:00:00',NULL,'<p>Вход свободный с деликатным фейсконтролем</p>',NULL,'0.0',2,137,1,'','',false,false,NULL,NULL,'2023-06-02 13:37:23','2023-07-09 20:12:15',NULL,'','0',18,33),
	 (994,'CREAM SODA × РАДУГА','2023-05-27-radio-cream-soda-raduga','2023-05-27',NULL,'18:00:00',NULL,'<p>&nbsp;У знаменитой российской хаус-группы Cream Soda вышел новый альбом. В честь этого проект совместно с диско-клубом «Радуга» устраивает веселую вечеринку в «Радио», где выступит с лайвом. Поддержат группу диджей-сетами её ближайшие соратники&nbsp;</p>',1500,'',2,149,1,'https://radugadiscoclub.ru/e270523','https://t.me/radugasuperclub/6003',false,false,NULL,NULL,'2023-05-25 12:58:12','2023-10-23 19:29:27',NULL,'','0',18,158),
	 (969,'Jukebox by Dietlove','2023-05-23-union-jukebox-by-dietlove','2023-05-23',NULL,'21:00:00',NULL,'<p>Волна редкого винила надвигается. Уже се-го-дня в <a href="https://vk.com/union.place">UNION</a> Саша Яковлев из <a href="https://vk.com/nina_record_store">NINA Record Store</a> и Soul Sista будут раскачивать ваше тело и душу самыми неожиданными пластинками. Джазовые мотивы Чикаго, альтернативное (не)диско Нью Йорка, моторик-ритмы, музыка народов мира, хип-хоп и фанк. Заманчиво, не так ли? Погружаться в эту неожиданную смесь начнем в 21:00, вход фри.</p>',NULL,'0.0',1,8,1,'','',false,false,NULL,NULL,'2023-05-23 18:12:40','2023-08-29 16:12:32',NULL,'','0',18,20),
	 (970,'GAS','2023-05-27-gas-gas','2023-05-27',NULL,'23:30:00',NULL,'<p>Живые есть после выходных? Тогда продолжаем! &nbsp;<br>27 мая отдыхают все&nbsp;<br>Во-первых, день города&nbsp;<br>Во-вторых, последняя суббота весны&nbsp;<br>В-третьих, мы официально открываем GAS MEDIA CLUB&nbsp;<br><br>ЧТО ЭТО ЗНАЧИТ?<br>Обновлённый&nbsp; состав DJ’s<br>Два плэйса сразу: open air + main stage&nbsp;<br>Новые летние коктейли в меню и это всё еще не всё</p>',500,'',1,57,1,'','',false,false,NULL,NULL,'2023-05-23 18:21:53','2023-10-20 23:30:56',NULL,'','0',18,68),
	 (971,'Hardstyle Cruise + Hardcore Afterparty','2023-06-03-factory-3-hardstyle-cruise-hardcore-a','2023-06-03','2023-06-04','19:30:00','06:00:00','<p>3 июня в Factory 3 пройдет HARDCORE AFTERPARTY после вечеринки на двухпалубном теплоходе HARDSTYLE SUNSET CRUISE.<br>Вход на Afterparty для участников круиза бесплатный! <br>Для всех остальных — 500р, оплата на входе.</p>',500,'2500.0',1,7,1,'https://t.me/redblackdj','',false,false,NULL,NULL,'2023-05-23 18:31:43','2023-10-23 19:59:49',NULL,'','0',18,216),
	 (972,'Слияние Фестиваль','2023-07-13-sliianie-festival','2023-07-13','2023-07-16','17:00:00','17:00:00','<p>Эко-кемпинг Слияние - гармоничное сочетание современных искусств:<br>музыки, видео и театра под открытым небом, а также единение с природой и актуальная танцевальная электроника<br>Изюминкой станут выступления различных музыкантов!<br>50 музыкантов и dj''s | 4 дня фестиваля | 2 танцевальных пространства<br>звук «Волновод» | Лазерное шоу | Светодиодные перфомансы<br>Детская зона | Лесная кухня и фудтраки | Кинотеатр | Ярмарка<br>База отдыха в 200 км от Москвы</p>',2000,'',2,NULL,3,'https://d-fusionfest.ru/#bilets','',false,false,NULL,NULL,'2023-05-24 16:03:23','2023-10-24 20:53:49',NULL,'','0',18,552),
	 (973,'Odyssey Carnival Festival','2023-06-24-odyssey-carnival-festival','2023-06-24',NULL,NULL,NULL,'<p>Пять элементов, пять стихий, пять сущностей, пять миров и пять лет… Всемирный змей Уроборос кусает себя за хвост и мы возвращаемся туда, откуда начали!<br>24 июня в городе на Неве, колыбели трех революций и месте рождения Одиссеи, вспыхнет синергия любви, счастья, жизни, музыки и света — 5th Element!&nbsp;<br>Буйство энергий огня, медитативность воды, легкость воздуха, твердь земли и ещё один, секретный мир ждут тебя в 5 пространствах, различаемых не только визуально, но и по музыке…</p><p>Ну и конечно, главный элемент, без которого ничто не сможет скрепить эти частицы, чтобы родилась настоящая сказка и легенда, которую мы творим вместе уже пять лет — это ты!<br>Лилу, готовь мультипаспорт, мы отправляемся к звёздам!</p>',3330,'',1,NULL,3,'https://odysseyfestival.timepad.ru/event/2392699/?utm_source=y_direct&utm_medium=cpc&utm_campaign=master_campaign&yclid=2797241883438421807','https://vk.com/odysseyfestival',false,false,NULL,NULL,'2023-05-24 16:55:05','2023-10-23 18:41:28',NULL,'','0',18,413),
	 (974,'Rooftop Day Party! ','2023-05-27-hi-so-terrace-rooftop-day-party','2023-05-27',NULL,'18:00:00',NULL,'<p>Папа в здании! Юра ZOKZOK возвращается в дело с дневными Rooftop вечеринками на крышу HI-SO Terrace на террасе отеля SO/St.Petersburg и с новым промо WOW!<br><br>&nbsp;Для открытия сезона есть 3 шумных повода:&nbsp;<br><br>- День рождения любимого Санкт-Петербурга;<br>- День рождения Юрия ZOKZOK;<br>- День рождения Mike Spirit, который приезжает из столицы с шоу-кейсом в компании Давида DAVO.&nbsp;<br><br>Николай FANICK и Максим M.Ti будут отвечать за локальную поддержку основной части мероприятия в дневное время.&nbsp;<br><br>Но это еще не все! Вас ждут специальные декорации!&nbsp;<br><br></p>',1500,'',1,180,1,'https://wowxhighway.ticketscloud.org/','',false,false,NULL,NULL,'2023-05-24 17:13:14','2023-10-24 21:02:45',NULL,'','0',18,169),
	 (975,'Количество Тепла','2023-05-27-solaris-lab-kolicestvo-tepla','2023-05-27',NULL,'16:00:00',NULL,'<p>Настало время тепла, 27 мая атмосфера аутентичной крыши Петербурга, диджеи и музыканты на финише весны создадут настроение нужное каждому.<br><br>Поймай май в кругу друзей на вечеринке в Солярисе. Великолепный вид и оригинальная музыка - то, что нужно для получения твоего Количества Тепла.</p>',1200,'',1,106,1,'https://spb.qtickets.events/72577-kolichestvo-tepla','',false,false,NULL,NULL,'2023-05-24 17:27:28','2023-10-03 02:22:08',NULL,'','0',18,90);
