	 (1041,'Суббота в Котельной','2023-06-03-bar-kotelnaia-subbota-v-kotelnoi','2023-06-03',NULL,'22:00:00',NULL,'<p>Вход свободный с деликатным фейсконтролем</p>',NULL,'0.0',2,137,1,'','',false,false,NULL,NULL,'2023-06-02 13:42:11','2023-10-19 22:13:59',NULL,'','0',18,62),
	 (982,'Vibe Room','2023-05-27-union-vibe-room','2023-05-27',NULL,'23:00:00',NULL,'<p>В эту субботу мы открываем полноценный портал в лето на Литейном, 55. Как обычно, забираем себе оба танцпола: на мейн стейдже во дворе ставим все самое лучшее и любимое из мира хип-хоп музыки, а бар отдаем под электронику и делаем свою версию Бергхайна.<br>К слову, Denis Yuzhin, празднующий sweet 30, возможно отыграет сет уже из 30 викендов подряд (прошлогодние 29 викендов оказались не шуткой, так что текста Starboy, The Hills, Creepin'' и свеженького Double Fantasy все же стоит подучить).<br><br>P.S Aфиша уже сейчас забирает гран-при в голосовании на лучший артворк Vibe Room 2023</p>',NULL,'500.0',1,8,1,'','',false,false,NULL,NULL,'2023-05-24 19:24:20','2023-10-21 15:06:00',NULL,'','0',18,90),
	 (976,'Пиратская Cтанция','2023-11-04-vk-stadium-piratskaia-ctanciia','2023-11-04',NULL,NULL,NULL,'<p><em>Забудешь страхи и сомненья,</em><br><em>Едва лишь ты достигнешь дна.</em><br><em>Неведомо для тех, кто сверху,</em><br><em>Что скрывает глубина…</em></p><p>Много веков пытаются люди разгадать секрет исчезновения Атлантиды — мифического государства-острова, сгинувшего в пучине океана. Лишь тому, кто не побоится совершить погружение, полное чудес и опасностей, откроется тайна, хранимая тёмной водой…</p><p>Впервые в Москве! Премьера 2023 года от Радио Рекорд — drum&amp;bass спектакль «Пиратская Станция» с постановкой «Atlantis».</p><p><em>* Состав артистов будет объявлен в социальных сетях Пиратской Станции. Первая партия билетов по специальной цене — в продаже.</em></p>',2000,'',2,73,3,'https://msk.showgogo.ru/events/concerts/piratskaya-stantsiya-atlantis-msk/04.11.23-22.00/','',false,false,NULL,NULL,'2023-05-24 17:35:07','2023-10-25 16:18:33',NULL,'','0',18,779),
	 (977,'MUTABOR 4 YEARS','2023-05-27-mutabor-mutabor-4-years','2023-05-27',NULL,'23:00:00',NULL,'<p>Пришло время перепроверить концепт «Я превращусь», с которым клуб заявил о своем существовании в далеком 2019 году!<br>Клуб отметит четырехлетие в субботу 27 мая масштабным танцевальным ивентом.<br><br>Задействованы все сцены и пространства магического бруталистского замка Mutabor. Таймтейбл — до утра понедельника.<br><br>На подмостках уикенда превращений и иллюзий! Классика элитных промбоксов: кинетические инсталляции — репетитивность как стиль и смысл.<br><br>А именно.<br><br>Кинетический зооморфизм в галерее образов на главной сцене: рыбы, ящер и, обязательно, аист.<br><br>Медиум. Колесо сансары в театре теней — закольцованное происхождение видов.<br><br>Авторы инсталляций Алексей Королев (Arma17) и Антон Левдиков. Художник по свету Филипп Раммо.<br><br>Большой объект в саду Mutabor: "тактильный" корабль — готовит объединенная творческая группировка OTG.ZAVOD.</p>',NULL,'2500.0',2,2,1,'https://mutabor.club/m4/','',false,false,NULL,NULL,'2023-05-24 17:49:12','2023-10-22 18:28:11',NULL,'','0',18,145),
	 (978,'ЭЛЕКТРОПОЛЕ ','2023-06-10-temple-of-deer-elektropole','2023-06-10',NULL,'17:00:00',NULL,'<p>Первый фестиваль электронной музыки и актуального хип-хопа «ЭЛЕКТРОПОЛЕ» пройдет 10 июня под вековыми сводами пространства Temple of Deer.<br><br>Эклектичный шоукейс хэдлайнеров в мультижанровом составе, в котором музыканты, диджеи и публика становятся единым организмом в сумасшедшем семичасовом рейве.</p>',1900,'',1,22,3,'https://tod.show/elektropolee?yclid=2819028916465360832','',false,false,NULL,NULL,'2023-05-24 17:56:34','2023-10-03 08:37:29',NULL,'','0',18,170),
	 (979,'RAVENSTVO','2023-05-27-rndm-ravenstvo','2023-05-27',NULL,'23:30:00',NULL,'<p>Наконец то тепло! Тепло, тепло, ещё теплее, горячо, совсем горячо, очень горячо! Да, твоя рука в правильном месте. У меня в штанах. Именно там, где на твоём запястье материализуется браслет со смайликом. Традионно встречаем лето в самой теплой компании. Естественно я о тебе. Как и всегда, это не мы делаем вечеринку. Это ты её делаешь!<br>Вход FREE по репосту афиши в INST / 500 без репоста</p>',0,'500.0',2,27,1,'','',false,false,NULL,NULL,'2023-05-24 18:02:47','2023-10-21 18:14:05',NULL,'','0',18,94),
	 (980,'THE POMNY | EXPERIENCE х REPORT RECORDS','2023-05-26-gazgolder-the-pomny-experience-x-repo','2023-05-26',NULL,'23:00:00',NULL,'<p>26 мая встречаем компанию артистов и продюсеров двух виниловых лейблов на двух танцполах Gazgolder club.&nbsp;</p><p>Первая музыкальная постановка, организованная в логическую цепочку руками команды Experience, в составе которой специальные гости, артисты, продюсеры и локальный состав из друзей и резидентов проекта.&nbsp;<br><br>PRESALE — 999₽ (50 tickets)<br>DOORS 23:00 - 00:00 — 1 500₽<br>DOORS 00:00 - 06:00 - 2 000₽<br>DOORS 06:00 - THE END - 1 000₽</p>',999,'2000.0',2,35,1,'https://moscow.qtickets.events/71982-26052023-the-pomny-experience-kh-report-records','',false,false,NULL,NULL,'2023-05-24 19:01:33','2023-10-20 06:21:35',NULL,'','0',18,119),
	 (1012,'ШУВА × РАДУГА','2023-06-02-yauza-suva-raduga','2023-06-02',NULL,'23:00:00',NULL,'<p>Всем привет от Шувы! В этy пятницу мы увидимся на Яузе, где устроим музыкальный праздник сначала во дворе, а потом внутри. В лайнапе конц очень крутой группы НЕЕЕТ, ТЫ ЧТО, лайв LOVANDA, сет АНТОХИ МС и вся шува-бэнд<br>Начало в 20:00. Всем, кто успеет зарегаться, до 21:00 можно войти фо фри, а потом — за полтора кэса или выше. В момент входа по реге, все обладатели полноценных билетов минуют очередь</p>',0,'1500.0',2,32,1,'https://radugadiscoclub.ru/e020623','https://radugadiscoclub.ru/e020623',false,false,NULL,NULL,'2023-05-31 13:18:12','2023-10-02 08:06:39',NULL,'','0',18,92),
	 (981,'µ⁴ NONO Mutabor ','2023-05-26-mutabor-4-nono-mutabor','2023-05-26',NULL,'19:00:00',NULL,'<p>26 мая в клубе Mutabor в рамках своего четырехлетия будет перезапущена культурная программа под названием "µскусство", которая объединяет современную композиторскую музыку, хореографию и театр.<br><br>Группа энтузиастов Kymatic, занимающаяся междисциплинарными аудиальными и перформативными практиками, представит большой вечерний концерт на главной сцене Mutabor под названием µ⁴ NONO.<br><br>В рамках программы "µскусство" коллектив Kymatic представит несколько проектов с участием крупных и средних составов. Их выступления будут сопровождаться уникальной визуальной поддержкой, отражающей эстетику клуба. Лидеры коллектива приготовили серию мероприятий, в которых произведения классического музыкального авангарда и работ молодых авторов будут технически и концептуально адаптированы к сценам и философии Mutaborа.<br><br>26 мая Kymatic в расширенном составе исполнит произведения итальянского авангардистского композитора Луиджи Ноно (1924-1990).</p>',1600,'',2,2,1,'https://mutabor.club/nono/','',false,false,NULL,NULL,'2023-05-24 19:13:39','2023-10-04 11:57:36',NULL,'','0',18,106),
	 (1071,'Sunset Soirée','2023-06-16-blanc-sunset-soiree','2023-06-16',NULL,'18:00:00',NULL,'<p>Летняя вечеринка под размеренные звуки танцевальной электронной музыки.</p>',0,'1000.0',2,36,1,'https://blanc.timepad.ru/event/2465371/','',false,false,NULL,NULL,'2023-06-14 12:47:40','2023-10-12 20:49:10',NULL,'','0',18,92);
