	 (985,'KARMA','2023-05-25-rndm-karma','2023-05-25','2023-05-26','19:00:00','05:00:00','<p>В четверг, 25 мая, диджей, главный редактор и сооснователь «МЫИDEM» -&nbsp; Julia Karma отмечает день рождения.<br><br>В лайнапе: основатель серии вечеринок Warehouse и талантливейший селектор Sergey Timoshov, виновница вечера Julia Karma, заводила и ко-фаундер стриминг-проекта «Проект» Misha Gutman, звездочка Катя Errioxa, а также DURA, Shoga, Suhasya с лайвом, Laura Palmer и Queen of the Highway.</p>',NULL,'0.0',2,27,1,'','',false,false,NULL,NULL,'2023-05-24 19:49:54','2023-10-18 03:19:20',NULL,'','0',18,79),
	 (986,'SABOTAGE DRUM & BASS PARTY','2023-05-26-mod-sabotage-drum-bass-party','2023-05-26',NULL,'23:59:00',NULL,'<p>Остановись, задержи дыхание! Sabotage возвращается уже в эту пятницу и это будет эпический взрыв Drum &amp; Bass энергии! Промо-команда берёт клуб MOD под своё контрольное правление, что бы окунуться в безудержную жару ночи.<br>Собери всю свою силу воли, накрасься в яркие цвета и приготовься встретить судьбу на танцполе!&nbsp;</p>',400,'600.0',1,113,1,'https://sabotage-inc.timepad.ru/event/2428008/','https://t.me/sabotageomg',false,false,NULL,NULL,'2023-05-24 19:57:01','2023-10-23 18:26:02',NULL,'','0',18,70),
	 (987,'Neuropunk Festival','2023-05-27-aurora-hall-neuropunk-festival','2023-05-27',NULL,'23:00:00',NULL,'<p>Отечественный drum and bass фестиваль возвращается в Санкт-Петербург!<br>Отборная группа нейро-спецназа вместе с добровольцами собирается на орбитальной станции Аврора для разработки и отправки секретной миссии по поиску важных данных об Архигруве в системе Альфа Центавра.<br><br></p>',1500,'',1,25,1,'https://www.nrpnk.ru/','',false,false,NULL,NULL,'2023-05-24 20:02:35','2023-10-14 00:32:13',NULL,'','0',18,102),
	 (988,'Мираж Препати','2023-05-26-miraz-miraz-prepati','2023-05-26',NULL,'21:30:00',NULL,'<p>Без лишних прелюдий&nbsp;<br>Пятница, летка, пре-пати друга, билеты у миши авера, работаем с 21:30<br>Думаем, что поводов приехать достаточно<br><br>и САМОЕ ГЛАВНОЕ - ВХОД ТЕПЕРЬ ТОЛЬКО СО ДВОРА</p>',NULL,'',1,77,1,'','',false,false,NULL,NULL,'2023-05-24 20:44:27','2023-10-22 08:40:25',NULL,'','0',18,73),
	 (989,'GHETTO SYMPHONY','2023-05-27-miraz-ghetto-symphony','2023-05-27',NULL,'22:00:00',NULL,'<p>И сразу к делу<br><br>В субботу у нас снова гостит TESTIN G с вечеринкой GHETTO SYMPHONY<br>название выбрали не просто так, будет и гитара, и клавиши , и даже терменвокс (чтобы это ни было)<br><br>Вход 500₽ с репостом/ 700₽ без внимания к мероприятию<br>nft priority pass - вход бесплатный<br><br></p>',500,'700.0',1,77,1,'','',false,false,NULL,NULL,'2023-05-24 20:52:58','2023-09-30 17:59:10',NULL,'','0',18,60),
	 (990,'Applique','2023-05-27-gazgolder-applique','2023-05-27',NULL,'23:00:00',NULL,'<p>В субботу состоится долгоиграющая вечеринка лейбла Applique с фантастическим сюжетом<br><br>Поговаривают, что её разработчики обновят клуб до новой версии и увеличат карту летней террасы для прохождения самого захватывающего рейва сезона в жанре электро и хаус</p>',1500,'',2,35,1,'https://applique.ticketscloud.org/','',false,false,NULL,NULL,'2023-05-24 21:11:59','2023-10-24 21:17:45',NULL,'','0',18,72),
	 (1020,'Пятница в Стрелке','2023-06-02-bar-strelka-piatnica-v-strelke','2023-06-02',NULL,'23:00:00',NULL,'<p>В пятницу во дворике у бара — музыкальная ассамблея радио «Тигр». Приходите веселиться, танцевать, обниматься и поддерживать круговорот позитивной энергии. Всю ночь будут играть бэк-ту-бэк принц восточных бэнгеров Аман По-Кайфу и главарь радио «Тигр» Влад Микеев.</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,NULL,'2023-05-31 15:21:25','2023-10-10 05:56:37',NULL,'','0',18,77),
	 (991,' Базовое Техно','2023-06-10-factory-3-bazovoe-texno','2023-06-10',NULL,'23:00:00',NULL,'<p>Гостями грядущей вечеринки Базовое Техно станут ребята с Урала. Techno Room Community&nbsp; - группировка бравых энтузиастов из Екатеринбурга. Восьмой год подряд ребята развивают и продвигают рейв-культуру у себя в городе и на Урале. Techno Room позиционируется на некоммерческом и индустриальном звучании. Заводы, фабрики, шум и суета города, это вдохновение команды. Техно, наполненное мраком, атональностью и многократным повторением, тоталитарный марш и жернова, сносящие всё на своём пути. Спектр вещания Techno Room широк и многогранен, парни не загоняют себя в рамки и шаблоны, наоборот, они их неприемлят. <br>Развиваясь сами, они дают дорогу для развития единомышленникам из разных сфер: музыка, искусство, фотография, медиа-арт, регулярно внедряя в свои ивенты новые имена. За семь лет команда успела провести более ста пятидесяти ивентов, снять фильм о развитии техно в Екатеринбурге с официальной премьерой в кинотеатре, организовать три рейва в промзоне, завести добродушные отношения с ключевыми промо страны.</p>',700,'',1,7,1,'https://rupor.biz/widgets/event-tickets/833?utm_source=listing_events&utm_medium=listing_events+&utm_campaign=1006','',false,false,NULL,NULL,'2023-05-24 21:22:33','2023-10-25 18:20:44',NULL,'','0',18,354),
	 (992,'ASYLUM','2023-06-02-rndm-asylum','2023-06-02',NULL,'23:00:00',NULL,'<p>На протяжении всей ночи будет грохотать тяжелая и скоростная музыка!<br><br>Впервые на Asylum выступят молодой талант QOSS и совсем недавно вернувшийся из Батуми FRACTOON. А также ранее не замеченные на столичной сцене ZRI.SVET из Санкт-Петербурга и TOMMI из Северной Осетии.&nbsp;<br><br>Прайм-тайм будет отдан под руководство опытных артистов, которые неоднократно радовали вас своим звучанием.&nbsp;</p>',500,'800.0',2,27,1,'','https://t.me/rndmcIub',false,false,NULL,NULL,'2023-05-24 21:28:08','2023-10-24 22:48:06',NULL,'','0',18,318);
