	 (995,'День рождения «Энтузиаста» - 10 лет','2023-05-27-prostranstvo-pole-den-rozdeniia-entuzi','2023-05-27',NULL,'20:00:00',NULL,'<p>&nbsp;Мотокафе «Энтузиаст» празднует свой десятый день рождения в «поле»: со своим пивом, новым мерчем и диджейкой на улице. В программе тусовочного вечера и ночи: караоке от Никиты Зеленого и диджей-сеты.<br>&nbsp;до 22:00 свободный, после 22:00 — 800 ₽.&nbsp;</p>',0,'800.0',2,46,1,'','https://t.me/eto_polye/1629',false,false,NULL,NULL,'2023-05-25 13:05:37','2023-10-15 13:01:22',NULL,'','0',18,87),
	 (996,'POWERHOUSE BACKYARD','2023-05-27-powerhouse-powerhouse-backyard','2023-05-27',NULL,'17:00:00',NULL,'<p>&nbsp;Какое тусовочное лето и без веранды «Паверхауса»? Один из самых просторных задних дворов столицы снова в деле: в субботу он открывается длинным музыкальным марафоном. Вас ждет новое меню гриля, коктейли и выступления друзей локации&nbsp;<br>&nbsp;до 22:00 — свободный, после 22:00 — за донейшн (сколько не жалко).&nbsp;</p>',0,'',2,5,1,'https://pwrhsbackyardopening.ticketscloud.org/','',false,false,NULL,NULL,'2023-05-25 13:13:37','2023-10-21 00:48:25',NULL,'','0',18,113),
	 (997,'СПИЧКИ','2023-05-27-yauza-spicki','2023-05-27','2023-05-28','14:00:00','05:00:00','<p>&nbsp;Большое мероприятие этого уикенда в Yauza Place — образовательная встреча, маркет и вечеринка команды «Спички». Если днем у вас дела, заходите потанцевать вечером&nbsp;</p>',1000,'',2,32,1,'https://sp14ki.timepad.ru/event/2439293/','https://t.me/titoishere/5352',false,false,NULL,NULL,'2023-05-25 13:21:28','2023-10-24 21:23:25',NULL,'','0',18,298),
	 (998,'Chillrave Daytime','2023-05-27-blanc-chillrave-daytime','2023-05-27',NULL,'18:00:00',NULL,'<p>Большой ивент. 3 танцпола, пазик день и двор.<br>Капитан готовит все по высшему разряду.&nbsp;<br><br></p>',2000,'',2,36,1,'https://chillrave.timepad.ru/event/2421291/','https://t.me/leveldvamusic/91',false,false,NULL,NULL,'2023-05-25 13:27:45','2023-10-23 00:35:09',NULL,'','0',18,126),
	 (999,'Planeta B','2023-05-26-griboedov-planeta-b','2023-05-26',NULL,'23:00:00',NULL,'<p>По классике Plan B появляется в последние моменты и для этого есть 2 повода. Один из них – день рождения основателя промо-группы Ильи Heliyah, второй это, естественно, потанцевать. Собран диджейский состав, где каждый ни раз играл за вертушками данного мероприятия , ну то есть можно смело их назвать командой. Музыкальная составляющая вечеринки варьируется от прогрессив хауса с примесью техно 90-х годов, которое в середине ночи перейдет в бочку с минимальным звучанием, а утро закроется дружественным B2B2B, тут врать не будем, услышать можно будет что угодно.<br><br></p>',500,'700.0',1,86,1,'https://spb.qtickets.events/73333-plan-b','',false,false,NULL,NULL,'2023-05-25 14:01:11','2023-10-25 13:42:15',NULL,'','0',18,36),
	 (1021,'Club Night','2023-06-03-propaganda-club-night','2023-06-03',NULL,'23:55:00',NULL,'<p>Club Night в субботу пройдет под музыку молодых и талантливых, а как иначе! Misha Gutman из стриминг-проекта Proekt, битмейкер Undergroover и Ofthesun из группировки TRD проведут 6-часовой экскурс в танцевальную электронику.</p>',NULL,'500.0',2,101,1,'','',false,false,NULL,NULL,'2023-05-31 15:26:24','2023-10-22 21:53:39',NULL,'','0',18,83),
	 (1022,'WAREHOUSE','2023-06-02-propaganda-warehouse','2023-06-02',NULL,'23:55:00',NULL,'<p>Очередной пятничный Warehouse Сергея Тимошова примет продюсера Bel Fort и талантливую техно-артистку Tasha Safari. Будет много плотной и прямой танцевальной бочки.</p>',500,'',2,101,1,'','',false,false,NULL,NULL,'2023-05-31 15:32:27','2023-10-06 00:45:05',NULL,'','0',18,55),
	 (1000,'РИТМЫ - Открытие','2023-05-26-ritmy-ritmy-otkrytie','2023-05-26',NULL,'20:00:00',NULL,'<p>КОЛЛЕГИ ПО ЧУВСТВУ РИТМА! ДОБРОГО ВАМ ВСЕМ УТРА!&nbsp;<br>ЕСТЬ ВАЖНОЕ ЗАДАНИЕ!&nbsp;<br>ПОСЕТИТЬ «РИТМЫ» В ЭТИ ВЫХОДНЫЕ И ДОЛОЖИТЬ ОБСТАНОВКУ.<br>МЫ ОТКРЫВАЕМСЯ В ТЕХНИЧЕСКОМ РЕЖИМЕ, ЧТОБ ВЫ УЖЕ ВСЕ ПОГЛЯДЕЛИ!&nbsp;<br>БУДЕТ ЕДА, МУЗЫКА И НАПИТКИ!<br><br>СТАРТ В 20:00 / ВХОД FREE<br>«Ритмы» созданы признанными бар- и стрит-фуд-инвенторами Санкт-Петербурга: Иваном Гринько («Грани», «Такты»), Львом Коваленко («Грани») и Владиславом Либерцевым (Hood Street Food). Даниил Фарафонов из «Тактов» собрал барную карту нового заведения.<br><br>««Ритмы» для меня — это прямое продолжение музыкальной концепции «Тактов». Музыка — не просто шум, заполняющий пространство, а тонкая нить, связывающая людей из совершенно разных компаний, различных жизненных принципов, возрастов и интересов. Музыка — это магия. Хочется делиться этой магией с вами! Вжух!», — говорит Иван Гринько.<br><br></p>',NULL,'0.0',1,181,1,'','https://t.me/vritme_bar',false,false,NULL,NULL,'2023-05-25 14:47:59','2023-10-20 15:29:33',NULL,'','0',18,78);
INSERT INTO public.events (id,title,slug,start_date,end_date,start_time,end_time,description,price_from,price_gate,city_id,venue_id,event_type_id,tickets_url,info_url,is_cancelled,is_featured,deleted_at,user_id,created_at,updated_at,ticketscloud_event_id,ticketscloud_event_token,ticketscloud_event_multi,age_limit,"views") VALUES
	 (1001,'Secret Day - Underground G','2023-05-27-griboedov-secret-day-underground-g','2023-05-27','2023-05-28','19:00:00','07:00:00','<p>Здравствуйте всем привет всем<br>С вами мы — команда мечты&nbsp;<br>Хотим сказать, что давно нас не было в уличных гонках<br>И поэтому мы возвращаемся нереальным гран-при&nbsp;<br>На повестке дня здоровый отдых, а на повестке здоровья принять весь урон и выдержать&nbsp;<br>Дабл дамаг в виде 15 диджеев и нескольких помещений в родном бункере, под возгласы поздравляющие именинника (ов)</p>',500,'',1,86,1,'','',false,false,NULL,NULL,'2023-05-25 14:57:10','2023-10-25 16:47:33',NULL,'','0',18,106),
	 (1002,'PANDEMIC CYBER RAVE','2023-06-17-blank-pandemic-cyber-rave','2023-06-17',NULL,'23:00:00',NULL,'<p>Стремление созидать переплетает наши души и тела в техничную спираль.<br>В таких союзах рождаются новые формы и текстуры, обретая свою суть в искусстве.<br><br>Третий по счету SPECIAL станет самым объёмным во всех проявлениях, мы вновь поднимем планку и расширим границы.<br><br>•3 Сцены<br>•18 Артистов<br>•6 Лайв выступлений (в том числе сильный индастриальный лайв артиста из Италии)<br><br>Каждый из задействованных залов клуба преобразуется в уникальную киберпанк локацию.&nbsp;</p>',1000,'',1,1,1,'https://t.me/pndmcravebot','',false,false,NULL,NULL,'2023-05-25 17:54:26','2023-10-20 09:13:14',NULL,'','0',18,618),
	 (1029,'ECLIPSE','2023-06-02-griboedov-eclipse','2023-06-02',NULL,'23:59:00',NULL,'<p>У всех нас есть сокровенные желания, которыми мы не готовы делиться в повседневной обстановке.<br><br>Поэтому в ночь пятницы нас ждёт ECLIPSE - ночь, в которую стираются все границы и исполняются желания, которые так долго таились внутри нас.<br><br>300 - с репостом<br>500 - без внимания</p>',300,'500.0',1,86,1,'','',false,false,NULL,NULL,'2023-05-31 22:14:48','2023-10-08 13:57:12',NULL,'','0',18,44),
	 (1003,'Electrobudka!','2023-05-26-kontrkult-electrobudka','2023-05-26',NULL,'23:00:00',NULL,'<p>Пересматривать пятничную фотоплёнку утром субботы с мыслями «еб твою мать, надеюсь ничего из этого не попало в интернет». Пятый стаканчик голубой лагуны был лишний, но это известно станет куда позже, пока ясно только то, что попытки жить превратились в показательные выступления или фильмы, что крутили по телеку в твоём детстве.&nbsp;<br>Запомнил ли ты ту девочку в леопардовом мини, или помнишь только ее духи?&nbsp;</p>',NULL,'600.0',1,33,1,'','',false,false,NULL,NULL,'2023-05-25 18:02:53','2023-10-04 16:02:28',NULL,'','0',18,46),
	 (1004,'Абстрасенция в Оранжерее','2023-06-03-oranzereia-tavriceskogo-sada-abstrasenci','2023-06-03',NULL,'16:00:00',NULL,'<p>Днем и вечером на сцене, окутанной ветками пальм и экзотических растений, выступят 5 электронщиков.&nbsp;<br><br>Состоится долгожданное возвращение звезды британской электроники VACANT&nbsp; из Южного Лондона&nbsp;<br>Первое выступление Jake Mckinson в России состоялось в ноябре далекого 2015 года на фестивале Абстрасенция, с тех пор музыкант выпустил множество убедительных релизов и выступил на крупных фестивалях Абстрасенции. Проект возвращается в Россию спустя три года с туром, который начнется с выступления в Оранжерее.&nbsp;<br><br>Впервые в Петербурге выступит новый резидент лейбла — музыкальный проект Jōninés из Москвы с презентацией дебютного альбома "Stubborn".&nbsp;<br>Nuage, участник культового лейбла Anjunadeep и один из первых резидентов Абстрасенции, выступит с презентацией материала нового альбома. Академический музыкант, основатель проекта "О чём классика" — Регина Solar Bird представит сет с живой оркестровой флейтой.&nbsp;<br>Блажь, электронный проект музыкального продюсера Михаила Нестерова, представит обновленный лайв.&nbsp;<br><br>Концерт состоится в двух сеансах с одинаковой программой — в 16:00 и 19:10.&nbsp;</p>',1000,'',1,48,1,'https://abstrasension.ru/tropical_june?utm_source=tg&utm_medium=cpm&utm_campaign=tg_dnc2905','https://t.me/abstrasension',false,false,NULL,NULL,'2023-05-30 14:41:51','2023-10-20 23:53:05',NULL,'','0',18,97),
	 (1023,'ACASA','2023-06-01-propaganda-acasa','2023-06-01',NULL,'23:55:00',NULL,'<p>В четверг встречаемся на шоукейсе заводной московской команды A CASA. Julia Konor, Mvxood, Discopank и Idontnolan будут ставить для вас многообразие электронной музыки.</p>',500,'',2,101,1,'','',false,false,NULL,NULL,'2023-05-31 15:37:12','2023-10-23 17:33:54',NULL,'','0',18,60),
	 (1024,' RESONANCE','2023-06-11-rndm-resonance','2023-06-11','2023-06-12','23:00:00','06:00:00','<p>Неугомонный квартет отправляется в «рандом» открывать летний сезон, а также праздновать день рождения DESTROY.&nbsp; К поздравлениям присоединяются близкие друзья именинника со стороны резо — Nikita Zabelin, Vlas Leskin, а также коллега по цеху Roma Ptashenko. Ну и куда же без сета от именинника.&nbsp; &nbsp;</p>',500,'',2,27,1,'','',false,false,NULL,NULL,'2023-05-31 21:33:48','2023-10-25 14:44:12',646,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWZkOTU5YWZmZGNiZDZlZTY0NTJjZjczIn0.GeRgIuxoux5eUegSzCkEWmLeljBwf4hO9W4fGQPV01A','0',18,239),
	 (1005,'KULT','2023-06-03-kontrkult-kult','2023-06-03','2023-06-04','23:00:00','10:00:00','<p>Культ есть таинство прямого механического ритма, погружающего всех причастных в массовую гипнотическую практику. Настраивая чуткую связь со своим телом, мы единовременно находимся в тесном контакте с тем, кто жонглирует музыкой, и теми, кто заворожен импульсами звука подобно нам — и в этом весь фокус.&nbsp;<br><br>Лайнапы, собранные куратором вечеринки Артуром Роос, всегда отличаются уровнем, жёсткостью и абсолютной гармонией. Этот раз не исключение: впервые после долгого отъезда из России выступит HOAX, новоиспеченный резидент Monasterio ALOD закатит утренник на 3 буйных часа, draken49 презентует авторский материал. Откроет ночь глубоким мрачным саундом Pollyesstear, затем пульт перехватит AMADAU со свойственным ему профессионализмом, а резиденты Культа Prozorova и PARTIA в ответе за уровень клуба.&nbsp;<br><br>Вход — 600 до полуночи с репостом, 800 после полуночи&nbsp;</p>',600,'800.0',1,33,1,'','',false,false,NULL,NULL,'2023-05-30 14:48:10','2023-10-24 21:00:55',NULL,'','0',18,89),
	 (1006,'Tesla','2023-06-03-mutabor-tesla','2023-06-03',NULL,'23:00:00',NULL,'<p>На выходных ожидается возвращение Tesla Никиты Забелина. Это перфоманс на стыке музыки и технологий, акт поклонения силам природы, выраженный в звуке и свете. Шесть резонансных трансформаторов Николы Теслы создадут разряды высокого напряжения<br><br>Вселенная Tesla началась как проект Никиты Забелина в 2019 году. Шоу с использованием молний в качестве звуковых осцилляторов привлекло внимание мировой общественности и стало первым в своем роде<br><br>В этот раз зрителей ждет новая музыкальная программа и неожиданные коллаборации</p>',1700,'',2,2,1,'https://mutabor.club/tesla','',false,false,NULL,NULL,'2023-05-30 14:58:46','2023-10-11 19:04:33',NULL,'','0',18,102),
	 (1007,'SAMOVAR 1 YEAR','2023-06-03-gazgolder-samovar-1-year','2023-06-03',NULL,'23:00:00',NULL,'<p>В следующей серии — Samovar празднует год! Все это время мы с вами варились тут и там, делали коллабы, выпускали релизы, находили таланты, горели сердцами, кипели жизнью. Дальше будет больше, ярче и громче, но сначала танцы, которые мы заслужили.<br><br>12 часов, два танцпола в Газе — вот чего от них ждать. По традиции, мейн — на серьезных движениях, а на террасе — первая суббота лета, и вся радость и счастье, которые к этому прилагаются. За пультами лучшие и легендарные, старые и новые друзья лейбла, а так же резиденты комьюнити.&nbsp;<br><br>В общем будет такой вайб, когда все свои и все — на Самоваре. Ждем всех пламенно и готовимся танцевать олл найт лонг.<br><br></p>',1000,'',2,35,1,'https://samovar1year.ticketscloud.org/','https://vk.com/wall-151733481_224',false,false,NULL,NULL,'2023-05-30 15:09:05','2023-10-21 08:14:43',NULL,'','0',18,176);
