	 (1008,'Bondarev Birthday Party','2023-06-04-warpp-bondarev-birthday-party','2023-06-04',NULL,'05:00:00',NULL,'<p>В ночь с 3 на 4 июня уже по традиции я буду праздновать свой день рождения в клубе WARPP, в месте которое 5 лет назад стало для меня вторым домом. Здесь мои мечты обретали крылья, а каждый звук и аккорд зажигал во мне пламя творчества и благодаря вашей поддержке я нахожусь там, где я есть сейчас. Я буду рад видеть всех, кто захочет меня поздравить и насладиться эксклюзивной музыкой, которую я начну играть для вас в 05.00 на втором танцполе. До скорой встречи</p>',NULL,'',1,23,1,'','',false,false,NULL,NULL,'2023-05-30 15:17:10','2023-10-09 23:57:20',NULL,'','0',18,78),
	 (1009,'Mirida / Bagus / Qdream','2023-06-02-warpp-mirida-bagus-qdream','2023-06-02',NULL,'23:00:00',NULL,'<p>Стартуем с 23:00 / FC/DС. Вход Первым 100 человек&nbsp; по спискам бесплатно до 00:00<br>Без списков вход - 1000 рублей</p>',0,'1000.0',1,23,1,'','https://warppclub.com/',false,false,NULL,NULL,'2023-05-30 15:22:52','2023-10-23 10:36:49',NULL,'','0',18,68),
	 (1010,'ЗАЯ','2023-06-03-yauza-zaia','2023-06-03',NULL,'15:00:00',NULL,'<p>Френдли-состав, эко-идеи, сладкая вата, самый вежливый и красивый человек на входе и другие профессиональные методы создания нежных нейронных связей — с 3-х часов дня до самого конца.&nbsp;<br><br>Три благонадежных и ухоженных танцпола, тридцать три локации и как минимум один секретный плейс: в генетическом коде праздника — пинг-понг, тир, салон видеоигр, лекторий от онлайн-кинотеатра Premier, звонок Зае, чайная, рисунки мелом и все, как в мультике про коробку с карандашами.<br>&nbsp;и ДРУЗЬЯ-ЗАИ<br>vinyl only<br><br><br><br></p>',1000,'',2,32,1,'https://tutzaya.ru/','',false,false,NULL,NULL,'2023-05-30 15:44:13','2023-10-17 09:05:05',NULL,'','0',18,142),
	 (1011,'MARGINALIA FEST','2023-06-02-serdce-marginalia-fest','2023-06-02','2023-06-03','18:00:00','06:00:00','<p>В эту пятницу на эклектичном фестивале MARGINALIA вас ждет синтез музыки, антимузыки и перформанса.&nbsp;</p>',700,'900.0',1,6,1,'https://vk.com/marginalia_fest_020623','https://t.me/marginalia_fest',false,false,NULL,NULL,'2023-05-31 13:11:35','2023-10-23 22:13:39',NULL,'','0',18,96),
	 (1025,'TAPENIGHT КЛАН: DIMKA BATARIN’S BIRTHDAY','2023-06-02-factory-3-tapenight-klan-dimka-batarin','2023-06-02',NULL,'23:59:00',NULL,'<p>Димка Батарин, солист группы Tapenight собирает компанию друзей, единомышленников и приближенных, чтобы отпраздновать свой день рождения.&nbsp;<br>TAPENIGHT Клан: Dimka Batarin’s Birthday случится в клубе Factory, который находится на Кожевенной линия В.О., 40.</p>',800,'',1,7,1,'https://tapenight-clan.ticketscloud.org/','',false,false,NULL,NULL,'2023-05-31 21:51:54','2023-10-24 21:02:35',NULL,'','0',18,76),
	 (1013,'Откровение','2023-06-03-blank-otkrovenie','2023-06-03',NULL,'23:00:00',NULL,'<p>Оно появилось невесть как. То ли один постмодернист в своей утопии непроизвольно предрек упоительную музыку автоматизированной будущности. То ли дети послевоенной Германии, воспитанные скрежетом станков и конвейеров, педантично вытеснили небрежность механистичностью, подобрали ключ зажигания и умчали по автобану прямиком в вечность. То ли бельвильская троица вдохнула полуночный радиоэфир и сотворила философию, в которой машина первична по отношению к человеку. Как бы то ни было, без сверхъестественного вмешательства здесь не обошлось.<br><br>«Откровение» — техно-центричная серия событий клуба Blank (https://t.me/blankclub/3818), (https://t.me/blankclub/3818) посвященная жанру, для многих ставшим религией нового времени и объединившим сотни тысяч людей по всей планете, которым нечего делить, кроме места на танцполе. На двух танцполах.</p>',700,'',1,1,1,'http://blankclub.ru/','',false,false,NULL,NULL,'2023-05-31 13:23:38','2023-10-23 23:19:54',NULL,'','0',18,143),
	 (1014,'3StageDNB presents: NEUROCULT','2023-06-02-cult-3stagednb-presents-neurocult','2023-06-02',NULL,'23:00:00',NULL,'<p>Самое время включить Drum&amp;Bass режим и отправиться в эпическое путешествие! 3stageDNB приглашает всех на мощнейший музыкальный ритуал, который состоится в клубе Cult</p>',0,'500.0',1,92,1,'https://spbpromo.timepad.ru/event/2448684/','',false,false,NULL,NULL,'2023-05-31 13:43:57','2023-10-23 10:47:50',NULL,'','0',18,66),
	 (1015,' Collective.','2023-06-02-blank-collective','2023-06-02',NULL,'23:00:00',NULL,'<p>Входим в коллективное бессознательное на отложенной релиз-пати компиляции «CLLCTV-VA#6» лейбла Collective.&nbsp;<br><br>Бытует мнение, что лейблы утратили былую значимость в музыкальной экосистеме, стали&nbsp; в ней лишним звеном. Любой может сварганить бит в сподручном DAW, свести дорожки, загрузить трек на облако, разослать диджеям и отслеживать, как счетчик прослушиваний ползет вверх.&nbsp;<br><br>Потом открываешь страничку Collective, залипаешь на ней, пока не переслушаешь все релизы по кругу, и понимаешь, что все вышесказанное, конечно, правдиво, но в контексте кого-то еще, только не его. Лейбл родом из Сибири сколотил в крепкое комьюнити уже состоявшихся артистов и талантливых новичков, имевших все шансы остаться ноунеймами, если бы не стали частью чего-то большего.<br><br>Билеты на входе:&nbsp;<br>00:00 - 700₽<br>01:00 - 900₽</p>',700,'900.0',1,1,1,'','',false,false,NULL,NULL,'2023-05-31 13:49:57','2023-10-15 14:42:45',NULL,'','0',18,66),
	 (1016,'CLOCKWORKHEADS','2023-06-10-rndm-clockworkheads','2023-06-10',NULL,'22:00:00',NULL,'<p>Особый гость - Александр Ant To Be из Кирова. Пятнадцать часов пути в Москву, тяжелая сумка винила, двух часовой сет классического джангла и хардкор джангл тюнов.<br><br>Современное воплощение олдскульных англицких продюсеров начала девяностых, свежий глоток воздуха для ценителей жанра, коллекционер раритетного винила, переводчик статей о хардкор джангле, резидент легендарного импринта Kniteforce Records [UK].</p>',400,'1000.0',2,27,1,'https://moscow.qtickets.events/73601-cwh-w-ant-to-be','',false,false,NULL,NULL,'2023-05-31 13:56:38','2023-10-21 07:00:24',NULL,'','0',18,284),
	 (1030,'Saturday Night','2023-06-03-griboedov-saturday-night','2023-06-03',NULL,'23:00:00',NULL,'<p>Родной подвал, его команда и диджеи снова готовы встретить вас и закрутить в бешеном смерче техно.&nbsp;<br><br>Бочка, бетонные стены и дикие ритмы как бы намекают - ночь простой не будет, так что готовьтесь на все 200%.&nbsp;<br><br>300 - с репостом&nbsp;<br>500 - без внимания</p>',300,'500.0',1,86,1,'','',false,false,NULL,NULL,'2023-05-31 22:18:03','2023-10-22 16:26:36',NULL,'','0',18,69);
INSERT INTO public.events (id,title,slug,start_date,end_date,start_time,end_time,description,price_from,price_gate,city_id,venue_id,event_type_id,tickets_url,info_url,is_cancelled,is_featured,deleted_at,user_id,created_at,updated_at,ticketscloud_event_id,ticketscloud_event_token,ticketscloud_event_multi,age_limit,"views") VALUES
	 (1017,'RADI MIRA I LUBVI X СПИЧКИ ','2023-06-02-supermetall-radi-mira-i-lubvi-x-spicki','2023-06-02',NULL,'14:00:00',NULL,'<p>Всем салют друзья!&nbsp;<br>Ну что, какие планы на первые дни лета? Есть супер идея, сохраняйте дату!<br>2-го июня весь вечер и ночь под летним открытым небом! Только вы, мы, музыка, Суперметалл и куча активностей и все это Ради Мира и Любви!<br>В этом году мы открываем летний сезон вместе со Спички - комьюнити, объединяющим бизнес, искусство и креативную индустрию.&nbsp;<br>Что в планах:&nbsp;<br>&nbsp;1. Маркет, который пестротой своих полосатых палаток перенест нас в атмосферу рынка 90х.<br>&nbsp;2. Увлекательный лекционный блок-открытый диалог с лидерами мнений и разных индустрий, в креслах спикеров.<br>&nbsp;3. Вау-сценография от студии Panterra и арт от друзей - художников!<br>&nbsp;4. Конечно, музыка! В программе довольно внушительный состав артистов! Всеми любимые лица, а также молодые дарования, одно имя перекрыто плашкой Сикрет ⭐️- сюрприза ради!<br>Все предпосылки для того чтобы&nbsp; собраться вместе, максимально круто провести время и создать самый правильный импульс на ближайшие теплые месяцы!&nbsp;</p>',2500,'',2,119,1,'https://rml.ticketscloud.org/','https://t.me/radi_mira_i_lubvi',false,false,NULL,NULL,'2023-05-31 15:03:38','2023-10-23 11:10:12',NULL,'','0',18,231),
	 (1018,'SCHËLK.INTRO','2023-06-02-slezy-schelkintro','2023-06-02','2023-06-03','23:30:00','08:30:00','<p>После успешного выхода на саундклауде делимся дальнейшими планами. В первый летний викенд «Щёлк» приглашает тебя для знакомства в оффлайне. С нас — приятный уху лайнап, с тебя — улыбка и танцы.</p>',800,'',2,102,1,'','',false,false,NULL,NULL,'2023-05-31 15:11:15','2023-10-16 00:11:59',NULL,'','0',18,103),
	 (1019,'HYPERBOLOID','2023-06-09-rndm-hyperboloid','2023-06-09',NULL,'23:00:00',NULL,'<p>Шоукейс Hyperboloid состоится 9 июня в клубе RNDM&nbsp;</p>',500,'800.0',2,27,1,'https://vk.cc/coqUaN','',false,false,NULL,NULL,'2023-05-31 15:17:00','2023-10-22 10:50:26',NULL,'','0',18,221),
	 (1027,'BODEYLOTION V/A','2023-06-03-blanc-bodeylotion-va','2023-06-03',NULL,'18:00:00',NULL,'<p>Фирменная вечеринка диджея и продюсера Димы Ковязина вместе с диско-клубом «Радуга». В лайнапе — уже заявившие о себе артисты «молодой крови» и давние друзья организаторов</p>',0,'1500.0',2,36,1,'https://radugadiscoclub.ru/e030623','',false,false,NULL,NULL,'2023-05-31 22:01:48','2023-10-10 02:51:24',NULL,'','0',18,131),
	 (1028,'DATABASE','2023-06-01-rndm-database','2023-06-01',NULL,'20:00:00',NULL,'<p>Встречаем новую вечеринку из серии DATABASE, которая пройдет в следующий четверг 1 июня!<br><br>Database - проект направленный на открытие перспективных артистов на современной drum and bass / jungle / bass сцене. Вход всегда бесплатный с наличием репоста афиши в одной из ваших соцсетей.<br><br>Бесплатный вход с репостом афиши в одной из соцсетей.<br>Без репоста или добровольно поддержать проект - 300 руб.<br><br></p>',0,'300.0',2,27,1,'','',false,false,NULL,NULL,'2023-05-31 22:07:29','2023-10-25 07:23:09',NULL,'','0',18,62),
	 (1032,'КРУИЗ','2023-06-03-powerhouse-kruiz','2023-06-03',NULL,'18:00:00',NULL,'<p>&nbsp;Заплыв по аудиоволнам «Дома силы» под ритмы британской электроники, хауса, брейкбита и джангла. Вечеринку организуют команды WAX NINJA и музыкальный коллектив Tiger Balms, а их специальные гости — группа «Поели», Aman Po-Kaifu, Guydee и другие. Тусовка начнется на веранде, а с приближением ночи переместится внутрь бара.&nbsp;<br>Вход - донейшен (оплата определяется вашим желанием)</p>',NULL,'',2,5,1,'','',false,false,NULL,NULL,'2023-05-31 22:33:13','2023-10-10 04:25:38',NULL,'','0',18,111),
	 (1033,'GALAXYDROME: THE UNITY','2023-06-03-aglomerat-galaxydrome-the-unity','2023-06-03',NULL,'23:00:00',NULL,'<p>Итак, авангард их состава представит основатель и главный функционер команды - THE PIT своим сетом из классического псайкора и террора, за ним подтягиваются их основные ударные единицы - Deliverance и Fuckear. Также, мы прочувствуем на себе воздействие светлых вайбов хард-транса от SNAILY и дарк PCP-вибраций от STANAX с его неутомимым рвением. Вторая и кульминационная часть лайнапа представляет из себя форматы b2b. Представят формат основатели серий вечеринок Gabber Attack и Gabbertone, которые с радостью откликнулись поддержать наш концепт. Вас ждёт виниловый сэт от основоположников отечественного хк-движения Guyver &amp; Ultarior, который остался глубоко памяти еще с первого UNITY. Закрывает этот строгий список b2b от участников нашей команды Usamov &amp; Hellasicker. А на десерт, впервые в наш состав интегрируется шоукейс питерского лейбла BLACK HOLES и это событие обещает быть интригующим</p>',1100,'',2,56,1,'https://glx-zion.timepad.ru/event/2434030/','',false,false,NULL,NULL,'2023-05-31 22:44:00','2023-10-22 05:41:08',NULL,'','0',18,94),
	 (1034,'Somatik Fest','2023-06-09-factory-3-somatik-fest','2023-06-09',NULL,'23:55:00',NULL,'<p>Среди репостов разыграем 5 билетов!<br>Первые утки - 500<br>Для носителей сектантских тату - 300</p>',800,'',1,7,1,'https://rupor.biz/widgets/event-tickets/837','',false,false,NULL,NULL,'2023-06-01 15:11:46','2023-10-14 14:55:20',NULL,'','0',18,306),
	 (1035,'Mixed.night vol.3','2023-06-11-mixed-mixednight-vol3','2023-06-11',NULL,'22:00:00',NULL,'<p>Mixed возвращается с фирменной вечеринкой mixed.night vol.3 в максимально летнем формате — впервые открывают террасу для танцев, развернувшись all night на два танцполах!&nbsp;<br><br>Террасу подключается в режим минимал, на улице проводы заката и встреча рассвета.&nbsp;</p>',700,'',1,59,1,'https://spb.qtickets.events/74101-mixednight-vol3','',false,false,NULL,NULL,'2023-06-01 15:16:10','2023-09-28 12:50:51',NULL,'','0',18,106),
	 (1036,'TEATRO','2023-07-08-zavod-im-stepana-razina-teatro','2023-07-08',NULL,'22:00:00',NULL,'<p>8 июля мы откроем двери нашего загадочного мира, где вы станете главными героями на иммерсивном фестивале электронной музыки TEATRO!<br><br>Атмосфера Teatro заставит тебя забыть о реальности и побыть основным персонажем, антураж которого – все происходящее вокруг. Ты можешь выбрать свой путь в этой ночи - стать частью представления или зрителем, но в любом случае, тебя ждет потрясающее путешествие.<br><br>Музыка этой главной ночи года поделится надвое: два танцпола – open air и indoors – поразят разностью концепций, которые в то же время образуют синергию звука. Выбор снова за тобой: мелодичный чил, ритмы которого бьются в унисон с природой и твоим сердцем, или поглощающий техно, будоражащий все твое нутро.<br><br>Однако, не только музыка делает эту вечеринку особенной. Тебя ждет настоящий театр, где каждый уголок пронизан духом мистики и загадочности. Ты будешь блуждать среди клоунов, фокусников и других удивительных персонажей, которые превратят эту ночь в одно масштабное действо.<br><br>Готов ли ты примерить на себя маску главного героя? Teatro ждет тебя!</p>',1900,'',1,154,1,'https://teatrofest.ticketscloud.org/','',false,false,NULL,NULL,'2023-06-01 15:33:45','2023-10-24 21:31:59',NULL,'','0',18,1234);
