	 (1039,'Лето Пришло','2023-06-02-oksid-leto-prislo','2023-06-02',NULL,'21:00:00',NULL,'<p>В эту пятницу бар Оксид устраивает большую вечеринку, где к основному танцполу прибавится еще и двор. Во дворе, конечно же, откроется мини-филиал Оксида со всеми фирменными коктиками и прочими прибамбасами. Играют олл старс Профоюза и не только</p>',NULL,'0.0',2,183,1,'','',false,false,NULL,NULL,'2023-06-01 18:35:31','2023-10-23 01:17:32',NULL,'','0',18,52),
	 (1042,'Santa Barbara. Jati Div ','2023-06-03-leveldva-santa-barbara-jati-div','2023-06-03',NULL,'23:00:00',NULL,'<p>Если хочется раствориться и забыться в ночи с бокалом любимого коктейля, то в leveldva с этим помогут резиденты Santa Barbara и Jati Div<br><br>Они традиционно погрузят гостей в гипнотический звук</p>',NULL,'0.0',2,138,1,'','',false,false,NULL,NULL,'2023-06-02 13:46:23','2023-10-19 02:43:19',NULL,'','0',18,54),
	 (1043,'Dialog','2023-06-02-mixed-dialog','2023-06-02',NULL,'22:00:00',NULL,'<p>Уже сегодня ночью Dialog возвращается в Mixed (https://www.instagram.com/mixed.sevcable/) с обновленной селекцией.&nbsp;<br>Румынский минимал, vinyl only и шикарный закат на Севкабеле — такой план на открытие первого викенда летнего сезона!</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,NULL,'2023-06-02 13:51:07','2023-10-03 07:20:06',NULL,'','0',18,18),
	 (1046,'Пятница в Стрелке','2023-06-09-bar-strelka-piatnica-v-strelke','2023-06-09',NULL,'23:00:00',NULL,'<p>Лето на «Стрелке» с музыкальными друзьями бара.<br><br>В пятницу устраивают вечеринку наши любимые Лала и Паша из группы Lovanda, компанию которым за пультом составит прекрасная Настя Мира.</p>',0,'',2,103,1,'','',false,false,NULL,NULL,'2023-06-08 16:29:44','2023-10-16 14:50:39',NULL,'','0',18,71),
	 (1047,'Warehouse','2023-06-09-propaganda-warehouse','2023-06-09',NULL,'23:55:00',NULL,'<p>Сергей Тимошов пригласил на пятничный Warehouse Романа Вабеля и Андрея Покровского: они выступят с 4-часовым совместным диджей-сетом.</p>',NULL,'0.0',2,101,1,'','',false,false,NULL,NULL,'2023-06-08 16:35:57','2023-10-20 01:02:24',NULL,'','0',18,83),
	 (1048,'Club Night','2023-06-10-propaganda-club-night','2023-06-10',NULL,'23:55:00',NULL,'<p>Субботней клубной ночью в Пропаганду возвращаются резиденты House of Palm. Всю ночь за пультом</p>',NULL,'0.0',2,101,1,'','',false,false,NULL,NULL,'2023-06-08 17:02:58','2023-10-23 02:39:23',NULL,'','0',18,57),
	 (1049,'China Town','2023-06-11-propaganda-china-town','2023-06-11',NULL,'23:55:00',NULL,'<p>Завершить неделю забегайте на воскресный China Town под привычные ритмы позитивной электроники.</p>',NULL,'0.0',2,101,1,'','',false,false,NULL,NULL,'2023-06-08 17:07:42','2023-10-22 06:05:34',NULL,'','0',18,172),
	 (1050,'Broken Hearts Club','2023-06-09-powerhouse-broken-hearts-club','2023-06-09',NULL,'23:00:00',NULL,'<p>Вечеринка-праздник в эту пятницу. Ее концепт таков: берем самых импозантных друзей <a href="https://vk.com/oberwave">OBERWAVE</a> и заставляем (кого–то даже насильно) играть музыку, под которую им разбивали сердце. Это может быть синтипоп, нью вейв, итало и даже шансон.<br><br>В общем, никаких строгих правил — просто танцуем, смеемся или плачем, а что еще нам остается. Кстати, в секретном баре подают любимые настойки, а на сцене стреляют глазами диджеи в самом расцвете лет. Как видите, не хватает тут только вас.<br><br>Вход - донейшен.&nbsp;</p>',100,'',2,5,1,'','https://vk.com/wall-187423251_374',false,false,NULL,NULL,'2023-06-08 18:02:01','2023-10-18 16:53:41',NULL,'','0',18,75);
