	 (1051,'GIRLS, GIRLS, GIRLS','2023-06-09-deep-fried-friends-girls-girls-girls','2023-06-09',NULL,'23:59:00',NULL,'',NULL,'',2,76,1,'','',false,false,NULL,NULL,'2023-06-08 18:20:51','2023-10-09 19:45:44',NULL,'','0',18,86),
	 (1052,'IT''S GOOD TO BE A TREE','2023-06-09-lebedinoe-ozero-its-good-to-be-a-tree','2023-06-09',NULL,'21:00:00',NULL,'<p>Лейбл It’s Good to be a Tree собирает в «Лебедином озере» всех любителей медленной электроники. В гости пожалует колумбийский музыкант AIWAA, который умело сочетает в сетах афролатинские ритмы и гипнотические грувы.</p>',1500,'',2,184,1,'https://g2b3-aiwaa.ticketscloud.org/','https://t.me/itsgoodtobeatree',false,false,NULL,NULL,'2023-06-08 18:28:04','2023-10-25 11:44:02',NULL,'','0',18,154),
	 (1053,'ASIA EXPERIENCE 4 YEARS','2023-06-09-gazgolder-asia-experience-4-years','2023-06-09',NULL,'23:00:00',NULL,'<p>Четыре года назад основатель Asia Experience организовал первое мероприятие, собрав любителей электронной музыки с острова Пханган.&nbsp;</p>',1500,'',2,35,1,'https://moscow.qtickets.events/72368-4-years-of-asia-experience-at-gazgolder','https://t.me/Gaztelegram',false,false,NULL,NULL,'2023-06-09 11:06:46','2023-10-18 13:57:08',NULL,'','0',18,125),
	 (1054,'HYPNOTICA','2023-06-09-yauza-hypnotica','2023-06-09',NULL,'18:00:00',NULL,'<p>Танцы под открытым небом в пространстве комфортного столичного дворика от команды Hypnotica. Одевайтесь красиво и настраиваетесь на танцы под жизнерадостную электронную музыку&nbsp;</p>',0,'1500.0',2,32,1,'https://hypnoticamusic.timepad.ru/event/2441507/','https://hypnoticamusic.timepad.ru/event/2441507/',false,false,NULL,NULL,'2023-06-09 11:13:21','2023-10-24 06:03:43',NULL,'','0',18,78),
	 (1055,'ОТКРЫТИЕ ФЕСТИВАЛЬНОГО ЦЕНТРА BEAT','2023-06-09-prostranstvo-pole-otkrytie-festivalnog','2023-06-09',NULL,'22:00:00',NULL,'<p>Мы в поле любим праздновать по любому поводу, а открытие фестивального центра Beat и пятница с показами «Рейва в Иране» и «Берлинского фейсконтрольщика» — повод вообще отличный<br><br>Отличный настолько, что к нам с первым за год лайвом в Москве заглянет Shadowax — альтер-эго музыкантки Миры Карьяновой (Ishome). А за диджейку встанут двое из No Wave! Андрей Клинг и Ильдар Иксанов, Vlas Leskin из Resonance и б2б Ромы Немова с Future Past Opportunities&nbsp;<br><br>Ситуация со входом следующая: все пришедшие на показ фильма «Берлинский фейсконтрольщик» могут остаться и на вечеринку, а остальных билеты ждут по ссылке:&nbsp;<br><br></p>',800,'',2,46,1,'https://beatopening.ticketscloud.org/','',false,false,NULL,NULL,'2023-06-09 11:21:32','2023-10-24 22:19:01',NULL,'','0',18,131),
	 (1056,'Saturday Night','2023-06-10-deep-fried-friends-saturday-night','2023-06-10',NULL,'23:59:00',NULL,'<p>В субботу в DFF вас ждет мультижанровая вечеринка. В программе — диджей-сет от продюсера и рэпера WHITE PUNK, харизматичного исполнителя НЕДРЫ в дуэте с билборд продюсером HIGHSELF и выступления других артистов.</p>',NULL,'1000.0',2,76,1,'','https://t.me/dffradio',false,false,NULL,NULL,'2023-06-09 11:31:23','2023-10-25 16:56:54',NULL,'','0',18,90),
	 (1057,'Highway Night','2023-06-10-blanc-highway-night','2023-06-10',NULL,'18:00:00',NULL,'<p>Вот оно какое - наше лето!<br>Наслаждаемся летними вечерами в уникальной атмосфере особняка Бланк.&nbsp;<br>Highway Night, для которой мы собрали одних из наиболее интересных и редко играющих вместе артистов лэйбла, начнется ранним вечером в уютном дворе центра столицы - расставляем красивые диваны, удобные кресла, расстилаем ковры и играем самые классные для этого времени суток пластинки.&nbsp;<br><br>Когда же на город опустится ночь, мы переместимся внутрь особняка, чтобы заполнить все его комнаты волнами тёплой и ласкающей музыки, счастьем в неограниченных количествах и небольшой толикой сумасбродства - все, как мы любим!<br><br></p>',0,'1500.0',2,36,1,'https://secret420.timepad.ru/event/2446154/','https://t.me/blanc_msk',false,false,NULL,NULL,'2023-06-09 11:44:16','2023-10-07 10:05:37',NULL,'','0',18,114),
	 (1058,'Амур Тужур - французская вечеринка','2023-06-16-macty-amur-tuzur-francuzskaia-vecerink','2023-06-16',NULL,'22:00:00',NULL,'<p>На одну ночь Мачты превратятся в настоящий парк развлечений! Галерея из сладостей, световые инсталляции, шатер с диджеями, сахарная вата, мейк-ап зона и, конечно же, подарки и сюрпризы для всех посетителей Лунного парка.<br><br>Вас ждет море ощущений и самое разнообразное звучание</p>',600,'',1,9,1,'https://spb.radario.ru/events/1929148/tickets?fbclid=PAAabOUYERK6I5m-nGGy9xbz4jnPt_BNb6lqE1LVNa6_C8K_Xe1XYAX8H5O30','',false,false,NULL,NULL,'2023-06-09 15:54:15','2023-10-21 01:24:48',NULL,'','0',18,73),
	 (1059,'KISS','2023-06-10-simach-kiss','2023-06-10',NULL,'23:00:00',NULL,'<p>Шоукейс фетиш-техно-команды Popoff Kitchen при участии резидентов и друзей&nbsp;</p>',NULL,'0.0',2,165,1,'','',false,false,NULL,NULL,'2023-06-09 15:58:24','2023-10-22 11:09:48',NULL,'','0',18,51),
	 (1060,'Plan B','2023-06-11-blank-plan-b','2023-06-11',NULL,'23:30:00',NULL,'<p>"С самого начала у нас была какая-то тактика и мы ее придерживались" -&nbsp; универсальная фраза для наездника пoсле конкура, эпитафии беспечной жизни дома и перехода к плану Б.&nbsp;<br><br>Plan B реализует Heliyah, который разок дал маху, поставив в каком-то местечке не ожидаемый хип-хоп, а минимал-техно, бейс и всякую грязь.&nbsp;<br>И вышло это так здорово, что запасной вариант очень быстро стал основным.&nbsp;<br>Plan B в Blank — звучит как план отличного воскресенья.<br>Билеты на входе:<br>&nbsp; &nbsp; &nbsp; &nbsp;00:00 - 600₽<br>&nbsp; &nbsp; &nbsp; &nbsp;01:00 - 800₽</p>',600,'800.0',1,1,1,'','',false,false,NULL,NULL,'2023-06-09 16:17:35','2023-10-25 00:34:01',NULL,'','0',18,76);
