	 (1061,'TERRACE EXPERIENCE - Electric Expirience','2023-06-10-zeltaia-terassa-terrace-experience-ele','2023-06-10','2023-06-10','17:00:00','23:30:00','<p>Перерыв окончен.<br>В эту субботу, спустя месяц после дебюта, первая трилогия вечеринок "TERRACE EXPERIENCE" завершится.&nbsp;<br><br>Террасу заполнят волны натурального электронного звучания.&nbsp;<br>Ритмы сломаются и будут разгоняться на протяжении всей вечеринки.&nbsp;<br>Мощный синтезированный звук перенесёт к истокам электроники, приводящей ваше тело в движение.&nbsp;<br><br>Вход - свободный</p>',NULL,'0.0',1,185,1,'','',false,false,NULL,NULL,'2023-06-09 17:00:38','2023-10-15 19:27:23',NULL,'','0',18,80),
	 (1062,'LEGAL''NAYA','2023-06-10-lendok-legalnaya','2023-06-10','2023-06-11','21:30:00','06:00:00','<p>В субботу на основном танцполе киностудии можно будет услышать самую разную музыку&nbsp;<br><br>На фото — артисты, которые отыграют на мероприятии. Особенно стоит отметить слот Иранца Reza Faryadi и пятичасовой перелет Брусники — выступления, которые редко по нынешним временам можно посетить в городе. Учитывая еще локацию ивента — событие обещает быть запоминающимся<br><br>Архитектурная восьмёрка из двух залов будет рассечена диджейкой. Зеленый зал станет - местом для поиска себя в танце, а фиолетовый - приватной зоной “Epic Ticket’s” со своим баром и диванами</p>',1200,'',1,182,1,'https://legalnaya-lendoc.ticketscloud.org/?fbclid=PAAaY-FBstl6Q6HOxrPT4TloMWcHV0ZJvkQwWxCbSXP-5NprBYmVnTC8bC3iE_aem_th_Af4RcDvgLoHyzMyweClownpWdm2Y9P4OR5EdqJ3Ocj9UWGdLpbxu5KKsQW-KilnQDFY','',false,false,NULL,NULL,'2023-06-09 18:15:09','2023-10-22 09:44:20',NULL,'','0',18,75),
	 (1063,'Пятница в VNVNC','2023-06-09-vnvnc-concert-hall-piatnica-v-vnvnc','2023-06-09','2023-06-10','23:00:00','06:00:00','<p>Нам не тесно, и мы вместе<br><br>Каждый weekend, month, year...<br><br>Ты наша неотъемлемая details<br><br>Ты их сразу услышишь...</p>',600,'1900.0',1,50,1,'https://kaverafisha.ru/saint-petersburg/events/vecherinka-v-vnvnc-9-iyunya-245817','',false,false,NULL,NULL,'2023-06-09 18:22:45','2023-09-17 03:11:26',NULL,'','0',18,15),
	 (1064,'Суббота в VNVNC','2023-06-10-vnvnc-concert-hall-subbota-v-vnvnc','2023-06-10',NULL,'23:00:00',NULL,'<p>Ёщё больше музыки с новой террасой<br><br>Стиль в каждой детали... Приходи и убедись<br><br>Ты их сразу услышишь...</p>',600,'1800.0',1,50,1,'https://kaverafisha.ru/saint-petersburg/events/vecherinka-v-vnvnc-10-iyunya-245818','',false,false,NULL,NULL,'2023-06-09 18:28:52','2023-09-16 16:45:14',NULL,'','0',18,33),
	 (1065,'11 июня на Конюшенной VNVNC','2023-06-11-vnvnc-concert-hall-11-iiunia-na-koniusenno','2023-06-11',NULL,'23:00:00',NULL,'<p>Отмечаем день России вместе<br><br>в наших лучших традиция<br><br>ждём тебя!<br><br></p>',600,'',1,50,1,'https://vnvncconcerthall.ru/events/vnvnc-voskresene-11-iyunya/','https://vnvncconcerthall.ru/',false,false,NULL,NULL,'2023-06-09 19:10:41','2023-10-25 05:56:13',NULL,'','0',18,89),
	 (1109,'TRIP: Big City Vibe','2023-06-24-blanc-trip-big-city-vibe','2023-06-24',NULL,'16:00:00',NULL,'<p>В преддверии ростовского фестиваля TRIP его команда устраивает препати, масштабы которого вполне сравнимы с грядущим событием. Субботнем вечером и ночью вы сможете посетить две площадки, где вас ждут десятки артистов, художников и лайвов.<br>Yauza &amp; Blanc</p>',0,'2000.0',2,36,1,'https://62b953c205f9f71b76d2cd3f.ticketscloud.org/e/647e26836c4aa4c64d7667e2','',false,false,NULL,NULL,'2023-06-24 01:44:45','2023-10-17 16:26:38',NULL,'','0',18,59),
	 (1066,'Samovar goes BLANK','2023-06-16-blank-samovar-goes-blank','2023-06-16',NULL,'23:00:00',NULL,'<p>Шумно отметив свою первую годовщину, московский лейбл SAMOVAR едет с дружеским шоукейсом в клуб BLANK.&nbsp;<br><br>В обойме резиденты лейбла: Symbol, Denis Potapov, Alfij, Dawn Razor и Sigmatic, а так же дружеская локальная поддержка в лице El, Pie, Keyser, Radmir Wayne и Ultranoise.&nbsp;<br>Последний, кстати дебютирует с синглом на лейбле Samovar прямо в день мероприятия, что непременно является еще одним хорошим поводом для веселья!</p>',1200,'',1,1,1,'https://smvrgoesblank.ticketscloud.org/','',false,false,NULL,NULL,'2023-06-14 11:55:57','2023-10-24 16:28:59',NULL,'','0',18,55),
	 (1067,'New Essentials','2023-06-15-propaganda-new-essentials','2023-06-15',NULL,'23:00:00',NULL,'<p>Новые четверги — новая молодая кровь в Пропаганде. Курирует ночь наша подруга, диджей и эксперт по ночной жизни из МЫИDЕМ Julia Karma.</p>',0,'',2,101,1,'','https://t.me/propagandamoscow',false,false,NULL,NULL,'2023-06-14 12:16:57','2023-10-24 23:22:16',NULL,'','0',18,48),
	 (1068,'Warehouse','2023-06-16-propaganda-warehouse','2023-06-16',NULL,NULL,NULL,'<p>Много техно не бывает, особенно у нас по пятницам. На Warehouse встречаем давних и дорогих друзей — Сергея Тимошова, Руслана Алиева и Андрея Automated.</p>',NULL,'',2,101,1,'','https://t.me/propagandamoscow',false,false,NULL,NULL,'2023-06-14 12:21:57','2023-10-12 18:41:55',NULL,'','0',18,94),
	 (1069,'Club Night','2023-06-17-propaganda-club-night','2023-06-17',NULL,'23:00:00',NULL,'<p>Не сбиваем обороты и делимся планами на тусовочную неделю!<br>Andrey Pokrovsky, Moonoton и Denis Kobyshev ведут очередной Club Night</p>',NULL,'',2,101,1,'','',false,false,NULL,NULL,'2023-06-14 12:26:46','2023-10-20 23:10:38',NULL,'','0',18,72);
