	 (1072,'ПИСК','2023-06-16-prostranstvo-pole-pisk','2023-06-16',NULL,'23:00:00',NULL,'<p>Смешение прямой бочки с энергичным электро и красного цвета с черным на новой вечеринке в «поле». Она пройдет после показа фильма «Артём И Ева» в рамках Beat Film Festival.</p>',600,'',2,46,1,'https://piskvpolye.ticketscloud.org/','https://t.me/eto_polye/1740',false,false,NULL,NULL,'2023-06-14 12:52:53','2023-10-25 04:16:41',NULL,'','0',18,126),
	 (1073,'Hypnotic','2023-06-16-rndm-hypnotic','2023-06-16',NULL,'23:00:00',NULL,'<p>Тёплым июньским ночам не хватает только отличной музыки – включим 16 июня в RNDM на вечеринке Hypnotic.<br>Мы раскинем для вас два танцпола, по которым разольём море жанров. Внутри – два лайва: первый отыграет краснодарский чаровник, чьи чуткие ритмы вдохновлены ранней гипнотической электроникой и выходили на виниле всех континентов. А также – новую программу покажет wei.xzy, создатель лейбла Collective/Коллектив и гений модульных синтезаторов.<br><br>Уличный танцпол в руках мастеров жанра – резидентов питерской формации Subspace. Также во дворике дополнительными точками притяжения станут пинг-понг и тату-мастерская.<br><br>Возглавят танцевальный вайб резиденты Черты Altruck, Mitya Chesnokov и Kvarta. <br>А команда TEMNOTA добавит в ночь ярких вспышек света!</p>',1000,'',2,27,1,'https://cherta.qtickets.ru/event/74609','https://vk.com/hypn8tic',false,false,NULL,NULL,'2023-06-14 13:04:30','2023-10-25 04:15:14',NULL,'','0',18,108),
	 (1074,'САНАТОРИЙ РАДУГА','2023-06-16-supermetall-sanatorii-raduga','2023-06-16',NULL,'20:00:00',NULL,'<p>Задорная тусовка диско-клуба «Радуга» с избранными резидентами и приглашенными гостями. В лайнапе: видеоблогер и певец Нико Гротик с лайвом, Amlinsky, Arkadich, Fraukrauze, Julia Konor и другие артисты.</p>',0,'1500.0',2,119,1,'https://radugadiscoclub.ru/e160623','',false,false,NULL,NULL,'2023-06-14 13:35:28','2023-10-22 17:56:57',NULL,'','0',18,235),
	 (1075,':data','2023-06-17-rndm-data','2023-06-17',NULL,'21:00:00',NULL,'<p>В субботу 17 июня :data перезапускает свой летний марафон с долгожданной вечеринкой на двух танцполах RNDM.<br><br>Вечер начнется с 21:00 на террасе клуба под виниловые сеты от Soulmate, Cutworx, Scool, Meen, Andray Rage и специально гостя, старейшего российского джангл/драм-н-бейс артиста, участника проектов Barbitura и Мальчишник - DJ Dan.<br><br>Главный танцпол запускаем в полночь. И здесь как мы любим: дабплейты, ганфингеры, ревайнды, мощный звук и сеты от Питерских гостей</p>',700,'',2,27,1,'https://moscow.qtickets.events/73929-data','https://vk.com/data_17_06',false,false,NULL,NULL,'2023-06-14 13:52:06','2023-10-25 18:24:17',NULL,'','0',18,105),
	 (1076,'LOUD BOYZ: NO STRESS','2023-06-17-supermetall-loud-boyz-no-stress','2023-06-17',NULL,'18:00:00',NULL,'<p>Электронное трио «Лауд» совместно с диско-клубом «Радуга» организуют большую вечеринку в честь нового альбома No Stress. Поддержит парней проект , Easy Fresh, Gabba из Башкирии, а также DJ Fenixxx, Taly &amp; Unit Boy и многие другие артисты.</p>',0,'1500.0',2,119,1,'https://radugadiscoclub.ru/e170623','',false,false,NULL,NULL,'2023-06-14 14:17:51','2023-10-09 02:14:09',NULL,'','0',18,235),
	 (1087,'Cleopatra','2023-06-23-community-moscow-cleopatra','2023-06-23',NULL,'22:00:00',NULL,'<p>Добро пожаловать на вечеринку по фильму "Клеопатра"! В эту ночь мы отправимся в древний Египет и прочувствуем всю атмосферу легендарной королевы Клеопатры.<br>Музыкальное оформление вечеринки будет подобрано по всей тематике фильма: с восточными мотивами, ритмами, звуками, которые всех будут подстегивать к движению и танцу.</p>',800,'',2,58,1,'https://moscow.qtickets.events/74987-cleopatra','',false,false,NULL,NULL,'2023-06-14 17:13:41','2023-10-17 15:51:25',NULL,'','0',18,232),
	 (1088,'Ravecore 2. Revolution Dance','2023-06-17-ionoteka-ravecore-2-revolution-dance','2023-06-17','2023-06-17','18:00:00','23:00:00','<p>Вторая UNDERGROUND RAVE вечеринка от команды RAVECORE</p>',200,'300.0',1,40,1,'https://spb.qtickets.events/72080-ravecore-2-revolution-dance-17062023-ionoteka-spb','https://vk.com/ravecoreevent',false,false,NULL,NULL,'2023-06-14 17:41:43','2023-10-14 13:47:20',NULL,'','0',18,49),
	 (1077,'Chillrave Daytime','2023-06-17-blanc-chillrave-daytime','2023-06-17',NULL,'18:00:00',NULL,'<p>Грандиозный лайнер под названием «Лето» могут взять на абордаж лишь такие отважные капитаны, как резиденты лейбла Leveldva — именно они 17 июня вновь отправятся в московский двор Blanc и устроят там уже второй Chillrave Daytime в этом сезоне.<br><br>Колокол пробьет начало в 18:00, когда город будет окутан колдовскими чарами заката и будет готов окунуться в безудержный 10-часовой чиллрейв, полный электроники и эмоций без границ.<br><br>17 июня Chillrave Daytime обещает стать событием грандиозного масштаба. Поводов для встречи несколько — день рождения главного капитана судна и основателя лейбла Leveldva Геры Топуридзе, возвращение Izhevski из странствий по миру и чиллрейв во дворе Blanc. Всего будет задействовано 3 танцпола, включая пазик, где всегда несется самая дикая часть вечеринки, и, конечно же, двор</p>',1500,'',2,36,1,'https://chillrave.timepad.ru/event/2449284/','',false,false,NULL,NULL,'2023-06-14 14:23:02','2023-10-25 09:42:04',NULL,'','0',18,227),
	 (1078,'TOTAL OVERDOSE','2023-06-16-griboedov-total-overdose','2023-06-16',NULL,'23:00:00',NULL,'<p>Обводим в календаре пятницу красным маркером, ведь теперь пятница наш — Day Of Pleasure.<br><br>Бункер, Рэп, Стиль —<br>Ничего лишнего.<br>Только удовольствие.<br>RAP / RAP / RAP<br><br>400 — с репостом<br>600 — без внимания</p>',400,'600.0',1,86,1,'','https://vk.com/griboedovbasement',false,false,NULL,NULL,'2023-06-14 14:32:08','2023-10-21 08:12:13',NULL,'','0',18,61),
	 (1079,'STYX','2023-06-17-griboedov-styx','2023-06-17',NULL,'23:00:00',NULL,'<p>Styx ( др. -греч. Στύξ ) — олицетворение первобытного ужаса и мрака, из которых возникли первые живые существа, и персонификация одноимённой мифической реки Стикс.<br><br>STYX ( др. -гриб. Дрейн ) — олицетворение настроений, путём прослушивания электронной музыки, в помещении бывшего бомбоубежища, будучи глубоко под землей.<br><br>Вход:<br>400 — с репостом<br>600 — без внимания<br>Free — для Дрейнеров*<br><br>* первым 20 при наличии соответствующего образа.<br><br>Улыбайся, пока жив.</p>',400,'600.0',1,86,1,'','https://vk.com/griboedovbasement',false,false,NULL,NULL,'2023-06-14 14:36:30','2023-10-24 13:07:50',NULL,'','0',18,64);
