	 (1080,'OUTLAW','2023-06-16-16-tonn-presnenskii-val-outlaw','2023-06-16',NULL,'23:30:00',NULL,'<p>16 июня в клубе «16 Тонн» пройдёт вечеринка OUTLAW<br>Со специальным гостем из Санкт-Петербурга - nootro<br><br>Ранние билеты уже в продаже<br>Открываем летний сезон вместе с аутло!</p>',600,'',2,29,1,'https://moscow.qtickets.events/73387-outlaw','',false,false,NULL,NULL,'2023-06-14 16:09:26','2023-10-25 04:16:20',NULL,'','0',18,71),
	 (1082,' Qtickets Поиск MOSHIC (Israel)','2023-06-16-fantomas-chateau-rooftop-qtickets-p','2023-06-16',NULL,'23:00:00',NULL,'<p>MOSHIC (Israel) - Легенда мировой электронно-музыкальной сцены, один из основоположников современного андерграунд прогрессив хауса, владелец лейбла Contrast Records; артист, несколько раз входивший в топ 100 диджеев планеты по версии DJ Mag; продюсер, чьи треки играли и выпускали на своих лейблах Tiesto и Armin Van Buuren, а в данный момент и сам John Digweed готовит релиз с музыкой нашего гостя на Bedrock Records.<br><br>Поддержку хедлайнеру обеспечат ещё несколько громких имен</p>',2000,'',2,170,1,'https://moscow.qtickets.events/74239-moshic-fantomas-rooftop','',false,false,NULL,NULL,'2023-06-14 16:32:33','2023-10-17 07:50:08',NULL,'','0',18,58),
	 (1083,'XTREME','2023-06-16-deep-fried-friends-xtreme','2023-06-16',NULL,'23:00:00',NULL,'<p>Москва, с 16 на 17 июня всю ночь будет играть зарубежная хип-хоп музыка&nbsp;</p>',699,'',2,76,1,'https://moscow.qtickets.events/74397-1706-xtreme-at-pravda','https://vk.ru/xtrememoscow',false,false,NULL,NULL,'2023-06-14 16:49:00','2023-10-21 13:43:05',NULL,'','0',18,77),
	 (1084,'HEAVEN','2023-06-16-gorod-heaven','2023-06-16',NULL,'23:30:00',NULL,'<p>Мероприятие открывает серию тусовок в мск, которые будут проводится каждый месяц. <br>Вас ждут исполнители с уникальными стилями в различных жанрах направлений электронной музыки. <br>Каждый найдет своё на наших концертах, ждем тебя !</p>',700,'',2,63,1,'https://moscow.qtickets.events/72525-heaven','https://vk.com/event220544281',false,false,NULL,NULL,'2023-06-14 16:55:51','2023-10-13 16:16:56',NULL,'','0',18,44),
	 (1085,'Oberwave','2023-06-16-mutabor-oberwave','2023-06-16',NULL,'23:55:00',NULL,'<p>Большая вечеринка в Мутаборе и последний подобный ивент перед летними каникулами. Специальный гость — DRIADA, с не самыми веселыми песнями и весьма экстатическими танцами на осколках сердец. В общем, увидимся в эту пятницу — мы начнем ровно в полночь и продолжим, пока рассвет не разлучит нас.</p>',700,'',2,2,1,'https://moscow.qtickets.events/74499-1606-oberwave-at-mutabor','https://t.me/oberwave',false,false,NULL,NULL,'2023-06-14 17:02:30','2023-10-24 21:29:58',NULL,'','0',18,68),
	 (1086,'Rezone Showcase','2023-06-17-community-moscow-rezone-showcase','2023-06-17',NULL,'22:00:00',NULL,'<p>17 июня в самой танцевальной библиотеке Community готовится нечто особенное – вечеринка Rezone Showcase.<br><br>Многогранное путешествие в мир танцевальной музыки от трендсеттеров жанра, с эксклюзивными новинками, Live импровизациями с синтезаторами и живым вокалом в стилях</p>',1400,'2000.0',2,58,1,'https://moscow.qtickets.events/73897-rezone-showcase-v-community','https://vk.com/djrezone',false,false,NULL,NULL,'2023-06-14 17:06:10','2023-10-20 13:09:00',NULL,'','0',18,70),
	 (1107,'РЕКА ','2023-06-24-bar-strelka-reka','2023-06-24',NULL,'23:00:00',NULL,'<p>Вечеринка-знакомство с новым брендом лимонадов «Река», которая пройдет под диджей-сеты Ксении Дукалис, Карины Истоминой и Gucci Kale. <br>Тут же будут подавать специальные летние коктейли, которые придумали только к вечеринке.</p>',NULL,'0.0',2,103,1,'','https://t.me/strelkabarmoscow',false,false,NULL,NULL,'2023-06-24 01:34:13','2023-10-20 02:13:59',NULL,'','0',18,100),
	 (1089,'AIWASKA + POZDNYAKOV','2023-06-17-krysa-18-aiwaska-pozdnyakov','2023-06-17',NULL,'20:00:00',NULL,'<p>Когда-то они должны были бы встретиться.<br>Это было неминуемо и неизбежно: самый веселый и харизматичный артист Москвы: Дима Поздняков и загадочный человек в маске, рожденный в дебрях Амазонки и названый сказочным именем Aiwaska.<br><br>И мы рады, что эта знаменательная встреча произойдёт на нашей вечеринке, которая пройдёт на террасе легендарной Крыши 18.<br>В последний день, не менее легендарного ПМЭФ и не менее легендарной вечеринки от Юрия Милославского.<br>В общем одни легенды.<br>Надо идти.</p>',1800,'',1,45,1,'https://spb.qtickets.events/74459-piter-moskva','',false,false,NULL,NULL,'2023-06-14 17:46:44','2023-10-24 12:35:51',NULL,'','0',18,208),
	 (1090,'CYBERPUNK ИНТЕРВАЛ','2023-06-23-mod-cyberpunk-interval','2023-06-23',NULL,'23:55:00',NULL,'<p>Когда все звезды сойдутся и магию чисел невозможно будет игнорировать, тогда и продолжит свое действие первый интерактивно-перфомативный рейв, где каждый станет участником происходящего.<br>Тематика этого события посвещена миру CyberPunk и его стилистическим аспектам.</p>',500,'',1,113,1,'https://spb.qtickets.events/74064-230623-cyberpunk-interval-mod-club','https://vk.com/cyberpunkinterval230623',false,false,NULL,NULL,'2023-06-14 17:58:21','2023-10-25 16:02:09',NULL,'','0',18,79),
	 (1091,'TimeOfNight DNB','2023-06-24-factory-3-timeofnight-dnb','2023-06-24',NULL,'23:50:00',NULL,'<p>Timeofnight DNB заряжает летний сезон плотными вайбами ломаного и прямого ритма в стенах Factory на Кожевенной&nbsp;<br><br></p>',500,'',1,7,1,'https://bit.ly/dtb2023','https://vk.com/tonfactory',false,false,NULL,NULL,'2023-06-15 10:38:59','2023-10-01 08:01:06',NULL,'','0',18,208);
