	 (1225,'WHAT IS MAIN?','2023-07-15-code-yard-what-is-main','2023-07-15',NULL,'19:00:00',NULL,'<p>Welcome for DAY &amp; NIGHT PARTY to new summer location: CODE YARD<br>Special Guest: JUSTBRADJ(UAE)<br>Djs: Pola, Pozdnyakov, Khaney<br>Start at 19:00<br>Кадашевская Набережная&nbsp; 6/1/2</p><p>Бронь столов и доп информация +79036110052</p>',2500,'',2,203,1,'https://afisha.timepad.ru/event/2487921','',false,false,NULL,NULL,'2023-07-04 03:14:51','2023-10-17 22:27:28',NULL,'','0',18,91),
	 (1093,'SENSES Open Air','2023-07-01-mutabor-senses-open-air','2023-07-01',NULL,'23:55:00',NULL,'<p>Летний SENSES состоится на открытом воздухе и будет вненомерной частью серии, но это не означает, что он перестанет быть самым чувственным фестивалем.<br><br>Встречаемся 1 июля на двух летних сценах клуба Mutabor.<br><br></p>',1400,'',2,2,1,'https://moscow.qtickets.events/70405-senses-open-air','http://vk.com/sensesopenair',false,false,NULL,NULL,'2023-06-15 12:46:46','2023-10-22 18:56:13',NULL,'','0',18,407),
	 (1094,'Funk You! Party','2023-06-24-macty-funk-you-party','2023-06-24',NULL,'20:00:00',NULL,'<p>Funk You! продолжает серию летних вечеринок в гавани Васильевского острова, в клубе с плавучим названием.&nbsp;<br>Никакой вычурной роскоши, все просто — один танцпол внутри, другой виниловый во внутреннем дворике.<br><br>На этот раз представят новую программу и премьеру проекта "VITYA".<br>VITYA — электронная музыка, объединяющая в себе множество граней разных стилей, с щепоткой романтики, иронии и озорства.</p>',500,'',1,9,1,'https://funk-you.timepad.ru/event/2464908/','',false,false,NULL,NULL,'2023-06-23 23:45:05','2023-10-09 22:10:02',NULL,'','0',18,52),
	 (1095,'Абстрасенция: Long Arm','2023-06-25-krysa-18-abstrasenciia-long-arm','2023-06-25',NULL,'18:00:00','22:30:00','<p>Вечером в воскресенье 25 июня впервые мероприятие пройдёт на Крыше 18 с захватывающим видом на акваторию Невы и крейсер Аврора.<br>Выступит легендарный представитель сцены отечественной электроники Long Arm — электронный продюсер и экспериментатор, известен динамичными живыми выступлениями и музыкальными экспериментами на стыке трип-хопа, нью-джаза, эмбиента и эклектичного хип-хопа.&nbsp;<br>С dj-сетом выступит лауреат премии Сергея Курехина и участник Boiler Room — Monokle. Stayhomie выступит с вокальным лайвом в стиле бэйса, хип-хопа и сдержанной электроники. Академический музыкант, Регина Solar Bird представит сет с живой оркестровой флейтой. Резиденты лейбла Абстрасенции Envenn выступят с атмосферным лайвом.</p>',1100,'',1,45,1,'https://abstrasension.ru/25june_roof18?utm_source=vk&utm_medium=cpc&utm_campaign=tg_dnc2106','',false,false,NULL,NULL,'2023-06-23 23:51:39','2023-10-22 11:52:12',NULL,'','0',18,88),
	 (1096,'Абстрасенция: VACANT x WOODJU','2023-06-30-roof-place-abstrasenciia-vacant-x-woodj','2023-06-30','2023-07-01','23:59:00','06:00:00','<p>Ночью 30 июня Абстрасенция пройдёт на двух сценах крыши RoofPlace с живописным видом на Финский залив и гавань Васильевского острова.<br>Состоится выступление звезды британской электроники VACANT из Южного Лондона.&nbsp;<br>Знаковый электронщик Woodju вернется на фестиваль с атмосферным лайвом. Будут презентации релизов от продюсеров Sloati из Москвы и Unworldly c берегов Волги.&nbsp; Выступит певица Йоко, мастер гипнотических ритмов Reddy Sample, Solar Bird с флейтой, Dveyl с гитарным лайвом, Bachiksma и La Soul c энергичными сетами.</p>',1200,'',1,176,1,'https://abstrasension.ru/30june_roofplace?utm_source=vk&utm_medium=cpc&utm_campaign=tg_dnc2106','',false,false,NULL,NULL,'2023-06-23 23:57:36','2023-10-10 21:29:34',NULL,'','0',18,166),
	 (1097,'Катэраг','2023-06-24-blank-katerag','2023-06-24',NULL,'23:00:00',NULL,'<p>Новый масштабный Катэраг&nbsp; пройдёт на двух танцполах Бланка<br><br>В лайн-апе заявлены представители Roots United, ABCD, Plan B, резиденты Катэрага и их друзья.&nbsp;<br><br>Гримерка – для любителей потемнее и быстрее. Техно, электро, брейкбит.&nbsp;<br>На террасе – лэфтфилд-электроника, хаус и транс</p>',900,'',1,1,1,'https://spb.radario.ru/events/1946584/tickets','https://t.me/cutarug/601',false,false,NULL,NULL,'2023-06-24 00:04:53','2023-09-27 21:13:40',NULL,'','0',18,40),
	 (1098,'LEGAL''NAYA','2023-06-24-brusnicyn-xoll-legalnaya','2023-06-24',NULL,'23:00:00',NULL,'<p>24 июня Легальная отправляется выбивать блестки из единорогов и праздновать пятилетие главного летнего карнавала ODYSSEY FESTIVAL&nbsp;<br>Фестиваль пройдет на территории культурного квартала Брусницын. Пять стихий и пять сцен, одна из которых полыхнет огнем под нашим кураторством<br><br>Состав на картинке, дни пошли на обратный отсчет. Ищите нас в ночь с субботы на воскресение, на единственном крытом танцполе в Брусницын Холле&nbsp;</p>',1200,'',1,70,1,'https://odyssey-elements.ru/','',false,false,NULL,NULL,'2023-06-24 00:16:58','2023-10-23 21:21:16',NULL,'','0',18,126),
	 (1099,'РИТМЫ OneBus','2023-06-24-ritmy-ritmy-onebus','2023-06-24','2023-06-25','22:00:00','06:00:00','<p>После небольшого перерыва OneBus&nbsp; открывает летний сезон, где диджеи готовят вкусный микс из разных стилей.<br>А также:<br>Бриз с залива, белые ночи, куча коктейлей на баре, чтобы потерять стеснение и показывать всем свои танцевальные мувы, ожидание, пока сведут мосты и упадут цены на такси... Что может быть лучше?</p>',NULL,'',1,181,1,'','https://t.me/vritme_bar',false,false,NULL,NULL,'2023-06-24 00:26:36','2023-10-11 05:45:03',NULL,'','0',18,28),
	 (1100,'Clique Coachella','2023-06-24-gas-clique-coachella','2023-06-24',NULL,'23:50:00',NULL,'<p>Открываем летний сезон! На одну ночь мы окажемся на легендарном фестивале Coachella! Лето — это маленькая жизнь, и мы сделаем так, чтобы вам точно было, что вспомнить.&nbsp;<br>Open-air площадка, 2 сцены, свежие фрукты, освежающие коктейли, бирпонг, мейк-ап зона, танцы нон-стоп и атмосфера одной из лучшей ночи в твоей жизни!<br>Dress code: Coachella in the building!</p>',500,'550.0',1,57,1,'','https://t.me/gasmusiclub',false,false,NULL,NULL,'2023-06-24 00:44:34','2023-10-03 14:42:11',NULL,'','0',18,32);
