	 (1359,'Суетология','2023-07-14-zoccolo-20-suetologiia','2023-07-14',NULL,'23:55:00',NULL,'<p>В самом центре лета, в самом центре города - #Hardcore дискотека, поводом которой стало желание отметить многое множество Дней Рождений!<br>В костюме клоуна - FREE!</p>',NULL,'300.0',1,72,1,'','',false,false,NULL,2,'2023-07-14 14:41:04','2023-10-25 06:07:21',NULL,'','0',18,106),
	 (1101,'Mixed.Night vol.4','2023-07-01-mixed-mixednight-vol4','2023-07-01',NULL,'22:00:00',NULL,'<p>1 июля Mixed проводит четвертый эпизод фирменной вечеринки mixed.night vol.4 на двух танцполах.<br><br>В этот раз в лайн-апе два хэдлайнера — Paul K прямиком из Румынии со своим первым визитом в Россию и Denis Kaznacheev, недавно прибыший из экспедиции по Латинской Америке.<br><br>Денис — продюсер, диджей и вдохновитель лэйбла Nervmusic. в музыке и сетах он создает вдумчивое звучание, подкрепляя его тонким грувом диссонирующих синтезаторов и оттенками органического инструментария.&nbsp;</p>',700,'',1,59,1,'https://spb.qtickets.events/75808-mixednight-vol-4','',false,false,NULL,NULL,'2023-06-24 00:50:04','2023-10-24 17:41:46',NULL,'','0',18,156),
