	 (1103,'Reality Saint-P b-day bash','2023-06-23-mixed-reality-saint-p-b-day-bash','2023-06-23',NULL,'22:00:00',NULL,'<p>Ночь в Mixed</p>',NULL,'',1,59,1,'','',false,false,NULL,NULL,'2023-06-24 01:06:15','2023-06-24 01:10:53',NULL,'','0',18,1),
	 (1104,'Cascade Night','2023-06-23-bar-strelka-cascade-night','2023-06-23',NULL,'23:00:00',NULL,'<p>Танцы до рассвета в уютном дворике бара «Стрелка» проходят каждую неделю. В новую пятницу здесь пройдет шоукейс московской команды «Каскад». За пультом — резиденты промо-команды Skunk York и Andy Karpik, а также битмейкер Lapti и Женя Савельева.<br><br></p>',NULL,'0.0',2,103,1,'','',false,false,NULL,NULL,'2023-06-24 01:13:15','2023-10-04 20:28:40',NULL,'','0',18,7),
	 (1105,'Libertas','2023-06-23-rndm-libertas','2023-06-23',NULL,'23:00:00',NULL,'<p>Мы прерываем невыносимо долгое ожидание и с гордостью объявляем возрождение нашей формации Libertas. 23 июня в стенах нами любимого RNDM пройдет первое событие «Vault Exodus» в новом составе и с удивительными экспериментами. Мы не изменяем себе и в этот раз привычный стиль войдет в ногу с новой современной эпохой и добавит мажорности к привычной бочке<br>Триумфальное возвращение молодой промокоманды после вынужденного перерыва. Вечеринка наполнится агрессивной прямой бочкой, за которую ответят друзья и резиденты</p>',600,'800.0',2,27,1,'','https://vk.com/event220808255',false,false,NULL,NULL,'2023-06-24 01:20:18','2023-06-24 01:20:39',NULL,'','0',18,1),
	 (1106,'APPLIQUE','2023-06-23-gazgolder-applique','2023-06-23','2023-06-25','23:00:00',NULL,'<p>Столичные заводилы из команды Applique отмечают шестилетие. С 23 по 25 июня они устроят бесперерывный праздник с комнатой смеха, чертовым колесом на мейне и воздушным замком на террасе. 37-часовое событие пройдет в атмосфере парка развлечений, где всех угостят попкорном и сладкой ватой.</p>',1500,'',2,35,1,'https://applique.ticketscloud.org/','',false,false,NULL,NULL,'2023-06-24 01:22:47','2023-06-24 01:29:44',NULL,'','0',18,1),
	 (1110,'Engineer Records ','2023-06-24-rndm-engineer-records','2023-06-24',NULL,'23:00:00',NULL,'<p>Фешенебельный виниловый лейбл Engineer возвращается в Москву со своим фирменным шоукейсом. После почти двухлетнего перерыва звук Funktion One будет густо дымить клубами румынимал грува, шелестеть странными триповыми текстурами и массировать диафрагму тягучими резиновыми басами современной Хаус музыки. Шеф повара вечеринки - два не нуждающихся в представлении артиста SLOWDANCE - Michael Dop и Tagir, а стартеры и аперитив подадут новые, но интригующие Tripolubov и Milou. Приходите к началу, танцуйте до утра и оставайтесь ночевать.</p>',500,'1000.0',2,27,1,'https://tramplinpro.timepad.ru','',false,false,NULL,NULL,'2023-06-24 01:55:25','2023-10-24 21:11:55',NULL,'','0',18,56),
	 (1111,'Спишь?','2023-06-24-mutabor-spis','2023-06-24',NULL,'21:00:00',NULL,'<p>24 июня самая короткая субботняя ночь в году, поэтому вопросительный знак в названии фестиваля уже не ирония, а практически сарказм.&nbsp;<br><br>План. До 5 утра не спать в гигантских гамаках на мейне под основную программу с вокально-пластическим перформансом и академической музыкой. В три ноль-ноль полностью проснуться в Гараже — к началу танцевальной части.&nbsp;</p>',1600,'',2,2,1,'https://mutabor.club/24~JUNE/','',false,false,NULL,NULL,'2023-06-24 02:01:45','2023-10-01 05:27:38',NULL,'','0',18,51),
	 (1112,'Electrobudka','2023-06-24-kontrkult-electrobudka','2023-06-24',NULL,'23:00:00',NULL,'<p>В субботу собираемся стирать обувные подошвы в электро-брейкбит припадке<br>Вход — 500 до полуночи, 700 после полуночи</p>',500,'700.0',1,33,1,'','https://t.me/kontrkult21',false,false,NULL,NULL,'2023-06-24 02:22:05','2023-10-16 21:40:33',NULL,'','0',18,35);
