	 (1113,'TON 618','2023-06-30-mutabor-ton-618','2023-06-30',NULL,'22:00:00',NULL,'<p>После долгого затишья, набравшись сил и энергии - Mizar открывает для вас двери Арт центра Мутабор 30 июня&nbsp;<br><br>TON 618 - название вечеринки&nbsp;<br>отсылка к самой большой чёрной дыре, известной на данный момент человечеству. Излучающий квазар.&nbsp;<br>TON 618 - учит нас тому, что пространство можно смять, как лист бумаги, в бесконечно малую точку; что время можно погасить, как трепещущее пламя; и что законы физики, которые мы считаем «священными» и неизменными, таковыми не являются».</p>',1000,'2000.0',2,2,1,'https://mizarco.timepad.ru/event/2465514/','',false,false,NULL,NULL,'2023-06-24 02:39:27','2023-10-25 06:15:24',NULL,'','0',18,169),
	 (1114,'Super Synchron','2023-06-25-yauza-super-synchron','2023-06-25',NULL,'12:00:00',NULL,'<p>В воскресенье команда Synchron отойдет от тусовочного амплуа и устроит дневной маркет в ресторане Yauza Place. Ребята перенесли его с «Суперметалла» в сердце Китай-города, чтобы вы с кайфом могли потягивать коктейли и закупиться обновками в центре.<br><br>В этот день двор на Яузе наполнится декором, аксессуарами и одеждой московских брендов, а также работами современных художников. Ну и какой же маркет без дневной вечеринки: сопровождать шопинг будет лайв пианиста Арсения Трофима и диджей-сеты<br><br>Вход свободный, но нужно зарегистрироваться по ссылке&nbsp;</p>',NULL,'0.0',2,32,1,'https://synchron-event.timepad.ru/event/2465753/','https://t.me/synchron_music',false,false,NULL,NULL,'2023-06-24 03:15:12','2023-10-14 02:23:22',NULL,'','0',18,142),
	 (1115,'Супер Крутая Туса','2023-06-24-supermetall-super-krutaia-tusa','2023-06-24',NULL,'18:00:00',NULL,'<p>&nbsp;Диско-клуб «Радуга» этим летом регулярно проводит вечеринки во дворе «Суперметалла». На очередной такой выступят завсегдатаи лайнапов промокоманды и их ближайшие друзья&nbsp;</p>',0,'1500.0',2,119,1,'https://radugadiscoclub.ru/e240623','',false,false,NULL,NULL,'2023-06-24 03:21:26','2023-10-24 21:20:28',NULL,'','0',18,160),
	 (1116,'Reson 01 ','2023-06-24-kyomei-reson-01','2023-06-24','2023-06-25','21:00:00','02:00:00','<p>Серия домашних вечеринок в нашем пространстве RESOhub.<br><br>В этом году одним из главных событий для Резонанса стало открытие нашего пространства RESOhub, в котором расположились наш мерч-стор и izakaya bar Kyomei.&nbsp;<br><br>Теперь каждые выходные стены&nbsp; RESOhub будут перевоплощаться в танцпол, где соберутся резиденты и друзья нашего коммьюнити.&nbsp;<br><br>24 июня мы начинаем новую главу в истории Резонанса — серию вечеринок RESON.&nbsp;<br><br></p>',NULL,'0.0',2,186,1,'','',false,false,NULL,NULL,'2023-06-24 03:30:01','2023-10-24 13:06:25',NULL,'','0',18,59),
	 (1117,'SPB Sound','2023-06-24-diuny-spb-sound','2023-06-24',NULL,'23:30:00',NULL,'<p>Наконец то лето, и можно играть музыку прямо на улице!<br>И двор бара"Дюны" отлично для этого подходит.<br><br></p>',NULL,'500.0',1,49,1,'','',false,false,NULL,NULL,'2023-06-24 03:41:51','2023-10-22 10:31:37',NULL,'','0',18,45),
	 (1118,'Resonance Records x Griboedov Basement ','2023-06-24-griboedov-resonance-records-x-griboedov','2023-06-24',NULL,'18:00:00',NULL,'<p>В эту субботу, на летней веранде Griboedov Amsterdam произойдет нечто: коллаборация с нашими друзьями - студией Resonance Records .<br>Открывает вечер live выступление от артистов Резонанса, трио - nobongforbaby, которые имея в своем арсенале винтажные примочки и сэмплеры, исполнят для вас свою музыку, в жанрах minimal techno, jungle и house. В середине вечера - Сальвадор Грув ! Живое выступление от резидентов Резонанса, в формате live, во главе с Темой Бабичем. Закрывает первую стадию нашего вечера Артур KIRSANAX, предводитель Griboedov Basement.<br>c 18:00 — 20:00&nbsp; - фри с репостом<br>c 20:00 с репостом - 300<br>c 20:00 - 500</p>',300,'500.0',1,86,1,'','',false,false,NULL,NULL,'2023-06-24 04:16:18','2023-10-12 18:28:17',NULL,'','0',18,33),
	 (1119,'Филд Модулейшн','2023-06-24-prostranstvo-pole-fild-moduleisn','2023-06-24','2023-06-25','20:00:00','03:00:00','<p>Интерактивная инсталляция, постоянно генерирующая новые звуки и изображения, которые отталкиваются от образов друг друга и создают себя снова и снова. А с помощью одного из экранов создавать образы смогут и все гости. С 24 июня и весь месяц после FM будет выставляться в полевом аперитиво, а в день открытия пройдет вечеринка, на которую с кассетным лайвом приедет Soft Blade и еще шестеро разножанровых музыкантов, а с лекцией прибудет музыкант и ведущий подкаста «Планетроника» Ник Завриев.</p><p>Соблюдаем режим летних вечеринок с переплетением музыки и искусства.</p>',NULL,'',2,46,1,'','https://www.polye.ru/',false,false,NULL,NULL,'2023-06-24 04:29:52','2023-10-10 06:06:21',NULL,'','0',18,53),
	 (1129,'MANIFEST x RAVENSTVO','2023-07-01-rndm-manifest-x-ravenstvo','2023-07-01',NULL,'23:00:00',NULL,'<p>Нет никаких сил больше это скрывать! Будем считать это каминг аутом. (Ой, блять, как будто бы никто ещё не понял). Рано или поздно это должно было случиться и кто мы такие, чтобы тому препятствовать! Мы давно признавались друг другу в любви в кулуарах и теперь мы хотим, чтоб это увидели все! Объявляю 1 июля праздником чистой и бескорыстной любви! Тебя, кстати, это тоже касается! Тебя мы тоже любим!<br><br>* 500₽ по репосту VK до полуночи<br>Учитываются репосты сделанные до 23:00 30/07/23</p>',0,'800.0',2,27,1,'','https://vk.com/ravenstvoxmanifest',false,false,NULL,NULL,'2023-06-28 00:30:57','2023-10-24 21:02:34',NULL,'','0',18,137),
	 (1360,'Washing Machine - CRUISE','2023-07-14-washing-machine-washing-machine-cruis','2023-07-14',NULL,'23:30:00',NULL,'',NULL,'',1,226,1,'','',false,false,NULL,2,'2023-07-14 14:48:34','2023-10-16 12:41:33',NULL,'','0',18,72),
	 (1120,'Большой Рейв','2023-07-01-blank-bolsoi-reiv','2023-07-01','2023-07-02','23:59:00',NULL,'<p>ОМГ! Какой же он большой! Слова твоей подружки ласкают чужие ушки. Извини, ты ни при чем, дело совсем не в тебе, просто он так плотно подсел на растишку, что вымахал до каких-то несусветных размеров.<br><br>«Большой Рейв» приумножает экспектации, взваленные на него крикливым именем, и реанимирует позабытый формат марафона — теперь не только объемный, но и длинный. 26-часовой нон-стоп, с которого раньше финишной ленты отвалятся только слабаки.<br><br>Подсчеты людей тут не ведут, легко сбиться, поэтому и мы разложим на подразделения. Техно-секта Monasterio передаст мейн или его руины весельчакам из TAPENIGHT Клан. Терраса пригреет семейство Blank и ближних. Гримерку сквотирует готовящийся к скорому запуску лейбл Devotee с приверженцами музыки, от которой хочется жить. И все это беспрерывное великолепие растянется с субботы аж до понедельника.<br><br>Отпусти ее и себя взять не забудь. Заодно узнаем, сможешь ли ты выдержать такую дистанцию.</p>',1600,'',1,1,1,'https://www.blankclub.ru','',false,false,NULL,NULL,'2023-06-27 23:07:38','2023-10-24 21:16:04',NULL,'','0',18,344);
