	 (1122,'New Generation','2023-06-30-dom12-new-generation','2023-06-30',NULL,'21:00:00',NULL,'<p>Отпусти мысли, растворись в мире музыки, где каждая нота — это отдельная история, а каждый ритм — это вызов твоего тела.<br>Селекцию для нас готовят прекрасные диджеи и музыканты, имена которых хорошо знакомы. Отдавать энергию в эту пятницу будут наши артисты</p>',NULL,'0.0',1,187,1,'','http://dom12spb.ru/',false,false,NULL,NULL,'2023-06-27 23:39:44','2023-10-20 21:12:32',NULL,'','0',18,57),
