	 (1124,'Архстояние 28-30 июля 2023','2023-06-28-art-park-arxstoianie-28-30-iiulia-2023','2023-07-28','2023-07-30','15:00:00',NULL,'<p>Ежегодный фестиваль ленд-арта и современного искусства, который проходит в самом большом арт-парке Европы Никола-Ленивец (Калужская область). <br>Программа включает презентацию архитектурных объектов, арт-проекты, театр, музыку, лекции и многое другое. В 2023 году фестиваль пройдет в 18-й раз. Тема - игра в предсказания.</p>',7200,'',2,82,3,'https://2023.stoyanie.ru','',false,false,NULL,NULL,'2023-06-27 23:52:13','2023-10-24 21:12:16',NULL,'','0',18,279),
	 (1138,'Ivan Roudyk / Alba / Qdream / Ten G','2023-07-01-warpp-ivan-roudyk-alba-qdream-ten','2023-07-01',NULL,'22:00:00',NULL,'<p>В эту субботу встречаем в клубе Warpp Иван Рудыка. Заслуженный деятель российской электронной сцены, чьи сэты, играемые во многих громких клубных проектах двух столиц, привили любовь к хаус музыке даже тем, кто был далек от нее до того. Локальную поддержку окажут наши резиденты</p>',0,'1000.0',1,23,1,'','https://warppclub.com',false,false,NULL,NULL,'2023-06-28 02:18:00','2023-10-25 09:05:46',NULL,'','0',18,78),
	 (1125,'Solar Vibe','2023-07-01-solaris-lab-solar-vibe','2023-07-01','2023-07-02','18:00:00','02:00:00','<p>1 июля на видовой крыше состоится вечеринка Solar Vibe.<br><br>План такой <br>18:00 - 22:00 - чилим на крыше под dub, hip-hop, downtempo, chill bass, beats, funky glitch-hop и провожаем солнышко.<br>&nbsp;22:00 -02:00 - уходим внутрь и раздаем басов: world bass, breakbeat, glitch-hop, dubstep, DNB, jungle.<br><br>Танцы на крыше, вдохновляющий вид, хорошая музыка, душевные разговоры и вкусные напитки. Мы проведём этот вечер в тёплой дружеской атмосфере.<br>Присоединяйся! <br><br>Вход: 400 р в предпродаже / 500 р на месте<br><br>По вопросам приобретения билетов пишите <a href="https://vk.com/ekzatikin">Никите</a></p>',400,'500.0',1,106,1,'https://vk.com/ekzatikin','',false,false,NULL,NULL,'2023-06-28 00:02:57','2023-10-24 03:57:02',NULL,'','0',18,106),
	 (1126,'LABEL NIGHT','2023-07-01-gazgolder-label-night','2023-07-01','2023-07-02','21:00:00','10:00:00','<p>Летняя ночь на террасе клуба Газгольдер.<br><br>1 июля отличная музыка от резидентов и друзей клуба. Поиграем в пинг понг, продегустируем новое летнее меню и встретим рассвет на любимой террасе клуба.<br><br>Вход:<br>21:00 — 23:00 FC / вход бесплатный, с предварительной регистрацией.<br>23:00 — 10:00 FC / вход по билетам</p>',0,'1000.0',2,35,1,'https://widget.afisha.yandex.ru/w/sessions/MTk5NDl8NDExNTQxfDI5MDIwMHwxNjg4MjM0NDAwMDAw?clientKey=93e262b1-8851-4821-9af4-2ba6d919f1f9','https://www.gazgolderclub.ru',false,false,NULL,NULL,'2023-06-28 00:12:24','2023-10-24 22:11:43',NULL,'','0',18,118),
	 (1127,'Corpus One','2023-06-30-gazgolder-corpus-one','2023-06-30','2023-07-01','21:00:00','10:00:00','<p>Первый, жаркий и долгожданный CORPUS ONE summer edition пройдёт 30 июня в музыкальной обители Москвы клубе Газгольдер.<br><br>На двух танцполах клуба развернется событие, пропитанное летним гедонизмом и почерком 12 артистов, которые своим фирменным звучанием автоматически впишут эту ночь в список ваших лучших летних воспоминаний.</p>',1200,'1700.0',2,35,1,'https://moscow.qtickets.events/75501-corpus-one-summer-edition?utm_source=gaz_site','https://www.gazgolderclub.ru/',false,false,NULL,NULL,'2023-06-28 00:19:04','2023-10-05 17:25:07',NULL,'','0',18,86),
	 (1128,'CLUB NIGHT','2023-06-30-rndm-club-night','2023-06-30',NULL,'22:00:00',NULL,'<p>Новый Club Night от команды RNDM с потрясающим составом впервые развернется на двух танцполах клуба уже в предстоящую пятницу.<br><br>Вход до 00:00 — бесплатный, после — 500 ₽.</p>',0,'500.0',2,27,1,'','https://vk.com/rndm_clubnight',false,false,NULL,NULL,'2023-06-28 00:25:10','2023-10-04 09:13:20',NULL,'','0',18,183),
	 (1130,'ISHOME','2023-07-15-temple-of-deer-ishome','2023-07-15',NULL,'20:00:00',NULL,'<p>Совмещая в себе роли звукового и видеохудожника, главная героиня меланхоличной электроники устроит долгожданный сеанс аудиовизуального гипноза.<br><br>Перламутровая электроника и аскетичное техно, невесомый эмбиент-поп и пронзительные цифровые драмы — балансируя между многообразием форм, Мирабелла Карьянова успела создать собственный музыкальный язык. Общим знаменателем в этом обилии жанров остается врожденная чуткость и филигранность Ishome, благодаря которым ее произведения образуют цельное повествование.</p>',800,'',1,22,2,'https://tod.show/ishome','',false,false,NULL,NULL,'2023-06-28 00:38:05','2023-10-23 18:26:01',NULL,'','0',18,215);
