	 (1136,'Sunsetting','2023-06-30-dizain-zavod-sunsetting','2023-06-30','2023-06-30','19:00:00','23:00:00','<p>Пытаемся выжать из лета максимум и в эту пятницу встречаемся на крыше. План до неприличия простой: встретим закат, потанцуем под сеты резидентов Oberwave и Salon du Exōtikûs, послушаем душещипательный лайв от господина Борзенкова (1/2 дуэта Elektromonteur) и, так и быть, выпьем по бокалу-другому.<br><br>Начнем в 19:00. Закончим в 23:00. Что касается музыки, то ничего сурового ждать не стоит — настроение летнее, романтичное и нью вейвовское. Сюрпризы, конечно, будут, но все в рамках приличия.</p>',500,'',2,188,1,'https://moscow.qtickets.events/76506-3006-sunsetting-na-kryshe','https://t.me/oberwave',false,false,NULL,NULL,'2023-06-28 02:05:34','2023-10-10 11:17:57',NULL,'','0',18,138),
