	 (1139,'Wonderland. Глава 16 Boat Party Daytime.','2023-07-15-warpp-wonderland-glava-16-boat-party-d','2023-07-15','2023-07-16','18:00:00','23:00:00','<p>Дорогие наши единомышленники. Мы хотим порадовать Вас летним событием. Благодаря Вам нашим любимым друзьям, мы постоянно совершенствуемся и смогли создать из Wonderland настоящий показатель качества и профессионализма, а также получили ваше доверие за что мы Вас очень сильно любим и ценим. Вечеринка с искренними людьми, артистами высшего эшелона класса А и потрясающей атмосферой, а также постоянной Sold Out составляющей. Тёплые июльские лучики солнца пробьются сквозь облака и озарят расцветающий мир дивных существ и чарующих звуков. Уже 15 июля Wonderland вернётся в обновлённом формате<br><br>Мы приглашаем вас в пятичасовое путешествие на борту волшебного ковчега, который проплывёт по берегам Невы мимо творений великих архитекторов, атмосферных закутков города Петра и выйдет в залив, чтобы насладиться нашим приключением сполна.<br><br>Капитан корабля настроит штурвал на правильную волну, волшебники-бармены сварят авторские зелья, а для полного погружения фeи-декораторы взмахнут волшебной палочкой и ковчег на один день превратится в мир, невиданный ранее. Любимые, мы будем вместе парить по белоснежным облакам, а также встретим магической красоты закат под волшебную музыку, ваши улыбки и запечатлим этот миг надолго.</p>',2500,'',1,214,1,'','https://hopeandlovehere.com',false,false,NULL,NULL,'2023-06-28 02:25:55','2023-10-18 02:39:50',648,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWM4ZjQ5ZTM2MTVjZTYwMTliOThmNzNlIn0.a0dGEAZ3N97GMpHyAWxF-8isExi5F023NUHtsUtPAvY','0',18,252),
