	 (1145,'Live History Night','2023-07-08-macty-live-history-night','2023-07-08','2023-07-09',NULL,NULL,'<p>8 июля в клубе Мачты состоится Drum &amp; Bass вечеринка с артистами и друзьями Петербургского ликвид-фанк лейбла Live History Records.<br><br>Гости из Оренбурга и Москвы. Главный танцпол в баре и виниловый танцпол на улице. Перформанс живого саксофона. Презентация новых релизов от резидентов.</p>',500,'700.0',1,9,1,'https://spb.radario.ru/events/1930362/tickets','',false,false,NULL,NULL,'2023-06-28 15:05:30','2023-10-25 07:31:11',NULL,'','0',18,155),
	 (1162,'Club Night','2023-07-01-propaganda-club-night','2023-07-01',NULL,'23:55:00',NULL,'<p>Субботняя клубная ночь в «Пропаганде» под звуки хауса, мильбурн-транса и другой погружающей электроники от завсегдатаев клуба и его новых друзей.</p>',NULL,'500.0',2,101,1,'','',false,false,NULL,NULL,'2023-06-29 15:32:47','2023-10-23 02:35:30',NULL,'','0',18,97),
	 (1146,'СИЯНИЕ','2023-06-30-slezy-siianie','2023-06-30',NULL,'23:00:00',NULL,'<p>СИЯНИЕ - это событие, которое объединяет в себе мощное звучание и эстетическую красоту света.<br><br>Мы собрали яркий лайн, который наполнит зал блестящими ломанными ритмами и, конечно же, убойной бочкой! Вы сможете насладится качественной электронной музыкой, которая заставит вас сиять на долгое время.<br><br></p>',400,'',2,102,1,'https://moscow.qtickets.events/75601-siyanie','https://vk.com/6sianie9',false,false,NULL,NULL,'2023-06-28 15:27:44','2023-10-17 05:08:36',NULL,'','0',18,81),
	 (1147,':data - Front Yard ','2023-07-01-axiom-bar-data-front-yard','2023-07-01','2023-07-01','18:00:00','23:00:00','<p>В субботу 1 июля продолжаем серию уличных бесплатных вечеринок "Front Yard" в Axiom Bar на Бауманской!<br><br>Теплый и летний вайб в уютном дворике на Басманном, отборная селекция ликвид фанк музыки от резидентов :data, мощный звук Funktion One, настольный теннис, лёгкие напитки и еда, а главное улыбки и танцы</p>',300,'',2,171,1,'https://moscow.qtickets.events/76206-front-yard','https://vk.com/datamoscow',false,false,NULL,NULL,'2023-06-28 15:32:33','2023-10-25 12:47:43',NULL,'','0',18,83),
	 (1148,'RISING SUN','2023-07-01-etherea-bar-rising-sun','2023-07-01',NULL,'21:00:00',NULL,'<p>В древние времена, до появления государственности, тайную музыкальную сеть возглавляло правление кланов, а мир управлялся тайным сообществом из тени. В 2048 г. 18 кланов отвечают за соблюдение порядка и музыкальных законов в Etherea Bar...<br><br>Для настоящих сегунов путь начнётся через татуировки. Два умелых наёмника шизару ловко превратят ваши тела в произведения искусства.<br><br></p>',800,'1000.0',2,189,1,'https://moscow.qtickets.events/75180-24-iyunya-2100-rising-sun-etherea','https://vk.com/rising_sun_algorithm',false,false,NULL,NULL,'2023-06-28 16:32:53','2023-10-22 16:53:28',NULL,'','0',18,85),
	 (1149,'PromoKode 1 Year Anniversary','2023-07-01-dvor-zacem-nakidalsia-promokode-1-year','2023-07-01',NULL,'23:00:00',NULL,'<p>Этим летом команда PromoKode будет отмечать свой первый День рождения! Вот уже целый год промо-группа проводит самые разноплановые мероприятия, в которых общим остаётся одно: лучшая музыка, яркие эмоции и тёплая атмосфера.<br><br></p>',700,'',2,145,1,'https://moscow.qtickets.events/74092-promokode-1-year-anniversary','https://vk.com/promokodeshowcase',false,false,NULL,NULL,'2023-06-28 16:45:27','2023-10-25 17:53:05',NULL,'','0',18,72);
