	 (1172,'HEAVEN','2023-07-15-treff8-club-heaven','2023-07-15',NULL,'23:00:00',NULL,'<p>Как гром среди ясного неба, появляемся со следующей вечеринкой. Собираем всех любителей современной электроники под крышей клуба TREFF8. Править парадом будет один из главных электронных продюсеров России - TREEPSIDE, а помимо него в лайн-апе наш близкий круг артистов и диджеев от Владивостока до Москвы</p>',700,'1500.0',2,84,1,'https://moscow.qtickets.events/76396-heaven-1507-treff8','',false,false,NULL,NULL,'2023-06-29 17:47:39','2023-10-23 20:44:07',NULL,'','0',18,135),
	 (1150,'FUNKY TUNES/FUNKY BEATS - F.F.B B-DAY PARTY','2023-07-01-16-tonn-presnenskii-val-funky-tunesf','2023-07-01','2023-07-02','23:00:00','05:30:00','<p>1 июля команда Funky Tunes приготовила для вас нечто грандиозное! У нашего друга Артема F. F. B День Рождения, и мы решили сделать ему подарок и пригласили диджеев, музыкантов и МС, чтобы поздравить его!!!<br>Вечеринка пройдет в «16 Тонн» и будет разделена на два блока:<br><br>23:30-05:30 Funky Beats (Главный танцпол, 2 этаж):<br>PLANET RAGTIME, FFB, MELLOWMATIX, CRUNCH FM, N-TONE, OVU, DR. MEL<br>MC: КУЗА DEGA, ГРОМЪ, RIMSKY THA RIMM<br><br>19:00-23:30 Funky Tunes (Pre-party на Красной Веранде «16 Тонн»):<br>ELECTROGORILLA, LOONEEZ, PIMPER FUNK, ESSENT, B-FORM<br>Вход:<br>(Главный танцпол, 2 этаж) Funky Beats — от 600 рублей в день мероприятия, предпродажа — от 300 рублей.<br>Funky Tunes — free. Эта часть вечеринки является pre-party и пройдет на Красной Веранде клуба.<br><br>16 Тонн, ул. Пресненский Вал, дом 6, стр. 1<br>Начало: 19:00<br>Окончание: 05:30</p>',500,'600.0',2,29,1,'https://moscow.qtickets.events/75176-funky-tunes-ffb-b-day-party','',false,false,NULL,NULL,'2023-06-28 16:57:41','2023-10-03 07:13:10',NULL,'','0',18,54),
	 (1151,'Green / Mr. T','2023-06-30-stirka40-green-mr-t','2023-06-30','2023-07-01','21:00:00','02:00:00','<p>После большого перерыва в на сцену Стирки возвращается сам Юрий Яблоков, друг диджея Залетного и коллекционер пластмассы.</p><p>С 23:00 жемчужины из своей коллекции винила крутит фронтмен бара «Pif-Paf» и&nbsp; панк-группы Michael Circle.&nbsp;</p>',NULL,'0.0',1,14,1,'','',false,false,NULL,NULL,'2023-06-28 17:13:26','2023-10-24 20:58:40',NULL,'','0',18,115),
	 (1152,'Дикое Диско','2023-07-01-macty-dikoe-disko','2023-07-01','2023-07-02','22:00:00','06:00:00','<p>Волшебная дискотека от Дикого Диско в Мачтах в эту субботу<br>2 танцпола, 12 диджеев, задний двор Мачт и площадь Севкабель Порта<br><br>Танцевальное погружение на 8 часов в мир волшебства и красоты.<br>Фантазии про магических подводных существ, затейливая красота неизведанного мира, иные законы притяжения (его больше нет!), жемчуг, переливы, тонкость, полупрозрачность.<br>Морская тема в декорациях и нарядах.</p>',2200,'',1,9,1,'https://dikoe-disko.timepad.ru/event/2462015/','https://t.me/dikoedisco',false,false,NULL,NULL,'2023-06-28 17:29:44','2023-10-24 00:09:09',NULL,'','0',18,160),
	 (1163,'РАДУГА × ШУВА','2023-07-01-blanc-raduga-suva','2023-07-01',NULL,'18:00:00',NULL,'<p>«Шува» — серия вечеринок Лалы и Паши из дуэта Lovanda, заряженная веселой электроникой. Тусовка начнется во дворе бара, а ночью переместится внутрь. В программе ищите интересные лайвы и многожанровые диджей-сеты.</p>',0,'1000.0',2,36,1,'https://radugadiscoclub.ru/e010723','',false,false,NULL,NULL,'2023-06-29 15:38:16','2023-10-21 18:24:00',NULL,'','0',18,105),
	 (1153,'Vibe Room Summer Camp ','2023-06-30-union-vibe-room-summer-camp','2023-06-30',NULL,'23:00:00',NULL,'<p>Продолжаем набирать обороты летних ивентов и разбиваем свой музыкальный лагерь на двух танцполах Ю в эту пятницу.<br><br>На мейн стейдже во дворе — трип по эпохам хип-хопа: от ветеранов и легенд Cypress Hill, Mobb Deep и Naughty By Nature до героев новой эпохи и фрешменов от Future и Travis Scott до Don Toliver и Baby Keem.&nbsp;<br>В баре, как обычно, танцпол со всем многообразием электронной музыки: от Kaytranada и Peggy Gou до Bicep и Fred again.</p>',NULL,'500.0',1,8,1,'','',false,false,NULL,NULL,'2023-06-28 18:18:52','2023-10-22 21:44:16',NULL,'','0',18,108),
	 (1154,'Vibe Room x Testin G x БАТО 7','2023-07-07-blank-vibe-room-x-testin-g-x-bato-7','2023-07-07',NULL,'23:00:00',NULL,'<p>Коллаборации между Vibe Room и Testin G&nbsp; давно стали неотъемлемой частью для обеих команд и скоро перейдут в разряд добрых традиций. Неудивительно, ведь вряд ли в Петербурге найдутся еще два настолько же близких по духу объединения.<br><br></p><p>На этот раз наш кроссовер обретает необходимый нам масштаб культового клуба Blank, а и без того фестивальный лайн-ап пополнятеся третьим участником — БАТО (Бурятский Андерграунд Творческое Объединение). Все три команды готовят не только диджей сеты, но и лайвы с живыми инструментами и творческие шоукейсы. Музыкальной программе и лайн-апу мы посвятим отдельный пост.</p><p><br></p>',500,'',1,1,1,'https://spb.qtickets.events/76477-vibe-room-x-testin-g-x-bato','',false,false,NULL,NULL,'2023-06-28 18:29:47','2023-10-24 07:21:42',NULL,'','0',18,202),
	 (1155,'LATEEN ','2023-07-01-griboedov-lateen','2023-07-01',NULL,'23:00:00',NULL,'<p>В эти жаркие летние ночи трясем телом под горячее латинское техно, хаус, реггитон и бразильский фанк.<br>Надевайте летние наряды, берите друзей и ждем вас на сумасшедший латинский дэнс, параллельно охлаждаясь фри дринком — коктейлем Cuba Libre.<br><br>Обладателям самого горячего аутфита — бесплатный вход с репостом<br><br>300 + репост / 500 без внимания<br><br>Репост считается действительным до 21:00<br><br></p>',300,'500.0',1,86,1,'','https://vk.com/griboedovbasement',false,false,NULL,NULL,'2023-06-28 18:42:29','2023-10-24 09:33:11',NULL,'','0',18,101),
	 (1156,'APPLIQUE 6 YEARS AKT 2','2023-07-15-mutabor-applique-6-years-akt-2','2023-07-15',NULL,'23:00:00',NULL,'<p>APPLIQUE: «Шестерка воплощает пробуждение сознания и очищение. В виде гексаграммы она состоит из двух противоположных треугольников, символизирующих огонь и воду, и выражает целостность духа и материи.<br>Во втором акте нашего шестилетия мы определим значение второго треугольника.»</p>',1000,'',2,2,1,'https://applique.ticketscloud.org/','',false,false,NULL,NULL,'2023-06-28 20:03:11','2023-10-23 05:44:02',NULL,'','0',18,680),
	 (1181,'All I NEED','2023-07-02-supermetall-all-i-need','2023-07-02',NULL,'20:00:00',NULL,'<p>Вечер, который пройдёт на really лучшей (чего уж там) летней площадке столицы под открытым небом. Если вы давно хотели смешать <strong>все, что вам нужно</strong>: summer atmosphere, лучших друзей, unforgettable программу, hip-hop music, потому что вам таааак надоело техно…</p><p><em>то вам точно нельзя пропустить ALL I NEED</em></p>',1900,'',2,119,1,'https://afisha.timepad.ru/event/2441095','',false,false,NULL,NULL,'2023-06-29 22:13:10','2023-10-09 03:42:14',NULL,'','0',18,136);
