	 (1157,'Планета К-30','2023-08-04-k-30-planeta-k-30','2023-08-04','2023-08-05',NULL,NULL,'<p>День рождения площадки и свеженький двухдневный фестиваль с целой вселенной внутри!&nbsp;<br><br>За три года К-30 стал отдельным миром. Островком безопасности и свободы на берегу Невы.&nbsp;<br>Настоящий метаверс со своими приколами, вечеринками, артистами, командой, резидентами и даже собственным спутниковым ТВ каналом.&nbsp;<br><br>Все эти люди и события образуют силу гравитации, которая не оставляет шансов, кроме как снова приземлиться на лучшей набережной, где вы провели 3 лета. 3 года за 2 дня — поместится? Конечно.<br>К-30 — это целая планета, любимая планета&nbsp;<br>&nbsp;<br>1 день фестиваля - 1900 руб.<br>Оба дня фестиваля - 4200 руб.</p>',1900,'4200.0',1,190,1,'https://www.k-30.com','https://www.k-30.com',false,false,NULL,NULL,'2023-06-29 14:35:34','2023-10-24 16:22:52',NULL,'','0',18,427),
	 (1158,'New Essentials','2023-06-29-propaganda-new-essentials','2023-06-29',NULL,'23:00:00',NULL,'<p>Новые четверги — новая молодая кровь в Пропаганде. Курирует ночь подруга клуба, диджей и наш главред Julia Karma.</p>',NULL,'0.0',2,101,1,'','',false,false,NULL,NULL,'2023-06-29 15:03:08','2023-10-24 21:56:04',NULL,'','0',18,62),
	 (1159,'Пятница в Стрелке','2023-06-30-bar-strelka-piatnica-v-strelke','2023-06-30',NULL,'23:00:00',NULL,'<p>Летние ночи в нашем дворике — всегда в лучшей музыкальной компании.<br><br>В пятницу за пультом наши (и ваши) любимчики Kedr Livanskiy и Flaty. Этой весной у совместного проекта Яны и Жени «Косая гора» вышел дебютный альбом — если ещё не успели послушать, то самое время.&nbsp;</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,NULL,'2023-06-29 15:10:28','2023-10-19 04:19:46',NULL,'','0',18,76),
	 (1160,'Суббота в Стрелке','2023-07-01-bar-strelka-subbota-v-strelke','2023-07-01',NULL,'23:00:00',NULL,'<p>Летние ночи в нашем дворике — всегда в лучшей музыкальной компании.<br>В субботу ждём всех на шоукейс радио 5/8. Играют основатель и идеолог станции Дима Сафронов, петербурженка Оля Семёнова, корифей московской клубной сцены Дима Студитский и невероятный дуэт «Ксюша» Поли Settima Tacca и Ксении Кручински.</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,NULL,'2023-06-29 15:16:30','2023-10-24 12:28:20',NULL,'','0',18,69),
	 (1165,'MODUS','2023-07-01-agli-modus','2023-07-01',NULL,'20:00:00',NULL,'<p>Творческое объединение «Практика» открывает пространство электронной музыки. Мы не ограничимся рамками house и techno музыки, вселенная расширяется, музыка будет объединять звуки, людей, пространства, а диджеи построят нашу общую галактику из разных ритмов.</p>',404,'',2,191,1,'https://moscow.qtickets.events/75061-modus','https://vk.com/modus0107',false,false,NULL,NULL,'2023-06-29 16:52:45','2023-10-20 05:32:43',NULL,'','0',18,62),
	 (1166,'BIG SUMMER PARTY Pioner & Portal','2023-07-01-pravda-big-summer-party-pioner-portal','2023-07-01','2023-07-02','23:30:00','06:00:00','<p>Сквозь пространство и время в ночные тусовки<br><br></p>',660,'',2,20,1,'https://moscow.qtickets.events/75588-big-summer-party-pionerportal','https://vk.com/pioner.portal',false,false,NULL,NULL,'2023-06-29 17:04:15','2023-10-21 17:35:42',NULL,'','0',18,76),
	 (1167,'Burning Series','2023-07-07-16-tonn-presnenskii-val-burning-serie','2023-07-07',NULL,'23:30:00',NULL,'<p>7 июля состоится особенная drum and bass вечеринка Burning Series с презентацией нового долгожданного альбома Cnof — "City Rhythm“, который выходит этим летом на голландском лейбле Fokuz Recordings. На главном танцполе клуба «16 Тонн» с 23:30 до утра мероприятие поддержат резиденты и артисты зарубежных лейблов</p>',600,'',2,29,1,'https://moscow.qtickets.events/75770-burning-series','https://www.burningseries.ru',false,false,NULL,NULL,'2023-06-29 17:14:57','2023-10-18 22:54:32',NULL,'','0',18,177),
	 (1168,'Noir Bazaar','2023-07-08-leveldva-noir-bazaar','2023-07-08',NULL,'23:00:00',NULL,'<p>Музыка, магия, мистика.<br>Легендарная вечеринка не для всех в легендарном месте не для всех.<br>Готовьте свои лучшие наряды — будет «Ах!».<br>Подробности скоро.</p>',1000,'',2,138,1,'https://moscow.qtickets.events/76563-0807-noir-bazaar-at-leveldva','https://t.me/oberwave',false,false,NULL,NULL,'2023-06-29 17:21:22','2023-10-20 07:27:48',NULL,'','0',18,154),
	 (1169,'Миша Плюс Один','2023-07-09-deep-fried-friends-misa-plius-odin','2023-07-09',NULL,'20:00:00',NULL,'<p>Дневная вечеринка с участием D''Maselle</p>',1000,'',2,76,1,'https://moscow.qtickets.events/75807-misha-plyus-odin','',false,false,NULL,NULL,'2023-06-29 17:26:47','2023-10-20 15:38:51',NULL,'','0',18,372),
	 (1182,'Exhaust ∞','2023-06-30-gorod-exhaust','2023-06-30','2023-07-01','23:55:00','06:00:00','<p>30 Июня в городе Москва в честь дня рождения замечательной Moonchia состоится Gabber/Doomcore мероприятие с участием исполнителей мировой doomcore сцены.</p>',500,'',2,63,1,'https://afisha.timepad.ru/event/2470844','',false,false,NULL,NULL,'2023-06-29 22:21:56','2023-10-15 21:00:43',NULL,'','0',18,48);
