	 (1173,'Sofia Rodina All Night Long','2023-07-28-rndm-sofia-rodina-all-night-long','2023-07-28',NULL,'22:00:00',NULL,'<p>RNDM приготовил для вас чудесное летнее приключение: 28 июля Sofia Rodina отыграет свой первый оллнайтер!<br><br>Любимица российской электронной сцены осветит эту ночь вспышками ярких эмоций. С заката до рассвета RNDM заполнится взрывной энергией, которая знакома каждому, кто бывал на сетах Софии — от Boiler Room до Tresor, от первого Outline до Японии и Вьетнама.<br><br>Sofia Rodina проведёт вас сказочной тропой по огромному миру жанров, освещённому магическим оформлением — которое артистка создаст сама.<br><br>Волшебный мир воплотится в RNDM совсем скоро — в продаже первые билеты по самой низкой цене — успевайте, пока они не исчезли!</p>',500,'',2,27,1,'https://moscow.qtickets.events/76281-sofia-rodina-all-night-long','https://vk.com/rodinaallnight',false,false,NULL,NULL,'2023-06-29 17:57:18','2023-10-14 15:23:29',NULL,'','0',18,177),
