	 (1176,'Завет','2023-06-30-kontrkult-zavet','2023-06-30',NULL,'23:00:00',NULL,'<p>День солнцестояния миновал, ночь постепенно начала набирать силу. Луна в растущей фазе, а значит, мысли принимают материальную форму много быстрее обычного. О чем мечтает каждый прожженый петербуржец? О солнце, тех самых встречах, светлых мыслях и тёмных делах.&nbsp;<br>Или нет?&nbsp;<br><br>Завет — та традиция Контркульта, что сливается с готическим вайбом ebm, подкрепляется истоками луны и людскими утехами, совмещает в себе атмосферу шабаша и приема у великого Гэтсби воедино.&nbsp;<br>Чин-чин! Отвори штору навстречу неведанному<br><br>Вход — 400₽ до полуночи с репостом афиши, 500₽ —после&nbsp;</p>',400,'500.0',1,33,1,'','',false,false,NULL,NULL,'2023-06-29 18:26:24','2023-10-14 13:51:46',NULL,'','0',18,148),
	 (1186,'ДЕНЬ РАДИО','2023-07-15-supermetall-den-radio','2023-07-15','2023-07-16','16:00:00','06:00:00','<p>Настраиваемся на волну нового летнего уикенда!</p><p>В пространстве Радио на территории Суперметалла тебя ждет вечерний концерт от ALAMPA, 9 диджей сетов от мастеров танцевальных жанров<br><br>Начинаем в субботу ранним вечером и продолжаем до позднего утра воскресенья.</p><p>Начало в 16:00</p><p>День (16:00 - 20:00): FC / вход бесплатный по предварительной регистрации</p><p>Ночь (20:00 - 06:00): FC / 21+ / вход по билетам</p><p>С картами Highway Family вход бесплатный</p>',0,'',2,119,1,'https://afisha.timepad.ru/event/2484961','',false,false,NULL,NULL,'2023-06-29 23:29:29','2023-10-24 20:54:18',NULL,'','0',18,422),
	 (1266,'FRIENDS AND FAMILY OPEN AIR','2023-07-07-ritmy-friends-and-family-open-air','2023-07-07',NULL,'21:00:00',NULL,'<p>Ребятки из F&amp;F решили собрать себя, своих друзей, друзей своих друзей у нас на террасе и внутри.&nbsp;<br><br>Обещается закат и рассвет! Электроника н любой вкус!<br>Короче, все, что вы любите!</p>',NULL,'0.0',1,181,1,'','',false,false,NULL,2,'2023-07-07 16:20:56','2023-10-24 12:29:06',NULL,'','0',18,65),
	 (1177,'Highway meets Hypnotica','2023-07-01-radio-highway-meets-hypnotica','2023-07-01',NULL,'18:00:00',NULL,'<p>Человеческое и&nbsp;искусственное, эмоциональное и&nbsp;ритмичное, реальное и&nbsp;иллюзорное&nbsp;— встречайте премьеру нового электронного проекта Illusions. Электроакустический проект, состоящий из&nbsp;четырех участников с&nbsp;перкуссией, электрогитарой, скрипкой и&nbsp;продуманным саунд-дизайном, помноженным на&nbsp;богатое наследие мировой электронной музыки. Мастерство владения музыкальными инструментами и&nbsp;богатая палитра, которую обеспечивает электроакустика способны создать у&nbsp;слушателя ощущение полноправного участника звукового путешествия в&nbsp;мир аудиальных иллюзий и&nbsp;форм, какие только может принимать музыка. Живой концерт Illusions&nbsp;в симбиозе с диджейским сэтом — это увлекательный музыкальный рассказ, каждый раз создающий пестрый звуковой мир!<br><br>Руководитель проекта - Леонид Сивелькин (скрипка)<br>Nitay - Electro Guitar&nbsp;<br>Игорь Свиридов - Sound Production, Piano<br>Артём Кузнецов - Percussion</p>',1500,'',2,149,1,'https://highwayevent.ru','',false,false,NULL,NULL,'2023-06-29 18:53:00','2023-10-24 06:07:36',NULL,'','0',18,79),
	 (1178,'RESON 02','2023-07-01-resohub-reson-02','2023-07-01',NULL,'21:00:00',NULL,'<p>Объявляем новой традицией выходные в RESOhub<br><br>В эту субботу, 1 июля, ждём гостей, чтобы есть традиционные японские блюда, пить саке и авторские коктейли, а главное — отдыхать вместе с Резонансом.&nbsp;<br><br>Задавать атмосферу вечера будут резиденты Резо и наши близкие друзья.</p>',NULL,'0.0',2,186,1,'','',false,false,NULL,NULL,'2023-06-29 19:59:39','2023-10-15 04:45:55',NULL,'','0',18,80),
	 (1179,'SE:VER X REVERSE','2023-06-30-community-moscow-sever-x-reverse','2023-06-30',NULL,'22:00:00',NULL,'<p>Вечер симбиоза таинственного севера и тропического очарования Бали - завораживающая коллаборация лейбла SE:VER и шоу-кейса Reverse Festival состоится 30 июня в зале-библиотеке столичного клуба Community Moscow. Красивые люди, световые проекции и, конечно же, селекция авторской музыки мастеров и друзей лейбла</p>',2000,'',2,58,1,'https://6401e42950cb2da37d3d7b09.ticketscloud.org/','',false,false,NULL,NULL,'2023-06-29 20:07:26','2023-10-19 12:51:58',NULL,'','0',18,68),
	 (1180,'ELECTRIC SUNSET + SUNRISE','2023-07-01-krysa-gostinicy-pekin-electric-sunset','2023-07-01',NULL,'20:00:00',NULL,'<p>2 террасы, головокружительный вид на красавицу столицу, музыка любимых артистов под лучами уходящего и восходящего солнца на крыше гостиницы Пекин вместе с LUXURYUNDERGROUNDSYSTEM и SPIRITON</p><p>После последнего <strong>ELECTRIC SUNSET</strong> и <strong>ELECTRIC SUNRISE</strong> на крыше гостиницы Пекин, самым часто задаваемым вопросом от вас было: "А когда следующая вечеринка?". Признаемся честно, так много пожеланий скорейшего повторения этой музыкальной феерии мы не получали никогда. Без преувеличения!</p>',3000,'',2,192,1,'https://afisha.timepad.ru/event/2480642','',false,false,NULL,NULL,'2023-06-29 21:34:57','2023-10-21 18:48:03',NULL,'','0',18,245);
