	 (1183,'ODYSSEY meets KETAMA','2023-07-08-blanc-odyssey-meets-ketama','2023-07-08',NULL,'18:00:00',NULL,'<p><strong>8 июля </strong>мы вновь высадимся десантом у московских друзей <strong>Blanс</strong>, дабы сняв абайю, покрытую марокканским песком, вольно раскинуться на мягчайших коврах и начать внимать яснооким гуриям на вечеринке <strong>Odyssey meets Ketama.</strong>&nbsp;</p>',1500,'',2,36,1,'https://afisha.timepad.ru/event/2468781','',false,false,NULL,NULL,'2023-06-29 22:30:32','2023-10-25 04:17:37',NULL,'','0',18,484),
	 (1184,'ELECTRIC SOUND GARDEN','2023-07-14-turandot-palace-electric-sound-garden','2023-07-14','2023-07-15','18:00:00','02:00:00','<p>На один вечер <strong>14 июля в пятницу</strong> терраса роскошного <strong>ресторана-дворца Турандот</strong> вновь превратится в мистический и загадочный сад, наполненный изысканной публикой, электронной музыкой от ваших любимых артистов в сочетании с люксовым сервисом от топового ресторанного проекта и фирменной атмосферой</p>',5555,'',2,193,1,'https://afisha.timepad.ru/event/2485193','',false,false,NULL,NULL,'2023-06-29 22:46:34','2023-10-24 13:14:38',NULL,'','0',18,345),
	 (1185,'Reverse Festival - Oasis','2023-07-14-soho-rooms-reverse-festival-oasis','2023-07-14','2023-07-15','20:00:00','05:00:00','<p>В День Рождения Reverse Festival расцветёт необыкновенной красоты оазис, на всем полюбившейся террасе Soho Rooms, прямо в центре столицы!</p><p>На этот раз мы погрузим вас в атмосферу изысканного оазиса, где будет все с излишеством от декораций до перфомансов и артистов!</p><p><strong>Нам 2 года</strong>, <strong>а это значит мы готовим для Вас много сюрпризов!</strong><br><strong>Вас ждёт самое красивое событие переполненное эмоциями, которое мы когда-либо создавали.</strong></p>',3500,'7000.0',2,158,1,'https://afisha.timepad.ru/event/2463946','',false,false,NULL,NULL,'2023-06-29 23:16:08','2023-10-25 17:08:05',NULL,'','0',18,217),
	 (1187,'MNS.AUDIO','2023-07-21-fantomas-chateau-rooftop-mnsaudio','2023-07-21','2023-07-22','22:00:00','12:00:00','<p>Лето встретило нас отличной погодой и мы не можем отказаться от соблазна, сделать мероприятие на самой живописной и атмосферной крыше Москвы. В эту ночь вы сможете насладится 2-мя музыкальными форматами, которые мы транслируем уже много лет в массы.</p>',1000,'2000.0',2,170,1,'https://afisha.timepad.ru/event/2483953','',false,false,NULL,NULL,'2023-06-29 23:41:04','2023-10-14 22:35:09',NULL,'','0',18,245),
	 (1188,'THE CELL','2023-07-29-rndm-the-cell','2023-07-29','2023-07-30','23:00:00','08:00:00','<p>Переживи своё очередное квантовое бессмертие, когда тело превратится в титановую оболочку и обретёт нечеловеческую выносливость пo команд<strong>е!</strong>&nbsp;На зависть нейромашин, твоё тело способно активировать режим “<em>non stop</em>” и предаваться безумному рейву всю ночь на очередном экспириенсе от Synesthesia “The Cell”.</p><p>Экстатические танцы под мощную прямую бочку и иммерсивные перформансы позволят высвободить себя из клетки невозможностей, наслаждаясь любимой атмосферой. И утром уйти победившим, что бы для тебя это ни значило.</p>',800,'',2,27,1,'https://afisha.timepad.ru/event/2465114','',false,false,NULL,NULL,'2023-06-29 23:50:17','2023-10-13 16:40:51',NULL,'','0',18,301),
	 (1189,'AVATAR PARTY "ПУТЬ ВОДЫ"','2023-07-15-avatar-party-put-vody','2023-07-15',NULL,'23:45:00',NULL,'<p>Мы приглашаем вас в пятичасовое путешествие на борту волшебного ковчега, который проплывёт по берегам Невы мимо творений великих архитекторов, атмосферных закутков города Петра и выйдет в залив, чтобы насладиться нашим приключением сполна!</p>',2500,'',1,NULL,1,'https://afisha.timepad.ru/event/2483870','',false,false,NULL,NULL,'2023-06-29 23:59:29','2023-10-25 09:02:21',NULL,'','0',18,180),
	 (1190,'3stageTECH presents: TECHNOCULT','2023-07-14-cult-3stagetech-presents-technocult','2023-07-14','2023-07-15','23:00:00','07:00:00','<p><strong>14 июля в клубе Cult</strong> мы превратимся в санктум для всех рейверов. Два танцпола, две реальности, одна ночь, которая никогда не закончится. Какой путь ты выберешь?<br><br>На <strong>Techno Stage</strong> мы собрали для вас истинных мастеров атмосферы, которые привезут свои музыкальные манифесты, чтобы ваши тела слились с ритмом битов</p>',400,'',1,92,1,'https://afisha.timepad.ru/event/2481989','',false,false,NULL,NULL,'2023-06-30 00:11:36','2023-10-14 18:02:29',NULL,'','0',18,276),
