	 (1194,'ДВОР','2023-06-30-yauza-dvor','2023-06-30','2023-07-01','19:00:00','03:00:00','<p>Двор🛝 — это что-то из детства, что-то уютное. Место, где чувствуешь себя в безопасности, знаешь каждый уголок и встречаешься с друзьями, забывая о внешнем мире.<br>___<br>Именно таким будет наш ДВОР в Углу в пятницу 30-го.<br><br>На вечеринке будет турнир по настольному теннису. Победители получат призы от Yauza Store!<br><br>Также, будет корнер от магазина и выставка картин, которые вы сможете приобрести.&nbsp;<br><br>За музыку отвечают резиденты и друзья сообщества. Одно имя держится в секрете, обещают привоз из Израиля 🇮🇱<br><br>Ожидается всё разнообразие электронных жанров, кроме техно — экспериментальный формат промо-группы.&nbsp;</p>',NULL,'300.0',2,32,1,'','',false,false,NULL,NULL,'2023-06-30 15:40:33','2023-10-08 22:34:49',NULL,'','0',18,60),
	 (1195,' Free BPM 17th Anniversary','2023-06-30-factory-3-free-bpm-17th-anniversary','2023-06-30',NULL,'23:59:00',NULL,'<p>Ну что, в Москве 17 лет отпраздновали, теперь пора ехать в Санкт-Петербург!<br><br>30 июня приглашаем всех на день рождения нашего лейбла Free BPM в клуб <a href="https://vk.com/factory3">FACTORY 3</a>.<br><br>Вас ждет мощный состав артистов, большинство из них выступит в формате back2back</p>',800,'',1,7,1,'https://beatraid.qtickets.ru/event/75048?base_color=79c230','https://vk.com/freebpm17thspb',false,false,NULL,NULL,'2023-06-30 15:54:24','2023-10-10 21:33:45',NULL,'','0',18,112),
	 (1196,'dime chu\ dj set ','2023-06-30-technodoner-dime-chu-dj-set','2023-06-30',NULL,'20:00:00',NULL,'<p>Коллекционер винила, резидент объединения .txt djs и участник вечеринок echo. отметился dj сетами на берлинском радио intaresu, rts.fm. Eго интересы начинаются с minimal house и прогрессируют до minimal techno и breakbeat.</p>',NULL,'',1,194,1,'','',false,false,NULL,NULL,'2023-06-30 16:06:39','2023-10-10 21:36:33',NULL,'','0',18,72),
	 (1197,'Pussy Deluxe','2023-06-30-q-bar-pussy-deluxe','2023-06-30','2023-07-01','22:00:00','03:00:00','<p>Каждый месяц собираем самых красивых и самых музыкальных леди под одной крышей, чтобы зарядиться нежной энергией на предстоящий месяц!<br><br>Собираемся в 22 принцессами, уползаем домой строго после 03&nbsp;<br><br>Вход бесплатный по репосту до вечера пятницы / без внимания 300р</p>',0,'300.0',1,161,1,'','',false,false,NULL,NULL,'2023-06-30 16:28:15','2023-10-14 00:16:41',NULL,'','0',18,79),
	 (1198,'nadia\ vinyl set','2023-07-01-technodoner-nadia-vinyl-set','2023-07-01',NULL,'20:00:00',NULL,'<p>Eё пристрастие к виниловым сетам позволяет насытить звучание глубиной и эмоциями. nadia мастерски сочетает несколько жанров, cмешивая их границы и создавая собственный стиль в клубной музыке, что погружает слушателей в уникальный аудиальный опыт.</p>',NULL,'0.0',1,194,1,'','',false,false,NULL,NULL,'2023-06-30 16:33:25','2023-10-24 06:42:18',NULL,'','0',18,112),
	 (1199,'Love Machine','2023-06-30-miska-bar-love-machine','2023-06-30',NULL,'21:00:00',NULL,'<p>30 июня, в Mishke самая свободная, чувственная, открытая и нежная вечеринка Петербурга и окрестностей — Love Machine!<br><br>Играют основатели Машины: Sad Alien и Cl33m, а в гостях у ребят — Pleasure Olezha.<br><br>Держите послание и напутствие от ребят: "Петербург, готовь свои танцевальные черевички!"&nbsp;<br>DRESS CODE: angels!</p>',NULL,'0.0',1,12,1,'','',false,false,NULL,NULL,'2023-06-30 16:39:32','2023-10-10 21:31:13',NULL,'','0',18,68),
	 (1200,'Грани в пятницу','2023-06-30-grani-grani-v-piatnicu','2023-06-30',NULL,'22:00:00',NULL,'<p>30.06 в пятницу<br>в 22 за диджейкой Juravlove<br>в 00 Klukva</p>',NULL,'0.0',1,197,1,'','',false,false,NULL,NULL,'2023-06-30 16:47:27','2023-10-16 16:57:20',NULL,'','0',18,52),
	 (1201,'Hotline Open Air в Джунглях','2023-06-30-scaste-hotline-open-air-v-dzungliax','2023-06-30',NULL,'23:00:00',NULL,'<p>В пятницу Hotline Open air в джунглях. двор СЧАСТЬЕ на Итальянской 17<br>Резерв: +79215631388<br>Иногда Хотлайн тотально меняется! А значит встречаемся в ДЖУНГЛЯХ.<br>Вечеринка в стиле Остров Парадиз (из пятого элемента)<br>Будет фуатэ и танцы животэ!<br>Не иссякающий фонтан и грязные танцы шмансы!<br>Ночи на пролёт! Ночи без сна! Вся ночь!<br>Укротители тигров Kto Dj? Tony Lil Bonjourlili<br>Специальный гость SAINT CITY LOVERS<br>Девочки лижите арочки скоро будите писать мамочке!<br>Dress code тема “Книга Джунглей” Леопардовое настроение! И зелено бирюзово зелено! Crazy Zoo, 5 ЭЛЕМЕНТ, ZEBRA-LEO-SNAKE!<br><br>Кто пропустил прошлый Hotline - посмотрите в ленте что творилось и представьте, что же будет в эту Пятницу.<br><br>Диско во всех проявлениях!&nbsp;<br>Плюс в 3 ночи начнётся Hip Hop RnB 2000s от Tony Lil<br><br>Вход свободный, но по репосту данной афиши в сторис и отметке двух друзей в комментариях!<br><br>Face-Control/Dress-Control, 18+</p>',NULL,'0.0',1,198,1,'','',false,false,NULL,NULL,'2023-06-30 16:58:21','2023-10-23 06:05:00',NULL,'','0',18,137),
	 (1202,'Лето Вино Танцы ','2023-06-30-na-vina-leto-vino-tancy','2023-06-30',NULL,'19:00:00',NULL,'<p>Ну, что! Все сошлось: погода наладилась, самый топовый двор На Вина на Петроградской и Çava&nbsp;<br><br>30 июня CAVA GLAM: ТАНЦЫ НА СКЛАДЕ!&nbsp;<br><br>Лето / танцы / вино<br><br>Wine lineup конечно же Сочный Юг! Vins de Soif! Пьем бутылками и бокалами.<br><br>Встречаемся на Складе в эту пятницу. Танцы начинаем с 19:00, но можете приходить раньше, все равно будет шик и глэм.<br><br>18+<br>DC - summer glam, роскошно и по-летнему.</p>',NULL,'0.0',1,199,1,'','',false,false,NULL,NULL,'2023-06-30 17:10:01','2023-10-23 06:05:00',NULL,'','0',18,99);
