	 (1204,'BRAVERS 6','2023-06-30-prostranstvo-pole-bravers-6','2023-06-30',NULL,'23:00:00',NULL,'<p>В свой шестой день рождения члены группировки Bravers, в народе брейверы, отправляются на спасение столичной эстрады&nbsp;<br><br>Только от них зависит исход вечеринки, на которой должны отыграть участники лейбла и самые близкие друзья<br><br>Для идеального дня рождения не хватает одной детали — гостей</p>',1100,'',2,46,1,'https://bravers-event.timepad.ru/event/2457770/','',false,false,NULL,NULL,'2023-06-30 17:26:58','2023-08-22 03:52:20',NULL,'','0',18,32),
	 (1205,'Strip Club Chicken Bone','2023-07-01-kontrkult-strip-club-chicken-bone','2023-07-01',NULL,'23:00:00',NULL,'<p>Тёплая июльская ночка манит аппетитным ароматом жареной курочки и битами, доносящимися будто из-под земли. А ты и рад вестись на это, ведь нет ни единой причины не лакомиться и не выкрикивать<br>«Fuck home, fuck sleep, come clean, zonin''»<br><br>В ближайшую субботу отлетаем в Griboedov Basement под хип-хоп, брейкбит и музыку наших сердечек&nbsp;</p>',400,'600.0',1,33,1,'','',false,false,NULL,NULL,'2023-07-01 18:39:57','2023-10-24 10:38:11',NULL,'','0',18,113),
	 (1206,'Spazio x Вечно Молодой','2023-07-01-union-spazio-x-vecno-molodoi','2023-07-01',NULL,'22:00:00',NULL,'<p>Сегодня во дворе — комьюнити Spazio и гости из Самары — резиденты Вечно Молодой — с пачкой танцевальной эклектики.&nbsp;<br>В зале — CIÉL и афро, немного джерси и тек хаус.&nbsp;</p>',NULL,'500.0',1,8,1,'','',false,false,NULL,NULL,'2023-07-01 18:44:56','2023-10-24 17:32:10',NULL,'','0',18,67),
	 (1207,'Funk you','2023-07-01-ritmy-funk-you','2023-07-01',NULL,'20:00:00',NULL,'<p>Музыка в стиле фанк — мама и папа многих современных музыкальных стилей.<br><br>Портал у нас с вами информационно-развлекательный, поэтому сегодня мы собрали лучших специалистов в данном вопросе.&nbsp;<br>Самых главных фанковедов города собираем на Кожевенной 34.&nbsp;<br>Стартуем в 20:00.&nbsp;</p>',NULL,'0.0',1,181,1,'','',false,false,NULL,NULL,'2023-07-01 18:50:09','2023-10-23 18:46:04',NULL,'','0',18,66),
	 (1208,'Different Beats','2023-07-01-stirka40-different-beats','2023-07-01',NULL,'22:00:00',NULL,'',NULL,'0.0',1,14,1,'','',false,false,NULL,NULL,'2023-07-01 18:54:47','2023-10-24 01:33:41',NULL,'','0',18,51),
	 (1229,'UK CLUB','2023-07-08-rndm-uk-club','2023-07-08',NULL,'23:00:00',NULL,'<p>Орловская команда UK CLUB представляет свой шоукейс. Состав резидентов проекта дополнят участники из Resonance Moscow— Fobos Hailey и Vlas Leskin. За авторский визуал вечера отвечает Егор Егоров из Hermosa Community.</p>',600,'1000.0',2,27,1,'','https://vk.com/rndm.club',false,false,NULL,NULL,'2023-07-04 15:15:13','2023-10-24 21:27:57',NULL,'','0',18,198),
	 (1209,'Расслабленная вечеринка','2023-07-01-miska-bar-rasslablennaia-vecerinka','2023-07-01',NULL,'21:00:00',NULL,'<p>Сегодня, 1 июля, в Mishke расслабленная вечеринка, отдых, который мы все заслужили, услада для ушей, радость для мышц.&nbsp; Играют куратор лейбла Sengiley Wax Денис Казаков и арт-директор самарского бара «Вечно молодой» Сергей PfPf.&nbsp;<br><br>Вот, каким им видится сегодняшний вечер: «Музыкальные вибрации Балеарских островов, легкое итало и диско всех ипостасей, легкий нетривиальный хаус с ненавязчивым ритмом, летне-пляжный вайб в городских джунглях».&nbsp;<br><br>Так тому и быть.</p>',NULL,'0.0',1,12,1,'','',false,false,NULL,NULL,'2023-07-01 19:00:12','2023-10-23 22:34:02',NULL,'','0',18,61),
