	 (1211,'Colnyshk0','2023-07-08-kontrkult-colnyshk0','2023-07-01','2023-07-01','23:00:00','07:00:00','<p>Стремящихся къ ​Свѣту​ союзниковъ Солнца зовемъ на коллективное служеніе въ Черный домикъ на Полюстровскомъ, дабы почтить день Петра и ​Февроніи​. Будемъ гулять, ​лобзаться и воспѣватъ за клиросомъ.<br>Вечеринка будет проходить в модном клубе Griboedov!</p>',500,'700.0',1,86,1,'','',false,false,NULL,NULL,'2023-07-03 13:14:47','2023-10-17 06:02:53',NULL,'','0',18,76),
	 (1212,'SESSION 01','2023-07-07-mixed-session-01','2023-07-07','2023-07-08','22:00:00','06:00:00','<p>SESSION - новый формат вечеринок, посвященный современному электронному глубокому саунду. Под замедленный бит отправимся с вами в музыкальное путешествие. Это будут длинные сеты диджеев в стилях: downtempo, deep, tech, electronic.</p><p><br></p><p>На первой вечеринке совершим погружение в самый deep с представителями промогруппы SoSlow - DimPo, Maznevich, при поддержке мощного синэнергичного дуэта SuziKari &amp; Shinder.</p><p><br></p><p>Ждем на берегу Севкабель порта с крутым звуком в баре Mixed!&nbsp;</p><p><br><br></p>',NULL,'500.0',1,59,1,'','',false,false,NULL,NULL,'2023-07-03 17:26:12','2023-10-23 19:35:37',NULL,'','0',18,190);
