	 (1213,'CWH','2023-07-08-rndm-cwh','2023-07-08','2023-07-08','18:00:00','23:00:00','<p>Вечер субботы 8 июля обещает быть вполне себе насыщенно-джангловым, ведь мы собрали, ничего себе - десять артистов, которые в формате получаса на каждого отыграю любимые треки жанра.<br><br></p>',NULL,'500.0',2,27,1,'','https://t.me/clockworkheads',false,false,NULL,NULL,'2023-07-04 01:45:49','2023-10-13 22:43:22',NULL,'','0',18,70),
	 (1214,'RED SHEEP','2023-07-07-rndm-red-sheep','2023-07-07',NULL,'23:00:00',NULL,'<p>Тем, кто предпочел не уезжать за город в затяжной трип, а остались в Москве, тоже не придется скучать. В RNDM для вас готовят нечто особенное с коктейлем из резидентов RED SHEEP, Monasterio, Popoff kitchen, ростовского ЛКМ и гостем из Липецка Damne.&nbsp;</p>',NULL,'600.0',2,27,1,'https://red-sheep.timepad.ru/event/2486995/','https://vk.com/club212186659',false,false,NULL,NULL,'2023-07-04 01:52:16','2023-10-21 16:57:01',NULL,'','0',18,244),
	 (1215,'DIZKO FM 86.6','2023-07-07-serdce-dizko-fm-866','2023-07-07',NULL,'19:00:00',NULL,'<p>Первая летняя вечеринка в Санкт-Петербурге *Dizko Fm* в стиле 80-х!<br><br>Этим вечером мы окунемся в старую и добрую эпоху 80-х.<br><br>- Диджей сеты от M4 Vaporwave и Apollo Deejay, живая гитара от NERRAI<br><br>- Merch Shop и Выставка Картин от M4 Vaporwave<br><br>Дресс Код: 80-е, неон, гавайские рубашки, киберпанк, маями вайс, пастельный лук</p>',450,'600.0',1,6,1,'https://spb.qtickets.events/75647-mechta-pati','https://vk.com/dizkofm_80s',false,false,NULL,NULL,'2023-07-04 02:18:48','2023-10-24 22:37:13',NULL,'','0',18,83),
	 (2183,'FAM CLUB','2023-10-20-vnvnc-concert-hall-fam-club','2023-10-20',NULL,'23:59:00',NULL,'<p>Встречаемся с вами уже в эту пятницу, как всегда на Конюшенной площади, 2В</p>',300,'',1,50,1,'https://spb.qtickets.events/88172-fam','',false,false,NULL,2,'2023-10-19 22:20:06','2023-10-24 12:34:46',NULL,'','0',18,27),
	 (1216,'AUDIO DRUG 2.0','2023-07-07-vremia-n-audio-drug-20','2023-07-07',NULL,'23:55:00',NULL,'<p>Невесомость - состояние, в котором отсутствует сила взаимодействия тела с опорой, но присутствует другая сила, сила ритмов и музицирования.<br><br>Приподними себя на более высокие вибрации в июльскую ночь вместе с нами!<br><br>Что тебя ждет?<br>⁃ Вкусный бар;<br>⁃ Концептуальные фото зоны;<br>⁃ Аукцион картин;<br>⁃ Market;<br>⁃ Van Dog;<br>⁃ Custom Zone.<br><br>Политика входа:<br>⁃ 600р с репостом&nbsp;<br>⁃ 500р в мерче 88Records<br>⁃ 900р без внимания</p>',600,'900.0',1,200,1,'https://spb.qtickets.events/74763-audio-drug-20','https://vk.com/88audiodrug',false,false,NULL,NULL,'2023-07-04 02:29:02','2023-10-24 13:17:21',NULL,'','0',18,105),
	 (1217,'ROOFTOP BY #AVG','2023-07-08-rooftop-rooftop-by-avg','2023-07-08',NULL,'18:00:00',NULL,'<p>Встреча с генгом на крыше, покупай билеты за ранее, места ограничены!<br><br></p>',1000,'',1,201,1,'https://spb.qtickets.events/75612-rooftop-by-avg-08072023-2300','',false,false,NULL,NULL,'2023-07-04 02:34:00','2023-10-17 16:05:14',NULL,'','0',18,203),
	 (1218,'Aequator','2023-07-14-kontrkult-aequator','2023-07-14',NULL,'23:00:00',NULL,'<p>Дорогие друзья и те, с кем мы ещё не успели подружиться, не упустите возможность посетить наше безумное мероприятие и раствориться в каноничной для нас атмосфере в пространстве андерграунд клуба griboedov!<br><br>Мы всегда делаем то, что любим, и любим то, что делаем, не изменяя собственным принципам, но это последнее мероприятие в привычном формате. Что будет дальше - никто не знает, но мы точно уверены в том, что 14.07.2023 состоится ПОСЛЕДНИЙ ТАНЕЦ, который, несомненно, запомнится всем гостям и останется в вашем сердце тёплым воспоминанием, разливающимся в памяти светом ламп и огнями вспышек.</p>',700,'',1,86,1,'https://spb.qtickets.events/75725-aequator','https://vk.com/aeqparty',false,false,NULL,NULL,'2023-07-04 02:37:57','2023-10-21 15:53:31',NULL,'','0',18,126),
	 (1219,'WeLove Drum & Bass - Кораблик','2023-07-15-korabl-welove-drum-bass-korablik','2023-07-15','2023-07-16','23:00:00','05:30:00','<p>В разгар белых ночей мы приглашаем тебя в пятичасовое морское путешествие на борту двух палубного корабля, который проплывет по берегам Невы, выйдет в залив открывая нам всё величие и атмосферу Санкт-Петербурга под звуки нашей любимой музыки.<br><br>15 июля WeLove Drum &amp; Bass Кораблик захватит наши сердца, чтобы подарить нам незабываемую атмосферу и нежные чувства, под мощнейшие сеты артистов Российской dnb сцены</p>',3000,'',1,202,1,'https://spb.qtickets.events/76089-welove-drum-bass-korablik','https://vk.com/welovednbship',false,false,NULL,NULL,'2023-07-04 02:43:14','2023-10-24 21:21:57',NULL,'','0',18,253),
	 (1220,'SVODKA','2023-07-28-blank-svodka','2023-07-28',NULL,'23:00:00',NULL,'<p>SVODKA GOES OFFLINE<br><br>МАСШТАБНАЯ ВЕЧЕРИНКА ОТ ЛЕЙБЛА SVODKA RECORDS<br>28 июля<br><br>скоро все узнаешь...</p>',1100,'',1,1,1,'https://spb.qtickets.events/75642-svodka-280723','https://blankclub.ru',false,false,NULL,NULL,'2023-07-04 02:48:08','2023-10-25 11:05:55',NULL,'','0',18,268),
	 (1221,'ПОСЛЕДНИЙ РЕЙВ: Santa Muerte','2023-07-29-diuny-poslednii-reiv-santa-muerte','2023-07-29',NULL,'23:45:00',NULL,'<p>Один год назад родился Последний Рейв. Но это значимое событие мы посвятим не рождению, а смерти, ведь, как говорят мексиканцы, смерть — это не конец, а начало новой жизни.<br><br>Одним из символов смерти в Мексике считается Santa Muerte — божественная фигура, которая представляет собой смерть в образе женщины и символизирует равенство людей.<br><br>В ночь, посвящённую этому культу, мы наденем свои самые яркие вещи и отметим годовщину вечеринки, которая в этот раз пройдёт необычно: пляжный песок, сангрита и расположенный на улице танцпол. Неизменным остаётся одно: эта ночь будет проходить под любимые звуки техно.</p>',300,'',1,49,1,'https://spb.qtickets.events/76732-posledniy-reyv-santa-muerte','https://vk.com/last.russian.rave',false,false,NULL,NULL,'2023-07-04 02:51:02','2023-10-25 15:42:39',NULL,'','0',18,636);
