	 (1222,'Polygon Rave @ Secret Place','2023-08-19-polygon-rave-at-secret-place','2023-08-19','2023-08-20','20:00:00','10:00:00','<p>Спустя год отгремевший индустриальный рейв POLYGON возвращается! На этот раз мы подготовим для вас 6 локаций и новых участников!<br><br>POLYGON RAVE - мультижанровый рейв, который пройдёт 19 августа в лучших традициях петербургского андеграунда, а именно на шести сценах заброшенной локации!<br><br>На этот раз с нами промо-команды: Timeofnight, Heavy Dubplate. Drop Dealerz, Ленинградская Смена, Базовое Техно, Technocore.<br><br>Внимание! Действует строгий face control. Не допускаются лица в алкогольном / наркотическом опьянении.<br><br>Пару слов о дресс коде: ограничений как таковых нету, но надо принять во внимание что, будет грязно, возможно сыро и мокро. Лучше выбрать практичный, удобный стиль одежды. Также советуем взять с собой фонарики и портативную зарядку для телефона.<br><br>Место проведения будет объявлено в день мероприятия в наших соц. сетях</p>',800,'',1,NULL,3,'https://rupor.biz/widgets/event-tickets/858','https://vk.com/polygon2023',false,false,NULL,NULL,'2023-07-04 02:59:34','2023-10-25 11:14:01',NULL,'','0',18,997),
	 (1223,'RAVECORE 3. RESURRECTING UNDERGROUND','2023-09-09-ionoteka-ravecore-3-resurrecting-under','2023-09-02','2023-09-03','19:00:00','23:00:00','<p>Третья UNDERGROUND RAVE вечеринка от команды RAVECORE<br>Начало в 19.00, твоя задача - быть вовремя.</p>',200,'',1,40,1,'https://spb.qtickets.events/75762-ravecore-3','https://vk.com/ravecoreevent',false,false,NULL,NULL,'2023-07-04 03:02:44','2023-10-22 11:22:57',NULL,'','0',18,299),
