	 (1227,'MIRÈLE GIRLS & BOYS','2023-07-07-radio-mirele-girls-boys','2023-07-07',NULL,'20:00:00',NULL,'<p>MIRÈLE GIRLS &amp; BOYS<br><br>Релиз-пати нового сингла певицы Mirèle и одновременно празднование её дня рождения, которое состоится при поддержке резидентов и друзей заводного диско-клуба «Радуга».&nbsp;</p>',0,'1500.0',2,149,1,'https://radugadiscoclub.ru/e070723','',false,false,NULL,NULL,'2023-07-04 03:27:22','2023-09-28 12:48:21',NULL,'','0',18,115),
	 (1228,'Филд Модулейшн','2023-07-08-prostranstvo-pole-fild-moduleisn','2023-07-08',NULL,'20:00:00',NULL,'<p>Мы сейчас еще раз расскажем вам про вечеринку «филд модулейшн», перенесенную с 24 июня на 8 июля, а вы обязательно прочитайте — есть несколько обновлений в лайнапе<br><br>Соблюдаем режим летних вечеринок с переплетением музыки и искусства 👨‍🎨<br><br>Вместе с Тинькофф Городом мы запускаем эксклюзивный проект для всех клиентов Тинькофф — Филд Модулейшн (по паспорту Frequency Modulation) — это аудиовизуальный проект Димы Морозова (VTOL) и Александры Гавриловой<br><br>Интерактивная инсталляция, постоянно генерирующая новые звуки и изображения, которые отталкиваются от образов друг друга и создают себя снова и снова. А с помощью одного из экранов создавать образы смогут и все гости<br><br>С 8 июля и весь месяц после FM будет выставляться в полевом аперитиво, а в день открытия пройдет вечеринка, на которую с лайвом приедет создатель лейбла Resonance Никита Забелин, резидент ГОСТ ЗВУКа OL с диджей-сетом и еще четверо разножанровых музыкантов. А с лекцией прибудет музыкант и ведущий подкаста «Планетроника» Ник Завриев&nbsp;<br><br>Билеты эксклюзивно в разделе Город приложения Тинькофф (https://tinkoffbank.onelink.me/1923863684/jonzubjx)<br>Если вы сохранили билеты на открытие инсталляции 24 июня, вы можете пройти по ним<br><br>Реклама: АО «Тинькофф Банк», ИНН 7710140679/771301001</p>',NULL,'',2,46,1,'https://tinkoffbank.onelink.me/1923863684/jonzubjx','https://t.me/eto_polye',false,false,NULL,NULL,'2023-07-04 03:41:25','2023-10-24 22:40:13',NULL,'','0',18,131),
	 (1230,'Shinder & Friends и ЧЕТЫРЕЧЕГО','2023-07-08-popravkabar-shinder-friends-i-cetyre','2023-07-08',NULL,'19:00:00',NULL,'<p>🟣 Shinder &amp; Friends - гаражный рок с элементами реггей, ска и добавлением экспериментов в гитарном звучании.&nbsp;<br><br>🟣 ЧЕТЫРЕЧЕГО – это хлёсткий фанк-рок с громкими гитарами и ироничными текстами. В багаже – два альбома и многочисленные лайвы.<br><br>🟣 Поддержку окажет&nbsp; ElectroGorilla со своим сборником советской музыки, в необычном формате, «Ритм Секция».<br>А после лайвов -&nbsp; автерпати с dj''s Nikita Buch&nbsp; &amp; Shinder</p>',300,'500.0',1,204,1,'https://funk-you.timepad.ru/event/2485109/','',false,false,NULL,NULL,'2023-07-04 15:50:37','2023-10-15 17:35:40',NULL,'','0',18,69),
	 (1231,'U-Night и back2future','2023-07-07-suba-bar-u-night-i-back2future','2023-07-07',NULL,'22:00:00',NULL,'<p>Приветствуйте U-Night и back2future!</p><p>Комьюнити этих ребят играет винил и диджитал, от Chillout до Techno!&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p><p>В пятницу 7 июля из-под их рук по всей ШУБЕ будут доноситься deep house, tech house и organic мотивы!</p>',NULL,'0.0',1,205,1,'','',false,false,NULL,1,'2023-07-05 02:44:10','2023-10-24 12:25:34',NULL,'','0',18,77),
	 (1232,'Gravitones ','2023-07-08-suba-bar-gravitones','2023-07-08','2023-07-09','20:00:00','02:00:00','<p>8 июля на сцене Шуба бар пройдет экспериментальный концерт синти панк группы "Gravitones" с участием&nbsp; перфомансом в виде аналогового техно&nbsp;</p><p>После нас ждёт привычное, и движовое звучание резидента Шуба бар Synesthesia и в завершении немного разбавит славянский рейв от дебютанта Симеона.&nbsp;</p>',NULL,'0.0',1,205,1,'','',false,false,NULL,1,'2023-07-05 02:50:36','2023-10-18 08:41:37',NULL,'','0',18,82),
	 (1233,'Jaspa Vol & Mike Pride ','2023-07-22-suba-bar-jaspa-vol-mike-pride','2023-07-21','2023-07-22','20:00:00','22:00:00','<p>22 июля на сцене Шуба бар исполнят свои хиты и наработки на будущие творения Jaspa Vol и Mike Pride, а после вас ждут звучание от Reggae media&nbsp; до глубокой ночи. Следите за новостями.&nbsp;</p>',NULL,'300.0',1,205,1,'','',false,false,NULL,1,'2023-07-05 02:55:33','2023-10-25 18:20:16',NULL,'','0',18,74),
	 (1234,'Возрождение + Afterparty','2023-07-07-gazgolder-vozrozdenie-afterparty','2023-07-07','2023-07-08','21:00:00','10:00:00','<p>Лето вступило в свои права, душа требует праздника - Pacha-Ti Promo при поддержке Highway Records приглашают на официальное афтерпати фестиваля Возрождение<br><br>На одну ночь обе команды перенесут гостей в фестивальную атмосферу, преобразив знакомое пространство московского клуба с помощью декораций, музыки и света</p>',0,'1000.0',2,35,1,'','https://pacha-ti.ru/',false,false,NULL,1,'2023-07-05 03:02:38','2023-10-23 00:31:06',6492,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjQyZDczNWJlOWVkZWIyMzZhNWRlM2E5In0.oRIxzpgkRaNYFJt0N1aU4Qgh-VapMtSHCfgW5PJO2Zo','0',18,123);
