	 (1235,'Hypnotica ','2023-07-07-blanc-hypnotica','2023-07-07',NULL,'18:00:00',NULL,'<p>В день, когда природа, согласно неизменному циклу, достигает своего наивысшего расцвета, команда организует культурно-танцевальное мероприятие в одном из самых приятных и уютных дворов старой Москвы<br><br>В программе вечера и теплой летней ночи запланировано много солнечной музыки и ритмов, гармонирующих с окружающей природой</p>',0,'1500.0',2,36,1,'https://62b953c205f9f71b76d2cd3f.ticketscloud.org/e/649572fb4256da9df5d7055a','',false,false,NULL,1,'2023-07-05 03:10:12','2023-10-23 06:46:56',NULL,'','0',18,96),
	 (1275,'SandBox','2023-07-08-sandboxmusicroom-sandbox','2023-07-08',NULL,'22:00:00',NULL,'<p>Внимание, друзья и гости Песочницы.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br>Влетаем в июльскую субботу 8.07. летним музыкальным бризом<br>Поздравляем с Днём рождения нашего резидента и техно-эстета - WAS.</p>',NULL,'500.0',1,110,1,'','https://linktr.ee/SandBoxMusicRoom',false,false,NULL,2,'2023-07-07 17:34:51','2023-10-22 07:32:51',NULL,'','0',18,91),
	 (1236,'Amen collection','2023-07-07-griboedov-amen-collection','2023-07-07','2023-07-08','20:00:00','06:00:00','<p>С 20 вечера до 6 утра — скоростные сбивки брейка, несущийся джангл, ритмичное электро и 10 артистов раскачают подвал и Амстердам по полной.&nbsp;<br>В 20:00 старт на веранде Griboedov Amsterdam. Разогрев, бильярд, танцы, и после заправки на баре действо перетекает в подвал, где будет нестись аж до самого утра.<br>Тем кто поймает каждый ритм - обещают фри дринк на баре, для тех кто хорошо пытался тоже.</p>',300,'500.0',1,86,1,'','https://t.me/griboedovbasement/2583',false,false,NULL,1,'2023-07-05 03:16:13','2023-10-24 08:43:19',NULL,'','0',18,87),
	 (1242,'Презентация дебютного альбома проекта Косая Гора','2023-07-21-prostranstvo-pole-prezentaciia-debiutnogo','2023-07-21','2023-07-21','20:00:00','22:30:00','<p>Косая Гора — новый инди-проект электронного продюсера и певицы Kedr Livanskiy и экспериментального продюсера и визуального художника Flaty.&nbsp;</p><p><br></p><p>Их дебютный альбом «Косогор» — многоязычное исследованием гитарной фолк-музыки, окутанной завораживающим дрим-попом и мрачными синтезаторами.</p>',1500,'',2,46,1,'','',false,false,NULL,2,'2023-07-06 17:11:49','2023-10-21 06:13:48',64918,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWU3MTBhZWY3NDAwY2IxMWYzZTQ2ZGY0In0.WbxEaRl31JF5V-SD8xg8E9MLxPBDzkQj6bfW4I2KXrs','0',18,126),
	 (1243,'Пятница в Мираже','2023-07-07-miraz-piatnica-v-miraze','2023-07-07',NULL,'21:00:00',NULL,'<p>итак, еженедельный пятничный дебош в этот раз начинается в 21:00, вместе с браслетами на друга, которые можно будет приобрести у нас на летке&nbsp;<br><br>но не спешим уезжать, ведь на летке появляются новые коктейли, а за диджейкой снова собирается золотой состав</p>',NULL,'0.0',1,77,1,'','',false,false,NULL,2,'2023-07-06 17:36:40','2023-10-24 03:38:35',NULL,'','0',18,73),
	 (1237,'Loud Boyz','2023-07-08-blank-loud-boyz','2023-07-08',NULL,'23:00:00',NULL,'<p>Тук тук тук, это кто?&nbsp;<br>Это ЛАУД! И мы в Питере!&nbsp;<br>Ставший уже для нас хоумспотом - клуб «Blank» открывает свои двери в очередной раз, для того, чтобы мы устроили там самый настоящий Loud Boyz.&nbsp;<br>Лайнап нарисовали королевский, поэтому ждём весь город, не иначе..<br>Будут:<br>Самый сильный голос новой школы - Thomas Mraz с лайвом и все наши совместные хиты! Вы ждали и дождались - встречайте, великий и ужасный Raw Takes! Впервые с нами в обойме, парень который не нуждается в представлении - Лёша SP4K! Официальные представители Eurodance в России - Turbosh! Ночной хулиган и просто легенда клубной жизни - Dj FeniXXX с умопомрачительной программой! Underground G и вся флэйва, которые просто взяли и захватили отдельную сцену на всю ночь. Ну и конечно же, мы - ваши громкие парни, которые никогда не стрессуют, а этой ночью будет особенный «NO STRESS Mood» Так что, зовите всех друзей и подруг, надевайте свои лучшие шмотки, и возможно кто-нибудь наконец-то сделает предложение руки и сердца прямо на Loud Boyz..</p>',900,'',1,1,1,'https://loud-boyz.ticketscloud.org/','',false,false,NULL,1,'2023-07-05 03:54:23','2023-10-23 22:24:13',NULL,'','0',18,175),
	 (1238,'Галерея х Photo','2023-07-14-blanc-galereia-x-photo','2023-07-14',NULL,'18:00:00',NULL,'<p>Половина лета уже не за горами, а значит нужно ловить за хвост все шансы сделать его ярче!<br><br>14 июля, в пятницу, начиная с 18.00 в одном из самых уютных (и уже точно знаковых) московских двориков Blanc откроются пространства «Галереи», состоящие из музыки, танцев, классных эмоций и невероятного фотоконтента от Воли Медведева! Время наслаждаться экватором лета!<br>18.00 — 20.00 FC / бесплатный по предварительной регистрации<br>20.00 — 06.00 FC / 21+ / вход по билетам<br>С картами Highway Family вход бесплатный</p>',0,'1000.0',2,36,1,'https://gallery.ticketscloud.org/','https://galereya.world',false,false,NULL,1,'2023-07-05 04:03:42','2023-10-22 00:21:33',NULL,'','0',18,118),
	 (1239,'RAVING MOSCOW / Open-Air','2023-09-02-raving-moscow-open-air','2023-09-02',NULL,'20:00:00',NULL,'<p>Событие, которого давно ждали любители и преданные фанаты электронной музыки - 6 танцполов, 16 часов непрерывной музыки под открытым небом, более 100 музыкантов и диджеев, палаточный лагерь, маркеты и многое другое в предварительном анонсе!<br><br>Данное мероприятие пройдёт в день города Москвы, неся в себе концепт урбанизма, вперемешку с природой<br><br></p>',800,'1200.0',2,NULL,1,'https://lk.ravers.events/e/30/raving-moscow','https://vk.com/event220612649?w=wall-220612649_28%2Fall',false,false,NULL,1,'2023-07-05 04:15:09','2023-10-25 17:33:38',NULL,'','0',18,923),
	 (1240,'Ночь в Саду','2023-07-07-in-the-garden-noc-v-sadu','2023-07-07','2023-07-07','17:00:00','23:00:00','<p>Традиционно мы захотели вас удивить и порадовать. Поэтому 7 июля приглашаем вас на совместную вечеринку Bassmatic Records и Orbita Project в основанный в 1892-м году Сад Эрмитаж. В этом историческом месте уютно расположилось новое лофтовое пространство с большой открытой террасой - In The Garden!<br>Приходите днём позагорать на шезлонгах у бассейна, отведать великолепную кухню и насладиться разнообразным барным меню. За окном жара, а значит настало время перемещаться на новые открытые площадки.&nbsp;<br>По предварительной регистрации на сайте, вход с 17:00 до 21:00 бесплатный!<br>А после 21:00 по билетам.<br><br>🎫 Tickets info:<br>1000 рублей до 03.07<br>1300 рублей до 07.07<br>1500 рублей на входе<br><br></p>',0,'1500.0',2,206,1,'https://bassmaticrecords.com/','',false,false,NULL,1,'2023-07-05 19:57:04','2023-10-15 07:34:41',NULL,'','0',18,137),
	 (1241,'Презентация дебютного альбома проекта Косая Гора','2023-07-12-novaia-scena-aleksandrinskogo-teatra-pre','2023-07-12',NULL,'21:00:00',NULL,'<p>Косая Гора — новый инди-проект электронного продюсера и певицы Kedr Livanskiy и экспериментального продюсера и визуального художника Flaty.&nbsp;</p><p><br></p><p>Их дебютный альбом «Косогор» — многоязычное исследованием гитарной фолк-музыки, окутанной завораживающим дрим-попом и мрачными синтезаторами.</p>',1200,'2000.0',1,207,1,'https://alexandrinsky.ru/afisha-i-bilety/kontsert-gruppy-kosaya-gora/?listim_open_widget=1','',false,false,NULL,2,'2023-07-06 17:00:46','2023-10-25 04:37:22',NULL,'','0',18,82);
