	 (1253,'YAUZA FIRST BIRTHDAY','2023-07-07-yauza-yauza-first-birthday','2023-07-07','2023-07-09','19:00:00','03:00:00','<p>Санаторию для души Yauza исполняется 1 год.&nbsp;<br>Один из самых любимых проектов в центре Москвы на территории старинных особняков и уютного дворика с зелёным садом в эти выходные отмечает первый день рождения<br>Как говорят сами именинники&nbsp; - в пятницу и субботу ждем в гости наших друзей, друзей друзей и их друзей!</p>',1000,'',2,32,1,'https://yauzafirstbirthday.ticketscloud.org/','',false,false,NULL,2,'2023-07-06 19:35:17','2023-10-22 07:56:28',NULL,'','0',18,113),
	 (1244,'Вечеринка Яны Кедриной','2023-07-07-prostranstvo-pole-vecerinka-iany-kedrino','2023-07-07',NULL,'22:00:00',NULL,'<p>&nbsp;Московская электронщица Яна Кедрина, она же Kedr Livanskiy, организует свою вторую тусовку в «поле». На ней она выступит с диджей-сетом, а поддержат артистку ближайшие друзья: DJ Designer, Flaty, Sharkeisha и лайв Lena Tsibizova &amp; Piper Spray. Они наполнят клуб интеллигентной и танцевальной электронной музыкой разных жанров.&nbsp;</p>',800,'',2,46,1,'https://t.me/eto_polye/1812','https://t.me/eto_polye/1812',false,false,NULL,2,'2023-07-06 18:39:40','2023-10-25 17:57:10',NULL,'','0',18,74),
	 (1245,'Ночь Ивана Купала','2023-07-07-community-moscow-noc-ivana-kupala','2023-07-07','2023-07-08','22:00:00','06:00:00','<p>&nbsp;Танцевальный обряд в баре-библиотеке Community, посвященный расцвету природы. Тусовщиков в хоровод под разные оттенки электроники с элементами фольклора закрутят артисты!<br>Ночь будет полна ритуалов, связанных с огнем, водой и травами! Чайная станция «Иван Чай», плетение венков, брачные обряды в церемониальном храме Community Moscow.</p><p><strong>Dress-code: </strong>Modern Folk &amp; Ethnic Style</p>',2000,'',2,58,1,'http://communitymoscow.ru/ivanakupala','',false,false,NULL,2,'2023-07-06 18:46:59','2023-10-15 09:16:15',NULL,'','0',18,75),
	 (1246,'OMUT','2023-07-07-bar-20-omut','2023-07-07','2023-07-08','19:00:00','05:00:00','<p>Приглашаем вас на незабываемую тусовку под названием OMUT!&nbsp;<br>У нас для вас выступят такие талантливые диджеи, как OBRAZTSOFF, MAX SHREMPH и ANDREY HIX. Атмосфера вечера будет создана настоящими мастерами своего дела, которые играют только на виниле. Не пропустите возможность погрузиться в энергетику этой команды, ведь они уже успешно работают в индустрии музыки уже 10 лет.&nbsp;<br>Встречаемся 7 июля в 19:00 и будем продолжать веселье до 5:00!<br><strong>Стоимость: </strong>бесплатно <a href="https://bar-20.timepad.ru/event/2491795/">по регистрации</a>.&nbsp;</p>',0,'',2,208,1,'https://bar-20.timepad.ru/event/2491795/','',false,false,NULL,2,'2023-07-06 18:54:06','2023-10-21 17:44:46',NULL,'','0',18,32),
