	 (1255,'Wonderland experiencE','2023-09-01-wonderland-experience','2023-09-01',NULL,NULL,NULL,'<p>Музыкальный туристический слёт<br>Звук:&nbsp; Funktion-One<br>Охрана посетителей :&nbsp; ‘’The Hooligans MC’’.<br><br>Орг. сбор:<br>До 25 июля-3000₽<br>До 10 августа-3500₽<br>До 29 августа-4000₽<br>На входе-5000₽<br><br>Музыкальные площадки , чайная , кухня,<br>баня, медпункт.</p>',3000,'5000.0',1,NULL,3,'https://rupor.biz/widgets/event-tickets/856','',false,false,NULL,2,'2023-07-06 20:02:18','2023-10-25 02:25:38',NULL,'','0',18,317),
