	 (1258,'GO BLANK','2023-07-15-blank-go-blank','2023-07-15',NULL,'23:59:00',NULL,'<p>Go Blank — наша ключевая линия событий, которую мы неустанно тянем и рихтуем вот уже 5 лет, ограждая ее от крутых виражей и изломов, подсунутых кривой. В ней сконцентрирована непомерная повернутость на звуке, умеющем заполонять пустоту внутри. К черту запутанность, если бы не эта вечеринка, Blank поставил бы точку в 2018-м.&nbsp;<br><br>Летняя версия Go Blank пройдет на трех танцполах. Лайн-ап террасы собран под кураторством Лены Поповой, светоча локальной сцены последних декад. На мейне — долгожданное воссоединение с Poima, только что вернувшимися из азиатской отлучки. Гримерка перелистнет страницы гримуара — ученики темных наук наведут мрак неистовыми техно-заклинаниями.&nbsp;</p>',800,'',1,1,1,'https://blankclub.ru','',false,false,NULL,2,'2023-07-06 21:31:32','2023-10-16 23:39:54',NULL,'','0',18,152),
	 (1259,'ЛАГЕРЬ','2023-07-08-samokatnaia-419-lager','2023-07-08',NULL,'22:00:00',NULL,'<p>12-часовая смена в летнем лагере с обширной программой уже в эту субботу! Ожидается лекция от Kickspaper, чистка кросс в прямом эфире, бир понг и гриль! Всё это в сопровождении лайвов от Captown, Alon, Минаева, Nick Rouze, Jein, Erian и резидентских диджей-сетов.&nbsp;<br><br></p>',0,'1000.0',2,209,1,'','',false,false,NULL,2,'2023-07-06 21:39:44','2023-10-22 17:38:20',NULL,'','0',18,123),
	 (1260,'Civilization Family — IMPERIAL GARDEN','2023-07-08-birds-civilization-family-imperial-ga','2023-07-08','2023-07-09','22:00:00','06:00:00','<p>Окунаемся в мифы и красоту Древнего Китая с фирменной вечеринкой Civilization Family — IMPERIAL GARDEN.<br>&nbsp;<br>Вечеринка пройдет в одном из самых красивых мест Москвы в ресторане BIRDS!&nbsp;<br><br>Dress-code: ORIENTAL и вариации на тему Китая.</p>',1800,'',2,210,1,'https://moscow.qtickets.events/76179-imperial-gardens','',false,false,NULL,2,'2023-07-06 21:49:31','2023-10-25 07:12:00',NULL,'','0',18,175),
