	 (1262,'Это очень древняя игра - Le Syndicat Electronique','2023-07-08-griboedov-le-syndicat-electronique','2023-07-08','2023-07-09','23:00:00','06:00:00','<p>в эту субботу в грибоедов контрабандой из лесов южной франции будет доставлен le syndicat electronique - сто духоподъемных минут нуар электро в режиме аксьон директ. экосистема праздника непослушания будет разделена на бункер и террасу. данжен вайб подпитаем гаагскими кислотами, на террасе устроим вечную весну по заветам ancienne belgique</p>',NULL,'500.0',1,86,1,'','',false,false,NULL,2,'2023-07-06 22:46:02','2023-10-22 09:37:30',NULL,'','0',18,178),
	 (1263,'Щелчковщина','2023-07-07-lachesis-shhelckovshhina','2023-07-07',NULL,'22:00:00',NULL,'<p>Как и все подстрекатели (двигаться под клевые ритмы), команда собирается в подвале и начинает колесить по жанрам, флипать заурядную танцевальную музыку и разделяться во мнениях. Лайн-ап собран так, что каждый при своем — для разрешения конфликтов будет целых две сцены. Однако же подавляющее большинство флешек забиты симпатично-хулиганскими треками энивей<br><br>Еще не все, ведь на «Щелчковщине» можно обзавестись татуировкой по тематическому эскизу от shtps6fck. Тем, кто не готов к наколкам, предлагаем выпить спешл-коктейль и примериться в корнере винтажного магазина Архиватор. Целый метагородок, получается</p>',NULL,'0.0',2,121,1,'','https://t.me/shelchokaround',false,false,NULL,2,'2023-07-06 23:17:22','2023-10-24 21:29:33',NULL,'','0',18,56);
