	 (1264,'White Bithday','2023-07-08-recnoi-pliaz-restoran-white-bithday','2023-07-08',NULL,'15:00:00',NULL,'<p>Легендарная "Крыша мира" празднует свое 17-летие в «Речном»!<br><br>Уже 8 июля в самом популярном бич-клабе Москвы - грандиозная "WHITE PARTY" в честь дня рождения легенды! Целый день - мощнейший лайнап и культовые имена лейбла<br>Специально для таких масштабных событий "Речной" в этом сезоне стал еще просторнее . А это значит - что 8 июля мы соберем еще больше наших друзей, вместе с которыми мы разделим нашу любовь к качественному звучанию и атмосфере праздника!<br><br>DRESS CODE: WHITE, ONLY WHITE, PURE WHITE!</p>',4000,'',2,211,1,'https://kryshamira.ticketscloud.org/','',false,false,NULL,2,'2023-07-06 23:32:58','2023-10-22 09:51:22',NULL,'','0',18,1194),
	 (1265,'Amen Keepers ','2023-07-29-suba-bar-amen-keepers','2023-07-29','2023-07-30','20:00:00','06:00:00','<p>кто однажды стал хранителем амена, навсегда остаётся верен своему выбору.&nbsp; Стань и ты, не упусти свой шанс!&nbsp;</p><p>&nbsp;29 июля в баре ШУБА пройдёт наша новая встреча со старыми друзьями.</p><p><br></p><p>Непременно приходите к нам и вас будут ждать:</p><p><br></p><p>▫ 9 артистов и 10 часов нашей любимой музыки;</p><p><br></p><p>▫ уютная и удобная локация;</p><p><br></p><p>▫ великолепная кухня и авторские настойки;</p><p><br></p><p>▫ дружеская атмосфера и приятная компания<br><br>Вход:&nbsp; до 23:00 и с 03:00 свободный&nbsp; с 23:00 до 03:00 400 руб &nbsp;</p>',0,'400.0',1,205,1,'','',false,false,NULL,2,'2023-07-07 00:01:07','2023-10-18 03:48:55',NULL,'','0',18,178),
	 (1268,'Deconstructa vol.V','2023-07-07-griboedov-deconstructa-volv','2023-07-07',NULL,'18:00:00',NULL,'<p>НОЧИ ИНДУСТРИАЛЬНОГО РЕГГЕТОНА И ПОСТ-КЛАБ МУЗЫКИ — БЫТЬ<br>DECONSTRUCTA переезжает в Griboedov Basement<br><br>Огромная благодарность команде клуба за радушный приём и оперативную помощь. Выручка с мероприятия поможет клубочку kontrkult быстрее найти новый домик&nbsp;</p>',NULL,'800.0',1,86,1,'','',false,false,NULL,2,'2023-07-07 16:31:32','2023-10-24 04:01:01',NULL,'','0',18,70),
	 (1269,'FLIP FLAP x JUNGLE FEVER','2023-07-08-union-flip-flap-x-jungle-fever','2023-07-07',NULL,'23:00:00',NULL,'<p>Лето в самом разгаре, а это значит, что пришло время для нового ивента от нашей команды. В этом месяце принимаем в гостях наших хороших друзей из Нижнего Новгорода - комьюнити Jungle Fever.<br><br>Начинаем в 22:00, где вас ожидают сэты от гостей и участников FLIP FLAP.<br><br>Как и месяц назад, зал по большей части будет принадлежать таким электронным жанрам как Breaks и D&amp;B, в то время как во дворе будет всевозможная современная электроника, в том числе и танцевальные эдиты на русские треки.<br><br>Вход до 23:00 фри, после – 500₽</p>',0,'500.0',1,8,1,'','',false,false,NULL,2,'2023-07-07 16:51:08','2023-10-23 20:07:38',NULL,'','0',18,83),
	 (1270,'ДОБРО','2023-07-08-union-dobro','2023-07-08',NULL,'22:00:00',NULL,'<p>Всем пис!<br>В эту субботу делаем большой ивент на двух танцполах Union вместе с командой Burda Dobro&nbsp;<br>На окнах у входа в бар ребята будут рисовать граффити<br>Так же во дворе будем записывать видео подкаст P14 Video Podcast&nbsp;<br>Ну и состав говорит сам за себя, будет пожар<br>Си ю</p>',NULL,'0.0',1,8,1,'','https://t.me/dobrovinyl',false,false,NULL,2,'2023-07-07 17:05:02','2023-10-15 02:02:23',NULL,'','0',18,158),
	 (1271,'Dialog','2023-07-08-mixed-dialog','2023-07-08',NULL,'22:00:00',NULL,'<p>продолжаем серию вечеринок в формате dialog с коллекционерами винила и приверженцами rominimal - Romoq и Danya Koposov.&nbsp;<br><br>совсем скоро лето перевалит за экватор - рекомендуем не упускать эти теплые вечера и проводить их в компании единомышленников, вкусных напитков и в сопровождении отличного звука.&nbsp;<br><br>загадали для всех солнце,&nbsp;<br>встречаемся на закате!</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,2,'2023-07-07 17:15:16','2023-10-25 04:08:17',NULL,'','0',18,91),
