	 (1273,'Пирамиды Урала','2023-07-07-macty-piramidy-urala','2023-07-07',NULL,'20:00:00',NULL,'<p>Приходите и подключитесь к резонансу пирамидальной формации, чтобы всем вместе отправиться в экспедицию по волнам преломленных психоделическим джазом состояний.</p>',NULL,'500.0',1,9,1,'','https://vk.com/uralpyramidsspb',false,false,NULL,2,'2023-07-07 17:26:01','2023-10-24 21:12:46',NULL,'','0',18,68),
	 (1274,'DJ ROW-MAN ','2023-07-07-stirka40-dj-row-man','2023-07-07',NULL,'21:00:00',NULL,'<p>DJ ROW-MAN 7 июля в "Стирке" обозревает вселенную Регги музыки и, конечно, смежных стилей.<br>Супермарафон начнётся в 21-00 (+-) и до полного изгнания дьявола.<br>Только винил и позитивные ввибрации.<br><br></p>',NULL,'0.0',1,14,1,'','https://t.me/aeonvektor',false,false,NULL,2,'2023-07-07 17:31:35','2023-10-24 01:37:41',NULL,'','0',18,47);
