	 (1284,'Paradigma Festival 2023 (Затерянная планета)','2023-08-18-paradigma-festival-2023-zateriannaia-pl','2023-08-18','2023-08-20',NULL,NULL,'<p>IOD Live Synth Community представляет уникальную лайв-сцену электронной музыки. 24 лайв-проекта, непрерывный калейдоскоп аналогового железа, каждое выступление - отдельный концерт. Традиционно для нашего комьюнити вы можете этим насладиться раз в год на сцене IOD.Специальный промокод для Listing.Events - lost_planet&nbsp;</p><p>Друзья! Приготовьтесь к незабываемому событию.&nbsp;</p><p>Фестиваль передовых звуковых технологий и идей, где Музыка - это универсальный язык общения.Представьте, как вы танцуете под звездами в окружении захватывающих дух природных красот. Наш живописный лес — идеальное место для вашего отдыха, танцев и незабываемых воспоминаний. Мы неустанно работаем над тем, что бы превзойти ваши ожидания и создать незабываемое путешествие, где царят музыка, искусство и гармония. Для вас мы готовим две сцены, два прогрессивных направления: HI-Tech и&nbsp; Live Techno .Сопровождает визуальное шоу, художественные инсталляции и внеземную атмосферу, которая перенесет вас на «Затерянную планету».</p>',4200,'',2,NULL,3,'https://lk.ravers.events/e/27/#tickets','https://paradigma.events/',false,false,NULL,4,'2023-07-07 19:33:51','2023-10-25 09:00:51',NULL,'','0',18,799),
	 (1285,'Best of Both Worlds','2023-07-08-miska-bar-best-of-both-worlds','2023-07-08',NULL,'21:00:00',NULL,'<p>80-е, хип-хоп, диско. Вообще-то жанры не имеют значения. Иногда Тимофей стоит за пультом и у тебя ощущение будто лучше музыки на свете просто нет. Вдруг сегодня будет как раз такой вечер.&nbsp;</p>',NULL,'0.0',1,12,1,'','',false,false,NULL,1,'2023-07-08 15:36:22','2023-10-24 22:22:09',NULL,'','0',18,74),
	 (1286,'Epilogue','2023-07-08-warpp-epilogue','2023-07-08',NULL,'22:00:00',NULL,'<p>Это будет наши последние выходные в этом уютном месте, и мы с нетерпением ждем, чтобы разделить с вами последние моменты здесь</p>',1000,'',1,23,1,'','https://warppclub.com/',false,false,NULL,1,'2023-07-08 15:40:03','2023-10-15 11:57:49',649,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWM4ZjQ5ZTM2MTVjZTYwMTliOThmNzNlIn0.a0dGEAZ3N97GMpHyAWxF-8isExi5F023NUHtsUtPAvY&event=649a134b35ddc34c5d2a0f98','0',18,64);
