	 (1288,'Langou Stines VECHERINKA N01','2023-07-09-ritmy-langou-stines-vecherinka-n01','2023-07-08',NULL,'19:00:00',NULL,'<p>Лангустины без резинки совсем озверели и прислали мне послание, которое я оцифровал (это было сложно) и несу вам.&nbsp;<br>Вот такая выжимка из креветочного письма. Видимо будет круто!&nbsp;<br>По стилистике — хаус и электро!</p>',NULL,'0.0',1,181,1,'','',false,false,NULL,2,'2023-07-08 16:41:44','2023-10-25 03:07:26',NULL,'','0',18,53),
	 (1289,'OMUT','2023-07-22-cerkvi-vo-imia-poseshheniia-presviatoi-devoi','2023-07-22',NULL,'20:00:00',NULL,'<p>Наше второе погружение в&nbsp;OMUT состоится 22.07 в Церкви Во Имя Посещения Пресвятой Девой Марией Святой Елизаветы.&nbsp;<br>«...Оказавшись в глубине времени, мы увидим как лучи солнца пробиваются через толщу воды, озаряя своим сиянием..<br>Оттолкнёмся от самого дна, нащупав опору, всплывём на поверхность, навстречу к свету..»</p>',500,'',1,212,1,'https://omut-event.timepad.ru/event/2488948/','',false,false,NULL,2,'2023-07-11 22:24:49','2023-10-25 16:38:46',NULL,'','0',18,229),
	 (1290,'Гихон Festival','2023-07-28-eden-garden-gixon-festival','2023-07-20','2023-07-21',NULL,NULL,'<p>С давних времен люди не скрывали своих желаний, давайте окунемся в царство Эдема в место под названием Гихон, здесь остались жить любители разврата и телесных удовольствий.<br>На территории также будет:&nbsp;<br><br>2 Dance Floor&nbsp;<br>BDSM zone &nbsp;<br>Massage zone &nbsp;<br>Perfomance<br>Fire show<br>Streptese show<br><br>За доп. плату предлагаем:<br><br>&nbsp;Место под палатку<br>&nbsp;Аренда палаток<br>&nbsp;Трансфер &nbsp;<br>&nbsp;Парковка&nbsp;<br><br>Dress Code: Burning man<br><br></p>',1500,'',1,213,3,'','',false,false,NULL,2,'2023-07-11 22:40:20','2023-10-21 19:59:09',NULL,'','0',18,687),
	 (1291,'SOLARIS','2023-07-14-solaris','2023-07-14','2023-07-16','16:20:00','16:20:00','<p>&nbsp;Solaris — ежегодный фестиваль электронной музыки. Он проходит в невероятно красивом месте марийских лесов, на берегу реки, в окружении столетних дубов и сосен, под прекрасными июльскими звездами.&nbsp;<br><br>Фестиваль включает в себя:<br>– музыкальные зоны (psychill, dub, deep, этника &amp; folktronica, slow rave, organic, techno, progressive и транс),<br>– декорированные лесные пространства,<br>– территорию оздоровительных и трансцендентальных практик,<br>– домики и палаточный лагерь,<br>– маркет, кухню, баню и душевые кабины, охраняемую стоянку.&nbsp;</p>',3500,'',6,NULL,3,'https://solarisfest.ru/#page=index','',false,false,NULL,2,'2023-07-11 22:51:10','2023-10-25 05:29:17',NULL,'','0',18,38),
	 (1292,'Mirage Control+','2023-07-14-miraz-mirage-control','2023-07-14',NULL,'00:00:00',NULL,'<p>наш несменяемый гроза пульта серёга токио снова решил, что просто сета ему мало, поэтому нас ждет новый control+ (подписка лайк репост)<br>в прошлый раз мне пришлось включить инстасамку в 2 часа ночи, чтобы хоть как-то уменьшить количество людей на танцполе (сработало в обратную сторону), в этот раз обещает еще жестче.<br>вход:&nbsp;<br>500₽ до 01:00<br>700₽ после 01:00</p>',500,'700.0',1,77,1,'','https://t.me/contrrrol',false,false,NULL,2,'2023-07-11 23:13:52','2023-10-25 09:35:43',NULL,'','0',18,82),
	 (1293,'МуRAVEйник','2023-07-22-solaris-lab-muraveinik','2023-07-22','2023-07-23','18:00:00','05:00:00','<p>МуRAVEйинк совсем скоро.&nbsp;</p><p>Хороший парень, приглашает на День Рождения.<br>Да будет, RAVE.</p><p>22 июля поздравляем одного из ярких представителей хаус сцены Санкт-Петербурга с никнеймом и имя ему Tr-Meet.&nbsp;</p><p>Вас, ждет исключительно хаус музыка, летний вайб, аутентичные виды крыш Петербурга, ну и конечно улыбки друзей и друг друга.</p>',1500,'',1,106,1,'','',false,false,NULL,2,'2023-07-11 23:21:08','2023-10-17 20:59:39',NULL,'','0',18,263),
	 (1294,'Свет и Музыка','2023-07-15-zavod-kazanorgsntez-svet-i-muzyka','2023-07-15','2023-07-15','17:30:00','22:00:00','<p>В программе фестиваля — четыре самобытных музыканта из Москвы, Санкт-Петербурга, Екатеринбурга и Казани, которые работают на стыке аудиального и визуального искусства.&nbsp;<br>«Свет и музыка» официально перезапустит первый советский аудиовизуальный фестиваль, который организовывался сотрудниками НИИ экспериментальной эстетики «Прометей» в Казани в 1960-1990-е годы.&nbsp;</p>',0,'',6,215,3,'https://smena-kazan.timepad.ru/event/2484363/#register','',false,false,NULL,2,'2023-07-11 23:34:59','2023-10-25 15:55:33',NULL,'','0',18,111),
	 (1295,'GAS:ON','2023-07-14-bauns-gason','2023-07-14','2023-07-15','21:00:00','07:00:00','<p>В пятницу в Баунсе снова пройдет вечеринка GAS:ON! Уже предвкушаем купание в бассейне, атмосферный уличный бар, мультибрендовый маркет и множество других активностей<br><br>И, конечно, dj-сеты и лайвы от любимых исполнителей.</p>',999,'',2,17,1,'https://gason-event.timepad.ru/event/2495198/','https://m.vk.com/wall-215368188_414?from=notifications',false,false,NULL,2,'2023-07-11 23:43:41','2023-10-25 01:47:59',NULL,'','0',18,85),
	 (1296,'КАТЭРАГ','2023-07-14-rndm-katerag','2023-07-14',NULL,'23:00:00',NULL,'<p>Что делаем? Все по «катэражной» классике: препатимся, секси одеваемся, качаем под электро и брейкбит, отлетаем под хардгрув и транс и в последний момент запрыгиваем на обратный поезд до Питера…</p>',700,'',2,27,1,'https://msk.radario.ru/events/1985971/tickets','https://m.vk.com/wall-145793441_2254',false,false,NULL,2,'2023-07-11 23:59:53','2023-10-20 23:45:24',NULL,'','0',18,87);
