	 (1297,'ГРЯДЁТ','2023-07-14-community-moscow-griadet','2023-07-14',NULL,'21:00:00',NULL,'<p>14.07 в библиотеке Community красота, интеллект, деликатность - всё соберется вместе, чтобы подарить вам незабываемую ночь.<br><br>Вы услышите множество музыкальных анрелизов и эксклюзивных работ в стиле ориентального прогрессив хауса.</p>',1000,'2000.0',2,58,1,'https://moscow.qtickets.events/76672-g-r-ya-d-e-t-progressive-adamov','',false,false,NULL,2,'2023-07-12 00:15:57','2023-10-18 17:15:15',NULL,'','0',18,64),
	 (1298,'POGROM REZO B-DAY','2023-07-14-gorod-pogrom-rezo-b-day','2023-07-14',NULL,'23:50:00',NULL,'',500,'',2,63,1,'https://moscow.qtickets.events/77393-pogrom-rezo-b-day','https://vk.com/pogrom_rezobday',false,false,NULL,2,'2023-07-12 00:23:38','2023-10-21 13:56:43',NULL,'','0',18,56),
	 (1299,'Corpus One - 5 years','2023-07-21-gazgolder-corpus-one-5-years','2023-07-21',NULL,'21:00:00',NULL,'<p>Cтоличная промо команда CORPUS ONE празднует свое пятилетие и готовит аудио-визуальный праздник на двух танцполах клуба Газгольдер.<br><br>Подарком в первую круглую дату будет хедлайнер ночи — американский диджей ESKUCHE, хитмейкер и трендсеттер западной электронной сцены.<br><br>В этот особенный день мы собрали всех наших друзей в лице проффесионалов своего дела, в руках которых палитра минималистичного и хаус-звучания заиграет миллионами красок и оттенков.</p>',1000,'2000.0',2,35,1,'https://moscow.qtickets.events/77491-corpus-one-5-year','',false,false,NULL,2,'2023-07-12 00:33:04','2023-10-21 11:15:07',NULL,'','0',18,134),
	 (1300,'HYPERRESEARCH','2023-07-21-etherea-bar-hyperresearch','2023-07-21',NULL,'23:00:00',NULL,'<p>Совместный шоукейс лейблов Hyperboloid Records и RESEARCHCORE</p>',500,'1000.0',2,189,1,'https://moscow.qtickets.events/77539-hyperresearch','https://vk.com/event221527637',false,false,NULL,2,'2023-07-12 00:38:48','2023-10-25 10:50:10',NULL,'','0',18,130),
	 (1301,'Despersion','2023-07-21-16-tonn-presnenskii-val-despersion','2023-07-21',NULL,'23:55:00',NULL,'<p>21 июля в 23:55 встречаемся на Drum and Bass вечеринке с презентацией дебютного альбома от проекта Despersion!<br>Главный танцпол второго этажа в клубе «16 Тонн»!<br>До встречи на танцполе! Зовите всех друзей!</p>',500,'',2,29,1,'https://moscow.qtickets.events/77179-despersion','',false,false,NULL,2,'2023-07-12 00:43:57','2023-10-22 12:10:19',NULL,'','0',18,164),
	 (1302,'BALANCE','2023-07-22-gazgolder-balance','2023-07-22',NULL,'20:00:00',NULL,'<p>В балансе между ночью и днем анонсируем новую вечеринку на двух танцполах творческого объединения Газгольдер<br><br>Одним из хайлайтов 16 часовой minimal party на открытой террасе станет выступление Prichindel (Sunrise) — звездного представителя новой румынской волны.<br><br>Уже появившись на самых важных площадках, таких как клуб Guesthouse или фестиваль Sunwaves, Каталин, безусловно, является одним из ди-джеев, которые будут продолжать расширять видение того, что означает «румынский звук».</p>',1000,'',2,35,1,'https://moscow.qtickets.events/77205-balance-at-gazgolder-club','https://www.gazgolderclub.ru/',false,false,NULL,2,'2023-07-12 00:48:12','2023-10-10 10:21:06',NULL,'','0',18,102),
	 (1303,'Noir Bazaar','2023-07-14-blank-noir-bazaar','2023-07-14',NULL,'23:00:00',NULL,'<p>Перешагиваем за середину лета и границу дозволенного в эту пятницу. Греемся и кружимся в экстатических танцах на веранде Бланка, а если не поможет — переместимся на мейн и устроим форменный марокканский притон, со всеми тлеющими и вытекающими. Напоминаем, что у нас, в отличие от погоды, без сюрпризов: все та же декадентская атмосфера, все те же горящие свечи, все та же ориентальщина и чертовщина. Хотя кто знает, может дело дойдет и до дарк диско, ебм и нью бита... В общем, увидите, услышите и почувствуете!</p>',500,'',1,1,1,'https://spb.qtickets.events/77485-1407-noir-bazaar-at-blank','https://t.me/oberwave',false,false,NULL,2,'2023-07-12 01:24:39','2023-10-21 11:54:02',NULL,'','0',18,95),
	 (1326,'Киссотека','2023-07-15-prostranstvo-pole-kissoteka','2023-07-15',NULL,'23:00:00',NULL,'<p>Вечеринка знакомств от проекта «Поцелуйный Бар», на которой можно будет стрелять глазками и пить летние коктейли. Гостей ждут два танцпола</p>',3000,'',2,46,1,'https://kissbar.timepad.ru/event/2450194/?utm_source=pole','',false,false,NULL,2,'2023-07-13 04:46:56','2023-10-21 05:16:20',NULL,'','0',18,157),
	 (1304,'Союз. Технический сеанс','2023-07-15-q-bar-soiuz-texniceskii-seans','2023-07-15',NULL,'22:00:00',NULL,'<p>15-го июля – в дату, разделяющую сезон солнца и веселья пополам – мы проведем наш первый Технический Сеанс. Групповая терапия музыкой, танцем и бесконечным игристым пройдёт в Q club , который на одну ночь превратится в обитель звука и света и станет пристанищем для нашего праздника.</p>',500,'',1,161,1,'https://spb.qtickets.events/77278-soyuz-tekhnicheskiy-seans','',false,false,NULL,2,'2023-07-12 01:32:25','2023-10-25 14:07:28',NULL,'','0',18,90),
	 (1305,'THE WHITE','2023-07-15-roof-place-the-white','2023-07-15',NULL,'23:30:00',NULL,'<p>В Питере есть традиция: каждым летом, надевать все белое и идти на вечеринку. Этой традиции уже более 20 лет и она не собирается останавливаться.<br>Белые вечеринки делают многие (если не все), но каждый год, одна из них, становится самой ожидаемой и самой веселой.<br><br>Мы не утверждаем, что это будет именно наша вечеринка THE WHITE, но мы можем точно сказать, что мы приложим самые титанические усилия, чтобы эта вечеринка была по-настоящему запоминающейся и дико веселой.<br>Ведь по-другому и быть не может!<br>В нашем Лайн-ап сам легендарный SPY.DER. Потрясающий MONOPLAY, уникальные ARTSKY с гениальным пианистом Артемом Савинковым. Хранитель формата и танцев Дима THE SHPAKOFF. И конечно, MIRIDA -&nbsp; чей музыкальный и исполнительский уровень вырос за последние годы до международного.</p>',2200,'',1,176,1,'https://spb.qtickets.events/74251-the-white','',false,false,NULL,2,'2023-07-12 01:37:25','2023-10-25 09:03:52',NULL,'','0',18,86);
