	 (1306,'MELANTUM','2023-07-15-rossis-club-melantum','2023-07-15',NULL,'23:30:00',NULL,'<p>Вечеринка со стильным звучанием и дружественной атмосферой.</p>',300,'',1,129,1,'https://spb.qtickets.events/76867-melantum','',false,false,NULL,2,'2023-07-12 01:42:10','2023-10-24 13:53:48',NULL,'','0',18,38),
	 (1307,'Smoky D Birthday','2023-07-22-diuny-smoky-d-birthday','2023-07-22','2023-07-23','23:40:00','06:00:00','<p>34 года назад свет увидел талантливый и несменный участник многих драм-н-бейс событий, мастер церемоний - MC Smoky D!<br><br>22 июля, по традиции, поздравляем Васю на уличной сцене клуба Дюны на Лиговском 50В.<br><br>Именинник порадует всех ценителей ломаных ритмов грамотным составом из специальных гостей и деятелей сцены.</p>',500,'800.0',1,49,1,'https://spb.qtickets.events/77622-smoky-d-birthday-bash-2023','',false,false,NULL,2,'2023-07-12 01:46:49','2023-10-21 04:10:53',NULL,'','0',18,139),
	 (1308,'Strip Club Chicken Bone','2023-07-14-griboedov-strip-club-chicken-bone','2023-07-14',NULL,'23:00:00',NULL,'<p>Тёплая июльская ночка манит аппетитным ароматом жареной курочки и битами, доносящимися будто из-под земли. А ты и рад вестись на это, ведь нет ни единой причины не лакомиться и не выкрикивать<br>«Fuck home, fuck sleep, come clean, zonin''»<br><br>В ближайшую субботу отлетаем в Griboedov Basement под хип-хоп, брейкбит и музыку наших сердечек&nbsp;</p>',400,'600.0',1,86,1,'','',false,false,NULL,2,'2023-07-12 02:30:48','2023-10-22 13:12:25',NULL,'','0',18,131),
	 (1309,'Mid SUMMIT','2023-07-14-mutabor-mid-summit','2023-07-14','2023-07-15','23:00:00','12:00:00','<p>14 июля отметим середину лета ярким фестивалем Mid SUMMIT в стенах московского Mutabor.&nbsp;<br><br>Летний эпизод Summit представит вам двух иностранных хедлайнеров, 3 сцены и более 20-ти локальных артистов. Как всегда, мы объединили несколько Петербургских музыкальных формаций, а также представителей московского андеграунда, чтобы создать особую атмосферу по энергетике и привезти в столицу с берегов Невы свой особый, неповторимый вайб. А компанию им составит горячая итальянская звезда Pisapia. Последние билеты первого релиза в ещё в продаже.<br><br></p>',1500,'',2,2,1,'https://systemfest.org','',false,false,NULL,2,'2023-07-12 04:12:20','2023-10-24 10:29:24',NULL,'','0',18,72),
	 (1310,'Joon Sound','2023-07-14-joon-joon-sound','2023-07-14',NULL,'17:00:00',NULL,'<p>В пятницу (впервые в JOON!) встречаемся с любимыми @superlax &amp; @fanick и слушаем</p>',NULL,'0.0',1,216,1,'','',false,false,NULL,2,'2023-07-12 22:57:28','2023-10-22 09:24:29',NULL,'','0',18,55),
	 (1311,'Открытие выставки Lutiy /  Volanski','2023-07-14-stirka40-otkrytie-vystavki-lutiy-vol','2023-07-14','2023-07-15','19:00:00','02:00:00','<p>С 14 июля на стенах Стирки выставка работ художников Denis Lutiy &amp; Aleksandr Volanski.</p><p>Сочетание оптических иллюзий, граффити бэкграунда, новых техник и современных материалов.</p><p>Суть работ и исследований художников заключается в возможности открытия многомерности восприятия, дающей возможность эффективного наблюдения, исследования своей жизни и окружающего мира.</p><p>Картины пребывают в постоянном движении и смене зрительных парадоксов. При наблюдении мы можем прийти к выводу, что прошлое, настоящее и будущее всегда находятся в одной точке.</p><p>Визуальные парадоксы абстрактных композиций созданы благодаря исследованиям в области перцептивных и апперцептивных функций человеческого восприятия.</p>',NULL,'0.0',1,14,1,'','',false,false,NULL,2,'2023-07-12 23:03:20','2023-10-20 23:00:29',NULL,'','0',18,97),
	 (1325,'Club Night','2023-07-15-gazgolder-club-night','2023-07-15','2023-07-16','21:00:00','09:00:00','<p>Новая серия мероприятий от создателей Gazgolder club&nbsp;<br><br>Вечеринка на веранде с качественным саундом от именитых мастеров танцевальной сцены и новых талантливых диджеев, а на мейне chill-zone и ретроспектива классических кино хитов.</p>',1000,'1500.0',2,35,1,'https://www.gazgolderclub.ru','',false,false,NULL,2,'2023-07-13 04:40:10','2023-10-22 14:20:30',NULL,'','0',18,112),
	 (1312,'WHITE KNIGHT','2023-07-15-zima-leto-villa-white-knight','2023-07-15','2023-07-16','21:00:00','05:00:00','<p>Белый цвет трактуется как начало, освобождение и свобода в целом, белая одежда в повседневной жизни человека обозначает начало нового этапа, очищение..<br><br>White Knight - это событие, которое заставляет сердца биться сильнее! Это праздник танцевальной культуры, где каждый участник ощущает себя частью огромной семьи, объединенной любовью к электронной музыке.<br><br>На первом российском музыкальном фестивале в белом собираются лучшие диджеи страны и зарубежные гости, которые создают неповторимое звучание из самых актуальных стилей и направлений танцевальной музыки.<br><br>Белый дресс-код - это не только признак элегантности, но и символ чистоты и света, который отражает дух фестиваля. На White Knight каждый участник становится частью этой магии и создает незабываемые воспоминания, которые остаются на всю жизнь.<br><br><br>DRESS CODE : TOTAL WHITE</p>',1900,'2500.0',1,217,1,'https://ra-agency.pro/whiteknight','',false,false,NULL,2,'2023-07-12 23:12:14','2023-10-25 18:20:15',NULL,'','0',18,143),
	 (1313,'ITALLIKA','2023-07-14-union-itallika','2023-07-14',NULL,'21:30:00',NULL,'<p>ITALLIKA на двух танцполах Union Bar, двор и зал, all night long&nbsp;<br>Вход: до 23 свободный, после 500₽.&nbsp;</p>',0,'500.0',1,8,1,'','',false,false,NULL,2,'2023-07-12 23:32:06','2023-10-10 21:56:42',NULL,'','0',18,88),
	 (1314,'RESON х Popoff Kitchen','2023-07-15-resohub-reson-x-popoff-kitchen','2023-07-15','2023-07-16','21:00:00','03:00:00','<p>В эту субботу наши друзья из Popoff Kitchen нагрянут в RESOhub. Намечается вечер в лучших традициях «Попоффцев» — стильно, громко и, конечно же, с любовью.&nbsp;</p>',NULL,'0.0',2,186,1,'','',false,false,NULL,2,'2023-07-12 23:59:01','2023-10-21 00:38:54',NULL,'','0',18,77);
