	 (1315,'НОЧЬ','2023-07-15-soma-noc','2023-07-15','2023-07-16','18:00:00','04:00:00','<p>15 июля во дворе Soma пройдёт уже четвёртая, летняя, почти дневная вечеринка кооператива “Ночь”. С 6 вечера до 4 утра гостей будут ждать музыкальное путешествие Москва-Питер, танцы под звёздным небом, коктейли, таро-гадания и тату.<br>Вечеринка кооператива “Ночь” - это всегда актуальный и разнообразный лайн-ап, хороший звук и атмосфера. Все обязательные составляющие на месте: метровый диско-шар, френдли вайбы, тапасы и коктейли от Soma, после которых не будет болеть голова. А ещё гостей ждёт волшебная комната с самыми актуальными таро-предсказаниями за донейшн и поп-ап тату-студия со специальными мини-тату.<br>&nbsp;<br>Как всегда, ночь - это только по любви! Увидимся во дворике!<br>FC/DC - пижама или пиджак</p>',NULL,'1500.0',2,218,1,'','',false,false,NULL,2,'2023-07-13 00:08:43','2023-10-25 14:52:32',NULL,'','0',18,192),
	 (1316,'ELECTROBUDKA','2023-07-15-griboedov-electrobudka','2023-07-15',NULL,'23:00:00',NULL,'<p>Прошлая вылазка Будки в Бейсмент до сих пор будоражит кровь: забившись битком вы топтали потолок (как вам это удалось — для нас шок и загадка). Мясо имеет свойство камбекаться, поэтому в субботу объявляем местом сборки два танцпола Griboedov Basement<br>За атмосферу на обоих стейджах несёт ответ не только свет электро-тусовки города, но и декораторы контркульта, любезно прихватившие все любимые световые приборчики и другие фишки с домика на Полюстровском&nbsp;<br><br>Помни, эти пляски располагают к обуви поудобнее. Сохранять спокойствие не получится.<br><br></p>',NULL,'700.0',1,86,1,'','https://m.vk.com/wall-154594155_17185?from=notifications',false,false,NULL,2,'2023-07-13 00:23:11','2023-10-15 22:46:11',NULL,'','0',18,97),
	 (1317,'Прожиточный Минимал','2023-07-13-propaganda-prozitocnyi-minimal','2023-07-13',NULL,'23:00:00',NULL,'<p>В четверг у нас впервые пройдет шоукейс московской команды «Прожиточный минимал». Лайнап ожидается совсем не четверговый.&nbsp;</p>',NULL,'0.0',2,101,1,'','',false,false,NULL,2,'2023-07-13 04:02:45','2023-10-19 05:59:37',NULL,'','0',18,66),
	 (1318,'Warehouse','2023-07-14-propaganda-warehouse','2023-07-14',NULL,'23:00:00',NULL,'<p>Похолодание не мешает нам танцевать и веселиться, так что ловите расписание тусовок этой недели<br>Техно всех оттенков на любимой вечеринке Warehouse. За пультом — гости и резиденты.</p>',NULL,'0.0',2,101,1,'','',false,false,NULL,2,'2023-07-13 04:07:01','2023-10-21 15:28:38',NULL,'','0',18,88),
	 (1319,'Club Night','2023-07-15-propaganda-club-night','2023-07-15',NULL,'23:00:00',NULL,'<p>Клубная ночь с позитивной электроникой сулит танцы до утра. Услышим завсегдатаев «Пропаганды».<br><br></p>',NULL,'0.0',2,101,1,'','',false,false,NULL,2,'2023-07-13 04:12:19','2023-10-20 20:08:49',NULL,'','0',18,65),
	 (1322,'ТВАРИ - Рабица','2023-07-14-prostranstvo-pole-tvari-rabica','2023-07-14',NULL,'23:00:00',NULL,'<p>14 июля в поле соберутся всякого рода твари: резиденты, сооснователи и близкие по духу «Рабице» артисты<br><br>Двор покроется экспериментами с гитарными и ритмик-нойз лайвами, а в пуле пройдет дискотека&nbsp;</p>',600,'',2,46,1,'https://rabitsavpolye.ticketscloud.org/','',false,false,NULL,2,'2023-07-13 04:26:48','2023-10-25 03:07:23',NULL,'','0',18,64),
	 (1323,'ЮБЛЕЙ','2023-07-14-supermetall-iublei','2023-07-14',NULL,'20:00:00',NULL,'<p>Вечеринка диско-клуба «Радуга» в честь дня рождения Илья Гадаева</p>',1000,'',2,119,1,'https://live.mts.ru/moscow/concerts/yubley','',false,false,NULL,2,'2023-07-13 04:30:09','2023-10-24 21:27:25',NULL,'','0',18,150),
	 (1324,'Birdie Summer Party','2023-07-15-bar-strelka-birdie-summer-party','2023-07-15',NULL,'23:00:00',NULL,'<p>Летняя вечеринка парикмахерских Birdie. За пультом — ордынская принцесса Djama и ведущая телеграм-канала «Чтобы вы танцевали» Эля Сафронова, а откроет вечер специальная секретная гостья.</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,2,'2023-07-13 04:35:58','2023-10-10 10:06:08',NULL,'','0',18,48),
	 (1327,'SIMACHEV X RESONANCE','2023-07-15-bar-simach-v-nedalnem-simachev-x-reson','2023-07-15','2023-07-16','23:00:00','05:00:00','<p>Резонанс снова врывается в Симач со своим фирменным шоукейсом.<br><br>На втором этаже соберется хулиганская троица: ответственный за прямую бочку и грувы Nikita Zabelin, электро и гетто дебош от CPSL, а также укротительница ломаных ритмов Julia Karma.<br><br>На первом этаже всё гораздо культурнее: вечер откроет диско и хаус настроения от Bulgakov, а в завершении вечеринки Kah Mal отправит «Недальний» в путешествие на дальний восток.</p>',NULL,'0.0',2,104,1,'','https://t.me/resonancemoscow',false,false,NULL,2,'2023-07-13 04:54:43','2023-10-24 21:20:02',NULL,'','0',18,109),
	 (1328,'SYSTEM ONE HUNDRED AND EIGHT','2023-07-15-bauns-system-one-hundred-and-eight','2023-07-15',NULL,'22:00:00',NULL,'<p>15.07<br>SYSTEM ONE HUNDRED AND EIGHT<br><br>В субботу, 15 июля, лейбл System 108 собирает резидентов и друзей, чтобы разделить лето пополам —&nbsp;пересечь экватор и на деле протестировать всю музыку, которую мы успели выпустить с момента нашей прошлой встречи</p>',1000,'',2,17,1,'','https://t.me/system108',false,false,NULL,2,'2023-07-13 04:59:18','2023-10-01 08:06:14',NULL,'','0',18,54);
