	 (1330,'ЖИВОТ','2023-07-15-fort-ino-zivot','2023-07-15','2023-07-16','21:00:00','09:00:00','<p>В ЭТУ СУББОТУ РЕЙВ "ЖИВОТ" В ЗАБРОШЕННОМ РАДИОАКТИВНОМ ФОРТЕ ИНО ПРЯМО НА ФИНСКОМ ЗАЛИВЕ.&nbsp;</p>',NULL,'500.0',1,219,1,'','',false,false,NULL,2,'2023-07-13 22:14:23','2023-10-17 08:48:57',NULL,'','0',18,210),
	 (1331,'District','2023-07-21-ritmy-district','2023-07-21',NULL,'23:00:00',NULL,'<p>21 июля встречаемся в самом летнем уголке города на Неве!<br>Заведем мафон на набережной Севкабеля в новом музыкальном пространстве Ритмы&nbsp;&nbsp;<br>2 танцпола, 12 артистов и профессиональная команда барменов сделают эту летную ночь самой горячей 🔥<br>Звуки хауса прольются на террасе, а для техно адептов готовится к открытию самый темный танцпол!<br>И это еще не все наши сюрпризы!&nbsp;</p>',500,'',1,181,1,'https://rupor.biz/widgets/event-tickets/857?utm_source=tg&utm_medium=early_birds&utm_campaign=dstrct2107','',false,false,NULL,2,'2023-07-13 23:22:24','2023-10-16 21:14:28',NULL,'','0',18,281),
