	 (1333,'CRUISE by Kuznya x SOLIDS','2023-07-15-solids-cruise-by-kuznya-x-solids','2023-07-15',NULL,'19:00:00',NULL,'<p>В шумном зале ресторана<br><br>Предлагаем вечер ностальгии по прошлому и танцев под давно знакомые всем слова и мелодии — только 15.07 мы планируем тотально оторваться под советскую эстраду, поп-хиты и просто все то, чего порой так требует русская душа.<br><br>Начинаем с препати на террасе</p>',NULL,'0.0',1,220,1,'','',false,false,NULL,2,'2023-07-14 04:18:26','2023-10-25 13:50:08',NULL,'','0',18,78),
