	 (1339,'Пятница в Современнике','2023-07-14-sovremennik-piatnica-v-sovremennike','2023-07-14',NULL,'19:00:00',NULL,'<p>Современник позиционирует себя пристанищем креативного класса [по своему характеру] и баром [по своей сути].&nbsp;<br>В меню представлены авторские коктейли, специально подобранные вермуты, порто и настойки.&nbsp;<br>Их здорово дополняют закуски made to share — на всю компанию.<br><br>В интерьере и вайбе богемные 70-е с флером Италии и Испании.&nbsp;</p>',NULL,'0.0',1,221,1,'','',false,false,NULL,2,'2023-07-14 05:20:55','2023-10-21 21:35:17',NULL,'','0',18,131),
	 (1340,'Суббота - Открытие','2023-07-15-sovremennik-subbota-v-sovremennike','2023-07-15',NULL,'22:00:00',NULL,'<p>Современник позиционирует себя пристанищем креативного класса [по своему характеру] и баром [по своей сути].&nbsp;<br>В меню представлены авторские коктейли, специально подобранные вермуты, порто и настойки.&nbsp;<br>Их здорово дополняют закуски made to share — на всю компанию.<br><br>В интерьере и вайбе богемные 70-е с флером Италии и Испании.&nbsp;<br><br></p>',NULL,'',1,221,1,'','',false,false,NULL,2,'2023-07-14 05:27:26','2023-10-24 20:58:06',NULL,'','0',18,116);
