	 (1341,'Vibe Room','2023-07-15-miraz-vibe-room','2023-07-15',NULL,'00:00:00',NULL,'<p>Что примечательно, гости выступят в нетипичном для себя амплуа и составят хип-хоп сеты специально для этой вечеринки. <br>Наверняка музыкальный селект ребят придется по душе многим любителям хип-хоп музыки.</p>',500,'700.0',1,77,1,'','',false,false,NULL,2,'2023-07-14 05:35:07','2023-10-10 21:54:23',NULL,'','0',18,55),
	 (1342,'Noche de Renacimiento. Part 2','2023-07-14-q-bar-noche-de-renacimiento-part-2','2023-07-14',NULL,'22:00:00',NULL,'<p>Hola, amigos!&nbsp;<br><br></p>',NULL,'300.0',1,161,1,'','',false,false,NULL,2,'2023-07-14 05:40:39','2023-10-10 22:02:07',NULL,'','0',18,75),
	 (1343,'Собирание Искр','2023-07-21-pticia-licnost-sobiranie-iskr','2023-07-21',NULL,NULL,NULL,'<p>Молодой Бог шёл вдоль высоких полок и спешно возвращал кабели обратно в разъемы, нажимал какие-то кнопки, проводил пальцами по сенсорам, не терпеливо переругиваясь с кем-то по квантовой связи:<br>- Вернуть их! Вернуть всё, как было...<br>- Ну же! Проснитесь.. Собрать все искры! Единение... - бормотал он.<br>- А вы! А вы сидите дома! , - уже очень внятно произнёс молодой Бог<br>&nbsp;кому-то, старым наверно.</p>',NULL,'0.0',1,4,1,'','',false,false,NULL,2,'2023-07-14 05:46:59','2023-10-25 00:54:38',NULL,'','0',18,104),
	 (1344,'TRAXUAL','2023-07-15-ritmy-traxual','2023-07-15',NULL,'21:00:00',NULL,'<p>Родные мои, в эту субботу на Кожевенной 34 состоится первое лейбл-найт шоу Traxual.<br>На вечеринке выступит основной состав резидентов из Москвы и Санкт-Петербурга при поддержке локальных артистов. Ребята обещают много интересной музыки, лайв выступления и презентацию первой компиляции «Chto Tut Skajesh»</p>',NULL,'0.0',1,181,1,'','',false,false,NULL,2,'2023-07-14 05:52:06','2023-10-17 14:02:53',NULL,'','0',18,89),
	 (1345,'NazloMne','2023-07-14-ritmy-nazlomne','2023-07-14',NULL,'20:00:00',NULL,'<p>Ну что, лето почти на середине своего пути. А это значит, что нужно ускорить веселье-каруселье! В эту пятницу нам помогает электро промо-банда NAZLOMNE. Ребята пропагандируют EBM движуху, ведут подкасты тусовки и все взрослые промо-дела!&nbsp;</p>',NULL,'0.0',1,181,1,'','',false,false,NULL,2,'2023-07-14 05:57:42','2023-10-19 16:57:27',NULL,'','0',18,116),
	 (1346,'WITCH HOUSE RAVE!','2023-07-14-ionoteka-witch-house-rave','2023-07-14',NULL,'23:30:00',NULL,'<p>Грандиозный&nbsp; вичхаус рейв!<br><br></p>',200,'',1,40,1,'','https://vk.com/escvpism',false,false,NULL,2,'2023-07-14 06:06:05','2023-10-22 06:21:25',NULL,'','0',18,225),
	 (1347,'Последний Концерт-Боевик','2023-07-15-port-sevkabel-poslednii-koncert-boevik','2023-07-15',NULL,'20:00:00',NULL,'<p>Сила музыки и мощь трицепсов, удары молнии и грохот сабов: в этот вечер небо разверзнется и обитатели Вальгаллы обратят свой взгляд на каждого из вас.&nbsp;</p>',NULL,'',1,177,1,'','https://avemorguenprtnrs.timepad.ru/event/2489535/',false,false,NULL,2,'2023-07-14 06:12:10','2023-10-25 04:37:25',NULL,'','0',18,113),
	 (1348,'Vaiss в Mixed bar','2023-07-15-mixed-vaiss-v-mixed-bar','2023-07-15',NULL,'22:00:00',NULL,'<p>Вечеринка для любителей минимал звучания, на которой воедино сливаются гипнотический и ритмичный танцевальный грув, глубокий бас и пульсирующий ритм.&nbsp;<br><br>глубокое погружение в электронную музыку all night.&nbsp;</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,2,'2023-07-14 06:19:32','2023-10-10 21:58:31',NULL,'','0',18,77),
	 (1349,'Friday','2023-07-14-mixed-friday','2023-07-14',NULL,'22:00:00',NULL,'<p>Погружение в мир музыки обеспечит Elistratov — убежденный сторонник винилового звучания и давний коллекционер аналоговых носителей звуковой информации.&nbsp;<br>Сформированный с годами опыт постоянного поиска той самой изысканной «интеллектуальной танцевальной музыки» безоговорочно расставляет чёткие приоритеты в отборе эксклюзивной компиляции под каждое мероприятие в сугубо индивидуальном порядке.&nbsp;<br>В каждом сете Elistratov можно моментально распознать его выдержанный годами стиль, где мягкая атмосферно-мелодическая составляющая, эстетично вплетённая в технологическую строгость ритмического рисунка, создаёт неповторимую фигуру полёта структуры его эксклюзивных миксов.<br><br>А составит ему компанию в этот пятничный вечер — товарищ по цеху Pie. Дмитрия можно часто встретить на мероприятиях нашего города и на гастролях во многих городах России.&nbsp;</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,2,'2023-07-14 06:23:43','2023-10-10 21:43:52',NULL,'','0',18,67),
	 (2184,' Qtickets Поиск 2K17','2023-10-21-vnvnc-concert-hall-qtickets-poisk-2k17','2023-10-21',NULL,'23:55:00',NULL,'<p>В эту субботу!<br>Отдыхаем с вами всю ночь, тематика 2К17. Встречаемся в 23:59 на Конюшенной площади, 2В.</p>',300,'',1,50,1,'https://spb.qtickets.events/88398-2k17','',false,false,NULL,2,'2023-10-19 22:23:59','2023-10-25 02:36:54',NULL,'','0',18,30);
