	 (1350,'Homies','2023-07-15-union-homies','2023-07-15',NULL,'22:00:00',NULL,'<p>В субботу вечеринимся под качественную селекцию хип-хопа и электроники на двух сценах Ю. Жаркий коллаб от Homies, сделавших внушительный перерыв длинною почти в год и готовых снова разрывать саундсистемы плотными басами, и Onebus — диллерами максимально танцевальных ритмов разных скоростей и жанров.&nbsp;<br><br>Вход до 23:00 фри, после — 500₽<br>Вход для всех обладателей билетов на St.Petersburg Cocktail Week бесплатный всю ночь после прохождения фейсконтроля.</p>',NULL,'500.0',1,8,1,'','',false,false,NULL,2,'2023-07-14 06:28:21','2023-10-12 07:19:25',NULL,'','0',18,93),
	 (1351,'Atlanta & After - Пляжная вечеринка','2023-07-15-petrusinskii-xutor-atlanta-after-pl','2023-07-15','2023-07-16','14:00:00','22:00:00','<p>Вы знаете, что на афтере мы любим устраивать тематические вечеринки, но в этот раз наша тематика будет уникальной — никто другой в городе не делает подобных вечеринок! И речь идет о нашей ежегодной пляжной тусовке&nbsp;<br><br>Только представь: свежий загородный воздух, озеро, в котором можно поплавать, бар по демократичным ценам, сцена, танцпол, ваша любимая команда диджеев и мс, пляжный волейбол и огромное количество зон с развлечениями…ну что, захотелось присоединиться?<br><br>Отправка от метро Пролетарская сбор у выхода 13:30-14:00, выезд обратно с площадки в 22:00</p>',700,'',1,222,1,'https://spb.qtickets.events/76663-plyazhnaya-vecherinka','',false,false,NULL,2,'2023-07-14 06:50:46','2023-10-25 12:10:27',NULL,'','0',18,234),
	 (1352,'LEILA BIRTHDAY FESTIVAL','2023-07-13-leila-birthday-festival','2023-07-13','2023-07-16','20:00:00','18:00:00','<p>Нам 2 года! По этому случаю устраиваем красивый и шумный 4-х дневный фестиваль, с 13 июля по 16 июля:<br><br>Четверг / 13 июля<br>По традиции четвергов — акустический концерт! Откроет программу фестиваля @aven1k в 20:00, исполнив любимые каверы на террасе с видом на Финский Залив<br><br>Пятница / 14 июля<br>Вечеринка! За музыку и летнее настроение отвечают @juravlove и @myampolskaya (по секретной информации — не обойдемся без музыки Леонида Агутина и Валерия Меладзе).<br>Дресс-код: блестки, перья, шляпы.<br>Начало в 21:00.<br><br>Суббота / 15 июля<br>Уличная ярмарка на террасе с поп-ап станцией со специальными летними коктейлями и поп-ап от цветочных друзей @shalost.studio (которые будут с нами и 16 июля)&nbsp;<br><br>Воскресенье / 16 июля<br>Поп-ап маркет в формате garage-sale от проекта @p.sideforluv с 12:00 до 18:00 под аккомпанемент виниловых пластинок от легендарного @flyhighthedj!<br><br>Встречаем праздник дня рождения и экватор лета вместе!</p>',NULL,'0.0',1,223,3,'','',false,false,NULL,2,'2023-07-14 07:02:36','2023-07-14 12:25:10',NULL,'','0',18,2),
	 (1353,'AVG','2023-07-14-trete-mesto-avg','2023-07-14',NULL,'20:00:00',NULL,'<p>Коктейльная неделя в разгаре! Планы на эту неделю — пить коктейли и танцевать до утра. Но самое сладкое, конечно, оставили напоследок — вечеринка AVG в эту пятницу! Весь гэнг в полном составе и наши друзья ЛАУД</p>',NULL,'',1,224,1,'','',false,false,NULL,2,'2023-07-14 07:14:45','2023-10-23 12:42:33',NULL,'','0',18,195),
	 (1354,'ЛАУД - Уличная Классика','2023-07-15-most-vetantura-laud-ulicnaia-klassika','2023-07-15',NULL,'18:00:00',NULL,'<p>Хэдлайнер. ЛАУД. Уличная Классика СПБ<br>Мост «Бетанкура»<br><br>Вечерний качовый движ прямо на площадке - это лучшее, что может произойти с нами в эту субботу.</p>',NULL,'0.0',1,225,1,'','',false,false,NULL,2,'2023-07-14 07:23:09','2023-10-11 17:18:05',NULL,'','0',18,142),
	 (1355,'Bakt Birthday Party','2023-07-14-motyga-bakt-birthday-party','2023-07-14',NULL,'20:00:00',NULL,'<p>Объединение НУЛЬ 21 продолжает радовать гостей новыми вечеринками, и на этот раз у команды особенное событие. В эту пятницу приглашают каждого, чтобы отметить День Рождение хорошего человека и одного из основателей объединения - Андрея bakt<br><br>Все соберутся в дружной компании, окруженной громкой музыкой, чтобы отпраздновать этот особенный день. Под сеты от друзей и резидентов, будут наслаждаться яркой атмосферой праздника, а также готовить вкусные шашлыки</p>',NULL,'0.0',2,114,1,'','',false,false,NULL,2,'2023-07-14 09:56:54','2023-09-07 18:55:05',NULL,'','0',18,41),
	 (1356,'Friday Night x Celebrity Cup','2023-07-14-deep-fried-friends-friday-night-x-celeb','2023-07-14',NULL,'00:00:00','05:00:00','<p>В эти выходные в ресторане DFF пройдет событие в коллаборации с Московским Кубком Селебрити (МКС) — нашумевшим медиафутбольным турниром, который называют “медийной Лигой Чемпионов”. Все выходные в ресторане будут восхвалять футбол, раздавать пасы и забивать голы, пить специальные коктейли и шоты, и, конечно же, танцевать.<br>До 1:00 - 500₽; до 3:00 - 1000₽; до 5:00 - free</p>',500,'1000.0',2,76,1,'','',false,false,NULL,2,'2023-07-14 10:06:06','2023-09-20 03:50:21',NULL,'','0',18,83),
	 (1357,'Saturday Night','2023-07-15-deep-fried-friends-saturday-night','2023-07-15','2023-07-16','00:00:00','05:00:00','<p>В эти выходные в ресторане DFF пройдет событие в коллаборации с Московским Кубком Селебрити (МКС) — нашумевшим медиафутбольным турниром, который называют “медийной Лигой Чемпионов”. Все выходные в ресторане будут восхвалять футбол, раздавать пасы и забивать голы, пить специальные коктейли и шоты, и, конечно же, танцевать. В лайн-апе вечеринки сеты настоящих чемпионов</p>',500,'1000.0',2,76,1,'','',false,false,NULL,2,'2023-07-14 10:15:01','2023-10-24 20:59:48',NULL,'','0',18,62),
	 (1361,'Ketch Up!','2023-07-14-ketch-up-ketch-up','2023-07-14',NULL,'23:00:00',NULL,'<p>Каждую пятницу и субботу Ketch Up на Кузнецком Мосту превращается в место притяжения любителей музыки, коктейлей и танцев до утра. Начало в 23:00, вход свободный с деликатным фейсером</p>',NULL,'0.0',2,227,1,'https://msk.ketch-up.ru/action/raspisaniye-vechernikh-setov-v-ketch-up-na-kuznetskom-mostu','',false,false,NULL,2,'2023-07-14 16:07:16','2023-10-21 19:58:40',NULL,'','0',18,46),
