	 (1364,'Funk You! Breaks vs Jungle','2023-07-21-roof-place-funk-you-breaks-vs-jungle','2023-07-21','2023-07-22','23:30:00','06:00:00','<p><br>Этой ночью устроим рейв! Чтобы наконец-то мощно оторваться, отдохнуть и получить удовольствие от музыки. Это будет вечеринка, полная веселья и колорита!</p><p><br></p><p>Ритм позволяет многим сердцам биться вместе, как одно целое!</p><p>Вся наша команда с нетерпением ждет вас в Roof Place 21ого июля.&nbsp;</p><p>Следующая вечеринка не скоро. Не пропусти встречу!</p>',700,'',1,176,1,'https://funk-you.timepad.ru/event/2484297/','https://t.me/funkyouspb',false,false,NULL,2,'2023-07-18 00:00:01','2023-10-22 06:18:00',NULL,'','0',18,195),
	 (1366,'Popoff Kitchen XXL','2023-07-22-mutabor-popoff-kitchen-xxl','2023-07-22',NULL,'23:00:00',NULL,'<p>Желтая пресса напишет: колкий бит, едкий дым, сомнительные личности, шокирующие откровения. Команда даст волю злым языкам и порадует публику грязными подробностями<br><br>3 жарких танцпола, даркрум, развязные гости. Копите силы!</p>',1500,'',2,2,1,'https://popoffxxl.ticketscloud.org/','',false,false,NULL,2,'2023-07-18 00:18:02','2023-10-18 09:23:35',NULL,'','0',18,322),
	 (1367,'Fat Vibez Records','2023-07-22-macty-fat-vibez-records','2023-07-22',NULL,'21:00:00',NULL,'<p>Мачтах состоится классическая вечеринка от лейбла Fat Vibez Records, с расширенным составом артистов на двух танцполах клуба. Главным событием ночи станет презентация альбома Outselect - Special Signals.&nbsp;<br><br>Летний вайб и морской бриз финского залива приятно дополнят атмосферу вечеринки, в сочетании с жирными вибрациями.&nbsp;<br>Резиденты и друзья лейбла представят полный спектр звучания британского андеграунда</p>',500,'',1,9,1,'https://spb.radario.ru/events/1966408','https://t.me/fatvibezrecords',false,false,NULL,2,'2023-07-18 00:24:38','2023-10-10 21:39:48',NULL,'','0',18,93),
	 (1368,'BE HIGH showcase ','2023-07-21-gestalt-be-high-showcase','2023-07-21',NULL,'22:00:00',NULL,'<p>Атмосферность события сформирует дуэт BE HIGH в составе из участников Александра Прохорова и Павла Рожнова, с некоторыми, ранее не звучавшими релизами, которые сделают вас заложниками танцев. &nbsp;<br>Не менее яркий представитель электронной сцены - Никита Стеблин, известный как MONKEY FISH, дополнит картину оригинального звучания нотами своего фирменного стиля. &nbsp;<br>И мастер хаус-сцены, погружающий в её истинные объятия, представитель лейбла HIGHWAY&nbsp; - Peter Lankton. &nbsp;</p>',NULL,'',2,126,1,'','https://t.me/highwayevent',false,false,NULL,2,'2023-07-18 04:06:59','2023-10-11 22:08:37',NULL,'','0',18,91),
	 (1369,'OBERWAVE','2023-07-22-slezy-oberwave','2023-07-22',NULL,'18:00:00',NULL,'<p>Давай вечером с тобой встретимся...&nbsp;<br><br>В эту субботу тестируем «вечерний» формат вечеринок, на этот раз в баре Слезы (https://t.me/slozy_bar) — том самом, что соседствует с клубом Aglomerat.&nbsp;<br><br>Для тех, кто давно хотел попасть на Обервейв, но привык спать по ночам — это ваш шанс. Остальным напомню, что в августе уходим в отпуск и планируем только шоукейс на Сигнале, других вечеринок, скорее всего, не будет.&nbsp;</p>',500,'',2,102,1,'https://moscow.qtickets.events/78136-2207-oberwave-at-slezy','',false,false,NULL,2,'2023-07-18 04:20:36','2023-10-22 07:14:24',NULL,'','0',18,86),
	 (1370,'Neuropunk Session','2023-08-05-factory-3-neuropunk-session','2023-08-05',NULL,'23:55:00',NULL,'<p>Друзья! Публикуем Line - up предстоящей вечеринки</p>',700,'',1,7,1,'https://spb.qtickets.events/77198-neuropunk-session-at-factory-spb','https://vk.com/nrpnkssn',false,false,NULL,2,'2023-07-18 04:30:23','2023-10-24 08:24:46',NULL,'','0',18,202),
	 (1371,'Legal''naya ','2023-07-29-blank-legalnaya','2023-07-29',NULL,'22:00:00',NULL,'<p>На мейне — масштабная застройка, где девственные джунгли обвивают металлоконструкции, а плотная бочка обхаживает недетское электро.<br>На золотом — чилл, бильярд, поэтические перформансы и секретный гость, о котором позже.</p>',1500,'',1,1,1,'','https://blankclub.ru',false,false,NULL,2,'2023-07-18 04:41:28','2023-10-24 22:02:28',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,210),
	 (1372,'Mexican Friday ','2023-07-21-suba-bar-mexican-friday','2023-07-21','2023-07-22','21:00:00','03:00:00','<p>Привет Зацени&nbsp;</p><p>Ола Ола Ола !!</p><p>Маргарита в шоке... То есть в шоте.</p><p>Сочные тако .... И звуки маракасов ....<br>Все верно!&nbsp;</p><p>21-го июля в пятницу в Шуба бар пройдет мексиканский стол.&nbsp;</p><p>Если вы не попали к нам нам в прошлый раз. У вас появилась эта возможность вновь.&nbsp;</p><p>Ну и по традиции вечер наполнится латиноамериканскими песнями плавно перетекая в современную электронную сессию.</p>',NULL,'',1,205,1,'','',false,false,NULL,2,'2023-07-18 20:55:36','2023-10-16 21:15:18',NULL,'','0',18,50),
	 (1373,'In-Beat-Ween - Шестилетие программы ','2023-07-21-simach-in-beat-ween-sestiletie-progra','2023-07-21',NULL,'23:00:00',NULL,'<p>Программа In-Beat-Ween на радио «Серебряный дождь» празднует шестилетие.&nbsp;<br>Всё это время шоу знакомило слушателей с редкой танцевальной музыкой мира.<br>Как вы можете знать, шоу In-Beat-Ween стартовало&nbsp; весной 2017 года и каждую среду в 21:00 продолжает знакомить меломанов с самой эксклюзивной, душевной и редкой танцевальной музыкой мира, находя баланс между последними трендами звукозаписи и вечной классикой, а также попутно открывая новые таланты.<br><br></p>',NULL,'0.0',2,165,1,'','',false,false,NULL,2,'2023-07-19 02:19:59','2023-09-26 16:03:39',NULL,'','0',18,79);
