	 (1379,'Temple De Plastique','2023-07-21-prostranstvo-pole-temple-de-plastique','2023-07-21',NULL,'23:00:00',NULL,'<p>Главные правила этой ночи — открытость и принятие. <br>Temple de plastique — это симбиоз искренности, свободы и безграничной любви в полевом антураже&nbsp;<br><br></p>',1000,'',2,46,1,'https://live.mts.ru/moscow/concerts/vecherinka-temple-de-plastique','https://t.me/eto_polye',false,false,NULL,2,'2023-07-19 03:16:53','2023-10-22 16:18:50',NULL,'','0',18,82),
	 (1380,'Пятница - Sengiley Wax x Takt','2023-07-21-bar-strelka-piatnica','2023-07-21',NULL,'23:00:00',NULL,'<p>Ухватить музыкальное лето за хвост можно на этих и всех следующих выходных сезона в нашем дворике.<br><br>В пятницу танцуем с резидентами и основателем лейбла Sengiley Wax — за пультом Денис Казаков, Moonoton и BRTS. Для всех, кто не в Москве, российско-израильский проект «Такт» организует прямую трансляцию, так что насладиться отличной музыкой можно будет из любой точки планеты.</p>',NULL,'0.0',2,103,1,'','https://t.me/strelkabarmoscow',false,false,NULL,2,'2023-07-19 03:23:08','2023-09-30 23:19:35',NULL,'','0',18,47),
	 (1381,'Techno Haters Night','2023-07-22-bar-strelka-techno-haters-night','2023-07-22',NULL,'23:00:00',NULL,'<p>Ухватить музыкальное лето за хвост можно на этих и всех следующих выходных сезона в нашем дворике.<br>В субботу ждём на вечеринке паблика Techno Haters, на который арт-дирекция «Стрелки» и все уважаемые меломаны страны подписаны уже очень давно.&nbsp;</p>',NULL,'0.0',2,103,1,'','http://t.me/techno_haters',false,false,NULL,2,'2023-07-19 03:35:04','2023-10-08 17:08:41',NULL,'','0',18,137),
	 (1382,'CRYSTAL CASTLES NIGHT','2023-07-22-rndm-crystal-castles-night','2023-07-22',NULL,'23:00:00',NULL,'<p>В эту ночь прозвучит обширная подборка музыки, включая хиты и редкие треки группы Crystal Castles. Мы будем играть ремиксы на их популярные песни, а также музыку, вдохновленную творчеством группы.</p><p>&nbsp;</p><p>Это отличный шанс для поклонников Crystal Castles насладиться их музыкой в новом формате и встретиться в живую с единомышленниками. Вечеринка пройдет в формате диджей-сетов с использованием мощнейшей звуковой системы FUNKTION-ONE.</p>',850,'',2,27,1,'https://nedostupnost.timepad.ru/event/2444310/','',false,false,NULL,2,'2023-07-19 03:39:24','2023-10-24 07:30:48',NULL,'','0',18,122);
