	 (1383,'Synchron PART II','2023-07-22-prostranstvo-pole-synchron-part-ii','2023-07-22',NULL,'16:00:00',NULL,'<p>&nbsp;Мультиформатное событие по случаю выпуска 2-ой компиляции авторской электроники от одноименного лейбла Synchron.&nbsp;<br>&nbsp;На этот раз объединение обещает раздать плотного танцевального грува на 2-х танцполах пространства "Поле" и приглашает в лайн-ап всех участников компиляции.<br>Вечеринка начнется с 14:00 дня. В лучших традициях Синхрона - каждый найдет музыку по душе. От легкой и солнечной электроники днем до бесперебойного техно ночью!<br><br></p>',600,'',2,46,1,'https://synchron-event.timepad.ru/event/2492140/','',false,false,NULL,2,'2023-07-19 03:53:56','2023-10-24 03:39:34',NULL,'','0',18,86),
	 (1384,'САНАТОРИЙ РАДУГА x КЛМ','2023-07-22-blanc-sanatorii-raduga-x-klm','2023-07-22',NULL,'18:00:00',NULL,'<p>Вечеринка диско-клуба «Радуга» совместно с петербургской командой «Клуб любителей музыки» в переднем дворе ресторана Blanc. <br>Ночью тусовка переместится внутрь заведения</p>',1500,'',2,36,1,'https://live.mts.ru/moscow/privileges/sanatoriy-raduga','',false,false,NULL,2,'2023-07-19 04:03:31','2023-10-23 19:15:32',NULL,'','0',18,154),
	 (1385,'ЭБА: 40','2023-07-28-ritmy-eba-40','2023-07-28',NULL,'21:00:00',NULL,'<p>Ребятишки, у Ромки Редмана 24 июля будет День Рождения. Моему бородатому пупсу треснет 40 лет.<br>Отмечать в сам день он конечно же по всем народным поверьям не будет, а вот 28 июля очень даже!<br>На это событие даже ворвется Саня Шулико из группы ХЛЕБ с дискджоккейским сетом!<br><br>На гриле всю ночь будут вертеться сосисочки</p>',NULL,'0.0',1,181,1,'','',false,false,NULL,2,'2023-07-19 04:09:45','2023-10-10 22:15:47',NULL,'','0',18,130),
	 (1395,'Boat Party at Warpp Club','2023-07-29-warpp-boat-party-at-warpp-club','2023-07-29','2023-07-29','18:00:00','22:00:00','<p>29.07 - Boat Party at Warpp Club<br><br>Warpp Boat Party - это не просто музыкальное событие, это опыт, который запомнится надолго.&nbsp;<br>Мы будем плавать по прекрасной Неве 4 часа, под музыку любимых резидентов</p>',2500,'',1,23,1,'https://boatparty.ticketscloud.org/','https://warppclub.com',false,false,NULL,2,'2023-07-19 12:55:50','2023-10-20 00:09:34',NULL,'','0',18,172),
	 (1386,'Flip Flap* OPEN DECKS','2023-07-30-ritmy-flip-flap-open-decks','2023-07-31','2023-07-31','16:00:00','00:00:00','<p>Мы продолжаем искать таланты и даём возможность проявить себя! Как и обещали, в этот раз пойдем еще дальше. Мы посвятим нашему «открытому столу» целый вечер и позовем гостей из музыкальной индустрии Санкт-Петербурга. Жанровых ограничений нет. Хотите играть рэп — пожалуйста, хотите электронику — ю а велком, D&amp;B — ваше право.<br><br>Вместе с гостями мы определим трех победителей, которые станут участниками большого мероприятия в конце августа в Ритмах.&nbsp;<br>Жюри:<br>Grinkop (Ритмы, Грани)<br>The Villars (FLIP FLAP)<br>ODDDI (Salute Honey, FLIP FLAP)<br>Denis Yuzhin (Vibe Room)<br>Coubraque (Vibe Room)</p>',NULL,'0.0',1,181,1,'','',false,false,NULL,2,'2023-07-19 04:16:31','2023-10-11 13:56:41',NULL,'','0',18,98),
	 (1387,'CIÉL 365 OPEN AIR','2023-07-22-ritmy-ciel-365-open-air','2023-07-22',NULL,'21:00:00',NULL,'<p>В эту субботу ребятки из CIÉL гуляют на широкую!<br>Ведь им можно — они в эфире целый год! Это уже огромный результат и радостный праздник.<br>Обещают кучу музона, секси-шмекси, напитки, розыгрыш денег, салют!&nbsp;<br>Начнут за диско, а закончат за хардстайл!&nbsp;<br><br></p>',NULL,'0.0',1,181,1,'','',false,false,NULL,2,'2023-07-19 06:05:11','2023-10-25 11:49:06',NULL,'','0',18,169),
	 (1388,'Sun Spirit VII: Community','2023-07-20-derevnia-orexovo-sun-spirit-vii-communi','2023-07-20','2023-07-23','13:00:00','13:00:00','<p>Арт-кемпинг посвященный исследованию музыки и искусство в природных ландшафтах ждет тебя</p><p>20-23 июля 2023 - новое место в 240 км (Новая Рига) от Москвы, Деревня Орехово, Ржевский район (Успенское поселение), Тверская область - парк интерактивного отдыха "Тория"</p><p>4 дня, 3 ночи наполненные впечатлениями и позитивными вибрациями!</p><p>5 музыкальных пространств и более 100 артистов, научный лекторий, кинотеатр, школа танцев и театр, ярмарка мастеров и мастерклассы, площадка здоровья.</p><p>Та самая атмосфера и вайб, в которые хочешь погрузиться и ждешь весь год, создаешь сам и вместе с нами!</p><p><br><br></p>',6000,'',2,229,3,'https://events.sunspiritgroup.ru/','',false,false,NULL,2,'2023-07-19 10:49:30','2023-10-24 22:07:02',NULL,'','0',18,218),
	 (1389,'Hotel California vol.`4','2023-07-21-rooftop-hotel-california-vol4','2023-07-21',NULL,'18:00:00',NULL,'<p>Основной движ начнётся в 18.00 и закончится в районе часа ночи, но для всех страждущих продолжения обещано афтепати на десерт</p>',1000,'',1,201,1,'https://spb.qtickets.events/77846-hotel-california-epizod-14','',false,false,NULL,2,'2023-07-19 11:19:10','2023-10-24 21:32:49',NULL,'','0',18,173),
	 (1390,'АБСУРД','2023-07-21-rndm-absurd','2023-07-21',NULL,'23:00:00',NULL,'<p>Двадцать первого июля, в пятницу, создали для вас новый Absurd, с абсурдными условиями для посещения. С 23:00 до 00:00 можно зайти вдвоём за 500 рублей.&nbsp;<br><br>Собрали для вас самых любимых и интересных артистов из Санкт-Петербурга и Москвы</p>',500,'',2,27,1,'','',false,false,NULL,2,'2023-07-19 11:23:51','2023-10-20 14:05:58',NULL,'','0',18,156),
	 (1391,'Cruise x Mirage','2023-07-21-miraz-cruise-x-mirage','2023-07-21',NULL,'23:30:00',NULL,'<p>так ну походу пора объявлять планы на выходные&nbsp;<br><br>в эту пятницу часть нашей банды отправится в плавание вместе с нашими друзьями из кузни, всем желающим отправиться с нами, милости просим по ссылке</p>',2500,'',1,234,1,'https://kuznyahouse.ru/cruise','',false,false,NULL,2,'2023-07-19 11:29:25','2023-10-21 07:25:27',NULL,'','0',18,95);
