	 (1392,'Мираж','2023-07-21-miraz-miraz','2023-07-21',NULL,'00:00:00',NULL,'<p>так ну походу пора объявлять планы на выходные, для всех остальных наших братиков и сестер клуб будет работать с 00:00 в КЛАССИЧЕСКОМ режиме (есть шанс занять летку до приезда синих мореплавателей)</p>',NULL,'0.0',1,77,1,'','https://t.me/miragebar',false,false,NULL,2,'2023-07-19 11:32:52','2023-10-21 13:58:40',NULL,'','0',18,86),
	 (1393,' Eurotrip','2023-07-22-griboedov-eurotrip','2023-07-22',NULL,'22:00:00',NULL,'<p>С сумасшедшей скоростью летим по всей Европе, от Стокгольма и Берлина, до Парижа и Лондона, и все это за одну ночь ! Главное пристегнуться, иначе можно улететь...<br><br>Первая остановка — Амстердам. В этом живописном месте как всегда замечательно: приятная атмосфера, хорошая музыка, приятные люди и отличный бар. Прибываем в 20:00, где будем изучать и оценивать разнообразие европейской электронной сцены. Если понравится, то оставим вас там до 06:00.&nbsp;<br><br>Но а для тех кто реально готов прокатиться с ветерком под помповую бочку, свежий брейк и пленяющий транс — будем ждать в подвале Basement, с 22:00 до самого утра.&nbsp;<br><br>Have a nice trip&nbsp;</p>',NULL,'600.0',1,86,1,'','https://t.me/griboedovbasement',false,false,NULL,2,'2023-07-19 11:40:30','2023-10-23 16:05:49',NULL,'','0',18,124),
	 (1394,' SWAPP X WHAT’$ CRACKIN ','2023-07-21-griboedov-swapp-x-what-crackin','2023-07-21',NULL,'20:00:00',NULL,'<p>SWAPP вместе с командой WHAT’$ CRACKIN, подготовили совместную вечеринку, где они представят для вас свежих игроков новой школы. В 18:00 начинаем движение в Amsterdam, где пройдет турнир по NBA 2K Будет BBQ, бильярд, заряженный бар и атмосфера полного кайфа с качественным саундом.<br><br>В 20 откупориваем подвал, где ребята собрали для вас лучших уличных игроков. After Luv — выступит с презентацией нового EP. MOSQUIT — янгбой, уже по-классике будет прокачивать Грибоедов, а так же мы откроем для вас нового артиста ARSMOKE.</p>',NULL,'700.0',1,86,1,'','',false,false,NULL,2,'2023-07-19 11:51:55','2023-10-10 21:34:31',NULL,'','0',18,107),
	 (1396,'WARPP - заключительная пятница на Литейном','2023-07-21-warpp-warpp-zakliucitelnaia-piatnica-na','2023-07-21',NULL,'23:00:00',NULL,'<p>Дорогие друзья, на этот раз уже точно, заключительная пятница пройдет в стенах клуба Warpp на литейном 53&nbsp;<br><br>Ждем вас, чтобы насладиться музыкальным настроением от наших резидентов:&nbsp;<br>Bagus / Gaidana / Qdream<br><br>Списки на сайте&nbsp;</p>',NULL,'1000.0',1,23,1,'','https://warppclub.com',false,false,NULL,2,'2023-07-19 13:05:10','2023-10-24 18:51:56',NULL,'','0',18,64),
	 (1397,'Last Night Warpp','2023-07-22-warpp-last-night-warpp','2023-07-22',NULL,'23:00:00',NULL,'<p>Наш клуб Warpp готовится к закрытию локации. Еще одна возможность провести LOVESCHOOL в стенах клуба на литейном 53&nbsp;<br>Это огромная и прекрасная история любви, музыки и гармонии. Ждем вас друзья, в эту субботу на особую, торжественную ночь<br>На протяжении всей ночи K Loveski со своим 6 часовым сетом.</p>',NULL,'1000.0',1,23,1,'','https://warppclub.com',false,false,NULL,2,'2023-07-19 13:29:56','2023-10-25 11:32:16',NULL,'','0',18,105),
	 (1398,'MONASTERIO HARD NIGHT','2023-08-04-mutabor-monasterio-hard-night','2023-08-04','2023-08-05','23:00:00','00:00:00','<p>Monasterio представляет самый жесткий лайнап в своей истории: три всадника апокалиптичного техно-звучания станут хедлайнерами MONASTERIO HARD NIGHT 4 августа в Mutabor.<br>Впервые выступит в России BΛNDI — один из лучших перформеров недавнего Monasterio Italy; фирменный стиль артиста — настоящий хардкортехно-романс! Другой дебютант JAPAU — один из самых брутальных индастриал-артистов не только родной Германии, но и всего мира. Хорошо знакомая нам француженка EASTEL — владелица знаменитого лейбла Heart''s Whispers — выбрала для мировой премьеры своего первого лайва именно Monasterio. Поддержат зарубежных гостей на главной сцене триумфаторы нашего выезда в Италию: CHAIN DAMAGE, GEMÜT и KYK, а откроет сцену дуэт SUB IMPERIUM.<br>Сцена Medium по традиции будет отдана на растерзание любимым резидентам и близким друзьям Monasterio. Отметим live с шести дек от MAIN SNIFFER ENGINEER, возвращение SHABALINA и призовой b2b для самых выносливых.<br>Уличная сцена Garden примет шоукейс наших давних друзей TECHNO ROOM из Екатеринбурга. Вновь оживет любимый многими танцпол Under: в темных низинах будет собран состав из новых имен, а также проверенных бойцов — ROKS и PROTOTYPE 03/4.</p>',2200,'',2,2,1,'https://monasterio.moscow/','https://monasterio.moscow/',false,false,NULL,2,'2023-07-19 13:46:35','2023-10-25 15:41:42',NULL,'','0',18,355),
	 (1399,'Joezi (Israel)','2023-07-22-community-moscow-joezi-israel','2023-07-22',NULL,'21:00:00',NULL,'<p><br>Суббота. 22 июля, клуб Community Moscow, CRRCT VIEW и ZERKALO project представляют: Joezi (Israel)!<br>&nbsp;<br>Главный хитмейкер этого лета или как его называют - Израильский Black Cofee.<br>Символ молодой жизни, эпатажный и знаменитый на весь мир Joezi, ворвётся на вечеринку лейбла CRRCT VIEW, с хитом 7 seconds!&nbsp;<br>Артист, который не нуждается в представлении…<br>От Ибицы до Майамии и от Миконоса до Тулума, этот парень покорил все самые лучшие вечеринки, о которых только можно мечтать!&nbsp;<br>И вот 22 июля, он выступит в Community Moscow, на вечеринке от CRRCT VIEW &amp; ZERKALO project.<br>Стань участником главного события этого лета!<br>Суббота. 22 июля, клуб Community Moscow, JOEZI!</p>',2500,'',2,58,1,'https://joezi.ticketscloud.org/','',false,false,NULL,2,'2023-07-20 16:42:21','2023-10-09 08:08:16',NULL,'','0',18,105),
	 (1400,'Рокошовит','2023-07-21-lachesis-rokosovit','2023-07-21',NULL,'20:00:00',NULL,'<p>Второй фест Рокшовит. Вечер откроется свежими инди и фанки лайвами от Любить, Canvil и Причудилось<br><br>Также уходить в жаркую ночь будут в компании звезд Москвы, Питера и Ярославля</p>',NULL,'0.0',2,121,1,'','',false,false,NULL,2,'2023-07-21 09:39:19','2023-10-05 11:31:48',NULL,'','0',18,74),
	 (1401,' БЭКЯРД23 ','2023-07-21-onegin-dvor-bekiard23','2023-07-21',NULL,'23:00:00',NULL,'<p>Для торжественного открытия ребята подобрали команду талантливых ди-джеев, которые отправят всех в музыкальное путешествие, наполняя воздух заразительными ритмами, заставляя двигаться всю ночь напролет. Приготовьтесь раствориться в танце и позволить музыке направлять каждый ваш шаг.</p>',NULL,'300.0',1,230,1,'','',false,false,NULL,2,'2023-07-21 09:45:47','2023-10-25 14:18:54',NULL,'','0',18,86),
	 (1402,'ECSTATIC DANCE FESTIVAL WILD','2023-08-17-gorkovskoe-more-ecstatic-dance-festiva','2023-08-17','2023-08-20','16:00:00',NULL,'<p>На берегу реки Волги из-за рубежа и со всей России соберутся лучшие международные и российские экстатик диджеи, музыканты живой музыки, певцы, ведущие телесных и танцевальных практик, мастера творчества и самовыражения. И все это под открытым небом во время самой теплой августовской погоды!</p>',8000,'',8,231,3,'','https://ecstaticdancerussia.ru/',false,false,NULL,2,'2023-07-21 11:19:18','2023-10-18 12:53:15',NULL,'','0',18,88);
