	 (1413,'Funky Shit - Фанки Шит','2023-07-21-macty-funky-shit-fanki-sit','2023-07-21',NULL,'20:00:00',NULL,'<p>Dj и продюссер Paul Sitter презентует в Мачтах свой лонгплей Hip-Hop Delivery.<br>Виниловый кавалер почетного ордена 7 дюймов, Пола знают во всех уголках Земли. Все, кто играет и слушает семидюймовые пластинки, ценит фанк, брейк-бит и биг-бит, не только слышали работы Пола, но часто даже имеют в коллекции его пластинки, которые регулярно выпускаются в Бельгии, Дании, Великобритании, Германии, а так же на собственном лейбле Пола Funky Shit Edits.</p>',NULL,'0.0',1,9,1,'','',false,false,NULL,2,'2023-07-21 16:12:47','2023-10-19 15:17:55',NULL,'','0',18,65),
	 (1414,'140:175 / DUBSTEP VS DNB','2023-07-21-hops-mustache-140175-dubstep-vs-dnb','2023-07-21','2023-07-22','19:00:00','02:00:00','<p>В эту жаркую пятницу Питер станет эпицентром битвы двух EDM-титанов!<br>В левом углу ринга: резиденты deathstep-лейбла Murder The Crowd. Борцы-тяжеловесы со всех уголков России, готовые показать, что Tearout и Deathstep не только живы, но и готовы испепелить любую сцену!<br>В правом углу ринга: Jump Up Crew - мастера боевого искусства жанров Drum''n''Bass и Jump Up. Из самых недр андеграунда сенсеи динамичных воблов и острых драмок вырвутся на поверхность!</p>',NULL,'',1,144,1,'','',false,false,NULL,2,'2023-07-21 16:23:18','2023-10-22 04:52:02',NULL,'','0',18,139),
	 (1415,'Shutta','2023-07-21-technodoner-shutta','2023-07-21','2023-07-21','20:00:00','22:00:00','<p>Петербургский dj и музыкант, незаменимый резидент roots united и куратор проекта music camp. без него не обходится ни одно значимое музыкальное событие двух столиц, благодаря его умению гармонично компилировать разные жанры в своих выступлениях.</p>',NULL,'0.0',1,194,1,'','',false,false,NULL,2,'2023-07-21 16:29:39','2023-10-24 22:27:34',NULL,'','0',18,82),
	 (1416,'Kefir - Пятница','2023-07-21-restobar-matiss-kefir','2023-07-21','2023-07-21','20:00:00','23:00:00','<p>У нас в гостях счастливый диск-жук Кефир со своей коллекцией виниловых пластинок&nbsp;</p>',NULL,'0.0',1,159,1,'','',false,false,NULL,2,'2023-07-21 16:34:35','2023-10-23 00:46:23',NULL,'','0',18,98),
	 (1417,'MTV Party','2023-07-21-grani-mtv-party','2023-07-21',NULL,'22:00:00',NULL,'<p>Микки Lovejoy снова у нас в гостях с MTV вечеринкой, так что вспоминаем все хиты мьюзик телевижен, пьём, наслаждаемся летом!<br><br>Всем велком</p>',NULL,'0.0',1,197,1,'','',false,false,NULL,2,'2023-07-21 16:39:58','2023-10-19 05:45:36',NULL,'','0',18,91),
	 (1418,'Salute Honey','2023-07-22-union-salute-honey','2023-07-22',NULL,'22:00:00',NULL,'<p>Вам знакомо чувство, когда давно не видел старого друга, не по причине ссоры или обиды, просто каждый живет своей жизнью, занимается своими делами, пьет кофе на излюбленной террасе по вечерам, и вы не забыли про него, нет: вы явно думаете друг о друге on a daily basis, и в голове четкая мысль - какую бы ты авантюру ему не предложил, он охотно на нее согласится, а, скорее всего, еще и друзей позовёт?&nbsp;<br><br>Нам - знакомо. Мы всегда испытываем его с вами, и вот, спустя разлуку, длиной в месяц, ждём вас на танцы, разговоры до утра, крепкие объятия и хорошую музыку (с этим у нас все стабильно).</p>',0,'',1,8,1,'','',false,false,NULL,2,'2023-07-21 16:46:57','2023-10-20 15:51:20',NULL,'','0',18,131),
	 (1430,'DUB Laundry','2023-07-22-stirka40-dub','2023-07-22',NULL,'23:00:00',NULL,'<p>В субботу 22го июля запускаем даб стирку в @stirka40 на Казанской 26. Легко избавляемся от пятен будних дней и восстанавливаем добрый вайб.</p>',NULL,'0.0',1,14,1,'','',false,false,NULL,2,'2023-07-21 18:16:30','2023-10-24 19:01:31',NULL,'','0',18,80),
	 (1419,'Класс Музыки','2023-07-22-union-klass-muzyki','2023-07-22',NULL,'21:00:00',NULL,'<p>Разлучаться с Salute Honey больше чем на месяц не представляется возможным: слишком грустно. Поэтому, вот они — мы, на летнике U в субботу, снова танцующие, подпевающие, резвящиеся на потеху близких по духу. Из бонусов предстоящей ночи: дивное пение Элины Духовной и танцевальный шоукейс от Skvirya &amp; Co. <br>Хип-хоп, бэйли, афробит, поп, гэридж и другое.<br><br>В зале — ученики нашей школы Класс Музыки бок-о-бок с профиками. Жанровый диапазон — широкий, танцевальная электроника от медленной до быстрой.&nbsp;</p>',NULL,'',1,8,1,'','https://klassmuziki.ru/',false,false,NULL,2,'2023-07-21 16:56:20','2023-10-23 02:26:13',NULL,'','0',18,139),
	 (1420,'Saturday ','2023-07-22-mixed-saturday','2023-07-22',NULL,'22:00:00',NULL,'<p>Не успели оглянуться, как лето перевалило за экватор. в грядущую субботу танцуем и радуемся хорошей погоде на самом горячем бэк ту бэке этого лета all night long</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,2,'2023-07-21 17:04:13','2023-10-24 21:31:18',NULL,'','0',18,70),
	 (1421,'Welcome New Membe','2023-07-21-q-bar-welcome-new-membe','2023-07-21',NULL,'23:00:00',NULL,'<p>Первый этап кастинга резидентов позади:<br><br>мы очень рады пополнению в нашей большой музыкальной&nbsp; и быстрорастущей семье и хотим скорее все познакомиться поближе!<br><br>Вход-свободный<br>не упустите возможность услышать новый пул музыкальных жанров и зарядиться творчеством в стенах ку от наших резидентов!</p>',NULL,'0.0',1,161,1,'','',false,false,NULL,2,'2023-07-21 17:09:32','2023-10-20 18:16:03',NULL,'','0',18,48);
