	 (1422,'Happy Birthday Q','2023-07-22-q-bar-happy-birthday-q','2023-07-22',NULL,'19:00:00',NULL,'<p>Звездный состав наших любимчиков!<br><br>Вот они, слева направо, те что заряжали Ку энергией на протяжении года вместе с нами</p>',NULL,'0.0',1,161,1,'','',false,false,NULL,2,'2023-07-21 17:14:52','2023-10-16 16:34:49',NULL,'','0',18,86),
	 (1423,'Owen Pitch','2023-07-22-technodoner-owen-pitch','2023-07-22','2023-07-22','20:00:00','22:00:00','<p>Kирилл играл у нас в денёрной месяц назад, но, увы, запись его сета, по техническим причинам, не состоялась. а мы бесконечно хотим её в нашу youtube коллекцию, чтобы перманентно кайфовать от его плотного и рельефного саунда.</p>',NULL,'0.0',1,194,1,'','',false,false,NULL,2,'2023-07-21 17:21:33','2023-10-13 08:27:37',NULL,'','0',18,84),
	 (1424,'Vinyl Only','2023-07-22-hops-mustache-vinyl-only','2023-07-22','2023-07-23','21:00:00','04:00:00','<p>Виниловый уют и вкуснейший крафт.<br><br>За вертушками Мэтры своего дела<br>Ждём тебя вечером в субботу 22 июля.<br>Первую пластинку ставим в 21-00<br>Вход свободный.</p>',NULL,'0.0',1,144,1,'','',false,false,NULL,2,'2023-07-21 17:25:34','2023-10-22 04:13:06',NULL,'','0',18,92),
	 (1425,'JOON SOUND #8','2023-07-22-joon-joon-sound-8','2023-07-22',NULL,'17:00:00',NULL,'<p>«Планирую ставить различные релизы 2010-2015 годов, такие как blood orange, solange, chet faker, neon indian и другие»</p>',NULL,'',1,216,1,'','',false,false,NULL,2,'2023-07-21 17:30:40','2023-10-17 08:01:32',NULL,'','0',18,97),
	 (1426,'Mauko meets friends in Solids','2023-07-22-solids-mauko-meets-friends-in-solids','2023-07-22','2023-07-22','16:00:00','22:00:00','<p>Согласитесь, в городе не так много дневных вечеринок? Тем более с танцами!<br>Solids, совместно с Петербургским издательством Mauko, очень хочет это исправить уже в ближайшую субботу.</p>',NULL,'0.0',1,220,1,'','',false,false,NULL,2,'2023-07-21 17:35:44','2023-10-25 14:43:01',NULL,'','0',18,70),
	 (1427,'NAUTILUS Boat party','2023-07-22-teploxod-slavutic-nautilus-boat-party','2023-07-22',NULL,'23:30:00',NULL,'<p>В пятницу - 28 июля - мы приглашаем всех на прогулку по Неве, которая пройдёт в компании представителей петербургской хаус-сцены разных поколений<br><br>Вас ждёт ночное путешествие, включающее в себя романтику северной столицы со всеми её историческими атрибутами и лучший музыкальный грув от диджейского лайнапа<br><br></p>',3500,'',1,237,1,'https://spb.qtickets.events/78005-nautilus-boat-party','',false,false,NULL,2,'2023-07-21 17:42:57','2023-10-25 09:19:35',NULL,'','0',18,147),
	 (1428,'АБСТРАСЕНЦИЯ','2023-07-23-krysa-18-abstrasenciia','2023-07-23',NULL,NULL,NULL,'<p>Воскресный оупен-эйр фестиваля атмосферной электроники состоится в Петербурге с впечатляющим видом на акваторию Невы и крейсер Аврора. Нас ждет незабываемый вечер на высоте и музыкальное путешествие с неповторимой атмосферой в компании 8 ярких представителей атмосферной электронной сцены.</p>',1200,'',1,45,1,'https://abstrasension.ru/','https://vk.com/abstrasension',false,false,NULL,2,'2023-07-21 17:50:20','2023-10-25 17:48:38',NULL,'','0',18,146),
	 (1493,'Mirage Saturday','2023-07-29-miraz-mirage-saturday','2023-07-29',NULL,'00:00:00',NULL,'<p>Про субботу раскрывать все карты не будем, но и без анонса не оставим&nbsp;<br><br>Настроение проводить второй месяц лета как следует, поэтому всем выжившим после пятницы настоятельно рекомендуем явиться</p>',NULL,'0.0',1,77,1,'','',false,false,NULL,2,'2023-07-28 13:46:44','2023-10-11 17:48:21',NULL,'','0',18,96),
	 (1429,'MLC LEGACY OF MTV: UNDERGROUND 2','2023-07-22-miraz-mlc-legacy-of-mtv-underground-2','2023-07-22',NULL,'00:00:00',NULL,'<p>В лучших традициях стритрейсинга нулевых, во дворе будет стоять куча затюненных легенд того времени (фоткаться можно, гонять нельзя), про декор в клубе ребята тоже не забыли, так что атмосфера будет найс<br><br>Помимо прочего, вас снова ждёт уже фирменный видеосет от 5dm, и конечно же конкурс, пацаны разыгрывают виниловый проигрыватель, пластинку three 6 mafia и футболку с бивисом и батхедом<br>nft priority pass - вход бесплатный</p>',600,'800.0',1,77,1,'','',false,false,NULL,2,'2023-07-21 18:09:57','2023-10-25 15:02:59',NULL,'','0',18,119),
	 (1431,'Перформанс-открытие фестиваля GAMMA','2023-07-21-novaia-scena-aleksandrinskogo-teatra-per','2023-07-21',NULL,'14:00:00',NULL,'<p><strong>Euphoria Orchestra x Artemy Anrilov</strong><br>Официальное открытие фестиваля GAMMA<br><br>На новой сцене Александринского театра сойдутся московский оркестр классической и современной академической музыки Euphoria и саунд-артист, адепт электронного звука Sofist, резидент m_division, известный в миру, как Артемий Анрилов. Опыт глубокого прослушивания или активное телесное сопереживание? Решать вам. В новом экспериментальном проекте соединились дух минимализма, академическая точность и танцевальная стихия техно-музыки.</p>',NULL,'',1,207,2,'','https://gammafestival.ru/',false,false,NULL,1,'2023-07-21 19:19:52','2023-10-22 19:27:40',NULL,'','0',18,117);
