	 (1434,'Itallika Boat Party','2023-07-23-itallika-boat-party','2023-07-23','2023-07-23','19:00:00','23:00:00','<p>Раз в сто лет мы делаем в Петербурге закатную вечеринку на кораблике, 23 июля вечером как раз тот случай, звезды сошлись - это еще и день рождения нашей Rapotosha✨🎂<br><br>• Кораблик будет украшен в зелëно-золотой тропик.&nbsp;<br>Дресс код соответствующий: зеленый, золотой, блестки, рок, глэм, летнее диско, капелька референсов есть в карусели в инсте.&nbsp;<br><br>• Количество мест всего 100, в первую очередь отдаем предпочтение друзьям и их друзьям, знакомым, тем кто ходил на наши вечеринки и тем кто просто понравится 🙃<br><br>• Продолжительность заплыва 3,5 часа, собираемся в 19.00, на наб. Макарова, и плывем навстречу закату.&nbsp;<br><br>• Стоимость билета 3000₽, в стоимость входит безлимитный коктейльный бар с напитками вроде апероль шприц, виски кола, джин тоник и тому подобное🍹🍸🧉<br><br>• Воскресенье, 23 июля, 19.00 - 23.00</p>',3000,'',1,NULL,1,'https://instagram.com/itallika?igshid=OGQ5ZDc2ODk2ZA==','',false,false,NULL,1,'2023-07-23 18:48:57','2023-10-10 21:45:53',NULL,'','0',18,59),
	 (1435,'SALUTE HONEY','2023-07-23-ritmy-salute-honey','2023-07-23',NULL,'16:00:00',NULL,'<p>Последствия субботних дискотек в этот раз разгребают салютханюльки.<br>Секси-лэйдис, фьюча-ар-энд-бишницы, крошки-малышки мои любимые причалят на воскресный откисон на Кожевенную 34.&nbsp;<br><br>Интерактив обещают точно, но вот какой, пока загадка! Сюрприз, говорят!<br>Советую просто прийти и все увидеть самим</p>',NULL,'',1,181,1,'','',false,false,NULL,1,'2023-07-23 18:51:21','2023-10-23 04:23:27',NULL,'','0',18,85),
	 (1436,'NAUTILUS boat party','2023-07-28-korabl-nautilus-boat-party','2023-07-28',NULL,'23:30:00',NULL,'<p>В пятницу, 28 июля мы приглашаем всех на прогулку по Неве, которая пройдёт в компании представителей петербургской хаус-сцены разных поколений.<br><br>Вас ждёт ночное путешествие, включающее в себя романтику северной столицы со всеми её историческими атрибутами и лучшим музыкальным грувом от диджейского лайнапа.</p>',2500,'',1,202,1,'https://spb.qtickets.events/78005-nautilus-boat-party','',false,false,NULL,2,'2023-07-25 10:42:11','2023-10-25 10:21:06',NULL,'','0',18,154),
	 (1438,'Think About Onohasm ','2023-07-29-lendok-think-about-onohasm','2023-07-29','2023-08-01','20:00:00',NULL,'<p>Рад представить мою персональную выставку, где каждая картина - это отражение моего творчества и души. Загляните внутрь моего мира и насладитесь уникальными образами, сочетающими реализм и абстракцию.<br><br>Открытие выставки состоит состоится 29.07 в галерее арт-центра при поддержке моих друзей музыкантов</p>',NULL,'0.0',1,182,1,'','',false,false,NULL,2,'2023-07-25 11:09:32','2023-10-25 09:43:34',NULL,'','0',18,117),
	 (1439,'APPLIQUE','2023-07-28-gazgolder-applique','2023-07-28',NULL,'21:00:00',NULL,'<p>28-го июля Applique предстанет в виде детской игрушки.<br>Кукла, которая при внешнем воздействии находится в непрерывном движении, но в состоянии полного равновесия</p>',1500,'',2,35,1,'','https://vk.com/superapplique',false,false,NULL,2,'2023-07-25 11:18:29','2023-10-23 22:10:57',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwYXJ0bmVyIjoiNWM1MDdlMjk0MWM2N2MwMDBjMDE5YmZjIn0.lodyLkpHNA2usWbuLThRmH1MHR3s8Ut4riFuQBdu358','0',18,89),
	 (1440,'AFTERSKAZKA - Церемония','2023-09-02-mutabor-afterskazka-ceremoniia','2023-09-02','2023-09-03','22:00:00','09:00:00','<p>Доступ на церемонию на одно лицо на все локации пространства. Посещение означает согласие с действующими на момент проведения правилами и требованиями правительства РФ и организатора. FC/DC. Одевайтесь ярко!</p>',2000,'',2,2,1,'','https://skazkafestival.ru',false,false,NULL,2,'2023-07-25 11:29:02','2023-10-24 21:22:15',6450,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjFiYTNiMDE0YTM4ZTcxNzQ1Yzk5MDhmIn0.jy_zCHgQZh054fIc_PbiOEEIweahKUFqCeO_whNc7k0','0',18,1095),
	 (1490,'PICNIC LIVE - CIRCUS ','2023-07-29-fedoskino-picnic-live-circus','2023-07-29','2023-07-29','12:00:00','00:00:00','<p>Встречаемся 29 июля на нашем ежегодном фестивале Picnic Live!!!<br><br>Стартуем в 12:00, встречаемся на нашей стилизованной локации, берем коктейли и заряжаемся свежими сетами от наших диджеев 💥&nbsp;<br><br>Намечается что-то грандиозное!<br>Следи за новостями.&nbsp;</p>',1000,'',2,244,1,'https://molodostmusic.ru/','',false,false,NULL,2,'2023-07-28 12:53:05','2023-10-24 21:43:10',NULL,'','0',18,175),
	 (1441,'HIGHWAY meets HYPNOTICA','2023-07-29-supermetall-highway-meets-hypnotica','2023-07-29',NULL,'16:00:00',NULL,'<p>"Гипнотическая Автострада" мы скучали по тебе!&nbsp;<br><br>Объединённые силы промо-команд Highway и Hypnotica приступили к подготовке новой встречи на высшем танцевальном уровне в самом притягательном и актуальном пространстве под открытым небом - Радио на Суперметалле.<br><br>В субботу 29 июля с 16 часов до рассвета любимые артисты Highway и Hypnotica подарят любовь и очаруют талантами, проникая в сердце каждого музыкального путешественника. Москва, Санкт-Петербург, Краснодар и Ростов-на-Дону - запредельная концентрация эмоций гарантирована! Взгляните на лайнап и готовьтесь к настоящим перегрузкам радости!<br><br>Отсчёт пошёл!<br><br>День (16:00 - 20:00): FC / вход бесплатный по предварительной регистрации<br>Ночь (20:00 - 06:00): FC / 21+ / вход по билетам<br>С картами Highway Family вход бесплатный</p>',1500,'',2,119,1,'https://radio42.ticketscloud.org/','',false,false,NULL,2,'2023-07-25 12:03:19','2023-10-23 17:25:58',NULL,'','0',18,310);
