	 (1446,'Крути и Танцуй','2023-07-30-blank-kruti-i-tancui','2023-07-30',NULL,'20:00:00',NULL,'<p>30 июля мы проведем велозаезд<br>Сохраняем традиции и открываем регистрацию на две группы<br>Все подробности велозаезда мы напишем отдельно в канале <br>Подписывайся, чтобы не пропустить детали и информацию&nbsp;<br><br>Финиш проведем в клубе Blank, где будут ждать фри дринки для первых 50-ти зарегистрировавшихся, фотозона, спешал меню, призы для победителей и, конечно же, отменный диджейский состав<br><br></p>',NULL,'',1,1,1,'https://t.me/blankclub','',false,false,NULL,2,'2023-07-25 17:05:41','2023-10-23 15:26:03',NULL,'','0',18,149),
	 (1447,'LATEENS ','2023-07-28-griboedov-lateens','2023-07-28','2023-07-29',NULL,NULL,'<p>Горячий юг перемещается в Basement: в программе эклектика самого свежего, ритмичного звука латинской америки. Экстаз и свобода.&nbsp;<br><br>Начнем с веранды Amsterdam 🇳🇱, где можно будет как следует прогреться, размяться, освежиться на баре, сыграть в бильярд и отлично провести время, под хороший саунд.<br><br>В середине ночи идем в Basement и танцуем заводные южные танцы до самого утра.&nbsp;<br><br>Много одежды не понадобится — будет по настоящему горячо, а самым сексуальным дадим 50% скидку на вход.</p>',NULL,'600.0',1,86,1,'','',false,false,NULL,2,'2023-07-26 11:38:20','2023-10-10 22:24:11',NULL,'','0',18,82),
	 (1448,'Manifest x Warehouse','2023-07-28-propaganda-manifest-x-warehouse','2023-07-28',NULL,'23:00:00',NULL,'<p>Всем йоу &amp; breaking news! 28 июля Manifest представит собственный шоукейс в легендарном клубе Propaganda, который вдохновляет столичных тусовщиков дольше, чем некоторые из Вас живут на этой планете. Lowchord, Basil White и Etrigan уже готовят эксклюзивные сеты, а Sergey Timoshov, Julia Karma и Roman Vabel планируют порадовать всех гостей фирменным клубным саундом. Не пропустите такую крутую летнюю коллабу!</p>',500,'',2,101,1,'','',false,false,NULL,2,'2023-07-26 11:43:02','2023-10-25 04:17:25',NULL,'','0',18,149),
	 (1508,'ISOLATOR','2023-07-30-q-bar-isolator','2023-07-30',NULL,'23:00:00',NULL,'<p>30.07 ISOLATOR в Q&nbsp;<br><br>В воскресенье, после бурных выходных, на Загородном 37, в баре Q команда 404GANG предлагает изолироваться от сущего и на всю ночь раствориться в вайбах стильного техно.</p>',350,'',1,161,1,'https://spb.qtickets.events/78215-isolator','',false,false,NULL,2,'2023-07-28 22:02:20','2023-10-20 17:22:11',NULL,'','0',18,55),
	 (1494,'SOMMERTREFFEN Sacred Sound','2023-08-12-rndm-sommertreffen-sacred-sound','2023-08-12',NULL,NULL,NULL,'<p>Знаем, как многие этого ждали и спешим порадовать всех вас долгожданной новостью о нашем следующем ивенте!&nbsp;<br>В этот раз, мы решили попробовать что-то новое и отправиться в другой город, в абсолютно новую для нас локацию.&nbsp;</p>',700,'',2,27,1,'https://spb.qtickets.events/78201-sacred-sound-sommertreffen','https://sacredsound.events',false,false,NULL,2,'2023-07-28 14:25:21','2023-10-25 12:16:19',NULL,'','0',18,170),
	 (1449,'SIGMA FESTIVAL','2023-07-29-mutabor-sigma','2023-07-29','2023-07-30','22:00:00','12:00:00','<p>SIGMA – мультижанровый фестиваль актуальной электронной музыки, объединяющий 50 влиятельных музыкантов, диджеев и новых ярких самородков с уникальным звучанием.<br>29 сентября мы погрузимся в невероятное 14-часовое путешествие в мир синергии звука, света и обилия музыкальных стилей на любой вкус. Действие развернется на 5 сценах главного арт-пространства Москвы – Mutabor.</p>',1200,'',2,2,1,'','',false,false,NULL,2,'2023-07-26 11:52:05','2023-10-24 21:24:40',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,286);
