	 (1452,'RAVE GIRLS','2023-08-11-ritmy-rave-girls','2023-08-11',NULL,NULL,NULL,'<p>В клубе в эту ночь будут орудовать девочки, а в лобби мальчики.<br><br>Мальчики будут лупить, но не очень сильно, ибо в эту ночь за вайб отвечают дамы.&nbsp;<br><br></p>',NULL,'0.0',1,181,1,'','https://t.me/vritme_bar',false,false,NULL,2,'2023-07-26 15:23:23','2023-10-23 10:48:00',NULL,'','0',18,250),
