	 (1457,'OPIUM Underground','2023-07-28-powerhouse-opium-underground','2023-07-28',NULL,'22:30:00',NULL,'<p>Команда Opium Underground собирает тусовщиков среди благовоний и свеч — танцевать под завораживающую электронную музыку. Вас будет ждать яркая палитра музыки со всех уголком мира, гипнотизирующие танцы и живые перкуссии.<br><br>Вход: донейшн (платите столько, сколько посчитаете нужным)</p>',100,'',2,5,1,'','',false,false,NULL,2,'2023-07-26 16:30:11','2023-10-21 12:13:36',NULL,'','0',18,109),
	 (1458,'Fancy Dance','2023-07-28-bar-strelka-fancy-dance','2023-07-28',NULL,'23:00:00',NULL,'<p>Танцы в баре «Стрелка» с героями столичной культурной сцены. За вертушками — главред VK Музыки и бывший музыкальный редактор «Вечернего Урганта» Сергей Мудрик и автор телеграм-канала «Сломанные пляски» и Коля Редькин.</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,2,'2023-07-26 16:33:52','2023-10-13 02:16:51',NULL,'','0',18,49),
	 (1459,'RNDM CREW x РАДУГА','2023-07-28-blanc-rndm-crew-x-raduga','2023-07-28',NULL,'20:00:00',NULL,'<p>Вечеринка диско-клуба «Радуга» совместно с группировкой RNDM CREW утраивают большую вечеринку в ресторане Blanc. Вас ждут два ночных танцпола, чилловый двор и звездные артисты</p>',1500,'',2,36,1,'https://radugadiscoclub.ru/e280723','',false,false,NULL,2,'2023-07-26 16:39:18','2023-10-25 17:43:21',NULL,'','0',18,306);
