	 (1460,'Please Please Repeat!','2023-07-28-radio-please-please-repeat','2023-07-28',NULL,'20:00:00',NULL,'<p>Не успели улечься эмоции от предыдущего REPEATа, как мы советуем всем готовиться к предстоящему!</p>',500,'',2,149,1,'https://radio-event.timepad.ru/event/2508988/','',false,false,NULL,2,'2023-07-26 16:45:27','2023-10-10 17:17:59',NULL,'','0',18,47),
	 (1461,'Гадкие Хиппи','2023-07-28-prostranstvo-pole-gadkie-xippi','2023-07-28',NULL,'20:00:00',NULL,'<p>3023 год. На просторах полевого запада, где право тусующегося — единственный закон, существует группа неукротимых бунтарей. Они — настоящие «гадкие хиппи», бороздящие просторы пустынь, где настоящая сила проявляется в битвах за звук и свободу.<br><br>28 июля станет апогеем беспредела, когда «гадкие хиппи» столкнутся с другими обладателями безумной музыкальной силы и нового альбома — «всадниками жкх». Станут ли они настоящими легендами полевого запада? Узнать можно только в боевике «гадкие хиппи» в поле.<br><br></p>',800,'',2,46,1,'https://vsadniki.ticketscloud.org/','',false,false,NULL,2,'2023-07-26 16:50:49','2023-10-24 22:55:07',NULL,'','0',18,66),
	 (1462,'UMAKER: LUKEA','2023-07-29-gazgolder-umaker-lukea','2023-07-29',NULL,'22:00:00',NULL,'<p>Школа диджеинга и промогруппа UMAKER устраивает вечеринку на трех танцполах. Главным гостем события станет француз Lukea, в музыке которого сливается темный и органичный саунд. Его поддержат локальные звезды и молодые артисты.<br>29 июля в Gazgolder ты услышишь тех, кто ещё никогда не приезжал в Россию и тех, по кому мы давно соскучились.<br><br>Minimal танцпол заполнят плотные ритмичные звуки перкуссии и качественного саунда от французского музыканта и диджея LUKEA. Не знаю, как ты, но мы его очень ждали.<br><br>Совсем ненадолго, буквально, на нашу вечеринку вернулся - SWOY (aka S.K.A.M.). Его house и minimal треки возглавляют чарты виниловых магазинов, а его аутентичный sound невозможно перепутать.&nbsp;</p>',1500,'',2,35,1,'https://umaker.ticketscloud.org/','',false,false,NULL,2,'2023-07-26 16:56:44','2023-10-24 23:58:47',NULL,'','0',18,148),
	 (1463,'DekaDance - Masquerade','2023-07-29-slezy-dekadance-masquerade','2023-07-29',NULL,'22:30:00',NULL,'<p>Приготовили для вас немного ренессансных вайбов: как насчет техно-маскарада и кутежа на манер эпохи возрождения?&nbsp;<br><br>Мы не будем прятаться за масками, мы примерим новые амплуа, в которых познаем себя&nbsp;<br>Отличная возможность стать в эту ночь кем угодно, возможно, им и остаться<br><br>Вход: В честь дня рождения основателя Декаденса, вход - любая купюра/перевод&nbsp;<br><br>DC:<br>Masquerade (маска), Gothic, Tech-wear, Street-Wear, Rave, Black</p>',100,'',2,102,1,'','https://t.me/dekadance_music',false,false,NULL,2,'2023-07-26 17:10:28','2023-10-24 20:25:35',NULL,'','0',18,68),
	 (1464,'Resonance Night','2023-07-29-bar-strelka-resonance-night','2023-07-29',NULL,'23:00:00',NULL,'<p>В субботу за пультом в «Стрелке» — резиденты творческий группировки Никиты Забелина Resonance Moscow. Играют: петербургская гетто-звезда Destroy, гуру синтетического звука Kah Mal и профессиональный резонатор Влас Лескин.</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,2,'2023-07-26 17:13:09','2023-10-11 00:12:58',NULL,'','0',18,72),
	 (1465,'Kixbox System Sound','2023-07-29-prostranstvo-pole-kixbox-system-sound','2023-07-29',NULL,'20:00:00',NULL,'<p>В ближайшую субботу следуйте строго за вибрациями саундсистемы KIXBOX — если не сворачивать с пути, они приведут вас в поле</p>',NULL,'0.0',2,46,1,'','',false,false,NULL,2,'2023-07-26 17:17:22','2023-10-14 17:59:49',NULL,'','0',18,197),
	 (1466,'МАКСИМАЛЬНО КРУТАЯ ТУСА','2023-07-29-blanc-maksimalno-krutaia-tusa','2023-07-29',NULL,'18:00:00',NULL,'<p>Тусовка диско-клуба «Радуга», которая из вечернего двора перетечет в ночь. В большом лайнапе — охапка друзей и резидентов команды с многожанровыми сетами и лайвами</p>',1500,'',2,36,1,'https://radugadiscoclub.ru/e290723','',false,false,NULL,2,'2023-07-26 17:22:30','2023-10-24 22:07:27',NULL,'','0',18,212),
	 (1467,'NEW FACES NIGHT ','2023-08-04-rndm-new-faces-night','2023-08-04',NULL,'22:00:00',NULL,'<p><strong>New Faces Night - серия ивентов от клуба, где мы открываем для вас новые имена. В программе нового ивента - ломаная бочка в перемешку с трансом, ускоряющаяся до хард техно.</strong></p>',NULL,'0.0',2,27,1,'','',false,false,NULL,2,'2023-07-26 17:27:48','2023-10-23 21:36:53',NULL,'','0',18,118),
	 (1468,' Natural Unity ','2023-07-28-suba-bar-natural-unity','2023-07-28',NULL,'21:00:00',NULL,'<p>Резидент бара Lemo -&nbsp; Riz&nbsp;откроет событие в 21:00 и добавляя к своему хаусу игру на синтезаторе.&nbsp;<br>Milena, дополнит свой organic, звуками скрипки.&nbsp;<br>В завершении вечера Digion поддаст чуть жёсткой бочки с популярными песнями в стиле mash up</p>',NULL,'0.0',1,205,1,'','',false,false,NULL,2,'2023-07-26 17:32:13','2023-10-25 12:20:28',NULL,'','0',18,79),
	 (1469,'This Saturday Night','2023-07-28-deep-fried-friends-friday-night','2023-07-29','2023-07-30','00:00:00','05:00:00','<p>Бесконечно можно смотреть на три вещи: как течёт вода, как горит огонь и сколько классных у нас сторис после вечеринки&nbsp;<br>В эту субботу ресторан DFF снова откроет свои двери для вас: спешл дринки, танцы до самого утра и бесконечные разговоры в малом дворике</p>',500,'1000.0',2,76,1,'','',false,false,NULL,2,'2023-07-26 17:41:37','2023-10-25 05:16:48',NULL,'','0',18,103);
