	 (1470,'Friday Night','2023-07-28-deep-fried-friends-friday-night-1','2023-07-28',NULL,'00:00:00',NULL,'<p>В эту пятницу в ресторане DFF выступит популярный российский певец и актёр Влад Соколовский со своим электронным live-проектом «VS20» — dj-перфомансом на стыках прогрессив и техно-хауса, с вплетением живого вокала. «VS20»&nbsp; вошёл в топ-10 мирового чарта Beatport, в категории progressive с композицией «Feel High» и топ-30 с треком «Like a Fire» в категории techno</p>',NULL,'500.0',2,76,1,'','',false,false,NULL,2,'2023-07-26 17:47:25','2023-10-25 15:45:57',NULL,'','0',18,90),
