	 (1509,'NO FACE','2023-07-29-q-bar-no-face','2023-07-29',NULL,NULL,NULL,'<p>В этот день нам не важно как ты выглядишь, важно что ты чувствуешь!<br>Прячь лицо и двигайся.</p>',NULL,'200.0',1,161,1,'','',false,false,NULL,2,'2023-07-28 22:06:00','2023-10-17 16:06:28',NULL,'','0',18,70),
