	 (1473,'Ahola - Rastsvet','2023-08-25-ahola-rastsvet','2023-08-24','2023-08-24',NULL,NULL,'<p>Ахола — фестиваль музыки и искусства.<br><br>Расцвет [ras''tsvejt] — наше третье музыкальное путешествие, посвященное самому благоприятному времени для жизни. Моменту, когда мы находимся на пике энергии, дышим полной грудью, берем от жизни максимум, а дарим — еще больше.<br><br>Более 50 артистов выступят на трех сценах.<br><br>Концерты, диджей-сеты, лекции, перформансы, йога, актёрский тренинг, воркшопы, маркет — возможности для новых ощущений и бесценного опыта.</p><p><br><br></p>',5000,'',1,NULL,3,'','https://aholafestival.com',false,false,NULL,2,'2023-07-27 15:54:13','2023-10-24 21:09:18',NULL,'','0',18,234),
	 (1474,'MATISSE Birthday Weekend','2023-07-28-restobar-matiss-matisse-birthday-weeken','2023-07-28','2023-07-29','19:00:00','01:00:00','<p>Все это время мы создаём красивое и уютное место для тех, кто ценит комфортное времяпрепровождение в нашем городе.</p><p>Ждём всех на наше пятилетие, которое мы проведём в лучших традициях&nbsp; рестобара Матисс</p>',NULL,'0.0',1,159,1,'','',false,false,NULL,2,'2023-07-27 16:09:26','2023-10-10 22:06:43',NULL,'','0',18,51),
