	 (1476,'Ghettopsychedelic','2023-07-30-lastocka-ghettopsychedelic','2023-07-30','2023-07-30','10:00:00','22:00:00','<p>Дневная Геттопсиходелика на крыше «Ласточки» 30 июля с 10:00 до 22:00 все оттенки бейс мьюзик</p>',550,'',1,10,1,'https://rupor.biz/widgets/event-tickets/854','',false,false,NULL,2,'2023-07-27 16:27:13','2023-10-25 08:39:01',NULL,'','0',18,132),
	 (1477,'Jumanji','2023-07-28-fantomas-chateau-rooftop-jumanji','2023-07-28','2023-07-29','23:00:00','06:00:00','<p>Фирменная вечеринка Bassmatic Box 28 июля в стиле Джуманджи на крыше Fantomas Rooftop - это сопряжение долгожданного летнего зноя, запаха нагретой на солнце тропической листвы и фруктов, переплетающихся с пьянящими пряными ароматами редких южных цветов. В отблесках светового шоу ночные гости джунглей будут отдаваться жарким танцам, обостряя своё восприятие окружающего и свои инстинкты. А утром, когда первые лучи солнца будут пробиваться сквозь листву, мы будем вместе приветствовать негаснущее светило, с благодарностью отдавая последние силы ритмичным движениям в честь наступления нового дня. Приходите 28-го июля на крышу Fantomas Rooftop в центре столицы и погрузитесь в знойный летний вайб этой ночи.</p>',1600,'2000.0',2,170,1,'https://bassmaticrecords.com/','',false,false,NULL,2,'2023-07-27 17:09:32','2023-10-24 22:24:22',NULL,'','0',18,116);
INSERT INTO public.events (id,title,slug,start_date,end_date,start_time,end_time,description,price_from,price_gate,city_id,venue_id,event_type_id,tickets_url,info_url,is_cancelled,is_featured,deleted_at,user_id,created_at,updated_at,ticketscloud_event_id,ticketscloud_event_token,ticketscloud_event_multi,age_limit,"views") VALUES
	 (1478,'LIFT ME UP','2023-08-26-kinky-rouge-lift-me-up','2023-08-26','2023-07-27','22:00:00','05:00:00','<p>Есть музыка, которая поднимает нас над облаками. Каждый её звук дарит чувство наслаждения и полёта. Мы впускаем её в сознание и она погружает нас в эйфорию и заставляет нас улыбаться.&nbsp;<br>Все это мы испытываем с десятикратной силой, если слышим нашу любимую музыку на шикарном звуке и в компании друзей и единомышленников.<br>Так же в эту ночь свои дни рождения будут праздновать сразу 3 диджея и наших хороших друга: Ithil, Kicker и LTJ Iceberg!&nbsp;</p>',500,'',2,62,1,'','',false,false,NULL,2,'2023-07-27 17:14:39','2023-10-19 19:38:10',NULL,'','0',18,275),
	 (1479,'SUNSPIN OPEN AIR 2.0','2023-08-04-sunspin-open-air-20','2023-08-04','2023-08-05','20:00:00','03:00:00','<p>Не часто такое случается, но этот год стал особенным. Врата Солнца этим летом откроются во второй раз! Проводниками сквозь них станут не просто лучшие из лучших, а настоящие легенды электронной сцены. Вы сможете впитать в себя всю энергию Солнца и познать таинства ночи. Два равноценных танцпола, Psy trance и Techno сольются в единой энергии. Ещё больше звука и света! Ещё больше погружения в атмосферу! Пройди сквозь Врата Солнца и проживи этот уникальный опыт вместе с нами на SunSpin 2.0.</p>',NULL,'1500.0',2,NULL,1,'','',false,false,NULL,2,'2023-07-27 17:23:38','2023-10-24 21:26:54',NULL,'','0',18,567),
	 (1480,'Gypsy Rave','2023-07-28-rovesnik-gypsy-rave','2023-07-28',NULL,'23:00:00',NULL,'<p>Насчет 2025 сказать ничего не можем, но в 2023 точно популярны туфли с большим носиком! Поэтому надеваем свои подкрадулички и в эту пятницу, 28 июля, идем в Ровесник на Gypsy Rave, чтобы встретиться со звездой Интернета Нико Гротиком&nbsp;<br><br>Послушаем все хиты Нико, а также подэнсим под техно (это ведь рэйв!) на сетах самой мощной диджейской компании на саппорте. Скажем только одно — этой ночью все цыгане точно будут кайфовать!<br>А пока Нико едет к нам на бэушном камазике за семьсот пятьдесят кэсов, у нас есть время подобрать самые стильные луки на вечеринку, чтобы сам Принц Сербии точно заценил.&nbsp;<br><br></p>',NULL,'0.0',2,239,1,'','',false,false,NULL,2,'2023-07-27 18:15:28','2023-09-29 10:19:05',NULL,'','0',18,86),
	 (1491,'БЭКЯРД','2023-07-28-onegin-dvor-bekiard','2023-07-28',NULL,'23:00:00',NULL,'<p>Привет!<br>Неделя приближается к выходным, а значит самое время строить планы с друзьями.<br>В пятницу диджеи играют свои лучшие сеты в нашем уютном дворике. Отдельно отметим диджея Зоркинa, который наконец заглянет в гости, впервые за долгое время разлуки с Петербургом (Юху!)<br><br>Обновленная барная карта и все тот же наивкуснейший стрит-фуд&nbsp;</p>',NULL,'300.0',1,230,1,'','',false,false,NULL,2,'2023-07-28 13:09:22','2023-10-17 22:23:25',NULL,'','0',18,61),
	 (1481,'HYPNOTICA meets KINETIKA','2023-08-05-radio-hypnotica-meets-kinetika','2023-08-05','2023-08-05','16:00:00','23:00:00','<p>В программе — красота в акцентах на самое интересное, чувственное, изящное и танцевальное: двое иностранных хедлайнеров — JOONE из Венесуэлы и TOMPER из Тель-Аль-Авива, техно-симфонический концерт BET LON с элементами оперы, креативный диджейский дуэт ROCCA &amp; LORENSIYA, артистичный коллектив из Минска с лайвом PARA NOIR, IBERIAN MUSE, чья музыка звучит по всей планете и часто встречает поддержку от главных артистов Afterlife, а так же резиденты и друзья лейблов, в общем — большое количество диджеев и музыкантов, транслирующих актуальный электронный звук в окружающее пространство. А еще художественные и световые инсталляции, видео-продакшен, резонирующий с эпохой VR и AR и большой маркет для тех, кто любит олицетворять собой красоту. Подбирайте наряды и настраивайте сердца на светлые чувства и положительные эмоции — лето в разгаре!&nbsp;</p>',1500,'',2,149,1,'https://wearerave.ticketscloud.org/','',false,false,NULL,2,'2023-07-27 18:34:39','2023-10-24 06:44:24',NULL,'','0',18,116),
	 (1482,'THE DAWLESS - Презентация альбома Broken Aux','2023-07-29-bauns-the-dawless-prezentaciia-alboma','2023-07-29','2023-07-30','22:00:00','06:00:00','<p>Всем подготовиться и пристегнуть ремни безопасности. В субботу, 29 июля, пройдет долгожданная тусовка, приуроченная к выходу альбома THE DAWLESS</p>',1200,'',2,17,1,'https://the-dawless.ticketscloud.org/','',false,false,NULL,2,'2023-07-27 19:02:00','2023-10-21 23:18:21',NULL,'','0',18,72),
	 (1483,'ELECTRIC SUNSET + SUNRISE','2023-07-28-oblako-53-electric-sunset-sunrise','2023-07-28','2023-07-29','20:00:00','06:00:00','<p>2 террасы и головокружительный вид на красавицу столицу, музыка любимых артистов в лучах уходящего и восходящего солнца, на крыше гостиницы Пекин<br>Начинаем вечер с 20.00 на Lounge террасе под лучами уходящего солнца, вкушая специально созданный для нашего мероприятия сет-ужин "Charged by the Electric sun" из 4 позиций (закуска, салат, горячее + напиток), завершая утренними танцам на террасе Dance вкупе с вдохновляющим ритуалом приветствия восходящего солнца.<br><br></p><p><br></p>',3000,'4000.0',2,240,1,'https://spiriton.timepad.ru/event/2504369/?utm_refcode=31e00e01a28c2edfc6f3f972a8f72f2d4cd8a97e#register','',false,false,NULL,2,'2023-07-27 19:23:51','2023-10-23 20:23:05',NULL,'','0',18,62),
	 (1484,'Компас fest 2023','2023-09-08-kompas-fest-2023','2023-09-08','2023-09-10','16:00:00','16:00:00','<p>«КОМПАС FEST» — ежегодный летний музыкальный фестиваль, проходящий более 5 лет на красивейших пляжах Черноморского побережья. Спортивно-музыкальный кэмп для любителей активного отдыха в России. 8-10 сентября, Локация фестиваля удивительная Бугазская коса, душа станицы Благовещенская - магическое место, которое одарит вас волшебством и незабываемыми впечатлениями. Приготовьтесь окунуться в атмосферу истинной свободы и не упускать моменты, о которых будете с теплом вспоминать годами.<br><br>ЧТО ВХОДИТ В СТОИМОСТЬ ТУРА?&nbsp;<br>• Проезд на комфортном автобусе туда и обратно;<br>‌• Проживание в гостинице 3 дня/2 ночи;<br>• Билет + браслет участника тура «КОМПАС» на все дни;<br>• 3 дня музыкальных вечеринок на территории локации фестиваля;<br>• Встреча сансета на пляже;<br>• Более 30 DJ и live проектов из разных городов России;<br>• Оздоровительные практики и йога;<br>• Серфинг и обучение (доп);<br>• Сопровождение группы опытными гидами и кураторами;<br>• Чайные церемонии в сhill zone (доп. услуга);<br>• Фото и видео отчёт о поездке.</p>',NULL,'',2,NULL,3,'','https://kompasfest.ru/',false,false,NULL,2,'2023-07-27 19:32:14','2023-10-24 17:55:51',NULL,'','0',18,453),
	 (1485,'MIRAGE x ÖMANKÖ','2023-07-28-miraz-mirage-x-omanko','2023-07-28',NULL,'00:00:00',NULL,'<p>Ваши любимые афиши о мероприятии с кино и танцами&nbsp;<br>вход 500₽ до 01:00/700₽ после + фейс<br>nft priority pass - вход бесплатный&nbsp;</p>',500,'700.0',1,77,1,'','',false,false,NULL,2,'2023-07-28 10:30:51','2023-10-21 11:50:30',NULL,'','0',18,127),
	 (1487,'TRIP FESTIVAL 2024','2024-07-25-embargo-villa-trip-festival-2024','2024-07-25','2024-07-28',NULL,NULL,'<p>С 25 по 28 июля на территории клуба Embargo Villa пройдет атмосферный Фестиваль электронной музыки TRIP 2024.<br><br><br>На территории Embargo Villa разместится 4 танцевальные арены: Main, Space, Forest и Pyramid. Кроме этого будет работать фудкорт, спортивная арена и зона бассейна. Также предусмотрена отдельная зона VIP с летней террасой, рестораном и баром.<br><br>TRIP 2024: добро пожаловать в лето!<br><br></p>',6000,'',17,242,1,'https://tripfestival.ru/tickets','',false,false,NULL,2,'2023-07-28 12:16:19','2023-10-25 16:37:04',NULL,'','0',18,257);
