	 (1488,'ВОЛШЕБНАЯ НОЧЬ','2023-07-28-community-moscow-volsebnaia-noc','2023-07-28',NULL,'22:00:00',NULL,'<p>Волшебство рождается внутри нас. Когда мы объединяемся, наши энергии аккумулируются в единый поток. А музыка пронизывает все наше существо и дарит ощущение тотального счастья.</p>',2000,'',2,58,1,'http://communitymoscow.ru/magicnight','',false,false,NULL,2,'2023-07-28 12:32:11','2023-10-17 11:35:39',NULL,'','0',18,66),
	 (1489,'Lesha Mironov & Friends','2023-07-29-sunday-ginza-lesha-mironov-friends','2023-07-29',NULL,'18:00:00',NULL,'<p>Кто в Петербурге не знает Лешу Миронова? Вот вам и ответ почему нужно оказаться в субботу в ресторане Sunday! (И да, мы реально очень ждали вечеринок на Крестовском).<br>Тяжелый люкс на пляже с видом на яхт-клуб, что-то на тусовочно-богатом</p>',1200,'',1,243,1,'https://spb.qtickets.events/76900-29-iyulya-lesha-mironov-friends?fbclid=PAAabzU9L3MUbKKHkPYGWJVr7wvNH12B3Wqdf4--ENJBu_xMkZgW4_Ubnbr-I_aem_AcRpto_8OeCNTUwcuNf5tM3NhTSZ9-tAEoB-YFnYbXEmHC6hDElGicglO3b7UoOIAMI','',false,false,NULL,2,'2023-07-28 12:43:45','2023-10-25 13:08:22',NULL,'','0',18,124),
	 (1541,'Суббота в technodöner','2023-08-05-technodoner-subbota-v-technodoner','2023-08-05','2023-08-05','20:00:00','22:00:00','<p>5. august. 8 pm &gt;&gt; svetiritm<br>за пультом уже 13 лет, начинающий продюсер, работает в магазине пластинок washing machine. в сетах отдаёт предпочтение гипнотичному techno, нойзовому dub, bleep, bass, dnb, house.</p>',0,'0.0',1,194,1,'','https://t.me/technodoner',false,false,NULL,3,'2023-08-04 16:19:13','2023-10-17 02:30:29',NULL,'','0',18,106),
	 (1495,'Soma Party','2023-07-28-soma-soma-party','2023-07-28','2023-07-29','20:00:00','03:00:00','<p>В Soma на Петровском бульваре танцуют и пьют новые коктейли в компании трех музыкальных энтузиастов, которые впервые выступят вместе b2b2b<br><br>Три имени, объединенные одной страстью — искать и делиться уникальной музыкой:<br>Gaz — тотальный диггер, путешествующий по миру, увозя с каждого континента пачку редких пластинок;<br>Andys — создатель изящных подборок, после которых остается приятное и щекотливое ощущение «А что это было? Хочу еще!»;<br>Vokbud — еще один зараженный страстью «диггать» глубоко и надолго. Законченный романтик, ловко передающий эмоции через музыку</p>',NULL,'0.0',2,218,1,'','https://soma.moscow/',false,false,NULL,2,'2023-07-28 14:34:53','2023-10-25 03:07:25',NULL,'','0',18,165),
	 (1496,'White Night Party','2023-07-29-white-place-white-night-party','2023-07-29',NULL,'21:00:00',NULL,'<p>Друзья, уже в эту субботу мы встречаемся, чтобы праздновать лето на так полюбившейся нам локации!&nbsp;<br><br>Приходите пораньше, White Place откроет свои двери в 21:00<br><br>Вас ждёт маркет с интересными украшениями, которые органично дополнят ваш образ&nbsp;<br><br>А также легкая вечерняя музыка от Aaron Voodoo, приятное окружение и легкий бриз Волги.</p>',2550,'',6,245,1,'https://plombir.events/whitenight','',false,false,NULL,2,'2023-07-28 14:51:04','2023-10-23 21:08:33',NULL,'','0',18,64),
	 (1498,'Пятница','2023-07-28-stirka40-piatnica','2023-07-28',NULL,'20:00:00','00:00:00','<p>Провожаем пятницу!</p>',NULL,'0.0',1,14,1,'','http://vk.com/stirka40',false,false,NULL,2,'2023-07-28 15:05:28','2023-10-10 22:05:44',NULL,'','0',18,58),
	 (1499,'Шатёр','2023-07-29-griboedov-sater','2023-07-29',NULL,'23:00:00',NULL,'<p>Этой яркой, теплой ночью, под куполом шатра, мы создаем атмосферу легкости, свежести и ставим по-истине хорошую музыку: перкуссионное техно, свежий брейк, заводящий бейли фанк, майами бейс и гипнотический транс.&nbsp;<br><br>Сначала отплываем в Amsterdam, где вас ждет отличный саунд, свежий бар, приятные люди, бильярд, качели, цветочки, одним словом — красота !&nbsp;<br><br>Потом кочуем в Basement, где в 23:00 мы открываем черную дыру прямо на танцполе. Выбраться будет очень тяжело, да и не зачем, ведь будет так хорошо, как и хотелось</p>',NULL,'600.0',1,86,1,'','',false,false,NULL,2,'2023-07-28 19:15:08','2023-10-25 16:51:25',NULL,'','0',18,121),
	 (1500,'Vibe Room Summer Camp','2023-07-28-union-vibe-room-summer-camp','2023-07-28',NULL,'23:00:00',NULL,'<p>Vibe Room Summer Camp 28 июля в Юнионе!<br>Вторая глава нашего летнего музыкального лагеря на двух танцполах Ю в эту пятницу.<br><br>Летние вечеринки во дворе Юниона давно стали отдельной категорией искусства, наша же задача остается неизменной — подобрать для вас идеальный саундтрек этой ночи.&nbsp;<br>Специально под это дело мы соберем все главные музыкальные хайлайты последних месяцев: от вездесущего хита Peggy Gou «Nanana» до долгожданного альбома «Utopia» от Travis Scott и бережно перенесем в наши плейлисты</p>',NULL,'500.0',1,8,1,'','',false,false,NULL,2,'2023-07-28 19:21:05','2023-10-19 17:55:22',NULL,'','0',18,101),
	 (1501,'Elan Vital x Obsydian','2023-07-29-union-elan-vital-x-obsydian','2023-07-29',NULL,'22:00:00',NULL,'<p>Слияние стихий, баланс интенсивности и покоя. Энергия жизни и выражение самых глубоких смыслов. На 2 сценах Юниона</p>',NULL,'500.0',1,8,1,'','',false,false,NULL,2,'2023-07-28 19:55:44','2023-10-22 00:40:12',NULL,'','0',18,130),
	 (1502,'Funky G','2023-07-28-union-funky-g','2023-07-28',NULL,'23:00:00',NULL,'<p>Сегодня, 28 июля, в Mishke всю ночь играет Funky G.&nbsp;</p>',NULL,'',1,12,1,'','',false,false,NULL,2,'2023-07-28 20:02:50','2023-10-10 22:01:57',NULL,'','0',18,83);
