	 (1520,'Techno Time','2023-08-05-kitaiskii-letcik-dzao-da-techno-time','2023-08-05',NULL,'23:00:00',NULL,'<p>Погружение в Techno измерение<br><br>Темные и глубокие басы<br>будут вашими проводниками.<br>Вы совершите переход через портал в мир оживших механических существ, услышите их голоса и увидите их тени...</p>',700,'',2,122,1,'https://moscow.qtickets.events/77917-techno-time','',false,false,NULL,1,'2023-08-02 12:52:09','2023-10-17 17:11:37',NULL,'','0',18,61),
	 (1511,'NEV SCHOOL RAVE / RLGN','2023-08-04-ritmy-nev-school-rave-rlgn','2023-08-04',NULL,'22:00:00',NULL,'<p>Банда техно-злодеев из М13 после небольшой паузы снова возвращаются на танцпол!<br><br>В этот раз мы помогли ребятам с усилением лайнапа в лице нашего брата по злодейскому музлу маэстро RLGN&nbsp;<br>Это значит, что ё*ке точно быть!<br><br>Основная обойма этого музыкального пулемёта подготовила для вас эксклюзивные сеты и свежее звучание.&nbsp;<br>Ожидается бескомпромиссный натиск техно и брейк-бита от резидентов тусы!</p>',NULL,'0.0',1,181,1,'','',false,false,NULL,2,'2023-07-28 22:18:54','2023-10-24 16:22:51',NULL,'','0',18,204),
	 (1512,'CLUB NIGHT ','2023-08-05-rndm-club-night','2023-08-05',NULL,'22:00:00',NULL,'<p><a href="https://www.instagram.com/rndm.club">Новый <strong>CLUB NIGHT</strong></a> <a href="https://www.instagram.com/rndm.club">от</a><strong> команды RNDM</strong> с потрясающим составом вновь развернется на двух танцполах клуба уже в предстоящую субботу. <br><br>→ На мейне мы решили устроить «горячую рейвуху»: не нуждающаяся в представлении <strong>Nastya Zimens</strong> прямиком из Санкт-Петербурга, гастролирующий по Европе со своими хитами <strong>Noimage, </strong>прошедший крещение крупными рейвами<strong> Pep</strong>, <strong>Etrigan</strong> от лица резидентского состава клуба, а так же молодой артист <strong>Schatz</strong> закроет эту ночь своей серьезной бочкой. <br><br>← Уличное пространство на всю ночь будет под воздействием стильных звуков от <strong>Ромы Пташенко и Wellew</strong> как и всегда на фирменном Funktion One<strong>.</strong></p>',NULL,'800.0',2,27,1,'','https://rndm.club',false,false,NULL,1,'2023-08-01 01:32:59','2023-10-24 22:28:51',NULL,'','0',18,112),
	 (1513,'CLUB NIGHT','2023-08-05-gazgolder-club-night','2023-08-05',NULL,'21:00:00',NULL,'<p>Серия клубных вечеринок от создателей Gazgolder Club<br><br>Вечеринка на веранде с качественным саундом от именитых мастеров и новых талантливых артистов, а на мейне chill-zone и ретроспектива классических кино хитов.</p>',1000,'1500.0',2,35,1,'','',false,false,NULL,1,'2023-08-01 01:35:46','2023-10-21 16:30:15',NULL,'','0',18,148),
	 (1514,'Wonderland','2023-08-12-hi-so-terrace-wonderland','2023-08-12',NULL,'17:00:00',NULL,'<p>Радостные новости для всех ценителей электронной музыки и волшебства! <br>12 августа вновь откроется дверь в волшебный мир Wonderland, и на этот раз мы соберемся на крыше удивительного места –&nbsp; Hi So Terrace. <br>Отличная возможность собраться вместе, чтобы наслаждаться потрясающей музыкой и невероятным видом с высоты крыши <strong>Hi So Terrace.</strong> Вы сможете ощутить магию сказочного мира в полной мере, в окружении удивительной атмосферы и друзей. <br> Гостем нашего вечера станет <strong>Long arm</strong> , талантливый музыкант и мастер создания атмосферы, выступит с лайв программой, которая привнесет вечеру удивительные нотки музыкального волшебства. Его мелодичные композиции и звуки непременно затронут струны сердец всех гостей.<br><br>Мы с нетерпением ждем вас на крыше Hi So Terrace, в этот особенный вечер вы окунетесь в атмосферу волшебства и удивления. Независимо от погоды, вам не придется беспокоиться о дожде, потому что наша терраса оборудована специальными возможностями застекления. Это позволит нам сохранить тепло и комфорт даже в случае непредвиденных осадков. Ведь ничто не должно помешать вам наслаждаться праздником и волшебством этого особенного мероприятия.<br><br></p>',1500,'2500.0',1,180,1,'','https://phagamast.com',false,false,NULL,1,'2023-08-01 02:14:51','2023-10-25 08:43:40',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjRiYTkyMGNkMmM0MGFkOGVlZGVhMzFhIn0.opDyaP3nkHu-Ska8IQ6NmFK5ZHRPnl_NF9DFfH_L66E','0',18,200);
