	 (1515,'Назад в Будущее','2023-08-03-cult-nazad-v-budushhee','2023-08-03','2023-08-03','23:00:00',NULL,'<p>ВАС ЖДУТ:</p><ul><li>Призы в стиле 00-х</li><li>Невероятная фотозона с различными аксессуарами 00-х</li><li>Диджеи, которые погрузят вас в нашу атмосферу</li></ul>',700,'',1,92,1,'https://tochka-6.timepad.ru/event/2510898/?utm_source=gorodzovet','',false,false,NULL,2,'2023-08-01 16:03:20','2023-10-14 19:35:39',NULL,'','0',18,89),
	 (1516,'Праздник урожая','2023-08-04-blanc-prazdnik-urozaia','2023-08-04','2023-08-05','18:00:00','06:00:00','<p>В пятницу в московском Blanc вновь прошумит «Праздник Урожая». Колосья наливаются силой, корнеплоды призывно зовут из под плодородной земли, в воздухе витает аромат свежескошенной травы и терпкого запаха тракторной смазки. Будут пляски. Ритуальные песнопения и милые жертвоприношения во имя блага земли, сакральные танцы во имя плодов и соцветий, заговоры на урожай и тучные стада, чествование заслуженных работников полей и всеобщее единение<br><br>Дресс — код: <br>Садово — Огородные фантазии</p>',NULL,'',2,36,1,'','',false,false,NULL,1,'2023-08-02 12:16:50','2023-10-23 13:20:07',NULL,'','0',18,149),
	 (1517,'День Радио','2023-08-11-radio-den-radio','2023-08-11','2023-08-19','18:00:00','06:00:00','<p>День Радио. Любовь с первого звука.<br>С картами Highway Family вход бесплатный</p>',1500,'',2,149,1,'https://secret420.timepad.ru/event/2522290/#register','',false,false,NULL,1,'2023-08-02 12:24:33','2023-10-13 05:36:42',NULL,'','0',18,135),
	 (1518,'HEAVEN II','2023-08-04-gorod-heaven-ii','2023-08-04',NULL,'23:30:00',NULL,'<p>Второе мероприятие из серии вечеринок HEAVEN откроет свои двери для вас 4 августа. Вас ждут исполнители с уникальными стилями в жанрах: wave, witch house и других направлениях электронной музыки. Тру андер в стенах Города.</p>',600,'',2,63,1,'https://moscow.qtickets.events/77093-heaven-ii','https://vk.com/heavenunion',false,false,NULL,1,'2023-08-02 12:42:28','2023-10-20 05:06:43',NULL,'','0',18,91),
	 (1519,'Burning Series. Закрытие летнего сезона ','2023-08-04-16-tonn-presnenskii-val-burning-serie','2023-08-04',NULL,'23:30:00',NULL,'<p>Дамы и господа! 4 августа состоится закрытие летнего сезона легендарных drum and bass вечеринок Burning Series в клубе «16 Тонн», где встречаются любители той самой ламповой атмосферы, новых знакомств и судьбоносных встреч!<br>Зовите всех друзей, оповестите джангалистов, здесь должны быть все наши. До встречи!</p>',600,'',2,29,1,'https://moscow.qtickets.events/78915-burning-series-zakrytie-sezona','https://www.burningseries.ru',false,false,NULL,1,'2023-08-02 12:48:42','2023-10-12 21:24:41',NULL,'','0',18,86),
	 (1523,'BYF 360°','2023-08-12-lastocka-byf-360','2023-08-12',NULL,'23:30:00',NULL,'<p>Наикрутейший плэйс ЛАСТОЧКА - два зала, общей вместительностью до 800 человек и специально оборудованный мэйнстэйдж под 360 градусов, чтобы можно было тусоваться в любом месте: хоть в сантиметре от диджея, хоть в самом углу зала, спокойно попивая свой напиток.</p>',500,'',1,10,1,'https://spb.qtickets.events/78687-byf-3600-x-lastochka','https://vk.com/byf360',false,false,NULL,1,'2023-08-02 13:20:22','2023-10-20 22:03:06',NULL,'','0',18,132),
	 (1524,'ROOFTOP','2023-08-05-krysa-18-rooftop','2023-08-05',NULL,'18:00:00',NULL,'<p>Встреча с генгом на крыше, покупай билеты за ранее, места ограничены!</p>',500,'',1,45,1,'https://spb.qtickets.events/79554-rooftop-by-avg-05082023-1800','',false,false,NULL,1,'2023-08-02 13:27:01','2023-10-25 11:52:15',NULL,'','0',18,295),
	 (1525,' GONGGY REC ','2023-08-04-griboedov-gonggy-rec','2023-08-04','2023-08-05','20:00:00','06:00:00','<p>GONGGY REC — это настоящее путешествие сквозь мир электронной музыки, которое завораживает и позволяет полностью погрузиться в созвучия мелодий и ритмов. Команда Basement, совместно с Gonggy , устраивает по-истине большой подкаст, который в формате вечеринки раскинется на два пространства нашего клуба.<br><br>Мы продолжаем исследовать новые звуковые горизонты и представим вашему вниманию интересных молодых артистов; ярких селекционеров танцевальной и экспериментальной электронной музыки, в основе которой будут лежать techno/breakbeat/electro/jungle и house.</p>',400,'400.0',1,86,1,'','https://t.me/griboedovbasement/2699',false,false,NULL,3,'2023-08-04 12:52:56','2023-10-24 16:22:54',NULL,'','0',18,75),
	 (1526,'ECLIPSE ','2023-08-05-griboedov-eclipse','2023-08-05','2023-08-06','23:00:00','06:00:00','<p>огда луна затмевает солнце, тьма окутывает свет. Звук начинает тянуть тебя за собой и тело уже полностью под контролем прямого ритма. Но когда он ломается, начинают происходить странные вещи.&nbsp;<br><br>В эту субботу вы сможете прочувствовать на себе гармонию ритма и мелодий, темных и томных звучаний прямой бочки, легких и быстрых сбивок брейкбита; отправиться в мир электронной музыки на всю ночь.<br><br></p>',400,'600.0',1,86,1,'','https://t.me/griboedovbasement',false,false,NULL,3,'2023-08-04 13:11:33','2023-10-23 09:07:22',NULL,'','0',18,85),
	 (1527,'Testin G &  CIÉL','2023-08-04-union-testin-g-ciel','2023-08-04','2023-08-05','19:00:00','06:00:00','<p>В эту пятницу врываемся с неистовой силой. Во дворе — Testin G с обширной программой, не отпускающей заинтересованных с самого вечера и до утра. В этот раз шуметь будем как прежде: вспомним, как оно было, когда все были в сборе, ведь в городе&nbsp; отец-основатель хип-хоп комьюнити PLAST.&nbsp; Диджейский баттл и джем, танцевальный перфоманс и масштабная музыкальная часть фестивального размаха. Начало в 19:00.&nbsp;<br><br>В зале — CIÉL и их третий эпизод в U, настрой которого весьма агрессивный. DnB, breakbeat, jungle и techno, выселяющие демонов из всех, кто готов подвигаться.&nbsp;</p>',500,'500.0',1,8,1,'','https://t.me/unionbarspb/4317',false,false,NULL,3,'2023-08-04 13:36:30','2023-10-24 16:22:53',NULL,'','0',18,101);
