	 (1528,'Five2smoke & UK Dealer','2023-08-05-union-five2smoke-uk-dealer','2023-08-05','2023-08-06','23:00:00','06:00:00','<p>Громкий кроссовер, от которого Ю раскалится до температур поверхности Венеры. В эту субботу зал разнесут Five2smoke, а двор испепелят UK Dealer. Прохлады не ждите, лайн-ап уже пылает: обе сцены накроет раскаленная волна из новинок английского саунда, ту-стэпа и прочей бейс электроники.&nbsp;</p>',500,'500.0',1,8,1,'','https://t.me/unionbarspb/4327',false,false,NULL,3,'2023-08-04 13:42:00','2023-10-19 14:27:41',NULL,'','0',18,95),
	 (1537,'Amen Break','2023-08-04-q-bar-amen-break','2023-08-04','2023-08-05','22:00:00','04:00:00','<p>ДИЭНБИШЕМ ДНБ С 22 до 05 в эту пятницу!<br><br>Для вас сыграют свои самые сокровенные и скрытные плейлисты, ребята из основной команды резиднетов</p>',0,'0.0',1,161,1,'','https://instagram.com/qclub37?igshid=MzRlODBiNWFlZA==',false,false,NULL,3,'2023-08-04 15:52:04','2023-10-24 16:22:54',NULL,'','0',18,72),
	 (1538,'Пятница в Шубе ','2023-08-04-suba-bar-piatnica-v-sube','2023-08-04','2023-08-05','21:00:00','06:00:00','<p>4 августа ожидается концерт восходящей звёзды исполнительницы своих и не только песен - Mamita с аккомпанементом.&nbsp;<br><br>Этот дуэт виртуозно смешивает в своем авторском звучании такие жанры как soul и pop, с помощью ударных, синтезатора, электро примочек и конечно голоса.&nbsp;<br><br>Это надо слушать, и желательно рядом со своей половинкой.&nbsp;&nbsp;Вечер однозначно сложится романтично.<br><br></p>',0,'0.0',1,205,1,'','https://t.me/bar_shuba',false,false,NULL,3,'2023-08-04 15:55:47','2023-10-24 16:22:53',NULL,'','0',18,76),
	 (1539,'Суббота в Мотисе','2023-08-04-restobar-matiss-subbota-v-motise','2023-08-04','2023-08-05','20:00:00','04:00:00','',0,'0.0',1,159,1,'','',false,false,NULL,3,'2023-08-04 15:59:07','2023-10-24 16:22:54',NULL,'','0',18,54),
	 (1540,'Инерция','2023-08-05-q-bar-inerciia','2023-08-05','2023-08-06','22:00:00','06:00:00','<p>Ине́рция (от лат. inertia — покой, бездеятельность, постоянство, неизменность) — свойство тела оставаться в некоторых, называемых инерциальными, системах отсчёта в состоянии покоя или равномерного прямолинейного движения в отсутствие внешних воздействий, а также препятствовать изменению своей скорости (как по модулю, так и по направлению) при наличии внешних сил за счёт своей инертной массы<br><br></p>',0,'0.0',1,161,1,'','https://instagram.com/qclub37?igshid=MzRlODBiNWFlZA==',false,false,NULL,3,'2023-08-04 16:09:40','2023-10-22 23:01:00',NULL,'','0',18,78),
	 (1529,'Bad Seeds','2023-08-04-macty-bad-seeds','2023-08-04','2023-08-05','20:00:00','06:00:00','<p>friday with <a href="https://vk.com/bad__seeds">Bad Seeds</a> — это вечер винилового знакомства на площади и обскьюрных находок диджеев на мейне внутри. редкие и непопулярные треки на шаффле с любимыми хитами на пластинках.<br><br><a href="https://vk.com/thataxe">that axe</a>: пластинки с традиционным брит-попом вперемешку с различным инди-роком от 80-х и до наших дней, добавляя точечные акценты в виде электроники.<br><br><a href="https://vk.com/marikomissarovaa">sweet hard</a>: анпакинг атмосферного соула и инди, мощная волна трип-хопа и легкий хруст винила на всей площади. надеюсь, иглы не будут устраивать брейк-бит вставки.<br><br><a href="https://vk.com/maple_heart">eremeow</a> : ставит обскурную музыку 80х для абстрактных балетов. индастриал, пост-панк, минимальная и новая волна.<br><br><a href="https://vk.com/indiekator">brandon</a>: познакомит пришедших с новой гаражной и психодел-рок сценой. от австралийцев и новозеландцев, до канадцев и британцев<br><br><br></p><p><br><br></p>',0,'0.0',1,9,1,'','https://vk.com/wall-215225815_211',false,false,NULL,3,'2023-08-04 15:06:43','2023-10-24 16:22:54',NULL,'','0',18,70),
	 (1530,' RAVERHEAD','2023-08-04-diuny-raverhead','2023-08-04','2023-08-05','23:00:00','06:00:00','<p>Хардкора много не бывает, равно как и драм н бейса. Можем смело заявить, что август для нас - месяц двух танцполов.<br><br>В этот раз на открытом воздухе и в помещении, чтобы обеспечить вам музыку самого высокого качества и отличную атмосферу. Приготовьтесь к пятничному тяжелому рейв-вечеру. Готовьте свои олимпийки, панамки и удобные кроссы.<br><br>Помните, что <a href="https://vk.com/raverhead">RAVERHEAD</a> — это место, где у вас нет границ, это место, где мы ценим вашу индивидуальность, и это место, где вы можете чувствовать себя свободными.</p>',400,'500.0',1,49,1,'https://vk.com/away.php?to=http%3A%2F%2Fspb.qtickets.events%2F78596-raverhead-0408&post=-80154238_2200&cc_key=','https://vk.com/raverhead',false,false,NULL,3,'2023-08-04 15:12:12','2023-10-24 16:22:54',NULL,'','0',18,96),
	 (1531,'PG • NORTH CENTRAL','2023-08-05-diuny-pg-north-central','2023-08-05','2023-08-06','23:50:00','06:00:00','<p>а нашем party вас ожидает:<br>• Live concert фрешменов<br>• Игра в кости на котктейли<br>• Розыгрыш сертификатов<br>• Tattoo performance<br>• Photo zone<br>• Beer pong<br>…И другие интерактивы и перфомансы…<br><br><br>Dress Code<br>•Широкие джинсы<br>•Оверсайз тишки<br>•Свитшоты<br>•Банданы<br>•Дюраги<br>•Майки<br><br>Ждём ВСЕХ GANGSTERS на наш первый, и далеко не последний…<br>Petrograd North Central&nbsp;</p>',400,'400.0',1,49,1,'','https://vk.com/north_central',false,false,NULL,3,'2023-08-04 15:18:38','2023-10-17 21:00:16',NULL,'','0',18,104),
	 (1532,'Суббота в Mixed','2023-08-05-mixed-subbota-v-mixed','2023-08-05','2023-08-06','22:00:00','06:00:00','<p>5 августа собираем в баре бодрую компанию хаус диггеров со стажем и по-совместительству наших хороших товарищей.<br><br>Fanick впервые попробовал свести пластинки в возрасте тринадцати лет, а в 19 уже был резидентом петербургской хаус-мекки — легендарного бара «Дружба». в наши дни часто выступает в рамках творческого объединения К.Л.М. (Клуб Любителей Музыки).&nbsp;<br>Jax — отец вдохновитель и сооснователь магазина Washing Maschine.<br>Timbol — диггер, не нуждающийся в представлении.</p>',0,'0.0',1,59,1,'','https://instagram.com/mixed.sevcable?igshid=MzRlODBiNWFlZA==',false,false,NULL,3,'2023-08-04 15:23:21','2023-10-24 21:25:39',NULL,'','0',18,93),
	 (1533,'Пятница в Mirage bar','2023-08-04-miraz-piatnica-v-mirage-bar','2023-08-04','2023-08-05','23:59:00','06:00:00','<p>стасон закусил на то, что я включил инстасамку в два часа ночи, поэтому в пятницу я не играю, но состав всё еще стоящий (+ всегда можно ворваться, пока играет токио)</p>',500,'500.0',1,77,1,'','https://t.me/miragebar/1385',false,false,NULL,3,'2023-08-04 15:28:45','2023-10-25 12:40:12',NULL,'','0',18,84);
