	 (1534,'Суббота в Mirage bar','2023-08-05-miraz-subbota-v-mirage-bar','2023-08-05','2023-08-06','23:59:00','06:00:00','<p>в субботу снова афтерпати авг, в этот раз решили объявить официально, чтобы вы точно спланировали весь свой вечер&nbsp;<br><br></p>',500,'700.0',1,77,1,'','https://t.me/miragebar',false,false,NULL,3,'2023-08-04 15:34:37','2023-10-25 14:25:46',NULL,'','0',18,154),
	 (1535,'Bass Button','2023-08-05-ritmy-bass-button','2023-08-05','2023-08-06','22:00:00','06:00:00','<p>Как давно вы произносили эти два приятных на слух слова?<br>Спешим вас порадовать легендарным возвращением, да еще и в разгар лета!<br>Нажимаем на кнопочку и слушаем правильную музыку.</p>',0,'0.0',1,181,1,'','https://t.me/vritme_bar',false,false,NULL,3,'2023-08-04 15:39:26','2023-10-21 05:46:26',NULL,'','0',18,97),
	 (1536,'Дикое Диско Альтернативный Танцпол','2023-08-05-macty-dikoe-disko-alternativnyi-tancpo','2023-08-05','2023-08-06','21:00:00','06:00:00','<p>Дикое Диско запускает новую вечеринку под названием «Альтернативный танцпол»<br><br>"три года назад это началось со второй сцены и вскоре стало понятно, что однажды она вырастет в отдельную вечеринку. так оно и вышло. сколько же артистов, диджеев и музыкантов локальной сцены выступало на этом танцполе, удивляя нас необычным и новым.<br><br>мы хотим сделать это главной сценой.<br>вечеринкой-концертом, абсолютно мультижанровой вечеринкой, вечеринкой-бунт, вечеринкой-андеграунд,<br>вечеринкой «вау что это за песня, как её найти»<br><br>получается, без Меладзе и Агутина и без красавчика Джастина,<br>но с живыми выступлениями, гитарами и барабанами, и даже виолончелью, с роком и панк-роком, с олдскульным хип-хопом, с техно и электроникой, с экспериментальной музыкой и с музыкой из южных стран, вообще хочется достать и услышать всё самое необычное, новое, яркое — но безусловно танцевальное и прыгательное.<br><br>это вечеринка про бунтарей и альтернативщиков,<br>про секс, про fuck the system,<br>про граффити, про свободу, про драйв,<br>про уличных художников,<br>про панков нового времени,<br>про диких и бешеных.<br>про нас с вами!<br>про нашу дикую и сильную сторону."<br><br></p>',1700,'',1,9,1,'https://vk.com/away.php?to=https%3A%2F%2Fdikoe-disko.timepad.ru%2Fevent%2F2489814%2F&post=-138512047_3776&cc_key=','https://vk.com/discodikoe',false,false,NULL,3,'2023-08-04 15:49:32','2023-10-23 19:56:01',NULL,'','0',18,102),
	 (1542,'Суббота в Шубе','2023-08-05-suba-bar-subbota-v-sube','2023-08-05','2023-08-06','22:00:00','06:00:00','<p>В субботу 5-го августа пройдет выставка "Music that we love"&nbsp; художника портретиста и винилового маньяка Nataly Fox&nbsp;<br><br>В её работах невозможно не узнать популярных артистов хип-хоп и электро индустрии.<br><br>Аккомпонемент ко всему действу будет от дружественных ди-джеев. Они отыграют свои винтажные слоты в тему выставки.&nbsp;</p>',0,'0.0',1,205,1,'','',false,false,NULL,3,'2023-08-04 16:32:25','2023-10-24 09:41:34',NULL,'','0',18,68),
	 (1543,'Суббота в Матиссе','2023-08-05-restobar-matiss-subbota-v-matisse','2023-08-05','2023-08-06','20:00:00','02:00:00','',0,'0.0',1,159,1,'','',false,false,NULL,3,'2023-08-04 16:38:49','2023-10-24 21:21:03',NULL,'','0',18,61),
	 (1544,'Абстрасенция: 10 лет. Концерт Vacant (UK)','2023-08-11-krysa-18-abstrasenciia-10-let-koncert','2023-08-11',NULL,'18:00:00',NULL,'<p>Воскресный оупен-эйр фестиваля атмосферной электроники состоится в Петербурге с впечатляющим видом на акваторию Невы и крейсер Аврора. Нас ждет незабываемый вечер на высоте и музыкальное путешествие с неповторимой атмосферой в компании 8 ярких представителей атмосферной электронной сцены.<br><br>На фестивале с лайвом отыграет WoodMood из Соснового Бора, Menual из Москвы выступит с презентацией нового альбома, виниловый диггер и электронщик с большим стажем Famitsu представит мелодичные работы в лайве. Мастер аналоговых синтов и джазовых запилов kiyán, а также Jōninés из Москвы презентуют свои новые альбомы, которые недавно вышли на лейбле Абстрасенции. Unquote соберет в сете глубокий мелодичный звук с уклоном в эстетику future garage и бейса, а повелитель атмосферных танцев Numback выступит с лайвом из новых работ.<br><br>Абстрасенция традиционно представляет знаковых героев атмосферной сцены, объединяя тысячи людей, которые вдохновляются интеллектуальной и кинематографичной электроникой.</p>',1300,'',1,45,1,'https://spb.qtickets.events/79687-abstrasentsiya-10-let-kontsert-vacant-uk-na-kryshe-18-v-spb','https://t.me/abstrasension',false,false,NULL,1,'2023-08-10 12:32:59','2023-10-22 00:18:41',NULL,'','0',18,101),
	 (1545,'LADOGA Galaxy 2023','2023-08-11-ladoga-galaxy-2023','2023-08-11','2023-08-13',NULL,NULL,'<p>Время и пространство объединят нас на прекрасном побережье Ладожского озера на LADOGA Galaxy.<br>Улыбки, дружеские объятия, зажигательные танцы, уютные посиделки у костра будут создавать ту самую атмосферу, которую так ценят в ladoga family.<br><br>А мы, скромный экипаж нашего космического корабля, сделаем всё, чтобы грядущее путешествие прошло фантастически!&nbsp;<br><br></p>',2000,'',1,NULL,3,'https://ladoga.qtickets.ru/event/69207?base_color=630094','https://vk.com/ladogaopenair',false,false,NULL,1,'2023-08-10 12:39:07','2023-10-10 23:20:35',NULL,'','0',18,112),
	 (1546,'Flashback Vol. 4','2023-08-11-sekret-flashback-vol-4','2023-08-11',NULL,NULL,NULL,'<h2><br></h2><p><br></p>',1000,'',1,86,1,'https://spb.qtickets.events/77807-flashback-vol-4','',false,false,NULL,1,'2023-08-10 12:59:34','2023-10-25 00:07:58',NULL,'','0',18,123),
	 (1547,'Bassmatic Records','2023-08-25-fantomas-chateau-rooftop-bassmatic-r','2023-08-25','2023-08-26','23:00:00','07:00:00','<p>&nbsp;Музыка и лето! 25 Августа мы с радостью приглашаем вас на одно из самых ожидаемых событий этого сезона — 4-й день рождения лейбла Bassmatic Records!&nbsp;</p><p>Четыре года назад мы начали это удивительное путешествие в мир электронной музыки, и с тех пор каждый день наполняли его своей энергией.&nbsp;</p><p>Лейбл был основан для того, чтобы радовать вас нашим видением звучания музыки, качественными вечеринками, выпускать в свет новые таланты как музыкальных продюсеров, так и диджеев нашей школы!</p><p>Мы растем и развиваемся вместе, и хотим разделить с вами эту радость! &nbsp;<br><br>&nbsp;В эту дату мы также прощаемся с летним сезоном 2023 года и хотим сделать это незабываемо, на пике эмоций и музыкального вдохновения.</p><p>Празднование и проводы пройдут на крыше Fantomas Rooftop, где откроется захватывающий вид на живописную Москву.</p><p>Мы сделали для вас два танцпола, собрали практически всех резидентов, подготовили невероятное авторское световое шоу, которое унесет вас за грани сознания и погрузит в мир музыкальной гармонии и красок.</p><p>И, по традиции, будем встречать рассвет вместе, провожая летний сезон с благодарностью и теплыми воспоминаниями.</p><p>Не пропустите этому невероятную ночь, посвященный нашему др, музыке, дружбе и лету!&nbsp;</p>',2500,'',2,170,1,'','https://bassmaticrecords.com',false,false,NULL,2,'2023-08-10 18:01:19','2023-10-22 10:36:16',NULL,'','0',18,327),
	 (1548,'Кассетная вечеринка!','2023-08-12-stirka40-kassetnaia-vecerinka','2023-08-12','2023-08-13','22:00:00','03:00:00','<p>В субботу 12 августа с 22 часов и до утра четверо диджеев будут ставить музыку исключительно с пленки!</p>',NULL,'0.0',1,14,1,'','',false,false,NULL,2,'2023-08-10 18:07:41','2023-10-25 17:26:59',NULL,'','0',18,90);
