	 (1558,'Friday ','2023-08-11-bar-strelka-friday','2023-08-11',NULL,'23:00:00',NULL,'<p>Августовские ночи на «Стрелке» проходят в приятной музыкальной компании. В пятницу за пультом — петербургский диджей и резидент творческой команды «Клуб любителей музыки» Артём Орлов</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,2,'2023-08-10 20:27:22','2023-09-28 05:25:36',NULL,'','0',18,49),
	 (1559,'WAREHOUSE','2023-08-11-propaganda-warehoue','2023-08-11',NULL,'23:55:00',NULL,'<p>Пятница в «Пропаганде» — это вечеринка Warehouse, на которой её куратор Сергей Тимошов играет с опытными локальными диджеями.</p>',NULL,'500.0',2,101,1,'','',false,false,NULL,2,'2023-08-10 20:29:20','2023-09-20 02:33:49',NULL,'','0',18,28),
	 (1549,'FLUR.space','2023-08-19-flurspace','2023-08-19','2023-08-20','20:00:00','12:00:00','<p>"FLUR.space – неоновый музыкальный фестиваль в Москве!&nbsp;<br>Каждые полтора часа новый диджей и новый стиль. И невозможно успеть всё на трёх танцполах:<br><br>• Main – отдаём полностью под прямую бочку. Начнём с&nbsp;классическим хаусовым лайвом, уйдём в теч, разгонимся до пиктайм техно и 140bpm, традиционно покрошим всё на кусочки панк рейвом, провалимся в быстрые дарк диско и афрохаус, закончим вечеринку органиком и летними вайбами – ждите их, когда солнце снова взойдёт над головами, аж в 12.00.<br><br>• Resistance – традиционно отдаём под ломанные ритмы.&nbsp;<br>Будет винил! Много винила! Почти до середины ночи виниловые диджеи будут играть брейкс и драм всех видов. А когда у всех отвалятся ноги, танцпол превратится в чилл. В недавно горящем от огненных вайбов зале зазвучат дарк степ, псай чил, трип хоп, а утро закончится мелодичным и лёгким ликвидом.&nbsp;<br><br>• Garden – вечерний чилл-танцпол, где прозвучат стихи!&nbsp;<br>Аритмичная медитативная музыка и редкие даунтемпо сеты диджеев сделают из него пространство, где всегда можно зарядить свою батарейку.<br><br>• 3 танцпола<br>• 20+ диджеев с авторской концепцией звучания<br>• 16 часов непрерывного веселья все выходные&nbsp;<br>• футуристичный неоновый дресс-код и возможность выгулять самые яркие аутфиты<br>• флуоресцентные декорации и самые незабываемые фото<br><br><br></p>',5000,'',2,247,1,'https://flur.space/ticket','',false,false,NULL,2,'2023-08-10 18:13:17','2023-10-24 22:35:54',NULL,'','0',18,182),
	 (1551,'CXODKA','2023-08-26-izi-cxodka','2023-08-26','2023-08-26','16:00:00','22:00:00','<p>"Летняя, жаркая, объединяющая, все это о вечеринке CXODKA&nbsp;<br>Покупая билет, ты получаешь:<br>– приветственный коктейль, который ты можешь выбрать сам<br>– зажигательные DJ-сеты<br>– пьяные и трезвые интерактивы<br>– фирменный мерч от UNITED<br>– возможность выиграть крутой подарок от наших партнеров<br>– невероятный вайб и много новых друзей<br>Заверши это лето громко!</p>',1666,'',2,150,1,'https://vk.com/unitedevents?w=product-198836566_8316400','',false,false,NULL,2,'2023-08-10 19:01:01','2023-10-24 01:32:57',NULL,'','0',18,106),
	 (1552,'REGIME','2023-08-12-griboedov-regime','2023-08-12','2023-08-13','23:00:00','06:00:00','<p>Шоукейс от лейбла Aphotic Gaze, посвященный экстремальным жанрам постиндустриальной музыки, который вновь опрокинет свое горнило в Петербурге.&nbsp;<br><br>В эту субботу, в 23:00, клуб Грибоедов заполнит аудио-интрузивный шквал промышленного звука. Оказавшись в нем вы будете поглощены. Не все выдержат и в итоге сгинут, остальные же будут отлиты в новые формы.&nbsp;</p>',NULL,'700.0',1,86,1,'','https://t.me/griboedovbasement',false,false,NULL,2,'2023-08-10 19:40:20','2023-10-25 05:08:41',NULL,'','0',18,156),
	 (1553,' AM Podcast #3','2023-08-13-griboedov-am-podcast-3','2023-08-13','2023-08-14','18:00:00','02:00:00','<p><br>Третья серия рубрики AM Podcast, где мы показываем интересных артистов и диджеев в формате offline/online на нашей веранде Amsterdam&nbsp;<br><br>Для вас будет работать кухня и бар, где вы сможете освежиться и подкрепиться, в сопровождении приятного саунда.&nbsp;<br><br>Будем ждать вас в это воскресенье<br><br><br></p>',NULL,'0.0',1,86,1,'','',false,false,NULL,2,'2023-08-10 19:46:42','2023-10-25 16:36:57',NULL,'','0',18,72),
	 (1554,'Большой Рейв','2023-08-12-blank-bolsoi-reiv','2023-08-12',NULL,NULL,NULL,'<p>Всё бывает в первый раз. Первый приказ, намаз, экстаз. И кто-то с глазами невинного котенка спросит: «а что, так можно было?». На что мудреный житейскими проволоками Blank отвечает: «да, сынок, это не фантастика». Это то, что мы натворили.<br><br>«<strong>Большой Рейв</strong>» — переворот в игре и сближение парадигм в образцовой вечеринке, возможной только у нас. Триполярочка от слова трип и цифры три. Мейн: чуваки из «<strong>Катэраг</strong>» и чудо-Мира <strong>Shadowax</strong>. Уличные беспорядки с командой трэпсеттеров <strong>AVG</strong>, убедившими, что рэп больше не кал — на террасе. И, наконец, «Изичи» в домике. Атмосферу того самого местечка под боком в гримерке воспроизведут те самые милые соседушки и друзья, прихватившие с собой чаек, пул и флешки. Не с пустыми же руками.<br><br>Неорганично? Да ты афишу видел!?</p>',1300,'',1,1,1,'https://bigrave.ticketscloud.org/','',false,false,NULL,2,'2023-08-10 20:05:39','2023-10-24 17:18:33',NULL,'','0',18,325),
	 (1555,'Popoff Kitchen Х Resonance Moscow','2023-08-11-mutabor-popoff-kitchen-x-resonance-mosc','2023-08-11',NULL,'23:00:00',NULL,'<p>Город уже раскалится до бела и они появятся как мираж в пустыне — сказочный дворец утех с темными закоулками для хорошей порки. Со стороны Попофф воздушные поцелуи и большой толстый бит, а с команды музыкантов и визионеров Resonance — дарк электро и эксперименты над вашими душами. Они дружно поделят три танцпола, выступают b2b и объединяют музыкальные возможности.<br><br><br></p>',1700,'',2,2,1,'https://resopopoff.ticketscloud.org/','',false,false,NULL,2,'2023-08-10 20:11:59','2023-10-25 05:11:10',NULL,'','0',18,223),
	 (1556,'Deka x Ambar','2023-08-12-brusnicyn-xoll-deka-x-ambar','2023-08-12',NULL,'21:00:00',NULL,'<p>12 августа <a href="https://instagram.com/deka.drop?igshid=MzRlODBiNWFlZA==">_deka</a>&nbsp;х&nbsp;<a href="https://instagram.com/ambarspb?igshid=MzRlODBiNWFlZA==">ambar</a> представляют большой ивент на новой площадке в культурном центре Брусницин, с мощным музыкальным составом.&nbsp;<br><br><br></p>',NULL,'0.0',1,70,1,'','',false,false,NULL,2,'2023-08-10 20:19:22','2023-10-24 23:23:14',NULL,'','0',18,76),
	 (1557,'Прожиточный Минимал','2023-08-10-propaganda-prozitocnyi-minimal','2023-08-10',NULL,'23:00:00',NULL,'<p>Шоукейс московской команды «Прожиточный минимал». В лайнапе заявлены столичные адепты минималистичной электроники</p>',NULL,'0.0',2,101,1,'','',false,false,NULL,2,'2023-08-10 20:24:19','2023-09-28 12:58:43',NULL,'','0',18,8);
