	 (1560,'Asylum invites Demontage','2023-08-11-slezy-asylum-invites-demontage','2023-08-11','2023-08-12','23:00:00','09:00:00','<p>Только отгремел наш шоукейс в клубе Mutabor, а мы уже приглашаем вас, любимых рейверов, на вечеринку <strong>Asylum invites Demontage</strong> 11 августа в бар Слезы.<br><br>Молодое московское объединение <strong>Demontage</strong> являются нашими соратниками в пропаганде тяжелого звучания и настоящего андерграунда. Группировка уже успела заявить о себе громкими сейшенами в столице, а теперь готова демонтировать привычное представление о техно-рейве совместно с <strong>Asylum</strong>.</p>',NULL,'800.0',2,102,1,'','',false,false,NULL,2,'2023-08-10 20:34:52','2023-10-10 13:58:24',NULL,'','0',18,50),
	 (1575,'Счастливые Диск-Жуки','2023-08-11-mixed-scastlivye-disk-zuki','2023-08-11',NULL,'22:00:00',NULL,'<p>в далëкой Галактике, свет звëзд которой виден только в самые сильные телескопы, есть планета, жители которой влияют на жизнь землян.<br>поэтому каждое тысячелетие на Землю прилетают счастливые диск-жуки. <br>двое из них: Кефир и Матпри выступят в <a href="https://www.instagram.com/mixed.sevcable/">Mixed</a> сегодня</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,1,'2023-08-11 16:40:28','2023-10-24 21:18:11',NULL,'','0',18,29),
	 (1576,'Морская Вечеринка 2.0','2023-08-19-port-sevkabel-morskaia-vecerinka-20','2023-08-19','2023-08-20',NULL,NULL,'<h3>Ночи становятся темнее, «Морская» – еще ярче. Предпоследний уикенд лета, звезды, море, танцы до утра.</h3><p>В ночь с 19 на 20 августа – встречаемся во втором эпизоде «Морской».</p><h3>System 108</h3><p>• Невиданный привоз — золотой состав группировки System 108 прямиком из столицы: любите качественное техно — вам в УКТ;</p><h3>Odyssey</h3><p>• Карнавальный showcase <a href="https://vk.com/odysseyfestival">Odyssey</a> — бесконечная <a href="https://vk.com/odysseyfestival">музыкальная</a> алхимия — на Морской площади;</p><h3>Сava Disco</h3><p>• <a href="https://vk.com/cavadisco">Çava Disco</a> шумно, как водопад шампанского, врывается в Атриум, совсем новую площадку, которую мы придумали специально для вас;</p><h3>Blank</h3><p>• В Вольте — горячо любимое семейство клуба <a href="https://blankclub.ru/">Blank</a>, братское транс-электронное сердце с другого берега Невы;</p><h3>Roots United и Клуб Любителей Музыки</h3><p>• На набережной — мощнейший коллаб от <a href="https://vk.com/fruitsunited">Roots United</a> и Клуба Любителей Музыки. Восьмичасовой беспредел из всего, о чем вы даже не мечтали;</p><h3>Ритмы и Provocateur Group</h3><p>• В Цеху Диско <a href="https://t.me/vritme_bar">Бар Ритмы</a> и <a href="https://t.me/eventprovocateur">Provocateur Group</a> решили объединиться во имя еды, напитков, аксессуаров и хаус-музыки. Неистовый шоппинг параллельно с танцами до утра.</p><p><figure data-trix-attachment="{&quot;contentType&quot;:&quot;image&quot;,&quot;height&quot;:228,&quot;url&quot;:&quot;https://image.sevcableport.ru/w:342/h:0/aHR0cHM6Ly9pbWFnZS5zZXZjYWJsZXBvcnQucnUvdzoyMDAwL2g6MC9hSFIwY0hNNkx5OXpaWFpqWVdKc1pYQnZjblF1Y25VdlkyOXVkR1Z1ZEM5dFlYZ3RkejB5TURBd0wybHRZV2RsY3k5aGVuRmpjSGw1TWk5d2NtOWtkV04wYVc5dUwyTmhZbVptTWpKa1pqSmxZMkkzWlRBMk5UZ3daV1UxWm1VelkyWmhOelV4WWpCbFpXVXhNak10TVRJNE1IZzROVE11YW5Cbg==&quot;,&quot;width&quot;:342}" data-trix-content-type="image" class="attachment attachment--preview"><img src="https://image.sevcableport.ru/w:342/h:0/aHR0cHM6Ly9pbWFnZS5zZXZjYWJsZXBvcnQucnUvdzoyMDAwL2g6MC9hSFIwY0hNNkx5OXpaWFpqWVdKc1pYQnZjblF1Y25VdlkyOXVkR1Z1ZEM5dFlYZ3RkejB5TURBd0wybHRZV2RsY3k5aGVuRmpjSGw1TWk5d2NtOWtkV04wYVc5dUwyTmhZbVptTWpKa1pqSmxZMkkzWlRBMk5UZ3daV1UxWm1VelkyWmhOelV4WWpCbFpXVXhNak10TVRJNE1IZzROVE11YW5Cbg==" width="342" height="228"><figcaption class="attachment__caption"></figcaption></figure></p><p><br><br></p><p><br></p>',2000,'',1,177,3,'https://sevcableport.ru/ru/afisha/morskaya-2-0','https://sevcableport.ru/ru/afisha/morskaya-2-0',false,false,NULL,1,'2023-08-11 17:02:56','2023-10-24 07:27:26',NULL,'','0',18,543),
	 (1561,'CORPUS ONE Summer edition vol.3','2023-08-11-gazgolder-corpus-one-summer-edition-vol','2023-08-11',NULL,'21:00:00',NULL,'<p>Последний месяц лета начнём с хороших новостей — август обещают жаркий.<br>Ещё успеем пошуметь тёплой летней ночью!&nbsp;<br><br>Слёт ценителей приятных ритмов назначен на пятницу 11 августа в любимом клубе Газгольдер.<br><br>Погружение в тонкие материи хаус и минимал музыки, расклад матрицы световых путешествий и фирменный вайб под руководством команды Corpus One.&nbsp;<br><br>Не пропустите финальный аккорд этого лета!</p>',1200,'',2,35,1,'https://qtickets.ru/iframe?event_id=79589&lang=ru&host=moscow.qtickets.events&winclose=1&integrations%5Bgoogleanalytics%5D%5BtrackingId%5D=UA-32309773-2&integrations%5Bgoogleanalytics%5D%5BclientId%5D=895193004.1691053945','',false,false,NULL,2,'2023-08-10 20:43:09','2023-10-24 21:22:40',NULL,'','0',18,62),
