	 (1564,'RABOTA','2023-08-11-rndm-rabota','2023-08-11',NULL,'23:00:00',NULL,'<p>Москва, встречай!<br>Рабочий коллектив из Ростова-на-Дону едет в командировку!<br><br>Rabota140 - это ростовская промогруппа, которая существует уже более двух лет. Мы прочно стоим на ногах в родном городе, но нужно расти! И именно поэтому настало время отправиться в столицу, где с уверенностью отработаем на дебютной вечеринке.&nbsp;</p>',500,'700.0',2,27,1,'','',false,false,NULL,1,'2023-08-11 14:28:43','2023-10-24 21:01:29',NULL,'','0',18,66),
