	 (1567,'Ketch Up!','2023-08-12-ketch-up-ketch-up','2023-08-12','2023-08-13','23:00:00','06:00:00','<p>Каждую пятницу и субботу Ketch Up на Кузнецком мосту превращается в место притяжения всех любителей отличной музыки, коктейлей и танцев под сеты диджеев.</p><p><br><br></p>',NULL,'0.0',2,227,1,'','https://msk.ketch-up.ru/action/raspisaniye-vechernikh-setov-v-ketch-up-na-kuznetskom-mostu',false,false,NULL,1,'2023-08-11 15:18:02','2023-10-05 22:57:04',NULL,'','0',18,23);
