	 (1568,'Виниловые Вечера - пятница','2023-08-11-bar-kotelnaia-vinilovye-vecera-piatn','2023-08-11',NULL,'19:00:00',NULL,'<p>Взаимосвязь с музыкой сильнее, чем я мог себе представить. Мысли воплощаются в музыку, а музыка в танец.&nbsp;<br>Танец – тонкая материя языка человеческого тела говорящая на всех языках мира. Танец открывает нас миру, мы открываем мир в себе.&nbsp;<br><br>Расписание бара «Котельная».&nbsp;</p>',NULL,'0.0',2,137,1,'','',false,false,NULL,1,'2023-08-11 15:24:43','2023-10-16 22:32:25',NULL,'','0',18,30),
	 (1569,'Виниловые Вечера - Суббота','2023-08-12-bar-kotelnaia-vinilovye-vecera-subb','2023-08-12',NULL,'19:00:00',NULL,'<p>Взаимосвязь с музыкой сильнее, чем я мог себе представить. Мысли воплощаются в музыку, а музыка в танец.&nbsp;<br>Танец – тонкая материя языка человеческого тела говорящая на всех языках мира. Танец открывает нас миру, мы открываем мир в себе.&nbsp;<br><br></p>',NULL,'0.0',2,137,1,'','',false,false,NULL,1,'2023-08-11 15:28:49','2023-10-17 05:34:28',NULL,'','0',18,37),
	 (1570,'ЖОСТКО КРУТАЯ ТУСА х ДР МАШКОВА','2023-08-13-radio-zostko-krutaia-tusa-x-dr-maskova','2023-08-13',NULL,'23:00:00',NULL,'<p>Жостко круто будет в субботу, ведь что бы вы не планировали, препременно окажетесь на супер-крутой тусе во двор Радио/Суперметалла<br><br>Отмечаем день рождения Машкова, значит весело будет сильно жестче обычного. Смотрите не перестарайтесь!&nbsp;<br>Лайн-ап с самыми сладкими резидентами и звездами, включая Мирель, к вечеринке прилагается. Скорее всего твои друзья тоже&nbsp; будут тут, ждём только тебя!&nbsp;<br><br>За афишу спасибо Куджею!</p>',1500,'',2,149,1,'','',false,false,NULL,1,'2023-08-11 15:41:05','2023-10-03 13:29:23',NULL,'','0',18,80),
