	 (1577,'Farewell to the Tower ','2023-08-12-suba-bar-farewell-to-the-tower','2023-08-12','2023-08-13','20:00:00','03:00:00','<p>12-го августа в субботу нас ждёт интересная подборка старых знакомых и совершенно новых диджеев.</p><p>Вечеринка под названием&nbsp;</p><p>"Farewell to the tower"&nbsp; посвящается секретной локации, которая была репетиционной базой, и к сожалению больше не может существовать на прежнем месте. По этому случаю все кто принимал участие в данном проекте решили отыграть свои сеты в Шуба бар. &nbsp;</p>',NULL,'0.0',1,205,1,'','',false,false,NULL,1,'2023-08-11 17:09:20','2023-10-21 09:26:38',NULL,'','0',18,49),
	 (1578,'BASSейн','2023-08-16-macty-bassein','2023-08-16',NULL,'18:00:00',NULL,'<p>ловим последние жаркие дни этого лета и предлагаем освежиться раскачавшись на вечеринке bassейн!<br>волны бейса, густое пульсирующее эхо, глубокое и низкое звучание, что бьет прямо в тело и отражается вибрацией в твоем бокале.</p>',300,'',1,9,1,'https://vk.com/away.php?to=https%3A%2F%2Fspb.radario.ru%2Fevents%2F2020044&post=-138512047_3799&cc_key=cq2RuY','',false,false,NULL,1,'2023-08-11 17:58:29','2023-10-23 10:35:36',NULL,'','0',18,60),
	 (1579,'ORANGE RAVE with GOOM GUM','2023-08-12-fantomas-chateau-rooftop-orange-rave','2023-08-12',NULL,NULL,NULL,'<p>Самое яркое в прямом смысле этого слова<strong> событие, которого мы ждали целых 2 года - ORANGE RAVE!<br></strong><br>А это значит, что мы готовим сочные, <br><strong>оранжевые образы, дополняем их яркими аксессуарами, берем самых позитивных друзей и окунаемся в оранжевую атмосферу легкости, беззаботности и счастья!<br>Хедлайнерами мероприятия станут только что вернувшиеся с Tomorrowland&nbsp; GOOM GUM! &nbsp;<br>GOOM GUM - российский электронный дуэт, покоривший без малого весь мир своим модным Indie Dance звучанием.</strong></p>',1800,'',2,170,1,'https://www.moscow.qtickets.events/79613-orange-rave','',false,false,NULL,1,'2023-08-11 18:01:54','2023-10-24 21:05:41',NULL,'','0',18,103),
	 (1580,'Saturday','2023-08-12-mixed-saturday','2023-08-12',NULL,'22:00:00',NULL,'<p>Grsha — продюсер, диджей, идеолог промо 12:34. успел выступить в разных уголках нашей страны и стать частым гостем кипрского клуба S//IP. отметился релизами на различных европейских лейблах и сетом в эфире французского Rinse FM.<br><br>поддержат Grsha — Poly, основатель лейбла Tur, резидент и арт директор Mixed, а также Kekoriy — владелец лейбла Utro и близкий друг бара&nbsp;</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,1,'2023-08-12 15:34:36','2023-10-10 21:41:17',NULL,'','0',18,44);
