	 (1585,'Timofey','2023-08-12-miska-bar-timofey','2023-08-12',NULL,'21:00:00',NULL,'<p>Сегодня, 12 августа, в Mishke весь вечер и всю ночь играет Тимофей.&nbsp;<br><br>80-е, редкие песни для танцев, диско, хип-хоп.&nbsp;<br><br>Некоторые вечеринки с Тимофеем бывают просто незабываемыми. Загадаем, чтобы и сегодня была такая.</p>',NULL,'0.0',1,12,1,'','',false,false,NULL,1,'2023-08-12 15:56:39','2023-10-24 20:57:27',NULL,'','0',18,63),
	 (1587,':data','2023-08-19-rndm','2023-08-19',NULL,'21:00:00',NULL,'<p>В субботу 19 августа мы встречаемся на последней вечеринке уходящего лета на двух танцполах RNDM.<br><br>По традиции стартуем с 21:00 на террасе клуба с приятной легкой музыкой и летним баром</p>',700,'',2,27,1,'https://moscow.qtickets.events/80340-data','',false,false,NULL,1,'2023-08-12 16:02:54','2023-10-24 21:02:05',NULL,'','0',18,72),
	 (1588,'ГРЯДЁТ','2023-08-12-community-moscow-griadet','2023-08-12',NULL,'22:00:00',NULL,'<p>По традиции вы услышите андерграундный прогрессив хаус, получите отличный сервис и прочувствуете качество во всем<br><br>Для большего впечатления мы пригласили <a href="https://www.instagram.com/fortycatsgram/">Forty Cats,</a> чьи треки завоевали признание во всем мире и отличаются деликатностью интеллектуального звучания.</p>',1000,'2000.0',2,58,1,'https://www.moscow.qtickets.events/79689-g-r-ya-d-e-t-progressive-forty-cats?qcode=bilet','',false,false,NULL,1,'2023-08-12 16:11:29','2023-10-21 17:51:02',NULL,'','0',18,53),
	 (1589,'NEWALGORITHM 2.0','2023-08-26-factory-3-newalgorithm-20','2023-08-26','2023-08-27','23:59:00','06:00:00','<h3>Друзья, лето близится к концу, а это значит, что мы заходим на следующий круг‼️ 26 августа N//A-Promo собирается в клубе Factory 3, чтобы вновь запустить тусовочный Алгоритм.&nbsp; В этом году мы решили добавить больше баса и напористого грува.</h3><p><br></p>',300,'',1,7,1,'https://shymka.timepad.ru/event/2531676/','',false,false,NULL,1,'2023-08-12 16:24:20','2023-10-15 22:20:07',NULL,'','0',18,128),
	 (1590,'Hypnotica','2023-08-12-blanc-hypnotica','2023-08-12',NULL,'16:00:00',NULL,'<p>Лето еще продолжается и впереди всех нас ждет еще много теплых ночей, музыкальных открытий, приключений и вдохновений. Однако для Hypnotica мероприятие в Blanc станет последним в этом летнем сезоне, поэтому трубим общий сбор и очень хотим со всеми вами еще раз поделиться эмоциями, выраженными через любимую музыку. Хотим обниматься со старыми друзьями, и завести новые знакомства. Хотим раскрасить уютнейший дворик Blanc в самые живописные цвета и подарить каждому из вас то, что нельзя купить — букет из сложно описываемых, но очень теплых и приятных чувств. Для этого 12 августа собираем друзей и единомышленников, чтобы вместе прожить и запомнить еще одну летнюю ночь и вернуться уже осенью с новыми планами, эмоциональными сюрпризами и фантастической музыкальной палитрой.</p>',1500,'',2,36,1,'https://hypnoticaxblanc.ticketscloud.org/','',false,false,NULL,1,'2023-08-12 16:31:33','2023-10-06 19:25:09',NULL,'','0',18,47),
	 (1591,'UNION FESTIVAL','2023-08-26-dizain-zavod-union-festival','2023-08-26',NULL,'12:00:00',NULL,'<p>В последние выходные лета пройдет ежегодный урбанистический фестиваль Union, объединяющий хип-хоп исполнителей и представителей электронной музыки. 3 уникальные сцены, 50 артистов, 35 часов без перерыва.<br><br>Гостей фестиваля не оставят равнодушными разнообразные активности: перфомансы, арт-галерея, лекции, настоящий фестивальный квест и многое другое, что вам предстоит увидеть и услышать на пути к дате.</p>',1000,'',2,188,3,'','',false,false,NULL,1,'2023-08-12 16:39:19','2023-10-25 13:03:57',NULL,'','0',18,209);
