	 (1592,'Мособлэлектро x Traxual','2023-08-12-slezy-mosoblelektro-x-traxual','2023-08-12','2023-08-13','23:00:00','06:00:00','<p>Москва встречает Мособлэектро и Traxual в Слезах. Но вам лучше самим проверить тусовку с интересными диджеями и сразу несколькими именитыми хедлайнерами за чип прайс на уютных танцполах бара в Агломерате. Электро, техно и пампящий гетто-тек обеспечат танцевальное настроение и максимальный дестрой локации.</p>',500,'',2,102,1,'https://moscow.qtickets.events/78540-mosoblelektro-x-traxual','https://vk.com/moextraxual1208',false,false,NULL,1,'2023-08-12 16:50:34','2023-09-25 14:22:16',NULL,'','0',18,27),
	 (1593,'круговая порука','2023-08-12-prostranstvo-pole-krugovaia-poruka','2023-08-12','2023-08-13','23:00:00','06:00:00','<p>В субботу вернется «круговая порука» — новый полевой формат, в котором один постоянный герой (Игорь Хипушит) встанет в начале вечеринки за диджейку и покинет ее только в самом конце, когда отыграет B2B со всеми оппонентами. В числе тех самых оппонентов Errortica, Masha Volum и Amal.Чего ждать сами не знаем, но будет крайне танцевально.</p>',800,'',2,46,1,'https://porukakrugovaya.ticketscloud.org/','',false,false,NULL,1,'2023-08-12 16:54:55','2023-10-25 14:30:09',NULL,'','0',18,94),
	 (1594,'Фестик 2023','2023-08-26-supermetall-festik-2023','2023-08-26',NULL,'15:00:00',NULL,'<p>Последний викенд этого лета мы проведём в кругу нашей большой семьи, чтобы вместе проводить сезон и запечатлеть его в своей наивысшей точке. Мультижанровое кросскультурное событие, вобравшее в себя лучшее из мира музыки, моды, еды и другого модерн-арта. Музыкальная программа мероприятия растянется на два дня, 26 и 27 августа, и будет состоять из целой россыпи сетов и концертов — первые имена в уже в лайнапе. Будет еще много сюрпризов, которые мы готовим для вас вместе с нашим лучшим другом — МТС.</p>',1500,'2500.0',2,119,3,'https://live.mts.ru/moscow/concerts/festik-2023','',false,false,NULL,1,'2023-08-12 16:58:31','2023-10-23 16:29:04',NULL,'','0',18,1108),
	 (1625,'CLUBNIGHT','2023-08-19-gazgolder-clubnight','2023-08-19',NULL,'21:00:00',NULL,'<p>Gazgolder Club продолжает серию вечеринок Club Night. Встречаем рассвет на открытой веранде под стильный саунд от резидентов и друзей клуба. На мейне chill-zone и ретроспектива кино хитов.</p>',1000,'',2,35,1,'https://gazgolderclub.ru/#clubnight','',false,false,NULL,2,'2023-08-17 22:06:33','2023-10-20 20:16:36',NULL,'','0',18,67),
	 (1595,'Interplay Events','2023-08-18-fantomas-chateau-rooftop-interplay-e','2023-08-18','2023-08-19','23:00:00','06:00:00','<p>Interplay на высоте, поближе к звёздам — пройдет на крыше FANTOMAS в самом сердце столицы уже 18 августа. FANTOMAS ROOFTOP - легендарное место, на котором проходило многочисленное количество топ вечеринок Москвы. Уникальная площадка расположенная на крыше обеспечивает прекрасный вид на город и болотную набережную, что создает особую атмосферу и делает каждую вечеринку более запоминающейся. Открытая терраса с раздвижной крышей и уличными обогревателями, VIP балкон, закрытая зона с камином и несколько баров. 18 августа, освобождайте дату, это пропустить нельзя.</p>',1500,'',2,170,1,'','',false,false,NULL,1,'2023-08-12 17:04:53','2023-10-25 11:14:30',NULL,'','0',18,117),
	 (1596,'Pink Perfect','2023-08-25-prostranstvo-pole-pink-perfect','2023-08-25','2023-08-26','23:00:00','08:00:00','<p>Финальная пятница уходящего лета с VENT. Замутили котёл из приверженцев техно, электро, эйсида и даже из хауса. Из Еревана ангажирован самобытный Sexy French Movements. Два танцпола с артом от художницы Anastasia Mats и инсталляциями от МХПИ и Александра Тито в виде скульптур дьяволёнка и чупа-чупсов. Мерчстор с дизайном Андрея Навицкого</p>',800,'1200.0',2,46,1,'https://ventevent.timepad.ru/event/2526620/','',false,false,NULL,1,'2023-08-12 17:10:15','2023-10-24 04:13:20',NULL,'','0',18,162),
	 (1597,'Majestic','2023-09-16-pravda-majestic','2023-09-16','2023-08-17','23:00:00','07:00:00','<p>16 сентября, Москва, клуб Pravda! Встречаем осень и открытие сезона от T.L.N. Promo! <br>На рейве Majectic соберутся лучшие представители отечественной Psytrance сцены во главе с хэдлайнером из Израиля, гуру high-tech и psy звучания — Oxidaksi! <br>cА также, при поддержке наших друзей из Space Reality и Грядёт Project будет действовать второй танцпол под открытым небом. Вас ждёт много любимой музыки, тематическое шоу, декор и непередаваемая атмосфера бесконечной рейв-ночи. Будь с нами, проводим летом вместе!</p>',1200,'',2,20,1,'','',false,false,NULL,2,'2023-08-16 12:17:24','2023-10-20 05:06:43',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,186),
	 (1598,'Twenty One Pilots Tribute','2023-08-26-live-stars-twenty-one-pilots-tribute','2023-08-26','2023-08-26','19:00:00','22:00:00','<p>Откройте для себя уникальное путешествие сквозь музыкальный ландшафт группы Twenty One Pilots и их вдохновляющую историю. На этом трибьют-концерте мы предлагаем вам погрузиться в мир многообразия звуков и эмоций. От динамичных и ритмичных риффов до глубоких и лиричных мелодий, вы почувствуете настоящий драйв и истинное волшебство музыки Twenty One Pilots.<br>Талантливые музыканты, исполняющие хиты Twenty One Pilots, умело переносят на сцену интенсивность и чувственность их песен. Каждая нота, каждое слово пропитаны смыслом и глубиной, и вы почувствуете, как музыка проникает в самые глубины души.<br>Трибьют-концерт Twenty One Pilots - это не только музыкальный вечер, но и возможность совместно отдать дань уважения этой выдающейся группе. Здесь вы найдете единомышленников, разделяющих любовь к творчеству Twenty One Pilots, и сможете проникнуться духом сообщества.<br>Приготовьтесь к погружению в интригующую музыкальную сагу, где каждая нота становится камнем в огромной мозаике эмоций.</p>',600,'',2,71,2,'','',false,false,NULL,2,'2023-08-16 13:01:56','2023-10-14 11:42:17',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,75),
	 (1599,'Молодость простит! Summer Fest.','2023-08-26-vk-muzyka-summer-stage-molodost-prosti','2023-08-26','2023-08-27','23:00:00','06:00:00','<p>Мы соскучились, поэтому встречаемся 26 августа на самой летней площадке Москвы — «VK Музыка Summer Stage», чтобы вместе проводить это лето и зарядиться энергией музыки и танцев на год вперед!</p>',NULL,'',2,167,3,'','https://vk.com/molodostrave',false,false,NULL,2,'2023-08-16 13:13:24','2023-10-11 19:35:58',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,180),
	 (1600,'Silent eXperiment','2023-08-16-motyga-silent-experiment','2023-08-16',NULL,'20:00:00',NULL,'<p>Silent eXperiment — импровизационный проект, соединяющий звучание традиционного гитарного психоделического рока и современную живую электронику. Гитарные искажения и циклы — основная ткань звука, в которую вплетены обертонное пение, флейты, шёпоты и шорохи.</p>',NULL,'0.0',2,114,1,'','',false,false,NULL,2,'2023-08-16 13:42:59','2023-09-28 13:32:24',NULL,'','0',18,22);
