	 (1601,'4 ПОЗИЦИИ БРУНО','2023-09-30-mod-4-pozicii-bruno','2023-09-30','2023-09-30','19:00:00','22:30:00','<p>Санкт-Петербург, 30 сентября, 4 Позиции Бруно в клубе MOD.<br>В этот вечер: большое и уютное осмысление нового альбома, а также песни с релизов последнего периода. 1000% токсик даб и токсик рэйв.</p>',1100,'',1,113,1,'','',false,false,NULL,2,'2023-08-16 14:11:01','2023-10-24 04:29:28',646,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,293),
	 (1602,'4 ПОЗИЦИИ БРУНО','2023-10-01-pravda-4-pozicii-bruno','2023-10-01','2023-10-01','19:00:00','22:00:00','<p>4 Позиции Бруно в клубе Pravda.<br>В этот вечер: большое и уютное осмысление нового альбома, а также песни с релизов последнего периода. 1000% токсик даб и токсик рэйв.</p>',1300,'',2,20,2,'','',false,false,NULL,2,'2023-08-16 14:18:38','2023-10-25 15:08:29',646,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,258),
	 (1603,'КРУЖОК х FAM','2023-08-18-blank-kruzok-x-fam','2023-08-18',NULL,'23:00:00',NULL,'<p>Бременские музыканты из клуба Кружок, потеряв в апреле свое место ездят по России с шоу-кейсами, а 18 августа вернутся в родной Петербург, чтобы сделать большую вечеринку при поддержке объединения Fam в Бланке.&nbsp;<br><br>На двух сценах клуба поместились почти все резиденты и специальный гость — Мистер Малой!&nbsp;</p>',1000,'',1,1,1,'','',false,false,NULL,2,'2023-08-16 14:43:42','2023-10-25 14:27:56',NULL,'','0',18,106),
	 (1613,'МОДНЫЙ ГОД','2023-08-18-ritmy-modnyi-god','2023-08-18','2023-08-19','22:00:00','06:00:00','<p>Ну ничёс-се! Ребятам из КУЛЬТУРЫ целый год!&nbsp;<br>В честь их Дня Рождения состоится пати-полным ходом в эту пятницу!&nbsp;<br><br>Время летит, музыка играет, все танцуют и кутят! Ребята говорят за это спасибо вселенной и всем вам конечно же!&nbsp;<br><br>Разумеется это только начало пути длинною в жизнь! Планы у ребят мама, не горюй! А мы поможем им в их осуществлении! Ура!<br>&nbsp;<br>В лайнапе представлены все самые важные люди проекта, те, кто был еще до его создания и у его истоков. Встречаем!</p>',NULL,'0.0',1,181,1,'','',false,false,NULL,2,'2023-08-16 16:38:43','2023-10-21 17:21:05',NULL,'','0',18,97),
	 (1604,'EMBRYO','2023-09-08-mutabor-embryo','2023-09-08',NULL,'23:00:00',NULL,'<p>REB↻RN. В коконе становится слишком тесно и значит - наступило время перерождаться. Индустриальный меланизм достиг апогея в твоём total black dress, а крылья жаждут слиться с ночью.&nbsp;<br><br>На этот раз rave-experience состоится на одной из самых известных площадок СНГ - Mutabor, чтобы вы смогли в полной мере прочувствовать масштабы своего очередного высвобождения. Пульсирующий адреналин до 180 bpm, побуждающая прямая бочка и завораживающий immersive art позволят вновь раскрыть себя миру в неистовых танцах.<br><br>Для воплощения фантасмагоричной техно-мистерии Embryo мы объединили свои усилия с творческими и идеологическими сподвижниками - московской командой RED SHEEP, воспринимающей каноничный и сложный техно-саунд 90х как один из способов познания. Экзистенциальные контрасты двух залов позволят достичь полярного баланса и совершить свою очередную трансформаторную эволюцию.<br><br></p>',1000,'',2,2,1,'https://synesthesia.timepad.ru/event/2488102/','',false,false,NULL,2,'2023-08-16 15:16:02','2023-10-24 21:13:13',NULL,'','0',18,474),
	 (1605,'Резьба ','2023-08-25-sekret-rezba','2023-08-25',NULL,'23:59:00',NULL,'<p>Резьба опять буквально врезается в историю Петербургского рейва, никого не оставляя равнодушным.<br>Как и всегда мы собрали лучших артистов подземелья, настоящих злобарей, чтобы опять устроить безумный шабаш.<br><br>В последнюю пятницу этого лета мы объединяем всех ценителей андеграундной рейв культуры для очередного витка истории Резьбы.</p>',999,'',1,7,1,'https://spb.qtickets.events/78462-rezba','',false,false,NULL,2,'2023-08-16 15:53:45','2023-10-24 21:25:57',NULL,'','0',18,149),
	 (1606,'Boat Party','2023-08-20-korabl-boat-party','2023-08-20',NULL,'18:00:00',NULL,'',1150,'',1,202,1,'https://spb.qtickets.events/80058-boat-party','',false,false,NULL,2,'2023-08-16 15:59:04','2023-10-24 21:14:32',NULL,'','0',18,79),
	 (1607,'Абстрасенция на Неве','2023-08-19-korabl-abstrasenciia-na-neve','2023-08-19',NULL,'18:00:00',NULL,'<p>В честь десятилетия Абстрасенция на один вечер и ночь продолжит атмосферные путешествия на корабле.<br><br>Путешествие состоится в двух сеансах с одинаковой программой — в 18:00 и 23:59. Количество мест строго ограничено.</p>',2100,'',1,202,1,'https://spb.qtickets.events/80255-abstrasentsiya-2023-na-neve','https://t.me/abstrasension',false,false,NULL,2,'2023-08-16 16:06:26','2023-10-21 03:29:52',NULL,'','0',18,77),
	 (1608,'AFTER OPEN AIR','2023-08-18-gas-after-open-air','2023-08-18','2023-08-19','23:59:00','06:00:00','<p>В пятницу мы встретимся с вами, чтобы насладиться последними теплыми деньками! Это лето выдалось поистине увлекательным — фестиваль, вечеринка на базе отдыха, привозы артистов, и как вы знаете, впереди нас ждут не менее классные ивенты и артисты — уже 25 и 27 августа&nbsp;<br><br>Этот ночной ивент в клубе GAS посвящен именно вам, гостям наших вечеринок, поэтому мы постарались сделать все возможное, чтобы эта тусовка осталась в памяти надолго!</p>',500,'',1,57,1,'https://spb.qtickets.events/80315-after-open-air-1808','https://t.me/atlantaafterparty',false,false,NULL,2,'2023-08-16 16:09:57','2023-10-21 14:49:54',NULL,'','0',18,169),
	 (1609,'СИЯНИЕ','2023-08-15-action-club-siianie','2023-08-15',NULL,'23:45:00',NULL,'<p>Слияние старого и нового, наглядная градация и реинтерпретация так полюбившегося в России вичхауса.<br>мощный звук и субкультурный уют, которые навеют приятные воспоминания тем, кто застал зарождение жанра и подарят интересный опыт тем, кто услышит впервые..</p>',700,'',1,47,1,'','https://vk.com/club221655724',false,false,NULL,2,'2023-08-16 16:13:45','2023-08-16 16:19:41',NULL,'','0',18,1);
