	 (1610,'Gate VII','2023-08-26-mutabor-gate-vii','2023-08-26',NULL,'22:00:00',NULL,'<p>Пока кто-то ищет свой gate в аэропорту, самые классные дрейфуют в сторону Мутабора! В очередной раз летим-свистим в стенах любимого Мутика. Все пройдёт масштабно, весело и как мы любим.&nbsp;<br><br>Техно нон-стопом на всех сценах + фирменное «гейтовское афтерпати». Не забываете восполнять свой водно-солевой баланс в баре клуба, ибо тусоваться в эту ночь придется до упора! с 26 по 28 августа, в арт-центре Mutabor пройдет 7-е событие серии GATE.</p>',1000,'',2,2,1,'https://www.gate7.ticketscloud.org','',false,false,NULL,2,'2023-08-16 16:22:12','2023-10-24 23:00:18',NULL,'','0',18,250),
	 (1611,'ОТКРОВЕНИЕ','2023-08-19-blank-otkrovenie','2023-08-19',NULL,NULL,NULL,'<p>Бланкуля, Бланк, Бланкусик в своем репертуаре! Опять замутил безумную вечеринку для любителей техно и постукивания прямой бочки.&nbsp;<br><br>«Откровение» — серия вечеринок, которую мы давно знаем и любим. В этот раз будет особенное откровение, ведь вечеринка пройдет по эгидой московского промо «Черта»!&nbsp;<br>Уверенный шоукейс со всеми резидентами «Черты», той самой, уже знаковой и для Питерской публики.&nbsp;<br><br>Ну что? Получается идем!&nbsp;</p>',NULL,'1000.0',1,1,1,'','',false,false,NULL,2,'2023-08-16 16:27:16','2023-10-25 15:21:38',NULL,'','0',18,106),
	 (1612,'‍️‍‍Братик и сестренка на Радуге','2023-08-18-blanc-bratik-i-sestrenka-na-raduge','2023-08-18',NULL,'23:00:00',NULL,'<p>Радуга — большая семья‍‍‍, в которой все — братики‍‍ и сестрёнки‍. Поэтому в пятницу Радуга️ и Братик и Сестрёнка‍️‍‍ сливаются в единый тус-тус<br><br>Расклад классический: вечером двор по регистрации, а потом олл найт танцпол‍️ внутри</p>',1000,'',2,36,1,'https://radugadiscoclub.ru/e180823','',false,false,NULL,2,'2023-08-16 16:32:49','2023-10-23 20:50:26',NULL,'','0',18,136),
	 (1615,'BALAGAN','2023-08-18-gazgolder-balagan','2023-08-18',NULL,'21:00:00',NULL,'<p>Соскучились? Добро пожаловать на второй сеанс, длиною в ночь, знаменитый BALAGAN приоткрывает занавес! Команды 16OM и HEY, LOCATION! приготовили для тебя музыкально - цирковое путешествие в ВООБРАЖАРИУМ ДОКТОРА ПАРНАСА. Вас ожидает два танцпола, реальный мир и мир, где воображения правят Вселенной!<br><br>Будь в центре масштабного представления под шум и гам клоунов, жонглеров, акробатов, лилипутов или же рискни пройти сквозь заветное зеркало и проверь свои фантазии на прочность, а возможно и сыграй в азартные игры с самим дьяволом. Выбор за тобой!</p>',1690,'',2,35,1,'https://balagan.ticketscloud.org/','',false,false,NULL,2,'2023-08-16 17:31:24','2023-10-21 04:03:15',NULL,'','0',18,104),
	 (1616,'Hypnotic Tango','2023-08-18-jane-hypnotic-tango','2023-08-18',NULL,'23:00:00',NULL,'<p>В эту пятницу ресторан Jane погрузится в атмосферу гипнотического танго, мистических ритмов, DJ-сетов и перформансов.<br><br>В тягучей атмосфере Jane и Late CheckOut мы забудем о повседневности и отдадим себя танцу под гипнотические сеты и живые выступления наших героев ночи</p>',1000,'',2,252,1,'https://moscow.qtickets.events/80786-hypnotic-tango-at-jane-restaurant','',false,false,NULL,2,'2023-08-16 17:47:18','2023-10-09 19:22:48',NULL,'','0',18,49),
	 (1617,'YOUNG BLOOD: Open decks','2023-08-17-griboedov-young-blood-open-decks','2023-08-17',NULL,'23:00:00',NULL,'',NULL,'0.0',1,86,1,'','',false,false,NULL,2,'2023-08-16 17:52:08','2023-10-20 00:32:17',NULL,'','0',18,56),
	 (1618,'ELECTROBUDKA!','2023-08-18-griboedov-electrobudka','2023-08-18',NULL,'23:00:00',NULL,'<p>«Самый лучший отдых – это смена рода деятельности. Я не могу отдыхать, просто лёжа на кровати» — пока ты это читал, SHULYA вернулся из отъезда, доделал обложку нового альбома твоего любимого исполнителя, а завтра выпустит новую коллекцию твоего любимого бренда, который создал тоже он.&nbsp;</p>',NULL,'700.0',1,86,1,'','',false,false,NULL,2,'2023-08-16 17:58:11','2023-10-23 17:22:38',NULL,'','0',18,87),
	 (1619,'SUBHUMAN PARTY','2023-09-02-griboedov-subhuman-party','2023-09-16',NULL,'23:00:00',NULL,'<p>Родные стены, родной звук, родные люди, иными словами встреча перед концом света! Настрой - разнести Бункер и хорошенько попариться</p>',500,'',1,86,1,'','',false,false,NULL,2,'2023-08-16 18:03:32','2023-10-21 07:50:39',NULL,'','0',18,183),
	 (1620,'ITALLIKA','2023-08-19-union-itallika','2023-08-19',NULL,'23:00:00',NULL,'<p>Let’s have a walk!&nbsp;<br>19 августа Itallika&nbsp; наполняет двор и бар Union.&nbsp;<br>Дресс: Rock, Glam, Disco, Summer, Fancy&nbsp;<br>Вход: до 23.00 свободный, после 500₽.&nbsp;</p>',0,'500.0',1,8,1,'','https://t.me/itallikaparty',false,false,NULL,2,'2023-08-17 18:04:53','2023-10-10 22:08:44',NULL,'','0',18,97),
	 (1621,'Reality Saint-P','2023-08-19-mixed-reality-saint-p','2023-08-19','2023-08-19','22:00:00','06:00:00','<p>В субботу Reality Saint-P&nbsp; вновь собирает старых и новых друзей под крышей mixed.bar.&nbsp;&nbsp;<br>традиционно, в программе музыка в стиле хаус под покровом летней ночи.</p>',NULL,'500.0',1,59,1,'','',false,false,NULL,2,'2023-08-17 18:19:10','2023-10-10 21:52:25',NULL,'','0',18,86);
