	 (1624,'STRIP CLUB CHICKEN BONE','2023-08-19-griboedov-strip-club-chicken-bone','2023-08-19',NULL,'23:00:00',NULL,'<p>Наряжайтесь горячо, оставьте домашний ужин! Добро пожаловать в STRIP CLUB CHICKEN BONE!&nbsp;<br><br>Вкусная субботняя вечеринка, как и положено, пройдёт в сопровождении горячих chicken и chick’s, лютого грува в бейсменте, холодного пива и ароматного гриля в амстердаме - пространствах кластера Griboedov.&nbsp;<br><br>снаружи — зелень, гриль и пул<br>внутри — розовый неон и завораживающая стрип пластика&nbsp;<br>повсеместно — бар, супер диджеи, максимальный стиль &nbsp;<br>&nbsp;<br>DC — выглядим соответствующе атмосфере. Наиболее аппетитные ladies и опасные gentlemans проходят со скидкой 50%&nbsp;<br><br></p>',NULL,'600.0',1,86,1,'','',false,false,NULL,2,'2023-08-17 21:42:08','2023-10-20 22:48:37',NULL,'','0',18,108),
	 (1626,'MLC: XXL Multivisuon','2023-08-18-miraz-mlc-xxl-multivisuon','2023-08-18',NULL,'00:00:00',NULL,'<p>итак, на днях жанру хип-хоп стукнуло целых 50 лет (прямо как твоему sugar daddy)<br>такой событие наши резиденты не упускают, поэтому в пятницу у нас ожидается MLC: XXL Multivisuon<br><br>др рэпа без рэперов было бы праздновать довольно странно, поэтому у нас соберется целый состав фрешменов<br><br>вход 600₽ до 01:00/800₽ после + фейс</p>',600,'800.0',1,77,1,'','',false,false,NULL,2,'2023-08-18 01:59:00','2023-10-10 23:50:46',NULL,'','0',18,49),
	 (1708,'FEMS 2 YEARS','2023-09-02-samoobman-fems-2-years','2023-09-02',NULL,'21:00:00',NULL,'<p>Девчачья промогруппа Fems, которая организует тусовки исключительно для раскрепощенных девушек, празднует двухлетие. Поздравлять формации будут</p>',1200,'',2,258,1,'https://only-girls-event.timepad.ru/event/2532841/','',false,false,NULL,1,'2023-08-30 14:58:11','2023-10-25 06:29:30',NULL,'','0',18,72),
	 (1627,'EUPHORIA','2023-08-19-smena-euphoria','2023-08-19',NULL,'23:00:00',NULL,'<p>Ощущаешь это головокружительное чувство легкости и вибрации нахлынувших эндорфинов?&nbsp;<br>Добро пожаловать на самую провокационную и чувственную вечеринку EUPHORIA<br>В россыпи безумия блесток и светского гламура, по венам плавит мозг химия эмоций, а нахлынувшие чувства, под ритмы музыки, направляют в танцы между разгоряченных тел, заставляя раствориться в наслаждении под покровом ночи.<br>Ты чувствуешь этот вайб? Это и есть эйфория!</p>',0,'500.0',2,253,1,'https://euphoria.ticketscloud.org/','',false,false,NULL,2,'2023-08-18 02:10:12','2023-10-24 22:23:57',NULL,'','0',18,268),
	 (1628,'Диско-Клуб','2023-08-19-yauza-disko-klub','2023-08-19',NULL,'23:00:00',NULL,'<p>Что ни вечеринка, то праздник. Что ни туса, то мода. В субботу встреча в Диско-клубе на Яузе, из роскошных экстерьеров которого плавно переплывут в его не менее‍ роскошные интерьеры<br><br>Лайнап полностью соответствует️ названию ивента и всему вышесказанному, так что готовьте‍ свои лучшие аутфиты так, будто в вас вселился сам Игнатий Носорогов</p>',1000,'1500.0',2,32,1,'https://radugadiscoclub.ru/e190823','',false,false,NULL,2,'2023-08-18 02:15:21','2023-10-20 18:13:16',NULL,'','0',18,187),
