	 (1631,'Gorilla Zippo','2023-08-20-recnoi-pliaz-restoran-gorilla-zippo','2023-08-20','2023-08-20','15:00:00','23:00:00','<p>Soho Family и Reverse Festival сплотились что бы дать вам по истине не забываемое событие в последние тёплые дни лета!</p><p><br></p><p>Одного образа Василию Вакуленко, поистине многогранному артисту, показалось мало. Если Баста - это лирика в стиле реп, то GORILLA ZIPPO - это электронный драйв. Взрывные и магические ритмы в этот день - только на "VK Музыка Речной"!</p>',2000,'',2,211,1,'','',false,false,NULL,2,'2023-08-18 02:29:58','2023-10-25 14:03:05',NULL,'','0',18,225);
