	 (1636,'HC EPISODE 15 x KURUCHBRO','2023-08-18-krysa-18-hc-episode-15-x-kuruchbro','2023-08-18',NULL,'18:00:00',NULL,'<p>Продолжение серию вечеринок Hotel California в одной из самых атмосферных летних площадок - Крыше 18!&nbsp;<br><br>В этот раз ваши ушки будет ласкать сет приглашенной звезды всех дискотек 2000-х - DJ FENIXXX&nbsp; <br>Так что находим свои кожаные плащи, солнцезащитные очки и подкрадули! Это будет легендарный движ на высоте птичьего полета</p>',1100,'',1,45,1,'https://spb.qtickets.events/79739-hotel-california-epizod-15','',false,false,NULL,2,'2023-08-18 15:18:45','2023-10-25 12:56:52',NULL,'','0',18,95),
	 (1637,'Small Rave in China Town','2023-08-26-blanc-small-rave-in-china-town','2023-08-26','2023-08-27','18:00:00','06:00:00','<p>В последние выходные лета 2 мира Бланка и Яузы вновь&nbsp;соединятся вместе, чтобы открыть портал для удивительных созданий, которые заполнят улицы древнего Китай города.<br>Музыка двух миров и наполнившие Китай город персонажи это не единственное что ждёт тебя в эту ночь - свыше 20 музыкантов, 30 торговцев антиквариатом, кимоно и ханьфу, гвоздестояние, чайные комнаты и другая магия Востока соприкоснутся в эту ночь.</p>',1500,'',2,36,1,'https://secret420.timepad.ru/event/2539291/','https://www.smallrave.ru',false,false,NULL,2,'2023-08-18 15:34:20','2023-10-22 10:35:23',NULL,'','0',18,312),
	 (1709,'Пятница','2023-09-01-bar-strelka-piatnica','2023-09-01',NULL,'23:00:00',NULL,'<p>Последний уикенд лета можно провести в уютном дворике бара «Стрелка». В пятницу за пультом — обладатель одной из самых интересных коллекций пластинок в столице Shiny Boots.</p>',NULL,'0.0',2,103,1,'','https://t.me/strelkabarmoscow',false,false,NULL,1,'2023-08-30 15:03:23','2023-10-09 08:50:20',NULL,'','0',18,48),
	 (1638,'HIGHWAY NIGHT','2023-09-01-gazgolder-highway-night','2023-09-01',NULL,'21:00:00',NULL,'<p>Красивый, загорелый, отдохнувший Highway врывается в клубный марафон осеннего Газгольдера с редчайшим составом артистов.&nbsp;<br><br>Вернувшись из отпусков, мы вновь танцуем на двух танцполах&nbsp; любимого Газгольдера на фирменной вечеринке&nbsp; Highway Night, где бриллиантовая дюжина диджеев наполнит восторгом и счастьем наши сердечки.<br><br>С картами Highway Family вход бесплатный</p>',1500,'',2,35,1,'https://secret420.timepad.ru/event/2539791/','https://highwayevent.ru',false,false,NULL,2,'2023-08-18 16:32:37','2023-10-25 06:27:56',NULL,'','0',18,144),
	 (1639,'БОТАНИКА','2023-09-02-supermetall-botanika','2023-09-02','2023-09-03','16:00:00','06:00:00','<p>У нас в головах давно назревал этот план! Школьные флешбеки: спринты по коридорам,&nbsp; подливание аммиака в тумбочку препода по химии...<br><br>2 сентября мы хотим включить машину времени, когда нужно не только взяться за книжки, гербарии и чертежные инструменты, но и осознать, что лето хоть и закончилось, а новый сезон танцев и любви впереди!&nbsp;<br><br>В этот день мы вновь окажемся на уникальной open air площадке в центре столицы Radio at Supermetall, чтобы, поправляя очки с диоптриями и мило краснея, устроить 14-часовой учебный марафон под говорящим названием «Ботаника».&nbsp;</p>',1200,'',2,119,1,'https://botanika.ticketscloud.org/','',false,false,NULL,2,'2023-08-18 16:41:40','2023-10-25 17:39:10',NULL,'','0',18,454),
