	 (1642,'Kiss Cocktail by Popoff Kitchen','2023-08-19-simach-kiss-cocktail-by-popoff-kitchen','2023-08-19',NULL,'23:00:00',NULL,'<p>Вечеринка Popoff Kitchen в «Симаче» — выпускная дискотека лета, где соседки по парте строют глазки красивым диджеям, а хулиганы радушно ждут ботанов у левой колонки.<br><br>Квартет AMAL, Ginsburg, Lera Foer и TURA сводит волнующий саундтрек, коктейли пьются, а Слава Крейзисука пускает внутрь только самых нарядных мальчишек и девчонок. Вспоминаем вайб 2000-х и заливаемся под танцевальную попсу ушедшей эпохи.<br><br></p>',NULL,'0.0',2,165,1,'','',false,false,NULL,2,'2023-08-18 17:00:19','2023-10-24 07:09:15',NULL,'','0',18,47),
	 (1643,'Friday w//','2023-08-18-mixed-friday-w','2023-08-18',NULL,'22:00:00',NULL,'<p>Сегодня Mixed принимает в гостях резидентов Бланка&nbsp; ✨<br><br>Novikov обладает разнофокусным взглядом на электронную музыку с уклоном в ее темные проявления. Дима не стоит на месте - с фейсконтроля клуба Blank переместился на его мэйн и успешно освоил технику игры на виниле.&nbsp;<br>Свой музыкальный спектр варьирует от давящего гипнотического звучания до разреженного минимализма.<br><br>Составит компанию очаровательная Utah – за 9 лет побывала в составе разных локальных проектов, с 2021 года числится в резидентском ростере клуба BLANK. Основательница собственного проекта pinwheel – серия музыкальных подкастов и событий, позволяющих показать публике не только громкие имена сцены андеграунда, но и малоизвестных талантливых музыкантов и диггеров.&nbsp;</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,2,'2023-08-18 17:04:03','2023-08-20 19:31:56',NULL,'','0',18,18),
	 (1644,'Старик и Море','2023-08-19-radio-starik-i-more','2023-08-19',NULL,'16:00:00',NULL,'<p>19 августа Чувство Ритма &amp; PLY сгармонизировались, чтобы воссоздать атмосферу книги Эрнеста Хэмингуэя «Старик и Море». Вся айдентика будет соблюдена, музыкальная составляющая тоже на высоте. Рекомендую к посещению!&nbsp;<br><br>Special guest: Anton Sevidov солист группы Tesla Boy, чьи dj сеты это путешествие в историю танцевальной музыки, певица и музыкант Elisa Di со своим фирменным лайвом, Samir Kuliev &amp; Mr Morek в ролях Старика и мальчика Сантьяго отыграют трехчасовой b2b dj set.&nbsp;<br><br>Также в музыкальной постановке участвуют: дуэт Yakuza &amp; Miro, которые наполнят вечер жаркими этническими ритмами, Alexander Belousov глава Triori Records и шоукейса Svoi, Katia Kepler диджей, певица, пианист резидент Chuvstvo Ritma Rec.<br><br>16:30 лекция о жизни Эрнеста Хемингуея и о книге "Старик и Море" читает Самир Кулиев<br>17:30 Показ мультфильма "Старик и Море" (Реж Александр Петров 1999) премия Оскар.&nbsp;<br>18:00 — 07:00 музыкальная часть</p>',1000,'',2,149,1,'https://radio-event.timepad.ru/event/2531430/?fbclid=PAAaZCAOhkVteqlGbju0xxZ43DJ2fJ4fSlM-YOJTe5BrpUkQ5IYfwdLvAjS5A_aem_AXjg8kO6hpo-hEyuV6NRrL1-Sh80UYDo2MCkiDlI4Hqw2nE9aJvnoWZoUbcWFLq0pkw','',false,false,NULL,2,'2023-08-18 17:08:15','2023-10-23 13:06:47',NULL,'','0',18,151),
