	 (1649,'Moscow Madness','2023-09-23-1930-moscow-moscow-madness','2023-09-23','2023-09-24','23:30:00','07:00:00','<p>MOSCOW MADNESS – фестиваль, который погружает в атмосферу безумия HARD музыки. Самые крутые артисты сцены приглашены, чтобы разорвать зал своим сетами. Погружение в музыкальное сумасшествие состоится 23-го сентября в клубе 1930 Moscow. Приглашаем всех разделить его вместе с нами.</p>',1200,'',2,30,3,'https://vk.com/app7763319','',false,false,NULL,2,'2023-08-18 17:42:22','2023-10-24 21:11:36',NULL,'','0',18,663),
	 (1650,'ESCVPISM','2023-08-25-ionoteka-escvpism','2023-08-25','2023-08-26','23:30:00','05:30:00','<p>Иногда бывает так, что бегство — единственный верный путь, ведь это не только отдаление, но ещё и приближение к чему-то.&nbsp;</p><p><br></p><p>25 августа в третий раз на всю ночь сбегаем от непростой действительности и теряемся в лабиринте фантазий, иллюзий и электронной музыки.</p>',NULL,'300.0',1,40,1,'','',false,false,NULL,2,'2023-08-18 18:01:47','2023-10-23 06:33:56',NULL,'','0',18,226),
	 (1651,'9 лет - Точка Сборки','2023-09-01-ritmy-9-let-tocka-sborki','2023-09-01',NULL,NULL,NULL,'<p>Серия вечеринок «Точка Сборки» отмечает свое 9-летие в самом актуальном клубе Санкт-Петербурга «Ритмы».<br><br>В лайн-апе проверенные бойцы Oira, Ершов и Залетный, частые гости Нортон Коммандер, бывалые новички Galet, Gaboev и Sereja Borisov,&nbsp; резиденты саундсистемы, а также модный московский minimal dj Kife Suffer, организатор широко известных в узких кругах афтепати сходох «Воскресный кайф».<br><br></p>',NULL,'300.0',1,181,1,'','',false,false,NULL,2,'2023-08-23 04:55:12','2023-10-25 07:45:35',NULL,'','0',18,145),
	 (1652,'AM PODCAST X FIVE2SMOKE','2023-08-27-griboedov-am-podcast-x-five2smoke','2023-08-27','2023-08-27','18:00:00','00:00:00','<p>Продолжаем нашу постоянную рубрику AM Podcast, но в этот раз объединяемся с самыми дружелюбными ребятами из Five2Smoke.<br><br>Начнем в 18:00 на веранде Amsterdam 🇳🇱, продолжим двигаться до 00:00 под свежий брейк и электро с отголосками олдскульного хип-хопа 90-х годов.</p>',NULL,'0.0',1,86,1,'','',false,false,NULL,2,'2023-08-23 05:01:17','2023-10-17 15:18:37',NULL,'','0',18,73);
