	 (1653,'Amenomalia','2023-08-25-rndm-amenomalia','2023-08-25',NULL,'22:00:00',NULL,'<p>Московские приверженцы рейва 90-ых М4019&nbsp; + «супер смурф»&nbsp; представляют аномальный движ в заключительную пятницу лета.&nbsp; Специальный гость — ветеран первой волны джангла в России и ведущий Bassline Radio Show — Кирилл PROFIT на виниле. Помимо движущих единиц лейблов, в лайн-апе Anna Forward, BRTS и диггеры редких виниловых треков — Soulmate b2b Gutta.</p>',700,'',2,27,1,'https://supersmurf.timepad.ru/event/2536681/','',false,false,NULL,2,'2023-08-23 05:07:00','2023-10-18 22:18:17',NULL,'','0',18,48),
	 (1654,'Resonance Showcase','2023-08-26-rndm-resonance-showcase','2023-08-26','2023-08-27','19:00:00','05:00:00','<p>Едкие лайвы плавят стены клуба на Наставническом, а диджеи разгоняют джоги до космических.<br><br>Финальную субботу лета встречаем в RNDM — с охапкой резидентов Resonance, близких по духу и молодых музыкантов-отличников. Поводов увидеться целых два: закрыть сезон и познакомиться с выпускниками четвертого потока RESO.lab, который вот-вот завершился в Moscow Music School.<br><br></p>',778,'',2,27,1,'','',false,false,NULL,2,'2023-08-23 05:15:05','2023-10-14 08:25:20',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWZkOTU5YWZmZGNiZDZlZTY0NTJjZjczIn0.GeRgIuxoux5eUegSzCkEWmLeljBwf4hO9W4fGQPV01A','0',18,67),
	 (1655,'Orbita Friends','2023-08-26-treff8-club-orbita-friends','2023-08-26','2023-08-27','23:00:00','06:00:00','<p>Вот и подошло то время, когда пора собирать чемоданы на очередной сезон в Гоа и конечно перед отъездом мы хотим собрать и как следует оттанцевать всех наших&nbsp; друзей . Финальная точка в летнем сезоне 2023 в Москве от проекта Орбита будет поставлена в клубе Трефф в субботу 26 августа.&nbsp; Закроем этот сезон вместе.</p>',1500,'',2,84,1,'','',false,false,NULL,2,'2023-08-23 05:20:30','2023-09-29 18:13:31',NULL,'','0',18,38),
	 (1656,'Zakatnaya','2023-08-26-miraz-zakatnaya','2023-08-26',NULL,'12:00:00',NULL,'<p>Закатная до конца.<br>Дэй онли. Кидс фрэндли.&nbsp;<br><br>Закатная: saintcitylovers и kulturarecordstore хором зовут на залив проводить последний викенд лета.<br><br>Это ваш билет в ахуительное ненадолго, если хотите. Музыкальный голубой огонек на песке от всех, кто устраивает вечеринки на Неве, а также безусловный трибьют всех этих бессонных ночей.&nbsp;<br><br>Стейдж снова будет там, где все началось. Но чуть левее.&nbsp;<br>Дюны — место силы для всех покорителей волн и музыкантов, заставших легендарные времена. На серф-станции развернется бар и фудкорт. О безопастности, чистоте и комфорте тоже подумали, не переживайте.<br><br>Заканчивайте лето красиво. Глубоко вдохните, выдохните и проваливайте домой.&nbsp;</p>',NULL,'0.0',1,256,1,'','',false,false,NULL,2,'2023-08-23 05:30:05','2023-10-25 18:22:38',NULL,'','0',18,445),
	 (1657,'НОЧЬ ЛЮБВИ - Дикое Диско','2023-08-26-brusnicyn-xoll-noc-liubvi-dikoe-disko','2023-08-26','2023-08-27','19:00:00','08:00:00','<p>Четыре сцены, три локации, 11 часов танцев, 2000 человек, 15 диджеев, 8 живых выступлений и один хор, поющий любимые всеми песни. <br><br>В последнюю субботу лета сразу на трех площадках в Севкабеле и культурном квартале «Брусницын», на одной из излюбленных тусовочных набережных Петербурга, Дикое Диско проведет свой пятый фестиваль-дискотеку «Ночь Любви».&nbsp;<br>Фестиваль посвящен Петербургу, любви к нему, любви друг к другу, к музыке.&nbsp;</p>',2800,'',1,70,3,'https://lovenight.ticketscloud.org/','https://t.me/dikoedisco/1325',false,false,NULL,2,'2023-08-23 05:39:21','2023-10-24 22:14:21',NULL,'','0',18,138),
	 (1658,'NEURONICLEDAY','2023-08-26-sosnovyi-bor-neuronicleday','2023-08-26',NULL,'17:00:00',NULL,'<p>Традиционно, 26 августа собираемся нашей EMC бандой в Сосновом Бору, чтобы поздравить с Днëм Рождения Нейро и Неоникла, а так же проводить лето, которое подарило нам много теплых дней и интересных событий<br><br>Последняя вечеринка уходящего лета состоится в любую погоду, в том же месте, что в прошлом году.</p>',1000,'',1,254,1,'https://rupor.biz/widgets/event-tickets/874','',false,false,NULL,2,'2023-08-24 00:38:43','2023-10-22 11:47:53',NULL,'','0',18,55),
	 (1659,'MILKY WAY','2023-08-25-lembolovo-milky-way','2023-08-25','2023-08-27','19:00:00','14:00:00','<p>Салют всем нашим людям</p><p>&nbsp;У нас новости&nbsp;<br>Как вы знаете, тёплый сезон подходит к концу, а значит и сезон Open-air’ов тоже.&nbsp;<br>До последних выходных этого лета остаётся меньше двух недель.</p><p>В связи с этим команда Experience Crew и Pandemic, объединившись с своими очень хорошими друзьями, анонсирует финальную открытую тусовку этого лета!</p><p>Фестиваль «Млечный Путь»<br>«Небольшое мультижанровое многопрофильное мероприятие»<br>Последний summer weekend.&nbsp;</p><p>3 дня - 25, 26 и 27 августа.&nbsp;</p><p>Уютный и густой хвойный лес с тихим озером в 70км от Петербурга.<br>Насыщенная дневная и ночная музыкальная программа, электронные live-сеты диджеев и живые выступления артистов, спортивные мастер классы и chill-развлечения, поварской лайн-ап и прочие прелести жизни.</p><p>На территории будет действовать бар с холодными, горячими и пенными напитками, а также закусками к ним. У вас будет шанс познакомиться с уникальными крафтовыми крепкими напитками, которые вы, почти наверняка, не пробовали.&nbsp;</p><p>В добавок, внутри феста будут действовать несколько лавок, в которых, если успеете, можно будет приобрести тот самый крафт и еще различные ништяки ручной работы.</p><p>Мы приглашаем всех присоединиться и отметить конец сезона стильно и ярко.&nbsp;</p><p>В этом году участие абсолютно ничего не стоит, лишь вашего присутствия!</p><p>Все подробности появляются в ТГ-канале мероприятия&nbsp;</p>',NULL,'0.0',1,255,3,'','',false,false,NULL,2,'2023-08-24 00:54:26','2023-10-10 21:42:05',NULL,'','0',18,95),
	 (1660,'Double Sound²','2023-08-25-blank-double-sound2','2023-08-25',NULL,'23:00:00',NULL,'<p>25 августа, после годичной паузы, Double Sound² отпразднует своё тринадцатилетие на террасе BLANK.<br><br>13 — счастливое число. Любовь — лучшее из чувств. 13 лет команда Double Sound², ведомая истинной любовью к музыке и медиаискусству, развивает свои взгляды на современные интерпретации хауса и минимала.<br><br>В последнюю пятницу лета музыкальный вектор ночи, который зададут Dvinskikh, Eitbit, Ika, Preesh и Soultape, поддержит медиахудожница Elina Zazulia со своими визуальными работами.</p>',700,'1000.0',1,1,1,'','https://t.me/blankclub',false,false,NULL,2,'2023-08-24 01:33:36','2023-10-25 09:51:53',64,'eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSJ9.eyJwIjoiNWRiYWU5YTAxODE0MTBhYmQzY2M2ZWU4In0.qMpyNDLwYZmcxCyCRlH9fLMFM8g9NtCCi9SdTdFqGgI','0',18,62),
	 (1661,'ЧУВСТВО РИТМА / REPTILOID','2023-08-26-ritmy-cuvstvo-ritma-reptiloid','2023-08-26',NULL,'15:00:00',NULL,'<p>ТАЙМ-ЛАЙН МЕРОПРИЯТИЯ<br><br>FLIP FLAP OPEN DECKS&nbsp;<br>15:00 — 22:00<br>*хаус, юкей, брейкбит /&nbsp;<br><br>15:00 — 16:00 TORI<br>16:00 — 17:00 MARCH 13&nbsp;<br>17:00 — 18:00 YUNG DANNY<br>18:00 — 19:00 ALWAYS AROUND&nbsp;<br>19:00 — 20:00 MONALISA<br>20:00 — 21:00 PULYA B2B SAICORE<br><br>GARDEN 21:00 — 06:00<br>*хаус, диско, минимал /&nbsp;<br><br>21:00 — 22:00 ДАЙТОНА<br>22:00 — 23:00 GRINKOP<br>23:00 — 00:00 ANTON MO<br>00:00 — 01:00 JURAVLOVE&nbsp;<br>01:00 — 02:00 DJ STONIK 1917<br>02:00 — 04:00 DIM PO<br>04:00 — 06:00 ROMA ALEKSEEV<br><br>CLUB 23:00 — 06:00<br>*брейкбит, электро, техно /&nbsp;<br><br>23:05 — 00:00 MAZNEVICH<br>00:00 — 00:55 VIBE MASTA<br>00:55 — 01:50 GRINKOP<br>01:50 — 02:15 ТЕХНО КАЙДЗЮ (LIVE)<br>02:15 — 03:15 REPTILOD (DJ-SET)<br>03:15 — 04:10 THE VILLARS<br>04:10 — 05:05 RWANDA&nbsp;<br>05:05 — 06:00 DIMKA BATARIN</p>',NULL,'1500.0',1,181,1,'','',false,false,NULL,2,'2023-08-24 01:40:14','2023-10-19 17:53:30',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjRjM2YzYzYwOTY2YmI3OTQ3YmY1ZDNjIn0.xq4IYLDwzZ9WR3I6L06fQsaokDjj_bE0a5CyzkmqQZE','0',18,196),
	 (1662,'Vibe Room x Testin G: Hip-Hop 50 Years Anniversary  ','2023-08-26-blank-vibe-room-x-testin-g-hip-hop-50','2023-08-26',NULL,'23:00:00',NULL,'<p>Совсем недавно все убедились, каким ярким и большим событием может быть тим-ап Vibe Room и Testin G.&nbsp;<br>В последнюю субботу лета группировки объединятся вновь, чтобы достойно проводить сезон и с должным размахом отметить 50-и летие любимого жанра для представителей обоих команд.&nbsp;<br><br>На своих мероприятиях ребята всегда старались развивать хип-хоп культуру во всех ее главных проявлениях: музыке, искусстве и танцах.&nbsp;<br>На этих трех китах и будет построена вся концепция нового кроссовера: 28 диджеев, музыкантов и артистов на 2 сценах клуба BLANK, масштабный танцевальный шоукейс и множество арт-инсталляций от андерграудных художников Петербурга.</p>',700,'',1,1,1,'http://spb.qtickets.events/81536-vibe-room-x-testin-g','https://t.me/viberoom_spb',false,false,NULL,2,'2023-08-24 01:53:23','2023-10-22 15:58:23',NULL,'','0',18,162);
