	 (1663,'GONGGY 1 Year! ','2023-08-26-griboedov-gonggy-1-year','2023-08-26',NULL,'23:00:00',NULL,'<p>Добро пожаловать на захватывающую вечеринку в честь дня рождения музыкального комьюнити GONGGY!&nbsp;<br>Это событие, насыщенное музыкой и радостью, соберет всех друзей в одном месте для незабываемой ночи.&nbsp;<br>На сцене Basement вы сможете насладиться энергичными электронными ритмами electro/breakbeat/techno, а сцена Amsterdam предложит мелодичные, но такие же ритмичные мотивы, погрузив вас в атмосферу праздника!&nbsp;<br><br>По традиции на канале YouTube пройдёт стрим тусовки, с качественной картинкой и отличным звуком.</p>',NULL,'700.0',1,86,1,'','https://t.me/gonggyyyy',false,false,NULL,2,'2023-08-24 01:58:19','2023-10-25 01:15:59',NULL,'','0',18,83),
	 (1696,'Love Machine.','2023-08-26-miska-bar-love-machine','2023-08-26','2023-08-27','21:00:00','04:00:00','<p>Сегодня, 26 августа, в Mishke наша гордость — вечеринка Love Machine.<br><br>Играют cl33m, sad alien и pleasure olezha.<br><br>Поп-музыка, которую хочется любить.&nbsp;</p>',NULL,'0.0',1,12,1,'','https://t.me/molodostvsyo',false,false,NULL,3,'2023-08-26 16:36:40','2023-10-13 12:17:07',NULL,'','0',18,57),
	 (1664,'ВОЯДЖЕР - 3','2023-08-25-macty-voiadzer-3','2023-08-25','2023-08-26','23:00:00','04:00:00','<p>Бортовой журнал. День 2026.&nbsp;<br>"Более 2000 дней я бродил в одиночестве в бескрайнем космосе, неся на борту самое ценное, что есть у человечества.&nbsp;<br>Внезапно с Земли поступил сигнал бедствия! Я развернул корабль, чтобы показать как звучит вечность и спасти нашу планету от гибели!"<br><br>25 августа, в ультрафиолетовом свете встречных кораблей, на остановке Севкабель. Мачты.&nbsp;<br>Две бортовые палубы и бравая команда музыкальных исследователей.<br><br></p>',500,'',1,9,1,'https://spb.radario.ru/events/2033319','',false,false,NULL,2,'2023-08-24 02:06:48','2023-10-22 07:39:35',NULL,'','0',18,43),
