	 (1668,'Jardin De Bliss','2023-08-25-powerhouse-jardin-de-bliss','2023-08-25',NULL,'23:00:00',NULL,'<p>Комьюнити и лейбл JARDIN DE BLISS на одну ночь погрузит Powerhouse в атмосферу летнего сада блаженств.&nbsp;<br>Вход: донейшен</p>',100,'',2,5,1,'','',false,false,NULL,2,'2023-08-24 02:36:21','2023-10-13 16:41:43',NULL,'','0',18,66),
	 (1669,'CONTROL+','2023-08-25-miraz-control','2023-08-25',NULL,'00:00:00',NULL,'<p>начинаем провожать лето в пятницу вместе с тусой серёги токио control+&nbsp;<br><br>всё так же хорошо, как и в прошлые два раза, электроника, рнб, приятный декор и даже розыгрыш&nbsp;</p>',500,'700.0',1,77,1,'','https://t.me/contrrrol',false,false,NULL,2,'2023-08-24 02:41:37','2023-10-25 17:40:58',NULL,'','0',18,80),
	 (1670,'Please Please Repeat!','2023-08-25-radio-please-please-repeat','2023-08-25',NULL,'20:00:00',NULL,'<p>Как ни крути, а лето было бурным. Ну, по крайней мере, для Repeat.<br><br>Большое спасибо всем, кто поддерживал наши мероприятия и регулярно заходил к нам.<br><br>На такой высокой ноте мы решили закончить этот летний&nbsp; сезон, поэтому ждем всех друзей под открытым небом в любимом Радио.<br><br>Лайнап подбирали думая обо всех</p>',1000,'',2,149,1,'https://radio-event.timepad.ru/event/2508988/','',false,false,NULL,2,'2023-08-24 02:55:02','2023-10-25 15:39:56',NULL,'','0',18,79),
	 (1671,'SIMACHEV X RESONANCE','2023-08-25-simach-simachev-x-resonance','2023-08-25','2023-08-26','23:00:00','05:00:00','<p>Новый хулиганский шоукейс «Резонанса» в «Симаче». Светские интерьеры второго этажа оккупирует ухабистый танцевальный саунд: Nikita Zabelin в b2b-сете с Vlas Leskin, маэстро скоростного электро DESTROY и гетто-принцесса CPSL.<br><br>Пока второй этаж грохочет и шумит, первый — кружится в интеллигентных танцах: за пульт встанeт селектор и радиовудущий Lay-Far и Kah Mal с эротичной хаус-подборкой.</p>',NULL,'0.0',2,165,1,'','',false,false,NULL,2,'2023-08-24 02:59:20','2023-10-24 20:29:59',NULL,'','0',18,104);
INSERT INTO public.events (id,title,slug,start_date,end_date,start_time,end_time,description,price_from,price_gate,city_id,venue_id,event_type_id,tickets_url,info_url,is_cancelled,is_featured,deleted_at,user_id,created_at,updated_at,ticketscloud_event_id,ticketscloud_event_token,ticketscloud_event_multi,age_limit,"views") VALUES
	 (1672,'КОЛЮЧКА','2023-08-25-mutabor-koliucka','2023-08-25',NULL,'23:00:00',NULL,'<p>Вторая вечеринка новой панк-серии от команд «Рабицы» и JOY, заряженная сырой энергией. В программе «Mедиума» — нетривиальные лайвы от рэпа до металла от артистов из разных городов. Диджейский саппорт в «Гараже» окажут продюсеры Lapti, Flaty и другие артисты.</p>',1000,'',2,2,1,'https://mutabor.club/koluchka/','',false,false,NULL,2,'2023-08-24 03:15:36','2023-10-13 14:12:47',NULL,'','0',18,65),
	 (1673,'ВИР МИР','2023-08-26-prostranstvo-pole-vir-mir','2023-08-26',NULL,'22:00:00',NULL,'<p>Это лето было полно любви и попрощаемся мы с ним соответствующе — долгожданным возвращением вир мира и танцами до утра<br><br>Для нас эта вечеринка особенная, а для многих из вас она была первой в поле. И несмотря на то, что с последнего вир мира прошел почти год, принципы и ценности у него остаются те же: любовь, безграничное принятие и аутфиты, блестящие так сильно, что нам не придется заниматься подсветкой. Последний пункт еще обсуждаем&nbsp;<br><br>На афише полный лайнап двух сцен, возвращение пионеров вир мира, новые имена и очень специальный для вечеринки гость</p>',900,'',2,46,1,'https://virmir.ticketscloud.org/','',false,false,NULL,2,'2023-08-24 03:22:00','2023-10-24 01:46:40',NULL,'','0',18,114),
	 (1674,'APPLIQUE RASTET','2023-08-26-gazgolder-applique-rastet','2023-08-26',NULL,'23:00:00',NULL,'<p>26-го августа команда Applique расцветёт в стенах клуба Газгольдер<br><br>После долгих летних ночей лейбл приносит плоды именно в августе, в самые жаркие выходные, перед окончанием летнего сезона.&nbsp;<br>Урожай из любимых артистов и резидентов лейбла созрел и мы традиционно приступаем к сбору всей электронной культуры на рейв в августе — самом подходящем для этого месяце<br><br></p>',1500,'',2,35,1,'https://applique.ticketscloud.org/','https://vk.com/appliquerastet',false,false,NULL,2,'2023-08-24 03:28:50','2023-10-24 21:24:21',NULL,'','0',18,78),
	 (1676,'Soma Party','2023-08-25-soma-soma-party','2023-08-25',NULL,'20:00:00',NULL,'<p>В последнюю пятницу лета Soma устраивают большую вечеринку до утра в своем дворе. На одной сцене впервые встретятся Rapossa и Izhevski, а поддержат их Pavel Nitsa и Oleg Tsoy<br><br>Rapossa впервые выступит с новым электронным лайв-шоу, используя аналоговые синтезаторы, гитарные партии и выдавая из колонок грувовую электронику, инди-дэнс и афро-хаус. Izhevski продолжит раскачивать двор своим сетом в жанре электроники и даунтемпо</p>',1000,'',2,218,1,'https://somamoscow.timepad.ru/event/2549549','',false,false,NULL,2,'2023-08-24 03:53:46','2023-10-25 14:13:48',NULL,'','0',18,131),
	 (1677,'Happy Birthday!','2023-08-26-vnvnc-concert-hall-happy-birthday','2023-08-26',NULL,'23:00:00',NULL,'<p>«вдохнула ты, а меня убил» и «чумового настроения и самых преданных друзей»<br><br>знакомые строчки..<br>думаем, что эти треки звучали у многих<br><br>послушаем вживую? 😏<br>только без Аллегровой&nbsp;<br><br>в эту субботу, на нашей сцене<br>ДЕНЬ РОЖДЕНИЯ VNVNC и<br><br>ГАНВЕСТ и его сочные бэнгеры<br>так сказать, полные «кайфули»<br>покупай билеты заранее, чтобы оказаться ближе и рассмотреть каждую татуировку на его теле</p>',700,'',1,50,1,'https://vnvncconcerthall.ru/events/vnvnc-subbota-26-avgust/','',false,false,NULL,2,'2023-08-24 03:59:51','2023-10-20 16:00:15',NULL,'','0',18,70),
	 (1678,'GO Blank','2023-09-02-blank-go-blank','2023-09-02',NULL,'23:00:00',NULL,'<p>Go Blank. Наша головная серия событий, традиционно служащая прологом продолжительного и насыщенного клубного сезона, обрела дополнительный подтекст. Начиная с ближайшей даты и впредь, каждый Go Blank демонстрирует глобальные метаморфозы, которые отразятся в обновлении интерьера и декора.<br><br>Музыкально Go Blank, как и прежде, являет собой квинтэссенцию звука, формирующего сущность клуба — электронный эклектизм, который нет смысла запирать в узкие жанровые пределы.&nbsp;</p>',1100,'',1,1,1,'','https://www.blankclub.ru',false,false,NULL,2,'2023-08-24 04:08:21','2023-10-22 09:30:32',NULL,'','0',18,131),
	 (1679,'Swan Lake','2023-08-25-lebedinoe-ozero-swan-lake','2023-08-25',NULL,'21:00:00',NULL,'<p>Друзья, становятся доброй традицией проводы лета под открытым небом парка Горького, в легендарном баре Лебединое Озеро. В пятницу 25 августа Сергей Санчес отыграет там свой многочасовой сет, по яркости впечатлений способный встать в один ряд с выступлением на закрытии Четвергов в Пропаганде. Лучшие треки из его коллекции на виниле в сочетании с хитами этого лета сделают эту ночь одним большим праздником.<br><br>До встречи в Лебедином!&nbsp;</p>',NULL,'1500.0',2,184,1,'','',false,false,NULL,2,'2023-08-24 04:17:13','2023-10-25 15:35:15',NULL,'','0',18,113),
	 (1680,'Panoptic','2023-08-26-mixed-panoptic','2023-08-26',NULL,'22:00:00',NULL,'<p>Третий по счету Panoptic пройдет 26.08 в родных стенах Mixed.&nbsp; <br>Провожать летний сезон ребята будут по традиции с резидентами и друзьями проекта, которые поддержат специальнго гостя из столицы. Виктор Лихоносов, он же Rabotnic - один из самых заметных продюсеров и диджеев в России, владелец винилового лейбла Antrakt, резидент вечеринок Meduza и Haze, частый гость московского Gazgolder и Mutabor.</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,2,'2023-08-24 04:23:46','2023-10-24 21:10:16',NULL,'','0',18,73),
	 (1681,'The Last Asylum','2023-08-25-lastocka-the-last-asylum','2023-08-25',NULL,'18:00:00',NULL,'<p>Свежий взгляд на тёмную сцену.<br>Новый подход к самой атмосферной музыке пост-советской России.</p>',400,'',1,10,1,'https://spb.qtickets.events/77771-the-last-asylum','https://vk.com/lastasylumshs',false,false,NULL,2,'2023-08-24 04:52:49','2023-10-21 11:59:22',NULL,'','0',18,56),
	 (1682,' Élan Vital &  Obsydian','2023-08-25-union-elan-vital-obsydian','2023-08-25','2023-08-26','23:00:00','06:00:00','<p>В пятницу приоткрываем дверь в тени сознания, где легко обнаружить неиссякаемый источник творческой энергии. Почувствуем, как бочка опережает удары сердца, а тело само расставляет акценты в нужных местах.&nbsp;<br><br>Темные стороны диско, восточное электро, техно и ломанные ритмы. Во дворе — Élan Vital (http://instagram.com/__elanvital) — оазис, готовый стать пристанищем для тех, чей разум отрицает невозможность лета быть хотя бы немного длиннее, в зале — Obsydian (http://instagram.com/obsydianwave) — плотная материя, медитативно выталкивающая уводящие от момента мысли посредством высоких значений bpm</p>',NULL,'500.0',1,8,1,'','https://t.me/unionbarspb',false,false,NULL,3,'2023-08-25 15:54:35','2023-10-10 21:44:46',NULL,'','0',18,52);
