	 (1683,'FUNK YEAH!','2023-08-25-roof-place-funk-yeah','2023-08-25','2023-08-26','23:45:00','06:00:00','<p>В эту пятницу, с полуночи традиционная встреча от команды Funk You! в Roof Place на закрытие летнего сезона! 6 часов фанки брейкса, брейкбита, гаражного бэйса от Funk You! и друзей.&nbsp;<br><br>Наряжайтесь в яркую одежду и аксессуары. Танцуйте до утра! Вы, ваше настроение и музыка - самое главное на вечеринках</p>',500,'500.0',1,176,1,'https://funk-you.timepad.ru/event/2531133/','https://t.me/funkyouspb',false,false,NULL,3,'2023-08-25 16:01:24','2023-10-13 11:56:06',NULL,'','0',18,99),
	 (1684,'пятница в Mixed','2023-08-25-mixed-piatnica-v-mixed','2023-08-25','2023-08-26','22:00:00','06:00:00','<p>нескучная пятница в весьма неожиданной компании.<br><br>провожаем август в сопровождении приятных хаус мотивов. за пультами мастермайнд бара — Kirill Vitman, Loveski — пионер российской хаус-сцены, а также основатель Loveschool и Misha Illeish — новый гость в наших стенах.&nbsp;<br><br></p>',NULL,'0.0',1,59,1,'','',false,false,NULL,3,'2023-08-25 16:08:46','2023-10-10 21:46:19',NULL,'','0',18,34),
	 (1685,'NAZLOMNE','2023-08-25-ritmy-nazlomne','2023-08-25','2023-08-26','20:00:00','06:00:00','<p>Мы очень напряглись мыслями о том, что последняя бесплатная туса этого сезона должна остаться в памяти навсегда!&nbsp;<br><br>Мы приготовили лайнап-пулемёт!&nbsp;<br>Ребята записали классные диски специально для вас и собрали всякие молодежные танцевальные мотивы от электро до габбы.&nbsp;<br><br></p>',NULL,'0.0',1,181,1,'','',false,false,NULL,3,'2023-08-25 16:12:13','2023-10-24 17:28:47',NULL,'','0',18,43),
	 (1686,'Пивная Карта 15 лет','2023-08-27-union-pivnaia-karta-15-let','2023-08-27',NULL,'14:00:00',NULL,'<p>Легендарное место и легендарное событие — 15 лет проекту, с которого началась пивная культура в стране. Празднуем день рождения «Пивной карты» в U в это воскресенье. &nbsp;<br><br>Вечер начнем с медленного потягивания разнообразнейших сортов пива и поглощения хитов от Smoke BBQ. Ближе к вечеру — слушаем треск винила, продолжаем перемещаться от одного корнера к другому, общаться и готовиться к лайву Василия Владимировича Васина,&nbsp; лидера группы-легенды КИРПИЧИ. Вход свободный, стартуем в 14:00!</p>',NULL,'0.0',1,8,1,'','https://t.me/unionbarspb',false,false,NULL,3,'2023-08-25 17:34:27','2023-10-24 21:29:15',NULL,'','0',18,147),
	 (1687,'Summer Last Party ','2023-08-26-nevinnyi-bar-summer-last-party','2023-08-26',NULL,NULL,NULL,'<p>Последние выходные лета! Ждем Вас друзья, встретится с любимыми в любимом Невинном, план вау!<br>Музыкальное сопровождение от лучших ребят планеты @artemdanu и @myataelektronnaya&nbsp;<br>До встречи 🫰🏻это лето не забудем никогда)</p>',NULL,'0.0',1,257,1,'','',false,false,NULL,2,'2023-08-25 17:36:50','2023-10-22 19:42:38',NULL,'','0',18,43),
	 (1688,'МИША МИША МИША','2023-08-26-union-misa-misa-misa','2023-08-26','2023-08-27','23:00:00','06:00:00','<p>Каким в эту субботу будет Миша Колесников?&nbsp; Без пяти минут тридцатипятилетним, но как всегда радушным и готовым вписаться в самые смелые авантюры.&nbsp;<br><br>Отмечаем его красивую дату фестивально, по-другому — никак: со всеми вечеринками-резидентами и лайвами на двух сценах родного Ю.</p>',NULL,'500.0',1,8,1,'','https://t.me/unionbarspb',false,false,NULL,3,'2023-08-25 17:38:42','2023-10-25 09:50:14',NULL,'','0',18,115),
	 (1689,'суббота в Mirage bar','2023-08-26-miraz-subbota-v-mirage-bar','2023-08-26','2023-08-27','23:00:00','06:00:00','<p>теперь о субботе&nbsp;<br><br>у нас в гостях homies crew (https://instagram.com/homies_crw?igshid=MzRlODBiNWFlZA==) (нет не просто наши кенты, это название)&nbsp;<br>парни непосредственно связаны с нашими большими друзьями tsunami picnic, так что где, как ни у нас начать новую серию их вечеринок&nbsp;<br>целый автопарк во дворе прилагается&nbsp;<br><br></p>',500,'700.0',1,77,1,'','https://t.me/miragebar',false,false,NULL,3,'2023-08-25 17:51:08','2023-10-24 10:29:46',NULL,'','0',18,40),
	 (1690,'ШАМБАЛА','2023-08-26-solaris-lab-sambala','2023-08-26','2023-08-27','20:00:00','06:00:00','<p>26 августа — в последнюю субботу летнего сезона 2023 мы соберёмся в уникальном пространстве Solaris Lab</p><p><br></p><p>Крытое пространство с выходом на крышу с которой раскрывается уникальная перспектива Петербурга — станет местом, где мы проводим с вами сансет и отправимся в ночное музыкальное путешествие. Добро пожаловать!</p>',1500,'',1,106,1,'https://spb.qtickets.events/80802-shambala','',false,false,NULL,2,'2023-08-25 19:02:32','2023-10-20 01:36:06',NULL,'','0',18,77),
	 (1691,'Last Summer Sunday','2023-08-27-macty-last-summer-sunday','2023-08-27','2023-08-27','20:00:00','23:55:00','<p>Проводим последнее воскресенье лета на lo-fi вечеринке, где выступают атмосферные шугейзеры и инди-рокеры из Москвы.<br>Полет в безграничном пространстве, океан звука, что волнами разбивается в шум. Все это во время легкого бриза финского залива в последние выходные особенно мечтательного лета.<br><br></p>',300,'300.0',1,9,2,'https://vk.com/away.php?to=https%3A%2F%2Fspb.radario.ru%2Fevents%2F2009069%2Ftickets&post=-138512047_3825&cc_key=','https://t.me/spb_masts',false,false,NULL,3,'2023-08-26 16:17:46','2023-10-17 17:01:43',NULL,'','0',18,85),
	 (1692,'Абстрасенция на Крыше18','2023-08-27-krysa-18-abstrasenciia-na-kryse18','2023-08-27','2023-08-27','18:00:00','23:00:00','<p>Идеальное воскресенье с фестивалем атмосферной электроники на крыше с впечатляющим видом на акваторию Невы и крейсер Аврора, выступят 8 резидентов фестиваля, будет много крутых лайвов и музыкальных открытий.<br><br>&nbsp;последняя возможность этим летом встретиться на опен-эйре с фантастически красивыми панорамными видами города;<br>&nbsp;в честь десятилетия фестиваля знаковый резидент Reddy Sample из города Тотьма выступит хедлайнером вечера и представит расширенный лайв-сет;<br>&nbsp;в этот день основатель фестиваля Игорь Адамс празднует день рождения, будет его праздничное выступление с dj-сетом</p>',1000,'',1,45,1,'https://abstrasension.ru/summer_air?utm_source=vk&utm_medium=cpc&utm_campaign=tg_tech2508','https://abstrasension.ru/summer_air?utm_source=vk&utm_medium=cpc&utm_campaign=tg_tech2508',false,false,NULL,3,'2023-08-26 16:24:45','2023-10-17 07:28:46',NULL,'','0',18,93);
