	 (1698,'MUTANT STATION','2023-09-01-ugol-mutant-station','2023-09-01','2023-09-01','18:00:00','23:00:00','<p>Представляем Mutant Stanton preparty к ежегодному рейву Analog Devices при поддержке дружественного комьюнити IOD.<br><br>Мутант станция явится центром музыкальных экспериментов в живом исполнении.&nbsp;<br>С помощью аналоговых синтезаторов и модульных систем команда IOD окажет прямое воздействие на мутацию жанров, мелодий и ритмов.<br>Приглашаем всех неравнодушных слушателей в уютное пространство Угол мотивировать и вдохновить наших артистов на достижения ими новых вершин в музыкальном искусстве.</p>',100,'',2,130,1,'','',false,false,NULL,2,'2023-08-28 19:42:02','2023-10-25 10:45:30',NULL,'','0',18,120),
	 (1699,'Solar Vibes','2023-09-03-solaris-lab-solar-vibes','2023-09-03','2023-09-03','18:00:00','00:00:00','<p>В это воскресенье мы все перевернём календарь. Да-да, и снова 3 сентября, друзья!<br>Мы решили провести этот день полный ностальгии - в компании друзей и под звуки хорошей музыки.<br><br>3 сентября состоится атмосферная вечеринка на видовой крыше SOLAR VIBES.<br><br>В программе<br><br>⭐️Электроника с живым кларнетом<br>⭐️Лайвы от участников фестиваля Абстрасенция<br>⭐️Панорамный вид на город пространства Solaris lab&nbsp;<br><br>Всё вместе - идеальный вариант красиво проводить это лето. Присоединяйтесь!<br><br>Вход: Первые 20 - 400 р./ далее 500 р./ на входе 600 р.<br>По вопросам приобретения билетов пишите в телеграм - @Ekzatikin</p>',400,'600.0',1,106,1,'','',false,false,NULL,2,'2023-08-28 20:02:54','2023-10-20 03:13:31',NULL,'','0',18,85),
	 (1700,'VTUSSE 5 YEARS','2023-09-01-blank-vtusse-5-years','2023-09-01',NULL,'22:00:00',NULL,'<p>Практически весь летний сезон мы готовили для вас мощнейший фестиваль в честь нашего дня рождения!&nbsp;<br>Свой юбилей мы подкрепляем масштабным событием в стенах легендарного @blankclub&nbsp;<br>Рады покорять новые вершины, удивлять свою аудиторию вновь и вновь, и показывать нашему любимому Saint-P на что мы способны</p>',1200,'',1,1,3,'https://spb.qtickets.events/81407-vtusse-5-years?fbclid=PAAaZwk2XPg7HaJqLPjJtAuMbl85ibJ4U8FUzEei6lLga5tOER7vlVTZonAcs_aem_AWtcPe7xUDHComsuv7oQyote4dvs2ON2zhh-kMBlkRcACKRb30VLCqdml_9xC9NOous','',false,false,NULL,2,'2023-08-28 20:40:16','2023-10-17 10:52:58',NULL,'','0',18,192),
