	 (1705,'Супервечеринка','2023-09-01-macty-supervecerinka','2023-09-01',NULL,'20:00:00',NULL,'<p>Супергруппа&nbsp; впервые в Санкт-Петербурге.<br>Концерт откроют лучшие друзья музыкантов: Паша Жданов при&nbsp; поддержке Вадика Тихонова презентует «Музыку для музыкантов»; сам же Вадик и Женя Зубарев по очереди исполнят свои (и чужие) золотые хиты, аккомпанируя голосу на деревянной гитаре<br>с круглым отверстием.<br><br></p>',650,'',1,9,1,'','https://vk.com/supergruppa_msk',false,false,NULL,1,'2023-08-30 14:12:57','2023-10-23 15:15:35',NULL,'','0',18,53),
	 (1706,'ZLOBA','2023-09-08-rndm-zloba','2023-09-08',NULL,'23:00:00',NULL,'<p><strong>Злобе вновь требуется твой серьезный ответ под покровом ночи и сиянием звезд Монастерио из Москвы и Санкт-Петербурга. Твоё желание исполняется, чтобы устроить сеанс очищения темным камерным рейвом.&nbsp;<br><br>Проведи эту ночь в злом мраке, чтобы встретить своих внутренних демонов лицом к лицу в этой жестокой гармонии где гнев и ярость растворяются, словно дым в ночном воздухе, уступая место переосмыслению и очищению.<br><br>Ритуальная встреча со Злобой в ночи доступна лишь избранным</strong></p>',700,'',2,27,1,'https://zloba.ticketscloud.org/','',false,false,NULL,1,'2023-08-30 14:32:23','2023-10-22 19:06:39',NULL,'','0',18,169);
