	 (1707,'A R M A','2023-09-09-mutabor-a-r-m-a','2023-09-09','2023-09-11','23:00:00','06:00:00','<p>Анонс, которого я ждал очень долго, потому что это мой дебют на АРМЕ. I’m so exited!<br><br>A R M A уикенд • 9 — 11 сентября. По нарастающей. Праздничный субботний прайм мейна. Две ночи на медиуме. Гараж нон-стоп до утра понедельника. Концерты на летней сцене в воскресенье вечером. Все на фоне "зависательных" экспериментов в Masala.</p>',2000,'',2,2,3,'https://mutabor.club/ARMA/','',false,false,NULL,1,'2023-08-30 14:42:22','2023-10-24 21:18:52',NULL,'','0',18,295),
