	 (1710,'ACT x BLANC','2023-09-01-blanc-act-x-blanc','2023-09-01',NULL,'19:00:00',NULL,'<p>Творческое объединение<br>ACT совместно с самым красивым и музыкальным двором BLANC&nbsp;расплетут твои косы, разрешат надеть все самое красивое и нарядное для встречи с осенью!<br>&nbsp;<br>Клуб любителей motherlode, шампань-шампань, сверкучести, сначала полегче, а потом пожестче, специально для вас:<br>&nbsp;<br>✨2 сцены! (чтобы делать туда-сюда)<br>✨ самые красивые и талантливые<br>✨электронный лайв<br>✨ танцы до утра!</p>',0,'1000.0',2,36,1,'https://blanc.timepad.ru/event/2562161/','',false,false,NULL,1,'2023-08-30 15:06:49','2023-10-21 16:53:21',NULL,'','0',18,78),
	 (1711,'New Faces Night','2023-09-01-rndm-new-faces-night','2023-09-01',NULL,'22:00:00',NULL,'<p>01 СЕНТЯБРЯ | ПЯТНИЦА | NEW FACES NiGHT<br><br>Начало нового учебного года решили начать символично - новый сезон открывают New Faces Night.&nbsp;<br><br>За транс часть в ответе toji, который успел выделиться на "Катэраг" и "Наследии", Арина LAR’KINA и Systema Zvuka поставят техно, так же послушаем Bara Dvh, который заставил всех вспотеть на Club Night.&nbsp;<br>Ну и как же в этот день без учеников и воспитанников наших резидентов -&nbsp; tochka s zapyatoy и Rita Moore.&nbsp;<br><br>Специально приглашенный артист - Дмитрий Гаспаров&nbsp;</p>',NULL,'0.0',2,27,1,'','',false,false,NULL,1,'2023-08-30 15:15:59','2023-10-11 15:21:13',NULL,'','0',18,50),
	 (1712,'MANIFEST','2023-09-16-rndm-manifest','2023-09-16',NULL,'23:00:00',NULL,'<p>16 сентября Manifest открывает осенний сезон и зовёт двух именитых бочка-мейкеров Gostwork и Hard.303, каждый из которых уже с ног до головы усыпан всевозможными овациями. Так же ищите в лайнапе имена ваших любимых резидентов: Etrigan (играл на Сигнале), Lowchord (он еще и дизайнер), Basil White (просто красавчик). Откроет эту ночь наш дорогой друг Depressive Tuesday, увидимся!&nbsp;<br><br>Вход: 800₽ по репосту VK до полуночи. <br>После полуночи 1000₽</p>',800,'1000.0',2,27,1,'','https://vk.com/wall-218637727_43',false,false,NULL,1,'2023-08-30 15:28:36','2023-10-22 06:39:19',NULL,'','0',18,207),
	 (1713,'BPM Block','2023-09-01-mutabor-bpm-block','2023-09-01',NULL,'22:00:00',NULL,'<p>Первое событие этой осени пройдёт в самом знаковом месте Мутабор для теплого времени года - танцполе Garden, с гостями из Румынии CaLLy и Vlad Arapasu.&nbsp;<br><br>Артисты, являющиеся сторонниками и представителями того самого румынского звука, при местной поддержке, наполнят ночь и утро своим музыкальным опытом.<br><br>Bpm block - место, где музыка объединяет людей, помогает им выразить себя и приносит эмоции.<br>Ритмы улучшают осознание времени и пространства. Легкость приносит радость.<br><br></p>',1420,'',2,2,1,'https://bpm-block.timepad.ru/event/2532917/?fbclid=PAAab0KWNLuHnhDBkO6W4yqx72YLvPeOy4AJMnc0xWucyObtNw5ObCWbRg7EY_aem_AQDKOnY6m5eNT6uu8Aa7yaXVUC4tuBE_floZaDROif_n-j6OSsciO2D8AUjHbnHyMRk','',false,false,NULL,1,'2023-08-30 15:44:50','2023-10-24 01:21:24',NULL,'','0',18,53),
	 (1714,'Катэраг. 2 года.','2023-09-09-blank-katerag-2-goda','2023-09-09',NULL,'23:59:00',NULL,'<p>За два года – более 250 часов музыки, десятки новых имён и рукопожатий от старой школы, но главное – тысячи ваших шагов на паркетах клубов, баров, террас.<br><br>«Новое поколение рейверов» заходит на третий круг, развернув праздничные скатерти в гримерке и на террасе.<br><br>Праздник это традиции. Следуем им и собираем фулл хаус – вокальный лайв для чутких ушей, электроника для робких поцелуев, техно для хруста досок под ногами и не поддающиеся описанию переплетения ритмов для движений всеми частями тела.<br><br></p>',800,'',1,1,1,'https://spb.radario.ru/events/2038215/tickets','',false,false,NULL,1,'2023-08-30 15:55:18','2023-10-25 06:47:51',NULL,'','0',18,133),
	 (1715,'Friday Session 02','2023-09-01-secrets-friday-session-02','2023-09-01',NULL,'23:00:00',NULL,'<p>Собирайтесь, любители ночных движений, самая яркая вечеринка этой пятницы - 1 сентября в клубе SECRETS&nbsp;<br>Эта пятница, открывающая сезон новых вечеринок SESSION в SECRETS , будет звучать электронное диско, синти, хаус, и щепотка гаража&nbsp;<br>ДО 00:00 ПО СПИСКАМ БЕСПЛАТНО - Списки на сайте</p>',0,'1000.0',1,147,1,'https://docs.google.com/forms/d/1St2-8Kigxpq53iPsyCZGjzo5AQFry6VNnPeIbbAAtvg/viewform?edit_requested=true','https://secretsnightroom.com/',false,false,NULL,1,'2023-08-30 17:30:57','2023-10-25 16:34:52',NULL,'','0',18,62),
