	 (1741,'Salute Honey ','2023-09-01-union-salute-honey','2023-09-01','2023-09-02','23:00:00','06:00:00','<p>Сегодня встречаемся с Salute Honey и их друзьями на двух сценах Ю.&nbsp;<br><br>Самая разнообразная танцевальная лектроника, хип-хоп, бэйли, поп-хиты и ломаные ритмы.<br><br></p>',NULL,'500.0',1,8,1,'','',false,false,NULL,3,'2023-09-01 21:02:52','2023-10-10 22:15:45',NULL,'','0',18,40),
	 (1718,'Systo - Osen''','2023-09-08-les-bliz-ermilovo-systo-osen','2023-09-08','2023-09-11',NULL,NULL,'<p>Дорогие друзья!<br>Искренне благодарим всех гостей и участников весеннего Систо за невероятный праздник, который удалось сотворить всем вместе!<br>И рады пригласить Вас в осенний лес на завершение сезона. Когда еще тепло, но ночи темны и небо полное звёзд...<br><br>Систо для нас стало не просто музыкальным событием, а традиционным слетом, объединяющим такие разные племена в единое большое сообщество!&nbsp;<br>Так давайте же вновь соберёмся вместе и покажем этому миру, что мы готовы к любым вызовам – любовь, творчество и намерение станут нашими инструментами.&nbsp;<br><br>Итак, готовимся к осеннему слету!&nbsp;<br>8-11 сентября 2023 года, где-то в лесах Ленинградской области.<br><br></p>',4700,'',1,168,3,'https://osen.solarsysto.ru/','https://vk.com/solarsysto',false,false,NULL,2,'2023-08-30 18:48:59','2023-10-24 21:07:39',NULL,'','0',18,403),
