	 (1726,'APPLIQUE','2023-09-02-vk-muzyka-summer-stage-applique','2023-09-02','2023-09-03','23:00:00','04:00:00','<p>Кульминацией летнего сезона вечеринок Applique станет сюрприз коллаборация с пространством VK Музыка Summer Stage&nbsp;<br><br>2 сентября врываемся в ночную программу на after после выступления «Дельфина»<br><br>Специально для вас к этому событию мы подготовим открытое небо и дизайн сценического пространства в нашем стиле&nbsp;</p>',1500,'',2,167,1,'https://www.summerstage.ru/event/concerts/applique-mekhanicheskiy-pyes-live-symbol-live-kovyazin-d-mark-s-oid-ldr/','',false,false,NULL,2,'2023-08-31 14:22:08','2023-10-22 22:10:01',NULL,'','0',18,126),
	 (1727,'ДЕЛЬФИН','2023-09-02-vk-muzyka-summer-stage-delfin','2023-09-02',NULL,'21:00:00',NULL,'<p>Кульминацией летнего концертного сезона на VK Музыка Summer Stage 2 сентября станет грандиозное выступление под открытым небом крестного отца отечественной инди-музыки «Дельфина».<br><br>Главный герой российской альтернативной сцены Андрей «Дельфин» Лысиков не нуждается в представлении. Успешно начав карьеру в начале 90-х годов в составе эпатажных рэп-групп «Мальчишник» и «Дубовый Гай», артист вскоре сместил фокус с «грязного рэпа» на идеально попавший в нерв времени агрессивный, и в то же время лиричный хип-хоп, который на долгое время обеспечил «Дельфину» место в хит-парадах радиостанций и телеканалов. Не останавливаясь на достигнутом, музыкант до сих пор продолжает эксперименты со звуком и словом, с каждым релизом все более упрочивая свой статус легенды независимой музыки.<br><br>Выступление «Дельфина» 2 сентября станет по-настоящему особенным событием – уникальный дизайн сценического пространства разработан специально для концерта на VK Музыка Summer Stage. В программе – все самые яркие хиты и свежие треки из нового альбома «ПРОЩАЙ ОРУЖИЕ».<br><br>Также всех зрителей концерта ждёт afterparty и специальная ночная программа «Ночь с Applique»</p>',2500,'',2,167,2,'https://www.summerstage.ru/event/concerts/2023-0902delfin/','',false,false,NULL,2,'2023-08-31 14:34:49','2023-10-19 14:31:30',NULL,'','0',18,55),
	 (1728,'CONTROL+','2023-09-02-park-krestovskii-control','2023-09-02','2023-09-02','16:00:00','22:00:00','<p>Встречаем новый сезон в субботу вместе с тусой сережи токио control+&nbsp;<br><br>Всё так же хорошо, как и в прошлые три раза, электроника, рнб, приятный декор, свежий воздух, выставка картин, вкусная еда, кальяны, горячий бассейн и даже джакузи. В общем всё для вечеринки у бассейна и даже больше.</p>',NULL,'0.0',1,259,1,'','https://t.me/contrrrol',false,false,NULL,2,'2023-08-31 14:43:19','2023-10-24 19:22:39',NULL,'','0',18,125),
	 (1730,'AMEN COLLECTION','2023-09-02-griboedov-amen-collection','2023-09-02',NULL,NULL,NULL,'<p>Новый сезон открывает вечеринка, которая пройдет на двух площадках клуба GRIBOEDOV BASEMENT, с сумасшедшей селекцией танцевальной электронной музыки — AMEN COLLECTION.<br><br>Начнем в 21:00 на терассе Amsterdam<br>&nbsp;Погружаемся в глубины музыкальной прогрессии, легкого ритма, в уютной и комфортной атмосфере, созданную цветами, благовониями, множеством огней и конечно же прекрасными людьми !<br><br>В 00:00 открываем двери в бомбоубежище Basement где можно будет хорошенько встряхнуться звучанием легендарного сэмпла AMEN BREAK, прямиком из Англии 90-х и 00-х.</p>',500,'700.0',1,86,1,'','https://vk.com/griboedovbasement?w=wall-154594155_17218',false,false,NULL,2,'2023-08-31 16:40:07','2023-10-25 02:07:13',NULL,'','0',18,77),
