	 (1734,'UNITED','2023-09-09-rndm-united','2023-09-09',NULL,'23:00:00',NULL,'<p>Спустя практически год, United возвращаются с вечеринкой с усиленным комплектом акустики Funktion One. Гостем вечеринки станет наш друг - Undergroover со специальным сетом.</p>',500,'',2,27,1,'https://moscow.qtickets.events/82170-united-at-rndm-ixix','',false,false,NULL,2,'2023-08-31 17:34:40','2023-10-21 08:53:16',NULL,'','0',18,68),
	 (1735,'Awesome House Style','2023-09-01-dom12-awesome-house-style','2023-09-01',NULL,'21:00:00',NULL,'<p>Наши резиденты сделают ваш weekend краше и вы точно услышите свой любимый трек под который захотите снять сторис.<br>Начало мероприятия в 21:00<br>Вот мы и отметили последние летние выходные в этом году, но мы знаем что после каждых громких вечеринок нужно еще несколько таких же для того что бы придти в себя, именно поэтому<br>погрузитесь в осеннюю атмосферу вместе с нами!<br><br>Настройте свой навигатор на пункт назначения «DOM12” и следуйте в точку назначения не останавливаясь.</p>',NULL,'',1,187,1,'https://dom12spb.ru/?utm_source=vkontakte','',false,false,NULL,2,'2023-08-31 17:45:17','2023-10-19 17:58:07',NULL,'','0',18,43),
