	 (1737,'WeLove Drum & Bass Rave Кибер-Квест ','2023-09-09-aurora-hall-welove-drum-bass-rave-kib','2023-09-09',NULL,NULL,NULL,'<p>Недалёкое будущее. Грани между человеческим разумом и искусственным интеллектом окончательно стерты. Это — пир технологий посреди боли, отчаяния и одиночества. Людям с рождения вживляют в мозг специальные чипы, чтобы контролировать каждый их шаг.</p><p>И только все части музыкального пароля помогут отключить чипы, чтобы освободить нас и возродить в сердцах отчаявшихся надежду, радость и любовь.</p>',1200,'',1,25,1,'https://welovednb.timepad.ru/event/2521658/?utm_source=vk&utm_medium=cps&utm_campaign=sales','',false,false,NULL,2,'2023-08-31 21:04:38','2023-10-24 19:17:28',NULL,'','0',18,128),
	 (1738,'Burning Series','2023-09-08-16-tonn-presnenskii-val-burning-serie','2023-09-08','2023-09-09','23:00:00','05:00:00','<p>Дамы и господа! Всех приглашаем на открытие нового сезона атмосферных уютных drum and bass вечеринок Burning Series в клубе «16 Тонн» 8 сентября в 23:00! Выступают артисты английских и голландских лейблов : Impish (Hospital Records, RAM), Cnof (Fokuz), специальный гость из Крыма, магистр ликвид-фанк звучания, — Sunny Crimea, чудесная ликвид-фанк дива Waandery и резидент вечеринок Dubtype.</p><p><br></p><p>Срочно оповестите всех друзей! Увидимся на танцполе!</p>',600,'',2,29,1,'https://moscow.qtickets.events/82184-burning-series-noch-drum-and-bass-muzyki?utm_source=listing&utm_medium=adv&utm_campaign=buttonlisting','',false,false,NULL,2,'2023-08-31 21:12:50','2023-10-22 20:19:19',NULL,'','0',18,235),
	 (1739,'GARAGE FRIENDS','2023-09-01-16-tonn-presnenskii-val-garage-friend','2023-09-01','2023-09-02','20:00:00','01:00:00','<p>1 сентября на Красной веранде 16 Тонн с 20:00 до 01:00 пройдет мероприятие GARAGE FRIENDS, на котором вы услышите преимущественно гэридж музыку всех известных вариаций, а также близко звучащие стили — грайм, басс, брейкбит, электро и другие.</p>',NULL,'0.0',2,29,1,'https://www.16tons.ru/concert/2023-garage-friends-01sep/','',false,false,NULL,2,'2023-08-31 21:21:16','2023-10-22 12:44:06',NULL,'','0',18,55),
