	 (1743,'Techno Grotesque','2023-09-01-sandboxmusicroom-techno-grotesque','2023-09-01','2023-09-02','23:59:00','06:00:00','<p>1 сентября, в День знаний, всех ждут уютные танцы в студии SandBoxMusicRoom.<br><br>🥳Также ребята будут поздравлять своего друга Dow''s Case&nbsp; с Днём рождения.<br>🎛️Техногротеск сентября во всем его разнообразии и начало клубной поры.&nbsp;<br><br>Начнём в 23:00.<br>🎧Музыкальный состав:&nbsp;<br>LOZARENKO•<br>SSHIVER•<br>DOW''S CASE (birthday set)•<br>PLOTNIKOFF•<br>MAG-IN•<br>SEVEREN•<br><br></p>',NULL,'500.0',1,110,1,'','',false,false,NULL,3,'2023-09-01 21:09:21','2023-10-10 22:07:12',NULL,'','0',18,54),
	 (1744,'NEUROCULT - Knowledge Day','2023-09-01-cult-neurocult-knowledge-day','2023-09-01','2023-09-02','23:00:00','06:00:00','<p>Танцпол, вместо школьного класса. Барные столы заменят парты. &nbsp;<br>Знания по предметам Neurofunk, Techstep, Technoid от учителей старой и новой Drum &amp; Bass школы: &nbsp;<br>&nbsp;&nbsp;<br>| VECSTER | FINSKY&nbsp; | BLACKHAM&nbsp; | &nbsp;<br>| Sinister&nbsp; | Veselect&nbsp; | Changed Daily| Mr.Anderson&nbsp; | T-Land&nbsp; | Vvcx&nbsp; | SHBDB | Outside DJ |&nbsp;<br>&nbsp;&nbsp;</p>',NULL,'700.0',1,92,1,'','',false,false,NULL,3,'2023-09-01 21:13:29','2023-10-23 22:16:07',NULL,'','0',18,96),
	 (1745,'пятница в Mixed','2023-09-01-mixed-piatnica-v-mixed','2023-09-01','2023-09-02','22:00:00','05:00:00','<p>первосентябрьская пятница в миксед с молодыми, но весьма талантливыми ребятами.&nbsp;<br><br>Texture — идейный вдохновитель вечеринок Echo этнической направленности, представитель культового магазина виниловых пластинок Washing Machine и резидент творческого объединения Шабаш Грув.<br><br>Yanush — диджей, любитель винила с большой коллекцией пластинок. в своих сетах не придерживается одного жанра и дает возможность ощутить все краски электронной музыки.</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,3,'2023-09-01 21:15:02','2023-10-22 15:34:21',NULL,'','0',18,49),
