	 (1753,'Виниловый Квартирник','2023-09-01-vinnyi-sklad-vinilovyi-kvartirnik','2023-09-01','2023-09-02','19:00:00','01:00:00','<p>Традиционный виниловый модный квартирник на Складе в пятницу🎶&nbsp;<br><br>Собираемся встретить осень с друзьями, ставим любимые пластинки из своих коллекций. Приносите свои – тоже будем ставить. Открытый виниловый микрофон. Конечно пьем любимых виноделов.&nbsp;<br><br>💫Начнем с диско, подхватим хаусом, дальше переходим в модные этно ритмы, после – врываемся с хитами и финалим максимально энергично и атмосферно!<br><br>🎙️В эфире Литвяк / Инер / Столярова / Элькина / Дятлов / Буч</p><p><br></p>',NULL,'0.0',1,250,1,'','',false,false,NULL,3,'2023-09-01 21:35:33','2023-10-19 15:33:55',NULL,'','0',18,62),
	 (1775,'WARPP','2023-09-16-buddha-bar-warpp','2023-09-16',NULL,'22:00:00',NULL,'<p>Приглашаем вас на незабываемое событие, которое пройдет 16 сентября на двух потрясающих танцполах, специально подготовленных для вас. Мы собрали для вас настоящую палитру эмоций и звуков, чтобы сделать этот вечер неповторимым.<br>С великим удовольствием представляем вам Warpp showcase , который состоится в стенах легендарного Buddha Bar. В этот вечер вы окунетесь в мир электронной музыки и танцевальных ритмов, созданных лучшими резидентами нашего клуба.</p>',1500,'',1,38,1,'','',false,false,NULL,2,'2023-09-06 20:33:38','2023-10-17 04:46:46',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,93),
