	 (1766,'Svidanie','2023-09-02-roof-place-svidanie','2023-09-02','2023-09-03','20:00:00','06:00:00','<p>детство – это проснуться летним утром. по телевизору крутят любимые мультики, на завтрак хлопья с молоком и чай с сахаром, и единственное, что тебя волнует - пойдете ли вы сегодня купаться на озеро. детство - это ощущение ветра в волосах, пока мчишься на четырехколесном велосипеде, щекощучее чувство внизу живота, когда летишь на качелях вверх. ловить снежинки ртом, кататься кубарем по склону, трогать, щупать, замечать.<br><br>сейчас мы научились выбирать порошок для стирки, оплачивать счета и составлять резюме. предпочитать теплый душ и постель постоянным вечеринкам. мы взрослеем и это нормально. но, честно говоря, почему-то именно сейчас хочется отказаться от ответственности и наслаждаться жизнью так, как это было в детстве.<br><br>СВИДАНИЕ CHILDHOOD - про все «впервые». про наши первые разы, про дурацкие игры, бесконечные ссадины и время, когда не существовало ни ограничений, ни лимитов. мы погружаем вас во время, где стать можно кем угодно, где возможно вообще всё и нет ни политики, ни денег, ни «я люблю тебя, но…».<br><br>2 сентября мы встречаемся в нашем любимом ROOFPLACE, где на протяжение всей ночи будем радоваться мелочам, танцевать и обниматься, а утром - встретим рассвет, как в первый раз в жизни.</p>',NULL,'1000.0',1,176,1,'','',false,false,NULL,3,'2023-09-02 19:05:02','2023-10-24 21:08:52',NULL,'','0',18,78),
	 (1767,'RAVERHEAD ','2023-09-02-most-betankura-raverhead','2023-09-02','2023-09-02','17:00:00','21:30:00','<p><br>⚙️RAVERHEAD&nbsp; захватывает новые территории. В эту субботу 02/09 наша команда уcтроит вечерний рейв с прямой трансляцией на открытом воздухе. Пришло время выйти из застенок клуба и начать шуметь на улицах города!&nbsp;<br><br>🩼Можете взять скейт, самокат или велосипед, ведь туса пройдет в скейтпарке под мостом Бетанкура.🦽<br><br>📀Для вас играют: VERAVGOBA| NUMBER12WELVE&nbsp; | INZET&nbsp; | ARACHNO PURGATORY | 2TRNT&nbsp; | DEMIDED<br><br></p>',NULL,'0.0',1,225,1,'','',false,false,NULL,3,'2023-09-02 19:08:55','2023-10-10 22:03:22',NULL,'','0',18,140),
	 (1768,'OMut','2023-09-02-cerkvi-vo-imia-poseshheniia-presviatoi-devoi','2023-09-02','2023-09-03','20:00:00','01:00:00','<p>В третий раз состоится концерт экспериментальной dark ambient и drone музыки. Который пройдёт, в уже полюбившейся всем, действующей Католической Церкви Посещения Пресвятой Девой Марией Елизаветы.<br><br>На этом особенном мироприятии вы сможете окунуться в мистическую атмосферу, создаваемую нашими уникальными проводниками🌊<br><br>Dark ambient и drone музыка известны своими глубокой и медитативной атмосферой, в которой вы сможете трансформировать ваше восприятие и погрузиться вас в совершенно новый мир музыки, пережив мощный духовный опыт.&nbsp;<br><br>Местом проведения концерта будет Католическая Церковь Посещения Пресвятой Девой Марией Елизаветы - историческая и культурная достопримечательность, известная своей великолепной архитектурой и особой акустикой.<br><br>🎶Проводниками в этот вечер станут:<br><br>✨TiihayaRekaa&nbsp;<br>✨BENLGRET&nbsp;<br>✨murmuration&nbsp;<br>✨Vialphas&nbsp;</p>',NULL,'600.0',1,212,2,'','',false,false,NULL,3,'2023-09-02 19:12:25','2023-10-10 21:58:20',NULL,'','0',18,121),
