	 (1772,'DOQTA FEST','2023-09-09-slezy-doqta-fest','2023-09-09',NULL,'22:30:00',NULL,'<p>Привет, друзья!&nbsp;</p><p>9 сентября 2023 года в Москве состоится крутое мероприятие - DOQTA FEST!&nbsp;</p><p>Этот знаковый мультижанровый двухтацпольный рейв из Санкт-Петербурга наконец-то приезжает в столицу, чтобы собрать всех любителей танцев на День Города!</p><p>Это безумное мероприятие пройдёт в баре СЛЁЗЫ, который находится по адресу Костомаровский пер. 3. Начало в 23:00, так что не опаздывайте!</p>',NULL,'500.0',2,102,1,'','',false,false,NULL,2,'2023-09-06 00:24:49','2023-10-24 21:32:00',NULL,'','0',18,55),
	 (1773,'Лёгкая','2023-09-08-suba-bar-legkaia','2023-09-08','2023-09-09','21:00:00','02:00:00','<p>В пятницу 8-го сентября&nbsp;</p><p>"Пустая среда" будет удивлять отборным house и disco house на виниле в программе вечеринки "Лёгкая"</p>',NULL,'0.0',1,205,1,'','',false,false,NULL,2,'2023-09-06 00:39:19','2023-10-24 11:08:09',NULL,'','0',18,46),
	 (1774,'MASKARAD 2023 ','2023-09-23-fantomas-chateau-rooftop-maskarad-20','2023-09-23',NULL,NULL,NULL,'<p>Достопочтимые<br>Судари и Сударыни!<br><br>Свидѣтельствуя наше почтеніе, просимъ васъ пожаловать на осенній ежегодный костюмный балъ-маскарадъ, который имѣетъ впервые быть на смотровой крыш<strong>ѣ</strong> изв<strong>ѣ</strong>стнаго столичнаго танцевальнаго заведенія "Fantomas Chateau &amp; Rooftop".<br><br>Сей карнавальный дивертисментъ состоится въ честь дня Осенняго Равноденствія,<br>знаменующаго проводы съ весной и л<strong>ѣ</strong>томъ.<br><br>По сему резону мы пригласили&nbsp; къ участію заслуженныхъ любимцевъ публики, которые радовали васъ <br>своей виртуозной игрой въ различныхъ жанрахъ на нашихъ недавнихъ проектахъ, дабы вспомнить еще разъ <br>лучшіе моменты завершающагося сезона.<br><br>Премилостиво просимъ выбирать наряды и маски по своему желанному усмотр<strong>ѣ</strong>нію и въ любой тематик<strong>ѣ</strong>,<br> али явиться въ повседневной одежд<strong>ѣ</strong>.<br><br>Но сп<strong>ѣ</strong>шимъ ув<strong>ѣ</strong>домить, что у насъ запланированы ц<strong>ѣ</strong>нные призы за самые лучшіе и оригинальные&nbsp;<br>историческіе дамскіе и мужскіе костюмы..</p>',2000,'',2,170,1,'https://chilloutplanet.ru/events/20230810/#buyTicket','https://maskarad.chilloutplanet.ru/',false,false,NULL,2,'2023-09-06 01:28:23','2023-10-15 10:40:30',NULL,'','0',18,125),
	 (1778,'THE WORLD OF DRUM&BASS 2023','2023-09-22-atmosphere-the-world-of-drumbass-2023','2023-09-22','2023-09-23','20:00:00','07:00:00','<p>Вы ждали этого больше трех лет. Главный фестиваль ломаных ритмов возвращается в своем первозданном виде. Иностранный лайн-ап, многотысячная площадка и, как обычно, не имеющее аналогов мультимедийное шоу.</p>',2000,'',2,134,1,'https://www.drum.ru','https://vk.com/wodbmoscow',false,false,NULL,2,'2023-09-06 21:32:03','2023-10-25 14:55:08',NULL,'','0',18,536);
