	 (1779,'DECONSTRUCTA ','2023-09-08-griboedov-deconstructa','2023-09-08',NULL,'23:00:00',NULL,'<p>Три танцпола жаркой латинской бочки neoperreo и емкие пружинящие семплы deconstructed club, генерируют уникальную по своей структуре энергию, переполняющую изнутри и обволакивающую снаружи.<br><br>Хэдлайнерами мероприятия выступят профессионалы эксперементальной электронной сцены<br><br>Мероприятие пройдет при содействии организации «Доступное действие». В эту ночь, абсолютно бесплатно и анонимно вы можете пройти тестирование на ВИЧ и сифилис, получить равную консультацию по вопросам ВИЧ и ЗППП, а также получить контрацептивы и лубриканты.<br><br></p>',NULL,'1000.0',1,86,1,'','',false,false,NULL,2,'2023-09-06 21:42:36','2023-10-24 19:36:54',NULL,'','0',18,60),
	 (1780,'Стас Танков и Симеон ','2023-09-09-suba-bar-stas-tankov-i-simeon','2023-09-09','2023-09-10','21:00:00','01:00:00','<p>В субботу 9-го сентября у нас выступит Станислав Танков или просто Стас. В начале нашего открытия он уже успел отметится на сцене Шуба бара. И пришло время повторить. Стас исполняет песни собственного сочинения, романтичный танцевальный рок.</p><p>После Стаса, за ди-джей пультом выступит со своей подборкой славянского рейва – Симеон.&nbsp;</p>',NULL,'0.0',1,205,1,'','',false,false,NULL,2,'2023-09-06 22:10:26','2023-10-25 12:35:43',NULL,'','0',18,39),
	 (1781,'INSIDE','2023-09-08-gazgolder-inside','2023-09-08',NULL,'21:00:00',NULL,'<p>После двухлетней паузы и тоски по шумным вечеринкам формация INSIDE возвращается на клубный горизонт.</p>',1200,'',2,35,1,'','https://t.me/insidemusicmoscow',false,false,NULL,2,'2023-09-06 22:26:53','2023-10-20 11:15:13',NULL,'','0',18,36),
	 (1782,'No Wave Night','2023-09-08-prostranstvo-pole-no-wave-night','2023-09-08',NULL,'23:00:00',NULL,'',600,'',2,46,1,'https://no-wave.ticketscloud.org/','',false,false,NULL,2,'2023-09-06 22:27:54','2023-10-24 20:55:09',NULL,'','0',18,84),
	 (1783,'Loud Boyz — Taly Birthday ','2023-09-09-gazgolder-loud-boyz-taly-birthday','2023-09-09',NULL,'23:00:00',NULL,'<p>Начиная с января 22го, мы провели больше десяти вечеринок Loud Boyz, и каждая из них, для нас была безумно крутой, но особенно запомнилась именно вечеринка в клубе Gazgolder.<br><br>Поэтому встречайте нас в стенах Gazgolder, но на этот раз с большим поводом, будем вместе с вами праздновать день рождения Тали!<br>Готовим атмосферу безудержного безумия и праздника, сюрпризы и долгожданный корнер с нашим новым мерчем, который мы эксклюзивно приготовили к этому ивенту.<br>Состав как обычно безумно мощный и родной</p>',1800,'',2,35,1,'https://loud-boyz.ticketscloud.org/','',false,false,NULL,2,'2023-09-06 22:40:06','2023-10-06 12:31:14',NULL,'','0',18,22),
	 (1784,'B-Day Altum Unda','2023-09-08-treff8-club-b-day-altum-unda','2023-09-08','2023-09-09','22:00:00','07:00:00','<p>8 сентября мы отмечаем день рождение Михаила Тимошенко. Михаил-музыкальный визионер, создатель атмосферы и арт инсталляций на разных музыкальных площадках Москвы. На свой день рождение он будет транслировать видение&nbsp; красоты через своё музыкальное Альтер эго. Нас так же ждёт визуальный экстаз -перфоманс, диджитл инсталляция от именинника Декорации от арт дилеров.</p>',1000,'',2,84,1,'','',false,false,NULL,2,'2023-09-06 22:50:29','2023-10-25 10:19:10',NULL,'','0',18,42),
	 (1785,'Intelligence - Бал Вампиров','2023-09-09-treff8-club-intelligence-bal-vampirov','2023-09-09','2023-09-10','22:00:00','07:00:00','<p>И лишь полнолуние заполнит бликами их страстные глаза… Ночь богемной нечести, роз и антуража элитного досуга. TREFF8 представляет новую атмосферную серию фирменных ивентов «INTELLIGENCE: Балл вампиров», где 9го сентября Nelli, на праздновании своего Дня Рождения, подготовит незабываемый BD set вместе с остальными звездами техно сцены.<br>Show:<br>- Живые инструменты: Скрипка;<br>- Костюмированные аниматоры;<br>- Vampire Go Go;<br>- Light Show;<br>- Атмосферные декорации.</p>',1000,'',2,84,1,'','',false,false,NULL,2,'2023-09-06 23:13:21','2023-10-25 14:58:46',NULL,'','0',18,58),
	 (1786,'SYSTEM ONE HUNDRED AND EIGHT × KOSHTA WEEKEND','2023-09-09-prostranstvo-pole-system-one-hundred-an','2023-09-09','2023-09-10','18:00:00','23:00:00','<p>Первым ивентом лейбла System 108 в новом сезоне станет коллаборация с фестивалем коллективного действия Koshta Weekend, который пройдет 9 и 10 сентября одновременно в двух клубах — Поле и БАYНС<br><br>Музыкальный лайн-ап мероприятия полностью скурирован командой 108 и состоит из ее друзей и резидентов, а многообразная арт-составляющая — нашими парнерами<br><br>Ко дню события готовится большой апдейт NFT-проекта Flowerave, о чем мы расскажем отдельно<br><br></p>',100,'2000.0',2,46,1,'https://system108.com/e090923','',false,false,NULL,2,'2023-09-06 23:19:31','2023-10-24 21:31:32',NULL,'','0',18,130),
	 (1824,'Lavia','2023-09-09-technodoner-lavia','2023-09-09',NULL,'20:00:00',NULL,'<p>Диджей из сибири, увлекающаяся музыкой с самого детства. играла во многих клубах и на вечеринках, весной была в числе организаторов техноквартирника в особняке xix века. в музыке вдохновляется возможностью передать свое видение и состояние. основные направления - techno</p>',NULL,'0.0',1,194,1,'','',false,false,NULL,2,'2023-09-08 18:10:28','2023-10-24 23:02:06',NULL,'','0',18,50),
	 (1787,'16om Birthday','2023-09-08-community-moscow-16om-birthday','2023-09-08','2023-09-09','22:00:00','06:00:00','<p>8 сентября в стенах Community Moscow празднуем день рождения проекта 16om. Мы отмечаем 14 лет существования или 4 года активной деятельности нашей команды! За это время мы собрали вокруг себя комьюнити из близких по духу людей, открыли свой рекорд-лэйбл, а сеты наших резидентов смотрят на YouTube десятки тысяч людей по всему миру. Ждем всех поклонников проекта, чтобы вместе отпраздновать наш день рождения, обняться со всеми близкими и хорошенько потанцевать.</p>',1590,'',2,58,1,'https://16ombirthday.ticketscloud.org/?rb_clickid=145225400-1693839057-1016349863','',false,false,NULL,2,'2023-09-06 23:27:01','2023-10-12 04:30:59',NULL,'','0',18,43);
