	 (1788,'Space Voyage','2023-09-22-mutabor-space-voyage','2023-09-22','2023-09-23','23:59:00','12:00:00','<p>Новая вечеринка в Мутаборе под чутким руководством Софии Родиной пройдёт 22 сентября.&nbsp;<br>&nbsp;<br>Пока лайн-ап третьей серии «Space Voyage» держится в секрете. Но мы уверены в том, что это будет незабываемое космическое приключение с качественным звучанием и нетривиальным подбором выступающих техно артистов.</p>',800,'',2,2,1,'https://spacevoyage.ticketscloud.org/?utm_source=tg&utm_medium=event&utm_campaign=voyage3','',false,false,NULL,2,'2023-09-06 23:32:43','2023-10-25 07:16:48',NULL,'','0',18,165),
	 (1789,'RROOM ABSTRACT','2023-09-16-gazgolder-abstract','2023-09-16','2023-09-17','22:00:00','10:00:00','<p>Абстрактные формы музыки и света наполнят собой пространство ТО «Газгольдер», чтобы явить вам RROOM ABSTRACT 16 сентября.&nbsp;<br><br>В рамках мероприятия состоится вторая коллаборация с проектом RTS.FM — международным интернет-радио с прямым вещанием и подкастами артистов из 30+ студий по всему миру</p>',1000,'',2,35,1,'','',false,false,NULL,2,'2023-09-06 23:39:22','2023-10-22 21:48:08',NULL,'','0',18,85),
	 (1790,'UNION','2023-09-09-dizain-zavod-union','2023-09-09','2023-09-11','12:00:00','03:00:00','<p>09 - 11 сентября на территории Дизайн завода состоится фестиваль UNION от московского комьюнити БЮРО, на котором посетителей ждут различные музыкальные сцены, а также дизайнерский маркет, лекторий, арт галерея, перфомансы и другие активности.&nbsp;</p>',1500,'',2,188,3,'https://unionfest.ticketscloud.org/','',false,false,NULL,2,'2023-09-06 23:53:25','2023-10-22 20:19:18',NULL,'','0',18,128),
	 (1791,'Red October - Fantomas Rooftop — закрытие сезона','2023-09-22-fantomas-chateau-rooftop-red-october','2023-09-22','2023-09-23','22:00:00','08:00:00','<p>Официальное закрытие летнего сезона главной музыкальной крыши столицы. Огни ночного города, аутентичность Красного Октября, танцы до рассвета. Фирменный лайнап и особая атмосфера от команды Quintessence.</p>',1000,'',2,170,1,'https://fantomasclosing.ticketscloud.org/','',false,false,NULL,2,'2023-09-06 23:59:34','2023-10-20 13:49:03',NULL,'','0',18,132),
	 (1792,'Resonance Moscow x G8','2023-09-15-prostranstvo-pole-resonance-moscow-x-g8','2023-09-15','2023-09-16','22:00:00','06:30:00','<p>Афтерпати фестиваля креативных индустрий G8 от команды Resonance с ураганным лайнапом.<br><br>Бродячая Собака, Poeli и Директор Всего с лайвами, а также Denis Simachev в b2b-сете с Orange и Kah Mal — культурная танцевальная программа в «пуле». «Другая комната» задаст тёмный вектор ночи: за это в ответе любимая команда&nbsp;</p>',500,'',2,46,1,'','',false,false,NULL,2,'2023-09-07 00:05:26','2023-10-24 21:11:15',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWZkOTU5YWZmZGNiZDZlZTY0NTJjZjczIn0.GeRgIuxoux5eUegSzCkEWmLeljBwf4hO9W4fGQPV01A','0',18,140),
	 (1793,'Highway Day and Night','2023-09-09-blanc-highway-day-and-night','2023-09-09','2023-09-10','18:00:00','06:00:00','<p>С распростертыми объятиями готовимся встретить осень и всех друзей лейбла Highway на новой вечеринке в уютном и гостеприимном Бланке. Как всегда по субботам начинаем ранним вечером, наблюдаем закат, в ожидании коктейлей рассказываем друг другу сочинение "Как я провёл лето" и вспоминаем, в каком московском парке самый красивый листопад. Выдающийся состав артистов этого мероприятия мгновенно татуируется в сознании, вызывает лёгкое головокружение и привыкание.</p>',1500,'',2,36,1,'https://secret420.timepad.ru/event/2549916/','',false,false,NULL,2,'2023-09-07 00:14:14','2023-10-21 07:42:19',NULL,'','0',18,72),
	 (1794,'MAGIC BIRTHDAY!','2023-09-08-fantomas-chateau-rooftop-magic-birth','2023-09-08','2023-09-09','23:00:00','07:00:00','<p>8 Сентября MAGIC BIRTHDAY! Мы по традиции отмечаем День Рождения нашего основателя Насти Династии.<br>Это будет праздник и самый настоящий MAGIC.<br>Ещё и заключительная&nbsp; вечеринка этого сезона, поэтому хотелось бы увидеть вас всех.</p>',1500,'',2,170,1,'https://moscow.qtickets.events/82329-magic-birthday','',false,false,NULL,2,'2023-09-07 00:21:11','2023-10-25 05:06:19',NULL,'','0',18,44),
	 (1795,'Asia Experience','2023-09-09-gazgolder-asia-experience','2023-09-09','2023-09-10','21:00:00','10:00:00','<p>Kоманда Asia Experience соберет в клубе Gazgolder своих друзей с острова Koh Phangan, позитивных людей и всех, кто любит электронную музыку в её разных проявлениях. Традиционно, мы разделим артистов на два танцпола по форматам.&nbsp;<br>Самые любимые диджеи в форматах minimal deep tech, house, melodic techno наполнят ночь качественным саундом, а мы все вместе создадим характерное для наших вечеринок дружелюбно - танцевальное настроение</p>',1000,'',2,35,1,'','',false,false,NULL,2,'2023-09-07 00:27:48','2023-10-09 01:23:48',NULL,'','0',18,35),
	 (1825,'DOBRO','2023-09-08-union-dobro','2023-09-08',NULL,'22:00:00',NULL,'<p>Сегодня — большая вечеринка лейбла Добро&nbsp; на двух сценах Ю с самыми позитивными вибрациями. Начало в 23:00</p>',NULL,'',1,8,1,'','https://t.me/dobrovinyl',false,false,NULL,2,'2023-09-08 18:13:19','2023-10-24 08:42:56',NULL,'','0',18,62),
	 (1796,'Первая осенняя Hypnotica','2023-09-08-blanc-pervaia-osenniaia-hypnotica','2023-09-08','2023-09-09','18:00:00','06:00:00','<p>Встречаем бархатный сезон. По этому случаю организуем в дружеском и уютном Blanc бархатную вечеринку. Собираем резидентов и единомышленников с целью как следует напитаться красивейшей атмосферой наступающей осени. Музыка будет особенной, настроение соответствующее красивой палитре, в которую скоро начнут окрашиваться деревья вокруг. Звук и танцы планируются на нескольких танцполах Blanc, в том числе и спонтанно возникающих. Ловите тепло, любовь и музыку в окружении красивых и классных людей.</p>',1500,'',2,36,1,'https://hypnoticaxblanc.ticketscloud.org/','',false,false,NULL,2,'2023-09-07 00:34:18','2023-10-24 22:29:49',NULL,'','0',18,62);
