	 (1797,'TRIPLEX','2023-09-09-griboedov-triplex','2023-09-09',NULL,'23:00:00',NULL,'<p>Любовь, свобода и безопасность — здесь можно все !<br><br>Продолжаем горячие выходные свежей вечеринкой, которая представит для вас гостей из Москвы, в лице FALCON KID, SQ7ZY,<br>наших друзей из KONTRKULT — NIENSHANZ и MVRLYA,<br>фирменный стиль от основы Питера — OTIUMO и ROUZI,</p>',NULL,'700.0',1,86,1,'','',false,false,NULL,2,'2023-09-07 00:39:24','2023-10-25 10:33:21',NULL,'','0',18,56),
	 (1798,'KULT x ELECTROBUDKA','2023-09-08-ritmy-kult-x-electrobudka','2023-09-08',NULL,'23:00:00',NULL,'<p>Восьмого сентября встречаемся в Ритмах на Севкабеле, чтобы за одну ночь дать вам буквально всё и вся: на двух танцполах развернутся шоукейсы с отборным электро и тяжеловесным техно.</p><p>&nbsp;Террасу, принимая поздравления с Днем рождения, открывает Mvrlya, а дальше и до самого утра пускаемся в пляс с DJ Stonik1917, Nienshanz, Negative Datura и далее по списку &nbsp;</p><p>Непосредственно внутри клуба будет бочка, бочка, бочка — собрали самый сок, жесть и авангард. Культ, как он есть: во главе PARTIA, Alex Pankov из Monasterio, гибридный лайв HOAX. В общем, есть, куда нестись.</p>',500,'',1,181,1,'https://nasledielabel.timepad.ru/event/2569421/','',false,false,NULL,2,'2023-09-07 02:13:23','2023-10-25 09:10:40',NULL,'','0',18,88),
	 (1799,'SABOTAGE 1 YEAR ANNIVERSARY','2023-09-08-mod-sabotage-1-year-anniversary','2023-09-08',NULL,'23:55:00',NULL,'<p>Нет времени объяснять, готовься к ПРЯМОМУ!&nbsp;<br><br>Прямому воздействию на уровень эндорфина!<br>Прямой бочке от наших резидентов и гостей!<br>Прямым стенам в обновлённом клубе Mod, отражающим космическое звучание house и techno музыки!<br><br>Тебя ждут два танцпола, 7 часов отборного саунда, 17 диджеев, хедлайнер из Калининграда WHITE, а также secret guest!</p>',400,'',1,113,1,'https://sabotage-inc.timepad.ru/event/2546754/','',false,false,NULL,2,'2023-09-07 02:18:44','2023-10-24 09:37:11',NULL,'','0',18,62),
	 (1800,'SERIAL by Music Hall Production','2023-09-30-music-hall-serial-by-music-hall-product','2023-09-30','2023-10-01','23:00:00','06:00:00','<p>В эту ночь, на двух танцполах, соберутся лучшие представители электронной сцены Москвы и Санкт-Петербурга, эксперты с большой и интересной историей, а так же новые, но уже хорошо зарекомендовавшие себя персоны. Serial это серия мероприятий от команды Music Hall Production, коллаборация ярких и талантливых личностей. Последняя суббота Сентября останется в памяти и даст новой вектор движения жизни ночного Петербурга.<br><br></p><p><br></p>',1500,'',1,269,1,'https://music-hall-production.timepad.ru/event/2538096','',false,false,NULL,2,'2023-09-07 02:30:55','2023-10-25 17:30:35',NULL,'','0',18,156),
	 (1801,'Krasa Rosa - Nadeya B-day','2023-09-15-cinist-krasa-rosa-nadeya-b-day','2023-09-15',NULL,'22:00:00',NULL,'<p>15 сентября в Secret Tsinist – вечеринка Krasa Rosa<br>Будем отмечать день рождения голоса проекта - Nadeya.<br>К нам приедут Stan Tone и Dasha Zarya и отыграют лайв, кстати впервые в Санкт-Петербруге!&nbsp;<br>Еще мы приготовили эксклюзивный мерч Krasa Rosa, просили - получайте<br>И на десерт – презентация нового трека Krasa Rosa.&nbsp;<br>Будем рады разделить все эти прелести с вами, до встречи!</p>',1200,'',1,94,1,'https://krasa-rosa-event.timepad.ru/event/2572462','',false,false,NULL,2,'2023-09-07 02:47:20','2023-10-19 04:22:39',NULL,'','0',18,84),
	 (1802,'TRANCEMISSION ','2023-10-06-a2-trancemission','2023-10-06',NULL,'22:00:00',NULL,'<p>«Трансмиссия» — это всегда буйство красок, неостановимый поток музыки и отличное настроение для всех присутствующих. На этот раз организаторы советуют: откройте сердце — и вы услышите волшебную музыку цветов, которые расцветают ночью! Осенняя танцевальная феерия в клубе A2 Green Concert озарится неоновым светом, который оживят сеты первоклассных диджеев. В фестивале примут участие аргентинская звезда транса Chris Schweizer, египетский продюсер Ahmed Helmy, а также Feel, Fonarev, Alexander Popov и Eximinds.</p>',2000,'',1,95,1,'','',false,false,NULL,2,'2023-09-07 03:05:39','2023-10-24 04:41:54',NULL,'','0',18,315),
	 (1803,'Vibe Room','2023-09-09-miraz-vibe-room','2023-09-09',NULL,'00:00:00',NULL,'<p>Жизнь после лета определенно есть — терраса на Большом 35 все еще работает, погода все еще летняя, а энтузиазма никогда не заканчивать вечеринку все еще целый вагон.<br><br>Вход 500₽ до 01:00 / 700₽ после&nbsp;</p>',500,'700.0',1,77,1,'','',false,false,NULL,2,'2023-09-07 03:43:19','2023-10-25 17:29:25',NULL,'','0',18,40),
	 (1826,'Dance Jam','2023-09-09-union-dance-jam','2023-09-09',NULL,'21:00:00',NULL,'<p>Вечером — танцевальный джем от промогруппы KWBNG.Prod, где выступят лучшие представители афро/денсхолл культуры и просто желающие показать себя на танцполе.</p>',NULL,'0.0',1,8,1,'','',false,false,NULL,2,'2023-09-08 18:20:26','2023-10-25 01:17:42',NULL,'','0',18,47),
	 (1804,'АМУР ТУЖУР ','2023-09-15-mod-amur-tuzur','2023-09-15',NULL,'23:30:00',NULL,'<p>Притягательные гейши, манящие своей красотой.<br>Блистательные самураи, восхищающие мужеством и бесстрашием<br>Необузданные демоны, пляшущие в темноте и приглашающие присоединиться к своему темному ритуалу.<br>На одну ночь Амур Тужур примет иную форму.<br><br>«Noir Asiatique» отправит вас в путешествие по Японии под мощное звучание уникального техно, рассекающего пространство словно катана.<br><br>👘DC: кимоно, хаори, просторные юбки-брюки, пояса оби, обувь на высокой платформе, веера, заколки, браслеты.</p>',900,'1500.0',1,113,1,'https://amourdiscotheque.qtickets.ru/','https://vk.ru/amourdiscotheque',false,false,NULL,2,'2023-09-07 03:50:43','2023-10-10 21:38:29',NULL,'','0',18,97),
	 (1805,' Wonderland','2023-09-09-secrets-wonderland','2023-09-09',NULL,'22:00:00',NULL,'<p>Сентябрьское 9-е число принесло с собой нечто особенное – сказочный мир Wonderland готовится распахнуть свои двери настежь.<br><br>Первым артистом, который ступит на музыкальную сцену клуба Secrets, станет талантливый NETOCHNO, знакомый многим по треку Ritmik, что сотни раз сотрясли танцполы предыдущих событий.<br>Волшебство этой ночи пригласило на свой бал крылатого амура музыки – Tantsui. Его мелодичный голос и магия звуков обещали покорить сердца всех присутствующих. Артист, выпускающие свои звуковые импринты, на Crosstown Rebels, Kindisch, Get Physical и Bar 25 Music, приедет подарить свою live программу.<br><br>После концерта вас ждет повествование историй от Serkvin и Nikita Grib. Их душевные рассказы оживят ночь и перенесут в мир восточных сказок с элементами азиатской магии.&nbsp;<br>Но самое завораживающее вас будет ожидать в конце. Финальный аккорд этой ночи – фантастическое B2b2b в исполнение от Serkvin, Nikita Grib и Netochno. Это будет как тройное слияние музыкальных миров, как фейерверк звуков и эмоций, которые завершат эту ночь в стране чудес.&nbsp;</p>',1500,'',1,147,1,'https://phagamast.ticketscloud.org/?utm_source=site&utm_content=lading','https://phagamast.com',false,false,NULL,2,'2023-09-07 04:02:06','2023-10-25 12:10:48',NULL,'','0',18,50);
