	 (1806,'FLIP FLAP','2023-09-08-blank-flip-flap','2023-09-08','2023-09-09','23:00:00','07:00:00','<p>В ночь с 8 на 9 сентября состоится главное и финальное мероприятие в рамках летнего тура.&nbsp;<br>Юбилей проекта FLIP FLAP в главном клубе города - BLANK (https://t.me/blankclub).<br><br>На основной сцене будет серьезная артиллерия: брейкбит, драм-н-бейс, джангл, а также лайв от хедлайнера FOLKPRO.<br>Зал «гримерка» будет передан артистам из Красноярска, Казани, Нижнего Новгорода и, конечно же, Санкт-Петербурга. По музыке будет всё: хаус, техно, гараж и т.п.&nbsp;</p>',1000,'',1,1,1,'','https://t.me/flipflapofficial/880',false,false,NULL,2,'2023-09-07 04:27:48','2023-10-25 16:17:56',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjRiZmExMzI3ZWY1Y2IxZDBmMmRiMzc2In0.U5LN-YJZhFaQgDeRexBOigU7_uZBm78libvTkW7weEg','0',18,85),
	 (1807,'GIRLS NIGHT 2','2023-09-08-miraz-girls-night-2','2023-09-08',NULL,'23:00:00',NULL,'<p><br><br>FC: 18+ | DC: glampunk<br>вход 600₽ до 01:00/800₽ после<br><br>nft priority pass - вход бесплатный&nbsp;</p>',600,'800.0',1,77,1,'','',false,false,NULL,2,'2023-09-07 04:38:32','2023-10-24 14:00:51',NULL,'','0',18,57),
	 (1808,'SENS','2023-09-23-mutabor-sens','2023-09-23',NULL,'23:00:00',NULL,'<p>Любители электронной музыки и ночной жизни Москвы уже знают: sens — это переворот в эстетике и форме рейва: берлинское звучание четырёх сцен, гонг-медитация, лежачий танцпол, перформансы и dark-вайб. Все это сочетается с монументальным преображением пространства, этикой активного согласия и свободы<br><br>На шабаш команда везёт обновлённую концепцию локаций и декора. Каждый уровень пространства, от катакомб Under’а до балконов Main’а — путь от телесной греховности к духовности<br>Гостей ждут:&nbsp;<br>• Пространство для селф-практик;<br>• Перформансы, поп-ап активности;<br>• Арт-инсталляции;<br>• Воздушные гимнасты;<br>• Богемный чилл;<br>• Лежачий танцпол в новом прочтении;<br>• И секретный «запретный плод».<br><br>DC: total black + fetish (людей на входе буквально заставляют снимать футболки с принтами, так что подойдите к вопросу ответственно)&nbsp;</p>',3300,'',2,2,1,'https://sens2309.ticketscloud.org/','',false,false,NULL,2,'2023-09-07 04:46:28','2023-10-25 04:37:22',NULL,'','0',18,191),
	 (1809,'LADY-DOLPHIN WEEKEND: FLIRT','2023-09-07-resohub-lady-dolphin-weekend-flirt','2023-09-07','2023-09-09','19:00:00','22:00:00','<p>Продолжаем создавать атмосферу томной вечеринки у бассейна во дворе изокаи Kyomei и активируем зону раскрепощенного флирта 🌹 Наш второй совместный викенд – это дурман тропических коктейлей и пинг-понг на раздевание<br><br>7 СЕНТЯБРЯ Четверг 19:00 - 22:00<br>Медленный эйсид экстаз от Vlas Leskin<br><br>8 СЕНТЯБРЯ Пятница 19:00 - 00:00<br>Будуар резидентов Resonance. Весь вечер DESTROY и CPSL в режиме b2b<br><br>9 СЕНТЯБРЯ Суббота 19:00 - 00:00<br>Боремся за свободный шезлонг под мелодии от Roma Nemov и Sablemik<br><br>Идите на скрип ботфортов леди Дельфин 🐬🌙<br><br>Вход: FREE<br><br></p>',NULL,'0.0',2,186,3,'','',false,false,NULL,2,'2023-09-07 19:22:00','2023-10-04 13:47:36',NULL,'','0',18,29),
	 (1810,'Peredel Eleven & Highlite','2023-09-29-powerhouse-peredel-eleven-highlite','2023-09-29','2023-09-30','23:23:00','07:00:00','<p>Серия концептуальных мероприятий Peredel Eleven придерживается собственных правил: Peredel плюс интересный артист равно новый взгляд на танцевальную музыку.&nbsp;</p><p>Седьмое мероприятие из цикла Peredel Eleven пройдет 29 сентября в Atmosphere Moscow.&nbsp;</p>',1750,'',2,5,1,'https://peredel11.com','',false,false,NULL,2,'2023-09-07 19:30:15','2023-10-25 09:37:06',NULL,'','0',18,120),
	 (1811,'POPOFF KITCHEN','2023-09-09-deep-fried-friends-popoff-kitchen','2023-09-09',NULL,'23:00:00',NULL,'<p>Пришло время познакомиться с нашими главными дьяволятами, именно они будут радовать вас музыкальной составляющей ночи!</p>',1000,'',2,76,1,'https://popoffredball.ticketscloud.org/','',false,false,NULL,2,'2023-09-07 20:31:30','2023-10-20 21:17:08',NULL,'','0',18,40),
	 (1812,'MIDNIGHT IN PARIS','2023-09-08-deep-fried-friends-midnight-in-paris','2023-09-08',NULL,'23:00:00',NULL,'<p>Самая безумная и веселая вечеринка грандиозно возвратится в стены любимого ресторана Deep Fried Friends уже в эту пятницу.&nbsp;<br>Откроет праздник жизни светский красавец и стиляга Ефим Гинзбург, затем за пульт встанет живая легенда диджеинга, создатель серии вечеринок Love Boat, обожаемый Виталий Козак&nbsp;<br>Поговаривают, что в ресторан заявятся секретные музыканты и устроят настоящее шоу, но мы ничего не знаем &nbsp;<br>Специальным гостем ночи будет ведущий YouTube-шоу «Вписка», топовый селектор Коля Редькин, а красиво завершит вечеринку наш бро, резидент Симача и автор пати "В шумном зале ресторана" Егор Холкин<br><br>ВХОД ПЛАТНЫЙ:<br>23:30 - 0:30 500₽<br>0:30 - 3:00 1000₽<br>3:00 - 5:00 FREE</p>',500,'1000.0',2,76,1,'','',false,false,NULL,2,'2023-09-07 20:35:21','2023-10-13 07:49:42',NULL,'','0',18,27),
	 (1813,'Raw Langoustines w/ Errioxa','2023-09-09-grani-raw-langoustines-w-errioxa','2023-09-09',NULL,'21:00:00',NULL,'<p>В субботу подходите на Некрасова, потому что в программе:<br>Raw Langoustines Party<br>Errioxa, WhoisKK и NLV за диджейкой с хаусом<br>Ваня Гринько за баром<br>Новые классные коктейли и еда<br><br>Напоминаем что мы полностью обновили меню и запускаем его уже в эти выходные!<br>Всех ждём</p>',NULL,'0.0',1,197,1,'','',false,false,NULL,2,'2023-09-07 20:40:52','2023-10-25 07:31:09',NULL,'','0',18,30),
	 (1814,'SOMA PARTY','2023-09-09-soma-soma-party','2023-09-09','2023-09-10','21:00:00','03:00:00','<p>У Soma особенные планы на эту субботу: хэдлайнером вечера станет Acid Orchestra —&nbsp;проект Евгения Викентьева (шеф-повар «Белуга»), Дмитрия Винникова&nbsp; (ex. Pompeya) и Даниила Силина (Sakura).</p>',NULL,'0.0',2,218,1,'','',false,false,NULL,2,'2023-09-07 20:46:18','2023-10-23 00:33:14',NULL,'','0',18,58),
	 (1815,'WHY?NOT','2023-09-08-cult-whynot','2023-09-08',NULL,'23:00:00',NULL,'<p>Yo, guys!&nbsp;<br>Команда Why¿Not вновь организовывает вечеринку! В этот раз мы соберемся в центре города в новом пространстве CULT. Ждём всех 8 сентября&nbsp;<br>Начало в 23:00! Танцуем до 6 утра&nbsp;<br>Адрес : Лиговский, 44-45 Д&nbsp;<br>Мы подготовили для вас два танцпола-электронные ритмы в сочетании со взрывным хип-хопом, а также&nbsp; лайв выступление наших артистов.&nbsp;<br>Будем двигаться под лучами диско шара и наслаждаться вкуснейшими коктейлями.<br>Давай проведем эту пятницу вместе&nbsp;</p>',300,'500.0',1,92,1,'','',false,false,NULL,2,'2023-09-07 20:50:26','2023-10-23 23:03:48',NULL,'','0',18,53);
