	 (1820,'DJ SLON Birthday Party','2023-09-16-factory-3-dj-slon-birthday-party','2023-09-16','2023-09-17','23:55:00','07:00:00','<p>Как всегда, в середине сентября dj Слон отмечает свой день рождения. В этом году, помимо дня рождения, Слон отмечает ещё и 30-летие творческого пути.<br><br>Можно начать перечислять клубы, где и с кем играл, или кого привозил, фестивали, в которых участвовал, города, страны и даже континенты, где бывал. Можно вспомнить его книги, радио передачи, и другое медиа присутствие, но получится огромный талмуд, делать этого мы не будем.)&nbsp;<br><br>Расскажем о том, кто будет играть на дне рождения, формат, само собой, техно и электро.&nbsp;</p>',500,'600.0',1,7,1,'','',false,false,NULL,2,'2023-09-08 17:46:02','2023-10-25 01:02:20',NULL,'','0',18,125),
