	 (1822,'RAVE PLANET ','2023-09-09-zoccolo-20-rave-planet','2023-09-09',NULL,'23:50:00',NULL,'<p>В ночь с 9 на 10 сентября в клубе <a href="https://vk.com/zoccolo_2_0">ZOCCOLO 2.0</a> пройдёт первая встреча ценителей электронной музыки, именуемая RAVE PLANET.<br><br>Будем уходить в отрыв под треки GSPD, Dead Blonde, Дети Rave, dlb, хриси и других. Вы услышите как новинки, так и старые хиты для ветеранов рейва.<br><br></p>',500,'1000.0',1,72,1,'https://rave-planet.qtickets.ru/event/79760','https://vk.com/wall-221310324_2',false,false,NULL,2,'2023-09-08 17:54:43','2023-10-25 03:57:30',NULL,'','0',18,60),
