	 (1827,'HOMIES','2023-09-09-union-homies','2023-09-09',NULL,'23:00:00',NULL,'<p>&nbsp;А после на двух сценах — широкоформатный ивент HOMIES,&nbsp; участники которого наполнят Ю электронным селектом в лучших традициях рейва на необитаемом острове. Хип-хоп, днб, юкг, джангл, которые будут звучать в унисон позитивно окрашенным визгам танцующей толпы.</p>',NULL,'500.0',1,8,1,'','',false,false,NULL,2,'2023-09-08 18:25:16','2023-10-25 15:41:46',NULL,'','0',18,47),
	 (1828,'DMT JAM','2023-09-10-ritmy-dmt-jam','2023-09-10',NULL,'20:00:00',NULL,'<p>Ребзя, не знаю, просили вы или нет, но мы вас услышали!&nbsp;<br><br>После длительного перерыва прямиком из закрытого Штакета к нам на Кожевенную 34 врывается первый электронный джем!&nbsp;<br>Все, у кого есть устройства, издающие электронные звуки, ждем у нас на квадрате!&nbsp;<br><br>Даже админ принесет свой 707 роландос!&nbsp;<br>Несите свои синты, грувбоксы, драммашины, синты, миди контроллеры и будем шуметь! Звук лютый, места полно, есть еда, коктыши и пево!&nbsp;</p>',NULL,'',1,181,1,'','',false,false,NULL,2,'2023-09-08 18:27:42','2023-10-21 12:52:19',NULL,'','0',18,24);
