	 (1829,' Kim & Buran ','2023-09-08-macty-kim-buran','2023-09-08',NULL,'20:00:00',NULL,'<p>Приглашаем вас на долгожданный концерт после долгого перерыва в обновленном составе в Мачтах.<br><br>Музыка Kim &amp; Buran — это саундтрек к несуществующему фильму о космосе, современная стилизация забытых музыкальных жанров как space age и sci -fi pop, а также space disco. Группа использует на выступлениях аналоговые синтезаторы и живую ритм секцию погружая в атмосферу космического полета.</p>',700,'',1,9,2,'https://spb.radario.ru/events/2017206/tickets','https://vk.com/kimandburanlive',false,false,NULL,2,'2023-09-08 18:30:17','2023-10-23 11:13:41',NULL,'','0',18,52),
	 (1830,'EgoEgo B-day Party','2023-09-08-miska-bar-egoego-b-day-party','2023-09-08','2023-09-09','21:00:00','03:00:00','<p>Сегодня, 8 сентября, в Mishke будет настоящее диджейское столпотворение, дым столбом, и вечеринка до упаду.</p>',NULL,'0.0',1,12,1,'','',false,false,NULL,2,'2023-09-08 18:33:03','2023-10-23 20:11:19',NULL,'','0',18,36),
