	 (1832,'Vinyl Taproom','2023-09-08-hops-mustache-vinyl-taproom','2023-09-08',NULL,'21:00:00',NULL,'<p>Ждём тебя в пятницу 8 сентября.<br>Первую пластинку ставим в 21-00<br>Вход свободный.<br>Адрес: HOPS MUSTACHE BAR<br>Лиговский 50 к.16 (крылечко с лампочками)!<br><br></p>',NULL,'0.0',1,144,1,'','',false,false,NULL,2,'2023-09-08 18:42:27','2023-10-24 06:55:44',NULL,'','0',18,41),
