	 (1834,'PANDEMIC RAVE','2023-10-07-blank-pandemic-rave','2023-10-07',NULL,'23:55:00',NULL,'<p>PANDEMIC RAVE - это новый виток рейв-ивентов с киберпанк уклоном, с разнообразным электронным звучанием и тематическим визуальным контентом. Свобода самовыражения, и альтернативная реальность на одну ночь обеспечена!</p>',700,'',1,1,1,'https://rupor.biz/widgets/event-tickets/880','',false,false,NULL,2,'2023-09-11 15:23:45','2023-10-25 17:48:41',NULL,'','0',18,740),
	 (1835,'Тайна Вече','2023-09-15-ksi-taina-vece','2023-09-15','2023-09-17','19:00:00',NULL,'<p>Ты точно в правильной базе данных.<br><br>Резиденция культуры Ѯ [кси] и мистический лэйбл vicious muse созывают саммит электронной музыки «Тайна вече». Среди участников: продюсеры, издатели, букинг агенты, меценаты клубной индустрии, музыкальные дилеры и диджеи. Гости саммита проведут три дня в резиденции на территории бывшей водяной мельницы с фирменным звуком и дискуссиями экспертов на актуальные темы.<br><br>Наша цель - создать среду для тесного общения, обмена опытом и коллабораций.</p>',2000,'',1,264,3,'https://kaparga.info/taina_veche','',false,false,NULL,2,'2023-09-12 19:12:33','2023-10-17 05:59:39',NULL,'','0',18,60),
	 (1836,'ПОСЛЕДНЯЯ ОСЕНЬ','2023-09-14-serdce-posledniaia-osen','2023-09-14',NULL,'19:00:00',NULL,'<p>14 сентября на Биржевой линии состоится праздничное закрытие Международного особняка искусств<br><br>15 сентября музыканты, художники, режиссёры, кузнецы, реставраторы роялей, выходцы ленинградского рок клуба, концертные площадки будут вынуждены освободить помещения на Биржевой линии, 8, 10 и 12. Поэтому 14 сентября здесь устраивают фееричные похороны андеграунда — со столом, блинами и танцами на костях.&nbsp;<br><br>В последний раз особняк откроет свои двери на 24 часа. Пришедших ждут музыка, огромный стол, шапито, барабаны, танцы, песни, финальное знакомство и прощание.&nbsp;</p>',1,'',1,6,1,'https://postrealism.timepad.ru/event/2559791/','',false,false,NULL,2,'2023-09-12 19:36:55','2023-10-18 16:09:04',NULL,'','0',18,80),
	 (1846,'Fantomas Rooftop — закрытие сезона','2023-09-22-chateau-de-fantomas-fantomas-rooftop','2023-09-22',NULL,'22:00:00',NULL,'<p>Официальное закрытие летнего сезона главной музыкальной крыши столицы. Огни ночного города, аутентичность Красного Октября, танцы до рассвета. Фирменный лайнап и особая атмосфера от команды Quintessence.&nbsp;</p>',1000,'',2,93,1,'https://fantomasclosing.ticketscloud.org/','',false,false,NULL,2,'2023-09-12 23:51:11','2023-10-23 08:51:49',NULL,'','0',18,75),
	 (1837,'SYNCHRON TAG','2023-09-16-mutabor-synchron-tag','2023-09-16','2023-09-17','21:00:00','06:00:00','<p>Команда Синхрон вновь выходит за рамки предсказуемого рейва. Комьюнити создает повод для переосмысления современного уличного искусства.<br>Вечер начнется с премьерного показа граффити фильма команды NRA. Кинохроника с изнанки московского метро.<br><br>На уличном танцполе развернется танцевальный батл от объединения «RISE». Более 50 уличных танцоров с уникальными стилями хореографии.<br><br>Главная интрига ночи — концерт легендарного рэп и граффити объединения Москвы. Их имена станут известны за сутки до ивента.&nbsp;<br><br>Фирменные аудиовизуальные лайв-выступления лейбла Синхрон продолжат традиции команды. Резиденты комьюнити сыграют для слушателя как в стерео, так и в квадро формате на уличном танцполе Мутабора. &nbsp;</p>',1000,'',2,2,1,'https://synchron-event.timepad.ru/event/2564989/','',false,false,NULL,2,'2023-09-12 22:32:22','2023-10-22 12:34:48',NULL,'','0',18,191);
INSERT INTO public.events (id,title,slug,start_date,end_date,start_time,end_time,description,price_from,price_gate,city_id,venue_id,event_type_id,tickets_url,info_url,is_cancelled,is_featured,deleted_at,user_id,created_at,updated_at,ticketscloud_event_id,ticketscloud_event_token,ticketscloud_event_multi,age_limit,"views") VALUES
	 (1838,'TOXIC','2023-09-15-blank-toxic','2023-09-15',NULL,'23:59:00',NULL,'<p>Ребятки, инсайт словила, щас тресну. Рассорилась со своим программным, вдрызг заколебал этим техно. Как ни зайду, всюду морды сложные, дергаются впотьмах, глаза на затылке, истину познают.<br><br>Целое лето умоляла: давай что-нибудь новенькое попробуем? А он все об одном, ноль компромисса, чистый абьюзер. Выдала психотерапевту все как есть, прорыдалась хоть плавай. Жаль, купальника не было, с таким курсом доллара только в слезах бултыхаться. Выслушал и говорит: девочка моя, а сама-то ты, проявляться пробовала?<br><br>И тут меня накрыло: че раньше не доперла? Как-то собралась, проработала убеждения, поставила намерение и аффирмациями легитимировала принятие себя. Готовлюсь к запуску личного бренда, «Токсик» называется, в честь меня. С программным все уладила, он у меня душка, даже дату выдал. Наполненности и осознанного веселья в изобилии! Откликается?</p>',900,'',1,1,1,'https://blankclub.ru','',false,false,NULL,2,'2023-09-12 22:40:41','2023-10-21 20:22:08',NULL,'','0',18,99),
	 (1839,'PRIVATE PERSONS — 7 YEARS','2023-09-15-mutabor-private-persons-7-years','2023-09-15',NULL,'23:00:00',NULL,'<p>15 сентября Private Persons вновь захватывают власть в Мутаборе и ваших сердцах. Одной из самых узнаваемых в мире формаций 7 лет. С днюхой!<br><br>По плану три сцены с участниками и друзьями лейбла, новинки магазина (включая коллабные айтемы со стволом), съёмка очередного эпизода STVOL TV на мейне. Ну кайф же.&nbsp;</p>',2500,'',2,2,1,'https://privatepersons.net/','https://privatepersons.net/',false,false,NULL,2,'2023-09-12 22:46:55','2023-10-20 07:01:34',NULL,'','0',18,212),
	 (1840,'Gothwave','2023-09-16-motyga-gothwave','2023-09-16',NULL,'23:00:00',NULL,'<p>Gothwave - goth-вечеринка, рожденная на руинах затяжной регрессии, - возвращается туда, где все начиналось.&nbsp;<br>&nbsp;<br>Развалины, летучие мыши, паутина - все, как ты любишь, но боишься в этом признаться даже себе!&nbsp;</p>',350,'',2,114,1,'https://www.gothwave.ticketscloud.org/','',false,false,NULL,2,'2023-09-12 22:52:38','2023-10-23 03:25:53',NULL,'','0',18,52),
	 (1841,'IDM/Future Pop/Lo-Fi','2023-09-14-motyga-idmfuture-poplo-fi','2023-09-14',NULL,'19:30:00',NULL,'<p>19:30 Игорь Плохой<br>20:30 ἀωρία<br>21:30 NickMoor<br>22:30 Sultan Seth</p>',NULL,'0.0',2,114,1,'','https://vk.com/wall-217420353_179',false,false,NULL,2,'2023-09-12 23:07:45','2023-10-24 22:46:18',NULL,'','0',18,39),
	 (1842,'HEARTCORE','2023-09-15-griboedov-heartcore','2023-09-15','2023-09-16','22:00:00','06:00:00','<p>Приглашаем всех любителей сложного звучания и простых танцев погрузиться в океан абстрактных сложных звуков от IDM и Future grime на самой громкой вечеринке пятницы</p>',NULL,'1000.0',1,86,1,'','',false,false,NULL,2,'2023-09-12 23:13:31','2023-10-24 21:03:25',NULL,'','0',18,68),
	 (1843,'YOUNG BLOOD: Open deck','2023-09-14-griboedov-young-blood-open-deck','2023-09-14','2023-09-14','21:00:00','23:59:00','<p>Приглашаем артистов, диджеев и всех тех, кто связывает свою жизнь с музыкой на наш новый формат — открытый пульт.<br><br>Не важно играете ли вы на каком то инструменте, используете микрофон для синтеза звука, драм-машину или же играете с сидюков; важно что вы тот, кто генерирует звуковую волну и получает от этого истинное удовольствие.</p>',NULL,'300.0',1,86,1,'','https://vk.com/wall-217420353_179?w=wall-154594155_17225',false,false,NULL,2,'2023-09-12 23:20:27','2023-10-06 15:48:52',NULL,'','0',18,28),
	 (1844,'Сутки','2023-10-21-mutabor-sutki','2023-10-21','2023-10-22','23:00:00','23:00:00','<p>Тик-так. Черта собирает друзей, чтобы вместе потеряться во времени, и точно знает, как это сделать: плеяда из 28 артистов с диджей-сетами и лайвами, завораживающий свет и атмосферные декорации, которые превратят Mutabor в пространственно-временной континуум на 24 часа. Только перешагнул порог - оп! и пошли вторые сутки.</p>',1500,'',2,2,1,'https://sutki.ticketscloud.org/','',false,false,NULL,2,'2023-09-12 23:30:57','2023-10-25 01:22:40',NULL,'','0',18,927),
	 (1845,'Tapenight КЛАН','2023-09-16-blank-tapenight-klan','2023-09-16',NULL,'23:59:00',NULL,'<p>16-го сентября собираем TAPENIGHT Клан в клубе BLANK.<br>На сценах и в зале собираемся большим комьюнити единомышленников, празднуем встречу под интересную музыку и пропитываемся атмосферой единства.</p>',700,'',1,1,1,'','',false,false,NULL,2,'2023-09-12 23:40:26','2023-10-17 22:32:26',64,'"eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBH','0',18,170),
	 (1847,'SE:VER Ночь сказок','2023-09-16-community-moscow-sever-noc-skazok','2023-09-16',NULL,'23:00:00',NULL,'<p>Музыкальное погружение в атмосферу русских народных сказок в современных электронных аранжировках. Столичный дебют звезд органики из Перми, любимые хедлайнеры из Санкт-Петербурга и убойная поддержка от столичных клубных хитмейкеров. 3D мэппинг клуба-библиотеки, "зажжение" грифона и съемки сетов в лучших традициях вечеринок Boiler Room и Mixmag для <a href="https://www.youtube.com/@wearesever/">канала SE:VER</a></p>',1500,'',2,58,1,'','https://severlabel.ticketscloud.org/',false,false,NULL,2,'2023-09-12 23:57:37','2023-10-22 22:38:42',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,155),
	 (1848,'ГАЛЕРЕЯ','2023-09-15-gazgolder-galereia','2023-09-15','2023-09-16','21:00:00','10:00:00','<p>Первая осенняя «Галерея» в середине сентября вихрем врывается в пространства «Газгольдера»! Непрерывный перформанс, состоящий из выставочной, фотографической и инсталляционной частей традиционно сопровождается ураганным лайнапом, объединяющим все актуальные музыкальные тенденции!<br><br>По картам Highway вход бесплатный</p>',1500,'',2,35,1,'https://budi.timepad.ru/event/2564776/','',false,false,NULL,2,'2023-09-13 00:03:15','2023-10-25 12:58:26',NULL,'','0',18,77);
