	 (1853,'HAKKENIGHT','2023-11-04-factory-3-hakkenight','2023-11-04',NULL,'23:59:00',NULL,'<p>После летних каникул рады анонсировать вам <a href="https://vk.com/hakkenation111">крупное событие</a> от нашего промо <a href="https://vk.com/hakkenation">HakkeNation</a>, которое состоится 4 ноября. <br>В день народного единства мы вместе с вами устроим ночь безумного угара и веселья.<br><br>Вас ожидают мастера своего дела и уникальный состав на 2-х танцполах в клубе <a href="https://vk.com/factory3">Factory</a>.</p>',1000,'',1,7,1,'https://spb.qtickets.events/83984-hakkenight-041123-factory','https://vk.com/hakkenation',false,false,NULL,2,'2023-09-13 16:36:16','2023-10-25 16:11:57',NULL,'','0',18,91),
