	 (1861,':DATA','2023-09-23-rndm-data','2023-09-23',NULL,'22:00:00',NULL,'<p>В субботу 23 сентября :data возвращается в родные стены RNDM, чтобы в лучшем виде отпраздновать открытие клубного сезона. Новейшие дабплейты со всего мира, усиленный звук Funktion-One, мрак, и ты в компании друзей и единомышленников. Все как мы любим!</p>',600,'',2,27,1,'https://moscow.qtickets.events/83722-2309-data-at-rndm','',false,false,NULL,2,'2023-09-13 18:11:36','2023-10-20 20:37:42',NULL,'','0',18,214),
	 (1862,'KONTRKULT','2023-09-15-rndm-kontrkult','2023-09-15',NULL,'23:00:00',NULL,'<p>Северный андеграунд тяжел и гремуч, не зря словосочетание «питерская злая бочка» стало именем нарицательным.<br><br>В пятницу петербургский клуб kontrkult заглянет в первопрестольную с вечеринкой. Начнём с задиристого брейкбита, продолжим непредсказуемым лайвом от Danila Master, закончим экспрессивным, глухим и экспериментальным техно.&nbsp;</p>',500,'',2,27,1,'https://moscow.qtickets.events/83937-kontrkult-x-rndm','',false,false,NULL,2,'2023-09-13 18:19:28','2023-10-24 11:55:23',NULL,'','0',18,48),
	 (1863,'МИР-2','2023-09-29-blank-mir-2','2023-09-29','2023-09-30','23:00:00','08:00:00','<p>29 сентября вечеринка <a href="http://t.me/mir2_mir2">МИР-2</a> в окружении световых инсталляций соберет на двух танцполах клуба <a href="http://t.me/blankclub">BLANK</a> талантливых музыкантов и артистов из различных стран и городов.<br><br>Открытие мероприятия ознаменует танцевальный перфоманс Трансформация, который через пластику тела выразит музыкальные эксперименты.&nbsp; &nbsp;<br><br>На главном танцполе на выступит Tøtal - музыкант из Еревана, основатель и владелец лейбла Death Bell Records уже знакомый Петербуржцам по фестивалю Gamma. Из Москвы приедет Unbalance - резидент м_division и Monasterio, игравший в самых знаковых техно клубах мира - Berghain и Tresor.<br><br>На террасу из Минска мы пригласили Пашу Morgotika - создателя масштабной серии вечеринок Мечта. Живым выступлением отметится мастер музыкального синтеза Neonicle.</p>',800,'',1,1,1,'https://mir2.timepad.ru/event/2584643/','',false,false,NULL,2,'2023-09-13 18:26:13','2023-10-22 19:26:44',NULL,'','0',18,246),
	 (1864,'Somatik Fest','2023-09-23-factory-3-somatik-fest','2023-09-23',NULL,'23:55:00',NULL,'',550,'',1,7,1,'https://rupor.biz/widgets/event-tickets/882','',false,false,NULL,2,'2023-09-13 18:34:39','2023-10-22 05:11:31',NULL,'','0',18,251),
	 (1865,'ГЕНА НУЛЕВЫЕ','2023-09-16-deep-fried-friends-gena-nulevye','2023-09-16',NULL,'23:00:00',NULL,'<p>В эту субботу, совместно с нашим другом и партнером <a href="https://instagram.com/genalokhtin?igshid=NzZhOTFlYzFmZQ==">Геной Лохтиным</a> мы погрузим ресторан Deep Fried Friends в золотую эпоху нулевых, в мир блёсток, страз и абсолютного гламура. <br><br>Впервые и специально для вас выступит один из главных столпов нулевых, первый рэпер и родоначальник хип-хопа в стране, продюсер, телеведущий и король эпатажа – <a href="https://instagram.com/bogdantitomir_official?igshid=NzZhOTFlYzFmZQ==">Богдан Титомир</a> , а дополнят незабываемую ночь – наша супер-подруга и звезда YouTube <a href="https://instagram.com/kdukalis?igshid=NzZhOTFlYzFmZQ==">Ксюша Дукалис,</a> отец RNDM CREW, легендарный менеджер OG BUDA, MAYOT и др – <a href="https://instagram.com/rozhok3d?igshid=NzZhOTFlYzFmZQ==">Алексей Рожков,</a> король оллнайтеров <a href="https://instagram.com/markschedrin?igshid=NzZhOTFlYzFmZQ==">Марк Щедрин</a> и участник команды DFF, продюсер и диджей <a href="https://instagram.com/spaida?igshid=NzZhOTFlYzFmZQ==">Спайда</a>&nbsp;<br><br>ВХОД ПЛАТНЫЙ&nbsp;<br>23:00 до 00:00 1000₽<br>00:00 до 03:00 1500₽<br>03:00 до конца FREE</p>',1000,'1500.0',2,76,1,'','',false,false,NULL,2,'2023-09-14 01:19:27','2023-10-24 23:38:03',NULL,'','0',18,66),
	 (1866,'Soma Season Closing Party','2023-09-15-soma-soma-season-closing-party','2023-09-15',NULL,'20:00:00',NULL,'<p>В эту пятницу прощаемся с уходящим теплом и устраиваем большую вечеринку во дворе.</p>',NULL,'0.0',2,218,1,'','',false,false,NULL,2,'2023-09-14 01:23:44','2023-10-23 02:18:17',NULL,'','0',18,65),
