	 (1869,'Ecstaz','2023-09-16-bar-strelka-ecstaz','2023-09-16',NULL,'23:00:00',NULL,'<p>В субботу — новый выпуск из серии вечеринок «Экстаз» с невероятно красивым лайнапом. Танцуем до рассвета под сеты основателя «Экстаза» Ильи Булгакова, ордынской принцессы Djama и алтайской принцессы Наташи Бай.</p>',NULL,'0.0',2,103,1,'','https://t.me/strelkabarmoscow',false,false,NULL,2,'2023-09-14 01:36:28','2023-10-24 20:55:36',NULL,'','0',18,57),
	 (1870,'TRIP 2023 OFFICIAL AFTERPARTY ','2023-10-06-blanc-trip-2023-official-afterparty','2023-10-06',NULL,'20:00:00',NULL,'<p>Скучали по TRIP и ярким фестивальным эмоциям? Мы — очень! Поэтому решили устроить официальное after party TRIP 2023.&nbsp;<br><br>6 октября собираемся в московском Бланке, чтобы вспомнить лучшие моменты фестиваля и поделиться энергией лета со старыми и новыми друзьями.&nbsp;<br><br>Присоединяйтесь! Have a nice trip!&nbsp;</p>',1000,'',2,36,1,'https://secret420.timepad.ru/event/2584790/','https://tripfestival.ru/',false,false,NULL,2,'2023-09-14 01:41:45','2023-10-23 15:17:07',NULL,'','0',18,154),
	 (1873,'Регги-фестиваль Rastashop','2023-10-07-aglomerat-reggi-festival-rastashop','2023-10-07','2023-10-08','19:00:00','05:00:00','<p>Ура, большой регги-фест! СуперПупер продакшн и Rastashop.ru представляют: крупнейший отечественный регги-фестиваль «Rastashop». 7 октября. Клуб «Aglomerat». Три танцпола - живая сцена и две саундсистемы с вечера и до утра.</p>',1600,'',2,56,3,'https://superpuper.timepad.ru/event/2546489/','',false,false,NULL,2,'2023-09-14 01:59:12','2023-10-23 05:48:45',NULL,'','0',18,178),
	 (1874,'ESCAPE II','2023-11-04-mutabor-escape-ii','2023-11-04',NULL,'23:00:00',NULL,'<p>Звук хулиганской электроники во-второй раз всецело заполнят Место Превращений своими геттами и джуками. Фестиваль Escape II пройдёт 4-го ноября в арт — пространстве Mutabor.&nbsp; Организаторы позаботились о мрачной доли техно в лайн-апе.</p>',1800,'',2,2,3,'https://moscow.qtickets.events/80321-escape-2','',false,false,NULL,2,'2023-09-14 02:04:44','2023-10-25 16:04:17',NULL,'','0',18,205),
	 (1875,'Jungle','2023-09-15-treff8-club-jungle','2023-09-15',NULL,'22:00:00',NULL,'<p>Тропический коктейль эмоций, дикая энергия джунглей и лишь эйфорическая ритмика на протяжении всей ночи. 15 сентября «TREFF8» запускает серию ивентов "JUNGLE" и это стоит прочувствовать в живую.<br>Мы подготовили для Вас по истине впечатляющую атмосферу, в сочетании со звездами техно сцены.</p>',1000,'',2,84,1,'','',false,false,NULL,2,'2023-09-14 02:15:53','2023-10-25 10:45:29',NULL,'','0',18,28),
	 (1876,'The Mask','2023-09-23-community-moscow-the-mask','2023-09-23','2023-09-24','21:00:00','06:00:00','<p>Понедельник день тяжелый, но мы к вам с афигенной новостью!<br><br>Вы просили и он вернется!<br>Вечеринка сентября по мотивам культового фильма «Маска»!<br><br>Приготовьтесь окунуться в атмосферу безумия и веселья!<br><br>Профессиональные актеры, иммерсивное шоу, VIP-зоны для тех, кто любит уединение, и тесный танцпол для тех, кто любит близость, но для каждого будет очень жаркая танцевальная музыка.<br><br>Все это вы почувствуете в сентябре в самой танцевальной библиотеке Москвы — COMMUNITY.<br><br></p>',2000,'',2,58,1,'https://moscow.qtickets.events/83919-the-mask','',false,false,NULL,2,'2023-09-14 02:20:52','2023-10-16 14:36:39',NULL,'','0',18,97),
	 (1877,'АвтоSTOPoм по Галактике','2023-09-14-garaz-avtostopom-po-galaktike','2023-09-14','2023-09-15','20:00:00','03:00:00','<p>14 сентября (четверг) приглашаем тебя заглянуть к нам на вечеринку, чтобы хорошо разогреться перед выходными в баре Гараж !&nbsp;<br><br>Этой ночью мы отправимся "Автостопом по галактике": погрузимся в гипнотические мотивы и яркие миры Progressive, Indie Dance и Melodic House.<br><br>Обещаем только положительные эмоции.&nbsp;<br><br>Добро пожаловать на борт ;)<br><br>Вас ждет незабываемое погружение в мир танцевальной музыки и ярких эмоций!</p>',NULL,'0.0',2,156,1,'','',false,false,NULL,2,'2023-09-14 02:25:34','2023-10-12 07:29:41',NULL,'','0',18,37),
	 (1878,'Figura Applique','2023-09-30-gazgolder-figura-applique','2023-09-30','2023-10-01','23:00:00','12:00:00','<p>Фигура — это силуэт, форма, персонаж, множество точек на плоскости, скульптура, живописное или графическое произведение, игровой элемент, позиция, часть танца, объект на фоне, словесный оборот, повторяющаяся музыкальная фраза<br><br>Applique - это техника декоративного искусства, заключающаяся в вырезании фигур по контуру и в прикреплении этих фигур к основе.&nbsp;<br>30-ое сентября - это дата вечеринки с новой основой Applique и его фигурой в центре пространства Gazgolder club</p>',1000,'',2,35,1,'','',false,false,NULL,2,'2023-09-14 02:46:20','2023-10-25 17:23:18',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,307),
	 (1879,'Popoff Kitchen Spb Camp','2023-09-23-blank-popoff-kitchen-spb-camp','2023-09-23',NULL,'23:00:00',NULL,'<p>Выездной лагерь Popoff Kitchen расставляет капканы в Петербурге. Все, кем пугают наивных и неопытных с заходом солнца, выйдут на охоту 🕷 Сцена MAIN - наша главная ловушка. Здесь как мотыльков у света ждут ночные хищники-резиденты. Гипнотический бит от Amal и Tura и вводящий в транс сет Zaira Gabibova</p>',1000,'',1,1,1,'https://popoffspb.ticketscloud.org/','https://t.me/popoffkitchen',false,false,NULL,2,'2023-09-14 03:02:34','2023-10-24 21:16:20',NULL,'','0',18,272);
