	 (1880,'TEATRO II Festival','2023-10-21-port-sevkabel-teatro-festival','2023-10-21',NULL,'21:00:00',NULL,'<p>21 октября вы снова станете героями главного спектакля электронной сцены! Иммерсивный фестиваль музыки TEATRO Edition возвращается, чтобы погрузить вас в самое обещающее действо года.<br><br>Танцпол Teatro будет сценой, где ты сыграешь свою главную роль, а все гости будут актерами, в игру будет вовлечен каждый.<br><br>Непрекращающейся увертюрой этого действа будет электронный вайб, который заставит прожить все эмоции под биты лучших диджеев.<br><br>Театральные декорации и особый сетап сцены подчеркнут завораживающую атмосферу TEATRO II.<br><br>Выбор за тобой: хочешь ли стать главным героем или играть мистическую второстепенную роль? Двери TEATRO открыты для тебя!<br><br>Хедлайнеры TEATRO<br>To be announced…<br><br>Когда: 21 октября<br><br></p>',1400,'',1,177,3,'https://teatrofest.ticketscloud.org/','',false,false,NULL,2,'2023-09-14 03:10:53','2023-10-25 02:36:56',NULL,'','0',18,318),
	 (1931,'ШУВА Х РАДУГА: ДЖЕДАЙ НАЙТ','2023-09-22-blanc-suva-x-raduga-dzedai-nait','2023-09-22',NULL,'23:00:00',NULL,'<p>Вечеринка <a href="https://vk.com/hyperboloid">Hyperboloid</a> в клубе <a href="https://vk.com/rndm.club">Rndm</a> cостоится 22 сентября<br><br></p>',0,'1500.0',2,36,1,'https://radugadiscoclub.ru/e220923','https://t.me/radugasuperclub',false,false,NULL,2,'2023-09-21 03:06:34','2023-10-24 21:52:59',NULL,'','0',18,88),
	 (1981,'Пятница','2023-09-29-bar-strelka-piatnica','2023-09-29',NULL,'23:00:00',NULL,'<p>Вечеринка телеграм-канала «Чтобы вы танцевали». За пультом: автор канала и резидентка бара «Ровесник» Эля Сафронова и талантливый диджей Дима Yucatan со специальным виниловым сетом.</p>',NULL,'0.0',2,103,1,'','https://t.me/strelkabarmoscow',false,false,NULL,2,'2023-09-28 02:21:20','2023-10-11 17:33:42',NULL,'','0',18,49),
	 (1881,'Odyssey Vostok','2023-09-23-buddha-bar-odyssey-vostok','2023-09-23',NULL,NULL,NULL,'<p>Вы просили, вы звали, вы хотели…. И он пришёл! Восток - это не только шёлк, тайны и благовония. Но и волшебная история, рассказанная великим Мастером! И 23 сентября ворота в сказку распахнутся и она станет былью! Кто-то увидит настоящий шагающих замок посреди города, кому-то откроется тайна морских глубин Японского моря, удачливым посчастливится прокатиться на котобусе, а некоторым даже обнять самого хранителя леса Тоторо.<br><br>На одну ночь таинственный Buddha Bar превратиться в храм любви имени Хаяо Миядзаки, уже многие десятилетия зажигающего миллионы сердец по всему миру надеждой и счастьем!<br><br>Дресс-код: Азия, якудза и кимоно, хентай, манга и аниме.</p>',2400,'',1,38,1,'','',false,false,NULL,2,'2023-09-14 03:14:45','2023-10-25 16:57:10',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,162),
	 (1882,'Solids Night Out','2023-09-16-solids-solids-night-out','2023-09-16','2023-09-17','22:00:00','03:00:00','<p>Прежде чем начать грустить по ушедшему лету, мы обязательно увидимся и потанцуем в эту субботу.&nbsp;<br><br>Ребята, нашумевшие инициативой Campus, у нас в гостях и с претензией на долгосрочное сотрудничество. Очень надеемся!<br><br>Что по музыке? Ровно то, что надо для легкомысленного вечера: беззаботное настроение, итало и французские оттенки в треках, а в лайнапе наши новые и старые друзья. Собственно, концепция тут одна — танцы!</p>',NULL,'0.0',1,220,1,'','',false,false,NULL,2,'2023-09-14 17:06:17','2023-10-17 01:09:45',NULL,'','0',18,66),
	 (1883,'Закрываем Двор','2023-09-16-cava-dvor-zakryvaem-dvor','2023-09-16',NULL,'15:00:00',NULL,'<p>Закрываем двор 16 сентября! Всем быть, прогулы не принимаются.<br><br>Есть такое слово — basta!&nbsp; Всё чуткое, чудное, прекрасное — обязано быть мимолётным, легонько горчить в послевкусии. Заканчиваться, проще говоря.<br><br>В этом есть неотвратимость, но в этом есть и мечта — всё вернётся, всё будет классно.<br><br>Pop-up cafe ÇAVA — не прощается в вами, ведь вы нам этого не простите. Однако, очень скоро мы возьмём паузу. Запланированный отпуск, саббатикал, долгий выходной.<br><br>Решение это — не получится отменить. Как и всё то, что мы сделали вместе с вами за предыдущие несколько месяцев.<br><br>С осознанием этого, со спокойной душой и согревающей гордостью — ждём вас всю неделю обниматься и делиться летними приключениями!&nbsp;</p>',NULL,'0.0',1,237,1,'','',false,false,NULL,2,'2023-09-14 17:09:38','2023-10-24 21:24:27',NULL,'','0',18,54),
	 (1884,'Overlap - Part 1 Pilot','2023-09-16-psai-overlap-part-1-pilot','2023-09-16',NULL,'21:00:00',NULL,'<p>22:00 Wickedsport&nbsp;<br>23:00 Zri.Svet&nbsp;<br>00:00 Dj 38<br>01:00 Ahirzaman&nbsp;<br>02:00 Huffy Fibryyx&nbsp;<br>03:00 Shiza<br>04:00 Schnelya&nbsp;<br>05:00 стилстилстилстилстил&nbsp;<br><br>Вход - 800 early<br>После 10го гостя 1000<br>Чай, вода - free</p>',800,'1000.0',1,266,1,'https://t.me/lil_officer','',false,false,NULL,2,'2023-09-14 17:18:08','2023-10-23 02:24:11',NULL,'','0',18,142),
	 (1885,'AVE RAVE: : countryside','2023-09-15-finskii-zaliv-ave-rave-countryside','2023-09-15','2023-09-17',NULL,NULL,'<p><br>Собираем донаты на прелести и трудности лесного движа, даже самая незначительная сумма значительно нам поможет<br><br>координаты пока не дадим, но локация выбрана, добраться можно будет быстро и легко- около 1,5 часа на автобусе</p>',100,'',1,267,1,'https://www.tinkoff.ru/cf/1elfj360Ek6','',false,false,NULL,2,'2023-09-14 17:24:17','2023-10-17 02:07:21',NULL,'','0',18,105),
	 (1886,'SOLUTION','2023-09-15-ritmy-solution','2023-09-15',NULL,'21:00:00',NULL,'<p>Ну вот и середина сентября. Ощущения осени пока нет и это радует.&nbsp;<br><br>Тут ветераны аналогового, стопудового жирного хауса собрались в промогруппу SOLUTION. И эта промогруппа собралась в эту пятницу пошуметь в Ритмах.&nbsp;<br><br>Туса пройдет в лобби и на остатках террасы. Клуб будет на просушке.<br><br></p>',NULL,'0.0',1,181,1,'','https://t.me/vritme_bar/1120',false,false,NULL,2,'2023-09-14 17:33:02','2023-10-10 21:23:54',NULL,'','0',18,76),
	 (1887,'LEGAL''NAYA','2023-09-23-lendok-legalnaya','2023-09-23',NULL,'22:00:00',NULL,'<p>23 сентября LEGAL’NAYA закатывает последнюю большую вечеринку в этом году&nbsp;<br><br>Звездный состав в отвязном фэнтези боевике о любви к музыке и танцам на трех сценах киностудии Лендок&nbsp;<br><br>Финальный эпизод пройдет с привычным фестивальным размахом.&nbsp;<br><br>Мэйном станет большой концертный зал, на котором развернется световая&nbsp; инсталляция площадью более 350м3</p>',1200,'',1,182,1,'https://legalnaya-lendoc.ticketscloud.org/','https://t.me/legalnaya3',false,false,NULL,2,'2023-09-14 17:43:24','2023-10-25 12:50:20',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,146);
