	 (1901,'Minimal Pushers','2023-09-16-mixed-minimal-pushers','2023-09-16','2023-09-17','22:00:00','04:00:00','<p>Minimal Pushers — авторская вечеринка Егора, на которой он приглашает к себе в компанию интересных и близких по духу диджеев.<br><br>кроме танцев на этой вечеринке один час сета (02-03) будет посвящен пластинкам «на продажу», которые вы сможете приобрести сразу же, как их отыграют.&nbsp;<br><br>в эту субботу приглашенный гость — Buwalda, основатель бара «Paranoia», саундпродюсер, хаусмейкер, сооснователь лейбла «TRIPPYTRAXX». Эд создает музыку с толстыми uk garage битами вперемешку с цепляющими мелодиями с абстрактным грувом.<br><br>заглядывайте — будет интересно!<br><br>Minimal Pushers w//<br><br>Buwalda<br>Kekoriy</p>',300,'500.0',1,59,1,'','',false,false,NULL,3,'2023-09-16 14:39:15','2023-10-24 21:08:55',NULL,'','0',18,78),
	 (1888,'uppercutboatparty','2023-09-16-teploxod-moskva-178-otstavit-grust','2023-09-16',NULL,'23:30:00',NULL,'<p>Вот и прошел фестиваль Solar Systo, дорогие друзья! От всей команды LenSoundDesign выражаем вам огромную благодарность за ваш вклад в вайб сцены ТЕХНОЛЕСЬЕ&nbsp;<br>Фестивальный сезон позади, но мы тут подумали, почему бы не собраться еще раз всем вместе? Вы любите танцевать под музыку, а мы любим, когда вы танцуете<br>Поэтому специально для вас наша команда подготовила вечеринку After Party на двухпалубном корабле «Москва 178» с видом на ночной город и разводные мосты. По традиции смешиваем разные стили музыки на двух танцполах. В программе: живые инструментальные рок выступления, хаус и конечно техно!<br>На корабле будет коктейльный бар и ваши любимые сорта чая от Чайного состояния</p>',2000,'',1,268,1,'https://t.me/Alex_Kniga','',false,false,NULL,2,'2023-09-14 17:49:24','2023-10-23 00:19:40',NULL,'','0',18,94),
	 (1889,'MILDIX/SALYX/LOVVSKY','2023-10-08-factory-3-mildixsalyxlovvsky','2023-10-08','2023-10-08','17:00:00','22:00:00','<p>Набирающий обороты реп исполнитель MILDIX известный многим по трекам “POMADA”, “Сон”, “Звёздочка” выступит 8 Октября в Санкт-Петербурге в известном клубе FACTORY 3</p>',300,'',1,7,1,'','',false,false,NULL,2,'2023-09-14 18:01:57','2023-10-17 05:51:08',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,73),
	 (1890,'РЕТРОСПЕКТИВА','2023-09-15-restobar-matiss-retrospektiva','2023-09-15','2023-09-15','20:00:00','23:30:00','<p>Вечер будет посвящён отечественной электронной сцене 90-х и 00-х. Всех гостей ждёт интересная экспозиция составленная из архивных флаеров музыкальной и клубной жизни Петербурга и других городов от, а так же дружелюбная атмосфера заведения Matisse и диджей сеты с виниловых пластинок.</p>',NULL,'0.0',1,159,1,'','',false,false,NULL,2,'2023-09-14 19:12:29','2023-10-18 07:28:51',NULL,'','0',18,71),
	 (1891,'OneBus','2023-09-15-union-onebus','2023-09-15','2023-09-16','23:00:00','06:00:00','<p>Перемещаемся в олдскульную UK-атмосферу в эту пятницу.&nbsp;<br><br>Первый осенний эпизод OneBus (https://instagram.com/0nebuss), где будем вместе с вами стирать пятки под мощный бас нулевых годов. Телепорт в прошлое, к основам, когда мир был захвачен басслайном, брейкбитом и режущими ухо синтами. Всё — от декораций до ваших аутфитов — будет пропитано рейверским духом того времени.<br><br>Ребята проводят конкурс у себя на странице, залетайте туда прямо сейчас.</p>',NULL,'500.0',1,8,1,'','',false,false,NULL,3,'2023-09-15 20:17:36','2023-10-11 12:59:41',NULL,'','0',18,93),
	 (1892,'пятница в Mixed','2023-09-15-mixed-piatnica-v-mixed','2023-09-15','2023-09-16','22:00:00','04:00:00','<p>уже почти 30 лет.&nbsp;<br>с 1995 года парни на стиле и в андерграунде высокого уровня. поколения клабберов и любителей танцевальной музыки выросли на их радиошоу и клубных выступлениях.<br><br>счастливые диск-жуки&nbsp;<br><br></p>',NULL,'0.0',1,59,1,'','',false,false,NULL,3,'2023-09-15 20:20:06','2023-10-17 11:20:28',NULL,'','0',18,77),
	 (1893,'LU❌❌❌URY BIRTHDAY MA💲HCORE DI💲COTHEQUE','2023-09-15-zoccolo-20-luury-birthday-mahcore','2023-09-15','2023-09-16','23:59:00','06:00:00','<p>Приветики, сучочка! Я знаю, ты целый год скучала по мне, жаловалась чьей-то мамке, что брейккор уже не торт, а твой дядя не прикасался к тебе и даже не включал тебе drill''n''bass все это время.<br><br>Но я вернулась, чтобы утереть твои солевые слезки, твоя крышесносная и горячая, долгожданная и ебанутая</p>',NULL,'',1,72,1,'','',false,false,NULL,3,'2023-09-15 20:25:19','2023-10-11 18:27:22',NULL,'','0',18,63),
	 (1894,'Pop Up Night','2023-09-15-suba-bar-pop-up-night','2023-09-15','2023-09-16','21:00:00','04:00:00','<p>Сегодня в пятницу 15-го<br>в Шубе прозвучат старые знакомые хиты прошлых лет в грамотной подборке от SashQ, и примерно в стиле ассортимент треков с добавлением хаусного масла от Digon</p><p><br></p>',NULL,'0.0',1,205,1,'','',false,false,NULL,3,'2023-09-15 20:27:56','2023-10-11 04:16:05',NULL,'','0',18,34),
	 (1895,'Buwalda','2023-09-15-technodoner-buwalda','2023-09-15','2023-09-15','20:00:00','22:00:00','<p><br>артист из казани, основатель бара «paranoia», саундпродюсер, хаусмейкер, сооснователь лейбла «trippytraxx». уже почти 10 лет он генерирует музыкальные движения в казани. его работы house, garage, tech можно услышать на лейблах как в россии, так и за рубежом. эд крафтит саунд с толстыми uk garage битами вперемешку с цепляющими мелодиями с абстрактным грувом.</p>',NULL,'0.0',1,194,1,'','',false,false,NULL,3,'2023-09-15 20:29:57','2023-10-24 09:26:51',NULL,'','0',18,53);
