	 (1899,' «VINYL TAPROOM» ','2023-09-15-hops-mustache-vinyl-taproom','2023-09-15','2023-09-16','21:00:00','05:00:00','<p><br>В УСАХ НА ПЕНЕ «VINYL TAPROOM»&nbsp;<br>DnB, Jungle, Dub Step и море крафтового!<br><br>Ответственные за ломаные ритмы&nbsp; &nbsp;<br>DECODE (#PRTYHARD CREW)&nbsp;<br>MC’MAN (#PRTYHARD CREW)&nbsp;<br>ALEX Y<br>PR-ICE<br>And friends…</p>',NULL,'0.0',1,144,1,'','',false,false,NULL,3,'2023-09-15 20:39:43','2023-10-22 08:30:54',NULL,'','0',18,56),
	 (1902,'Plan B','2023-09-16-miraz-plan-b','2023-09-16','2023-09-17','23:59:00','06:00:00','<p>всем, кто скучал и просил электронику - запрягаем лошадей и скачем на plan b&nbsp;<br>в прошлый раз вы чуть не побили рекорды по бару и количеству людей, есть шанс дожать<br><br>за пультом соберутся следующие ковбои: heliyah,&nbsp; tikhon boyko, pie и rwanda<br><br>снимает всех duyaraa<br><br></p>',NULL,'700.0',1,77,1,'','',false,false,NULL,3,'2023-09-16 14:43:52','2023-10-19 21:00:46',NULL,'','0',18,65),
	 (1903,'суббота в Шубе','2023-09-16-suba-bar-subbota-v-sube','2023-09-16','2023-09-17','21:00:00','04:00:00','<p>&nbsp;16-го бар наполнится звуками фанка диско соула и немного регги от Multiselectah и RLLKRC и диско-хаусом от Mert Bindebir&nbsp;</p>',NULL,'0.0',1,205,1,'','',false,false,NULL,3,'2023-09-16 14:46:08','2023-10-17 08:45:00',NULL,'','0',18,46),
	 (1904,'суббота в technodöner','2023-09-16-technodoner-subbota-v-technodoner','2023-09-16','2023-09-17','20:00:00','02:00:00','<p>любовь к synthpop и post-punk 80-х, сформировавшей вкус кирилла, вытекла в dj сеты и резидентство на вечеринки itallika. после 3х лет внутренний дебошир вылез наружу, выбил дверь и увёл в сторону мультижанровости, где в мелодику помещаются дисгармония и металлический транс. сейчас кирилл работает над kivach padio - популяризирует сторителлинг и даёт возможность артистам срывать ярлыки, раскрывая слушателям все грани их музыкального вкуса.</p>',NULL,'0.0',1,194,1,'','',false,false,NULL,3,'2023-09-16 14:49:03','2023-10-17 17:25:13',NULL,'','0',18,68),
	 (1905,'суббота в Гранях','2023-09-16-grani-subbota-v-graniax','2023-09-16','2023-09-17','22:00:00','04:00:00','',NULL,'0.0',1,197,1,'','',false,false,NULL,3,'2023-09-16 14:50:39','2023-10-17 12:07:54',NULL,'','0',18,52),
	 (1906,'ЭЛЕКТРИ СИТИ HBD ДЕТКА!','2023-09-16-hops-mustache-elektri-siti-hbd-detka','2023-09-16','2023-09-17','20:00:00','06:00:00','<p>16.09.23&nbsp;<br>В УСАХ НА ПЕНЕ “ЭЛЕКТРИ СИТИ HBD ДЕТКА!”&nbsp;<br>Смешение стилей и вкусов! Полный отрыв и агония!<br><br>За пультом диджейс:&nbsp;<br>• KIRILL IVA<br>• WAYLE<br>• VASYA L<br>• HERMI THUG<br>• SPORTSMAN<br>+ Special guest&nbsp;<br><br></p>',NULL,'0.0',1,144,1,'','',false,false,NULL,3,'2023-09-16 14:57:36','2023-10-17 01:37:36',NULL,'','0',18,51),
	 (1907,'суббота в Solaris Lab','2023-09-16-solaris-lab-subbota-v-solaris-lab','2023-09-16','2023-09-17','22:00:00','04:00:00','<p>Субботним вечером нашу космическую станцию посетит Galagramma, самобытная и яркая девушка из Москвы, основательница арт-команды и промо-группы Provodnik, а также участница многочисленных фестивалей и музыкальных проектов.&nbsp;<br><br>Galagramma движется в своём ритме, осваивает саунд-дизайн и создаёт собственные произведения в жанре tech house, ambient, DnB: ценители интеллектуального звучания не останутся равнодушными! Поддержат гостью резиденты Solaris Lab — German и Vizhu.</p>',NULL,'0.0',1,106,1,'','',false,false,NULL,3,'2023-09-16 15:03:50','2023-10-24 21:03:52',NULL,'','0',18,79),
	 (1908,'суббота в Твари Божьей','2023-09-16-tvar-bozia-subbota-v-tvari-bozei','2023-09-16','2023-09-17','22:00:00','04:00:00','<p>В эту субботу&nbsp;<br>команда проекта Nemo Flashback и их гости проведут всех в жизнерадостный Acid с агрессивной пульсацией плотного баса.&nbsp;<br><br>Lune up:<br>Nemo_Flashback<br>Fuckir<br>Dima Interstate<br>ACIDIST live<br><br>ACID TECHNO ALL NIGHT LONG</p>',NULL,'0.0',1,262,1,'','',false,false,NULL,3,'2023-09-16 15:05:52','2023-10-23 01:37:35',NULL,'','0',18,75);
