	 (1909,'Абстрасенция 2023 в Оранжерее. Бархатный сезон','2023-09-16-oranzereia-tavriceskogo-sada-abstrasenci','2023-09-16',NULL,'16:00:00','22:00:00','',1100,'',1,48,2,'','https://abstrasension.ru/velvetseason',false,false,NULL,3,'2023-09-16 15:08:25','2023-10-19 22:21:09',NULL,'','0',18,89),
	 (1910,'суббота в Стирке 40','2023-09-16-stirka40-subbota-v-stirke-40','2023-09-16','2023-09-17','20:30:00','02:00:00','<p>Приглашаем всех, кто бодр, присоединиться к нам в субботу в Стирке на тематическом д.ж. сете, примечательным тем, что ни, собственно, Чака Берри ни Кобейна в нем не прозвучит.&nbsp;</p>',NULL,'0.0',1,14,1,'','',false,false,NULL,3,'2023-09-16 15:10:23','2023-10-17 06:53:17',NULL,'','0',18,48),
	 (1911,'суббота в Мишке','2023-09-16-miska-bar-subbota-v-miske','2023-09-16','2023-09-17','21:00:00','04:00:00','<p>Сегодня, 16 сентября, в Mishke весь вечер и всю ночь играет dj Krug.&nbsp;<br><br>Редкая музыка для танцев, болтовни и размеренного времяпрепровождения.&nbsp;<br><br>Хаус, диско, песни.&nbsp;</p>',NULL,'0.0',1,12,1,'','',false,false,NULL,3,'2023-09-16 15:12:07','2023-10-16 20:04:54',NULL,'','0',18,54),
	 (1912,'Shtab Showcase','2023-09-16-roof-place-shtab-showcase','2023-09-16','2023-09-17','23:00:00','07:00:00','<p>Планировавшийся поп ап проект от организаторов Штаба в бывших Углях накрылся медным тазом, так как помещение в последний момент отдали под производство. Но ребята не сдаются и проведут ряд шоукейсов Shtab 2.0 (https://t.me/theshtab) в соседнем Roof Place.<br><br>В серии 4 мощных мероприятия, первым из которых станет Shtab Showcase — с техно и электро на мейне и смешанными вайбами от хауса до драм-н-бейса на танцполе Room 360°&nbsp;<br><br>Main: Igor Starshinov / Shutta / Nastya Zimens / Techno Punks / Rave-Instructor<br><br>Room 360°: Bagus / Ika / Oira / Pliskin / Sparks &amp; Mistwist / Akudji / Glickman / Dj Rakk<br><br>Sound: Shtab Soundsystem 15kwt / Turbosound &amp; funktion one&nbsp;</p>',NULL,'700.0',1,176,1,'','',false,false,NULL,3,'2023-09-16 15:14:08','2023-10-17 02:50:23',NULL,'','0',18,118),
	 (1913,'Nuclear Session','2023-09-22-griboedov-nuclear-session','2023-09-22','2023-09-23','00:00:00','06:00:00','<p>Друзья, всем привет!&nbsp;<br>Холода уже стучат в дверь, а мы ждём жаркую встречу с вами 22.09.2023 на Nuclear Session<br><br>Теплее одевайтесь, пейте горячие напитки и не болейте! Ну а тем кто всё же заболел, желаем скорейшего выздоровления! Так как времени до нашей встречи осталось очень мало, надо успеть вылечиться, чтобы вместе с нами написать новую главу DnB истории и знатно оторваться!<br><br>Стоимость входного билета с репостом в ВК составляет 300 рублей. <br>Репост&nbsp; необходимо сделать до 23:59 четверга!</p>',300,'500.0',1,86,1,'','',false,false,NULL,2,'2023-09-20 16:49:17','2023-10-24 21:12:45',NULL,'','0',18,109),
	 (1914,'Funky Tunes - 5 years','2023-09-29-16-tonn-presnenskii-val-funky-tunes','2023-09-29',NULL,'19:00:00',NULL,'<p>Мы приглашаем вас отпраздновать наш первый юбилей, потанцевать, пообщаться и послушать качественную музыку от наших гостей и резидентов и зарядиться тёплым позитивным вайбом.</p><p>5 лет мы стараемся подарить вам праздник и FUNKY TUNES — это не просто серия вечеринок, а настоящая семья близких по духу людей.</p><p>И в этот раз мы приготовили для вас очень приятный сюрприз!!!!&nbsp;</p><p><strong>&nbsp;Вход: Pre-party Floor — свободный, Anniversary Floor — 400-700р</strong></p><p>Pre-party Floor: 19:00 — 23:30 на Красной веранде<br>B-FORM, ESSENT, PIMPER FUNK, VETER B-DAY SET, VIRTUS, VALERIE&nbsp;<br><br>Anniversary Floor: 23:30 — 05:30&nbsp;<br>FUNK FIRE DJ''S (DR. MEL and BLESS), VITYA (live), JAFAR, ELECTROGORILLA, SHINDER, KOMYSHEV, LOONEEZ&nbsp;</p>',400,'700.0',2,29,1,'https://www.16tons.ru/concert/2023-funky-tunes-29sep/','',false,false,NULL,2,'2023-09-20 17:03:58','2023-10-24 04:14:22',NULL,'','0',18,79),
	 (1915,'Министерство Ломаного Бита','2023-09-30-16-tonn-presnenskii-val-ministerstvo','2023-09-30','2023-10-01','22:00:00','05:00:00','<p>Команда «Министерство ломаного бита» приглашает на одноименную вечеринку drum&amp; bass и jungle музыки.</p><p>Собираемся в стенах красной веранды легендарного Московского клуба «16 Тонн».</p><p>Уютная атмосфера красной веранды, напитки, еда, прекрасная команда артистов и, конечно же, любимая музыка — то, что ждет тебя на нашем ламповом мероприятии.</p><p>У нас можно услышать не только нашумевшие бэнгеры от мейнстрима до олдскула, но и самый тяжелый darkside звук, ну и, конечно же, треки наших артистов. В наших рядах не только громкие имена отечественной бэйс-сцены, но и незнакомцы, которые, как мы считаем, не уступают мастодонтам во вкусах, техниках сведения, перфомансах и других качествах.</p><p>В этот раз мы делаем уклон на jungle музыку и поэтому пригласили по настоящему крутых джанглистов! Приходите наслаждаться аменбрейк звучанием и не только.</p>',NULL,'300.0',2,29,1,'','',false,false,NULL,2,'2023-09-20 17:59:33','2023-10-19 13:54:54',NULL,'','0',18,83),
	 (1916,'Phagamast','2023-09-30-cinist-phagamast','2023-09-30',NULL,'23:00:00',NULL,'<p>Мы не ограничиваемся каким-то одним стилем музыки, поэтому на наших вечеринках вы сможете услышать разное звучание, включающим в себя микс из широко известных исполнителей и только начинающих свой путь молодых талантов. Мы уверены, что объединение ведет к органичному развитию и раскрытию скрытых талантов, и хотим создать максимально комфортную для этого среду. Phagamаst стремится сделать каждый звук настоящим мостом между народами, объединяя их в одну крепкую семью. Мы верим, что звуки и ритмы могут стать языком, понятным всем.&nbsp;</p>',1100,'',1,94,1,'https://tesla-boy.ticketscloud.org','',false,false,NULL,2,'2023-09-20 18:05:16','2023-10-25 16:49:32',NULL,'','0',18,129),
	 (1917,'TIMEOFNIGHT','2023-09-23-roof-place-timeofnight','2023-09-23','2023-09-24','23:00:00','07:00:00','<p>23 сентября объявляем сбор с на крыше Roofplace c шоукейсом ломаных ритмов <a href="https://vk.com/timeofnightz">Timeofnight DNB</a>, а также шумно отмечаем День Рождения <a href="https://vk.com/lowriderzmusic">Романа Lowriderz</a>&nbsp;<br><br>Событие пройдет на двух танцполах крыши Roofplace (Васильевский остров, Кожевенная линия 30, Roofplace). На главном расположится основная DNB сцена, на втором танцполе 360° — музыка от techno до D&amp;B и jungle!</p>',NULL,'1000.0',1,176,1,'https://timeofnight.timepad.ru/event/2584640/','https://vk.com/timeofnightz',false,false,NULL,2,'2023-09-20 18:10:59','2023-10-25 05:18:28',NULL,'','0',18,168),
	 (1918,'ALL IN CORE','2023-09-30-roof-place-all-in-core','2023-09-30','2023-10-01','23:00:00','10:00:00','<p>TechnoCore с гордостью представляет:<br>В крышесносное место, куда еще не ступала #HARDCORE и #BREAKCORE нога, мы влетаем сразу с двух, на два танцпола!<br><br></p>',700,'',1,176,1,'https://technocore.timepad.ru/event/2585807/','',false,false,NULL,2,'2023-09-20 18:22:40','2023-10-23 02:20:35',NULL,'','0',18,167);
