	 (1919,'Dark Jazz','2023-10-14-mutabor-dark-jazz','2023-10-14','2023-10-14','19:00:00','22:30:00','<p>Группы Бром, Dizzy Dutch Duck и регуляры лайв-сессий Dark Jazz — экспериментаторы-авангардисты Low Kick Collective — в четвертой "темной" джаз-программе Mutabor.<br><br>Коллективы представляют разные саб-жанры: от собственно dark jazz (Low Kick Collective) до no-jazz и nu jazz — Бром и Dizzy Dutch Duck соответственно.</p>',1200,'',2,2,2,'https://mutabor.club/darkjazz4/','',false,false,NULL,2,'2023-09-20 18:46:29','2023-10-23 21:58:33',NULL,'','0',18,157),
	 (1933,'SK8TECHNO 5 YEARS','2023-09-23-samoobman-sk8techno-5-years','2023-09-23',NULL,'18:00:00',NULL,'<p>Sk8techno устраивает большой тимбилдинг в честь своего юбилея!<br>23 сентября<br>19 артистов<br>12 часов<br>5 лет<br>3 лайва<br>2 танцпола<br>1 уличная сцена<br>1 фудтрак&nbsp;<br>1 бильярд….</p>',NULL,'800.0',2,258,1,'','https://t.me/SK8TECHNO',false,false,NULL,2,'2023-09-21 03:17:30','2023-10-21 15:51:27',NULL,'','0',18,60),
	 (1920,'IN[BASS]','2023-09-30-griboedov-inbass','2023-09-30',NULL,'18:00:00',NULL,'<p>30-го сентября главная бас группировка города IN[BASS] приглашает искушенного слушателя на свою фирменную вечеринку ALL STARS 2016, где каждый получит шанс погрузится в удивительный&nbsp; мир низких частот в историческом пространстве клуба Грибоедов.<br><br>В этот вечер, на двух танцполах, максимально плотно и без прелюдий, для вас выступят лучшие селекторы страны в областях темных музыкальных искусств</p>',300,'500.0',1,86,1,'','',false,false,NULL,2,'2023-09-20 18:55:34','2023-10-24 21:21:15',NULL,'','0',18,244),
	 (1921,'В ТЕМНОТЕ','2024-03-23-mutabor-v-temnote','2024-03-23','2024-03-25','23:00:00','03:00:00','<p>(µ) – Танцевальный марафон: MAIN — GARAGE. Дарк энтертейнтмент: квест в питч-блэк лабиринте развлечений UNDER.<br>Пространство под клубом погрузится в абсолютную темноту, путь к свету через препятствия и спецэффекты укажет гуру катакомб.</p>',1200,'',2,2,1,'https://mutabor.club/vtemnote','',false,false,NULL,2,'2023-09-21 01:54:42','2023-10-25 17:06:50',NULL,'','0',18,149),
	 (1923,'Neo-Gothic Ball','2023-09-30-neo-gothic-ball','2023-09-23',NULL,'23:00:00',NULL,'<p>чин-чин! — гулко зазвенят бокалы, торжественно открывающие раут. 23 сентября, в субботу, мы приглашаем вас на нео-готический бал по случаю Дня рождения Марго — соосновательницы kontrkult и арт-директора всех наших проектов.<br><br>Вечеринка пройдёт в полузаброшенном особняке с видом на Фонтанку, отсюда строгое требование к внешнему виду: позвольте себе прийти так, как возможно не выряжались никогда — это бал, и наряды являются его неотъемлемой частью.<br>Дам и господ ждём в платьях и костюмах. (Винтаж станет неплохим подспорьем).<br><br>Культурная программа обещает пестрить нещадным техно,<br><br>В половину второго ночи вашему вниманию будет представлен русский сакральный перформанс Елены Жива.<br><br>Место: точный адрес будет оглашен в день мероприятия.<br>Подсказка: это Архитектурное наследие фон Гогена, Бертельса и Голенищева.</p>',700,'',1,NULL,1,'https://spb.qtickets.events/84731-nasledie','',false,false,NULL,2,'2023-09-21 02:08:43','2023-10-19 00:35:31',NULL,'','0',18,60),
	 (1924,'МИКСТУРА','2023-09-22-secrets-night-room-mikstura','2023-09-22',NULL,'23:00:00',NULL,'<p>В пятницу, 22 сентября в клубном пространстве&nbsp;Secrets Night Room в поддержку локальной сцены стартует серия вечеринок МИКСТУРА в которой будут представлены разные оттенки хаус-музыки от классических направлений до современных тенденций стиля.</p>',1000,'',1,271,1,'https://spb.qtickets.events/84751-mixtura','https://t.me/chanelsecrets/40',false,false,NULL,2,'2023-09-21 02:16:36','2023-10-12 01:42:03',NULL,'','0',18,69),
