	 (1927,'MOULIN ROUGE','2023-09-23-podmoskovnye-vecera-moulin-rouge','2023-09-23',NULL,'22:00:00',NULL,'<p>23 сентября в Клубном Доме «Подмоскоvные Vечера» состоится техно-party Moulin Rouge by Civilization Family. Гости погрузятся в настоящую атмосферу парижского Мулен Ружа: перья, блеск, профессиональные танцоры, шикарные костюмы, качественная музыка.</p>',1800,'',2,272,1,'https://moscow.qtickets.events/83696-moulin-rouge','',false,false,NULL,2,'2023-09-21 02:40:13','2023-10-22 07:04:21',NULL,'','0',18,68),
