	 (1929,' TEMPLE DE PLASTIQUE','2023-09-23-prostranstvo-pole-temple-de-plastique','2023-09-23',NULL,'22:00:00',NULL,'<p>Temple de Plastique — это вечеринка, где мы хотим по-настоящему наслаждаться тем, что у нас никто не сможет отнять —&nbsp; свободой, возможностью быть собой, возможностью смеяться, плакать и танцевать под самый разный звук<br><br>В этот раз держитесь, мы призвали мощную северную музыкальную артиллерию в лице Xs project, Dead Moon и Primitive — они не дадут вам ни шанса не затанцевать и напомнят, за что мы так сильно любим Санкт-Петербург&nbsp;<br><br>Помните, время вместе и музыка — наше главное оружие и лекарство! Каждый раз как первый, и каждый раз как последний</p>',1000,'',2,46,1,'https://live.mts.ru/moscow/concerts/temple-de-plastique-koncert','',false,false,NULL,2,'2023-09-21 02:49:56','2023-10-20 02:23:48',NULL,'','0',18,52),
	 (1930,'Club Night','2023-09-22-gazgolder-club-night','2023-09-22',NULL,'22:00:00',NULL,'<p>Согреемся под саунд от друзей и резидентов клуба, посмотрим кино в chill-zone и просто тепло проведем время.<br><br></p>',1000,'',2,35,1,'https://gazgolderclub.ru/#clubnight','',false,false,NULL,2,'2023-09-21 02:59:55','2023-10-20 01:25:58',NULL,'','0',18,73),
	 (1935,'IMPULSE','2023-09-22-tsz40-impulse','2023-09-22','2023-09-23','22:00:00','08:00:00','<p>Как и обещали, Щелк открывает новый клубный сезон с амбициями выйти на уровень international, поэтому запускает масштабное действие из трех актов с финальной точкой в декабре.<br><br>И так, Акт I - вечеринка Impulse.<br><br>Суть и концепция проста - мы устали от одних и тех же мест, имен, треков … отправив запрос во вселенную (в наш тг-канал), мы получили россыпь миксов от талантливых камрадов и камрадок, которые и займут почетное место в лайнапе Impulse - something new for your ears …<br><br>Прищёлкивать будем в новой локации ТСЖ40, что на Покровке. Чистенький плейс и мощный звук - fresh and clean</p>',NULL,'500.0',2,273,1,'','',false,false,NULL,2,'2023-09-22 02:25:57','2023-10-20 02:54:26',NULL,'','0',18,76),
	 (1936,'BUNKER w/ZHELEZKER','2023-09-29-griboedov-bunker-wzhelezker','2023-09-29',NULL,'23:00:00',NULL,'<p>Концепция BUNKER заключается в объединении людей общих взглядов, иллюстрируя идею «энергетической реинкарнации идей и смыслов»<br><br>BUNKER считает точкой соприкосновения с людьми первобытность: первородное, животное, которое отображает истинные желания человека.<br><br>ЛУЧШИЙ ВЫХОД — ЭТО ВХОД.<br><br>-500 первые 100 репостов<br>-700 остальные<br>-1000 на входе</p>',500,'1000.0',1,86,1,'','',false,false,NULL,2,'2023-09-22 02:46:30','2023-10-25 17:11:46',NULL,'','0',18,158),
	 (1937,'SEX MACHINE','2023-09-22-griboedov-sex-machine','2023-09-22',NULL,'21:00:00',NULL,'<p>Jump into the driver''s seat and put it into speed drive!<br><br><br>— 400 + репост<br>— 600 на входе</p>',400,'600.0',1,86,1,'','https://vk.com/wall-154594155_17232',false,false,NULL,2,'2023-09-22 02:56:26','2023-10-22 17:55:19',NULL,'','0',18,118),
	 (1938,'Ужас! Класс!','2023-09-29-bauns-uzas-klass','2023-09-29','2023-09-30','22:00:00','05:00:00','<p>Взглянув на лайнап в первый раз, становится немного&nbsp; не по себе , но если присмотреться получше — тепло и любовь растекаются по телу, ведь в нём все свои поцаны, а еще Паша Техник.<br><br>Представляем самую смелую тусу Радуги, которую придумал сам Релиджен</p>',1000,'',2,17,1,'https://radugadiscoclub.ru/e290923','',false,false,NULL,2,'2023-09-22 03:06:10','2023-10-22 13:10:15',NULL,'','0',18,129),
	 (1939,'DECADANCE','2023-10-14-twenty-one-club-decadance','2023-10-14','2023-10-15','23:00:00','06:00:00','<p>А что вообще такое декаданс? Это искусство, эстетика, это уход от материализма и моральных условностей, это усложнение своего мироощущения. Что же более всего соответствует этому в современном мире? Конечно техно. Тёмное, ломающее старые каноны, обволакивающее ваше сознание. Этой ночью мы ждём вас в самом сердце столицы, на Новом Арбате и хотим вместе с вами разрушить рамки повседневности и погрузиться в эстетику техно культуры.</p>',700,'900.0',2,26,1,'','',false,false,NULL,2,'2023-09-22 03:12:46','2023-10-25 03:49:35',65086071,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjMzNTZhODBhMjk3ODRkYjQ3OWJmNzllIn0.tC3bNjq6S4IsICErSSRCHp2L6E-cjuylfaqYZQuTULw','0',18,220),
	 (1940,'EYWA','2023-09-30-community-moscow-eywa','2023-09-30','2023-10-01','22:00:00','06:00:00','<p>Добро пожаловать на вторую вечеринку трёх небесных промо. В этот раз источником нашего вдохновения явилась Эйва (eywa) – коллективное сознание жителей фантастической планеты Пандоры, богиня всего живого.<br>30 сентября. EYWA Community Mind. Наше коллективное сознание это творчество!<br><br>30 сентября, мы открываем магический наполненный творчеством портал в Community, главной art площадке Москвы и словно народ На’ви, жители Пандоры, соединимся с нашей Эйвой, МУЗЫКОЙ и искусством, источниками вдохновения и счастья, которое случается всегда когда мы вместе.</p><p><br>Артисты:<br><br></p>',1400,'',2,58,1,'','',false,false,NULL,2,'2023-09-22 03:19:36','2023-10-25 05:16:07',NULL,'','0',18,97),
	 (1941,'INSOMNIA Drum & Bass Night','2023-09-30-twenty-one-club-insomnia-drum-bass-ni','2023-09-30','2023-10-01','23:00:00','06:00:00','<p>В субботу 30 сентября серия московских Drum &amp; Bass вечеринок INSOMNIA возвращается, чтобы отметить открытие нового клубного сезона. Новейшая и проверенная временем музыка со всего мира, ламповая атмосфера друзей и единомышленников. Мы ждём тебя!</p>',500,'',2,26,1,'','',false,false,NULL,2,'2023-09-22 03:41:05','2023-10-23 16:24:54',65077,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjNhM2UwM2I3Yzg3NjBmZTZjM2Q2YWIxIn0.bUfkBSnN8yzzeLF08de2DyecSa_zrNoxDkaE3LHpBHk','0',18,85),
	 (1942,'Live History','2023-10-14-macty-live-history','2023-10-14','2023-10-15','22:00:00','05:00:00','<p>Всем пламенный привет, друзья!<br>Прошло уже 3 месяца с нашей последней встречи на Live History. 14 октября в клубе Мачты у нас есть отличный повод собраться в самый разгар Петербургской осени, и отметить мировой выход 6-го тиража винила от Live History Records. Увидеться и послушать любимую музыку от резидентов и гостей из разных городов России.</p>',600,'',1,9,1,'https://spb.radario.ru/events/2053814','',false,false,NULL,2,'2023-09-22 03:55:13','2023-10-23 09:06:21',NULL,'','0',18,127);
