	 (1946,'MLC: Goodbye Summer','2023-09-23-miraz-mlc-goodbye-summer','2023-09-23',NULL,'00:00:00',NULL,'<p>если вы думаете, что мы оставим вам шанс поехать в субботу в другое место, то читаем внимательно&nbsp;<br><br>какой месяц без mlc, правильно? правильно<br>так что наши резиденты , в компании с алисой шавровой, ребятами из бурятского андерграунда и uk dealer собираются в клубе, чтобы устроить для всех праздник<br><br></p>',600,'800.0',1,77,1,'','',false,false,NULL,2,'2023-09-22 16:54:35','2023-10-23 00:00:59',NULL,'','0',18,102),
	 (1947,'GENTLEMEN’S CLUB','2023-09-22-deep-fried-friends-gentlemens-club','2023-09-22',NULL,'00:00:00',NULL,'<p>В эту пятницу мы соберем самых лучших джентельменов города в одном месте, а именно в особняке DFF на Таганской и, ровно в полночь, откроем для всех вас жемчужные двери в клуб одиноких сердечек<br>ВХОД ПЛАТНЫЙ:<br>23:00 - 00:00 800₽<br>00:00 - 03:00 1200₽<br>03:00 - 05:00 FREE</p>',800,'1200.0',2,76,1,'','',false,false,NULL,2,'2023-09-22 16:59:01','2023-10-14 20:09:08',NULL,'','0',18,47),
	 (1948,'Ciao Ragazzi!','2023-09-22-late-checkout-ciao-ragazzi','2023-09-22',NULL,'22:00:00','02:00:00','<p>В эту пятницу отель Марко Поло станет сердцем Италии, а лобби-бар Late Checkout – Колизеем итало-диско танцев!<br>Специально для этого вечера были наняты исследователи музыкальной итальянской культуры</p>',NULL,'0.0',2,275,1,'','',false,false,NULL,2,'2023-09-22 17:05:14','2023-09-28 11:48:16',NULL,'','0',18,28),
	 (1949,'CLOSING DFF YARD','2023-09-24-deep-fried-friends-closing-dff-yard','2023-09-24',NULL,'20:00:00',NULL,'<p>Лето пролетело стремительно, но ярко, чего за эти месяцы у нас только не было! Провожаем последний теплый день в это воскресенье у нас во дворе – слушаем музыку, танцуем под диджей сеты, едим бранч и гриль, рассказываем истории, пьем пет-нат, а вечером смотрим «Короля Льва» под открытым небом.&nbsp;<br>BIG SCREEN CARTOON:<br>20:00 «LION KING»<br>FREE ENTRY</p>',NULL,'0.0',2,76,1,'','',false,false,NULL,2,'2023-09-22 17:10:02','2023-10-23 08:24:39',NULL,'','0',18,83),
	 (1950,'Street Choice','2023-09-22-union-street-choice','2023-09-22',NULL,'22:00:00',NULL,'<p>Уважаемый хаус-дуэт Street Choice собирает свою свиту в Ю на очередном эпизоде Drop.<br><br>Ребята устраивают «Дропы» редко, но всегда аккурат обстановке. Так, прохладная пятничная ночь будет хорошенько прогрета различными оттенками хаус музыки, диско, брейкбита и хип-хопа. За пультом — локальные герои со своими аутентик селекшн<strong><br><br>Вход до 23:00 фри, после — 500₽</strong></p>',0,'500.0',1,8,1,'','',false,false,NULL,2,'2023-09-22 17:31:34','2023-10-21 13:32:12',NULL,'','0',18,77),
	 (1951,'ITALLIKA','2023-09-23-union-itallika','2023-09-23',NULL,'22:00:00',NULL,'<p>Заревербированные хлопки отскакивают от стен и попадают прямо в центр тела, легкое облако винтажных синтов подхватывает каждое движение. Застрявшие в невесомости, мы ощущаем себя гораздо более цельными, чем когда либо.&nbsp;<br><br>Вход до 23:00 фри, после — 500₽</p>',0,'500.0',1,8,1,'','',false,false,NULL,2,'2023-09-22 17:35:15','2023-10-25 04:26:17',NULL,'','0',18,93),
	 (1952,'DIALOG','2023-09-22-mixed-dialog','2023-09-22',NULL,'22:00:00',NULL,'<p>dialog возвращается в mixed. с расширенным лайн-апом.<br><br>юнайт, который так долго ждали: Kekoriy (Utro / Minimal Pushers) и Poly (Tur / Mixed) отыграют трехчасовой b2b.&nbsp;<br><br>а Romoq и Danya Koposov порадуют пачкой нового винила на разогреве.&nbsp;</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,2,'2023-09-22 17:40:28','2023-10-22 05:58:34',NULL,'','0',18,67);
