	 (1968,'суббота в Мишке','2023-09-23-miska-bar-subbota-v-miske','2023-09-23','2023-09-24','21:00:00','04:00:00','<p>Диско и всякие танцевальные жанры вокруг да около.&nbsp;<br><br>Будут танцы или нет — черт его знает. Но вы точно проведёте время в приятной компании. И услышите какую-нибудь новую, прежде незнакомую музыку. По нынешним временам уже немало.&nbsp;<br><br></p>',NULL,'0.0',1,12,1,'','',false,false,NULL,3,'2023-09-23 19:47:26','2023-10-25 12:08:31',NULL,'','0',18,77),
	 (1970,'Neo-Gothic ball ','2023-09-23-fontanka-78-neo-gothic-ball','2023-09-23','2023-09-24','23:00:00','06:00:00','<p>чин-чин! — гулко зазвенят бокалы, торжественно открывающие раут. 🌙 23 сентября, в субботу, мы приглашаем вас на нео-готический бал по случаю Дня рождения Марго — соосновательницы kontrkult и арт-директора всех наших проектов.&nbsp;<br><br>🕷️ Вечеринка пройдёт в полузаброшенном особняке с видом на Фонтанку, отсюда строгое требование к внешнему виду: позвольте себе прийти так, как возможно не выряжались никогда — это бал, и наряды являются его неотъемлемой частью.&nbsp;<br>Дам и господ ждём в платьях и костюмах. (Винтаж станет неплохим подспорьем).<br><br>🩸Культурная программа обещает пестрить нещадным техно и непредсказуемыми явлениями.<br><br>&nbsp;🌒 В половину второго ночи вашему вниманию будет представлен русский сакральный перформанс Елены Жива. &nbsp;<br><br>🕷️ Место: точный адрес будет оглашен в день мероприятия.&nbsp;<br>🕸️ Подсказка: это Архитектурное наследие фон Гогена, Бертельса и Голенищева.</p>',900,'',1,276,1,'','',false,false,NULL,3,'2023-09-23 19:56:04','2023-10-25 14:01:49',NULL,'','0',18,217),
