	 (1976,'ГЕСТ','2023-09-28-laboratorio-distilita-gest','2023-09-28','2023-09-28','20:00:00','23:59:00','<p>Как вы знаете, гостей мы любим принимать по обе стороны нашей барной кафедры. Этот четверг не станет исключением. Наши друзья из бара Современник встанут за стойку со своими авторскими коктейлями, а за музыкальную часть будут отвечать DJ Smirnov и Лёша Пой.&nbsp;<br>Старт в 20:00, столики, как и всегда, лучше бронировать заранее!&nbsp;</p>',NULL,'',1,278,1,'','',false,false,NULL,2,'2023-09-27 17:16:55','2023-10-24 10:51:20',NULL,'','0',18,31),
