	 (1978,'Хэллоувин Хэллоуферм Хэллоувсем','2023-10-29-art-ferma-xellouvin-xellouferm-xellouvs','2023-10-29',NULL,'18:00:00',NULL,'<p>Выставка Арт-Пугал  Мистические инсталляции  Мерч музыкантов и художников  Крафтовый бар  Фермерская кухня  Кинотеатр ужасов<br><br>Вечеринка будет проходить в Лен области внутри атмосфернейшего фермерского дома. Не стоит переживать, что вы замёрзнете: есть большая печь в доме, будут большие костры и наши горячие сердца!&nbsp;<br><br>Ферма находится под управлением козлов, баранов, кур, коровы с конём и пса Тая...все дружелюбны, приветливы и ждут вас в гости!&nbsp;<br><br>В костюме 500₽  без 800₽<br><br>Предпродажа закрывается в 28.10 днем<br><br>* Наши координаты высылаются автоматически после регистрации.</p>',500,'800.0',1,261,1,'https://spb.qtickets.events/52957-khellouvin-khellouferm-khellouvsem','https://vk.com/hellouwsem',false,false,NULL,2,'2023-09-27 17:28:13','2023-10-25 16:21:24',NULL,'','0',18,75),
	 (1979,'Точка Невозврата','2023-09-30-macty-tocka-nevozvrata','2023-09-30',NULL,'22:00:00',NULL,'<p>Твое последнее путешествие ждет тебя.<br><br>Это не просто вечеринка,<br>Это билет до конечной остановки реальности, где происходит резонанс.<br>Точка невозврата — это коллапс электронной музыки на стыке со сверхъестественным. Только живые синты и визуальное приключение длинною в одну ночь.<br>Однажды перешагнув через черту,<br>назад пути уже нет.<br>Хватит ли тебе смелости присоединиться?<br><br></p>',400,'',1,9,1,'https://spb.radario.ru/events/2052542','',false,false,NULL,2,'2023-09-28 02:09:48','2023-10-21 22:24:50',NULL,'','0',18,106),
	 (1980,'Hard Line','2023-10-21-factory-3-hard-line','2023-10-21',NULL,'23:00:00',NULL,'<p>Radio Show Hard Line объявляет об осеннем мероприятии в клубе Factory, где вас встретят две сцены с артистами из Санкт-Петербурга и приглашенными гостями. Специально на эту вечеринку на первом этаже клуба будет добавлен звук, чтобы добавить рейву больше глубокого звучания и адского баса&nbsp;</p>',500,'',1,7,1,'https://mehanikafest.edinoepole.ru/widget/events/11/event_seats','https://t.me/HardlineTechno',false,false,NULL,2,'2023-09-28 02:14:06','2023-10-25 01:10:47',NULL,'','0',18,178),
	 (1982,'Суббота','2023-09-30-bar-strelka-subbota','2023-09-30',NULL,'23:00:00',NULL,'<p>В субботу за пультом 2/3 диджейского коллектива Ha-HaBiBi: романтик Миша Политковский, чьи сеты каждый раз удивляют и разбивают сердца, и невероятная Аня Захарова, чей концерт с группой «Не Твоё Дело» во дворе «Стрелки» в 2016-м мы вспоминаем с самыми добрыми ностальгическими чувствами, и с не меньшим удовольствием слушаем новый трек СБПЧ (https://www.youtube.com/watch?v=VAv1zbGbG4w) с участием Ани.</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,2,'2023-09-28 02:25:01','2023-10-22 17:47:15',NULL,'','0',18,43),
	 (1983,'CLUB NIGHT','2023-09-29-gazgolder-club-night','2023-09-29','2023-09-30','22:00:00','09:00:00','<p>Традиционно танцы на террасе до утра с резидентами и друзьями клуба, а так же chill-zone с кинопоказом мировых кинохитов.</p>',0,'1000.0',2,35,1,'https://gazgolderclub.ru/#clubnight','',false,false,NULL,2,'2023-09-28 02:28:43','2023-10-18 06:42:09',NULL,'','0',18,113),
	 (1984,'Dark Carnival','2023-09-29-a2-dark-carnival','2023-10-28',NULL,'22:00:00',NULL,'<p>Масштабный праздник индивидуальности, безграничной свободы и самовыражения. Место без социальных масок и притворства, где можно и нужно заявить о себе: «Я НЕПОВТОРИМЫЙ!». Рассказать о своих желаниях и мыслях, показать свой характер и душу, воплотив их в дерзком образe<br><br>Готовь свой лучший костюм и не бойся быть собой. <br>Ждём тебя – яркого и смелого – на карнавале</p>',1200,'',1,95,1,'https://www.darkcarnival.ru','',false,false,NULL,2,'2023-09-28 02:36:52','2023-10-25 16:58:07',NULL,'','0',18,321);
