	 (1985,'АSYLUM','2023-09-29-rndm-asylum','2023-09-29','2023-09-30','23:00:00','08:00:00','<p>Спустя 4 месяца мы вновь приглашаем вас на Asylum в RNDM, где наши друзья и резиденты будут радовать ваши ушки и тела жесткой бочкой!<br><br>Хедлайнер вечеринки KIBO - хардкорщик с большим стажем, совсем недавно проявивший себя и на сцене хард-техно. Не изменяя своим традициям мы приглашаем талантливых молодых артистов</p>',NULL,'800.0',2,27,1,'','https://t.me/asylummoscow',false,false,NULL,2,'2023-09-28 02:51:58','2023-10-14 22:08:21',NULL,'','0',18,54),
	 (1986,'TESLA','2023-09-29-supermetall-tesla','2023-09-29',NULL,'20:00:00',NULL,'<p>Сколько катушек Тесла понадобится, чтобы задействовать все органы чувств?<br>Узнаем на шоукейсе Resonance, который пройдёт в рамках вечеринки «НДЧ» фестиваля «Креатех Фест» на Суперметалле уже 29 сентября.<br><br>Гвоздь программы — перфоманс TESLA, где Никита Забелин играет на трансформаторных катушках Николы Теслы, извлекая настоящие молнии: будет даже слышен запах электричества в пространстве.<br><br></p>',1200,'',2,119,1,'','',false,false,NULL,2,'2023-09-28 02:57:37','2023-10-24 08:01:54',6510116,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWZkOTU5YWZmZGNiZDZlZTY0NTJjZjczIn0.GeRgIuxoux5eUegSzCkEWmLeljBwf4hO9W4fGQPV01A','0',18,140),
	 (1987,'ИНТЕР КРУТАЯ ТУСА','2023-09-30-blanc-inter-krutaia-tusa','2023-09-30',NULL,'23:00:00',NULL,'<p>Вечеринка диско-клуба «Радуга» с разбойным лайнапом, где вы услышите электро, гетто-саунд, бойкую прямую бочку и не только</p>',NULL,'1500.0',2,36,1,'https://radugadiscoclub.ru/e300923','https://radugadiscoclub.ru',false,false,NULL,2,'2023-09-28 03:02:32','2023-10-22 15:10:32',NULL,'','0',18,85),
	 (1988,'DANILOVSKY X RADI MIRA I LUBVI','2023-09-30-danilovskii-rynok-danilovsky-x-radi-mir','2023-09-30','2023-10-01','22:30:00','04:00:00','<p>Команда RADI MIRA I LUBVI в компании резидентов и гостей отправится на Даниловский рынок. Повод для тусовки — 60-летие рынка, а на одну ночь промогруппа продлит режим его работы до четырех утра и наполнит танцевальной музыкой.</p>',1900,'',2,280,1,'https://danilovsky.timepad.ru/event/2593157/','',false,false,NULL,2,'2023-09-28 03:12:00','2023-10-24 04:20:28',NULL,'','0',18,171),
	 (1989,'CWH','2023-09-30-rndm-cwh','2023-09-30','2023-09-30','18:00:00','05:00:00','<p>Две смены джангла в формате вечера и классического ночного.<br><br>Дебютируют в вечернюю смену со звуками джангла, джангл техно и хардкор брейкбита: Данила BRICK | Сергей L OWN | Александр BRAINWORM<br><br>Выбирай удобные временные рамки: если соблюдаешь режим, начало в 18:00 и успеешь нырнуть в метро. Если нормами социума готов пренебречь - просто приходи к началу и получай удовольствие до утра!</p>',NULL,'700.0',2,27,1,'','',false,false,NULL,2,'2023-09-28 03:15:24','2023-10-17 13:34:35',NULL,'','0',18,37),
