	 (2066,'ESCVPISM','2023-10-06-ionoteka-escvpism','2023-10-06','2023-10-07','23:30:00','05:30:00','<p>Реальность страшнее любой истории про ведьм, демонов или злых духов, поэтому 6 октября мы в очередной раз сбегаем от неё на бал нечисти ESCVPISM и устраиваем самый мистический шабаш под звуки витч-хауса.</p>',NULL,'300.0',1,40,1,'','',false,false,NULL,2,'2023-10-04 16:26:51','2023-10-21 19:39:02',NULL,'','0',18,100);
