	 (1994,'ЧИКАГО','2023-09-29-ritmy-cikago','2023-09-29',NULL,NULL,NULL,'<p>В эту пятницу состоится просто великолепная и уникальная встреча выпускников всех культовых и исторических питерских дискотек.&nbsp;<br><br>Если вы +- возраста админа, то вы просто расплачетесь от счастья! Состав — крышесносный пулемёт!<br><br>Слова Вива, Мишка, Спешал Кейс, 50х50, Ноль, Единица, Двойка, Троица, Дом Быта, Дружба, Джизуз, Игратека, Эфир вам о чем-нибудь говорят?<br><br>Пишу и радуюсь, что золотой состав артистов из моей юности будет давать гастроль у нас в коктейльной зоне!&nbsp;<br><br>Ответственность за хаус-музыку, которую мы любим на себя берут легенды, которых мы заслужили</p>',NULL,'0.0',1,181,1,'','',false,false,NULL,2,'2023-09-28 04:13:51','2023-10-22 04:35:53',NULL,'','0',18,87),
	 (1995,'Кругозор','2023-09-30-prostranstvo-pole-krugozor','2023-09-30',NULL,'22:00:00',NULL,'<p>Есть одна старая полевая поговорка — если открыть и закрыть сезон одной и той же вечеринкой, будет в жизни у вас много хорошего. Открывали мы последний сезон кругозором, а значит, прощаться будем тоже им&nbsp;<br><br>Если говорить проще — фестиваль «кругозор» возвращается в поле&nbsp;<br><br>В лайнапе крайне долгожданное возвращение Люси margenrot в поле спустя почти два года, первый в поле концерт группы Ночной Проспект и диджей-сеты в диапазоне от слоуджемов и даунтемпо к интеллектуальному хаусу, техно, эйсиду и нарушению всякого спокойствия</p>',1000,'',2,46,1,'https://krugozor.ticketscloud.org/','',false,false,NULL,2,'2023-09-28 04:21:50','2023-10-23 00:29:57',NULL,'','0',18,109),
	 (1996,'Прожиточный Минимал','2023-09-28-propaganda-prozitocnyi-minimal','2023-09-28','2023-09-29','23:00:00','05:00:00','<p>&nbsp;Шоукейс московской команды «Прожиточный минимал», эпизоды которого теперь регулярно проходят в стенах «Пропаганды». В лайнапе заявлены столичные адепты минималистичной электроники&nbsp;</p>',NULL,'0.0',2,101,1,'','https://t.me/propagandamoscow/1267',false,false,NULL,2,'2023-09-28 04:40:03','2023-10-15 07:21:28',NULL,'','0',18,49),
	 (1997,'VARIOUS','2023-09-29-powerhouse-various','2023-09-29',NULL,'23:00:00',NULL,'<p>29 Сентября, в стенах Powerhouse Moscow пройдет новая сборка топовых экспертов и заметных имен на небосводе электронной сцены, которые в этот вечер наполнят духом свободы стены родного дома силы.<br>Вход осуществляется по системе Donation</p>',100,'',2,5,1,'','https://vk.com/various2909',false,false,NULL,2,'2023-09-28 04:46:11','2023-10-11 09:52:20',NULL,'','0',18,42),
	 (1998,'EMO PARTY','2023-09-30-triglinki-emo-party','2023-09-30',NULL,'21:00:00',NULL,'<p>Атмосфера Blazer, конверсов и разбитых сердец<br>Чтобы вернуть 2007, ребята подготовили: Dj сет с классикой эмо-жанра от «My Chemical Romance» до «Психеи», тату-зону, бар с авторскими коктейлями, конкурс на бесплатное тату за лучший образ.&nbsp;<br>DC: эмо-стиль, подводка на глазах, черный и розовый, джинсы-скинни, конверсы.&nbsp;<br>Вход - donation от 150₽ по записи через @yanaborisovayanaborisova</p>',150,'',1,281,1,'','',false,false,NULL,2,'2023-09-28 04:57:24','2023-10-25 14:03:03',NULL,'','0',18,111),
	 (1999,'THIS SATURDAY','2023-09-30-deep-fried-friends-this-saturday','2023-09-30',NULL,'23:00:00',NULL,'<p>В эту субботу и только для вас — участник группы «ХЛЕБ», блогер, актёр, топ батя и селектор <a href="https://instagram.com/shulikome?igshid=NzZhOTFlYzFmZQ==">САША ШУЛИКО,</a> ведущий шоу «ВПИСКА», музыкальный исследователь <a href="https://instagram.com/nikolai_tretiy?igshid=NzZhOTFlYzFmZQ==">КОЛЯ РЕДЬКИН,</a> мастер красного словца, сценарист и креатор <a href="https://instagram.com/comajee?igshid=NzZhOTFlYzFmZQ==">COMAJEE,</a> диджей-очаровашка <a href="https://instagram.com/alina_gabdullina?igshid=NzZhOTFlYzFmZQ==">ALINA GABDULLINA</a> и любимый резидент DFF CLUB и ÖMANKÖ, талантливый <a href="https://instagram.com/gucci_kale?igshid=NzZhOTFlYzFmZQ==">GUCCI KALE</a><br><br>ВХОД ПЛАТНЫЙ&nbsp;<br>23:00 - 00:30 500₽<br>00:30 - 03:30 1000₽<br>3:30 - till end FREE</p>',500,'1000.0',2,76,1,'','',false,false,NULL,2,'2023-09-28 05:01:51','2023-10-20 20:12:48',NULL,'','0',18,37),
	 (2000,'GIRLS, GIRLS, GIRLS','2023-09-29-deep-fried-friends-girls-girls-girls','2023-09-29',NULL,'23:00:00',NULL,'<p>Прекрасные музы города соберутся в ресторане Deep Fried Friends уже в эту пятницу <br>В первые у нас в гостях окажется невероятная и обаятельная певица <a href="https://instagram.com/siuzannavarnina?igshid=NzZhOTFlYzFmZQ==">СЮЗАННА</a> со своим дебютным техно-сетом, также для вас выступят – прекрасная половинка дуэта Lovanda – <a href="https://instagram.com/laleebloom?igshid=NzZhOTFlYzFmZQ==">LALA,</a> фэшн-энтузиастка, бизнес коуч и супер вумен <a href="https://instagram.com/pavelena?igshid=NzZhOTFlYzFmZQ==">PAVELENA,</a> инста-муза и основательна бренда Muses and Blouses – мисс <a href="https://instagram.com/babekrisbabe?igshid=NzZhOTFlYzFmZQ==">BABEKRISBABE,</a> блогер и предприниматель <a href="https://instagram.com/bahman_nata?igshid=NzZhOTFlYzFmZQ==">NATA BAHMAN,</a> оунер серии вечеринок Fems, гетто хаус принцесса <a href="https://instagram.com/rimmakim?igshid=NzZhOTFlYzFmZQ==">RIMMA KIM</a><br><br>ВХОД ПЛАТНЫЙ&nbsp;<br>С 23:00 до 00:00 700₽<br>С 0:00 до 3:00 1000₽<br>С 3:00 до конца FREE</p>',700,'1000.0',2,76,1,'','',false,false,NULL,2,'2023-09-28 05:06:25','2023-10-21 01:53:24',NULL,'','0',18,82),
