	 (2003,'NeroPunk Session','2023-09-30-factory-3-neropunk-session','2023-09-30',NULL,'23:00:00',NULL,'<p>Открываем сезон фирменной вечеринкой Neuropunk Session с мощным, разнообразным составом! В этот раз не только резиденты подкаста, но и участники Нейробункера и Нейропанк академии.</p>',900,'',1,7,1,'https://nrpnk.ru/','',false,false,NULL,2,'2023-09-28 12:42:49','2023-10-21 21:56:58',NULL,'','0',18,85),
