	 (2007,'PG NORTH CENTRAL','2023-09-29-mod-pg-north-central','2023-09-29',NULL,'23:30:00',NULL,'<p>PG NORTH CENTRAL, снова на связи!<br>Люто дебютировали в Дюнах, теперь забираем MOD!<br>- Game Center - развлекательно-игровая зона с тату мастерами, покером, картами , блэкджеком и ш.....<br>В общем сам все увидишь)<br><br>- Выступление перспективных артистов нашего лейбла PETROGRAD RECORDS, со свежим звуком!<br><br>- Розыгрыши и подарки от наших партнеров:</p>',400,'',1,113,1,'https://spb.qtickets.events/84224-pg-north-central','https://vk.com/north_central',false,false,NULL,2,'2023-09-28 15:01:24','2023-10-22 04:35:56',NULL,'','0',18,223),
	 (2008,'Saint Rave','2023-10-01-lastocka-saint-rave','2023-10-01',NULL,'19:30:00',NULL,'<p>Это слэм, это гнев<br>Это новый русский рейв<br>Тебя ждет яркий и насыщенный слэм под треки любимых исполнителей.</p>',150,'',1,10,1,'https://spb.qtickets.events/82572-saint-rave','https://vk.com/saintsrave',false,false,NULL,2,'2023-09-28 15:20:56','2023-10-17 10:12:07',NULL,'','0',18,35),
