	 (2011,'Club Night','2023-09-30-propaganda-club-night','2023-09-30','2023-10-01','22:00:00','06:00:00','<p>Гость грядущей субботы Gegen Mann – музыкальный проект московского продюсера и ди-джея Александра Ломакина. Как диджей Геген Манн абсолютно не ограничен стилистическими рамками, но особое предпочтение отдает дарк диско, нью биту и раннему гоа трансу.</p>',NULL,'0.0',2,101,1,'','',false,false,NULL,2,'2023-09-28 16:03:40','2023-10-18 10:51:53',NULL,'','0',18,45),
