	 (2013,'SOLAR SYSTEM: Inspiration','2023-09-29-community-moscow-solar-system-inspirat','2023-09-29','2023-09-30','21:00:00','06:00:00','<p>В пятницу вечером соберёмся в библиотеке, чтобы вместе стать немного счастливее и проникнуться Dj-сетами артистов, которые вдохновляют тысячи людей на погружение в состояние истинного блаженства!<br><br></p>',2000,'',2,58,1,'http://communitymoscow.ru/','',false,false,NULL,2,'2023-09-28 16:58:01','2023-10-23 11:11:02',NULL,'','0',18,136),
	 (2014,'Avatar Party','2023-09-29-cinist-avatar-party','2023-09-29',NULL,'23:00:00',NULL,'<p>Готовься к незабываемому музыкально-визуальному путешествию, где магия сливается с музыкой и создает неповторимые впечатления!<br>Флуоресцентный декор AVATAR, создаст мистическую атмосферу.<br>Художники украсят тебя фантастическими узорами, которые будут светиться в темноте. Атмосфера будет пропитана магией, каждый может стать частью этого фантастического мира!</p>',777,'',1,94,1,'https://kupit-bilet-online.ticketscloud.org/e/64ff59af65ee1037ad44a63d','',false,false,NULL,2,'2023-09-28 18:05:51','2023-10-22 16:27:11',NULL,'','0',18,60),
	 (2015,'BoomBap Masterz','2023-09-30-griboedov-boombap-masterz','2023-09-30',NULL,'19:00:00',NULL,'<p>BoomBap Masterz возвращается! Двенадцатый сезон мастеров BoomBap уже этой осенью! Только для вас в этот вечер свои эксклюзивные треки представят:<br><br>ОСЕНЬ/2023: BIG JOINT, HB ARMY, BOOM DEEZEE, BOTANIQUE, АЛЁША ЩЕ, KLIOTSA, MC STA, YARUS, OKHTA STREET FAMILY</p>',NULL,'500.0',1,86,1,'','https://vk.com/boombapmastazlive',false,false,NULL,2,'2023-09-28 18:16:52','2023-10-17 19:41:40',NULL,'','0',18,62);
