	 (2027,'OBERWAVE VII YEARS ANNIVERSARY','2023-10-20-mutabor-oberwave-vii-years-anniversary','2023-10-20',NULL,'23:55:00',NULL,'<p>Знаете ли вы хотя бы одну более–менее известную серию вечеринок, посвященных электронной музыке с приставкой «дарк» и при этом не техно? А в России? А из существующих? А из тех, кто стабильно и качественно делает свое дело семь лет подряд? О чем и речь.<br><br>Пир во время чумы и большой праздник для любителей бади мьюзик, нью бита и дарк диско. С размахом отмечаем семилетие в Мутаборе. Декорации, свечи, лайвы и фирменная атмосфера — все это, конечно же, будет.</p>',800,'',2,2,1,'https://moscow.qtickets.events/83835-oberwave-vii-years-anniversary-at-mutabor','https://t.me/oberwave',false,false,NULL,2,'2023-09-29 02:37:54','2023-10-25 16:00:35',NULL,'','0',18,179),
	 (2016,'MASK','2023-10-29-mutabor-mask','2023-10-29',NULL,NULL,NULL,'<p>(µ) — Hide behind the MASK: не-Хеллоуин Mutabor.<br>Пространство MSL закрутило в водовороте сюрреалистических образов — сцена станет шоукейсом иллюзий антагонистического Хеллоуина, искажающим действительность зеркалом, за которым обитают идеи и образы костюмированных фильмов Федерико Феллини.<br>Женя Соболь, режиссер трейлеров ARMA и Outline, автор ставшего новогодней сенсацией Cabaret Alter, делает из MSL "сюрреалистичную гостиную" — в которой гостей будут развлекать игрой на арфе, гаданием на пластинках и картах таро, кинолотереей, чтением сказок, спиритическими и гипнотическими сеансами.<br><br>Среди участников известные и очень известные фрики и перформеры. Отгадать, кто именно, будет достаточно сложно, поскольку лица, согласно идее события, будут скрыты.<br><br></p>',1200,'',2,2,1,'https://mutabor.club/MASK/','https://vk.com/wall-183454569_1500',false,false,NULL,2,'2023-09-28 18:22:44','2023-10-25 17:45:39',NULL,'','0',18,810),
	 (2017,'Ø ⟶ Outline Pre-Party','2023-11-25-mutabor-o-outline-pre-party','2023-11-25',NULL,NULL,NULL,'<p>Outline. Полномасштабный пре-ивент фестиваля. Задействованы все сцены и пространства Mutabor. В продаже первые билеты.<br><br><em>CAN''T WAIT</em></p>',1800,'',2,2,1,'https://mutabor.club/pre-outline/','',false,false,NULL,2,'2023-09-28 18:26:42','2023-10-25 16:08:57',NULL,'','0',18,180),
	 (2018,'Corpus One','2023-10-06-gazgolder-corpus-one','2023-10-06',NULL,NULL,NULL,'<p>6 октября команду CORPUS ONE затянет круговорот новых витков аудио-визуальных удовольствий. Вечеринка развернется на двух танцполах клуба Газгольдер. Тщательно подобраная осенняя компиляция звёзд электронной сцены не оставит ни единого шанса упустить столь долгожданное событие.</p>',1000,'2000.0',2,35,1,'https://moscow.qtickets.events/84876-corpus-one-gazgolder','',false,false,NULL,2,'2023-09-28 18:29:51','2023-10-24 06:36:13',NULL,'','0',18,66),
	 (2019,'POLНЫЙ SUR','2023-09-30-treff8-club-polnyi-sur','2023-09-30',NULL,'23:00:00',NULL,'<p>Самый лучший и безболезненный способ справиться с осенней хандрой - придумать новый яркий лук и поехать на вечеринку Polный Sur by Space Reality в любимый клуб Treff8.<br>И если вы считаете, что для побега из дома нужен повод, то мы его вам уже придумали.<br><br>30 сентября к нам прилетают любимчики клубной тусовки, невероятно талантливый дуэт Space Food из Санкт-Петербурга. Также, вас ожидают выступления резидентов и друзей комьюнити, приправленные неожиданными перфомансами и лайвом от Лаврецкого.<br><br>В целом мы позаботимся о том, чтобы эта ночь стала для вас незабываемой.<br>Главное помните о том, какие вы невероятные и особенные! И не бойтесь быть яркими.<br><br>FC|DC: Color Fantasy, No Black</p>',1600,'',2,84,1,'https://moscow.qtickets.events/82467-polnyy-sur-by-space-reality','',false,false,NULL,2,'2023-09-28 18:43:14','2023-10-22 02:41:34',NULL,'','0',18,37),
