	 (2025,'LOUD''S SESSIONS','2023-10-21-munk-bar-louds-sessions','2023-10-21',NULL,'23:00:00',NULL,'<p>Drum and bass и jungle совместно с диджеями и вокалистами!<br><br>После большого перерыва мы с огромной радостью хотим представить вам новую главу проекта Loud''s Sessions!<br>Уже в третий раз московские диджеи и вокалисты подготовят для вас совместные выступления. Только атмосферные и позитивные вибрации! Поехали!<br><br></p>',600,'',2,282,1,'https://moscow.qtickets.events/84708-louds-sessions211023munk-bar','',false,false,NULL,2,'2023-09-29 02:29:21','2023-10-22 00:56:27',NULL,'','0',18,116),
	 (2026,'Drum & Bass','2023-10-20-16-tonn-presnenskii-val-drum-bass','2023-10-20',NULL,'23:55:00',NULL,'<p>Для Вас в эту ночь играют одни из лучших представителей Российской Drum and Bass сцены!<br>Ребята представляют такие города, как Москва, Санкт-Петербург, Вологда и, конечно же, Брянск!<br><br>Только качественный Drum and Bass, новые треки и отличная атмосфера ждут Вас!<br><br></p>',500,'',2,29,1,'https://moscow.qtickets.events/85405-drum-bass','',false,false,NULL,2,'2023-09-29 02:34:54','2023-10-24 07:44:12',NULL,'','0',18,168),
