	 (2028,'TIME AND MECHANICS','2023-10-20-lachesis-time-and-mechanics','2023-10-20',NULL,'22:00:00',NULL,'<p>Время, Космос, Механизмы!<br>Вы стоите на пороге невероятных открытий. Доверьтесь нам, и мы проведем вас в самое сердце мистической тьмы.<br>Начнем это удивительное путешествие вместе.<br>Добро пожаловать в мир Времени и Его Механизмов!</p>',800,'',2,121,1,'https://moscow.qtickets.events/85628-time-and-mechanics','',false,false,NULL,2,'2023-09-29 02:43:38','2023-10-25 10:45:24',NULL,'','0',18,133),
	 (2029,'COMMUNITY & SPACE OF BASE','2023-10-13-base-club-community-space-of-base','2023-10-13',NULL,'23:00:00',NULL,'<p>Самый масштабный FESTIVAL электронной музыки этой осени. Объемный звук, свет и видео-инсталляции от создателей лучших клубных шоу.<br>Впервые в России в формат электронного проекта интегрировано уникальное иммерсивное шоу с элементами перформанса, которые не оставят равнодушным ни одного зрителя.<br>Начало в 23:00 До скорой встречи!&nbsp;<br><br></p>',1500,'4000.0',2,274,1,'https://moscow.qtickets.events/85717-community-space-of-base','',false,false,NULL,2,'2023-09-29 02:50:06','2023-10-24 06:56:08',NULL,'','0',18,110),
	 (2030,':data x UNITED','2023-10-13-mutabor-data-x-united','2023-10-13',NULL,'23:00:00',NULL,'<p>В пятницу 13 октября :data и UNITED представляют третью совместную вечеринку в стенах пространства Mutabor! Как и прежде, на двух танцполах клуба, в разных темпах, но объединенных единой идеей</p>',800,'',2,2,1,'https://moscow.qtickets.events/85756-data-x-united','',false,false,NULL,2,'2023-09-29 03:02:55','2023-10-22 12:12:00',NULL,'','0',18,224),
