	 (2032,'Art Area Birthday','2023-10-07-community-moscow-art-area-birthday','2023-10-07','2023-10-08','18:00:00','05:00:00','<p>Если ты читаешь эту страницу значит ты мой долгожданный гость на вечеринке Art Area в честь моего дня рождения 7 октября, которая пройдет в сердце Москвы в библиотеке электронной музыки Community Moscow.<br><br>Регистрация обязательна для всех гостей, чтобы хостес смогли выдать тебе браслет. Конечно же, ВИП браслет с проходом за бэкстейдж и отдельные зоны.<br><br>Что касается подарков: я улетаю на Бали и мое положение и объем чемоданов не позволят мне взять их с собой. Но на Бали я хочу собрать свою домашнюю музыкальную студию и развивать проект с мультимедийными художниками, поэтому принимаю подарки в виде финансового вклада в мои проекты.<br><br>Ниже ты можешь выбрать опцию, которая тебе удобна.<br><br>Пожалуйста не дарите также цветы! Спасибо.<br><br>С нетерпением жду нашей встречи 7 октября.</p>',1,'',2,58,1,'https://moscow.qtickets.events/85148-art-area-birthday-for-friends-0710','',false,false,NULL,2,'2023-09-29 03:54:34','2023-10-16 19:31:12',NULL,'','0',18,105),
	 (2033,'Goa TV','2023-10-06-treff8-club-goa-tv','2023-10-06',NULL,'23:00:00',NULL,'<p>6 Октября Goa TV врывается в клуб Treff8 со своей фирменной вечеринкой!<br><br>Мы провожаем dj Cosmonaut в Гоа, и это будет его крайний сет перед отлетом, который точно нельзя пропустить.<br><br>Стильные ребята из Stereoporno порадуют свежачком, наш друг Samed специально прилетит из Екб, а Teo с Anna Sobol внесут горячую озорную перчинку на эту вечеринку. И это, конечно же, далеко не весь список того, что вас ждёт.<br>Однозначно, наш вайб вам понравится и вы уйдете по-настоящему счастливыми!</p>',1500,'',2,84,1,'https://moscow.qtickets.events/85445-goa-tv-at-treff8','',false,false,NULL,2,'2023-09-29 04:01:00','2023-10-17 21:19:36',NULL,'','0',18,49),
	 (2034,'ALGORITHM: ARKAIM','2023-09-30-kinky-rouge-algorithm-arkaim','2023-09-30',NULL,'23:45:00',NULL,'<p>Образуя электронный контур и вызывая цифровые звуки, команда переместилась в древний город параллельной вселенной.</p>',600,'',2,62,1,'https://moscow.qtickets.events/83497-300923-algorithm-arkaim','https://vk.com/algorithm_arkaim',false,false,NULL,2,'2023-09-29 04:06:44','2023-10-22 04:00:26',NULL,'','0',18,45),
	 (2035,'Vinyl Night','2023-09-30-kitaiskii-letcik-dzao-da-vinyl-night','2023-09-30',NULL,'23:30:00',NULL,'<p>Ночная вечеринка для всех ценителей рок-н-ролла!<br><br>Всю ночь - рок-хиты с виниловых пластинок, конкурсы с призами, танцы до утра!</p>',400,'',2,122,1,'https://moscow.qtickets.events/84666-vinyl-night-3009','https://vk.com/vinylnight3010',false,false,NULL,2,'2023-09-29 04:11:30','2023-10-12 07:45:33',NULL,'','0',18,26),
	 (2036,'MOSHPIT','2023-09-30-basnia-federaciia-etaz-90-moshpit','2023-09-30',NULL,'22:00:00',NULL,'<p>Ночной закрытый эксклюзивный ивент от творческого объединения MOSHPIT в бизнес центре Москва-сити, в уникальном пространстве на 90-м этаже. HIP-HOP музыка, живые выступления&nbsp;<br>Именитые диджеи Москвы отыграют будоражащие сознание сеты. VIP столы с официантами, стильные посетители и невероятные ощущения от музыки ждут вас!</p>',729,'',2,283,1,'https://moscow.qtickets.events/84901-moshpit','https://t.me/moshpitproject',false,false,NULL,2,'2023-09-29 04:17:49','2023-10-23 07:34:59',NULL,'','0',18,63),
	 (2037,'Очень Шумный Гиг','2023-09-30-smena-ocen-sumnyi-gig','2023-09-30',NULL,'19:00:00',NULL,'<p>Очень шумная туса в последний день сентября на втором этаже родного Таганского клуба.</p>',800,'',2,253,1,'https://moscow.qtickets.events/84389-ochen-shumnyy-gig-3009-smena-20','https://vk.com/loudgig',false,false,NULL,2,'2023-09-29 04:23:33','2023-10-23 15:59:05',NULL,'','0',18,36),
