	 (2067,'Udacha Label Night','2023-10-06-prostranstvo-pole-udacha-label-night','2023-10-06',NULL,'22:00:00',NULL,'<p>6 октября в пространстве Поле состоится ночь лейбла Udacha. Шевелить энергетические поля, расширять границы восприятия, менять местами время и пространство будут резиденты и ближайшие друзья лейбла:<br><br>22:00 • Максим Панфилов - диджей, коллекционер и музыкальный эрудит, в прошлом резидент легендарного клуба НИИ, за плечами которого множество самых разнообразных сетов, подготовит очередной сюрприз для наших ушей, душ и тел.<br><br>23:00 • Flaty - электронный музыкант, продюсер и аудиовизуальный художник из Москвы, резидент и A&amp;R лейбла ГОСТ звук, основатель лейбла ANWO Records, участник дуэта Serwed. Flaty внёс свой бриллиант в каталог Udacha пластинкой от Dada Ques и в этот раз сыграет редкий лайв сет из эмбиент -дроуна, спектральной музыки, декомпозиции хоралов, в том числе из неизданной и не исполнявшейся ранее музыки.<br><br>00:00 • Zdehvedo Gob - коллектив, состоящий из основателя Udacha Алексея А5, ребят из Gamayun и музыканта Ромы Шестаева, исполнит живой концерт со своими последними музыкальными находками и алхимическими импровизациями.<br><br>01:00 • Влад Добровольский - музыкант и звуковой маг, со множеством интереснейших релизов на различных российских и иностранных лейблах, участник дуэта САД. Каждый лайв сет Влада - настоящий Опыт, и в этот раз он доставит нас туда, где мы ещё не бывали.<br><br>02:00 • Keroz - музыкант, продюсер и художник из Королёва, участник коллективов Болшево трио, Jueno Muzak, Cattle Freq, основатель лейбла Музыка Болшево. В музыкальном мире владеет сверхспособностью слышать необъятное и обнимать невидимое. Городской вайб, березовая роща, хипхоп и джаз с ровной бочкой.<br><br>03:00 • P_sh - музыкант и художник, специалист по пограничным музыкальным состояниям и хранитель первозданной связи человека с Музыкой Мира, участник дуэта САД. Как диск-жокей Василий известен своей невероятной селекцией и сыграет виниловый сет, после которого можно будет только гадать было ли это сном или реальностью.<br><br>04:00 • Fita - соосновательница Udacha, DJ и художница, оформившая первые 12 релизов лейбла. Оксана вернёт нас обратно в наши тела танцами, танцами и ещё раз танцами.<br><br>05:00 • Стас Митрофанов - музыкант и диджей, участник проектов Gamayun и Zdehvedo Gob. Стас сыграет свою подборку из хауса/чикаго диско/техно.</p>',NULL,'600.0',2,46,1,'https://udachalabelnight.ticketscloud.org/','',false,false,NULL,2,'2023-10-04 17:00:32','2023-10-24 13:35:14',NULL,'','0',18,129),
	 (2039,'HARDCORE ORIGINS','2023-09-29-kinky-rouge-hardcore-origins','2023-09-29',NULL,'23:55:00',NULL,'<p>Время вернуться к истокам! За одну ночь мы совершим путешествие в далекие 90-ые. Вспомним, как звучал любимый стиль в самом начале своего пути и окунемся в атмосферу хардкор- и техно-рейвов того времени. Виниловые сеты, ранние и культовые релизы жанра, а также техно-стейдж, символизирующий тесную связь двух музыкальных направлений между собой.</p>',1050,'',2,62,1,'https://moscow.qtickets.events/82346-hardcore-origins','https://vk.com/hardcoreorigins',false,false,NULL,2,'2023-09-29 04:35:43','2023-10-24 05:43:20',NULL,'','0',18,82),
	 (2040,'Chacha’s Crew Loft Edition','2023-09-29-rpm-bar-chachas-crew-loft-edition','2023-09-29',NULL,'22:00:00',NULL,'<p>Мы скучали, и с большой радостью анонсируем нашу встречу! С наступлением нового клубного сезона по традиции собираем всех наших любимых друзей на первой веринке серии «Loft Edition» от нашей семьи Chacha’s Crew. Как и всегда мы приготовили для вас интересный лайн-ап, выбрали интересную локацию, где почувствуем себя снова свободными после рабочей неделе. Наши правила неизменимы. Приводи друзей, берите напитки и хорошее настроение, запасную обувь, и до встречи на танцполе!</p>',1500,'',2,284,1,'https://moscow.qtickets.events/85394-chachas-crew-loft-edition','https://t.me/chachascrewofficial',false,false,NULL,2,'2023-09-29 04:42:33','2023-10-11 04:39:21',NULL,'','0',18,37);
