	 (2041,'Зе Саунд Оф Факен Хэлл','2023-09-29-sklad-3-ze-saund-of-faken-xell','2023-09-29',NULL,'20:30:00',NULL,'<p>29 сентября на Складе номер 3 пройдет мини-фестиваль "Зе Саунд Оф Факен Хэлл". Выступят Hexe, "Резина", "Зачарованные", "Заговор против мужчин" и Teckel.<br><br>"Факен Хэлл" - репетиционная точка на Электрозаводе, облюбованная любителями постхардкора и всевозможных радикальных гитарных экспериментов. В разное время здесь репетировали Jars, Mad Pilot, Eeva, "Джуна" и много кто еще. Кузница нойз-рока и московская реинкарнация Amphetamine Reptile, "Факен Хэлл" достойна упоминания в летописях столичного андеграунда и собственного фестиваля.<br><br>Последнее и произойдет 29 сентября, а сыграют сегодняшние обитатели комнаты. Приходите, вас ждут чарующие гитарные звуки, которые каждый день пугают всех, кто оказался на шестом этаже Электрозавода.</p>',400,'',2,285,1,'https://moscow.qtickets.events/82482-ze-saund-of-faken-khell','',false,false,NULL,2,'2023-09-29 04:49:13','2023-10-11 06:49:34',NULL,'','0',18,36),
