	 (2044,'Drop Dealerz Rave','2023-11-11-zoccolo-20-drop-dealerz-rave','2023-11-11',NULL,'23:55:00',NULL,'<p>Скучали?... Drop Dealerz снова здесь! Мы возвращаемся, чтобы сокрушить осенние будни мощнейшей энергетикой любимой музыки! Новый эпизод Drop Dealerz Rave - новые имена в лайн апе</p>',500,'',1,72,1,'https://spb.qtickets.events/84286-drop-dealerz-rave-11112023-zoccolo-20','https://vk.com/dropdealerzrave_11_11',false,false,NULL,2,'2023-09-29 05:00:50','2023-10-25 16:13:58',NULL,'','0',18,69),
