	 (2046,'Five2smoke','2023-09-30-union-five2smoke','2023-09-30',NULL,'22:00:00',NULL,'<p>Субботнюю ночь проведем под бодрый танцевальный селект FIVE2SMOKE (https://instagram.com/five2smoke). Ребята снова собирают друзей под крышей Ю, чтобы уничтожить танцпол жирным басом и резвыми битами UKG, брейкбита, днб и прочего, заставляющего двигаться.&nbsp;</p>',NULL,'500.0',1,8,1,'','https://t.me/unionbarspb',false,false,NULL,2,'2023-09-29 05:18:39','2023-10-22 19:49:34',NULL,'','0',18,79),
