	 (2064,'Точка Сбора','2023-09-30-loft-metamorfoza-tocka-sbora','2023-09-30','2023-10-01','23:00:00','06:00:00','<p>ТОЧКА СБОРА</p><p>👋Друзья! 30.09.2023 приглашаем Вас погрузится в космическое путешествие ночных психоделических звуковых ритмов.&nbsp;</p><p>🔴Night Psy / 🌲Psy Forest music</p><p>🎶Line-Up</p><p>Cream Corp (Digital Dream rec.)</p><p>LaaToka (Sun Station rec.)</p><p>Artur Advaita (Genetic lab rec)</p><p>Бузина́ обыкновенная</p><p>Arkaim (Gabriel Family)</p><p>Buzza (Fractal Family)</p><p>💎Оформление сцены:</p><p>Evgeniy Zheton</p><p>👉Информация об участниках: https://arendalofta-spb.ru/tochkasbora</p><p><br></p>',500,'',1,87,1,'https://rupor.biz/widgets/event-tickets/881','',false,false,NULL,3,'2023-09-30 12:23:11','2023-10-21 19:20:57',NULL,'','0',18,93),
	 (2065,'Asia Expirience','2023-10-07-gazgolder-asia-expirience','2023-10-07','2023-10-08','22:00:00','12:00:00','<p>Чем обычная тусовка отличается от качественной вечеринки? Конечно, подготовкой! <br>Для своих старых и новых друзей команда <strong>Asia Experience</strong> готовится со всей душой, тщательно подбирая артистов, продумывая декорации и световое оформление.</p><p>Традиционно, line up разделится на два танцпола, соответственно музыкальным форматам.&nbsp;</p>',1500,'2000.0',2,35,1,'https://qtickets.ru/iframe?event_id=82764&host=www.asiaexperienceofficial.com&winclose=1','',false,false,NULL,2,'2023-10-04 16:23:38','2023-10-25 01:46:02',NULL,'','0',18,448),
	 (2068,'DAMN x BASEMENT','2023-10-06-griboedov-damn-x-basement','2023-10-06',NULL,'22:00:00','06:00:00','<p>Cерый сезон — не помеха. Вечеринка борцов с осенней хандрой и унынием — DAMN, совместно с резидентами клуба BASEMENT.</p>',NULL,'700.0',1,86,1,'','',false,false,NULL,2,'2023-10-04 17:58:40','2023-10-25 17:48:39',NULL,'','0',18,163),
	 (2069,'Friday w//','2023-10-06-mixed-friday-w','2023-10-06',NULL,'22:00:00',NULL,'<p>В пятницу в баре Mixed ожидаются диджеи с отличным вкусом и внушительными коллекциями винила.<br><br>Jax — отец вдохновитель и сооснователь культового магазина пластинок Washing Maschine.<br><br>Texture — идейный вдохновитель вечеринок Echo, представитель Washing Maschine и резидент творческого объединения Шабаш Грув.<br><br>ребята обещают поддержать осеннее настроение спокойной, вдумчивой и текстурной музыкой.<br><br></p>',NULL,'0.0',1,59,1,'','',false,false,NULL,2,'2023-10-05 00:42:22','2023-10-22 16:08:16',NULL,'','0',18,29),
	 (2070,'Boeing Party','2023-10-06-cult-boeing-party','2023-10-06',NULL,'23:00:00',NULL,'<p>В пятницу команда Boeing party приглашает всех на борт рейса, который проследует над западной культурой, и захватит русскую рэп сцену. Капитан этого корабля - Glocki52! Опытный пилот, знающий своё дело.<br><br></p>',NULL,'500.0',1,92,1,'','',false,false,NULL,2,'2023-10-05 00:49:51','2023-10-21 09:41:39',NULL,'','0',18,45),
	 (2071,'GLADIATORS','2023-11-03-roof-place-gladiators','2023-11-03',NULL,'23:00:00',NULL,'<p>3 ноября ЛенСмена возвращается в Roof Place с брендовым событием <br><strong>HARD/INDUSTRIAL techno — GLADIATORS II.</strong><br><br>Событие пройдет на двух тёплых танцполах пространства. Усиленный звук, формат boiler room, любимые резиденты, новые имена, приглашённые звёзды, индустриальные элементы в атмосфере комфортного кирпично-бетонного лофта. Тематика - Римская Империя, костюмы и образы приветствуются и поощряются, однако это по желанию. FC/DC, 18+.&nbsp;</p>',799,'',1,176,1,'https://t.me/lngrdsmena_bot','',false,false,NULL,2,'2023-10-05 01:09:40','2023-10-25 16:09:34',NULL,'','0',18,72),
	 (2072,'Popoff Kitchen XXL 6 Years B-day','2023-10-07-mutabor-popoff-kitchen-xxl-6-years-b-da','2023-10-07','2023-10-08','23:59:00','12:00:00','<p>Гостей Popoff Kitchen 7 октября ждет сладкий стол. Сцена Main станет главным угощением с двойной порцией артистов в формате b2b и монументальным кремовым слоем авторства SashaRTS. Откроют лайнап зефирки с ядреным перцем из объединения FEMS — Rimma Kim и Risha Rush. Продолжат шоколадные принцы с крепкими орешками из Resonance —&nbsp; DESTROY и Vlas Leskin. А закроют программу любимые трубочки с вытекающей сгущенкой Roma Ptashenko и Linnea. Впадаем в сахарную кому до рассвета!<br>Снимаем ваш легкий мандраж перед ответственным событием 7 октября. Чтобы попасть на день рождения Popoff Kitchen было проще и стоять в очереди с цветами и конфетами для именинника веселее, мы снова ввели билеты-тройнички за 3333 рублей. Главное правило — единовременный вход для всей компании.&nbsp;</p>',1500,'',2,2,1,'','',false,false,NULL,2,'2023-10-05 01:14:29','2023-10-24 20:49:36',65047973,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwYXJ0bmVyIjoiNjUwNDc1YWI5ZTczYzQxZjA3YTkwYjNhIn0.FFG3bksJ4LHJNA1idUIyj-TiAlcLaaRt1qE5Vjp0oJY','0',18,207),
	 (2073,'Кружок','2023-10-13-blank-kruzok','2023-10-13','2023-10-14','23:00:00','07:00:00','',NULL,'900.0',1,1,1,'https://blankclub.ru/','',false,false,NULL,2,'2023-10-05 01:25:25','2023-10-24 16:27:18',NULL,'','0',18,149),
	 (2074,'ОТКРОВЕНИЕ','2023-10-14-blank-otkrovenie','2023-10-14',NULL,'23:00:00',NULL,'<p>Красная нитка, продетая в ушко иглы, на которую мы, кажется, навеки подсели. Ведущая к истине? Ну узнаем. Техно — сквозной для серии событий «Откровение» механический шов. Им тут все вышито-перешито, связано-перевязано. Долбит в перепонки — балдеют тело и душа.<br><br>Два танцпола — мейн и раздевалка, где за ночь можно перепрошить себя полностью. Завязать дружбу с бессознательным: «Здравствуйте, у вас дома никого нет? Значит, я по адресу». Выпустить шипы и стать колючим, как эта колюще-режущая музыка, что исполосовала своими ритмами весь твой век. Помни, в пустыне выживают пейоты и койоты, поэтому поскорее признай адаптивную особенность, выпускай клыки или иголки.&nbsp;</p>',1000,'',1,1,1,'https://blankclub.ru/','https://vk.com/blankclub_spb',false,false,NULL,2,'2023-10-05 01:35:13','2023-10-25 15:06:01',NULL,'','0',18,168);
