	 (2077,'ODYSSEY Autumn Season Opening','2023-10-13-blanc-odyssey-autumn-season-opening','2023-10-13','2023-10-14','19:00:00','06:00:00','<p>Что это? Птица? Самолёт? Осенняя хандра? НЕТ! Это Odyssey Autumn Season Opening - продолжение наших кутежей во славу счастья, музыки и танцам!&nbsp;<br>Летний сезон был душевным и огненным, пришла пора готовиться к пляскам и возлияниям под более умеренную температуру на улице, но с не меньшим энтузиазмом!<br><br>13 октября в стенах Blanс и при поддержке затейников из Odyssey и Highway встречаем тьму и холод во всеоружии, не давая ни единого шанса тоске и прочим негативным вибрациям. Только танцы и любовь, только хардкор!&nbsp;<br>Дресс-код: листопад!&nbsp;<br>В полном образе - вход бесплатный.</p>',1000,'',2,36,1,'https://secret420.timepad.ru/event/2616531/','https://vk.com/wall-164356516_2630',false,false,NULL,2,'2023-10-05 02:14:27','2023-10-24 16:51:54',NULL,'','0',18,145),
	 (2078,'YOUNG BLOOD: Open deck','2023-10-07-griboedov-young-blood-open-deck','2023-10-07',NULL,'22:00:00',NULL,'<p>Не важно играете ли вы на каком то инструменте, используете микрофон для синтеза звука, драм-машину или же играете с сидюков; важно что вы тот, кто генерирует звуковую волну и получает от этого истинное удовольствие.<br><br>Присылайте нам свои сеты, музыку и все то, что вы считайте отображением вашего творчества в тг @bymomwithlove. Лучших из вас пригласим к нам на вечеринку.<br><br></p>',NULL,'500.0',1,86,1,'','',false,false,NULL,2,'2023-10-05 02:30:42','2023-10-24 16:35:26',NULL,'','0',18,75),
	 (2079,'House of Palm','2023-10-06-bar-strelka-house-of-palm','2023-10-06',NULL,'23:00:00',NULL,'<p>В пятницу в «Стрелке» — вечеринка House Of Palm под руководством арт-директора «Дома Культур» Саши Шульца, компанию которому составят резиденты серии Sanmix и Nachitanny.</p>',NULL,'0.0',2,103,1,'','https://t.me/strelkabarmoscow',false,false,NULL,2,'2023-10-05 02:59:56','2023-10-23 08:52:47',NULL,'','0',18,23),
	 (2080,'Суббота','2023-10-07-bar-strelka-subbota','2023-10-07',NULL,'23:00:00',NULL,'<p>В субботу за пультом диджейский тандем мечты: музыкант, резидент культурного центра «Поле» Полина Фаворская и один из наших любимых диджеев, исключительный селектор Денис Enfant.</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,2,'2023-10-05 03:03:02','2023-10-23 10:27:36',NULL,'','0',18,39),
	 (2081,'UNDEGROUND EXPERIENCE','2023-10-06-rndm-undeground-experience','2023-10-06',NULL,'23:59:00',NULL,'<p>Underground Experience в составе, Dj Слон и Даня Де Боа, едут в дружественный RNDM, пилить техно с пластов, поддержку им составят старые друзья и хорошие Дж, dj Нив и Антон Ушаков он же Тоникс.<br>&nbsp;Формат как всегда в рамках детройт, брайтон, СПб техно, вонки и небольшие вкрапления электро.</p>',500,'',2,27,1,'https://texpereriv.timepad.ru/event/2607134','https://t.me/rndmcIub',false,false,NULL,2,'2023-10-05 03:08:54','2023-10-20 01:40:32',NULL,'','0',18,29),
	 (2082,'RED SHEEP','2023-10-07-rndm-red-sheep','2023-10-07',NULL,'23:00:00',NULL,'<p>Хедлайнером вечеринки назначен Tøtal, диджей из Армении и основатель лейбла Death Bell Records. Он обрел локальную известность и дебютировал на Boiler Room Yerevan, сет с которого почти полностью состоял из его авторского продакшена.&nbsp;<br><br>Компанию ему составят приверженцы олдскульного звучания: наученный детройтскому саунду резидент Cherta Mitya Chesnokov, идейный вдохновитель владимирского комьюнити Hexagone chamber rave Ivan Mitz, Sergei Hromov, чью музыку вы не раз слышали в подкастах Resonance Moscow.&nbsp;<br>Stepan Borin будет ответственен за raw techno, а A.E или Александр Ершов, как сооснователь Red Sheep, погрузит эту ночь в пучину классического техно с приятно шуршащей примесью грува.&nbsp;</p>',800,'1000.0',2,27,1,'https://red-sheep.timepad.ru/event/2608776/','https://t.me/rndmcIub',false,false,NULL,2,'2023-10-05 03:13:36','2023-10-22 16:53:15',NULL,'','0',18,53),
	 (2083,'LOVANDA × РАДУГА: PANTERA','2023-10-07-blanc-lovanda-raduga-pantera','2023-10-07',NULL,'21:00:00',NULL,'<p>В конце этой недели у нашей любимой группы <a href="https://t.me/lovanda_music">Lovanda</a> выйдет новый альбом Pantera, и уже в субботу, 7 октября, ребята презентуют его на Радуге<br>Полный звёздных сюрпризов перформативный лайв по случаю релиза запланирован на начало вечера — не опаздывать! Ну а дальше классическое пати с шампунем и вениками<br>По дресскоду всё просто — одеваемся, как на фотке. И тусуемся также</p>',1500,'',2,36,1,'https://radugadiscoclub.ru/','',false,false,NULL,2,'2023-10-05 03:22:32','2023-10-22 18:47:51',NULL,'','0',18,70),
	 (2084,'NIKITA ZABELIN ∞ DREAM ALL NIGHT LONG','2023-10-07-prostranstvo-pole-nikita-zabelin-drea','2023-10-07',NULL,'21:00:00',NULL,'<p>Традиционный олл-найтер Никиты Забелина, который погрузит вас в его воспоминания. К многочасовому соло артиста на стыке жанров добавились выступления друзей и коллег, которые займут еще один танцпол «поля»</p>',1800,'',2,46,1,'','',false,false,NULL,2,'2023-10-05 03:27:48','2023-10-25 07:22:50',65098,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWZkOTU5YWZmZGNiZDZlZTY0NTJjZjczIn0.GeRgIuxoux5eUegSzCkEWmLeljBwf4hO9W4fGQPV01A','0',18,44),
	 (2085,'Wonderland - глава 20. M.O.S.','2023-10-14-cinist-wonderland-glava-20-mos','2023-10-14',NULL,'23:00:00',NULL,'<p>Это не просто вечеринка, это настоящее магическое приключение благодаря участию наших друзей – музыкального проекта <strong>M.O.S</strong>., чья магия звуков легко завораживает наши сердца. 14 октября музыканты создадут непередаваемую атмосферу в <strong>Wonderland</strong></p>',1200,'',1,94,1,'https://wonderland.ticketscloud.org/','',false,false,NULL,2,'2023-10-05 03:35:25','2023-10-22 00:11:01',NULL,'','0',18,107),
	 (2103,'пятница в Мишке','2023-10-06-miska-bar-piatnica-v-miske','2023-10-06',NULL,'21:00:00',NULL,'<p>Сегодня, 6 октября, в Mishke весь вечер и всю ночь играет Funky G.&nbsp;<br><br>Диско, хип-хоп, фанк и даже хаус. Винегрет из наших любимых жанров.<br><br>Можно танцевать, можно болтать с друзьями обо всем на свете, можно шазамить редкие треки, можно выпивать. Этот вечер сгодится для всего.<br><br></p>',NULL,'0.0',1,12,1,'','',false,false,NULL,3,'2023-10-06 21:35:04','2023-10-22 13:21:10',NULL,'','0',18,20);
INSERT INTO public.events (id,title,slug,start_date,end_date,start_time,end_time,description,price_from,price_gate,city_id,venue_id,event_type_id,tickets_url,info_url,is_cancelled,is_featured,deleted_at,user_id,created_at,updated_at,ticketscloud_event_id,ticketscloud_event_token,ticketscloud_event_multi,age_limit,"views") VALUES
	 (2088,'REBRN (Diynamic / Disco Halal)','2023-10-14-community-moscow-rebrn-crrct-view-z','2023-10-14',NULL,'21:00:00',NULL,'<p>Израильский музыкант, который за короткое время успел ворваться во все чарты и хит-парады электронной музыки.&nbsp;<br>Релизы на таких лейблах как Disco Halal от Moscoman, Realm от Gorgon City, Maccabi House от Adam Ten, Kinetika, Phisica, CRRCT VIEW и далее по списку самых актуальных и продаваемых, обратили на себя внимание и позволили ему получить поддержку от Solomun и выпустить релиз на легендарном Diynamic.<br><br>От Тель-Авива до Майами, география его выступлений ширится и вот наконец вы можете услышать его в Москве.&nbsp;</p>',1500,'',2,58,1,'https://rebrn.ticketscloud.org/','',false,false,NULL,2,'2023-10-05 04:03:23','2023-10-24 01:14:31',NULL,'','0',18,81),
	 (2089,'Reggae Media','2023-10-05-hops-mustache-reggae-media','2023-10-05','2023-10-05','20:00:00','23:00:00','<p>«Среда — это маленькая пятница, а четверг — это время для регги музыки.»<br><br>Команда Reggae.Media продолжает сезон виниловых регги четвергов в уютном HOPS MUSTACHE BAR / УСЫ НА ПЕНЕ. Reggae, dub, dancehall с виниловых пластинок и вкуснейшее крафтовое пиво.<br><br>Bолны позитива и хорошего настроения от мастеров</p>',NULL,'0.0',1,144,1,'','',false,false,NULL,2,'2023-10-05 15:57:00','2023-10-09 20:57:09',NULL,'','0',18,8),
	 (2090,'Deep Bass Therapy','2023-10-07-solaris-lab-deep-bass-therapy','2023-10-07',NULL,'19:30:00',NULL,'<p>Наступила настоящая осень, и резко захотелось тепла и дружеского вайба!&nbsp;<br>Поэтому в эту субботу 7 октября мы вместе будем погружаться в осень под звуки глубокого баса в пространстве Solaris lab.&nbsp;<br><br>Бас и бит лечит, согревает и объединяет.<br>Теплый вайб, дружеские объятия и вкусные согревающие напитки.<br>Вход: Donation @ekzatikin (куда отправлять - писать Никите)&nbsp;<br>Donation для нас - это способ узнать, что мы делаем что-то ценное для вас и вдохновиться продолжать</p>',200,'',1,106,1,'https://t.me/Ekzatikin','',false,false,NULL,2,'2023-10-05 16:03:17','2023-10-13 22:26:03',NULL,'','0',18,59),
	 (2091,'Session vol.3','2023-10-06-secrets-session-vol3','2023-10-06',NULL,'23:00:00',NULL,'',NULL,'0.0',1,147,1,'','',false,false,NULL,2,'2023-10-06 01:03:13','2023-10-11 00:16:33',NULL,'','0',18,20),
	 (2092,'VTUSSE','2023-10-07-miraz-vtusse','2023-10-07',NULL,'23:00:00',NULL,'<p>Итак, в субботу команда VTUSSE решила громко отвиснуть в Miragebar.&nbsp;<br>Хедлайнером этих плясок запланирован SP4K, который выступит с мощным электронным диджей-сетом, который будет включать себя ремиксы из его последнего альбома «Сверхзадача» !&nbsp;<br>Билеты на входе -<br>600₽ до 1:00 / 800₽ после</p>',600,'800.0',1,77,1,'','https://t.me/youvtusse',false,false,NULL,2,'2023-10-06 01:08:59','2023-10-24 16:35:26',NULL,'','0',18,97),
	 (2093,'Warehouse','2023-10-06-propaganda-warehouse','2023-10-06',NULL,'22:00:00',NULL,'<p>Продолжаем открывать новые имена. В этот раз это Melevis – диджей и продюсер, отдающий предпочтение быстрому и хлесткому берлинскому техно.&nbsp;</p>',NULL,'0.0',2,101,1,'','https://t.me/propagandamoscow',false,false,NULL,2,'2023-10-06 15:29:53','2023-10-22 08:11:59',NULL,'','0',18,26),
	 (2094,'Club Night','2023-10-07-propaganda-club-night','2023-10-07',NULL,'22:00:00',NULL,'<p>Суббота олицетворяет смешение стилей современной танцевальной музыки с участием лучших диджеев столицы.</p>',NULL,'0.0',2,101,1,'','https://t.me/propagandamoscow',false,false,NULL,2,'2023-10-06 15:34:36','2023-10-20 17:26:08',NULL,'','0',18,52),
	 (2095,'China Town','2023-10-08-propaganda-china-town','2023-10-08',NULL,'23:00:00',NULL,'<p>В заключение недели, танцуем с хорошо известными резидентами вечеринки.</p>',NULL,'0.0',2,101,1,'','',false,false,NULL,2,'2023-10-06 15:37:48','2023-10-23 11:45:09',NULL,'','0',18,58),
	 (2096,'Пятница','2023-10-06-stirka40-piatnica','2023-10-06',NULL,NULL,NULL,'<p>Kon''nichiwa!<br>Honjitsu 10 tsuki 6-nichi kin''yōbi, randorīrūmude wa&nbsp;<br>21: 00 Kara DJ Zh ga,&nbsp;<br>23: 00 Kara Messer ga purei shimasu.&nbsp;<br>Bā `dima to Asha'' nite<br>Arigatō</p>',NULL,'0.0',1,14,1,'','http://vk.com/stirka40',false,false,NULL,2,'2023-10-06 15:42:16','2023-10-11 00:16:33',NULL,'','0',18,28),
	 (2098,'FRIDAY','2023-10-06-kiki-friday','2023-10-06',NULL,'19:00:00',NULL,'<p>собакам можно с ноутбуком</p>',NULL,'0.0',1,54,1,'','https://t.me/kikikiiix',false,false,NULL,2,'2023-10-06 16:33:33','2023-10-11 18:27:26',NULL,'','0',18,37);
