	 (2099,' Spazio ','2023-10-06-union-spazio','2023-10-06',NULL,'22:00:00',NULL,'<p>Сегодня — прямая и ломаная танцевальная музыка от друзей и резидентов креативной формации Spazio&nbsp; Интергалактический лайв Konerytmi&nbsp; и бодрящие сеты Moonoton , Pachino и Denis Kazakov.&nbsp;</p>',NULL,'500.0',1,8,1,'','',false,false,NULL,3,'2023-10-06 21:27:27','2023-10-11 04:15:03',NULL,'','0',18,36),
	 (2100,'пятница в Miragbar','2023-10-06-miraz-piatnica-v-miragbar','2023-10-06',NULL,'23:00:00',NULL,'<p>теперь можно официально выебываться, что наши диджеи собирают стадионы ( привет миш ), но ночью в пятницу там ловить нечего, так что собираемся у нас<br><br>практически золотой состав за пультом: seeyay,&nbsp; 5dm,&nbsp; vibe masta,&nbsp; tokyo,&nbsp; aver&nbsp;<br><br>фотографирует наш новый боец @yianaa&nbsp;</p>',NULL,'0.0',1,77,1,'','',false,false,NULL,3,'2023-10-06 21:29:57','2023-10-11 00:16:48',NULL,'','0',18,19),
	 (2128,'Triori Records','2023-10-14-gazgolder-triori-records','2023-10-14',NULL,'22:00:00',NULL,'<p>Тусовка лейбла Triori Records на двух танцполов «Газгольдера» для всех любителей погружающей танцевальной электроники. В лайнапе отметятся резиденты и друзья импринта.</p>',1200,'',2,35,1,'https://moscow.qtickets.events/86510-triori-records-label-night-at-gazgolder','',false,false,NULL,2,'2023-10-11 17:44:23','2023-10-22 11:11:35',NULL,'','0',18,50),
	 (2101,'МЕЖДУНАРОДНЫЙ ТАНЦЕВАЛЬНЫЙ РУССКИЙ ВОЛЖСКИЙ ХВАТ В СТИЛЕ ДИСКО','2023-10-06-ritmy-mezdunarodnyi-tancevalnyi-russki','2023-10-06',NULL,'22:00:00',NULL,'<p>Ура! Этот день настал! Мы тренировались всю неделю в дисциплине «прыжки под инстасамку до потолка», сегодня будем показывать мастер-класс!<br><br>Помимо мэшап бэннеров и ядовитых хитов сегодня будет и хаус и диско! Дайтона уже в костюме, а мы без!&nbsp;<br><br>Атос прилетел из Самары, так что воложане, вам быть стоочково!<br><br>22:00 — 23:00 ГРИНЬКО<br>23:00 — 00:00 ДАЙТОНА<br>00:00 — 01:00 ЕГОРОВ<br>01:00 — 02:00 АТОС<br>02:00 — 04:00 ЯВГЕТ + РОМАНОВ<br><br></p>',NULL,'0.0',1,181,1,'','',false,false,NULL,3,'2023-10-06 21:31:54','2023-10-22 12:00:39',NULL,'','0',18,24),
	 (2102,'пятница в Матиссе','2023-10-06-restobar-matiss-piatnica-v-matisse','2023-10-06',NULL,'20:00:00',NULL,'<p>6.10 - Пятница, 20:00:&nbsp;<br>Primat, 3rd Form<br>(house, jackin, classic)<br><br></p>',NULL,'0.0',1,159,1,'','',false,false,NULL,3,'2023-10-06 21:33:29','2023-10-17 11:54:24',NULL,'','0',18,16),
	 (2104,' «VINYL DRUMROOM»','2023-10-06-hops-mustache-vinyl-drumroom','2023-10-06',NULL,'20:00:00',NULL,'<p>06.10.23&nbsp;<br>В УСАХ НА ПЕНЕ «VINYL DRUMROOM»&nbsp;&nbsp;<br>Море Крафтового под добрый DnB, Jungle, Dub Step!<br><br>Ответственные за ломаные ритмы:&nbsp; &nbsp;<br>M.DOG<br>INV<br>ALEX Y<br>PR-ICE<br>And friends…<br><br></p>',NULL,'0.0',1,144,1,'','',false,false,NULL,3,'2023-10-06 21:36:55','2023-10-22 06:30:23',NULL,'','0',18,17),
	 (2105,'Charity Dance','2023-10-06-pticia-licnost-charity-dance','2023-10-06',NULL,'23:30:00',NULL,'<p>Благотворительная дискотека!<br>Где: в баре Птичья Личность&nbsp;<br>Когда: ночь с 6 на 7 октября&nbsp;<br>Зачем: отдохнуть, тяпнуть крафтового пивка или настоек, потанцевать и собрать денег в пользу "Ночлежки"<br>Кто играет: самые классные и любимые диджеи петербургских тусовок&nbsp;<br>Билеты: исключительно на входе, 100 процентов билетов идут "Ночлежке". Оплата по куаркоду либо наличными в копилку, сдачи не будет, так как копилка закрыта на замочек.<br>Дресс-код: блестящее, безумное, нарядное</p>',NULL,'200.0',1,4,1,'','',false,false,NULL,3,'2023-10-06 21:40:11','2023-10-11 00:16:50',NULL,'','0',18,21),
	 (2106,'Добро','2023-10-07-union-dobro','2023-10-07',NULL,'23:00:00',NULL,'<p>В субботу готовимся просочиться сквозь тёмные переулки противоречий, чтобы обнажить душу перед музыкой, исследовать грандиозную палитру звуков и с ними объять горизонты Добра (https://t.me/dobrovinyl). Наши сердца объединяться в неразрывную гармонию, которая откроет портал в мир красоты, доброго хауса и нью-диско.<br><br>Будем принимать в гостях Stogov (https://instagram.com/dmitriy_stogov) из Великого Новгорода, везущего с собой свежий релиз “World Colour”, попавший во все топы в разделе Deep House, отмечать выход супервеселого EP Nikita Buch (https://instagram.com/nikitabuch) на лейбле Добро и беззаботно сливаться с осенним воздухом в компании Buzz Compass (https://instagram.com/buzzcompass), Juravlove (https://instagram.com/juravlove), Hoopa (https://instagram.com/apoohoopa), Anton Mo (https://instagram.com/antonmo).</p>',NULL,'500.0',1,8,1,'','',false,false,NULL,3,'2023-10-07 18:59:34','2023-10-22 04:54:18',NULL,'','0',18,76),
	 (2107,'saturday w//','2023-10-07-mixed-saturday-w','2023-10-07',NULL,'22:00:00',NULL,'<p>в субботу принимаем любителей винила и приверженцев доброго звучания.<br><br>Buren’ — самые хаусовые усы Питера, диджей и друг нашего бара, треть творческого объединения Шабаш Грув. предпочитает многогранный хаус от «задуматься в супермаркете» до «несемся, сделаем погромче».<br><br>поддержит его Misha Illeish — новое имя на сцене Петербурга. диджей, музыкант родом из Тольятти.<br><br>saturday w//<br>&nbsp;<br>Buren’<br>Misha Illeish<br><br></p>',NULL,'0.0',1,59,1,'','',false,false,NULL,3,'2023-10-07 19:01:55','2023-10-24 18:59:04',NULL,'','0',18,84),
	 (2108,'KOROBKA VINYLA MOVING PARTY','2023-10-07-macty-korobka-vinyla-moving-party','2023-10-07',NULL,'21:00:00',NULL,'<p>Рады наконец-то позвать вас на вечеринку в честь переезда наших друзей из магазина Коробка винила. (https://vk.com/korobka_vinyla) Будем танцевать, общаться, дарить подарки и праздновать переезд все вместе!<br><br>В программе сеты на виниле от всей нашей команды, а также розыгрыш 3 сертификатов в магазин (на 5к, 3к и 1к) и депозита в баре Мачты!<br><br></p>',NULL,'0.0',1,9,1,'','',false,false,NULL,3,'2023-10-07 19:06:15','2023-10-22 18:27:40',NULL,'','0',18,47);
