	 (2109,'SSTRICTLY ROOTS ','2023-10-07-suba-bar-sstrictly-roots','2023-10-07',NULL,'22:00:00',NULL,'<p>В субботу на сцене Шуба бар будет играть создатель информационного сообщества @reggaemedia весьма известного на просторах интернета, и площадок в Санкт Петербурге, а так же за его пределами.&nbsp;<br>Имя ему - Tippa Mult<br>Для нас отыграет 4-часовой сет в стилистике disco, soul, и конечно же reggae. Настраиваем свои нервные окончания на позитивный вайб, и получаем удовольствие.</p>',NULL,'0.0',1,205,1,'','',false,false,NULL,3,'2023-10-07 19:11:14','2023-10-13 22:26:02',NULL,'','0',18,39),
