	 (2111,'SOMETHING SPECIAL','2023-10-07-hops-mustache-something-special','2023-10-07',NULL,'21:00:00',NULL,'<p>Хаус, техно, инди, дип и фанки брейкс в одном бокале любимого крафта!<br><br>За вертушками будут миксовать:<br>BORJA ROMANOV&nbsp;<br>ALEX MAYTHEM&nbsp;<br>ROMA PRICE<br>… and friends ….</p>',NULL,'0.0',1,144,1,'','',false,false,NULL,3,'2023-10-07 19:14:08','2023-10-13 22:26:03',NULL,'','0',18,32),
