	 (2112,'Redroom Redness','2023-10-07-pticia-licnost-redroom-redness','2023-10-07',NULL,'18:00:00',NULL,'<p>Подошел к концу лесной сезон и впереди посиделки-поплясалки<br>в клубах и барах.<br>Ну и начнем мы с милого местечка в центре города на<br>улице Рубинштейна 28д ,<br>7 октября с 18 вечера до 06 утра<br>а там как пойдет!)<br>Мы решили погулявши<br>по лесам и так как<br>вся команда<br>давно не собиралась вместе,<br>устроить субботний<br>Техно-Хаус сейшен<br>и позвать гостей,<br>как в старые добрые!<br>Спокойно послушать,<br>пообщаться и поплясать.<br>Ламповое место-ламповая туса!!!<br>Ждем дорогие наши в гости вас!!! подробности тут и тг!<br><br>Line Up:<br><br>18-00 | @pru2f (DeepMinimal)<br>19-00 | @Dmitriy_Tselitskiy&nbsp; (MelodicMinimal)<br>20-00 | @andreiwhite4939&nbsp; (IntelegentEthnoMinimal)<br>21-00 | @bornspb (DeepHypnoticMinimal)<br>22-00 | @alak_mech (HiTechProgressiveCosmic)<br>23-00 | @RavUniverse (CosmicMelodicPeakTime)<br>00-00 | @roderia_music (HiTechOrganicProgressive)<br>01-00 | @Alex_Kniga (DeepHypnoticRaw)<br>02-00 | @XayZz78 (DeepPeakTimeAcid)<br>03-00 | @idonotregret (MelodicPeakTimeHard)<br>04-00 | @magingeorgi (DeepDarkHardHypnotic)<br>05-00 | @der_brut (DarkAcidHypnotic)<br>06-00 | одеяло и подушки или автопатя?)<br><br></p>',NULL,'500.0',1,4,1,'','',false,false,NULL,3,'2023-10-07 19:17:56','2023-10-17 00:42:22',NULL,'','0',18,51),
	 (2113,'суббота в Стирке 40','2023-10-07-stirka40-subbota-v-stirke-40','2023-10-07',NULL,'22:00:00',NULL,'<p>Помните были такие блестящие серебристые кружочки, компакт-диски?<br>Так вот до них, еще во времена первого альбома Mr.Oizo, были компакт-кассеты, с которых сегодня и будут играть greenartist, Hoopa, WTN и Антон Крамбл!<br>Музыка разная, хорошая.<br><br>В баре Дима и Асяя<br>приходите и приносите карандаши, на случай если перемотка опять работать не будет<br><br>UPD: По поступившей только что информации Хупа и Крамбл таки будут играть с флешек до 00:00, а потом метро закроется и начнется музыка с кассет</p>',NULL,'0.0',1,14,1,'','',false,false,NULL,3,'2023-10-07 19:19:55','2023-10-13 12:40:47',NULL,'','0',18,53),
	 (2114,'суббота в Мишке','2023-10-07-miska-bar-subbota-v-miske','2023-10-07',NULL,'21:00:00',NULL,'<p>Сегодня, 7 октября, в Mishke играют gandyglu и Саша Шонин.<br><br>Песни, которые хочется слушать, и песни, под которые хочется танцевать. Диско, хаус, фанк. Делайте, что хотите, только не скучайте.<br><br></p>',NULL,'0.0',1,12,1,'','',false,false,NULL,3,'2023-10-07 19:21:13','2023-10-13 15:35:03',NULL,'','0',18,36),
