	 (2117,'Nuclear Session','2023-10-13-griboedov-nuclear-session','2023-10-13',NULL,'23:55:00',NULL,'<p>Доброго дня, наши атомные гости!<br><br>Как вы уже догадались, в пятницу, 13 октября мы вновь собираемся в клубе "Грибоедов" (https://vk.com/gribi4), чтобы поднять радиационный фон в северной столице ☢️<br>Наши частицы настроены на тотальный разнос танцпола и зарядку ядерной энергией каждого гостя !!<br>Дозиметры не понадобятся, уверяем вас - облучение будет максимальным <br><br>Вход в зараженную зону - 500р<br>С репостом <a href="https://vk.com/nuclear_session_2?w=wall-222744774_1">поста в ВК</a>&nbsp; - 300р<br>Вступайте в ряды облученных и следите за информацией в наших соц сетях<br><a href="https://t.me/+CKean_tfIiU0MDAy">Телеграм канал </a><br> <a href="https://t.me/+G6pYh4MFVdswZThi">Телеграм чат </a><br> <a href="https://vk.com/atomgrad.underground">Группа ВК</a><br> <a href="https://vk.com/nuclear_session_2">Группа мероприятия ВК</a> &nbsp;</p>',300,'500.0',1,86,1,'','https://vk.com/nuclear_session_2?w=wall-222744774_1',false,false,NULL,2,'2023-10-11 15:25:51','2023-10-22 13:40:32',NULL,'','0',18,59);
INSERT INTO public.events (id,title,slug,start_date,end_date,start_time,end_time,description,price_from,price_gate,city_id,venue_id,event_type_id,tickets_url,info_url,is_cancelled,is_featured,deleted_at,user_id,created_at,updated_at,ticketscloud_event_id,ticketscloud_event_token,ticketscloud_event_multi,age_limit,"views") VALUES
	 (2118,'NEWSCHOOLRAVERS x МОСОБЛЭЛЕКТРО','2023-10-13-griboedov-newschoolravers-x-mosoblelekt','2023-10-13','2023-10-14','22:00:00','06:00:00','<p>Пятница 13 ознаменуется вечеринкой сразу трех творческих формирований!</p><p>К нам едут ребята из МОСОБЛЭЛЕКТРО — образовавшееся в 2021 году творческое объединение, которое переросло в независимый лейбл весной 2022 года. Громкий прием устраивает команда NEWSCHOOLRAVERS — Питерская промо группа, в которой ребята приносят в клубную культуру свое, аутентичное звучание. Творческое объединения BASEMENT, дополнит картину свежим звуком и гостеприимной атмосферой.</p>',NULL,'1000.0',1,86,1,'','',false,false,NULL,2,'2023-10-11 15:32:56','2023-10-24 16:06:55',NULL,'','0',18,85),
	 (2130,'QUINTESSENCE','2023-10-20-rndm-quintessence','2023-10-20','2023-10-21','22:00:00','08:00:00','<p>Финальная вечеринка Quintessence в уходящем году приурочена к празднованию дня рождения Димы Гаспарова, в связи с чем собираемся в родной гавани большой тусовкой и закипаем по классике. На этом лирическая часть заканчивается и начинается фактическая.<br><br>За праздничную музыкальную программу отвечают: Anastasia Zems прямиком из Португалии, связующее звено резидентов Popoff Kitchen в лице Amal и Moonoton, смотритель Рандома — Wellew, брянская мощь Lvrin из Arma17, ну и конечно, сам виновник торжества Dmitry Gasparov.<br><br>Вход:<br><br>22:00—00:00 бесплатный по регистрации.<br>00:00—08:00 по билетам.</p>',0,'',2,27,1,'https://quintessence.ticketscloud.org','',false,false,NULL,2,'2023-10-11 18:09:31','2023-10-24 12:33:15',NULL,'','0',18,96),
	 (2119,'ÇAVA Noir Kiss','2023-10-28-otel-akyan-cava-noir-kiss','2023-10-28',NULL,'21:00:00',NULL,'<p>ÇAVA Noir Kiss — слишком интересная история. Рассказывать её только на одном танцполе было бы пошло. А мы в таком — не замечены 🖤<br><br>Поэтому вот вам целый ménage à trois из танцполов:<br><br>&nbsp;Первый… он первый. Этим всё сказано. Здесь всё, что мы с вами расслышим даже в тумане. Всё чему подпоём и подтанцуем, особенно после игристого, двух, трёх, коктейля, шота…<br><br>&nbsp;Следующий — расположится прямо в строящемся бассейне будущего SPA отеля AKYAN. Мы обозначили его литерой Ж, но это не значит, что мы не можем представить себе голого мужчину в ванной. Можем. Некоторые из нас являются таким мужчиной прямо сейчас. Впрочем, как нетрудно догадаться, ставить музыку на танцполе Ж будут исключительно девушки.<br><br>&nbsp;Третий — в зеркальном фитнес-зале отеля. Он называется М. Где, как не там — поигрывать мускулатурой? Здесь перед вами во всей красе предстанут персонажи мужественного лайнапа.<br><br>Свои двери откроют комнаты музыки и гедонизма, наполненные чистым звуком, эстетикой и барами. Куда же без них?<br><br>Лайнапы&nbsp; ÇAVA Noir Kiss — на афишах. Уверены, многие имена вам знакомы. А значит вы можете быть уверены, что музыка добавит всем нам флюидов, нуарного вайба, желания двигаться, а значит — жить.<br><br>До встречи в AKYAN. Знали бы вы, сколько раз мы уже ломали грифель карандаша, которым вычёркиваем дни до старта.<br><br>P.S. Кажется, несколько билетов ещё остаются в продаже. Бережём их для тебя.<br><br></p>',1500,'',1,90,1,'','http://cavadisco.com/',false,false,NULL,2,'2023-10-11 15:43:28','2023-10-25 18:25:40',650820,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwYXJ0bmVyIjoiNjQyMThkZDZhNTE0ZDZkNzA0MGMwNDZjIn0.A7S7X0qg96dScJrgVvFKdf1EXRjt8wQ82I8Y_q-3r14','0',18,136),
	 (2120,'5/8 Radio Night','2023-10-13-bar-strelka-58-radio-night','2023-10-13',NULL,'23:00:00',NULL,'<p>В пятницу в «Стрелке» — шоукейс главной музыкальной интернет-радиостанции столицы, радио 5/8. За пультом — основатель станции Дима Сафронов и популярный блогер Саша Шулико.</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,2,'2023-10-11 15:52:15','2023-10-22 19:44:12',NULL,'','0',18,17),
	 (2121,'ДВД','2023-10-13-powerhouse-dvd','2023-10-13',NULL,'23:00:00',NULL,'<p>Новая встреча клуба любителей перевернутых предметов, неспокойной музыки и двух танцполов под названием "Дом Вверх Дном" состоится уже в ближайшую пятницу.&nbsp;<br><br>Save the date.</p>',100,'',2,5,1,'','https://t.me/powerhousemoscow',false,false,NULL,2,'2023-10-11 15:55:22','2023-10-23 02:38:51',NULL,'','0',18,34),
	 (2157,'Friday 13','2023-10-13-cult-friday-13','2023-10-13',NULL,'23:00:00',NULL,'<p>мы не верим в приметы, мы исповедуем качественную музыку — приходи, проверишь&nbsp;</p>',NULL,'500.0',1,92,1,'','',false,false,NULL,2,'2023-10-13 03:18:50','2023-10-18 03:18:21',NULL,'','0',18,44),
	 (2122,'CLUB NIGHT','2023-10-13-gazgolder-club-night','2023-10-13','2023-10-14','22:00:00','09:00:00','<p>Фирменная домашняя тусовка на утепленной террасе клуба «Газгольдер». Мейн на одну ночь превратится в кинотеатр, где будут крутить классику кино,&nbsp;</p>',1000,'',2,35,1,'https://gazgolderclub.ru/#clubnight','',false,false,NULL,2,'2023-10-11 16:00:17','2023-10-24 23:22:12',NULL,'','0',18,76),
	 (2123,'SIMACHEV X RESONANCE','2023-10-13-bar-simach-v-nedalnem-simachev-x-reson','2023-10-13',NULL,'23:00:00',NULL,'<p>Вновь Resonance захватит богемные интерьеры особняка на Тверском. Дебоширить на мейне второго этажа будет маэстро грува Nikita Zabelin и Mark Griboedov из дуэта Yung Acid, а за спиди-электро и бойкий ломаный саунд в ответе DESTROY и Julia Karma.<br><br>Потёмки второго этажа разбавит светлая электроника на первом. Троица Vouie Lega, Vasya Saiko и наш друг из Ирана Reza Faryadi наполнят его интеллектуальной электроникой и позитивным хаусом с винила.<br><br></p>',NULL,'0.0',2,104,1,'','',false,false,NULL,2,'2023-10-11 16:44:50','2023-10-23 19:21:22',NULL,'','0',18,37),
	 (2124,'CLUB NIGHT','2023-10-13-rndm-club-night','2023-10-13',NULL,'23:00:00',NULL,'<p>Одним из главных событий вечера станет появление Sexstasy - хранителя фешенебельного лоска и любимца публики, а также атмосферный лайв Жени Sestrica, в котором прозвучит материал из нового альбома.&nbsp;<br><br>Но это еще не все! Вас ждёт эксклюзивные диджей сет от Марии CPSL - представительницы дружественной формации “Resonance” и выступления резидентов клуба, Rayme и Wellew, со своим фирменным саундом.</p>',800,'',2,27,1,'https://rndm.ticketscloud.org/','',false,false,NULL,2,'2023-10-11 17:02:49','2023-10-25 16:29:12',NULL,'','0',18,158),
	 (2125,'Hard Thursday','2023-10-12-zoccolo-20-hard-thursday','2023-10-12',NULL,'19:00:00',NULL,'<p>Наступила осень. На улице уже не так тепло и жарко, как, например, было в скейтпарке. Но радовать годным музлом и бешенным настроением мы не перестанем. Команда RAVERHEAD&nbsp; влетает со своим шоукейсом в Тяжелые Четверги! Настрой команды - дарить тепло и раздавать #hardcore в стенах Zoccolо 2.0!</p>',NULL,'0.0',1,72,1,'','https://linktr.ee/RAVERHEAD',false,false,NULL,2,'2023-10-11 17:07:49','2023-10-22 04:15:09',NULL,'','0',18,16);
