	 (2126,'HYPNOTICA','2023-10-13-yauza-hypnotica','2023-10-13','2023-10-14','18:00:00','06:00:00','<p>Мир, любовь и музыка — основа и фундаментальные составляющие наших мероприятий. Особое внимание тут уделяется в первую очередь людям, сформировавшим дружное сообщество, которые и создают особую атмосферу, пропитанную душевностью и теплом. 13 октября состоится еще одна вечеринка Hypnotica в пространстве Yauza, посвященная празднованию дня рождения Лоренсии.&nbsp;<br><br></p>',1000,'',2,32,1,'https://hypnoticaxyauza.ticketscloud.org/','',false,false,NULL,2,'2023-10-11 17:16:59','2023-10-22 12:17:26',NULL,'','0',18,34),
	 (2127,'Excellent','2023-10-14-bar-strelka-excellent','2023-10-14',NULL,'23:00:00',NULL,'<p>В субботу в «Стрелке» пройдет вечеринка Excellent. Всю ночь за пультом: звезда диджейской сцены Кыргызстана Gaz Preston, коллекционер буги и фанка Артем Челбаев, а также идейный вдохновитель тусовки Baster Jazzster.</p>',NULL,'0.0',2,103,1,'','https://t.me/strelkabarmoscow',false,false,NULL,2,'2023-10-11 17:24:42','2023-10-23 22:40:21',NULL,'','0',18,56),
	 (2131,'INVIDERS','2023-10-21-rndm-inviders','2023-10-21',NULL,'23:00:00',NULL,'',600,'',2,27,1,'https://bit.ly/3F5qFFG','',false,false,NULL,2,'2023-10-11 18:12:43','2023-10-24 01:54:09',NULL,'','0',18,60),
	 (2132,'A Casa','2023-10-14-powerhouse-a-casa','2023-10-14',NULL,'23:00:00',NULL,'<p>Бонджорно, празднующие!&nbsp;<br><br>Это не просто вечеринка, а день рождение самой яркой звёздочки и идеолога A Casa - Юли Конор.&nbsp;<br>Праздник пройдёт в стенах родного домика Powerhouse, но это еще не все. Доставайте не просто наряды, а самые настоящие вечерние туалеты.<br>Потому что вас ждёт Бал! Когда еще предоставится случай надеть «то самое платье»?&nbsp;<br><br>Этой ночью вас ждёт не только потрясающая музыка от друзей именинницы, но и культурная программа - выставка, которую готовит Мурад, а также полный отвал бошки от красоты и нарядов вокруг.</p>',100,'',2,5,1,'','',false,false,NULL,2,'2023-10-11 18:17:15','2023-10-20 05:43:03',NULL,'','0',18,51),
	 (2133,'Пятилетие Bankside 18','2023-10-14-prostranstvo-pole-piatiletie-bankside-18','2023-10-14',NULL,'23:00:00',NULL,'<p>Ciao! &nbsp;<br>На следующую субботу ничего не планируйте — мы с командой Bankside все уже спланировали за вас<br><br>14 октября промо-группировке исполнится 5 лет! Bankside известны своими зарубежными привозами и пятилетие не исключение. В этот раз главным гостем станет Saverio Celestrio — диджей, продюсер и друг лейбла из страны бесконечных макаронин, вулканов и солнца. Отсюда и ciao! А к итальянцу Saverio присоединятся друзья группировки<br><br>Билеты только на входе и будут стоить 1000 рублей</p>',NULL,'1000.0',2,46,1,'','https://t.me/eto_polye',false,false,NULL,2,'2023-10-11 18:22:16','2023-10-22 23:26:50',NULL,'','0',18,43),
	 (2134,'Why Not Party','2023-10-14-milky-way-why-not-party','2023-10-14','2023-10-15','22:00:00','06:00:00','<p>Приглашаем погрузиться в завораживающее световое шоу и позволить музыке перенести вас в другое измерение.<br><br>Вас ждет разноформатная качественная электронная музыка, live - выступление, танцевальное шоу.&nbsp;<br><br>Создай образ и удиви нас нарядом. Самые креативные будут вознаграждены</p>',800,'1000.0',1,286,1,'','',false,false,NULL,2,'2023-10-13 01:28:16','2023-10-22 07:59:40',NULL,'','0',18,51),
	 (2135,'SERIAL','2023-10-28-music-hall-serial','2023-10-28',NULL,'22:00:00',NULL,'<p>Второй эпизод, музыкального сериала от легендарного Music Hall, пройдёт на борту не менее легендарного Летучего Голландца.&nbsp;</p><p>В последнюю субботу октября он станет ковчегом, несущим энергию света сквозь тьму ночи, собрав под своими парусами сильных, творческих личностей, воплощающих красоту в мире музыки и искусства, где нет места злу и коварству.</p><p>Дресс-код: яркие, светлые и сияющие образы, добрые волшебники и сказочные герои, интеллигентная сексуальность. Чертям здесь не место, так что никаких мрачных нарядов и темных оттенков.<br><br>Да прибудет с вами сила света!</p>',1500,'',1,287,1,'https://music-hall-production.timepad.ru/event/2619269/','',false,false,NULL,2,'2023-10-13 01:35:42','2023-10-25 16:21:34',NULL,'','0',18,64),
	 (2136,'EUROTRIP','2023-10-20-griboedov-eurotrip','2023-10-20',NULL,'23:00:00',NULL,'<p>Пристегнитесь ! Мы анонсируем долгожданное электронно-музыкальное турне по всей Европе, вместе с Eurotrip<br><br>Три сцены, 40 Артистов! Это уже больше чем вечеринка — это фестиваль электронной музыки в самом сердце Петербурга&nbsp;<br><br>Have a nice trip</p>',500,'1000.0',1,86,1,'https://euro-trip.ticketscloud.org/','',false,false,NULL,2,'2023-10-13 01:40:58','2023-10-24 08:14:41',NULL,'','0',18,258),
	 (2137,'GONGGY','2023-10-14-griboedov-gonggy','2023-10-14',NULL,'22:00:00',NULL,'<p>Собираемся с нашими друзьями из GONGGY боевым составом трясти подвал под свежее электро, брейк, транс и техно, по традиции транслируя все на <a href="https://www.youtube.com/@griboedovbasement">YOUTUBE&nbsp;</a><br>В 22:00, в Amsterdam 🇳🇱, будем согреваться теплой атмосферой, горячим глинтвейном на баре и приятным саундом<br><br>В 00:00 бежим в подвал и показываем, как хорошо мы с вами умеем веселиться</p>',NULL,'700.0',1,86,1,'','',false,false,NULL,2,'2023-10-13 01:50:42','2023-10-20 02:11:02',NULL,'','0',18,62),
	 (2138,'Hell''o''Blank','2023-10-28-blank-helloblank','2023-10-28','2023-10-29','22:00:00','08:00:00','<p>Конец октября. Природа увядает, напоследок растушевывая себя в багрянец. Полчища гоблинов шастают в вечерних сумерках, клянча сладости у соседей. Нудные взрослые дожидаются момента, чтобы реализовать свои запретные фантазии и хотя бы раз в год быть тем, кем хочется быть. Это Хеллоуин вколачивает крышку гроба в сезон, который на Западе называют жутким. Но это там, здесь же такими страшилками никого не запугаешь. Эксклюзивные права на всесезонную жуть, в отличие от резины, не сотрутся.&nbsp;<br><br>Жизнь не сахар, но порой подбрасывает такие конфетки, от которых слипается. Например, Hell’o’Blank — вечеринка-трикстер, праздник переодеваний, перевоплощений и необъяснимых явлений. Побег от зомби на адский шабаш, лишь бы не покусали. В лайн-апе тысяча чертей и еще 15 диджеев, готовых закружить в исступленных вальсах, будто бес вселился. До криков петухов на рассвете, ну или пока небо не окропит святой водой.</p>',900,'',1,1,1,'https://blankclub.ru','',false,false,NULL,2,'2023-10-13 01:57:01','2023-10-25 16:14:52',NULL,'','0',18,77);
