	 (2154,'Суббота','2023-10-14-restobar-matiss-subbota','2023-10-14',NULL,'20:00:00',NULL,'<p>14.10 - Суббота, 20:00 :<br>Smirnov, So.young</p>',NULL,'0.0',1,159,1,'','',false,false,NULL,2,'2023-10-13 03:03:54','2023-10-20 01:41:03',NULL,'','0',18,35),
	 (2139,'CIEL','2023-10-13-union-ciel','2023-10-13',NULL,'22:00:00',NULL,'<p>В эту пятницу Ciél&nbsp; опустят наши головы в бурлящий, хлесткий, басовый, уничтожающий английский звук. Умеренный прямой разгон, злая ломаная середина и расплавленный, субтильный, сбитый финал — возможность методично и эффективно выпустить своих внутренних демонов. Разгоняемся от 130 до 170, периодически захватывая реп и неожиданные эдиты на популярные треки.<br>Вход до 23:00 фри, после — 500₽</p>',NULL,'500.0',1,8,1,'','https://t.me/unionbarspb',false,false,NULL,2,'2023-10-13 02:03:12','2023-10-22 08:14:55',NULL,'','0',18,74),
	 (2140,'Salute Honey','2023-10-14-union-salute-honey','2023-10-14',NULL,'22:00:00',NULL,'<p>Чувства переполняют, слов не хватает: Salute Honey&nbsp; снова орудуют в баре на Литейном 55, а это неминуемо приводит к решительно танцевальной субботней ночи.&nbsp;</p>',NULL,'500.0',1,8,1,'','',false,false,NULL,2,'2023-10-13 02:08:26','2023-10-20 16:03:19',NULL,'','0',18,61),
	 (2158,'Music','2023-10-13-na-vina-music','2023-10-13',NULL,'20:00:00',NULL,'<p>Диско-квартирник, винил, отдел вина и музыки и топовые этикетки на складе. Каким будет оранжевый октябрь?&nbsp;</p>',NULL,'0.0',1,199,1,'','',false,false,NULL,2,'2023-10-13 03:27:27','2023-10-23 01:35:06',NULL,'','0',18,27),
	 (2141,'Friday','2023-10-13-mixed-friday','2023-10-13',NULL,'22:00:00',NULL,'<p>Matpri — петербургский артист, диджей и продюсер, владелец лейбла Prosaic, в своих сетах предпочитает музыку в жанрах House и Micro-house.&nbsp;<br>активный игрок рынка винила и цифры, отметился релизами на Hoarder, Heisenberg, SAKTU и Slowdy Mowdy.&nbsp;<br><br>Андрей подобрал осенний материал, который будет звучать all night long!</p>',NULL,'0.0',1,59,1,'','',false,false,NULL,2,'2023-10-13 02:11:22','2023-10-22 09:46:30',NULL,'','0',18,57),
	 (2143,'Double Sound²','2023-10-14-mixed-double-sound2','2023-10-14',NULL,'22:00:00',NULL,'<p>этим летом команда вернулась после годичной паузы и отметила 13-летие на террасе клуба BLANK.&nbsp;<br>Preesh, Ika и Dvinskikh продолжают деятельность комьюнити в родном городе. многое изменилось за это время, но страсть к музыке и собственный взгляд на её главный посыл остались неизменными.</p>',NULL,'500.0',1,59,1,'','',false,false,NULL,2,'2023-10-13 02:19:14','2023-10-21 08:43:31',NULL,'','0',18,43),
	 (2144,'PREоткрытие','2023-10-21-base-preotkrytie','2023-10-21',NULL,'21:00:00',NULL,'<p>Ну шо мои хорошие, вот и подробности о новом месте. Уже в следующую субботу можно будет самолично посмотреть как расцветает новый проект на месте бывшего клуба Классик.</p>',NULL,'0.0',1,288,1,'','https://t.me/base_events',false,false,NULL,2,'2023-10-13 02:26:06','2023-10-25 10:41:23',NULL,'','0',18,208),
	 (2145,'Пятница','2023-10-13-miraz-piatnica','2023-10-13','2023-10-14','00:00:00',NULL,'<p>соник в пуховике это походу муд на ближайшие месяцев 5, так что мы всерьез занялись крытой леткой( зимка получается )<br>ну а вы пока всерьез ознакомьтесь с планами на пятницу</p>',NULL,'0.0',1,77,1,'','',false,false,NULL,2,'2023-10-13 02:31:11','2023-10-20 16:13:08',NULL,'','0',18,44),
	 (2146,'Vibe Room','2023-10-14-miraz-vibe-room','2023-10-14',NULL,'00:00:00',NULL,'<p>теперь к основному интересующему вас вопросу<br>в целом, уже по афише понятно, что будет пиздато, но для закрепления - в субботу у нас vibe room<br><br>вход 600₽ до 01:00 / 800₽ после</p>',600,'800.0',1,77,1,'','',false,false,NULL,2,'2023-10-13 02:34:37','2023-10-23 13:11:36',NULL,'','0',18,50),
	 (2147,'Ломаные Ритмы','2023-10-14-ritmy-lomanye-ritmy','2023-10-14',NULL,'22:00:00',NULL,'<p>Вы как-то просили джангл и днб тусу. Ну мы вам ее сделали в воскресенье, вы не особо пришли.&nbsp;<br>Окей, намёк понят!<br><br>Вот вам субботняя ломаная дискотека от команды TIMEOFNIGHT.<br>Все как вы просили, но еще круче и в субботу!&nbsp;<br><br>Ребята решились аж на два танцпола!</p>',500,'',1,181,1,'','https://vk.com/lomanye',false,false,NULL,2,'2023-10-13 02:38:22','2023-10-23 13:11:35',NULL,'','0',18,66);
