	 (2152,'Гопотека','2023-10-13-lastocka-gopoteka','2023-10-13',NULL,'23:30:00',NULL,'<p>Все что режет слух… В прямом смысле, а не назойливые тренды…<br>Хардбасс, Пампин хаус, Хард Хаус, Русская Вичуха и все, что качает тех, кто двигается на ровном.<br>ВНИМАНИЕ: Строгий дресскод в виде спортивок! В обычной одежде не пускаем.</p>',NULL,'600.0',1,10,1,'','',false,false,NULL,2,'2023-10-13 02:56:44','2023-10-22 13:22:02',NULL,'','0',18,136),
