	 (2155,'МРАК Birthday Party','2023-10-14-pticia-licnost-mrak-birthday-party','2023-10-14','2023-10-15','21:00:00','06:00:00','<p>Мрак oyoy_maloy получает свой 25-й уровень, и такое событие просто нельзя оставить без посиделок-потанцевалок в баре и старого-доброго кутежа!<br>Приходите с обнимашками, горячими сердцами и танцуйте под наши разносторонние сеты, имениннику стукнуло четверть века!<br><br>Пьём, топчем танцпол под доминирующие ритмы #dnb и немножко #hardtechno, болтаём о том о сём. Пока диджеи дерутся за freejack, джедаи устраивают разборки у бара!&nbsp;</p>',200,'',1,4,1,'','',false,false,NULL,2,'2023-10-13 03:08:02','2023-10-23 18:06:28',NULL,'','0',18,83),
	 (2156,'MADFOX.EVENTS','2023-10-14-cult-madfoxevents','2023-10-14',NULL,'23:00:00',NULL,'<p>отмечаем день рождения промо и одновременно поздравляем с b-day лисью матерь!<br>внедряем на втором танцполе урбан-стилистику, демонстрируем новые взрывные таланты и дополняем образ уличной арт-каллиграфией от Yano.</p>',NULL,'500.0',1,92,1,'','https://Vk.com/mdfxcult',false,false,NULL,2,'2023-10-13 03:13:20','2023-10-20 15:16:11',NULL,'','0',18,48),
	 (2161,' Вася В в HOPS MUSTACHE BAR','2023-10-13-hops-mustache-vasia-v-v-hops-mustache-b','2023-10-13',NULL,'21:00:00',NULL,'<p>Итак, классический петербургский МС, лидер культовой петербургской группы Кирпичи, трижды кругом петербуржец в седьмом поколении Вася В (https://instagram.com/tzar_vasilich_kirpichi?igshid=MzRlODBiNWFlZA==). (https://instagram.com/tzar_vasilich_kirpichi?igshid=MzRlODBiNWFlZA==) наконец-то сыграет в HOPS MUSTACHE BAR! (https://instagram.com/hops_mustache_bar?igshid=MzRlODBiNWFlZA==)<br>В программе концерта в двух отделениях будет представлен успешный последний альбом "Триумф", главные хиты Кирпичей в оригинальном прочтении, а также неожиданные версии и редкие песни. Не пропустите душевный вечер от Василия Владимировича Васина, отличное настроение и масса юмора гарантированы.&nbsp;<br>Добро пожаловать!</p>',NULL,'0.0',1,144,1,'','',false,false,NULL,3,'2023-10-13 14:46:20','2023-10-22 16:26:49',NULL,'','0',18,44),
	 (2162,'пятница в Мишке ','2023-10-13-miska-bar-piatnica-v-miske','2023-10-13',NULL,'21:00:00',NULL,'<p>Сегодня, 13 октября, в Mishke весь вечер и всю ночью играет идеальный диск-жокей nekrasivaya noga.<br><br>Обещаем вам диско, хаус и все это в самых неожиданных формах и видах. Музыка, которую вы никогда не слышали и которую потом никак не забыть.&nbsp;<br><br></p>',NULL,'0.0',1,12,1,'','',false,false,NULL,3,'2023-10-13 14:47:46','2023-10-21 12:19:38',NULL,'','0',18,40);
