	 (2165,'Колбасный Цех','2023-10-14-iubileinyi-kolbasnyi-cex','2023-10-14',NULL,'22:00:00',NULL,'<p>Трепещите, колбасёры!<br>Радио Рекорд возвращает «КОЛБАСНЫЙ ЦЕХ» 🔥<br>14 октября в петербургском СК «Юбилейный» мы отметим 20-летие легендарного рейва!<br><br>Готовьте перчатки, свистки и веера! Вас ждёт полное погружение в атмосферу ностальгического рейва:<br>• ночь лучшей электронной музыки нулевых;<br>• культовые артисты: AQUAGEN, DJ GROOVE, МС ЖАН &amp; DJ RIGA, DJ Нил, XS PROJECT, Sonic Mine и DJ Врунгель;<br>• МС Вспышкин в виртуальной реальности;<br>• лазерное шоу (как в старые добрые) 🧤<br>• 100 гоу-гоу Рекорд Чикс 💃💃<br><br>В вашем луке приветствуются кислотные и ядовитые цвета, светоотражающие вставки, боты на платформе и яркий мейк-ап у девушек.</p>',NULL,'',1,289,1,'','',false,false,NULL,3,'2023-10-14 13:58:48','2023-10-24 11:46:54',NULL,'','0',18,368),
