	 (2167,'Вертикаль Soundsystem','2023-11-04-slezy-vertikal-soundsystem','2023-11-04',NULL,'22:00:00',NULL,'<p>4 ноября, в баре Слёзы, состоится премьера группировки Вертикаль Саундсистем (ex DDR) и их нового ебейшего звука в 15кВт! Будем танцевать в слезах, обниматься в слезах, пить слезы в слезах как в первый и последний раз!</p>',NULL,'420.0',2,102,1,'','',false,false,NULL,2,'2023-10-18 16:16:27','2023-10-25 16:12:59',NULL,'','0',18,25),
