	 (2169,'Reggae Thursday','2023-10-19-hops-mustache-reggae-thursday','2023-10-19','2023-10-19','20:00:00','23:00:00','<p>Команда Reggae.Media продолжает сезон виниловых регги четвергов в уютном баре HOPS MUSTACHE BAR / УСЫ НА ПЕНЕ. C виниловых пластинок и вкуснейшее крафтовое пиво.<br><br>За пультом: Tippa Mult с регги подборкой, Bamba с отборным дабом, а также немного ломанных ритмов от Logdog.</p>',NULL,'0.0',1,144,1,'','',false,false,NULL,2,'2023-10-18 16:39:07','2023-10-22 14:28:56',NULL,'','0',18,9),
	 (2215,'10 years anniversary Bassline Blog','2023-10-20-pticia-licnost-10-years-anniversary-ba','2023-10-20',NULL,'20:00:00',NULL,'<p>20 октября отмечаем 10-летие Bassline Blog–основного бэйслайн коммьюнити СНГ и презентуем альбом в честь этого события. Рады видеть всех неравнодушных к basslin&nbsp;<br>В программе пробивной басс и MC у микрофона. Приветствуются дарственные донаты!</p>',100,'',1,4,1,'','',false,false,NULL,2,'2023-10-20 02:08:08','2023-10-25 11:24:07',NULL,'','0',18,49),
	 (2170,'WARPP Label Showcase','2023-10-27-buddha-bar-warpp-label-showcase','2023-10-27',NULL,'22:00:00',NULL,'<p>Встречайте шоу кейс нашего лейбла Warpp, на которой выступит один из ярких представителей progressive house сцены - DJ Ruby!<br><br>DJ Ruby – Со своими незабываемыми сетами и потрясающим взаимодействием с публикой, смог завоевать сердца миллионов фанатов по всему миру. Он выпустил обширный список музыкальных постановок на различных лейблах и стал пионером многих электронных жанров.<br>Особое внимание заслуживают два его альбома, которые принесли ему истинное признание в индустрии.<br><br>Ruby представит свои новейшие треки, а также лучшие хиты. Поддержку ему окажут наши друзья и резиденты&nbsp;</p>',1200,'',1,38,1,'https://warpp.ticketscloud.org/','',false,false,NULL,2,'2023-10-18 16:49:02','2023-10-25 16:41:39',NULL,'','0',18,42),
	 (2171,'DARKNESS RISES XIII','2023-10-20-factory-3-darkness-rises-xiii','2023-10-20',NULL,'23:50:00',NULL,'<p>Комьюнити атмосферной, звуковой темной эстетики DARKNESS RISES XIII,&nbsp; уже в эту пятницу в FACTORY проведет 4 эпизод MESSXII</p>',800,'',1,7,1,'','https://t.me/darknessrss',false,false,NULL,2,'2023-10-18 17:11:29','2023-10-25 09:39:37',64,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjM5YTE0NzJjNjEyYTc4YzgzYjFmOGYyIn0.oAFfncYALgq63Q5FScDi9Nuo4DnR-CQb4Sv5wz-YDzY','0',18,89);
