	 (2172,'СИЯНИЕ','2023-10-20-action-club-siianie','2023-10-20',NULL,'23:55:00',NULL,'<p>Наступает время когда тьма вновь подарит СИЯНИЕ&nbsp;<br><br>В пятницу наступит время вспомнить, что ночь имеет свой цвет, свет и звук, а музыкальные проводники готовы погрузить всех в самое сердце мрака:</p>',800,'',1,47,1,'https://spb.qtickets.events/85095-siyanie-21','https://t.me/LvdnoIvents',false,false,NULL,2,'2023-10-18 17:47:31','2023-10-23 23:50:14',NULL,'','0',18,47),
	 (2173,'MOST','2023-10-20-mixed-most','2023-10-20',NULL,'22:00:00',NULL,'<p>В эту пятницу Mixed bar наводит Мост с Беларусью: Vovred &amp; Emtryx — дуэт братьев из Минска, представляющие селекцию в стилях минимал и брэйкс.<br><br>Раньше артисты были частью проекта Cult Rave, но постепенно ушли от техно и нашли своё пристанище в минималистичных компиляциях, где могут свободно выражать свою творческую индивидуальность и близкую им по духу эстетику. Сейчас ребята резиденты минского клуба Modul Art Platform и музыкального проекта Znichka.</p>',700,'1000.0',1,59,1,'https://spb.qtickets.events/87429-most','',false,false,NULL,2,'2023-10-18 17:52:32','2023-10-23 15:26:02',NULL,'','0',18,69),
	 (2174,'M''N''MUM','2023-10-21-ritmy-mnmum','2023-10-21',NULL,'22:55:00',NULL,'<p>M’N’MUM&nbsp; не просто вечеринка, а шоу-кейс легендарных железячников DMT Electronics (https://on.soundcloud.com/896bd) – питерского сообщества электронных музыкантов, отличительной чертой и фирменным знаком которого является страсть и любовь к синтезаторам, драм-машинам и секвенсорам.&nbsp;</p>',500,'700.0',1,181,1,'','https://vk.com/mnmumdmt',false,false,NULL,2,'2023-10-18 18:02:31','2023-10-24 20:49:32',652,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNjRjM2YzYzYwOTY2YmI3OTQ3YmY1ZDNjIn0.xq4IYLDwzZ9WR3I6L06fQsaokDjj_bE0a5CyzkmqQZE','0',18,56),
	 (2175,'Kekoriy & Peter Zherebtsov','2023-10-21-redrum-kekoriy-peter-zherebtsov','2023-10-21','2023-10-21','20:00:00','00:00:00','',NULL,'0.0',1,249,1,'','',false,false,NULL,2,'2023-10-19 16:39:47','2023-10-24 15:46:00',NULL,'','0',18,32),
	 (2176,'Бал Наташи Ростовой в космосе','2023-10-28-kinostudiia-lenfilm-bal-natasi-rostovoi','2023-10-28','2023-10-29','20:00:00','06:00:00','<p>ВАЛЬСУ БЫТЬ!<br>Odyssey Festival вновь устраивает в Петербурге настоящее костюмированное светопреставление. Это не просто бал, и не космическая опера и даже не банальный рейв. Это «Бал Наташи Ростовой в космосе»!<br>Сотни самых красивых людей со всех уголков страны, ревущие дюзы космолётов, загадочные альковы и декорации, скафандры и кринолин, великосветская учтивость и нравы других планет – лишь малая часть того, что ждёт гостей 28 октября.<br><br>Дресс-код: великосветский бал и крайний космос<br><br>Cкидка 10% по промокоду:&nbsp; CHIRIK<br>Количество билетов ограниченно</p>',4200,'',1,290,1,'','',false,false,NULL,2,'2023-10-19 16:48:22','2023-10-25 17:14:45',6511,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWQ0NDA3ZWVkMjNlMGE0Njk5YTU2Yjg4In0.2CFYmpAMwr_Rb3jn16I8phtMsvrM03XYr19FNv6Ka28','0',18,88),
	 (2177,'North Central','2023-10-21-mod-north-central','2023-10-21',NULL,'23:55:00',NULL,'<p>3-я серия HIP-HOP Show от команды «PETROGRAD • North Central»&nbsp;<br>Будут звучать новейшие треки от DJ и свежайшие новинки артистов PG<br><br></p>',400,'',1,113,1,'https://spb.qtickets.events/86376-pg-north-central','https://vk.com/north_central',false,false,NULL,2,'2023-10-19 18:37:17','2023-10-25 18:13:59',NULL,'','0',18,280),
	 (2178,'ATLANTA','2023-10-20-gigant-xoll-atlanta','2023-10-20',NULL,'18:00:00',NULL,'<p>ЭТА ПЯТНИЦА&nbsp;<br><br>20 числа мы встретимся в Гигант Холле, чтобы на большой просторной площадке тусить весь вечер вместе с нашей командой!&nbsp;<br><br></p>',600,'',1,53,1,'https://spb.qtickets.events/86821-atlanta-2010-gigant-kholl','https://t.me/atlantaact1',false,false,NULL,2,'2023-10-19 21:45:31','2023-10-25 14:25:34',NULL,'','0',18,68),
	 (2198,'Acid Orchestra Night','2023-10-20-union-acid-orchestra-night','2023-10-20',NULL,'21:00:00',NULL,'<p>Ночь, которая не повторится дважды. В эпицентре пятницы в Ю — лайв Acid Orchestra, проекта Евгения Викентьева, , Дмитрия Винникова (ex. Pompeya) и Даниила Силина (Sakura).&nbsp;<br><br>Группа не имеет записей на каких-либо платформах или носителях: все аранжировки происходят в формате живой импровизации на концертах — это особенность позволяет присутствовать в моменте, когда звучит музыка, находить себя в ее потоке, жить и дышать ею прямо сейчас.&nbsp;<br><br>Вход до 23:00 фри, после — 500₽</p>',0,'500.0',1,8,1,'','',false,false,NULL,2,'2023-10-20 00:25:20','2023-10-22 20:28:15',NULL,'','0',18,49),
	 (2179,'Абстрасенция 10 лет','2023-10-21-oranzereia-tavriceskogo-sada-abstrasenci','2023-10-21',NULL,'16:00:00',NULL,'<p>В честь десятилетия Абстрасенция организует праздничный шоукейс в Оранжерее Таврического сада. Днем и вечером на сцене, окруженной пальмами, выступят 5 знаковых электронщиков. Вас ждет захватывающий мир атмосферной электронной музыки, звучание которой идеально сочетается с видами экзотических растений.<br><br>Woodju спустя год вернется с лайвом в Оранжерею, Long Arm сыграет необычный виниловый dj-сет. X.Y.R., один из самых известных российских эмбиент-проектов, выступит с умиротворяющим лайвом. Slow Sun, мастер downtempo и chillwave, представит обновленную программу. На фестивале состоится долгожданное возвращение Марины Faib с лайв-презентацией нового сингла, который выйдет на лейбле Абстрасенции.<br><br>Концерт состоится в двух сеансах с одинаковой программой — в 16:00 и 19:10. Количество мест ограничено.</p>',1100,'',1,48,1,'https://abstrasension.ru/orangery_2023?utm_source=tg&utm_medium=cpc&utm_campaign=tg_dnc1910','',false,false,NULL,2,'2023-10-19 21:52:24','2023-10-25 13:39:47',NULL,'','1',18,73),
	 (2180,'Культура х Диско Тека','2023-10-20-ritmy-kultura-x-disko-teka','2023-10-20',NULL,'22:00:00',NULL,'<p>Минский электронный лейб «Диско Тека» и Питерский проект «Культура» организовали совместную вечеринку. Это будет настоящее заявление всем.<br><br></p>',700,'',1,181,1,'https://spb.qtickets.events/87463-kultura-kh-disko-teka','',false,false,NULL,2,'2023-10-19 22:04:59','2023-10-25 16:13:43',NULL,'','0',18,70);
