	 (2181,'МИКСТУРА','2023-10-20-secrets-mikstura','2023-10-20',NULL,'23:00:00',NULL,'<p>В пятницу, 20 октября в клубном пространстве Secrets.Night Room<br>пройдёт вторая вечеринка из серии МИКСТУРА.<br><br>Участники Петербургской хаус-сцены представят свои диджей-сеты, которые будут наполнены разными оттенками хаус-музыки от классических направлений до современных тенденций стиля.</p>',1000,'',1,147,1,'https://spb.qtickets.events/87405-mikstura-ot-krauzeparty','',false,false,NULL,2,'2023-10-19 22:10:22','2023-10-25 13:08:19',NULL,'','0',18,45),
	 (2182,'HEROES x CULT: villains','2023-10-20-cult-heroes-x-cult-villains','2023-10-20',NULL,'23:00:00',NULL,'<p>злодеи никогда не спят — они составляют грандиозные планы на эту пятницу<br><br>• откроем двери в 22:00<br>(тату-зона, продажа lifestyle от ,таро, гвозди и несколько секретов от нас)</p>',600,'700.0',1,92,1,'https://spb.qtickets.events/88034-heroes-x-cult-villains-20-oktyabrya','https://vk.com/cultspacespb',false,false,NULL,2,'2023-10-19 22:15:54','2023-10-23 12:23:23',NULL,'','0',18,47),
	 (2185,'VTUSSE HALLOWEEN: trick or treat','2023-10-27-letucii-gollandec-vtusse-halloween-tri','2023-10-27',NULL,'23:00:00',NULL,'<p>В таинственную ночь всех мертвых мы окунемся в загробный мир танцев на костях. Встречаемся на величественном и покрытым мраком историями корабле - «Летучий Голландец»<br><br>Множество кровавых забав и загадок ждут твою невинную душу, осталось только зайти на борт…<br><br>Главные гости пиратского торжества - Лауд !<br>И наш Питерский любимчик - Леша Миронов !<br><br></p>',600,'',1,291,1,'https://spb.qtickets.events/88340-vtusse-halloween-trick-or-treat','',false,false,NULL,2,'2023-10-19 22:28:22','2023-10-25 18:13:15',NULL,'','0',18,67),
	 (2186,'ANIMA NOX','2023-10-27-factory-3-anima-nox','2023-10-27',NULL,'23:55:00',NULL,'<p>27 октября 2023, Санкт-Петербург!<br><br>В ночь всех святых команда partydelaem приглашает всех стать частью большого психоделического театра на двух сценах клуба FACTORY.</p>',1200,'',1,7,1,'https://spb.qtickets.events/85127-anima-nox-psytrancetechnohalloween','https://vk.com/animanox23',false,false,NULL,2,'2023-10-19 22:33:51','2023-10-25 16:19:17',NULL,'','0',18,37),
	 (2187,'CHINATOWN','2023-10-28-brusnicyn-xoll-chinatown','2023-10-28',NULL,'22:30:00',NULL,'<p>Хеллоуин от Юрия Милославского и его команды известен в СПБ очень давно — уже более 20 лет, в последнюю субботу октября толпы людей в костюмах штурмуют различные локации, где с разной степенью массовости и помпезности, проходит этот клубный праздник.<br><br>На сей раз, выбором стал квартал Брусницын холл, что на Кожевенной линии.<br>Всего на одну ночь, он превратится в легендарный Chinatown со всеми его удовольствиями, приключениями и опасностью.<br>Именно в этот день тут может случится, что угодно.<br><br>Но самое главное, это то, что это случится под хорошую музыку. Ведь хедлайнерами праздника станут AGRABA и SPY.DER, практически легенды клубной и событийной Москвы.</p>',2100,'',1,70,1,'https://spb.qtickets.events/86205-chinatown','',false,false,NULL,2,'2023-10-19 22:39:35','2023-10-25 16:20:49',NULL,'','0',18,52),
	 (2188,'[ALT]ERNATIONAL','2023-10-28-port-sevkabel-alternational','2023-10-28',NULL,'23:30:00',NULL,'<p>28 октября в стенах KRNG CORP. состоится масштабная туса! Накануне Хэллоуина мы устроим настоящее шоу с представителями лучшего мэшапного паблика – [alt]!<br>Мы подготовили порцию плохих шуток, вырвиглазный визуал, сочные танцевальные ритмы и ужасно смешную атмосферу! А если вы вдруг потеряетесь в сумасшедшей волне веселья, то ориентироваться в пространстве и времени вам помогут наши волонтеры – их вы узнаете по бейджикам и особому вайбу!<br>Приходите танцевать и радоваться жизни вместе с нами 28 октября 2023 в KRNG CORP, Севкабель Порт! Начало в 23:30.</p>',400,'',1,292,1,'https://spb.qtickets.events/84132-alternational','https://alternational.ru/',false,false,NULL,2,'2023-10-19 22:44:27','2023-10-25 16:54:24',NULL,'','0',18,50),
	 (2189,'Nasledie Nignt at the theater','2023-10-28-nasledie-nignt-at-the-theater','2023-10-28',NULL,'23:50:00',NULL,'<p>Ночь в театре October 28<br><br>Давно ходили в театр? Был ли то балет, опера или, быть может, спектакль?<br><br>В субботу, 28 октября, в интерьерах действующего театра, вы лицезреете авторское представление от kontrkult х nasledie.<br><br>В первой части действа вес ожидает спектакль «Демоническая женщина» по рассказу Н. Тэффи, в исполнении Александры Киселевой, худ. руководителя театра перформативных искусств plastic sensе.<br><br>Затем, без перерывов на антракт, для вас играют хедлайнеры KATSURA, DRAAG и METAPHYSICA. Как сказали бы критики, представление сложное, местами тяжелое, очень глубокое и захватывающее. Раскроем всю драматургию рейва в театре, буквально от ямы для бельэтажей.<br><br>Дорогая публика, нам будет не важно, очки на вас, пенсне или бинокль в сумочке, но убедительно просим облачиться в свои лучшие вечерние туалеты. Снова перчатки, веера, фраки и низкий поклон винтажу.</p>',700,'',1,NULL,1,'https://spb.qtickets.events/88261-nasledie-nignt-at-the-theater','',false,false,NULL,2,'2023-10-19 22:50:25','2023-10-25 16:06:56',NULL,'','0',18,37),
	 (2190,'Dia de los muertos (День мертвых)','2023-11-04-mod-dia-de-los-muertos-den-mertvyx','2023-11-04',NULL,'23:59:00',NULL,'<p>Пленяющая сознание Мексика, празднование торжества жизни, образы, сошедшие с другого континента, прерванный яркими красками нуар и новое прочтение ужасающе манящего праздника.<br><br>Предлагаем вам окунуться в тьму и найти там свет вместе с нами.<br><br>Что вас ждет?<br><br>стилизованная иммерсивная вечеринка — полное погружение в мексиканскую атмосферу<br>активности с призами: конкурс на самый яркий образ, латиноамериканский Форт Борд<br>«suerte o muerte» — посмотрим, сможете выпить горячительное и не показать виду<br>аквагрим — черепа, цветы или придумаете что-то более креативное?<br>профессиональная фото-и видеосъемка<br><br>DC: ужасающе красивые костюмы в стилистике, акцент на черное<br><br></p>',699,'',1,113,1,'https://spb.qtickets.events/87809-dia-de-los-muertos-den-mertvykh','https://vk.com/spectrumpr',false,false,NULL,2,'2023-10-19 23:00:35','2023-10-25 16:22:38',NULL,'','0',18,28),
	 (2202,'PLAN B','2023-10-21-miraz-plan-b','2023-10-21',NULL,'00:00:00',NULL,'<p>теперь к анонсу&nbsp;<br><br>эксперименты с техно мы конечно любим, но вы очевидно не всегда к ним готовы, так что субботний plan b&nbsp; пройдёт под рэп и все из него вытекающие, чтобы все были счастливы<br><br>вход 500₽ до 01:00/700₽ после&nbsp;</p>',500,'700.0',1,77,1,'','',false,false,NULL,2,'2023-10-20 00:47:22','2023-10-25 13:41:49',NULL,'','0',18,60),
	 (2191,':data','2023-11-10-ritmy-data','2023-11-10','2023-11-11','22:00:00','06:00:00','<p>Спустя три с половиной года московская серия драм-н-бейс вечеринок и одноименный музыкальный лейбл возвращаются в город на Неве.<br><br>История :data берет начало с декабря 2018 года. За это время проект перерос из уютной ежемесячной вечеринки в новое музыкальное движение, объединенное одной целью - показать новую школу drum and bass музыки в России и далеко за ее пределами.<br><br>Как и всегда, вас ждет самая свежая музыка, релизы нашего лейбла, дабплейты со всего мира и фирменная мрачная атмосфера. До встречи!</p>',700,'',1,181,1,'https://spb.qtickets.events/86763-data-saint-petersburg','',false,false,NULL,2,'2023-10-19 23:12:51','2023-10-25 16:20:46',NULL,'','0',18,22);
