	 (2197,'YOUNG BLOOD: Open deck ','2023-10-21-griboedov-young-blood-open-deck','2023-10-21','2023-10-22','22:00:00','06:00:00','<p>Не важно играете ли вы на каком то инструменте, используете микрофон для синтеза звука, драм-машину или же играете с сидюков; важно что вы тот, кто генерирует звуковую волну и получает от этого истинное удовольствие.<br><br>Присылайте нам свои сеты, музыку и все то, что вы считайте отображением вашего творчества в тг <a href="https://t.me/bymomwithlove">Superlative</a> . Лучших из вас пригласим к нам на вечеринку!</p>',NULL,'500.0',1,86,1,'','',false,false,NULL,2,'2023-10-19 23:52:10','2023-10-25 13:42:48',NULL,'','0',18,72),
	 (2213,'PolyParty FreakShow Halloween','2023-10-28-mod-polyparty-freakshow-halloween','2023-10-28',NULL,'23:59:00',NULL,'<p>Всего на один день в известный клуб MOD приедет бродячий цирк — FREAKSHOW&nbsp;<br><br>Клоуны и артисты в причудливых костюмах уже придумали программу на всю ночь. А мы нашли лучших диджеев, собрали цирковые декорации, заказали попкорн и сладкую вату</p>',500,'',1,113,1,'https://polypartyspb.timepad.ru/event/2632789/','',false,false,NULL,2,'2023-10-20 02:00:08','2023-10-25 16:55:50',NULL,'','0',18,33),
	 (2199,'Élan Vital ','2023-10-21-union-elan-vital','2023-10-21',NULL,'22:00:00',NULL,'<p>Проводник для тех, кто ищет безопасные методы отщепления от реальности; гипнотический, пряный, многослойный, скрытый от посторонних глаз неиссякаемый источник жизненной силы и энергии — Élan Vital — в эту субботу в Ю.&nbsp;<br><br>С героями интенсивных танцевальных практик за пультом углубимся в познание различных видов хауса и темного диско, странного этнического электро, техно и сбитых ритмов.<br><br>Вход до 23:00 фри, после — 500₽</p>',0,'500.0',1,8,1,'','',false,false,NULL,2,'2023-10-20 00:30:51','2023-10-25 11:41:24',NULL,'','0',18,44),
	 (2200,'Mixed.yugen 幽玄 ','2023-10-21-mixed-mixedyugen','2023-10-21',NULL,'22:00:00',NULL,'<p>mixed.yugen 幽玄 — новая серия вечеринок в Mixed с концептуальной музыкой, основная идея которой — возможность для диджея пройтись по самым дальним закоулкам своей коллекции и раскрыться перед слушателем путем выступления в формате all night long.<br><br>югэ́н (яп. 幽玄 сокровенный, тайный, мистический) — эстетическая категория в японской культуре, обозначающая интуитивное, предполагаемое, нежели явное, очевидное восприятие сущности объекта.<br><br>«очевидное сменяется потайным. конечную реальность, скрытую за предметом, нельзя точно определить, глубинные чувства нельзя изобразить на лице, выразить прямо — можно лишь намекнуть на них, дать знать о их существовании, чтобы зритель или читатель смог нащупать их в себе»<br><br>задача мастеров состоит в том, чтобы вызвать «ощущение дали, таинственности, неопределенности и почти нереальности».&nbsp;<br><br></p>',NULL,'0.0',1,59,1,'','',false,false,NULL,2,'2023-10-20 00:36:16','2023-10-24 20:49:32',NULL,'','0',18,40),
	 (2201,'Le Club','2023-10-21-miraz-le-club','2023-10-20',NULL,'23:30:00',NULL,'<p>итак, мы попытаемся сделать так, чтобы клуб не разорвался в пятницу, но не обещаем&nbsp;<br><br>первое, оно же самое главное, мы полностью остеклили и утеплили нашу летку(зимку), так что бронирование столов и вторая зона клуба снова объявляется открытой&nbsp;</p>',NULL,'700.0',1,77,1,'','',false,false,NULL,2,'2023-10-20 00:39:46','2023-10-23 12:38:34',NULL,'','0',18,44);
