	 (2216,'Битва Экстрасенсов','2023-10-28-cult-bitva-ekstrasensov','2023-10-28',NULL,'23:00:00',NULL,'<p>28 октября в 23:00 на телеканале CULT пройдет финальная серия «Битвы Экстрасенсов», где встретятся лучшие из лучших и продемонстрируют свои способности на глазах у всех телезрителей.&nbsp;<br>гадаем на мистера х, участвуем в розыгрыше airpods и apple watch от ZHUKOV STORE, рисуем грим и проверяем свою интуицию этой ночью<br><br></p>',500,'',1,92,1,'https://spb.qtickets.events/87376-halloween-bitva-ekstrasensov-28-oktyabrya-cult','',false,false,NULL,2,'2023-10-20 02:12:55','2023-10-25 17:49:56',NULL,'','0',18,131),
	 (2217,'25 граней','2023-10-20-solaris-lab-25-granei','2023-10-20',NULL,'18:00:00',NULL,'<p>Открытие выставки «25 граней» художницы Дарьи Раскопиной и музыкальное сопровождение&nbsp;<br>&nbsp;<br>В день рождения Дарья откроет свою третью персональную выставку, которую посвятила нашим внешним и внутренним ограничениям.<br>25 лет — 25 граней одного человека: каждый возраст — это рубеж, о котором художница рассказывает в своем творчестве, предлагая зрителю поразмышлять вместе с ней. Около 40 работ живописи, графики и цифрового арта окунут вас в мир, где границы стёрты и только вы сможете их определить и обозначить.&nbsp;</p>',NULL,'0.0',1,106,1,'','',false,false,NULL,2,'2023-10-20 02:18:00','2023-10-25 00:34:41',NULL,'','0',18,32),
	 (2218,'Хэппи Хардкор','2023-10-20-ionoteka-xeppi-xardkor','2023-10-20',NULL,'23:30:00',NULL,'<p><a href="https://vk.com/iono_happy_hardcore">20 октября Ионотека уничтожит твой мозг! Самая убойная ночная вечеринка с ХЭППИ ХАРДКОРОМ!</a> Танцуй как упоротая жаба, ведь это твоя вечеринка, а не посиделки с бабушкой! Чудовищные аудио-эксперименты, ремиксы на Шамана, Мишу Круга и прочая кайфовая дичь!</p>',NULL,'200.0',1,40,1,'','https://www.vk.com/iono_happy_hardcore',false,false,NULL,2,'2023-10-20 02:21:57','2023-10-24 14:07:17',NULL,'','0',18,66),
	 (2219,'Пятница','2023-10-20-bar-strelka-piatnica','2023-10-20',NULL,'23:00:00',NULL,'<p>В пятницу в «Стрелке» пройдет ультимативный олл-найтер Валеры Sputnik — резидента заведения и человека многих талантов: участника сообщества System108, покорителя танцполов «Радуги» и директора мотокафе «Энтузиаст».</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,2,'2023-10-20 02:23:55','2023-10-21 10:51:45',NULL,'','0',18,15),
	 (2220,'Highway Night','2023-10-20-gazgolder-highway-night','2023-10-20','2023-10-21','21:00:00','10:00:00','<p>Промогруппа и лейбл Highway устраивают свою фирменную тусовку с позитивной электроникой, хаусом и минималом. Команда собрала в лайнапе избранных артистов и друзей&nbsp;</p>',1500,'',2,35,1,'https://secret420.timepad.ru/event/2622996/','https://t.me/Gaztelegram',false,false,NULL,2,'2023-10-20 02:27:02','2023-10-25 00:22:34',NULL,'','0',18,35),
	 (2221,'BIICMAK × РАДУГА','2023-10-20-blanc-biicmak-raduga','2023-10-20',NULL,'21:00:00',NULL,'<p>Диско-клуб «Радуга» делает совместный ивент с BIICMAK. Это тусовка российского электронщика и битмейкера Biicla, атмосферный саунд которого сравнивают с Fred Again. К артисту присоединятся его друзья с сетами из хауса, чикагского саунда и прочей танцевальной электроники.</p>',1500,'',2,36,1,'https://radugadiscoclub.ru/e201023','',false,false,NULL,2,'2023-10-20 02:32:34','2023-10-25 12:32:58',NULL,'','0',18,61),
	 (2222,'Суббота','2023-10-21-bar-strelka-subbota','2023-10-21',NULL,'23:00:00',NULL,'<p>Петербургский «Клуб Любителей Музыки» на гастролях в «Стрелке». Играют основатели и резиденты: видный артист из андеграунда северной столицы Дима Голденков, хартбрейкер Артем Орлов и хаус-гуру Fanick.</p>',NULL,'0.0',2,103,1,'','',false,false,NULL,2,'2023-10-20 02:39:26','2023-10-24 09:35:36',NULL,'','0',18,27),
