	 (2224,'RROM CHROME','2023-10-21-gazgolder-rrom-chrome','2023-10-21',NULL,'21:00:00',NULL,'<p>За свою продолжительную карьеру Nima участвовал во многих мэйджор вечеринках и фестивалях, таких как Sunwaves, Ibiza Underground, S.A.S.H, Fuse London, Pyramid Ibiza.<br><br>Его увлечение музыкой привело к созданию собственного концепта в проведении мероприятий под названием Join на Ибице, а диджейку он делит с Ricardo Villalobos, Raresh, Dan Ghenacia, Subb-an и другими ассами жанра.</p>',1000,'2000.0',2,35,1,'https://gazgolderclub.ru/#rroom','https://t.me/moscowrroom',false,false,NULL,2,'2023-10-20 02:47:40','2023-10-25 11:29:13',NULL,'','0',18,50),
	 (2225,'PainOpticum','2023-10-28-rndm-painopticum','2023-10-28',NULL,'23:00:00',NULL,'<p>Врата Ада открываются вновь, чтобы затянуть тебя в свои объятия. Твой демон так и жаждет сорваться с цепи. Сможешь ли ты пройти испытания четвертого круга? Не знает никто. Именно поэтому он и носит название «Выжить».</p>',800,'',2,27,1,'https://synesthesia.timepad.ru/event/2615899/','',false,false,NULL,2,'2023-10-20 02:54:01','2023-10-25 16:12:46',NULL,'','0',18,53),
	 (2226,'ASYLUM 1 YEAR','2023-11-03-rndm-asylum-1-year','2023-11-03',NULL,'22:00:00',NULL,'<p>В честь праздничного события команда подготовила лайн-ап полный хедлайнеров: исколесивший пол-Европы испанец DEEPHELLBOY и покорившая Южную Америку ISTINA. Из южного Дагестана вновь нагрянет AHIRZAMAN, а северную столицу представит наш близкий друг B4.</p>',1000,'1500.0',2,27,1,'https://moscow.qtickets.events/86232-asylum-1-year','',false,false,NULL,2,'2023-10-20 03:00:09','2023-10-25 16:15:16',NULL,'','0',18,30),
	 (2227,'TESLA 2024','2024-02-10-mutabor-tesla-2024','2024-02-10','2024-02-11','22:00:00','10:00:00','<p>TESLA – уникальный перфоманс на стыке музыки и технологий: лайв, где Никита Забелин играет на катушках Николы Теслы, извлекая настоящие молнии.<br><br>Будут задействованы все органы чувств и даже слышен запах электричества в пространстве Мутабора.<br><br>Мы переосмыслили вселенную TESLA и готовим кое-что интересное. Новое шоу в феврале.<br><br></p>',1000,'',2,2,1,'','',false,false,NULL,2,'2023-10-20 03:09:59','2023-10-25 16:03:55',652,'eyJhbGciOiJIUzI1NiIsImlzcyI6InRpY2tldHNjbG91ZC5ydSIsInR5cCI6IkpXVCJ9.eyJwIjoiNWZkOTU5YWZmZGNiZDZlZTY0NTJjZjczIn0.GeRgIuxoux5eUegSzCkEWmLeljBwf4hO9W4fGQPV01A','0',18,15),
	 (2228,'BIRTHDAY BALL COMMUNITY RUSSIA','2023-10-21-basnia-federaciia-etaz-90-birthday-ball','2023-10-21',NULL,'20:00:00',NULL,'<p>21 октября (суббота) свои двери для вас откроет Новая локация MOSCOW CITY на 90 этаже в самом сердце столицы<br><br>"COMMUNITY RUSSIA" - Приглашает вас на юбилейное мероприятие, посвященное трехлетию великолепного пути наших проектов.<br><br>Мы хотим выразить искреннюю благодарность всем дорогим гостям, которые на протяжении долгого времени посещают и поддерживают наши мероприятия<br><br>Dress code: COCKTAIL &amp; MASQUERADE MASKS (вход строго в карнавальных масках)</p>',5555,'',2,283,1,'https://moscow.qtickets.events/86176-2110-birthday-ball','',false,false,NULL,2,'2023-10-20 03:17:51','2023-10-25 12:03:20',NULL,'','0',18,158),
	 (2229,'Prada Party Посвят','2023-10-21-kinky-rouge-prada-party-posviat','2023-10-21','2023-10-22','21:00:00','05:00:00','<p>Уже прошел второй месяц учебы, а ты так и не успел нормально потусить с одногруппниками?<br><br>Уже 21 октября, специально для вас мы организуем самую жаркую ночь для студентов!<br><br>Что вас ждет:<br>•Двухэтажная площадка в центре Москвы<br>•Лучшие DJ-сэты<br>•Вместимость более 600 человек<br>•Большое количество VIP-комнат<br>•Два бара<br>•Два танцпола</p>',666,'',2,62,1,'https://moscow.qtickets.events/85751-prada-party-posvyat','https://t.me/pradapartymsk',false,false,NULL,2,'2023-10-20 03:25:08','2023-10-25 15:56:02',NULL,'','0',18,72),
