	 (2234,'Temple of Ghost','2023-11-03-osobniak-m-temple-of-ghost','2023-11-03',NULL,'22:00:00',NULL,'<p>Фестиваль Temple of Ghost, посвященный международному празднику Halloween, пройдет 3 ноября в двух исторических особняках на набережной Москвы реки.<br><br>Событие развернется на 3-х тематических сценах: Ghost, Meduza и Afterhalloween. На них встретятся знаковые отечественные и европейские музыканты, чтобы вместе с гостями погрузиться в будоражащий мир электроники.<br><br>Лабиринт с иммерсивными элементами, 18 актеров, 16 артистов, 16 комнат – и все это под чутким арт-дирекшеном Саши Сахарной. Таких событий Москва не видела очень давно.</p>',2500,'',2,293,1,'https://tod.show/ghost','',false,false,NULL,2,'2023-10-20 16:14:40','2023-10-25 18:26:25',NULL,'','0',18,225);
