	 (2244,'Burning Series','2023-11-10-16-tonn-presnenskii-val-burning-serie','2023-11-10','2023-11-11','23:30:00','05:30:00','<p>10 ноября, в пятницу, на главном танцполе клуба «16 Тонн» на легендарной drum &amp; bass вечеринке Burning Series, проводимой лейблом Occulti, выступят не нуждающиеся в представлении артисты английских и голландских лейблов</p>',600,'',2,29,1,'https://moscow.qtickets.events/87240-burning-series-noch-drum-and-bass-muzyki?utm_source=listing&utm_medium=adv&utm_campaign=buttonlisting','https://www.burningseries.ru/',false,false,NULL,2,'2023-10-24 14:55:36','2023-10-25 17:29:00',NULL,'','0',18,15);
