	 (2245,'Free Flow Flava','2023-12-16-16-tonn-presnenskii-val-free-flow-fla','2023-12-16',NULL,'20:00:00',NULL,'<p>16 декабря в&nbsp; «Тоннах» с&nbsp; live-сетом выступит электронный самурай, мастер японского хип-хоп грува FREE FLOW FLAVA.&nbsp;</p><p>FREE FLOW FLAVA — один из&nbsp; самых известных российский битмейкеров. Он работает в&nbsp; своём уникальном жанре на&nbsp; стыке мрачного трэпа, лоу-файя и&nbsp; хип-хопа с мистическим азиатским вайбом. Объяснять музыкальными терминами его творчество невозможно: треки FREE FLOW FLAVA с&nbsp; японской живописью имеют больше общего, чем с&nbsp; хип-хопом. Горы и&nbsp; воды на&nbsp; гравюрах — образ идеального космического миропорядка, который японские мастера укладывали в&nbsp; изображения воды и&nbsp; гор, — FFF создает звуком.&nbsp;</p><p>Визуализация треков на&nbsp; экране «16 Тонн» во время сета поможет зрителю на&nbsp; время концерта оставить за пределами зала все проблемы и&nbsp; отдаться чувственному опыту переживания синестетической музыки.</p>',1000,'',2,29,2,'https://www.16tons.ru/concert/2023-free-flow-flava-16dec/','',false,false,NULL,2,'2023-10-24 15:00:33','2023-10-25 16:12:29',NULL,'','0',18,12),
	 (2246,'САМЫЙ СТРАШНЫЙ HALLOWEEN 2023','2023-10-27-serdce-samyi-strasnyi-halloween-2023','2023-10-27','2023-10-28',NULL,NULL,'<p>27 и 28 октября город на Неве вновь окутает самая страшная ночь в году! Лишь избранные соберутся в стенах вновь открытого клуба «Сердце» на ежегодный фестиваль тёмной сцены. Музыка будет звучать от заката до рассвета, пока не погаснет последняя свеча. Более 20 групп и DJ, два дня и две ночи, умопомрачительные декорации, ярмарка тёмных мастеров, тематические угощения, фотозоны и фейс арт! Всё это ждёт тех, кто приобщится к нашему ежегодному празднику скорби.<br>Не боишься пережить с нами самый темный уикенд в году? Тогда Добро пожаловать на Самый Страшный Halloween!<br><br>День 1 - 27 октября:<br>Otto Dix<br>Illidiance<br>Repus Tuto Matos<br>Konfirmat<br>Coldleap&nbsp;<br>LandScrona<br>Wooden Rifle<br>Deus Deus O!<br>Void<br>Error<br>Liderk<br><br>День 2 - 28 октября:<br>Roman Rain<br>Dominia<br>Witchcraft<br>Xe-None<br>КРОУ<br>F.O.R.<br>Strong Product<br>Mental Discipline<br>Freaky Mind<br>Vеда<br>DJ Atom<br><br></p>',1700,'',1,6,1,'https://www.infinityconcert.ru/#event/2060507','https://vk.com/ihalloweenspb',false,false,NULL,2,'2023-10-24 17:43:30','2023-10-25 17:41:34',NULL,'','0',18,15),
	 (2247,'HELLOWEEN PARTY','2023-10-28-loft-metamorfoza-helloween-party','2023-10-28',NULL,'19:00:00',NULL,'<p>28 Октября ты проникнешь в заброшенный дом, где Страж предложит тебе сыграть в игру, от которой ты не сможешь отказаться.<br>Он загипнотезирует тебя и увлечет в путешествие, из которого ты уже не сможешь вернуться прежним.<br>Ему помогут 5 проводников в мир танцевальной эйфории и&nbsp; КАЙФА, которые будут держать тебя в тонусе<br>Ты выплеснешь все эмоции и энергию внутри этого дома, поскольку именно этого будет требовать Страж.<br>Дом благословляет тебя к перерождению и новым эмоциям.<br>Тебе придется отдать свою энергию до последней капли, что бы потом вздохнуть полной грудью и восполниться новой.</p><p>ТЫ ГОТОВ К ЭТОЙ ИГРЕ?</p><p>❌БЕЗ АЛКОГОЛЯ&nbsp;<br><br></p>',1000,'',1,87,1,'https://cbiletom.ru/event.php?event=5568','',false,false,NULL,2,'2023-10-25 15:53:37','2023-10-25 16:31:36',NULL,'','0',18,2),
	 (2248,'Senstatic Dance','2023-11-11-motyga-senstatic-dance','2023-11-11','2023-11-26','17:00:00','00:00:00','<p>Это производное от двух слов: <strong>Senses</strong> (чувства) + <strong>Ecstatic dance</strong> (танец в экстазе)</p><p>Мы объединили в одном пространстве чувственные практики и Ecstatic dance, чтобы каждый нашел свой способ исследовать себя и расширять свои чувственные и энергетические границы.</p><p><strong>Ecstatic dance </strong>– это практика свободного танца, без правил и заученных движений, под специально подобранную электронную и живую музыку. Мы добавили к танцам чувственные практики, позволяющие испытать новые ощущения и раскрыть возможности твоего тела.</p><p>Наконец, Senstatic Dance – это пространство общения и знакомства, на языке танца, жестов, прикосновений или тихих слов, с такими же открытыми, свободными и интересными людьми.</p><p><strong>Что тебя ждет:</strong></p><p>▫️Центральный танцпол с одним из лучших Ecstatic DJ-ев Москвы<br>▫️Зона чувственных практик (с мастерами и без раздевания)<br>▫️Сенсорные зоны (на развитие органов чувств)<br>▫️Sense floor (как dance floor, только лёжа и расслаблено)<br>▫️Тантрические круги (для тех, кто хочет в тантру и энергию)<br>▫️Игры на знакомства&nbsp; (для поиска партнеров или друзей)</p><p>Весь вечер ты можешь быть один/одна или в паре, или общаться и знакомиться с другими людьми — комфортно, безопасно и приятно.</p>',6000,'',2,NULL,1,'https://www.senstatic.ru/','https://www.senstatic.ru/',false,false,NULL,2,'2023-10-25 16:03:31','2023-10-25 18:28:40',NULL,'','0',18,2),
	 (2249,'Воскресный Кайф','2023-10-29-rndm-voskresnyi-kaif','2023-10-29','2023-10-29','17:00:00','23:00:00','<p>&nbsp;Очередным Воскресным Кайфом заведует Никита Mysnik, а это значит, что стоит ожидать много веселой румынщины и прочего бодрого минимала на любой вкус.&nbsp;</p>',NULL,'0.0',2,27,1,'','',false,false,NULL,2,'2023-10-25 16:24:30','2023-10-25 16:44:37',NULL,'','0',18,1),
	 (2250,'Underground G','2023-10-28-griboedov-underground-g','2023-10-28',NULL,'23:00:00',NULL,'<p>Мне 6 годиков "вечеринка"<br>6 лет назад я был совсем малышом, но потом научился пить, курить и материться по взрослому!</p>',NULL,'',1,86,1,'','',false,false,NULL,2,'2023-10-25 18:04:00','2023-10-25 18:16:10',NULL,'','0',18,0),
	 (2251,'Halloween - «НОЧЬ СВЯТЫХ»','2023-10-28-bauns-halloween-noc-sviatyx','2023-10-28','2023-10-29','21:00:00','07:00:00','<p>Кошмар на улице Ямского поля!<br><br>В последнюю субботу октября лучшие хип-хоп команды столицы объединятся в ужасающе мощную вечеринку!<br><br>Хедлайнерами «Ночи святых» станут далеко не святые 163ONMYNECK и обворожительная бестия HOFMANNITA. Свежий материал, дерзкие панчи!<br><br></p><p><figure data-trix-attachment="{&quot;contentType&quot;:&quot;image&quot;,&quot;height&quot;:16,&quot;url&quot;:&quot;https://vk.com/emoji/e/f09f9888.png&quot;,&quot;width&quot;:16}" data-trix-content-type="image" class="attachment attachment--preview"><img src="https://vk.com/emoji/e/f09f9888.png" width="16" height="16"><figcaption class="attachment__caption"></figcaption></figure> Приготовьтесь выпустить всех своих демонов этой ночью!</p>',1290,'',2,17,1,'https://gason-event.timepad.ru/event/2639538/','',false,false,NULL,2,'2023-10-25 18:21:16','2023-10-25 18:25:36',NULL,'','0',18,0);
